I[285] = {n:"Wheat Flour",t:52,d:"This flour is obtained by grinding grains of wheat. It is an essential ingredient in the making of bread, pancakes, waffles and delicious cakes, but is mainly used for silly games among children.",ep:1,g:251,l:1,wd:true,fm:true,w:2,p:0};
I[286] = {n:"Baker\'s Yeast",t:48,d:"It\'s an essential ingredient for making bread rise.",ep:1,g:137,l:1,wd:true,fm:true,w:1,p:1};
I[287] = {n:"Sesame Seed",t:58,d:"Extremely rich in protein, this seed is a choice ingredient in the making of tasty bread, but the cultivation of sesame is rather delicate in the Amaknan climate. As a result, it is very rare and expensive.",ep:1,g:3,l:1,wd:true,fm:true,w:1,p:1};
I[288] = {n:"Wild Sunflower Seed",t:58,d:"This protein-rich seed gives a peculiar taste and smell to loaves of bread. The only way to find such a seed is to kill a Wild Sunflower... Well you could always buy one too, I suppose.",ep:1,g:6,l:12,wd:true,fm:true,w:1,p:10};
I[289] = {n:"Wheat",t:34,d:"Since the beginning of time, wheat has been the staple food of Amakna\'s inhabitants and Tofus.",ep:1,g:9,l:1,wd:true,fm:true,w:2,p:0};
