I[298] = {n:"Tofu Sandals",t:11,d:"These sandals are made from the feathers of boiled Tofu and the sole from Tofu beak, a very resistant material. Protracted wearing can render the wearer as daft as a Tofu.",ep:1,g:4,l:1,wd:true,fm:true,w:7,p:100};
I[299] = {n:"Faillette Boots",t:11,d:"Offence is the best defence. With these anti-aggression boots, you will easily send muggers packing. And those guys who come up to you at crossroads and clean your mount\'s teeth.",ep:1,g:8,l:24,wd:true,fm:true,w:30,p:1800};
I[300] = {n:"Poppy Seed",t:58,d:"This seed imparts hallucinogenic properties to bread, ideal for a well-earned brain-holiday after a hard day\'s fighting.",ep:1,g:11,l:5,wd:true,fm:true,w:1,p:1};
I[301] = {n:"Tofu Feather",t:53,d:"Tofu feathers are very magical things - just one kilo of them weighs as much as a kilo of steel!",ep:1,g:14,l:4,wd:true,fm:true,w:1,p:10};
I[302] = {n:"Pumpkin",t:68,d:"Pumpkins grow in fields. They\'re not much bigger than Boowolf testicles, but they certainly taste much better.",ep:4,g:12,l:15,wd:true,fm:true,w:5,p:10};
I[303] = {n:"Ash Wood",t:38,d:"Ash wood is a low-quality wood but it is very common - it grows fast too. It is truly the Starbucks of woods.",ep:1,g:17,l:1,wd:true,fm:true,w:5,p:0};
I[304] = {n:"Gobball Leather",t:56,d:"Tanners use this tough, coarse leather to make cheap boots, belts, masks and even whips. The only drawback is that it smells like rutting Gobball... but maybe you\'re into that kind of thing.",ep:1,g:16,l:9,wd:true,fm:true,w:2,p:1};
I[305] = {n:"Wabbit Tooth",t:47,d:"They might be a bit worn from all that carrot munching malarkey, but Wabbit Teeth are great for making potions thanks to their rejuvenating properties.",ep:8,g:13,l:20,wd:true,fm:true,w:1,p:1};
I[306] = {n:"Evil Dandelion Flower",t:35,d:"This flower loses its toxic properties when properly boiled and dried, and can be consumed in a herbal tea, but it is mainly used to entertain youths in search of romance. Indeed, who has never blown an Evil Dandelion Flower down the neck of a coveted lover? Such beautiful seeds, sweet as the touch of a shaft of sunlight on the dew-damp leaves of a charm tree. Perhaps Iops, who, instead of blowing, tend to suck the seeds and choke miserably in terrible convulsions.",ep:1,g:18,l:5,wd:true,fm:true,w:1,p:10};
I[307] = {n:"Moskito Wings",t:104,d:"These delicate wings have a very distinctive feature - anyone who dares to chew on them will gain spectacular powers of concentration. As a result, they\'re mainly used to make wisdom potions, and if you chew enough, you\'ll be able to spot a misplaced apostrophe on a Wanted notice in Astrub at fifty paces.",ep:1,g:19,l:2,wd:true,fm:true,w:1,p:1};
I[308] = {n:"White Dreggon Shell",t:111,d:"This white shell is nearly unbreakable, but if the best jewellers polish it for generations, they can use its magic properties to make amulets with exceptional powers.",ep:11,g:21,l:64,wd:true,fm:true,w:5,p:1};
I[309] = {n:"Demonic Rose Petal",t:35,d:"These petals are a powerful aphrodisiac and so the ideal present to win over your beloved. Just one thing... it\'s better not to smoke them... It has the opposite effect.",ep:1,g:20,l:6,wd:true,fm:true,w:1,p:10};
I[310] = {n:"Chafer Bone",t:47,d:"This almost unbreakable bone becomes soft in contact with water, which makes things much easier for alchemists.",ep:1,g:15,l:34,wd:true,fm:true,w:5,p:1};
I[311] = {n:"Water",t:15,d:"Water is useful for many things.Make sure it\'s stagnant and cloudy for maximum taste when brewing beer.",ep:1,g:26,l:1,wd:true,fm:true,w:1,p:1};
I[312] = {n:"Iron",t:39,d:"Iron is essential to Blacksmiths and anyone else who works with metal. Some logical creatures even use it for ironing.",ep:1,g:24,l:1,wd:true,fm:true,w:5,p:0};
I[313] = {n:"Gold",t:39,d:"Gold is a rare and precious metal. Thanks to its intrinsic qualities, it is essential to the making of powerful and beautiful weapons.",ep:1,g:22,l:80,wd:true,fm:true,w:5,p:0};
I[315] = {n:"Diamond",t:50,d:"Diamond is the jeweller\'s best friend, but it requires great skill to be worked properly. To find some, you often need to venture into dangerous mines. Good thing diamonds are forever, you wouldn\'t want to be doing that twice a year!",ep:1,g:25,l:50,wd:true,fm:true,w:10,p:5000};
I[316] = {n:"Emerald",t:50,d:"Glowing vivid green, this magnificent jewel can easily transform a frog into a prince, no kissing required.",ep:1,g:23,l:50,wd:true,fm:true,w:10,p:5000};
I[317] = {n:"Small Tabi Staff",t:4,d:"This staff used to be very handy for Amakna breeders who wanted to keep their flocks of Tabis in one place. It doesn\'t actually do much, but it is very light. Great for running after Gobballs.",ep:7,g:6,l:30,wd:true,fm:true,w:1,an:12,e:[5,3,1,1,40,50,false,false],c:"CA>20",p:2650};
I[318] = {n:"Tabi Staff",t:4,d:"This staff used to be very handy for Amakna breeders who wanted to keep their flocks of Tabis in one place. It doesn\'t actually do much, but it is very light. Great for running after Gobballs.",ep:7,g:6,l:34,wd:true,fm:true,w:1,an:12,e:[5,3,1,1,40,50,false,false],c:"CA>20",p:3200};
I[319] = {n:"Great Tabi Staff",t:4,d:"This staff used to be very handy for Amakna breeders who wanted to keep their flocks of Tabis in one place. It doesn\'t actually do much, but it is very light. Great for running after Gobballs.",ep:7,g:6,l:37,wd:true,fm:true,w:1,an:12,e:[5,3,1,1,40,50,false,false],c:"CA>25",p:3750};
I[320] = {n:"Powerful Tabi Staff",t:4,d:"This staff used to be very handy for Amakna breeders who wanted to keep their flocks of Tabis in one place. It doesn\'t actually do much, but it is very light. Great for running after Gobballs.",ep:7,g:6,l:40,wd:true,fm:true,w:1,an:12,e:[5,3,1,1,40,50,false,false],c:"CA>30",p:4300};
I[323] = {n:"Kam Assutra Amulet",t:1,d:"This amulet gives the wearer special abilities: they will be possessed by a mysterious aura, which flows through their bodies and increases their physical abilities tenfold.",ep:1,g:4,l:43,wd:true,fm:true,w:5,p:5000};
I[324] = {n:"Krokette Amulet",t:1,d:"This amulet turns pink when you\'re feeling perky. Rumour has it that it also increases tenfold your chances of finding good items.",ep:1,g:7,l:6,wd:true,fm:true,w:5,p:300};
I[325] = {n:"Sram Amulet",t:1,d:"Hand-made by one of the greatest Sram jewellers, this amulet is made of small skulls carved in bone, helping its wearer escape perilous situations.",ep:1,g:3,l:2,wd:true,fm:true,w:5,p:200};
I[326] = {n:"Deulegarnoulle Amulet",t:1,d:"The Deulegarnoulle amulet comes from the Nordic regions... It\'ll increase your summoning powers.",ep:1,g:2,l:33,wd:true,fm:true,w:4,p:3000};
I[327] = {n:"Karne Rider Blade",t:6,d:"This blade was first forged for the Karne Riders, but it was unfortunately too heavy for those weak goblins. \nIt\'s a very light weapon for normal beings, however, light enough to deliver rapid blows in succession.",ep:1,g:3,l:16,wd:true,fm:true,w:25,an:14,e:[5,5,1,1,50,20,false,false],c:"CS>32",p:900};
I[328] = {n:"Slash",t:6,d:"This strange double-bladed sword was originally used to prune trees and cut through dense forests. The lumberjacks soon realised that it was also an excellent weapon against other creatures.",ep:1,g:4,l:18,wd:true,fm:true,w:28,an:14,e:[6,5,1,1,20,60,false,false],c:"CS>36",p:1050};
I[329] = {n:"The Arc de Triomphe",t:2,d:"As its name indicates, this bow will help you on your path to consistent victory. A skilled Cra architect without an ounce of imagination later stole the same name for one of his monuments.",ep:7,g:11,l:30,wd:true,fm:true,w:15,an:10,tw:true,e:[10,4,2,10,30,50,false,true],c:"CA>30&CC>5&CS>10",p:1950};
I[331] = {n:"Rain Bow",t:2,d:"This is the bow of choice in the region. From what people say, you\'ll find treasure where its arrows fall. You have to make sure you fire them towards the end of a rainbow, but I still think it\'s crazy.",ep:7,g:16,l:22,wd:true,fm:true,w:19,an:10,tw:true,e:[10,5,2,11,30,50,false,true],c:"CA>22&CC>15",p:1500};
I[332] = {n:"Joan\'s Bow",t:2,d:"Joan was a little crazy, always hearing Tabis burping she said... They confiscated her bow - for her own good, mind you - and finally decided to burn her at the stake altogether. She burnt great, she did, something else... And I\'ve seen a few burnings, me... I still have her singed kneecap if you want... come... hey! Where... ahhhh!",ep:7,g:15,l:30,wd:true,fm:true,w:23,an:10,tw:true,e:[10,4,2,9,30,50,false,true],c:"CS>10&CA>30",p:2550};
I[333] = {n:"Ber Ed Stick",t:3,d:"Originally made to be eaten, this baguette became a fearsome weapon when Xavier the Baker left it in his furnace for 234 years. Why did leave it so long? He had enough of making cheese sandwiches, and started doling out knuckle sandwiches to the monsters around the bakery. In his enjoyment, he forgot all about it.",ep:3,g:9,l:50,wd:true,fm:true,w:1,an:11,e:[5,3,3,5,50,50,false,true],c:"CW>40&CI>100",p:6650};
I[334] = {n:"Liriel\'s Wand",t:3,d:"This wand once belonged to Lirel, an Eniripsa who died of an overdose of strawberries, after losing his wings in a pain so excruciating that your heart would stop beating if I told you any more. Collectors are surprisingly desperate to get hold of this wand, given that it\'s said to be cursed.",ep:7,g:5,l:20,wd:true,fm:true,w:13,an:11,e:[5,5,2,3,50,50,false,true],c:"CI>40",p:1300};
I[335] = {n:"Magus Bwork Staff",t:4,d:"Without their staff, the Magus Bworks are as harmless as Tofus. Need I say more about the power of this weapon?",ep:7,g:1,l:58,wd:true,fm:true,w:28,an:12,e:[5,3,1,1,30,50,false,false],c:"CI>58&CA>20",p:8900};
I[336] = {n:"Gwandpa Wabbit\'s Staff",t:4,d:"This staff can levitate Cawwots! Mind you, that\'s not very useful in a fight, it has to be said.",ep:8,g:1,l:32,wd:true,fm:true,w:1,an:12,e:[5,2,1,1,30,50,false,false],c:"CI>32&CA>10",p:2900};
I[337] = {n:"Bwork Archer Bow",t:2,d:"The Bwork Archer Bow is extremely simple to use. It was designed with the Bwork Archers in mind... A bloody Tofu could use it... The catch is that you have to be as strong as a Crackler to string it.",ep:7,g:4,l:20,wd:true,fm:true,w:20,an:10,tw:true,e:[10,5,2,7,30,50,false,true],c:"CS>20&CA>20",p:1300};
I[338] = {n:"Little Bwork Blade",t:6,d:"This basic sword can usually be handled even by the most idiotic of Bworks, that is to say the ones who are incapable of using a bow or a staff... Some of these geniuses even mistake the blade for the handle. The tradition in this case is for the Bwork to poke its own eyes out with its fingers... Lovely!",ep:1,g:13,l:21,wd:true,fm:true,w:30,an:14,e:[5,5,1,1,50,30,false,false],c:"CS>42",p:1400};
I[339] = {n:"Chafer Blade",t:6,d:"This Blade once belonged to Metzger the Butcher, who used it to cut up bones. A Chafer managed to steal it from him and in his hands, the blade became a fearsome weapon. Whole families of shoe salesmen went out of business, not to mention the glove trade... just terrible.",ep:1,g:5,l:27,wd:true,fm:true,w:20,an:14,e:[20,6,1,1,15,60,false,false],c:"CS>54&CC>10",p:2100};
I[340] = {n:"Leurnettes",t:5,d:"These daggers allow you to steal anything and everything, anything from everyone, or everything from anyone, or everyone from any...no that doesn\'t work... They\'re great, though.",ep:1,g:9,l:12,wd:true,fm:true,w:15,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>12",p:600};
I[341] = {n:"Eurfolles Daggers",t:5,d:"These legendary daggers are a true collector\'s item for any self-respecting Sram. They are so revered that even some of these rats refuse to steal them.",ep:7,g:10,l:46,wd:true,fm:true,w:10,an:13,e:[10,2,1,1,30,50,false,false],c:"CA>46",p:5600};
I[342] = {n:"Birming Hammer",t:7,d:"This very special hammer was made of Kwak beaks. That\'s why it\'s so prickly when it knocks you head over heels!",ep:5,g:12,l:18,wd:true,fm:true,w:1,an:15,e:[5,4,1,1,50,30,false,false],c:"CI>12&CS>6",p:1100};
I[345] = {n:"Small Pushn Shovel",t:8,d:"An Enutrof builder who had had a few drinks too many at the tavern realised one night that this shovel could do more than dig holes in the ground.",ep:1,g:8,l:25,wd:true,fm:true,w:40,an:16,e:[5,4,1,1,40,40,false,false],c:"CS>5&CC>20",p:1900};
I[346] = {n:"Ano Rak Ring",t:9,d:"According to some legends, this ring protects against bad weather. In reality, this has never been proven because it has never rained in Amakna.",ep:1,g:34,l:17,wd:true,fm:true,w:4,p:1000};
I[347] = {n:"Golden Rhizome",t:8,d:"This shovel is a very efficient tool for cutting nutsedge, a type of weed. It\'s also an excellent weapon for taking care of the weeds you\'ll find in the inns of Amakna.",ep:1,g:10,l:40,wd:true,fm:true,w:30,an:16,e:[10,4,1,1,50,50,false,false],c:"CS>10&CC>30",p:4400};
I[348] = {n:"Celery-Tea\'s Boots",t:11,d:"These boots once belonged to a cook who was always in a big rush. He spent his time criss-crossing the land of Amakna looking for celery-tea.",ep:2,g:5,l:53,wd:true,fm:true,w:20,p:6700};
I[350] = {n:"Silver",t:39,d:"Silver is bright, pure and much coveted by discerning jewellers. Contrary to the myth spread round by the unscrupulous Miners\' Association, it has no particular effect on vampires. Unless they\'re miserly vampires... Or artistic vampires... Do vampires make jewellery? It doesn\'t... say... here... Anyway, if it\'s a really nasty vampire who\'s only out for blood, who has a good job... damn. Do vampires work... Look, just sell the bloody thing or something.",ep:1,g:28,l:60,wd:true,fm:true,w:5,p:0};
I[351] = {n:"Amakna Beer",t:37,d:"This beer will give you back some of your precious health points. Let\'s not forget the old saying, though - \'Sometimes you drink your drink and sometimes your drink drinks you.\'",ep:2,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:2};
I[352] = {n:"Small Holy Sword",t:6,d:"A holy sword awarded to young warriors during their training.",ep:1,g:1,l:13,wd:true,fm:true,w:30,e:[5,4,1,1,50,50,false,false],c:"CS>26&CV>5",p:700};
I[353] = {n:"Little Knight Sword",t:6,d:"The Little Knight Sword is an efficient and sturdy sword. Properly used, it can inflict serious damage upon your enemies.",ep:7,g:9,l:21,wd:true,fm:true,w:30,an:14,e:[4,5,1,1,30,30,false,false],c:"CS>42",p:1400};
I[354] = {n:"The Klebik",t:6,d:"This kind of sword is forged for the bodyguards of a renowned and wealthy shopkeeper. Its main use consists of frightening thieves but when murder is required - a tenacious burglar, a fussy customer - you\'ll find it equal to the task.",ep:1,g:11,l:25,wd:true,fm:true,w:20,e:[12,4,1,1,30,60,false,false],c:"CS>50&CW>5",p:1850};
I[355] = {n:"Valuable Ring",t:9,d:"This ring increases strength and courage.",ep:1,g:7,l:12,wd:true,fm:true,w:4,p:600};
I[356] = {n:"Stamina Belt",t:10,d:"This simple belt increases stamina.",ep:1,g:3,l:27,wd:true,fm:true,w:16,p:2200};
I[357] = {n:"The Tail",t:6,d:"This sword symbolizes a body part Ecaflips of which Ecaflips are particularly proud. If you don\'t feel it\'s hypocrisy to take it, be my guest.",ep:1,g:18,l:13,wd:true,fm:true,w:20,an:14,e:[20,4,1,1,15,15,false,false],c:"CS>26&CA>10",p:650};
I[358] = {n:"The Infernal Tail",t:6,d:"The Infernal Tail is really... infernal. If you don\'t use it properly, it will drive your enemies and team mates completely crazy... before long, you won\'t have any team mates left, just enemies. Nobody has ever been known to use it properly, so, well, you\'ve been warned.",ep:1,g:18,l:21,wd:true,fm:true,w:20,an:14,e:[20,4,1,1,15,15,false,false],c:"CS>42&CA>10",p:1400};
I[359] = {n:"Ecalisor",t:9,d:"A long time ago, King Allister Snoc gave this ring to Isidor, a smart cat, renowned for his incomparable agility.",ep:1,g:35,l:29,wd:true,fm:true,w:3,p:2400};
I[360] = {n:"Tiwabbit Ears",t:106,d:"Once boiled, these small, hairy, brown ears give off a smell of dead Boowolf. A true delight when stuffed with royal jelly.",ep:8,g:30,l:11,wd:true,fm:true,w:1,p:10};
I[361] = {n:"Cawwot",t:68,d:"It\'s the only food a Tiwabbit Wosungwee can eat, which is as good an excuse as any for its severe retardation.",ep:2,g:31,l:20,wd:true,fm:true,w:1,p:2};
I[362] = {n:"Blue Larva Skin",t:59,d:"This delightfully smooth skin is an excellent ingredient for magic potions.",ep:1,g:32,l:2,wd:true,fm:true,w:1,p:2};
I[363] = {n:"Orange Larva Skin",t:59,d:"This delightfully smooth skin is an excellent ingredient for magic potions.",ep:1,g:33,l:9,wd:true,fm:true,w:1,p:2};
I[364] = {n:"Green Larva Skin",t:59,d:"This delightfully smooth skin is an excellent ingredient for magic potions.",ep:1,g:34,l:7,wd:true,fm:true,w:1,p:100};
I[365] = {n:"Arachnee Leg",t:103,d:"In spite of its magical properties, this thin, hairy leg is in short supply - alchemists use it to pat their faces after shaving and never have enough left to sell... Like my mother always said... Don\'t get dry off your own supply.",ep:1,g:35,l:2,wd:true,fm:true,w:1,p:10};
I[366] = {n:"Tofu Beak",t:47,d:"Don\'t trust the ridiculously tiny appearance of this Tofu beak, it\'s well-sharpened. The archers of Amakna have used them as arrow heads since the beginning of time.",ep:1,g:37,l:4,wd:true,fm:true,w:1,p:2};
I[367] = {n:"Tofu Egg",t:105,d:"This egg smells as if it\'s rotten the second it comes rolling out of the hen\'s behind. Imagine what it smells like when it is actually rotten.",ep:1,g:38,l:4,wd:true,fm:true,w:1,p:1};
I[368] = {n:"Strawberry Jelly",t:110,d:"Many greedy adventurers were dreadfully sick because of this delicious Jelly. There\'s a saying that goes " + "\"" + "everything is poison, nothing is poison, it\'s the dose that matters" + "\"" + ". In the case of the Strawberry Jelly, avoid the overdose.",ep:5,g:40,l:28,wd:true,fm:true,w:1,p:100};
I[369] = {n:"Mint Jelly",t:110,d:"Many greedy adventurers were dreadfully sick because of this delicious Mint Jelly. Eaten in moderation, to ease your bad breath for example, it will have soothing properties on the morale of your troops.",ep:5,g:41,l:10,wd:true,fm:true,w:1,p:100};
I[370] = {n:"Royal Bluish Jelly",t:110,d:"This delicious jelly is the result of the digestion and fermentation of honey by a Royal Jelly. Inedible in its raw state, it\'s nevertheless an ingredient of choice for sweets.",ep:7,g:407,l:50,wd:true,fm:true,w:1,p:100};
I[371] = {n:"Moskito Brow",t:15,d:"The Moskito has long, thin eyebrows that set off its irresistible good looks perfectly. Because it is so sensitive, these brows are often drenched with tears of unknown properties.",ep:1,g:44,l:1,wd:true,fm:true,w:1,p:1};
I[372] = {n:"Black Tiwabbit Headband",t:15,d:"This headband gives the appearance of a fierce warrior to the Black Tiwabbit who wears it. The Wabbit Wambo is apparently behind this custom of wearing a headband.",ep:8,g:29,l:11,wd:true,fm:true,w:1,p:2};
I[373] = {n:"Evil Dandelion Stem",t:36,d:"This stem, as flexible and solid as a teachers cane, is THE choice material in the making of whips and other disciplinary implements, which are essential in the successful upbringing of children and to a healthy, open relationship between consenting adults...",ep:1,g:45,l:6,wd:true,fm:true,w:1,p:10};
I[374] = {n:"Evil Dandelion Tongue",t:36,d:"The green colour of this Evil Dandelion Tongue is due to its excessive consumption of mint jelly... Can you imagine how much jelly you have to eat to turn that colour?",ep:1,g:555,l:5,wd:true,fm:true,w:1,p:2};
I[375] = {n:"Evil Tofu Tooth",t:47,d:"The Evil Tofu swapped its ridiculous little beak for ridiculous big teeth. It\'s hard to know which one is the more dangerous.",ep:1,g:47,l:3,wd:true,fm:true,w:1,p:1};
I[376] = {n:"Evil Tofu Wing",t:104,d:"This tiny, ridiculous wing is not very useful to the Evil Tofu... the only thing it does do is blow hot air to knock Moskitoes off balance.",ep:1,g:48,l:3,wd:true,fm:true,w:1,p:1};
I[377] = {n:"Mush Mush Thorn",t:15,d:"This venomous thorn protects the Mush-Mush in close combat, but, tragically, also means the creature cannot give hugs without killing the hugee. For more important matters, the Mush-Mush uses sporm, which he fires to his partner from far away.",ep:1,g:49,l:5,wd:true,fm:true,w:1,p:1};
I[378] = {n:"Mush Mush Sporm",t:15,d:"This sporm is the " + "\"" + "precious seed" + "\"" + " that allows the Mush-Mush to scatter its angry mob wherever it wants, which is everywhere, basically. Be careful, however, as smelly feet and the smell of Bowisse\'s Boots attracts the sporms.",ep:1,g:50,l:5,wd:true,fm:true,w:1,p:1};
I[379] = {n:"Crab Pincer",t:47,d:"The Crab claw is like a deadly, unbreakable peacock feather... a great source of pride to its previous owner.",ep:1,g:51,l:4,wd:true,fm:true,w:1,p:1};
I[380] = {n:"Wild Mint Leaf",t:36,d:"This is the staple food of Green Jelly, so if you smell mint, don\'t get the teacups out right away...",ep:1,g:52,l:30,wd:true,fm:true,w:1,p:0};
I[381] = {n:"Strawberry",t:46,d:"Strawberries are the Strawberry Jelly\'s staple food. Don\'t get too excited at the thought of these delicious red fruits if you smell strawberry, it\'s likely that you\'ve simply stumbled into a Strawberry Jelly\'s hunting ground.",ep:7,g:53,l:28,wd:true,fm:true,w:1,p:1};
I[382] = {n:"Karne Rider Nail",t:47,d:"This dirty nail, which has been dragged about everywhere, was rescued from the streets. It\'s up to you to give the appendage a second chance.",ep:3,g:54,l:16,wd:true,fm:true,w:1,p:1};
I[383] = {n:"Gobball Horn",t:47,d:"Gobball Horns are as shiny and soft as fresh-tanned leather. For some unknown reason, Osamodas love them...",ep:1,g:55,l:9,wd:true,fm:true,w:1,p:1};
I[384] = {n:"Gobball Wool",t:57,d:"This thick wool smells like Bwork BO, which is understandable as it is very warm. What\'s more, it\'s hypoallergenic, and so it greatly favoured by Eniripsas for this very reason.",ep:1,g:56,l:9,wd:true,fm:true,w:1,p:1};
I[385] = {n:"Gobball Saliva",t:15,d:"This infection-ridden slobber smells so bad because Gobballs never stop licking their filthy wool, which also gives Gobballs atrociously bad breath. A vicious circle.",ep:1,g:57,l:9,wd:true,fm:true,w:1,p:1};
I[386] = {n:"Boar Snout",t:15,d:"This snout is an essential tool for sniffing out acorns in the undergrowth. Unlike the Dragon Pig\'s snout, this one isn\'t eaten - it has a disgusting stench.",ep:1,g:58,l:14,wd:true,fm:true,w:1,p:1};
I[387] = {n:"Boar Tusk",t:47,d:"This tusk allows the Boar to protect itself from enemies and, if required, to pick its snout... So don\'t forget to clean it with warm spring water before grinding it down into a fine powder.",ep:1,g:59,l:14,wd:true,fm:true,w:1,p:1};
I[388] = {n:"Boar Hair",t:54,d:"Boar hairs are naturally tapered and so ideal for the making of brushes and brooms. Some people develop serious allergies to boar hair, so always rub softly and infrequently.",ep:1,g:60,l:14,wd:true,fm:true,w:1,p:1};
I[389] = {n:"Wild Sunflower Oil",t:60,d:"This Oil is highly recommended by dieticians because of its high proportion of essential, unsaturated and polyunsaturated fatty acids...",ep:1,g:61,l:12,wd:true,fm:true,w:1,p:100};
I[390] = {n:"Walnut Oil",t:60,d:"Because of its fruity flavour and its low proportion of saturated fatty acids, Walnut Oil is essential in pastry-making and for flavouring cakes. It can be kept in a closed bottle for a few days only.",ep:4,g:62,l:32,wd:true,fm:true,w:1,p:100};
I[391] = {n:"Cashew Nut",t:58,d:"When harvested, unripe Cashew Nuts can be used to make oil. Once dried, they\'re also used as toys by simple-minded Iop children.",ep:4,g:63,l:32,wd:true,fm:true,w:1,p:10};
I[392] = {n:"Pecan Nut",t:58,d:"Pecan Nuts can be used to make oil but it\'s better to consume them dried if you\'d rather not suffer their laxative properties.",ep:4,g:64,l:32,wd:true,fm:true,w:1,p:10};
I[393] = {n:"Acorn",t:58,d:"Boars love acorns and almost everyone everywhere wonders why. Hey... that could be a haiku.",ep:1,g:65,l:14,wd:true,fm:true,w:1,p:10};
I[394] = {n:"Hazelnut",t:58,d:"An Eniripsa doctor made it his regular habit to stop off at a bar in Bonta for a hazelnut daiquiri on his way home from work. One afternoon, the bartender was dismayed to find that he was out of hazelnut extract. Thinking quickly, he threw together a daiquiri made with hickory nuts and set it on the bar. The Eniripsa came in at his regular time, took one sip of the drink and exclaimed, " + "\"" + "This isn\'t a hazelnut daiquiri!" + "\"" + " " + "\"" + "No, I\'m sorry" + "\"" + ", replied the bartender, " + "\"" + "it\'s a hickory daiquiri, doc." + "\"" + "",ep:1,g:66,l:14,wd:true,fm:true,w:1,p:1};
I[395] = {n:"Five-Leaf Clover",t:36,d:"This clover is a staple of the Tabis\' diet. Nevertheless, breeders are wary of it because of the devastating flatulence it unleashes upon their livestock.",ep:1,g:67,l:20,wd:true,fm:true,w:1,p:0};
I[396] = {n:"Palm Oil",t:60,d:"Thanks to its delicate taste and aroma, this Oil is suitable for any kind of culinary challenge; from frying food to making French dressing.",ep:3,g:68,l:32,wd:true,fm:true,w:1,p:100};
I[397] = {n:"Oilbow Grease",t:60,d:"This rare type of oil is what we call a mechanical elixir - it lubricates cogs and hinges so well that it only needs to be applied once. A guy by the name of Billy Wanka tried to make everlasting chewing gum with it once, but many, many children perished. Keep it for your hinges.",ep:4,g:69,l:32,wd:true,fm:true,w:1,p:100};
I[398] = {n:"Palm Fruits",t:46,d:"This strange fruit produces a refined oil when squeezed. What a pity you can\'t squeeze it because of its shell which is as hard as the sole of Bowisse\'s Boots.",ep:3,g:81,l:32,wd:true,fm:true,w:1,p:10};
I[399] = {n:"Sesame Oil",t:60,d:"Sesame Oil is obtained from sesame seeds and can be distinguished from the others by its rich and delicate taste... toasted hazelnuts I would say. The only problem is that it smells like grilled Gobball.",ep:1,g:71,l:1,wd:true,fm:true,w:1,p:100};
I[400] = {n:"Barley",t:34,d:"If you stare for too long at a Barley plant, you\'ll begin to see minute flaws in its leaves and its stem. Enraged by these imperfections, you\'ll write a letter to King Allister demanding that something be done about them, and not even a Consolation Drop will calm your ire.",ep:1,g:82,l:10,wd:true,fm:true,w:2,p:0};
I[401] = {n:"Hop",t:34,d:"The flower of the female Hop plant contains all of the active ingredients used in brewing, such as bitter resins and essential oils. The flower of the male Hop plant isn\'t useful for anything, other than scattering pollen all over the place.",ep:1,g:80,l:30,wd:true,fm:true,w:2,p:0};
I[405] = {n:"Malt",t:34,d:"The name given to germinated Barley, the most important ingredient in quality beer. Be careful with Malt, it has an enormous capacity for absorbing beer in its germination phase... just like Tot after a hard day hunting Tofus.",ep:1,g:83,l:60,wd:true,fm:true,w:2,p:0};
I[406] = {n:"Wo Wabbit Stomach",t:15,d:"The main feature of this stomach is that it can easily distend. This greatly simplifies the Wo Wabbit\'s digestive problems caused by its excessive drinking of fermented Cawwot liquor.",ep:8,g:146,l:39,wd:true,fm:true,w:1,p:10};
I[407] = {n:"Prespic Peak",t:47,d:"Nothing\'s better than a Prespic peak for picking your teeth or creating a new arrow point.",ep:1,g:134,l:18,wd:true,fm:true,w:1,p:50};
I[408] = {n:"Elite Chafer Dentures",t:47,d:"Elite Chafers\' teeth are ruined by too much drinking, which is why they use dentures. These dentures cost a fortune because the teeth are made from gold and the foetid breath of Elite Chafers endows said gold with unpredictable powers.",ep:9,g:129,l:43,wd:true,fm:true,w:1,p:50};
I[409] = {n:"Magus Bwork Beard Hairs",t:54,d:"For obscure reasons, these red hairs smell very bad when it\'s raining. The Bwork Magi take advantage of their magic powers nevertheless, which could be of interest to some alchemists.",ep:4,g:131,l:23,wd:true,fm:true,w:1,p:20};
I[410] = {n:"Magus Bwork Book",t:25,d:"This book is a true collector\'s item. It\'s a source of inspiration and sturdiness for the Bwork Magus. Each page conceals numerous secrets about the anatomy of Amakna\'s creatures.",ep:4,g:130,l:1,wd:true,fm:true,w:1,p:100};
I[411] = {n:"Ice Kwak Beak",t:47,d:"Thanks to its extraordinarily strong beak, the Ice Kwak can dig holes in the ice. No one knows why it does this, though. Ahh yes, Ice Kwaks are strange creatures, there\'s no doubt about it.",ep:1,g:133,l:24,wd:true,fm:true,w:1,p:20};
I[412] = {n:"Fire Kwak Beak",t:47,d:"Thanks to its extraordinarily strong beak, the Fire Kwak can put out embers, just  for the pleasure of putting out embers. Fire Kwaks are really strange, there\'s no doubt about it.",ep:5,g:132,l:24,wd:true,fm:true,w:1,p:20};
I[413] = {n:"Wind Kwak Beak",t:47,d:"Thanks to its extraordinarily strong beak, the Wind Kwak can fly into a window without being knocked out, just for the pleasure of flying into a window without being knocked out. Wind Kwaks are really strange, there\'s no doubt about it.",ep:5,g:110,l:24,wd:true,fm:true,w:1,p:20};
I[414] = {n:"Ice Kwak Feather",t:53,d:"A distinctive feature of this feather is that it is resistant to frost. That\'s why you never see an Ice Kwak shiver.",ep:1,g:112,l:24,wd:true,fm:true,w:1,p:20};
I[415] = {n:"Fire Kwak Feather",t:53,d:"A distinctive feature of this feather is that it resists flames. That\'s why Fire Kwaks don\'t burn.",ep:5,g:111,l:24,wd:true,fm:true,w:1,p:20};
I[416] = {n:"Wind Kwak Feather",t:53,d:"A distinctive feature of this feather is that it resists gusts of wind. That\'s why you never see Wind Kwaks get blown inside out like an umbrella.",ep:5,g:113,l:24,wd:true,fm:true,w:1,p:20};
I[417] = {n:"Mushd Mud",t:15,d:"The aggressive Mushd is composed of many pieces of mud put together. The only way to get the better of it is to dry it out. Which is difficult considering its state of humidity.",ep:2,g:116,l:17,wd:true,fm:true,w:1,p:1};
I[418] = {n:"Gwandpa Wabbit Beard Hairs",t:54,d:"Gwandpa Wabbit has a foul-smelling false beard, just like Fathew Chwistmas, but worse. As he is constantly dribbling in front of  Gwandma Wabbit, the hairs of his beard are impregnated with the underestimated powers of his dribble.",ep:8,g:114,l:39,wd:true,fm:true,w:1,p:100};
I[419] = {n:"Gwandpa Wabbit Ears",t:106,d:"These ears are pointed, rigid and covered with beautiful thick striped fur. It\'s unquestionably some exquisite fur, mainly because it\'s odourless.",ep:8,g:115,l:39,wd:true,fm:true,w:1,p:1};
I[420] = {n:"Flax String",t:15,d:"With this very sturdy flax string, you can choose to either make nice, solid seams or to bind your friends\' hands and feet to show them who the real guild leader is.",ep:1,g:118,l:1,wd:true,fm:true,w:1,p:10};
I[421] = {n:"Flax Flower",t:35,d:"The Flax Flower can either be blue or white, according to when the seed is sown. Sipped as an infusion, it endows an uncommon feeling of well-being.",ep:1,g:117,l:1,wd:true,fm:true,w:1,p:0};
I[422] = {n:"Flax Seed",t:58,d:"This minute seed contains lots of goodness and plenty of flavour. Kwak hunters use these glistening seeds to lure the dozy creatures into traps.",ep:1,g:119,l:1,wd:true,fm:true,w:2,p:1};
I[423] = {n:"Flax",t:34,d:"There\'s nothing special about the Flax Stem except that it is able to return to its original shape after bending up 7 times. And so this fibre is equally flexible.",ep:1,g:122,l:40,wd:true,fm:true,w:2,p:0};
I[424] = {n:"Flax Fibre",t:55,d:"This is the Fibre they use to make the finest of cloth... Being quite rare, the stuff is expensive, but always popular with the weavers.",ep:13,g:120,l:46,wd:true,fm:true,w:1,p:1};
I[425] = {n:"Hemp",t:34,d:"The Hemp Stem can be used for research into hallucinations. But it is also used in construction where it serves a very different purpose.",ep:1,g:121,l:70,wd:true,fm:true,w:2,p:0};
I[426] = {n:"Hemp Fibre",t:55,d:"This fibre is less beautiful than resistant but it can be smoked in your quiet moments of introspection.",ep:13,g:123,l:46,wd:true,fm:true,w:1,p:1};
I[427] = {n:"Hemp Seed",t:58,d:"Hemp Seed is used to calm down herds of Tabis during the rutting season. All you need to do is toss these seeds on their grazing ground and they\'ll instantly become less savage.",ep:1,g:157,l:10,wd:true,fm:true,w:1,p:10};
I[428] = {n:"Hemp Flower",t:35,d:"This flower is used to make potions with random effects! These effects range from general paralysis to invulnerability to Flatulence of the Wabbit, an old personal favourite.",ep:1,g:156,l:10,wd:true,fm:true,w:1,p:0};
I[429] = {n:"Bwork Archer Arrow Head",t:15,d:"This rusty arrow head is made from a rare metal that is only found on these arrow heads.",ep:4,g:125,l:24,wd:true,fm:true,w:1,p:1};
I[430] = {n:"Invisible Chafer Bone",t:47,d:"This Bone is invisible thanks to its special properties. It must have some use in the making of magic potions.",ep:1,g:126,l:23,wd:true,fm:true,w:1,p:20};
I[431] = {n:"Crackler Stone",t:51,d:"This stone is almost alive, it draws life from the precious stones it contains. Nobody can break it except a Crackler. It\'ll make a great stone hammer.",ep:2,g:127,l:31,wd:true,fm:true,w:5,p:1};
I[432] = {n:"Rib Chops",t:47,d:"Grilled Rib Chops are absolutely delicious, but there\'s not much meat on them...",ep:3,g:158,l:33,wd:true,fm:true,w:1,p:100};
I[433] = {n:"Chafer Archer Thighbone",t:47,d:"This is a really strange bone... If you crumble it into dust, you can use it for curry powder. Seriously, just add water and hey presto... curry! I know a few unscrupulous chefs who\'ll be delighted to hear the news.",ep:1,g:101,l:34,wd:true,fm:true,w:1,p:100};
I[434] = {n:"Treechnid Bark",t:96,d:"This piece of bark is rough, cracked, covered with small bumps and smells strangely good, just like the heel of an Enutrof\'s foot.",ep:1,g:103,l:32,wd:true,fm:true,w:1,p:1};
I[435] = {n:"Treechnid Root",t:98,d:"This piece of root has gained a lot of experience accompanying the Treechnid through the undergrowth. That still doesn\'t explain why it\'s magic.",ep:1,g:102,l:32,wd:true,fm:true,w:1,p:1};
I[436] = {n:"Treechnid Root Staff",t:4,d:"This staff is carved out of a huge Treechnid root, and its main use is in close combat. The only problem for the owner is that its roots regenerate  when in contact with water... That includes rain, by the way.",ep:1,g:1,l:30,wd:true,fm:true,w:1,an:12,e:[5,2,1,1,20,50,false,false],c:"CI>30&CC>5",p:2650};
I[437] = {n:"Treechnid Bud",t:108,d:"During puberty, Treechnids are covered with ugly buds full of juicy sap and rich in vitamins. Later, these buds will give birth to new shoots which will give birth to buds.",ep:1,g:104,l:32,wd:true,fm:true,w:1,p:1};
I[438] = {n:"Boowolf Tail",t:65,d:"The Boowolf Tail is so similar to a big mossy log that you just can\'t tell them apart. That\'ll only add to your manic paranoia, I know, but you\'re better off knowing, believe me.",ep:1,g:105,l:70,wd:true,fm:true,w:1,p:50};
I[439] = {n:"Boowolf Canine",t:47,d:"This sharpened tooth is above all prized as a lucky charm. If this is true, lady luck must have a very poor sense of smell.",ep:1,g:106,l:70,wd:true,fm:true,w:1,p:1};
I[440] = {n:"Boowolf Claw",t:15,d:"This filthy claw is used to make fearsome weapons.",ep:1,g:107,l:70,wd:true,fm:true,w:1,p:1};
I[441] = {n:"Copper",t:39,d:"Copper is great for making cheap weapons...it\'s could almost be a substitute for gold... Except it\'s soft, light, reacts with air, discolours quickly...",ep:1,g:108,l:10,wd:true,fm:true,w:5,p:0};
I[442] = {n:"Bronze",t:39,d:"This metal is often used in the making of decorative items. It\'s ideal for beautifying your weapons on the cheap.",ep:1,g:109,l:20,wd:true,fm:true,w:5,p:0};
I[443] = {n:"Cobalt",t:39,d:"The name " + "\"" + "Cobalt" + "\"" + " means " + "\"" + "Devil\'s Copper" + "\"" + " in ancient Sadida. It\'s suited to the forging of light and stylish - but lethal - weapons.",ep:1,g:77,l:30,wd:true,fm:true,w:5,p:0};
I[444] = {n:"Tin",t:39,d:"Tin is a soft and heavy metal, a bit like the Wo Wabbit but worse.",ep:1,g:78,l:50,wd:true,fm:true,w:5,p:0};
I[445] = {n:"Manganese",t:39,d:"Contrary to general opinion, this metal is not used to make gutters but terrifying weapons such as the " + "\"" + "Manganesian Sharp" + "\"" + "... This implement has bumped off more than a few Tofus at the Bulgur Festivals.",ep:1,g:397,l:40,wd:true,fm:true,w:5,p:0};
I[446] = {n:"Bauxite",t:39,d:"When properly sharpened, this metal is much appreciated for its silver colour and sharpness.",ep:1,g:76,l:70,wd:true,fm:true,w:5,p:0};
I[447] = {n:"Coal",t:39,d:"Coal has no particular magic properties, despite what you might think. However, it does attract lightning, stores it and worst of all, always frees it at the worst possible time.",ep:5,g:75,l:1,wd:true,fm:true,w:5,p:0};
I[448] = {n:"Flint",t:51,d:"This sharp stone has cut the throat of more than one careless mole.",ep:1,g:74,l:22,wd:true,fm:true,w:5,p:1};
I[449] = {n:"Ebony Wood",t:38,d:"This wood owes its name to a misunderstanding... A family of lumberjacks living in this forest had a daughter named Bonnie. Bonnie was the only one who knew where to find a rather special type of tree and so this wood was named after her: " + "\"" + "Bonnie Wood" + "\"" + ". Time and poor spelling finally produced the name " + "\"" + "Ebony Wood" + "\"" + ".",ep:7,g:73,l:70,wd:true,fm:true,w:5,p:0};
I[450] = {n:"Granite Stone",t:51,d:"This heavy mineral doesn\'t wear or bend, which limits its usefulness to blacksmiths. It is only in working it for a long period that you will manage to extract some precious stones from it.",ep:1,g:1,l:30,wd:true,fm:true,w:20,p:1};
I[454] = {n:"Lumberjack Axe",t:19,d:"This perfectly-forged axe is the perfect gift for lumberjacks who always blame their tools.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,40,40,false,false],p:150};
I[455] = {n:"Hammer of Dawn",t:7,d:"This ridiculously small hammer was used by Zokrim the peasant. Every day at dawn, he would work on his useless, meandering fences which still stretch all over his territory like confused spider webs.",ep:1,g:2,l:26,wd:true,fm:true,w:20,an:15,e:[5,4,1,1,50,30,false,false],c:"CS>10&CI>16",p:2000};
I[456] = {n:"Oak Killer",t:19,d:"This axe enables you to easily cut down trees, even the biggest ones. It is above all appreciated for its heavy weight which can cut a Bwork into three pieces. The only requirement is that you are strong enough to lift it!",ep:7,g:2,l:33,wd:true,fm:true,w:50,an:17,e:[5,4,1,1,40,40,false,false],c:"CS>66&CA>10",p:3150};
I[458] = {n:"Captain Chafer Amulet",t:1,d:"Some say the Chafer is sensitive and distinguished, because his amulet carries the skulls of his dead cousins. Others say he\'s a beastly creature, because it was he who killed them.",ep:1,g:3,l:19,wd:true,fm:true,w:4,p:1200};
I[459] = {n:"Ash Plank",t:95,d:"A Handyman could use this plank to make something delightful - a coffin, for example. Just bear that in mind.",ep:1,g:93,l:1,wd:true,fm:true,w:10,p:10};
I[460] = {n:"Oak Wood",t:38,d:"This high-quality wood is particularly resistant. It\'s ideal for making things like bludgeons, houses or even boats. But its most vital use is for beer barrels...",ep:1,g:92,l:30,wd:true,fm:true,w:5,p:0};
I[461] = {n:"Yew Wood",t:38,d:"The wood of the Yew Tree is very strong and flexible. Consistently voted wood of the year by the bow makers of the region, it\'s also rather difficult to find -  the peasants of Amakna destroy any shoots they see because they\'re poisonous to Gobballs.",ep:1,g:94,l:50,wd:true,fm:true,w:5,p:0};
I[462] = {n:"Treechnid Root Bow",t:2,d:"Though you can kill the Treechnids, their wood never truly dies... this makes it incredibly difficult to work. All the same, killing a Treechnid with an arrow made of the root of one of its brothers will really hit hard, and if they don\'t die, you can be sure it\'ll ruin their lives forever! Good show!",ep:1,g:1,l:28,wd:true,fm:true,w:10,an:10,tw:true,e:[10,4,2,7,30,50,false,true],c:"CS>10&CA>28",p:2250};
I[463] = {n:"Amber",t:50,d:"This magnificent precious stone is made of fossilised tree resin. You can sometimes find a little Moskito inside, trapped for aeons in the sticky sap, which makes the stone even more valuable.",ep:1,g:96,l:32,wd:true,fm:true,w:4,p:20};
I[464] = {n:"Treechnid Amber",t:50,d:"This magnificent gem is made of fossilised treechnid resin. You can sometimes find a little Arachnee trapped inside, caught for aeons in the sticky sap, which was a well-deserved death for that kind of monster.",ep:1,g:97,l:32,wd:true,fm:true,w:5,p:40};
I[465] = {n:"Crystal",t:50,d:"Crystal is translucent and beautiful, but extremely brittle. Such is life, nothing is perfect even with precious stones.",ep:1,g:98,l:50,wd:true,fm:true,w:20,p:5000};
I[466] = {n:"Sapphire",t:50,d:"This precious blue stone is well-adapted to the making of magical weapons, possibly because lazy script writers always use blue to represent mana.",ep:1,g:99,l:50,wd:true,fm:true,w:20,p:5000};
I[467] = {n:"Ruby",t:50,d:"The shimmering glow of this precious stone forces the Fire Kwak\'s feathers to evolve. But it\'s as cold as the Ice Kwak\'s snowballs.",ep:1,g:100,l:50,wd:true,fm:true,w:20,p:5000};
I[468] = {n:"Amaknan Bread",t:33,d:"Soft of texture, golden of crust and hot out of the oven, this small Bread will increase your health points. It\'s the most popular bread and usually the cheapest.",ep:1,g:13,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[469] = {n:"Treechnid Root Wand",t:3,d:"This wand makes use of the magic properties of the Treechnid Root. Beware of the side effects of this living wand, it can sometimes turn against its owner.",ep:1,g:3,l:33,wd:true,fm:true,w:20,an:11,e:[5,4,2,2,50,40,false,true],c:"CI>33&CW>10",p:3100};
I[470] = {n:"Elm Wood",t:38,d:"Once a common type of wood, Elm is now much sought-after. A long time ago, a terrible bewitchment called Grafioze was cast by a powerful Bwork Magus of the worst kind, decimating whole forests of it.",ep:3,g:677,l:90,wd:true,fm:true,w:5,p:0};
I[471] = {n:"Maple Wood",t:38,d:"Maple leaves have inspired people of limited imagination to create a flag, and the syrup adds taste to pancakes. As for maple wood, we still don\'t know what to do with it.",ep:1,g:153,l:40,wd:true,fm:true,w:5,p:0};
I[472] = {n:"Hornbeam Wood",t:38,d:"This wood is known as Hornbeam Wood because Sadidas always sound their horn under its tree. Apparently this helps them mate... Anyway, you can find more information on the subject in the Bwork Magus Book...",ep:1,g:138,l:80,wd:true,fm:true,w:5,p:0};
I[473] = {n:"Chestnut Wood",t:38,d:"The smell of chestnut wood sends flies packing. Well, not so much the flies who like chestnuts... or flies who don\'t have much of a sense of smell... When you think about it, that probably covers most flies...",ep:1,g:86,l:10,wd:true,fm:true,w:5,p:0};
I[474] = {n:"Cherry Wood",t:38,d:"This type of wood is appreciated in the cabinet-making trade because of its dense texture and the brown-reddish colour it acquires with time.",ep:1,g:139,l:60,wd:true,fm:true,w:5,p:0};
I[476] = {n:"Walnut Wood",t:38,d:"Walnut wood is often used in the making of furniture.",ep:1,g:95,l:20,wd:true,fm:true,w:5,p:0};
I[477] = {n:"Dragon Pig Blood",t:15,d:"This phial is full of a blood which used to confer evil powers to the Dragon Pig. To be drunk in moderation or used as an ingredient of the Dragon Pig black pudding, if you like it, of course!",ep:2,g:544,l:70,wd:true,fm:true,w:10,p:100};
I[478] = {n:"Charm Pruner",t:19,d:"This axe has Woodee The Lumberjane to thank for its name... She knew how to turn on the charm and divert the lumberjacks\' attention, running in and stealing all the best trees for herself while they scurried off to pay ridiculous prices for rosebuds, sugarcane and those little snow globes that you shake... as soppy as wells they were.",ep:7,g:3,l:47,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,40,40,false,false],c:"CW>20&CI>20&CC>20",p:5900};
I[479] = {n:"Ivory",t:47,d:"Ivory is always in great demand because of its legendary whiteness. Smiths use the stuff when forging lethal weapons. Collectors value it just as highly. You\'ll have no problem selling this in Amakna.",ep:1,g:88,l:40,wd:true,fm:true,w:10,p:100};
I[480] = {n:"Strange Ore",t:39,d:"This Ore has been extracted from a mysterious and unknown quarry. Unlike most strange items, it doesn\'t have an ounce of magic in it.",ep:1,g:90,l:24,wd:true,fm:true,w:5,p:100};
I[481] = {n:"Dragon Pig Skull",t:47,d:"Despite its small capacity, this skull is a real collector\'s item. Its similarity with the skull of a Iop has allowed numerous medical students to write theses on the intellectual weakness of Amakna\'s most intellectually challenged class.",ep:2,g:91,l:70,wd:true,fm:true,w:50,p:100};
I[482] = {n:"Pushn Shovel",t:8,d:"An Enutrof builder who had had a few drinks too many at the tavern realised one night that this shovel could do more than dig holes in the ground.",ep:1,g:8,l:27,wd:true,fm:true,w:40,an:16,e:[5,4,1,1,40,40,false,false],c:"CS>7&CC>20",p:2200};
I[483] = {n:"Great Pushn Shovel",t:8,d:"An Enutrof builder who had had a few drinks too many at the tavern realised one night that this shovel could do more than dig holes in the ground.",ep:1,g:8,l:29,wd:true,fm:true,w:40,an:16,e:[5,4,1,1,40,40,false,false],c:"CS>9&CC>20",p:2500};
I[484] = {n:"Powerful Pushn Shovel",t:8,d:"An Enutrof builder who had had a few drinks too many at the tavern realised one night that this shovel could do more than dig holes in the ground.",ep:1,g:8,l:31,wd:true,fm:true,w:40,an:16,e:[5,4,1,1,40,40,false,false],c:"CS>11&CC>20",p:2800};
I[485] = {n:"Chafer Lancer Leather Briefs",t:56,d:"When winter comes, the Chafer Lancer never leaves home without his leather briefs... they keep his joints warm and distract his enemies if needs be.",ep:1,g:152,l:44,wd:true,fm:true,w:10,p:100};
I[486] = {n:"Boar Leather",t:56,d:"This leather is particularly resistant, but smells like a male boar in rut. This explains why local farmers use it to trap female boar, who are too stupid to see past such a devious ruse.",ep:1,g:16,l:14,wd:true,fm:true,w:10,p:1};
I[487] = {n:"Dragon Pig Leather",t:56,d:"This useless dreamer of a beast burnt all its hair off after trying to transform itself into a dragon. The leather stinks.",ep:2,g:142,l:70,wd:true,fm:true,w:10,p:6000};
I[489] = {n:"Magnifying Glass",t:20,d:"With this magnifying glass, you will be able to analyse the elements of the location. Treasures will be yours!",ep:1,g:3,l:1,wd:true,fm:true,w:10,an:3,e:[1,6,1,1,100,10,false,false],p:10};
I[490] = {n:"Flask",t:20,d:"An essential item for any self-respecting alchemist, this flask will keep your best potions safe.",ep:1,g:2,l:1,wd:true,fm:true,w:3,an:4,e:[1,6,1,1,200,2,false,false],p:10};
I[491] = {n:"Setter",t:5,d:"This item is essential to the work of Jewellers.",ep:1,g:16,l:1,wd:true,fm:true,w:10,e:[5,4,1,1,50,50,false,false],p:150};
I[492] = {n:"The Kneader",t:20,d:"An essential tool for the baker-confectioner profession.",ep:1,g:1,l:1,wd:true,fm:true,w:8,an:4,tw:true,e:[50,6,1,1,500,10,false,false],p:10};
I[493] = {n:"Hammer Smith\'s Hammer",t:7,d:"An essential tool for making hammers.",ep:1,g:2,l:1,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,50,50,false,false],p:150};
I[494] = {n:"Sword Smith\'s Hammer",t:7,d:"An essential tool for making swords.",ep:1,g:2,l:1,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,50,50,false,false],p:150};
I[495] = {n:"Dagger Smith\'s Hammer",t:7,d:"An essential tool for making daggers.",ep:1,g:2,l:1,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,50,50,false,false],p:150};
I[496] = {n:"Shovel Smith\'s Hammer",t:7,d:"An essential tool for making shovels.",ep:1,g:2,l:1,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,50,50,false,false],p:150};
I[497] = {n:"Miner\'s Pick",t:21,d:"An essential tool for collecting ore.",ep:1,g:1,l:1,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,50,50,false,false],p:150};
I[498] = {n:"Staff Slasher",t:5,d:"An essential tool for making staffs.",ep:1,g:17,l:1,wd:true,fm:true,w:10,e:[5,4,1,1,50,50,false,false],p:150};
I[499] = {n:"Wand Slasher",t:5,d:"An essential tool for making wands.",ep:1,g:17,l:1,wd:true,fm:true,w:10,e:[5,4,1,1,50,50,false,false],p:150};
I[500] = {n:"Bow Slasher",t:5,d:"An essential tool for making bows.",ep:1,g:17,l:1,wd:true,fm:true,w:10,e:[5,4,1,1,50,50,false,false],p:150};
I[501] = {n:"Reworked Treechnid Sap",t:15,d:"This syrupy sap has been tampered with by a renowned Alchemist who wanted to liven up Treechnid Roots. I don\'t need to tell you that you\'ll have to be careful with this stuff.",ep:2,g:162,l:30,wd:true,fm:true,w:2,p:50};
I[502] = {n:"Yew Axe",t:19,d:"This axe is the only tool that can cut down enchanted trees. It\'s the silver bullet of axes.",ep:1,g:4,l:17,wd:true,fm:true,w:20,an:17,e:[10,4,1,1,40,50,false,false],c:"CS>10&CI>35",p:950};
I[515] = {n:"Boulgourde of the Glades",t:19,d:"This axe once belonged to the renowned Lumberjack, Brouce Boulgoure. He used to be married to Kassiopee Baine, another great Lumberjack\'s daughter. Many\'s the time this weapon protected him when he was alone in the forest.",ep:7,g:5,l:62,wd:true,fm:true,w:60,an:17,tw:true,e:[15,6,1,1,50,40,false,false],c:"CI>124&CC>30&CV>10",p:10100};
I[519] = {n:"Magical Cure",t:48,d:"This powder is made of Flax and Bread. Neither of these ingredients explain its magical properties.",ep:1,g:2,l:1,wd:true,fm:true,w:1,p:1};
I[520] = {n:"Poppy Seed Bread",t:33,d:"This bread is one of the trickiest to make... It\'s extremely difficult to remain coherent as the fumes make their inebriating way into your bloodstream and your loaves slowly begin to scream terrifyingly cruel obscenities at you.",ep:1,g:10,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[521] = {n:"Sesame Seed Bread",t:33,d:"The most daring Kwaks often dress up as bakers to steal sesame seeds. After a long process of costly mistakes, the Kwaks now know to only try such reckless tricks on Iop bakers.",ep:1,g:11,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[522] = {n:"Flax Seed Bread",t:33,d:"This bread is rich in proteins but completely tasteless. That\'s just the way it is, you can\'t have your bread and eat it too as the bakers say.",ep:1,g:12,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[524] = {n:"Hazelnut Bread",t:33,d:"This Bread, cooked to golden perfection with a delicate flour contains no colourings or preservatives, unlike the Royal Jelly.",ep:1,g:12,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[526] = {n:"Cereal Bread",t:33,d:"This multi-cereal bread contains enough fibre to give a dead man the runs.",ep:1,g:6,l:60,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[527] = {n:"Walnut Bread",t:33,d:"First, walnuts are toasted and put into the soft centre. Then, the bread is cooked over Walnut Wood.",ep:4,g:8,l:40,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[528] = {n:"Wholemeal Bread",t:33,d:"This wholemeal enriched bread is a quality product for the discerning palate.",ep:1,g:7,l:20,wd:true,fm:true,w:2,u:true,ut:true,p:1};
I[529] = {n:"Barley Flour",t:52,d:"This flour is milled from barley grains. It gives a certain lightness to the centre of the bread which has no equal in the land, unless you use occult magic in your bakery.",ep:1,g:256,l:1,wd:true,fm:true,w:2,p:0};
I[530] = {n:"Rye Flour",t:52,d:"This flour retains all the characteristics of Rye. According to the legend, Rye which sprouts at dawn never ripens. In a typically peasant-style leap of logic, many farmers procreate at dawn hoping their future children will never grow old.",ep:1,g:257,l:1,wd:true,fm:true,w:2,p:0};
I[531] = {n:"Oats Flour",t:52,d:"This flour doesn\'t rise during baking, which makes for a very dense bread, ideal when you have to sock a monster on the loaf.",ep:1,g:250,l:1,wd:true,fm:true,w:2,p:0};
I[532] = {n:"Rye",t:34,d:"This dark cereal can grow under the worst of conditions, it\'s one of the rare cereals capable of surviving long periods of drought.",ep:1,g:123,l:50,wd:true,fm:true,w:2,p:0};
I[533] = {n:"Oats",t:34,d:"This type of cereal is used to feed the young Tabis, whose teeth are not sufficiently developed for hard foods. The peasants nevertheless dished it out with a fearful moderation, being well aware of the eye-watering damage wrought by a fibre-fed intestinal tract.",ep:1,g:154,l:20,wd:true,fm:true,w:2,p:0};
I[534] = {n:"Malt Flour",t:52,d:"This white flour is made by grinding sprouted grains of barley, which gives a slightly acidic taste to bread, or at best a taste of stale beer. Great for breakfast on a Sunday morning.",ep:1,g:255,l:1,wd:true,fm:true,w:2,p:0};
I[535] = {n:"Hop Flour",t:52,d:"This flour lends a delicious beer-taste to bread, without having to waste beer in the process. What a skilled bunch, these bakers, don\'t you think ?",ep:1,g:253,l:1,wd:true,fm:true,w:2,p:0};
I[536] = {n:"Oatflake Bread",t:33,d:"This bread, light and soft in the centre, is ideal for people that Single Mother Nature has endowed with a tiny stomach...",ep:1,g:5,l:10,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[537] = {n:"Potato",t:68,d:"Generally speaking, when you come across a spud, it means that you either are in the middle of a field or in the depths of a dungeon.",ep:1,g:135,l:1,wd:true,fm:true,w:20,p:10};
I[538] = {n:"Peeled Potatoes",t:68,d:"This peeled potato is edible.",ep:1,g:136,l:1,wd:true,fm:true,w:20,p:10};
I[539] = {n:"Rye Bread",t:33,d:"This Bread is prepared with Rye Flour, which lends a brown colour to the centre and a delicious sugary flavour.",ep:1,g:9,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[543] = {n:"Diamond Stone",t:51,d:"When properly polished, this stone can make a magnificent Diamond.",ep:1,g:144,l:30,wd:true,fm:true,w:20,p:15};
I[544] = {n:"Emerald Stone",t:51,d:"When properly polished, this stone can make a magnificent Emerald.",ep:1,g:145,l:30,wd:true,fm:true,w:20,p:15};
I[545] = {n:"Crystal Stone",t:51,d:"When properly polished, this stone can make a magnificent Crystal.",ep:1,g:141,l:30,wd:true,fm:true,w:20,p:15};
I[546] = {n:"Sapphire Stone",t:51,d:"When properly polished, this stone can make a magnificent Sapphire.",ep:1,g:151,l:30,wd:true,fm:true,w:20,p:15};
I[547] = {n:"Ruby Stone",t:51,d:"When properly polished, this stone can make a magnificent Ruby.",ep:1,g:150,l:30,wd:true,fm:true,w:20,p:15};
I[548] = {n:"Recall Potion",t:12,d:"This potion will take you back to your last save point.",ep:1,g:17,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[577] = {n:"Peasant Scythe",t:22,d:"This scythe will never be a fearsome weapon, since it\'s a bit rusty and not very sharp... On the other hand, it is the perfect tool for reaping grain.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,50,50,false,false],p:150};
I[578] = {n:"Whetstone",t:51,d:"Thou shalt not cast the first stone...",ep:2,g:127,l:1,wd:true,fm:true,w:20,p:1};
I[579] = {n:"Leather Cutter",t:5,d:"An essential tool to the making of shoes and belts.",ep:1,g:18,l:1,wd:true,fm:true,w:10,e:[5,4,1,1,50,50,false,false],p:150};
I[580] = {n:"Ghetto Raid Potion",t:12,d:"You\'ll recover between 101 and 200 energy points using this potion.",ep:1,g:18,l:10,wd:true,fm:true,w:1,u:true,p:20};
I[582] = {n:"White Flour",t:52,d:"You need several cereals to make this flour, which is much appreciated for its quality. You wouldn\'t think to look at it, would you?",ep:1,g:7,l:1,wd:true,fm:true,w:2,p:0};
I[583] = {n:"Minx Flour",t:52,d:"This off-white flour takes its name from the peasant woman who discovered it. She enjoyed slapping the men of the village on the backside with her hands covered in flour. The minx.",ep:1,g:7,l:20,wd:true,fm:true,w:2,p:0};
I[586] = {n:"Peasant Flour",t:52,d:"Shika Ingalsse got the idea for this immensely popular flour while knocking Brouce Boulgoure\'s pets around with sacks of inferior milled cereal. Don\'t worry, outrage ensued.",ep:1,g:258,l:30,wd:true,fm:true,w:2,p:0};
I[587] = {n:"Wheatmeal",t:52,d:"This flour is a mixture of several types of cereal and consequently a particularly rich mixture... very useful for whole wheat bread.",ep:1,g:259,l:40,wd:true,fm:true,w:2,p:0};
I[592] = {n:"Ivan Nowe String",t:2,d:"This bow once belonged to Ivan Nowe, a foolhardy Cra who had a cruel habit of attacking stray Tofus. This bow first puzzles the enemy before efficiently killing them.",ep:7,g:1,l:36,wd:true,fm:true,w:10,an:10,tw:true,e:[10,4,2,7,15,50,false,true],c:"CS>30&CA>36",p:3600};
I[593] = {n:"Freyesque Orchid",t:35,d:"This flower is as rare as it is beautiful. It\'s not surprising when you know that the rampant Toads of the region use them to feed their offspring.",ep:1,g:192,l:40,wd:true,fm:true,w:1,p:0};
I[594] = {n:"Edelweiss",t:35,d:"This flower is beautiful but very rare . It\'s no surprise - its magic is so powerful that it can even bring people back to life.",ep:1,g:191,l:50,wd:true,fm:true,w:1,p:0};
I[596] = {n:"Short Fishing Rod",t:20,d:"This small fishing rod is perfect for catching small fish in ponds.",ep:1,g:8,l:1,wd:true,fm:true,w:1,an:18,e:[1,4,1,1,100,100,false,false],p:200};
I[597] = {n:"Simple Capturing Net",t:99,d:"Extremely resistant, this net enables you to capture the wildest of mounts, provided you first succeeded to hypnotize or distract it.",ep:20,g:1,l:1,wd:true,fm:true,w:1,an:0,p:10};
I[598] = {n:"Grawn",t:41,d:"Grawns are appreciated for their delicate taste and bright pink colour. On the other hand, they are hated for their legendary bad temper and their gomina-style antennas.",ep:1,g:292,l:1,wd:true,fm:true,w:1,p:10};
I[600] = {n:"Kralove",t:41,d:"The Kralove may not look like much, but don\'t be fooled - behind its sad eyes, a fearsome predator crouches, ready to pounce on an intruding stranger.",ep:2,g:309,l:20,wd:true,fm:true,w:1,p:10};
I[602] = {n:"Sickle-Hammerhead Shark",t:41,d:"This red shark is an activist with a strong herd instincts - there is no sense of the individual in their group even if their chief, Stakemoff, is idolised as a hero.",ep:2,g:322,l:80,wd:true,fm:true,w:2,p:1};
I[603] = {n:"Kittenfish",t:41,d:"The Kittenfish has two unusual characteristics - it has whiskers and it purrs under water to frighten Flying Fish.",ep:1,g:277,l:1,wd:true,fm:true,w:1,p:50};
I[607] = {n:"Muddy Trout",t:41,d:"The Muddy Trout is somehow related to the aggressive Salmoon of Moon Island. This trout is delicious both raw and cooked...",ep:1,g:395,l:1,wd:true,fm:true,w:1,p:50};
I[610] = {n:"Crab Amulet",t:1,d:"This delicate but original whitish amulet is made of Crab.",ep:1,g:30,l:24,wd:true,fm:true,w:2,p:1800};
I[616] = {n:"Fisherman Amulet",t:1,d:"This amulet, set with fish scales, is supposed to bring its wearer good luck when he puts out to sea on stormy nights.",ep:1,g:29,l:22,wd:true,fm:true,w:2,p:2000};
I[617] = {n:"Pirate Amulet",t:1,d:"Many sailors have been impressed by this terrifying amulet. All you have to do is put it on and you\'ll be a feared warrior.",ep:1,g:20,l:41,wd:true,fm:true,w:2,p:4500};
I[619] = {n:"Gobball Master Staff",t:4,d:"This staff allowed Paile Ingalsse, breeder of Gobballs, to summon the Tofus that kept his flocks safe. After a tragic accident, he discovered that it was also a fierce weapon.",ep:7,g:6,l:85,wd:true,fm:true,w:20,tw:true,e:[10,3,1,1,30,100,false,false],c:"CI>60&CW>20&CA>40",p:10000};
I[620] = {n:"Kralove Cutting Sword",t:6,d:"Thanks to this sword, the celebrated sailor Mobby Diquerivurs sliced the tentacles off the equally famous Giant Kralove of Moon Island, much feared for his habit of smothering drunken sailors.",ep:1,g:8,l:61,wd:true,fm:true,w:50,an:14,e:[10,7,1,1,50,50,false,false],c:"CV>60&CW>60",p:9900};
I[629] = {n:"Pointed Hat",t:16,d:"Your date will be the Queen of the Ball with this magnificent hat.",ep:5,g:1,l:21,wd:true,fm:true,w:5,p:1400};
I[638] = {n:"Somoon Fisherman Amulet",t:1,d:"Fishing a Somoon is quite a miracle but don\'t worry, with this amulet around your neck, there\'s no such word as " + "\"" + "can\'t" + "\"" + ".",ep:12,g:24,l:35,wd:true,fm:true,w:5,p:2500};
I[639] = {n:"Amulet of the Depths",t:1,d:"The Amulet of the Depths has been found in the submerged shipwreck of the renowned Kralove fisherman, Tom Fawyer, also famous for his lousy jokes at the pirates\' bar.",ep:14,g:22,l:47,wd:true,fm:true,w:5,p:6000};
I[640] = {n:"Rento Bow",t:2,d:"Fishermen used this bow to clean the vermin off the coastlines of Amakna... The cowards usually committed the pesticide from the windows of the local bars.",ep:14,g:38,l:46,wd:true,fm:true,w:10,an:10,tw:true,e:[10,4,2,10,30,45,false,true],c:"CA>46",p:5600};
I[641] = {n:"Ancestral Cotton",t:15,d:"This cotton is as soft as the belly fur of a young female Ecaflip, as white as a spring cloud and as delicate as a Tofu feather.",ep:1,g:657,l:6,wd:true,fm:true,w:1,p:500};
I[642] = {n:"Silkworm Cocoon",t:15,d:"This huge, off-white cocoon can be unwound to obtain 100% pure filament silk. \nIt is even said that the adventurer Harry Hane used it to help him get out of Dark Vlad\'s maze.",ep:1,g:489,l:6,wd:true,fm:true,w:1,p:100};
I[643] = {n:"Silk String",t:15,d:"The delicacy and suppleness of this String is hard to beat. Silk is the fabric favoured by the Chafers for their fighting underwear.",ep:1,g:486,l:5,wd:true,fm:true,w:1,p:100};
I[646] = {n:"Black Tiwabbit Hairs",t:54,d:"This black hair doesn\'t show the dirt. This is an advantage that will interest the kind of hero who thinks that a brisk walk through the rain is as good as a bath. They melt when they touch sweat, though.",ep:8,g:195,l:11,wd:true,fm:true,w:1,p:50};
I[648] = {n:"Wabbit Hair",t:54,d:"This type of hair is not really appreciated by experienced Tailors but it has the virtue of repelling Moskitoes because of its smell of Citronella Grass.",ep:8,g:196,l:18,wd:true,fm:true,w:1,p:1};
I[649] = {n:"Wo Wabbit Hairs",t:54,d:"This kind of hair is so greasy that you can use it to make waterproof cloths.",ep:8,g:197,l:39,wd:true,fm:true,w:1,p:40};
I[650] = {n:"Gwandpa Wabbit Hairs",t:54,d:"These malodorous hairs are rarely used by tailors because they have a tendency to curl when they come into contact with cawwot juice.",ep:8,g:198,l:39,wd:true,fm:true,w:1,p:50};
I[651] = {n:"Boowolf Fabric",t:55,d:"This fabric, made of Boowolf hair, is very rare. It\'s strong enough to resist to all kinds of physical and magical attacks.",ep:1,g:199,l:70,wd:true,fm:true,w:1,p:100};
I[652] = {n:"Boar Fabric",t:55,d:"This Boar hair fabric is rough and foul-smelling... but it offers excellent protection against physical attacks.",ep:1,g:220,l:13,wd:true,fm:true,w:1,p:50};
I[653] = {n:"Prespic Fabric",t:55,d:"Under its peak the Prespic has a carpet of soft red fur which gives off a rotten smell on rainy days. Fortunately, it never rains in Amakna... just don\'t use this fabric to make your swimming trunks.",ep:1,g:661,l:17,wd:true,fm:true,w:1,p:100};
I[654] = {n:"Wabbit Fabric",t:55,d:"This fabric, made from Wabbit Gwandpa Beard Hairs, is very bushy, as well as irritating, a bit like a fat, urticant caterpillar.",ep:8,g:15,l:18,wd:true,fm:true,w:1,p:100};
I[657] = {n:"Tofu Master Staff",t:4,d:"This staff allowed Shika Ingalsse, leader of Gobballs, to summon the Tofus that kept her flocks safe. After a tragic accident, she discovered that it was also a fierce weapon.",ep:7,g:6,l:56,wd:true,fm:true,w:10,an:12,tw:true,e:[5,3,1,1,30,50,false,false],c:"CI>40&CW>10&CS>30",p:5600};
I[658] = {n:"Tabi Master Staff",t:4,d:"This staff allowed Gramine Ingalsse, leader of Gobballs, to summon the Tofus that kept his flocks safe. After a tragic accident, he discovered that it was also a fierce weapon.",ep:7,g:6,l:34,wd:true,fm:true,w:10,an:12,tw:true,e:[5,3,1,1,30,50,false,false],c:"CI>20&CW>5",p:3400};
I[673] = {n:"Chestnut Tree Eater",t:19,d:"This Axe has no outstanding features except its natural lightness which is due to the Chestnut Wood it is made from. It has a shaft as light as a feather from the tail of a young Evil Tofu.",ep:1,g:6,l:8,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,45,45,false,false],c:"CS>8&CA>3",p:400};
I[674] = {n:"Cherry Splitter",t:19,d:"" + "\"" + "There\'s nothing wrong with this axe... Seriously, nothing. Really." + "\"" + " The wise words of Brouce Boulgoure, Lumberjack extraordinaire. Its Cherry wood shaft cushions vibrations when you\'re cutting trees down or splitting Bworks\' skulls.",ep:1,g:7,l:32,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,45,45,false,false],c:"CV>40",p:2900};
I[675] = {n:"Walnut Cutter",t:19,d:"This axe doesn\'t look special, but it does the job. Brouce Boulgoure the Lumberjack won the Bwork Dwarf tree-cutting championship with this modest tool - that\'s saying something.",ep:1,g:8,l:21,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,45,45,false,false],c:"CV>30",p:1350};
I[676] = {n:"Maple Tree Eater",t:19,d:"This axe\'s special feature is that it never gets rusty, so don\'t be surprised when hungry Lumberjacks start licking the sweet tree sap from its blade.",ep:1,g:10,l:25,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,45,45,false,false],c:"CA>30",p:1850};
I[677] = {n:"Pirate Cloak",t:17,d:"This cloak once belonged to Zokrim, an old pirate. He must have been rather unlucky...",ep:1,g:11,l:1,wd:true,fm:true,w:10,p:1};
I[678] = {n:"Ivory Parchment",t:13,d:"(Double click to gain experience) \nWith this parchment, you gain Experience without putting yourself on the line!",ep:1,g:25,l:25,wd:true,fm:true,w:1,u:true,p:1};
I[679] = {n:"White Parchment",t:13,d:"(Double click to gain experience)\nWith this parchment, you gain Experience without putting yourself on the line!",ep:1,g:3,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[680] = {n:"Golden Parchment",t:13,d:"(Double click to gain experience) \nWith this parchment, you gain Experience without putting yourself on the line!",ep:1,g:26,l:50,wd:true,fm:true,w:1,u:true,p:1};
I[683] = {n:"Small Strength Scroll",t:76,d:"(Double click to gain strength)\nWith this scroll you can safely and permanently increase your strength.\nBe careful though, as you can only use it if your strength is below 25.",ep:1,g:21,l:1,wd:true,fm:true,w:1,c:"Cs<25",u:true,p:1000};
I[684] = {n:"Spell Point Scroll",t:76,d:"(Double click to gain 1 Spell Point)\nWith this scroll you can safely and permanently increase your Spell Points by 1.",ep:1,g:666,l:1,wd:true,fm:true,w:1,u:true,p:15000};
I[686] = {n:"Small Intelligence Scroll",t:76,d:"(Double click to gain intelligence)\nWith this scroll you can safely and permanently increase your intelligence.\nBe careful though, as you can only use it if your intelligence is below 25.",ep:2,g:23,l:1,wd:true,fm:true,w:1,c:"Ci<25",u:true,p:1000};
I[690] = {n:"Flax Flour",t:52,d:"This flour is very strange. It\'s not made of grain, which explains why it doesn\'t look like flour. It also explains why it doesn\'t taste, smell or behave like flour.",ep:1,g:254,l:1,wd:true,fm:true,w:2,p:0};
I[692] = {n:"Solid Bread",t:33,d:"Made with Flax Flour, this Bread is fatty with a brown centre. Although rich in essential oils, it tastes awful.",ep:1,g:12,l:1,wd:true,fm:true,w:2,u:true,ut:true,p:1};
I[694] = {n:"Crimson Dofus",t:23,d:"Ignemikhal the Fire Dragon created the Crimson Dofus. I would tell you that it stinks of sulphur... but it stinks of so many other things too.",ep:1,g:1,l:6,wd:true,fm:true,w:5,p:1};
I[695] = {n:"Lumberjack Scroll",t:13,d:"You gain Experience as a Lumberjack by using this scroll. (Double click to use it).",ep:1,g:27,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[696] = {n:"Slob Headgear",t:16,d:"Besides its has-been look, the Slob Headgear is great for those high-noon duels... keeps some sun out of your eyes.",ep:1,g:2,l:20,wd:true,fm:true,w:4,p:1300};
I[697] = {n:"Makroute",t:16,d:"Makroute is a very affectionate dog... He never leaves his master\'s side. A fine animal.",ep:2,g:3,l:6,wd:true,fm:true,w:6,p:30000};
I[698] = {n:"Sortingat Hogwat",t:16,d:"The Sortingat Hogwat comes from a famous School of Magic. This lively creature has met the greatest wizards of our time, like Mrs Magoa AlaGale, Mr Doublegore and the renowned Misk\'arry Rotter.",ep:1,g:4,l:33,wd:true,fm:true,w:6,p:3000};
I[699] = {n:"The Troma",t:16,d:"The Trauma is as shady as an Eraserhead made of Bherb hairs, and that\'s saying something. (If you don\'t know what an Eraserhead made of Bherb hairs looks like, refer to the great books of the Hen Pens).",ep:1,g:5,l:22,wd:true,fm:true,w:10,p:1525};
I[700] = {n:"Pandawa",t:16,d:"Ah, the Pandawa, look at the face on him! Just like his good friend Makroute, he spends all his time on his owner\'s head. This lazy beast never needs to move more than an arm\'s length - he steals all he needs straight from his owners hands!",ep:2,g:6,l:6,wd:true,fm:true,w:10,c:"PG!10",p:12000};
I[701] = {n:"The Oiram",t:16,d:"The Oiram has many fans throughout the world who just love its classy look. This hat once belonged to a plumber who spent his days cleaning pipes. He was quite stylish himself.",ep:1,g:7,l:22,wd:true,fm:true,w:12,c:"PG!10",p:1525};
I[702] = {n:"Kritter",t:16,d:"This demon skull, constructed from various bones, gives its bearer a graceful and elegant look... Even your lover will be sick with envy...",ep:1,g:8,l:30,wd:true,fm:true,w:9,c:"PG!10",p:2600};
I[703] = {n:"Dora",t:16,d:"This magical hat, which looks like an upside-down wicker fruit basket, is in fact... a magical upside-down fruit basket hat. It will certainly impress the neighbours, especially if they are Bwork Magus apprentices.",ep:2,g:9,l:36,wd:true,fm:true,w:20,p:3550};
I[704] = {n:"Eachure Hat",t:16,d:"With this hat of leather Chafer briefs, the female Bwork magi won\'t be able to resist you. That\'s not a good thing, mind - many are known to wear long, red beards and none are known for their femininity.",ep:2,g:10,l:36,wd:true,fm:true,w:10,p:3550};
I[705] = {n:"Tromatizing Mask",t:16,d:"If what you\'re looking for is a bit of trauma, you\'ll find great relief in this magnificent coconut. We remind you that a free straw and many a mouthful of fresh coconut-flavoured goodness are waiting for you inside.",ep:12,g:11,l:47,wd:true,fm:true,w:10,p:6000};
I[706] = {n:"Crystaloball",t:16,d:"Hung \'Short Memory\' Lekahurse owned a magnificent crystal ball, his grandpa gave it to him. He wisely decided to hold on to it for the rest of his life... In fact he put it on his hat which he never took off again... until one day, a jealous breeze took it away. He followed, and the breeze seemed to mock him, suspending the hat in the air, and whipping it away just as his searching fist approached. Not without a sense of decency, the wind took him home for a brief visit once a season and when it sensed the poor man was close to the end, took him to the edge of a cliff, hung the hat there for a moment AND... down Lekahurse tumbled... at peace at last.",ep:4,g:12,l:24,wd:true,fm:true,w:12,s:38,p:1775};
I[707] = {n:"Minot\'Horn",t:16,d:"With this hat of Minotoror\'s Horns, you\'ll have no problem passing yourself off as a Minotoror if your confidence in your own powers is failing. This trickery only works on simple-minded creatures such as Iops and Tofus.",ep:2,g:13,l:33,wd:true,fm:true,w:10,s:54,p:3000};
I[708] = {n:"Pilbocks Hat",t:16,d:"This brand new larva skin magic green hat gives its bearer a jolly appearance... jolly but incredibly stupid. We can\'t always get what we want and this hat is a perfect example.",ep:1,g:14,l:30,wd:true,fm:true,w:8,p:2525};
I[709] = {n:"Lorko Kasko",t:16,d:"This hat of enchanted bark once belonged to Lorko, a lumberjack. He challenged the renowned Brouce Boulgoure to an  Elm uprooting duel in Liroye Merline.",ep:9,g:15,l:37,wd:true,fm:true,w:9,c:"PG!10",p:3825};
I[710] = {n:"Korko Klako",t:16,d:"The Korko Klako is a beautifo hato worno by the mo handso Sadido.",ep:1,g:16,l:17,wd:true,fm:true,w:9,c:"PG=10",p:1000};
I[711] = {n:"Jouik Krampe",t:16,d:"This magnificent leather mask once belonged to Jouik Krampe, cousin of Zeurg. They were both fond of tight leather clothes. A bit like Captain Chafer, only not as perverse.",ep:8,g:17,l:26,wd:true,fm:true,w:15,c:"PG=10",p:2025};
I[712] = {n:"Gulliver",t:16,d:"This hat is so original that you will soon think you\'re fantastic, unique and on top of the world. It is said that in bygone days, Rakmar Bilgout used it to charm the queen of the Gobballs. He didn\'t hesitate to cut her throat open afterwards... Nothing to do with the hat I hope.",ep:13,g:18,l:33,wd:true,fm:true,w:10,p:3075};
I[713] = {n:"Sword Smith Scroll",t:13,d:"(Double click to gain Experience as a Sword Smith)",ep:1,g:28,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[714] = {n:"Dagger Smith Scroll",t:13,d:"You gain Experience as a Dagger Smith by using this scroll. (Double click to use it).",ep:1,g:29,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[715] = {n:"Bow Carver Scroll",t:13,d:"You gain Experience as a Bow Carver by using this scroll. (Double click to use it).",ep:4,g:30,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[716] = {n:"Staff Carver Scroll",t:13,d:"You gain Experience as a Staff Carver by using this scroll. (Double click to use it).",ep:1,g:31,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[717] = {n:"Wand Carver Scroll",t:13,d:"You gain Experience as a Wand Carver by using this scroll. (Double click to use it).",ep:1,g:32,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[718] = {n:"Spell Scroll: Leek Pie",t:75,d:"(Double click to learn the spell) \nThis scroll will teach you the elementary spell \'Leek Pie\'.",ep:1,g:1,l:1,wd:true,fm:true,w:1,u:true,p:10000};
I[719] = {n:"Spell Scroll: Release",t:75,d:"(Double click to learn the spell) \nThis scroll will teach you the elementary spell \'Release\'.",ep:1,g:18,l:1,wd:true,fm:true,w:1,u:true,p:10000};
I[720] = {n:"Spell Scroll: Lightning Strike",t:75,d:"(Double click to learn the spell) \nThis scroll will teach you the elementary spell \'Lightning Strike\'.",ep:1,g:19,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[721] = {n:"Spell Scroll: Summoning of Arachnee",t:75,d:"(Double click to learn the spell) \nThis scroll will teach you the summoning spell \'Summoning of Arachnee\'.",ep:16,g:16,l:1,wd:true,fm:true,w:1,u:true,p:10000};
I[724] = {n:"Spell Scroll: Staff Skill",t:73,d:"(Double click to learn the spell)\nThis scroll will teach you a spell that will enable you to cause more damage when you use a staff.",ep:1,g:2,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[725] = {n:"Spell Scroll: Sword Skill",t:73,d:"(Double click to learn the spell)\nThis scroll will teach you a spell that will enable you to cause more damage when you use a sword.",ep:3,g:1,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[726] = {n:"Spell Scroll: Bow Skill",t:73,d:"(Double click to learn the spell)\nThis scroll will teach you a spell that will enable you to cause more damage when you use a bow.",ep:4,g:3,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[727] = {n:"Spell Scroll: Hammer Skill",t:73,d:"(Double click to learn the spell)\nThis scroll will teach you a spell that will enable you to cause more damage when you use a hammer.",ep:1,g:4,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[728] = {n:"Spell Scroll: Wand Skill",t:73,d:"(Double click to learn the spell) \nThis scroll will teach you a spell that will enable you to cause more damage when you use a wand.",ep:1,g:5,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[729] = {n:"Spell Scroll: Dagger Skill",t:73,d:"(Double click to learn the spell)\nThis scroll will teach you a spell that will enable you to cause more damage when you use a dagger.",ep:2,g:6,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[730] = {n:"Spell Scroll: Shovel Skill",t:73,d:"(Double click to learn the spell) \nThis scroll will teach you a spell that will enable you to cause more damage when you use a shovel.",ep:7,g:7,l:20,wd:true,fm:true,w:1,u:true,p:10000};
I[731] = {n:"Class Spell Scroll: Brokle",t:75,d:"(Double click to learn the spell)\nThis scroll will teach Iops the class spell \'Brokle\'.",ep:2,g:4,l:1,wd:true,fm:true,w:1,c:"PG=8",u:true,p:10000};
I[732] = {n:"Silimelle\'s Wedding Ring",t:9,d:"This magnificent wedding ring was stolen from Silimelle, a female brewer, during a boozy meal at the Inn. See what happens when you accept drinks from strangers?",ep:1,g:30,l:26,wd:true,fm:true,w:1,p:2000};
I[733] = {n:"Ragalde\'s Boots",t:11,d:"Without any doubt, Ragalde was one of the most foolhardy Iop warriors. With these magic boots, he slew a great number of enemies.",ep:1,g:7,l:49,wd:true,fm:true,w:1,p:5000};
I[734] = {n:"Blo\'up Belt",t:10,d:"This belt is the weapon of choice for crowd control in Amakna prison and at the annual town fair.",ep:1,g:7,l:17,wd:true,fm:true,w:10,p:1000};
I[737] = {n:"Emerald Dofus",t:23,d:"Greener than a sick Tofu, the Emerald Dofus was created by Aerafal, the Air Dragon. To create such a green thing, he was certainly feeling airsick. That would be the last straw, wouldn\'t it?",ep:1,g:2,l:6,wd:true,fm:true,w:5,p:1};
I[739] = {n:"Turquoise Dofus",t:23,d:"The Turquoise Dofus was created by Aguabrial, the Water Dragon. It\'s incredible what a Dragon can do with some water...",ep:1,g:3,l:6,wd:true,fm:true,w:5,p:1};
I[742] = {n:"Horned Staff",t:4,d:"" + "\"" + "I am the eggman, I am the Dofus. Waka fu ku." + "\"" + " The last words recorded by the renowned Axe Smith-cum-Minstrel, Jon Lemon. Soon after, he was crushed by a Giant Tofu egg.",ep:1,g:1,l:29,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,30,200,false,false],c:"CC>20&CI>30",p:2350};
I[743] = {n:"Golden Brioche",t:33,d:"The recipe for this brioche was standardised by Xavier the Baker himself. He wanted to make a delicious and light brioche. It\'s more than he could have hoped for...",ep:1,g:8,l:60,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[744] = {n:"Bowisse\'s Cloak",t:17,d:"This cloak is an often underestimated one-of-a-kind. It is made of green larva skin, giving it a most pleasant, rugged appearance.",ep:1,g:1,l:20,wd:true,fm:true,w:10,p:1275};
I[745] = {n:"Gold Ingot",t:40,d:"This ingot is made of solid gold.",ep:1,g:241,l:10,wd:true,fm:true,w:1,p:0};
I[746] = {n:"Ebonite",t:40,d:"This rare alloy is used in the making of rare and often lethal items. It is a too-little-known fact that Ebonite, once it has rusted, becomes a dangerous poison.",ep:1,g:658,l:20,wd:true,fm:true,w:20,p:0};
I[747] = {n:"Aluminite",t:40,d:"This alloy is incredibly light and is consequently a choice metal for small daggers or short swords.",ep:1,g:660,l:10,wd:true,fm:true,w:10,p:0};
I[748] = {n:"Magnesite",t:40,d:"This eccentric alloy is almost magical; it glitters and vibrates at night time, which is enough to frighten a slightly gullible Bwork.",ep:1,g:659,l:30,wd:true,fm:true,w:30,p:0};
I[749] = {n:"Bakelelite",t:40,d:"Bakelelite is not a solid alloy but correctly sharpened, it becomes as sharp as a Chafer\'s Blade.",ep:1,g:487,l:40,wd:true,fm:true,w:40,p:0};
I[750] = {n:"Kouartz",t:40,d:"This strange Alloy contains an impressive energy which makes it quite unstable under certain circumstances. The best Smiths are mad about Kouartz and use it to create weapons with almost legendary powers.",ep:1,g:664,l:60,wd:true,fm:true,w:60,p:0};
I[752] = {n:"Vampire Blood",t:15,d:"This blood is magic and is an essential ingredient of Magic Black Puddings. The side effects remain unknown.",ep:2,g:89,l:15,wd:true,fm:true,w:1,p:100};
I[754] = {n:"Vampire Cloak",t:17,d:"Marinated in pure blood for many long years, this cloak has acquired a ruby red colour that is very pleasing to the eye. This cloak is much favoured during the Dalouhine celebrations.",ep:7,g:17,l:29,wd:true,fm:true,w:13,p:2500};
I[756] = {n:"Vampire Leather Briefs",t:56,d:"In order to avoid being hit in the spots where it hurts, the Vampire sometimes puts on his Leather Briefs when he goes hunting. The briefs also provide him good protection against sunburns.",ep:3,g:622,l:15,wd:true,fm:true,w:1,p:100};
I[757] = {n:"Bluish Jelly",t:110,d:"This jelly sticks the feathers of Tofus pretty strongly. But why should you want to do that?",ep:5,g:42,l:3,wd:true,fm:true,w:1,p:1};
I[758] = {n:"Dispenser of Justice Cloak",t:17,d:"This cloak can only be worn by the great dispensers of justice... It\'s not very popular.",ep:1,g:2,l:30,wd:true,fm:true,w:10,c:"Ps=1&Pa>20",p:2550};
I[759] = {n:"Chogreloting Cheeken Cloak",t:17,d:"This magnificent cloak was made with the feathers of the very last Cheeken of Amakna. It\'s a real rarity that collectors dream of hanging on their living room wall.",ep:8,g:3,l:33,wd:true,fm:true,w:4,p:5000};
I[760] = {n:"Curryless Curry Bread",t:33,d:"A Kwaker Vans prototype. Its flavour and quality are surprising, but so is the smell, unfortunately. You\'ll never get used to it.",ep:2,g:12,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[761] = {n:"Mouse Hairs",t:54,d:"These mouse hairs are very thin and soft - a much sought-after resource in the making of expensive coats for the mistresses of rich Amaknan bankers.",ep:1,g:549,l:1,wd:true,fm:true,w:1,p:1};
I[764] = {n:"Little Owl Amulet",t:1,d:"This small amulet will delight inexperienced adventurers.",ep:1,g:1,l:1,wd:true,fm:true,w:2,p:50};
I[765] = {n:"Farle Ingalsse\'s Scythe",t:22,d:"This scythe once belonged to Farle Ingalsse himself. It is sharp enough to mow any kind of cereal and any kind of monsters hidden in cereal fields.",ep:3,g:1,l:13,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,45,50,false,false],c:"CC>10",p:650};
I[766] = {n:"Koliet Aclou",t:1,d:"This Amulet increases the damage of inexperienced adventurers.",ep:1,g:34,l:1,wd:true,fm:true,w:1,p:20};
I[767] = {n:"Royal Gantie",t:9,d:"Don\'t mind its stuck-up name, this ring can only make your hero stronger. Okay, his chin will shrink too, but hey, who cares!",ep:1,g:8,l:1,wd:true,fm:true,w:1,p:100};
I[768] = {n:"Camate",t:9,d:"This ring influences your fate. You\'ll be tougher but less lucky. In other words, you improve your chances of living a long time and ruin your chances of living happily.",ep:1,g:33,l:1,wd:true,fm:true,w:1,p:100};
I[769] = {n:"Einekeineux",t:11,d:"These boots bring good fortune. Unfortunately, they decrease your resistance.",ep:1,g:5,l:2,wd:true,fm:true,w:1,p:200};
I[770] = {n:"Fecaflip",t:11,d:"This magnificent pair of boots converts a bit of your strength into intelligence.",ep:1,g:3,l:2,wd:true,fm:true,w:1,p:200};
I[771] = {n:"Ash Tree Eater",t:19,d:"This Axe is nothing exceptional but it is  appreciated by Lumberjack apprentices for its simplicity of use.",ep:1,g:9,l:8,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,45,45,false,false],c:"CS>10&CC>10",p:400};
I[772] = {n:"Swashbucloak",t:17,d:"According to what people say, this legendary cloak makes you almost invisible when combined with the fencers\' legendary sword, the Dart Onion, and to the legendary hat of the Six Rams of the Rahk Shepherds.",ep:7,g:4,l:22,wd:true,fm:true,w:10,p:1500};
I[773] = {n:"Ellinie Cloak",t:17,d:"This light cloak comes from the Patitalian Country, a place where people communicate with their limbs. This explains the incredible lightness and complete freedom of movement given by the cloak.",ep:1,g:5,l:14,wd:true,fm:true,w:1,p:775};
I[774] = {n:"Cape Ulais",t:17,d:"Coming from the Mount TaigÃ¼e, this cape ended up poisoning its former female owner... Strangely enough, if you wear it, it will increase your resistance.",ep:1,g:7,l:14,wd:true,fm:true,w:3,p:775};
I[775] = {n:"Cape Ability",t:17,d:"This Cape has been made with infinite care and attention, it allows the wearer to find the enemy\'s weak point.",ep:5,g:9,l:17,wd:true,fm:true,w:10,p:1000};
I[776] = {n:"Sin Cape",t:17,d:"A certain Mulba used this item to carry half her kitchen with her on a long, difficult quest to find the Seven Crystal Hens which fell from the stars. This cloak will make you strong and brave.",ep:5,g:8,l:14,wd:true,fm:true,w:3,p:775};
I[777] = {n:"Salt \'n\' Battery Cape",t:17,d:"The battery cock whose feathers made this cape fought its killers for several days and nights before finally dying of exhaustion. Let me tell you, killing that crazy chicken nearly finished them off too.",ep:5,g:10,l:44,wd:true,fm:true,w:10,p:5275};
I[778] = {n:"Mori Arty\'s Cloak",t:17,d:"This authentic bad guy cloak proves you belong to the gang of the diabolic Mori Arty. It is said that his bad luck equalled his astounding intelligence. Only true bad guys can wear it.",ep:2,g:11,l:6,wd:true,fm:true,w:1,c:"Ps=2&Pa>30",p:20000};
I[779] = {n:"Maj\'Hic Cloak",t:17,d:"This cloak looks ordinary... but isn\'t. It can make its wearer invisible to the eyes of those who are not looking at him. Really impressive!",ep:8,g:12,l:34,wd:true,fm:true,w:15,p:3300};
I[781] = {n:"Itou Lascione Cape",t:17,d:"This superb cloak once belonged to the Great Stratequerre. This renowned and expert strategist lord of war, hungry for the universe conquest, soon gave up his plans after having arrayed himself in the cloak. Really strange!",ep:8,g:7,l:21,wd:true,fm:true,w:10,p:1400};
I[782] = {n:"Agride",t:19,d:"This very special axe was originally designed to teach budding lumberjacks the art of chopping. When it is well used, it can split a young carefree Treechnid in two, provided that such a Treechnid exists...",ep:1,g:11,l:27,wd:true,fm:true,w:20,an:17,e:[5,4,1,1,45,45,false,false],c:"CW>15",p:2200};
I[783] = {n:"Lumberjack Amulet",t:1,d:"This amulet, made exclusively of precious wood, is highly prized and loved by lumberjacks who usually exaggerate its abilities to offset the cost of the material.",ep:1,g:9,l:22,wd:true,fm:true,w:2,p:1500};
I[784] = {n:"Mulish Cat\'s Boots",t:11,d:"Mulish Cat was a renowned Ecaflip, and the most stupid in his class. In combat, the only match for his nonexistent intelligence was his bewildering luck.",ep:1,g:3,l:2,wd:true,fm:true,w:1,p:200};
I[785] = {n:"Fortifying Ring",t:9,d:"The tradition of passing this ring down from grandfather to grandson gives it incredible power. This one is but a pale imitation of the original, but even so, it is much sought after by collectors, whether they are Enutrof or not.",ep:1,g:29,l:11,wd:true,fm:true,w:1,p:525};
I[786] = {n:"Puny Owl Pendant",t:1,d:"The jeweller\'s hand slipped while shaping this amulet, which imparts more intelligence to the wearer but in exchange, imparts a tear-inducing migraine, making it almost impossible to see anything.",ep:1,g:1,l:2,wd:true,fm:true,w:1,p:200};
I[787] = {n:"Ano Rexik Ring",t:9,d:"This strange little ring can increase the agility of the wearer in exchange for chance points.",ep:1,g:31,l:1,wd:true,fm:true,w:1,p:100};
I[789] = {n:"Koober\'s Belt",t:10,d:"This belt is all the rage among young Amaknians. A follower of Sadida, couturier by trade, is behind this fashion. When he sold it for the first time, he said :" + "\"" + "Life is short, play hard!" + "\"" + "",ep:2,g:9,l:1,wd:true,fm:true,w:1,p:10};
I[790] = {n:"Cape of Good Hope",t:17,d:"The magic effects of this cape are often overestimated, which inevitably caused heavy losses in adventurers, such as the notorious minstrel Jon Lemon.",ep:8,g:5,l:30,wd:true,fm:true,w:8,p:2525};
I[791] = {n:"Treechnidis Vivitus",t:4,d:"This is a staff made of living Treechnid roots. But watch out... It has a tendency to turn on its master. When it does decide to attack the same target as you, it can be very deadly.",ep:2,g:1,l:34,wd:true,fm:true,w:10,an:12,e:[5,2,1,1,50,30,false,false],c:"CC>30&CI>34&CW>15",p:3400};
I[792] = {n:"Treechnid Sap",t:15,d:"This syrupy sap is useless unless you are prepared to wait for it to harden and eventually turn into Amber. People say that a shrewd and particularly attractive Enutrof has found a way to speed up this process.",ep:1,g:162,l:45,wd:true,fm:true,w:2,p:50};
I[793] = {n:"Potion of Old Age",t:12,d:"This potion speeds up some chemical processes, like the formation of precipitates. It\'s just like a very powerful yeast, without the musty taste.",ep:1,g:2,l:1,wd:true,fm:true,w:1,p:100};
I[795] = {n:"Strength Scroll",t:76,d:"(Double click to gain strength)\nWith this scroll you can safely and permanently increase your strength.\nBe careful though, as you can only use it if your strength is below 50.",ep:1,g:34,l:1,wd:true,fm:true,w:1,c:"Cs<50",u:true,p:2500};
