I[818] = {n:"Ded Aleicar\'s Rock Key",t:12,d:"This small rock key will open the door of Ded Aleicar\'s cave. So long as you find it, of course...",ep:4,g:14,l:1,wd:true,fm:true,w:1,p:1};
I[819] = {n:"Holy Sword",t:6,d:"A holy sword awarded to young warriors during their training.",ep:1,g:1,l:15,wd:true,fm:true,w:30,an:14,e:[5,4,1,1,50,50,false,false],c:"CS>30&CV>3",p:800};
