I[822] = {n:"Knight Sword",t:6,d:"The Little Knight Sword is an efficient and sturdy sword. Properly used, it can inflict serious damage upon your  enemies.",ep:7,g:9,l:23,wd:true,fm:true,w:30,an:14,e:[4,5,1,1,30,30,false,false],c:"CS>46",p:1600};
