I[825] = {n:"Bwork Blade",t:6,d:"This basic sword can usually be handled by the most cretinous of Bworks, that is to say the ones who are incapable of using a bow or a staff... Some of these geniuses even mistake the blade for the handle. The tradition in this case is for the Bwork to poke its own eyes out with its fingers... Lovely!",ep:1,g:13,l:23,wd:true,fm:true,w:15,an:14,e:[5,5,1,1,50,30,false,false],c:"CS>46&CA>8",p:1600};
