I[828] = {n:"Whistling Bow",t:2,d:"This bow fires its arrows so rapidly that the whistling sound travels for miles. A sound piece of advice: if you want to be discreet, equip it with a silencer.",ep:1,g:15,l:11,wd:true,fm:true,w:10,an:10,tw:true,e:[5,3,2,6,30,40,false,true],c:"CA>11&CS>5",p:550};
I[829] = {n:"Com Bow",t:2,d:"Due its restricted range, this bow is not very popular... Use it to weaken your enemies before finishing them off with a close-range weapon or a crafty spell.",ep:1,g:1,l:8,wd:true,fm:true,w:10,an:10,tw:true,e:[5,4,2,5,30,50,false,true],c:"CA>8",p:400};
