I[836] = {n:"Treering",t:9,d:"This ring, made of Treechnid bark, has great powers but carries great responsibility with it. However, in spite of its value, it is said to be cursed.",ep:1,g:11,l:5,wd:true,fm:true,w:1,p:100};
I[837] = {n:"Kluh\'s Boots",t:11,d:"These boots increase your strength but they affect your intelligence. They could even turn you into a Iop in case of prolonged and regular use.",ep:1,g:3,l:8,wd:true,fm:true,w:1,p:400};
I[838] = {n:"Oni Blood",t:15,d:"This much sought-after flask full of Oni Blood is used by the experienced alchemists to give frightening properties to some weapons.",ep:4,g:662,l:75,wd:true,fm:true,w:1,p:100};
I[840] = {n:"Minotoror Hairs",t:54,d:"These hairs smell very bad but are very resistant. Wearing a material made of Minotoror hair will make a fearsome combatant of you... much appreciated by flies, on top of that.",ep:2,g:201,l:125,wd:true,fm:true,w:1,p:100};
I[841] = {n:"Ring of Satisfaction",t:9,d:"This ring increases AP in exchange for some strength and intelligence.",ep:1,g:12,l:8,wd:true,fm:true,w:1,p:10};
I[842] = {n:"Golden Dreggon Shell",t:111,d:"This golden shell is nearly unbreakable, but if the best jewellers polish it for generations, they can use its magic properties to make amulets with exceptional powers.",ep:11,g:202,l:64,wd:true,fm:true,w:5,p:1};
I[843] = {n:"Black Dreggon Shell",t:111,d:"This black shell is nearly unbreakable, but if the best jewellers polish it for generations, they can use its magic properties to make amulets with exceptional powers.",ep:11,g:203,l:64,wd:true,fm:true,w:5,p:150};
I[844] = {n:"Sapphire Dreggon Egg",t:105,d:"A cute little Dreggon will come out of this strange egg if a female Sapphire Dreggon sits on it. All the same don\'t try to keep it warm against you, you never know...",ep:11,g:204,l:74,wd:true,fm:true,w:20,p:100};
