I[846] = {n:"Black Dreggon Egg",t:105,d:"A cute little Dreggon will hatch out of this strange egg if a female Black Dreggon sits on it. All the same don\'t try to keep it warm against you, you never know...",ep:11,g:206,l:74,wd:true,fm:true,w:20,p:100};
