I[848] = {n:"Old Dreggon Bone",t:47,d:"This old bone is magic. Correctly used, it should make very powerful items.",ep:11,g:15,l:70,wd:true,fm:true,w:20,p:100};
I[849] = {n:"Strong Ring",t:9,d:"This small ring increases Strength.",ep:1,g:5,l:1,wd:true,fm:true,w:1,p:50};
I[850] = {n:"Nimble Ring",t:9,d:"Amaknean collectors are desperate to get their fingers into this ring, though it\'s not worth a penny.",ep:1,g:1,l:1,wd:true,fm:true,w:1,p:50};
I[851] = {n:"Vital Ring",t:9,d:"This small ring increases Life.",ep:1,g:2,l:1,wd:true,fm:true,w:1,p:50};
I[852] = {n:"Small Magic Ring",t:9,d:"This small ring increases Intelligence.",ep:1,g:3,l:1,wd:true,fm:true,w:1,p:50};
I[853] = {n:"Small Chance Ring",t:9,d:"This ring slightly increases Luck.",ep:1,g:42,l:1,wd:true,fm:true,w:1,p:50};
I[854] = {n:"Little Bear Amulet",t:1,d:"This small amulet increases strength.",ep:1,g:5,l:1,wd:true,fm:true,w:1,p:50};
I[856] = {n:"Little Frog",t:1,d:"This small amulet increases agility",ep:1,g:2,l:1,wd:true,fm:true,w:1,p:50};
I[859] = {n:"Agility Belt",t:10,d:"This basic belt increases agility.",ep:1,g:8,l:1,wd:true,fm:true,w:1,p:50};
I[860] = {n:"Chance Belt",t:10,d:"This basic belt increases luck.",ep:1,g:3,l:1,wd:true,fm:true,w:1,p:50};
I[861] = {n:"Small Strength Boots",t:11,d:"These boots increase the strength of the wearer in exchange for agility, making them totally unlike a Tofu in all but intelligence.",ep:1,g:3,l:2,wd:true,fm:true,w:1,p:200};
I[862] = {n:"Intelligence Sandals",t:11,d:"These sandals increase the intelligence of the wearer. They are also eternally fashionable. They are finished off with a breathable walnut sole for exquisite grip.",ep:1,g:4,l:8,wd:true,fm:true,w:1,p:400};
I[863] = {n:"Nimble Boots",t:11,d:"These boots increase the agility of the wearer so that he can get into character as a Tofu every time he feels like making a fool of himself.",ep:1,g:5,l:8,wd:true,fm:true,w:1,p:400};
I[864] = {n:"Chance Boots",t:11,d:"These boots increase your luck in finding powerful items such as Gobball saliva.",ep:1,g:1,l:8,wd:true,fm:true,w:1,p:100};
I[867] = {n:"Dragolyre",t:1,d:"Made of Dreggon remains, this splendid amulet is impressive enough to make your bravest enemies run home sobbing.",ep:11,g:9,l:32,wd:true,fm:true,w:2,p:4700};
I[878] = {n:"Baker Scroll",t:13,d:"You gain Experience as a Baker by using this scroll. (Double click to use it).",ep:1,g:33,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[879] = {n:"Shoemaker Scroll",t:13,d:"You gain Experience as a Shoemaker by using this scroll. (Double click to use it).",ep:1,g:34,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[880] = {n:"Royal Gobball Wool",t:57,d:"This wool is a mixed blessing, really. Soft and light, yet quite fragile, it is simply heaven to scratch with a handful of it. On the other hand, I\'ve seen mental hospitals full of eczema sufferers of sound mind and body who do nothing all day long but scratch, scratch, scratch themselves with this stuff.",ep:1,g:207,l:35,wd:true,fm:true,w:1,p:4000};
I[881] = {n:"White Gobbly Wool",t:57,d:"This wool is extremely soft, because it comes from a Gobbly\'s back. But be careful, it\'s still impregnated with its smell, so stay away from Gobblies during mating season if you don\'t want to end up in hospital.",ep:1,g:208,l:2,wd:true,fm:true,w:1,p:1};
I[882] = {n:"Gobball War Chief Wool",t:57,d:"This wool smells terrible, but it once belonged to a Gobball War Chief and so is of great sentimental value to warriors.",ep:1,g:209,l:19,wd:true,fm:true,w:1,p:1};
I[883] = {n:"White Gobbly Leather",t:56,d:"This smooth skin suits the making of leather underwear perfectly. The leather underpants of the Chafers are an early example.",ep:1,g:534,l:2,wd:true,fm:true,w:1,p:1};
I[884] = {n:"Black Gobbly Leather",t:56,d:"This shining leather is often used by shoemakers and tailors to make small boots and hats.",ep:1,g:16,l:2,wd:true,fm:true,w:1,p:1};
I[885] = {n:"Black Gobbly Wool",t:57,d:"Even if tailors don\'t use it that much, this rough wool is very popular with the Enutrofs, who use it to hide their premature baldness.",ep:1,g:210,l:2,wd:true,fm:true,w:1,p:1};
I[886] = {n:"Royal Gobball Leather",t:56,d:"The incredible suppleness of this leather is fit for a king, and the web-like cracks are proofs of the Royal Gobball longevity. It\'s the best leather in Amakna.",ep:1,g:535,l:35,wd:true,fm:true,w:1,p:4000};
I[887] = {n:"Gobball War Chief Leather",t:56,d:"" + "\"" + "Yes there\'s something you can send back to me, Gobball boots of Gobball leather." + "\"" + " The dying words of the renowned Minstrel, Jon Lemon, before he died, suffocated by the stench of a Gobball War Chief.",ep:1,g:534,l:19,wd:true,fm:true,w:1,p:1};
I[888] = {n:"Great Concentration Boots",t:11,d:"These boots are so comfortable that they instantly increase your concentration.",ep:1,g:6,l:26,wd:true,fm:true,w:15,p:1950};
I[889] = {n:"Powerful Concentration Boots",t:11,d:"These boots are so comfortable that they instantly increase your concentration.",ep:1,g:6,l:27,wd:true,fm:true,w:15,p:2200};
I[890] = {n:"Gobball Boots",t:11,d:"These boots are made of Gobball leather. Thanks to the smell they give off, breeders can approach and kill other Gobballs with the slightest of ease.",ep:1,g:3,l:1,wd:true,fm:true,w:3,p:150};
