I[901] = {n:"Piglet Leather",t:56,d:"Just like mimolette, this leather becomes a dirty shade of orange with the passage of time... and the horrible smell... Uggh!",ep:1,g:141,l:18,wd:true,fm:true,w:1,p:1};
I[902] = {n:"Klime\'s Small Boots",t:11,d:"These boots gave such agility to Klime the Shoemaker that he was able to ride Gobballs. He died when he mistook a Jelly for a Gobball... It was the day of his brother\'s wedding, he was understandably a little under the weather.",ep:1,g:9,l:13,wd:true,fm:true,w:10,p:700};
I[903] = {n:"Klime\'s Boots",t:11,d:"These boots gave such agility to Klime the Shoemaker that he was able to ride Gobballs. He died when he mistook a Jelly for a Gobball... It was the day of his brother\'s wedding, he was understandably a little under the weather.",ep:1,g:9,l:17,wd:true,fm:true,w:10,p:950};
I[904] = {n:"Klime\'s Great Boots",t:11,d:"These boots gave such agility to Klime the Shoemaker that he was able to ride Gobballs. He died when he mistook a Jelly for a Gobball... It was the day of his brother\'s wedding, he was understandably a little under the weather.",ep:1,g:9,l:18,wd:true,fm:true,w:10,p:1100};
I[905] = {n:"Klime\'s Ultra-Powerful Boots",t:11,d:"According to the legend, these boots were secretly replaced by another pair, which though defective, were ultra-powerful; they were made by a clumsy, overworked shoemaker.",ep:1,g:9,l:41,wd:true,fm:true,w:10,p:4500};
I[906] = {n:"Small Chase Boots",t:11,d:"With these boots, Hogmeiser used to chase off the only human beings he couldn\'t stand the sight of: children. Fortunately for them, the weight of the footwear prevented him from ever catching a single one.",ep:20,g:10,l:31,wd:true,fm:true,w:9,p:2700};
I[907] = {n:"Chase Boots",t:11,d:"With these boots, Hogmeiser used to chase off the only human beings he couldn\'t stand the sight of: children. Fortunately for them, the weight of the footwear prevented him from ever catching a single one.",ep:20,g:10,l:34,wd:true,fm:true,w:10,p:3200};
I[908] = {n:"Great Chase Boots",t:11,d:"With these boots, Hogmeiser used to chase off the only human beings he couldn\'t stand the sight of: children. Fortunately for them, the weight of the footwear prevented him from ever catching a single one.",ep:20,g:10,l:37,wd:true,fm:true,w:11,p:3700};
I[909] = {n:"Powerful Chase Boots",t:11,d:"With these boots, Hogmeiser used to chase off the only human beings he couldn\'t stand the sight of: children. Fortunately for them, the weight of the footwear prevented him from ever catching a single one.",ep:20,g:10,l:39,wd:true,fm:true,w:12,p:4200};
I[910] = {n:"Hogmeiser\'s Boots",t:11,d:"These boots belonged to Hogmeiser for many years, before he actually lost them on a stupid bet with Grizmine. The moral of this story is... never gamble with an Ecaflip.",ep:2,g:11,l:76,wd:true,fm:true,w:20,p:15000};
I[911] = {n:"Hogmeiser\'s Worn Boots",t:11,d:"These boots seem to have belonged to Hogmeiser for many years. They are now worn and uncomfortable. If you\'re lucky enough, a good shoemaker will repair them for you.",ep:1,g:11,l:1,wd:true,fm:true,w:10,p:10};
I[912] = {n:"Hogmeiser\'s Golden Boots",t:11,d:"These magnificent Hogmeiser boots are finely peppered with precious stones, protecting you against magic attacks. Brouce Boulgoure himself used them to crush the Treechnid King\'s head many years ago, just to liven up the opening of the Trool Fair.",ep:2,g:12,l:99,wd:true,fm:true,w:30,p:25000};
I[916] = {n:"Silicate Amulet",t:1,d:"Silicate made this amulet on a wintry morning for a famous adventurer named Rimb Vardi, who was hunting down an old Magus Bwork. The bungling magic that followed was the root of many a natural disaster.",ep:1,g:9,l:37,wd:true,fm:true,w:2,p:3700};
I[917] = {n:"Autumn Leaf",t:1,d:"This Brooch was made one fall morning in the depths of a Beech and Elm forest, near the Olag-Lacustre Island. It is considered to be a true relic by a great many Lumberjacks.",ep:7,g:64,l:89,wd:true,fm:true,w:2,p:20500};
I[918] = {n:"Ancestral Amber",t:50,d:"This amber comes from an Ancestral Treechnid and is priceless. It can confer magic properties on some items, provided they are made by skilled hands.",ep:9,g:108,l:100,wd:true,fm:true,w:2,p:200};
I[919] = {n:"Ancestral Daggers",t:5,d:"These powerful daggers, forged from Ancestral Amber according to ancient techniques, were used during the colonization of Moon Island. It soon became wild again.",ep:9,g:8,l:34,wd:true,fm:true,w:10,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>34&CI>10",p:3300};
I[920] = {n:"Ancestral Wood",t:38,d:"This elm wood comes from the Olag-lacustre Island, which was struck by lightning one Fall morning. Rumours have it that a Bwork Magus is responsible for it because he didn\'t control his elementary spells properly.",ep:2,g:678,l:100,wd:true,fm:true,w:1,p:0};
I[922] = {n:"Axe Smith\'s Hammer",t:7,d:"An essential tool for making axes.",ep:1,g:2,l:1,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,50,50,false,false],p:150};
I[923] = {n:"Treechnid Splitter",t:19,d:"This battle axe was forged by Kademlia Boulgoure to fight against the most terrifying Treechnids. Legend has it that this legendary weapon killed more Treechnids in a night than there are trees in Amakna.",ep:7,g:12,l:74,wd:true,fm:true,w:190,an:17,e:[5,4,1,1,45,45,false,false],c:"CS>148&CW>10&CV>30",p:14400};
I[924] = {n:"Klime\'s Powerful Boots",t:11,d:"These boots gave such agility to Klime the Shoemaker that he was able to ride Gobballs. He died when he mistook a Jelly for a Gobball... It was the day of his brother\'s wedding, he was understandably a little under the weather.",ep:1,g:9,l:19,wd:true,fm:true,w:20,p:1200};
I[926] = {n:"Bewitched Wood",t:38,d:"This wood was bewitched by a Treechnid Magus to give birth to a tiny Treechnid once put into water. This wood is obviously extremely magical.",ep:1,g:140,l:45,wd:true,fm:true,w:30,p:0};
I[927] = {n:"Ancestral Treechnid Splitter",t:19,d:"This battle axe was forged by Kademlia Boulgoure to fight against the Ancestral Treechnid. Only the best warriors can handle it.",ep:3,g:13,l:93,wd:true,fm:true,w:100,an:17,tw:true,e:[10,4,1,1,40,50,false,false],c:"CS>200&CI>100",p:22400};
I[928] = {n:"Ogralimde\'s Sword",t:6,d:"Ogralimde was a great warrior who derived his strength from his master Adyol, an exceptionally intelligent and powerful Bwork Magus. This apprentice never surpassed his master.",ep:1,g:12,l:45,wd:true,fm:true,w:10,an:14,e:[2,4,1,1,25,25,false,false],c:"CS>100",p:4500};
I[929] = {n:"Kristalite",t:50,d:"This magic stone with a particular name is not suitable for general public as it can give great powers to weapons and jewels.",ep:22,g:705,l:120,wd:true,fm:true,w:20,p:500};
I[930] = {n:"Dark Miners\' Treasure Map",t:24,d:"This map reveals the location of the Dark Miners\' Treasure Chest:  \n" + "\"" + "The chest may be found on an island. You\'ll have to pass behind a foundry to lay your hands on it." + "\"" + "",ep:1,g:6,l:1,wd:true,fm:true,w:0,p:1};
