I[939] = {n:"Bworks\' Treasure Map",t:24,d:"This map indicates the location of the Bworks\' treasure chest: " + "\"" + "The chest may be found in a dead end, in the South-East of the Dark Forest. It will certainly be kept by a group of Bworks." + "\"" + "",ep:3,g:7,l:1,wd:true,fm:true,w:0,p:1};
