I[949] = {n:"Great Vitality Headband",t:16,d:"This headband increases vitality.",ep:1,g:20,l:3,wd:true,fm:true,w:2,p:4500};
I[951] = {n:"Needles and Thread",t:20,d:"This needle and thread will help you on your way to becoming a great tailor.",ep:2,g:4,l:1,wd:true,fm:true,w:1,an:4,e:[1,4,1,1,100,100,false,false],p:100};
I[952] = {n:"Mad Boowolf Cloak",t:17,d:"This cloak was made of hairs and other organic elements taken from Boowolves... I can smell its power from here...",ep:1,g:3,l:33,wd:true,fm:true,w:5,p:3075};
I[953] = {n:"Mad Tofu Cloak",t:17,d:"With this handmade cloak of Tofu feathers, you will be able to run faster and escape from tackle zones with the grace of a shotgun-blasted pigeon...",ep:1,g:19,l:36,wd:true,fm:true,w:10,p:3075};
I[954] = {n:"Poak Cloak",t:17,d:"The Samoulaille is a legendary cloak, embroidered specially for warriors who live for close combat situations.",ep:7,g:2,l:22,wd:true,fm:true,w:10,p:1500};
I[955] = {n:"Cape Hillary",t:17,d:"Hairdressers use the Cape Hillary to tie up their hair. Will you?",ep:8,g:5,l:34,wd:true,fm:true,w:10,p:3275};
I[956] = {n:"Cape Rice",t:17,d:"This cloak increases your range, allowing distant targets to be attacked... or naÃ¯ve adventurers to be dumbfounded into unsuspecting admiration. Haha!",ep:8,g:7,l:33,wd:true,fm:true,w:10,p:3000};
I[957] = {n:"The Gobb",t:17,d:"The Gobb increases damage and vitality, but it gives off a nasty odour, too. Don\'t be surprised if the Gobballs think you\'re one of the gang.",ep:5,g:12,l:23,wd:true,fm:true,w:15,p:1575};
I[958] = {n:"Dofusteuse",t:17,d:"This cloak is certainly one of the most powerful of its kind in the world. It increases all the characteristics of its wearer.",ep:1,g:8,l:6,wd:true,fm:true,w:15,p:100000};
I[959] = {n:"Treasure Map 5",t:24,d:"-- to do --",ep:1,g:10,l:1,wd:true,fm:true,w:0,p:1};
I[960] = {n:"Wabbit Potion",t:24,d:"This potion is a cure for myxomawosis. A sip of it and you will be able to visit Wabbit Island safely.",ep:5,g:2,l:1,wd:true,fm:true,w:0,p:1};
I[961] = {n:"Wabbit Key",t:24,d:"One of the three keys which will enable you to enter the Wabbit Castle.",ep:8,g:3,l:1,wd:true,fm:true,w:0,p:1};
I[962] = {n:"Wabbit Key",t:24,d:"One of the three keys which will enable you to enter the Wabbit Castle.",ep:8,g:4,l:1,wd:true,fm:true,w:0,p:1};
I[963] = {n:"Wabbit Key",t:24,d:"One of the three keys which will enable you to enter the Wabbit Castle.",ep:8,g:5,l:1,wd:true,fm:true,w:0,p:1};
I[965] = {n:"Dopple Stone",t:50,d:"This stone comes from the Dopple World. It\'s highly-prized by some inhabitants of Amakna.",ep:2,g:663,l:41,wd:true,fm:true,w:15,p:10000};
I[966] = {n:"Tailor Manual",t:25,d:"(Double click to learn how to become a Tailor) \nThis tailor manual will teach you the tricks of the trade. For those who lack imagination, the first pages have a few simple cut out patterns.",ep:1,g:13,l:1,wd:true,fm:true,w:1,u:true,p:100};
I[967] = {n:"Dazzling Cloak",t:17,d:"This magnificent cloak increases AP, as well as vitality and wisdom.",ep:13,g:78,l:55,wd:true,fm:true,w:20,p:100000};
I[968] = {n:"Dazzling Belt",t:10,d:"This magnificent belt increases action points, vitality and wisdom.",ep:1,g:10,l:30,wd:true,fm:true,w:200,p:100000};
I[969] = {n:"Wa Wabbit\'s Crown",t:16,d:"This magnificent Crown once belonged to the notorious Wa Wabbit.",ep:8,g:21,l:30,wd:true,fm:true,w:30,s:40,p:3000};
I[970] = {n:"Wa Wabbit\'s Staff",t:4,d:"This staff once belonged to the notorious Wa Wabbit.",ep:8,g:21,l:25,wd:true,fm:true,w:20,an:12,tw:true,e:[5,5,1,1,30,20,false,false],s:40,p:2500};
I[971] = {n:"Wa Wabbit\'s Cloak",t:17,d:"This cloak once belonged to the notorious Wa Wabbit. It is still impregnated with his perspiration which will bring back a few memories of the amazing fight every time you put it on.",ep:8,g:21,l:30,wd:true,fm:true,w:25,s:40,p:2525};
I[972] = {n:"Cawwot Dofus",t:23,d:"The Cawwot Dofus increases its bearer\'s wisdom.",ep:1,g:6,l:6,wd:true,fm:true,w:5,p:100000};
I[973] = {n:"Arachnid Leg",t:24,d:"A very thin but very hairy Leg. The best Alchemists manage to create powerful poisons with the juice extracted from these legs.",ep:2,g:11,l:1,wd:true,fm:true,w:0,p:1};
I[974] = {n:"Distressed Farmer\'s Head",t:24,d:"He had it coming: the distressed farmer lost his head...",ep:1,g:12,l:1,wd:true,fm:true,w:0,p:1};
I[975] = {n:"Captive Vampire Fang",t:24,d:"This very pointy fang belonged to a vampire. If you wear it round your neck, or even if you simply carry it in your inventory... you\'ll be able to show it to your buddies. Sorry, were you expecting more?",ep:1,g:13,l:1,wd:true,fm:true,w:0,p:1};
I[976] = {n:"Pumpkwin",t:16,d:"A distinctive feature of the Pumpkwin is that it prevents the dispersion of magic particles, making it a good magic insulator. That\'s why some warriors use this vegetable as headgear.",ep:4,g:24,l:20,wd:true,fm:true,w:10,p:500};
I[989] = {n:"Lemon Shigekax",t:42,d:"Rediscover the flavour of bygone days with this bitter lemon drop. \nThis candy gives 100 energy points.",ep:1,g:23,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[990] = {n:"Strawberry Shigekax",t:42,d:"Rediscover the flavour of bygone days with this strawberry drop.",ep:13,g:25,l:1,wd:true,fm:true,w:1,u:true,p:140};
I[991] = {n:"Mint Shigekax",t:42,d:"Rediscover the flavour of bygone days with this minty drop. \nThis candy gives 200 energy points.",ep:2,g:24,l:1,wd:true,fm:true,w:1,u:true,p:400};
I[992] = {n:"Cherry Shigekax",t:42,d:"Rediscover the flavour of bygone days with this cherry drop. \nThis candy gives 50 energy points.",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:100};
I[993] = {n:"Greenjely",t:42,d:"Though made of mint jelly, this candy has repulsed more than a few vegetarians, but it\'s still a speciality of Amakna.",ep:5,g:21,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[994] = {n:"Redjely",t:42,d:"Made out of strawberry jelly, even if it repelled quite a few vegetarian, it\'s still a specialty of Amakna.",ep:5,g:20,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[995] = {n:"Blujely",t:42,d:"Blue-jelly based, it\'s one of the specialties of Amakna even though it repelled many vegetarians.",ep:5,g:22,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[996] = {n:"Multijely",t:42,d:"Multijely was banned after children started disappearing soon after eating it. Not long after, they realised the kids were just going to the shop to get more.",ep:5,g:26,l:1,wd:false,fm:true,w:1,c:"Sc!1056",u:true,p:100};
I[997] = {n:"Kokonut",t:46,d:"Round as a cannonball, the Kokonut also has 3 holes, which makes it very easy to throw away.",ep:12,g:159,l:42,wd:true,fm:true,w:2,p:1};
I[998] = {n:"Captain Pirate\'s Cute Shorts",t:15,d:"Captain Pirate\'s shorts are the proof that ridicule has actually killed someone. But apparently, they are also very lucky.",ep:12,g:163,l:82,wd:true,fm:true,w:2,p:1};
I[999] = {n:"Not Tempting Canvas",t:55,d:"This large piece of canvas is slimy and smelly but yet of quite good quality. Too bad it has so many holes!",ep:12,g:164,l:1,wd:true,fm:true,w:5,p:1};
I[1000] = {n:"Empty Barrel",t:15,d:"This big barrel was emptied a long time ago, nevertheless we can still guess what it used to contain: rum, Kamas, drunken pirates... anything you can find in a barrel besides water.",ep:12,g:165,l:1,wd:true,fm:true,w:5,p:1};
I[1001] = {n:"Kokoko Wood Plank",t:95,d:"What will you do with this plank? Build a boat? Lay a floor in your house? Do you really care? Whatever, it\'s just a simple plank for the moment.",ep:12,g:166,l:42,wd:true,fm:true,w:10,p:10};
I[1002] = {n:"Kokonut Palm Trunk",t:38,d:"Kokonut palm trunks are similar to other trunks: straight and strong, yet they are slightly thinner than the average.",ep:12,g:167,l:42,wd:true,fm:true,w:1,p:1};
I[1003] = {n:"Kokoko Wood Beam",t:38,d:"Solid wood beam. Don\'t put it into someone\'s eye.",ep:12,g:168,l:42,wd:true,fm:true,w:1,p:1};
I[1004] = {n:"Essential Rope",t:15,d:"No self-respecting adventurer would go without such a Rope in his inventory. You should be advised to do the same, although it\'s a piece of advice seldom taken!",ep:12,g:170,l:1,wd:true,fm:true,w:1,p:1};
I[1005] = {n:"Raft Receipt",t:24,d:"A receipt signed by Kib Rock telling you your raft will be ready soon.",ep:1,g:176,l:1,wd:true,fm:true,w:0,p:1};
I[1006] = {n:"Pirate Hat",t:24,d:"Large brim, the insignia of death embroidered on, fur to make it nice...This pirate hat is a classic of its kind among captains.",ep:12,g:14,l:1,wd:true,fm:true,w:0,p:1};
I[1007] = {n:"Hook",t:24,d:"Essential accessory for unlucky pirates, this hook can be used as a hand. Its colour gives it a classy style...",ep:12,g:15,l:1,wd:true,fm:true,w:0,p:1};
I[1008] = {n:"Falling Jaw",t:24,d:"People say that this Jaw necklace was created when a captain caught one of his sailors smiling at him.",ep:12,g:16,l:1,wd:true,fm:true,w:0,p:1};
I[1009] = {n:"Pirate Skull",t:24,d:"This skull wearing a headband proves that a even a dead pirate can hide his baldness.",ep:12,g:17,l:1,wd:true,fm:true,w:0,p:1};
I[1010] = {n:"Green Shell",t:24,d:"The shell of a mad turtle that thinks it\'s a ninja.",ep:12,g:18,l:1,wd:true,fm:true,w:0,p:1};
I[1011] = {n:"Yellow Shell",t:24,d:"The Shell of a mad turtle who had probably ingested too many dangerous substances.",ep:12,g:19,l:1,wd:true,fm:true,w:0,p:1};
I[1012] = {n:"Red Shell",t:24,d:"The shell of a mad turtle that liked tomatoes and cheese on a warm slice of bread.",ep:12,g:20,l:1,wd:true,fm:true,w:0,p:1};
I[1013] = {n:"Blue Shell",t:24,d:"The shell of a mad turtle who wanted to imitate Zowwo, the Masked Fox.",ep:12,g:21,l:1,wd:true,fm:true,w:0,p:1};
I[1014] = {n:"Green Mask",t:24,d:"This Mask of Cheerful Kanniball has been made in the image of Greenery, element which is linked to meat seasoning.",ep:12,g:22,l:1,wd:true,fm:true,w:0,p:1};
I[1015] = {n:"Yellow Mask",t:24,d:"This Whining Kanniball mask has been made in the image of Lightning. What does that mean? Hey, I just work here, buddy.",ep:12,g:23,l:1,wd:true,fm:true,w:0,p:1};
I[1016] = {n:"Red Mask",t:24,d:"This Mask of Irascible Kanniball has been made in the image of Fire, element of roasting meat.",ep:12,g:24,l:1,wd:true,fm:true,w:0,p:1};
I[1017] = {n:"Blue Mask",t:24,d:"Mask of a Surprised Kanniball that has been made in the image of Water, element which slakes thirst between two mouthfuls of meat.",ep:12,g:25,l:1,wd:true,fm:true,w:0,p:1};
I[1018] = {n:"Glu",t:15,d:"This pot of pink jelly might smell good... But you must never taste it or you won\'t ever speak again. It\'s an excellent fixative.",ep:12,g:171,l:1,wd:true,fm:true,w:1,p:1};
I[1019] = {n:"Helmet",t:16,d:"With that Helmet on, you\'ll have a very special look... halfway between ridiculous and  comical.",ep:1,g:25,l:20,wd:true,fm:true,w:10,p:200};
I[1020] = {n:"Broken Helmet",t:15,d:"This helmet took a bullet for you pal... He died for you, man...",ep:2,g:173,l:1,wd:true,fm:true,w:5,p:1};
I[1021] = {n:"Wooden Wings",t:17,d:"For those who have always dreamt of flying like a Kwak, go back to bed because these wings will turn you into a public menace and an idiot.",ep:1,g:22,l:20,wd:true,fm:true,w:20,p:1200};
I[1022] = {n:"Broken Wings",t:104,d:"Looking at these broken wings makes you realise just how badly you wanted to stay in bed this morning.",ep:2,g:174,l:1,wd:true,fm:true,w:10,p:1};
I[1023] = {n:"Bottle of Rum",t:15,d:"The label says \'10 year old rum\' but it is quite impossible to check if it tells the truth. Don\'t drink it excessively on the road for fear of seasickness.",ep:12,g:177,l:1,wd:true,fm:true,w:2,p:1};
I[1026] = {n:"Small Stek Knife",t:5,d:"One day, the infamously crazy T. Bun Stek found two strange yet impressive knives... No one could figure out what they were for. He used the very same knives to sacrifice half his livestock to the Gods and soon after they bellowed the answer from the heave\'s. He was slaughtering a particularly noisy cow at that very moment... The poor guy didn\'t hear a word.",ep:1,g:13,l:32,wd:true,fm:true,w:10,an:13,e:[15,3,1,1,30,50,false,false],c:"CA>32&CS>10",p:3000};
