I[1030] = {n:"Kitten Tails",t:5,d:"This pair of daggers is in fact a magic game. Designed to entertain young Ecaflips, it was taken off the market when a visiting Sram decided to join. She was only a child... Shame on you... shame on us all.",ep:14,g:20,l:25,wd:true,fm:true,w:10,an:13,e:[15,3,1,1,30,50,false,false],c:"CA>40&CS>20&CV>20",p:1800};
I[1031] = {n:"Elorie Entuwan\'s Cruel Daggers",t:5,d:"These magnificent daggers once belonged to the cruellest Sramette Amakna ever saw... Just being AS cruel as most Srams is quite an achievement... She was bad.",ep:1,g:7,l:40,wd:true,fm:true,w:1,an:13,e:[12,3,1,1,30,50,false,false],c:"CA>40",p:4000};
I[1032] = {n:"Small Rowler Blade",t:5,d:"This dagger was originally used by the secret brotherhood of Rowler. This guild wanted to plunge Amakna into chaos. They finally disappeared when the island where they hid and schemed was submerged by the waves.",ep:1,g:14,l:44,wd:true,fm:true,w:10,an:13,e:[13,3,1,1,30,50,false,false],c:"CA>44&CC>5",p:5000};
