I[1040] = {n:"Ortimus Contrari\'s Bloody Blades",t:5,d:"Ortimus Contrari is a legendary assassin. If I told you how he carried out his contracts... you\'d want to kill yourself even before he got to you.",ep:9,g:19,l:80,wd:true,fm:true,w:15,an:13,e:[15,3,1,1,20,50,false,false],c:"CA>79&CS>40",p:10000};
I[1041] = {n:"Unlucky Knight\'s Broken Sword",t:5,d:"The legends tell of a famous Iop who left his island home and travelled across the sea to find work as an interpreter for the Kings of Amakna. He took to the job full of hope, enthusiasm and diligence, dazzling Ecaflips and Fecas alike with his vibrant wordplay and passion for good grammar. Unfortunately, on his way to the castle, he stumbled over a rock that turned out to be a Mega Crackler, and this broken sword was the only trace they found of him, or his equipment.",ep:1,g:43,l:35,wd:true,fm:true,w:20,an:13,e:[5,5,1,1,30,50,false,false],c:"CS>20",p:3000};
I[1042] = {n:"Small Sleeping Shovel",t:8,d:"This shovel is made of a very rare wood. According to the legend, young girls fall into an eternal sleep when they touch this weapon. Note that in case of repeated contact, valiant heroes can also be affected.",ep:1,g:20,l:34,wd:true,fm:true,w:30,an:16,e:[5,4,1,1,40,40,false,false],c:"CS>4&CC>26",p:3200};
