I[1046] = {n:"Small Mishmashovel",t:8,d:"What can be better than an eco-friendly shovel to clear your garden of weeds? This shovel is THE best way of getting rid of daisies. It\'s also great to feed them to your enemies.",ep:1,g:18,l:38,wd:true,fm:true,w:40,an:16,e:[7,4,1,1,30,50,false,false],c:"CS>10&CC>28",p:4000};
