I[1050] = {n:"Small Woukuis Shovel",t:8,d:"The Woukuis family forged this shovel during the war between the Elle-Poma and the Touge-Woukuis. The one problem is that it covers your hands with grease. It\'s also very popular with unmarried warriors who spend a lot of time alone. Dunno why.",ep:3,g:21,l:49,wd:true,fm:true,w:35,an:16,e:[5,4,1,1,40,40,false,false],c:"CC>40&CS>40",p:5000};
