I[1054] = {n:"Cruel Trovel",t:8,d:"Half trowel and half shovel, the Trovel went out of fashion with builders and was remarketed as a weapon. Easy to handle and to put away thanks to its size, it\'s the ideal accessory for any Enutrof that\'s fond of a drink.",ep:13,g:15,l:53,wd:true,fm:true,w:20,an:16,e:[5,3,1,1,40,40,false,false],c:"CC>47",p:5000};
I[1055] = {n:"Koutoulou\'s Small Shovel",t:8,d:"These ghastly shovels are hand-crafted by the islanders of Koutoulou who use whatever materials come to hand to make them. Useless for digging holes, their main purpose is  to ward off imaginary spirits and naughty children.",ep:8,g:19,l:25,wd:true,fm:true,w:30,an:16,e:[5,4,1,1,40,40,false,false],c:"CC>22&CI>3",p:1500};
