I[1084] = {n:"Hammer of Wrongs",t:7,d:"With this fearsome Hammer you will be able to prove the popular belief that muscles are more important than intelligence. This logic only works for people who are weaker than you, however. As we say ourselves... Strong is... never wrong.",ep:9,g:20,l:81,wd:true,fm:true,w:60,an:15,e:[10,4,1,1,40,50,false,false],c:"CI>100",p:15000};
I[1085] = {n:"Falistos\' Maul",t:7,d:"Falistos are Xelor demons. They betrayed their old principles and increased their strength by forging more and more powerful hammers. After spreading chaos across the land, they were defeated and banished underground. But some of the weapons they forged remained intact...",ep:9,g:19,l:79,wd:true,fm:true,w:70,an:15,tw:true,e:[15,7,1,1,50,25,false,false],c:"CS>79",p:10000};
