I[1141] = {n:"Earth Kwak Feather",t:53,d:"A distinctive feature of this feather is that it resists falling rocks. That\'s why Earth Quacks are never buried by landslides.",ep:5,g:223,l:24,wd:true,fm:true,w:1,p:20};
I[1142] = {n:"Earth Kwak Beak",t:47,d:"Thanks to its extraordinarily strong beak, the Fire Kwak can put out embers, just  for the pleasure of putting out embers. Fire Kwaks are really strange, there\'s no doubt about it.",ep:5,g:222,l:24,wd:true,fm:true,w:1,p:20};
I[1143] = {n:"Small Iron Wand",t:3,d:"According to the tag, this wand has the power to make people obey whoever is holding it. The instructions say you have to shake it rapidly near your adversary. If it doesn\'t work, try and poke him in the eye with it.",ep:4,g:21,l:56,wd:true,fm:true,w:15,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>80",p:20000};
