I[1147] = {n:"True Fake Magic Staff",t:4,d:"This staff is a replica of a legendary artefact, but with slightly lesser powers. It sends out light if it falls on the ground and it can distort your voice to any pitch you desire. The latter feature is useful for luring enemies into mortal traps... just don\'t try to kill them with it when they fall for your trick.",ep:1,g:16,l:35,wd:true,fm:true,w:15,an:12,e:[7,4,1,1,50,50,false,true],c:"CI>45",p:7000};
I[1148] = {n:"Small Dakn Staff",t:4,d:"Most young Fecas have staffs quite similar to this one. More than a fashion, it\'s almost become a ritual.  Has no one ever told them how ridiculous they look?",ep:5,g:19,l:24,wd:true,fm:true,w:30,an:12,e:[5,4,1,1,30,50,false,true],c:"CS>25&CA>5",p:5000};
