I[1152] = {n:"Small Crystal Staff-Ball",t:4,d:"A short-sighted, grumbling, fortune telling, smelly old Feca accidentally created this powerful weapon when her staff rammed into her crystal ball as she slipped from the kitchen table. She\'d read her own fortune long before and, well, she more or less lived on that table... wonder what it was she thought was going to kill her... well, I guess she wasn\'t the best fortune teller.",ep:5,g:18,l:28,wd:true,fm:true,w:15,an:12,e:[5,3,1,1,40,50,false,true],c:"CW>10&CA>20",p:8000};
