I[1324] = {n:"Catmint",t:36,d:"This plant will make the mouth of an Ecaflip water.",ep:2,g:46,l:1,wd:true,fm:true,w:1,p:5000};
I[1325] = {n:"Walnut Shell",t:46,d:"Naturally resistant to all kind of aggressions, this shell symbolizes the Feca ideology.",ep:2,g:52,l:1,wd:true,fm:true,w:1,p:5000};
I[1326] = {n:"Bloody Flint",t:51,d:"This resistant and sharpened stone has apparently been used against something or someone. It is a raw and dangerous item which perfectly illustrates the characteristics of a Iop.",ep:2,g:47,l:1,wd:true,fm:true,w:1,p:5000};
I[1327] = {n:"Carved Bone",t:47,d:"It\'s a fearsome and gloomy item. Once worked it\'s as dangerous as a Sram.",ep:2,g:48,l:1,wd:true,fm:true,w:1,p:5000};
I[1328] = {n:"Enigmatic Kama",t:15,d:"A Tofu head with a strange Tofu hat on decorates this Kama.",ep:1,g:182,l:1,wd:true,fm:true,w:10,p:1};
I[1329] = {n:"Flexible Wood",t:38,d:"This big wooden branch, with its flexible and curvilinear shape makes you immediately think of Cras.",ep:2,g:49,l:1,wd:true,fm:true,w:1,p:5000};
I[1330] = {n:"Amulet Itbe",t:1,d:"It is an original creation of the silversmith John-Lay Nonne, and now one of the most sought after jewels on the continent.",ep:1,g:31,l:10,wd:true,fm:true,w:5,p:500};
I[1331] = {n:"Oly Medal",t:1,d:"Oly was a female Iop with only one ability - cooking. It is said that Iop himself gave her this medal in order to compensate for her weaknesses in battle. Only pure-hearted people can wear it.",ep:7,g:23,l:51,wd:true,fm:true,w:10,c:"Ps=1&Pa>10",p:7000};
I[1332] = {n:"Old Four-Leaf Clover",t:36,d:"Four-leaf clovers are rarer than five-leaf ones. So when you find one, you should rub it dry between two spell scrolls.",ep:2,g:50,l:1,wd:true,fm:true,w:1,p:5000};
I[1333] = {n:"Spark Potion",t:26,d:"Thanks to the feeble fire magic it contains, this warming potion is usually used to weakly enchant all sorts of items.",ep:3,g:19,l:1,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:250};
I[1334] = {n:"Sulphur Pouch",t:48,d:"This little pouch of sulphur gives off an unbearable smell...The same smell as an Osamodas.",ep:2,g:51,l:1,wd:true,fm:true,w:1,p:5000};
I[1335] = {n:"Drizzle Potion",t:26,d:"Thanks to the feeble water magic it contains, this simmering potion is usually used to weakly enchant all sorts of items.",ep:3,g:22,l:1,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:250};
I[1336] = {n:"Nettles",t:36,d:"Rapidly rubbing this plant on your skin will make you suffer torture but the stimulation produces beneficial effects... well, that\'s what Sacriers say at least.",ep:2,g:53,l:1,wd:true,fm:true,w:1,p:5000};
I[1337] = {n:"Draught Potion",t:26,d:"Thanks to the feeble air magic it contains, this sighing potion is usually used to weakly enchant all sorts of items.",ep:3,g:25,l:1,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:250};
I[1338] = {n:"Tremor Potion",t:26,d:"Thanks to the feeble earth magic it contains, this vibrating potion is usually used to weakly enchant all sorts of items.",ep:3,g:28,l:1,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:250};
I[1339] = {n:"Bluebells",t:35,d:"Bluebells are very small, delicate and attractive. On top of that, some say they have the power to calm down spirits and cure some illnesses. They were probably created by a divinity who wanted a plant in the image of the Eniripsas.",ep:2,g:46,l:1,wd:true,fm:true,w:1,p:5000};
I[1340] = {n:"Landslide Potion",t:26,d:"Thanks to the earth magic it contains, this trembling potion is usually used to enchant all sorts of items.",ep:9,g:29,l:25,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:500};
I[1341] = {n:"Shower Potion",t:26,d:"Thanks to the water magic it contains, this lapping potion is usually used to enchant all sorts of items.",ep:9,g:23,l:25,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:500};
I[1342] = {n:"Gust Potion",t:26,d:"Thanks to the air magic it contains, this whistling potion is usually used to enchant all sorts of items.",ep:9,g:26,l:25,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:500};
I[1343] = {n:"Blazing Fire Potion",t:26,d:"Thanks to the fire magic it contains, this crackling potion is usually used to enchant all sorts of items.",ep:9,g:20,l:25,wd:true,fm:true,w:1,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:500};
I[1344] = {n:"Vervain",t:36,d:"This special plant helps people go to sleep. It must be the emblem of Sadida.",ep:2,g:53,l:1,wd:true,fm:true,w:1,p:5000};
I[1345] = {n:"Fire Potion",t:26,d:"Thanks to the powerful fire magic it contains, this fulminating potion is usually used to powerfully enchant all sorts of items.",ep:4,g:21,l:50,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:800};
I[1346] = {n:"Tsunami Potion",t:26,d:"Thanks to the powerful water magic it contains, this flooding potion is usually used to powerfully enchant all sorts of items.",ep:4,g:24,l:50,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:800};
I[1347] = {n:"Hurricane Potion",t:26,d:"Thanks to the powerful air magic it contains, this howling potion is usually used to powerfully enchant all sorts of items.",ep:4,g:27,l:50,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:800};
I[1348] = {n:"Earthquake Potion",t:26,d:"Thanks to the powerful earth magic it contains, this entangling potion is usually used to powerfully enchant all sorts of items.",ep:4,g:30,l:50,wd:true,fm:true,w:6,c:"Pj=48|Pj=49|Pj=50|Pj=46|Pj=44|Pj=45|Pj=43|Pj=47",p:800};
I[1350] = {n:"Strong Bow",t:2,d:"This bow was created by a wizard who was fond of his cider. In order to ease his crippling hangovers, he invented this water-type bow.",ep:3,g:4,l:15,wd:true,fm:true,w:10,an:10,tw:true,e:[5,5,3,6,30,50,false,true],p:250};
I[1351] = {n:"Ykulf Bow",t:2,d:"As the saying goes " + "\"" + "With a bow, it\'s make or break" + "\"" + ". Wise men avoid this bow. The rumour is it has the evil eye...",ep:1,g:51,l:30,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,6,10,10,false,true],c:"CC>30",p:1600};
I[1352] = {n:"Mushd Bow",t:2,d:"This bow carries the forces of earth and water. Woe betide him who cannot control at least one of the two...",ep:2,g:6,l:50,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],p:5000};
I[1353] = {n:"Sawn-Off Pulley Bow",t:2,d:"All the pulleys of this bow were sawn off. It used to be a symbol of the conflict between Good and Evil.\nTouch it and you\'ll feel the supreme justice of the ancient lawmakers running through your fingertips.",ep:12,g:10,l:41,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],c:"Ps=1&Pa>10&CI>30&CW>30",p:200};
I[1354] = {n:"Hickory Tree",t:2,d:"Hick was an accursed Cra: he couldn\'t stop hiccupping... One day he threw his bow into the fire and decided to use a sword instead. The curse strangely disappeared at that exact moment...",ep:13,g:11,l:50,wd:true,fm:true,w:10,an:10,tw:true,e:[5,5,2,6,40,40,false,true],p:1000};
I[1355] = {n:"Hidsad Bow",t:2,d:"The man who created this bow, a certain Marc Hidsad, never really knew how to use it. He usually hurt himself just as much as his enemies.",ep:14,g:12,l:40,wd:true,fm:true,w:10,an:10,tw:true,e:[5,5,2,7,30,50,false,true],p:4000};
I[1356] = {n:"Half Loaf",t:3,d:"Rika Zarouil The Female Baker was renowned for having been the smallest Eniripsa in the whole world of Amakna. She made her loaves in small cardboard furnaces and used this old bread to impale many a hero.",ep:1,g:13,l:11,wd:true,fm:true,w:10,an:11,e:[5,4,2,2,30,50,false,true],p:1000};
I[1357] = {n:"Wangs",t:3,d:"A mischievous sculptor tried to make people think his wands were daggers, calling them Wangers at first, and then simply Wangs. His plan didn\'t work, but his wands most definitely do.",ep:7,g:17,l:35,wd:true,fm:true,w:10,an:11,e:[5,4,2,2,40,40,false,true],c:"CI>25",p:3500};
I[1359] = {n:"Wily Wand",t:3,d:"The origins of this wand remain quite obscure. I can tell you that it\'s great for finding parking on a rainy Monday in Amakna town... Just points in the direction you need to go... It does one-way streets and everything!",ep:9,g:12,l:59,wd:true,fm:true,w:10,an:11,e:[7,3,2,3,30,50,false,true],c:"CI>70&CS>30",p:5000};
I[1360] = {n:"The Hyldegarde",t:3,d:"This wand was created many years ago in the forging flames of Dyin Ard. You\'d be well-advised to have a bucket of water at hand just to keep control of the mini-inferno.",ep:13,g:8,l:48,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],p:4800};
I[1361] = {n:"Sylvian Wand",t:3,d:"The Sylvian Wand gives you sharp sight. You\'ll probably use it for picking out a good escape route.",ep:1,g:15,l:43,wd:true,fm:true,w:10,an:11,e:[4,5,2,2,40,40,false,true],c:"CA>80",p:4000};
I[1362] = {n:"Vampiric Stake",t:3,d:"The Vampiric Stake is in fact the wand of a vampire who retired long ago from social life and slaughtering. This strange piece of wood has nevertheless inherited a few qualities from its former owner...",ep:7,g:14,l:65,wd:true,fm:true,w:10,an:11,e:[5,6,2,3,50,20,false,true],c:"CA>30&CW<60",p:4000};
I[1363] = {n:"Tont\'Ata Staff",t:4,d:"On top of its unbearable name, this staff has many ways to get on its owner\'s nerves.",ep:1,g:5,l:40,wd:true,fm:true,w:10,an:12,e:[5,5,1,1,5,5,false,true],c:"CI<100",p:5000};
I[1364] = {n:"Forgetfulness Staff",t:4,d:"This staff is just great... Gets rid of all your worries and bad vibes for a whole day... Along with about six weeks of your memory... And most of your... Okay, maybe it\'s not such a good idea.",ep:13,g:11,l:30,wd:true,fm:true,w:15,an:12,e:[5,3,1,1,50,50,false,true],c:"CW>50",p:3000};
I[1365] = {n:"Flatu Lance",t:4,d:"They say it was the staff that made a fearsome warrior of Heds, they say it was magic and could shoot fire. Ever heard of All Bran? Eight bowls of this stuff a day and you\'d be shooting fire too buddy...",ep:1,g:68,l:20,wd:true,fm:true,w:15,an:12,e:[8,5,1,1,50,40,false,true],p:2000};
I[1366] = {n:"Gobbherd Staff",t:4,d:"This staff is commonly used by gobbherds during the trading season to fend off the Bworks, who like to snack on the Gobball herds around this time. The prized dish is the gobbherd himself.",ep:9,g:9,l:12,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,50,50,false,true],p:1200};
I[1367] = {n:"Staff of Dina Mite",t:4,d:"This staff once belonged to the beautiful Dina Mite, renowned for her explosive voice... In her day, she was a cracker too.",ep:13,g:6,l:40,wd:true,fm:true,w:15,an:12,e:[5,5,1,1,30,50,false,true],c:"CI>50&CA>40",p:4000};
I[1368] = {n:"\'110\' Spear",t:4,d:"" + "\"" + "The 110" + "\"" + " was the name given to the 110 Amakna firemen who, in the year 450, valiantly fought the fire started by a bored Red Wyrmling. This spear belonged to one of them and will only respond to valiant hands.",ep:1,g:18,l:29,wd:true,fm:true,w:15,an:12,e:[5,4,1,1,40,50,false,true],c:"CC>10",p:2500};
I[1369] = {n:"Table Knives",t:5,d:"These knives have been specially conceived to be used in luxury restaurants. However, because of their rather strange appearance, the owner decided to resell them to a travelling knife thrower.",ep:1,g:13,l:33,wd:true,fm:true,w:10,an:13,e:[10,3,1,1,30,50,false,true],c:"CA>55&CC>5",p:3000};
I[1370] = {n:"Ergot Mina",t:5,d:"The hilt of this weapon is greasy and slippery but it really does look fab.",ep:1,g:14,l:20,wd:true,fm:true,w:10,an:13,e:[8,3,1,1,50,50,false,true],p:2000};
I[1371] = {n:"Eulasse Daggers",t:5,d:"Eulasse was a gobbherd in Amakna who one day found these dirty daggers in the Gobball dung heap. Be careful with them, the hilts are still a bit slippery...",ep:1,g:10,l:40,wd:true,fm:true,w:20,an:13,e:[10,3,1,1,30,50,false,true],c:"CA>40",p:4000};
I[1372] = {n:"Otof\'Mai\'We Daggers",t:5,d:"Otof\'Mai\'We was a hermit, a legendary disciple of Sram, who spent his life avoiding all sorts of contact with others. When he died, his favourite daggers were found next to his body. Only the nimblest of men can control them.",ep:9,g:19,l:44,wd:true,fm:true,w:15,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>60",p:5300};
I[1373] = {n:"The Infernal Razor",t:5,d:"Any Enutrof worthy of the name has a beard and old Krys Nosheive was no exception. One day his wife, Mrs Nosheive, bought him a razor, and he decided he would rather use it as a weapon.",ep:1,g:17,l:30,wd:true,fm:true,w:15,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>30",p:3000};
I[1374] = {n:"Tylo Daggers",t:5,d:"Tylo was an ancient scribe of Amakna... centuries ago. He had the strange habit of carving stone using daggers instead of chisels. This magnificent and resistant dagger belonged to him.",ep:1,g:12,l:30,wd:true,fm:true,w:13,an:13,e:[10,3,1,1,30,50,false,false],c:"CS>50",p:3000};
I[1375] = {n:"Terophyle Axe",t:19,d:"Terophyle the Iop was capable of lifting enormous stones... It\'s not really proof of intelligence to you or I, but a Iop who can capture the idea of picking up something round is already a king among his people.",ep:1,g:14,l:15,wd:true,fm:true,w:25,an:17,e:[10,5,1,1,50,50,false,true],c:"CS>70&CI<10",p:800};
I[1376] = {n:"Huvant Axe",t:19,d:"This axe might be heavy, but it will take down Trools in a flash. The magic runes it contains can also burn enemies.",ep:7,g:15,l:35,wd:true,fm:true,w:23,an:17,e:[10,5,1,1,40,50,false,true],c:"CS>50",p:3000};
I[1377] = {n:"Samuel J. Axe",t:19,d:"Hure was a young priest who used weapons freely to spread the word of God. His favourite weapon was an axe on which he inscribed numerous meaningful quotations... his final blows were always accompanied by a blood-curdling supplications, which ended, each word like a hot pin in the victim\'s ear, with the phrase " + "\"" + "And, you will know my name is The Lord when I lay my vengeance upon thee!" + "\"" + "",ep:1,g:16,l:22,wd:true,fm:true,w:22,an:17,e:[10,5,1,1,50,50,false,true],c:"CW>30",p:2200};
I[1378] = {n:"Jon Lemon",t:19,d:"Created for young, bloodthirsty warriors, this battle axe makes a deafening noise when it strikes another weapon.",ep:1,g:17,l:28,wd:true,fm:true,w:22,an:17,e:[8,5,1,1,40,40,false,true],c:"CA>30",p:2300};
I[1379] = {n:"The Bhharnsheee Hammer",t:7,d:"Legend has it that the name of this hammer is in fact the phonetic transcription of the noise it makes when it crushes a skull. Unfortunately, it is impossible to be sure since anyone within earshot tends not to make it out alive.",ep:7,g:9,l:35,wd:true,fm:true,w:35,an:15,e:[8,5,1,1,30,40,false,true],c:"CS>50&CA>20",p:35000};
I[1380] = {n:"Forgetfulness Potion: \'Curative Word\'",t:43,d:"Using this potion will cause you to unlearn one level of the Eniripsa spell \'Curative Word\'.",ep:2,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
