I[1383] = {n:"Tortoi Hammer",t:7,d:"It took many, many years and many, many smiths to forge this hammer. The result is a magnificent weapon which has unfortunately inherited a particular concept of efficiency from its creators.",ep:1,g:5,l:55,wd:true,fm:true,w:20,an:15,tw:true,e:[8,4,1,1,50,50,false,false],p:8000};
