I[1393] = {n:"The Metronome",t:7,d:"This Hammer was made from a clock, the famous clock swallowed by the Crocodyl when it devoured the hand of Captain Hawkfish. Though the clock has been located, the hand is still missing. Hawkfish\'s hand that is... the clock was in surprisingly good... Oh forget it.",ep:5,g:21,l:54,wd:true,fm:true,w:20,an:15,e:[8,6,1,1,40,40,false,true],c:"CI>62&CW>22",p:9700};
