I[1403] = {n:"Ha Hammer",t:7,d:"This hammer once belonged to Aha, a young Osamodas who wasted all his days telling painful one-liners. The hammer couldn\'t break open a hazelnut, but it\'s useful for breaking the ice from time to time.",ep:1,g:3,l:23,wd:true,fm:true,w:20,an:15,e:[4,4,1,1,30,30,false,true],c:"CA>20",p:1700};
I[1404] = {n:"Toh\'Lo Hammer",t:7,d:"So you like animals? So did Toh\'Lo. He devoted his whole life to helping them out. This hammer kind of represents his relationship with animals, a communion as shaky as a lame Gobball on a freshly gravelled driveway.",ep:5,g:15,l:35,wd:true,fm:true,w:35,an:15,e:[6,4,1,1,30,30,false,true],c:"CI>80&CW>30",p:3400};
I[1405] = {n:"Fairy Water",t:12,d:"The fairy water has healing properties similar to those of Eniripsa\'s blood. No more need to bleed the poor fellows dry...",ep:3,g:41,l:60,wd:true,fm:true,w:1,u:true,ut:true,p:100};
I[1406] = {n:"Unikron Blood",t:12,d:"This potion faithfully reproduces all the properties of Unikron blood, except immortality. Drink it and you\'ll be cured!",ep:3,g:40,l:60,wd:true,fm:true,w:1,u:true,ut:true,p:100};
