I[1426] = {n:"Layte\'s Slicer",t:8,d:"Layte, the creator of this shovel, was a devoted disciple of Iop. You can guess what this guy\'s major flaw was.",ep:3,g:8,l:24,wd:true,fm:true,w:24,an:16,e:[5,5,1,1,50,50,false,true],p:1800};
I[1427] = {n:"Zebuth Shovel",t:8,d:"This shovel is used by the Kanniball High Priests of Moon Island to invoke Zebuth, one of their gods who is often depicted as a cow. Only vile characters use it.",ep:1,g:40,l:55,wd:true,fm:true,w:30,an:16,e:[5,6,1,1,50,20,false,true],c:"Ps=2&CC>50",p:8000};
I[1428] = {n:"Everlasting Flower",t:36,d:"This strange little plant grows in arid environments and gives off a smell of curry. It seems it can resist ageing. If only all this could be said for woman...",ep:2,g:54,l:1,wd:true,fm:true,w:1,p:5000};
I[1429] = {n:"Small Mechba Shovel",t:8,d:"This shovel, created by Mechba, is used by Enutrof followers to knock nuts from trees. On the battlefield, it has a similar function. Yowza!",ep:1,g:19,l:30,wd:true,fm:true,w:15,an:16,e:[5,6,1,1,40,40,false,true],c:"CC>10&CI>10",p:1500};
I[1430] = {n:"Mechba Shovel",t:8,d:"This shovel, created by Mechba, is used by Enutrof followers to knock nuts from trees. On the battlefield, it has a similar function. Yowza!",ep:1,g:19,l:45,wd:true,fm:true,w:23,an:16,e:[5,6,1,1,40,40,false,true],c:"CC>15&CI>15",p:2300};
I[1431] = {n:"Great Mechba Shovel",t:8,d:"This shovel, created by Mechba, is used by Enutrof followers to knock nuts from trees. On the battlefield, it has a similar function. Yowza!",ep:1,g:19,l:60,wd:true,fm:true,w:30,an:16,e:[5,6,1,1,40,40,false,true],c:"CC>25&CI>25",p:3000};
I[1432] = {n:"Houze Shovel",t:8,d:"Gaston Houze, gardener and disciple of Enutrof, planted too many plants. It had to be said... There, I\'ve said it. What\'s more this worn spade is the evidence of his dirty business. Never talk to this thing, it\'ll tell you stories, don\'t believe a word, it\'ll have you digging yourself into your own grave before you know it... and then where will you be? I hate this damn thing.",ep:1,g:17,l:21,wd:true,fm:true,w:21,an:16,e:[2,4,1,1,50,50,false,true],c:"CC>27&CW<100&CS>10",p:2100};
I[1433] = {n:"Security Shovel",t:8,d:"This shovel was once a self-defence weapon used by a small group of female Enutrof\'s followers. Once they had even this puny pile of power in their clutches, they turned into horrible crea.......",ep:7,g:4,l:60,wd:true,fm:true,w:30,an:16,e:[10,5,1,1,50,50,false,true],c:"CC>60&CS>30&CA>10",p:6500};
