I[1436] = {n:"Ikan Shovel",t:8,d:"Ikan was Churros the Warrior\'s little fish. The shovel doesn\'t look a thing like the creature, but the smell is almost identical...",ep:7,g:8,l:50,wd:true,fm:true,w:50,an:16,e:[10,5,1,1,50,50,false,true],c:"CC>30&CA>10",p:7800};
