I[1461] = {n:"Scalding Poison",t:15,d:"This Arachnee leg poison will send your head right into space. Both literally and figuratively seeing that, after a short period of wide-eyed cosmic clarity, your skull explodes due to the massive increase in blood pressure.",ep:1,g:189,l:20,wd:true,fm:true,w:1,p:100};
I[1462] = {n:"Vampiric Liquid",t:15,d:"This liquid, a blend of several bloods, has the nasty habit of catching in your throat.",ep:2,g:188,l:30,wd:true,fm:true,w:1,p:100};
I[1463] = {n:"Element Flask",t:71,d:"This Flask is especially designed for capturing elementary essences.",ep:1,g:57,l:1,wd:true,fm:true,w:1,p:50};
