I[1469] = {n:"Recommendation Scroll",t:24,d:"Uba Tesse has given you this parchment. He has warmly recommended that you train as an alchemist.",ep:1,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[1470] = {n:"Recommendation Scroll",t:24,d:"You got this parchment from Uba Tesse. He highly recommends the alchemist training. There is a small note from by Boff Chalon.",ep:2,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[1471] = {n:"Recommendation Scroll with a Flower",t:24,d:"Uba Tesse gave you this parchment. He highly recommends the alchemist training. There\'s a small note from Boff Chalon. A flower attached to it proves you attended the first lesson.",ep:3,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[1472] = {n:"Exam Request Scroll",t:24,d:"This scroll indicates you have finished your training as an alchemist and that you\'re now ready to take the exam.",ep:3,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[1473] = {n:"Green Fingers",t:20,d:"With these gloves on, you can easily and safely gather all kinds of flowers.",ep:1,g:5,l:1,wd:true,fm:true,w:5,e:[5,3,1,1,30,50,false,true],p:100};
I[1474] = {n:"Xelor Amulet",t:1,d:"This ultra-powerful amulet is the fruit of the expert time-mastery of an old  Xelor.",ep:1,g:28,l:52,wd:true,fm:true,w:10,p:7300};
I[1475] = {n:"Pretty Blade",t:6,d:"The Pretty Blade has been crafted by the renowned blacksmith Dave-LoL, just before he died for the sake of the prettiest girl in the kingdom, a Iop. It is said that the efficiency of the blade is only matched by the grace of the wearer.",ep:4,g:15,l:60,wd:true,fm:true,w:30,an:14,e:[10,4,1,1,30,50,false,false],c:"CS>100&CV>50",p:3000};
I[1476] = {n:"Crackler Pendant",t:1,d:"This powerful pendant contains the life-blood of the Crackler, that is to say all the items he gathered before he was killed by some jealous adventurer.",ep:2,g:25,l:47,wd:true,fm:true,w:5,p:5800};
I[1477] = {n:"Lucky Mulette",t:1,d:"Mulette was a little female Ecaflip dogged by bad luck... until her grandmother presented her with this amulet.",ep:1,g:26,l:44,wd:true,fm:true,w:5,p:5000};
I[1478] = {n:"Harmony",t:1,d:"This pendant will make you feel more harmonious.",ep:1,g:122,l:47,wd:true,fm:true,w:1,p:6000};
I[1479] = {n:"The Cardboard Twot",t:7,d:"This legendary Hammer has already proved itself in Amakna. It belonged to the powerful Cardboard Twot who used it to transform his opponents into confetti and papier-mÃ¢chÃ©.",ep:13,g:6,l:46,wd:true,fm:true,w:20,an:15,e:[5,4,1,1,50,30,false,false],c:"CI>50&CV>30",p:5600};
I[1480] = {n:"Peace",t:1,d:"This pendant will make you feel at peace with the world.",ep:1,g:121,l:38,wd:true,fm:true,w:1,p:4000};
I[1481] = {n:"Understanding",t:1,d:"This pendant will make you grant you greater understanding of the world around you.",ep:1,g:11,l:26,wd:true,fm:true,w:1,p:2000};
I[1482] = {n:"Palid Emblem",t:1,d:"This is an extremely useful amulet, but it turns its wearer as white as a Gobball.",ep:1,g:32,l:41,wd:true,fm:true,w:2,p:4500};
I[1483] = {n:"Kabbala",t:1,d:"A mysterious symbol of a mysterious organization... by the way, it doesn\'t exist and you\'ve never heard of it, understand?",ep:11,g:13,l:29,wd:true,fm:true,w:2,p:2500};
I[1484] = {n:"Modified Amulet Itbe",t:1,d:"An excellent copy of the work done by Polma Kartnay, the silversmith\'s apprentice. This reproduction surpasses the original.",ep:1,g:31,l:17,wd:true,fm:true,w:5,p:1000};
I[1485] = {n:"Pippin",t:1,d:"This amulet is said to be a modified version of the Golden Destiny... which is really strange when you think that these two amulets have nothing in common except their ridiculous appearance.",ep:1,g:27,l:22,wd:true,fm:true,w:5,c:"CC>10",p:1500};
I[1486] = {n:"Holy Medal",t:1,d:"Holy was a female  Iop, intent on spreading Evil throughout the land. Renowned for her incredible composure, she would never get angry except when people compared her to someone named Oly.",ep:1,g:23,l:31,wd:true,fm:true,w:3,p:2800};
I[1487] = {n:"Adelus",t:10,d:"Not only is this belt elegant, it also massages you as you walk... You\'d be surprised what a back rub can do for your murderous instinct.",ep:1,g:12,l:48,wd:true,fm:true,w:30,p:6075};
I[1488] = {n:"Plimclik",t:1,d:"This strange name refers to an  equally strange object made from previous amulets... goodness knows how. We know just as little about the circumstances in which it was found...",ep:11,g:123,l:130,wd:true,fm:true,w:24,p:1000};
I[1489] = {n:"Pin of Mhete",t:1,d:"With this near-perfect pin, you\'ll have the wisdom of an Irish salmon. It\'s great for group therapy sessions among friends. Don\'t forget to bring some tissues, though, it can get emotional!",ep:11,g:15,l:28,wd:true,fm:true,w:1,p:2300};
I[1490] = {n:"Nhanor Kibrill Chain",t:1,d:"The creator of this chain, someone called Ken Aton, was renowned for his strange habits. He spent all his time hunting the Minotoror for his coat which he wanted to make into an Asserag",ep:1,g:12,l:13,wd:true,fm:true,w:2,p:650};
I[1491] = {n:"Liche Chain",t:1,d:"The Liche was a dirty creature known for infiltrating the ranks of valiant warriors in order to steal food. Marmalade and toast was his favourite. But one day, the warriors saw through its little game and the Liche had to run away...",ep:13,g:12,l:45,wd:true,fm:true,w:2,p:5400};
I[1493] = {n:"Sacrier\'s Wound",t:9,d:"It is said that this ring emerged out of a Sacrier\'s grinning, pus-stuffed wound. Niiice.",ep:1,g:13,l:15,wd:true,fm:true,w:2,p:800};
I[1494] = {n:"Ringer",t:9,d:"The main function of this pretty ring was to help Osamodas recognize their Tofus during fights.",ep:1,g:14,l:15,wd:true,fm:true,w:4,p:800};
I[1495] = {n:"Soff Ring",t:9,d:"This small modest-looking ring was created by Degun. He was more famous for shouting his head off without the slightest reason and his violent aversion to the Liche than for his talent as a jeweller.",ep:1,g:37,l:36,wd:true,fm:true,w:3,p:3575};
I[1496] = {n:"Ecaflip\'s Luck",t:9,d:"This ring was made to increase its wearers luck during card games.",ep:1,g:32,l:20,wd:true,fm:true,w:4,p:1300};
I[1497] = {n:"Xelor\'s Past",t:9,d:"Rings forged during Xelor\'s temporal journeys.",ep:1,g:16,l:30,wd:true,fm:true,w:4,p:2600};
I[1498] = {n:"Enutrof\'s Memento",t:9,d:"These rings were cooled from the forge with the tears of Enutrof, shed over his lost shovel. Must have been some shovel!",ep:1,g:15,l:30,wd:true,fm:true,w:4,p:2600};
I[1499] = {n:"The Enutrofion",t:9,d:"This ring is meant for Enutrofs only. It was enchanted by their God so that the followers would be the only ones to wear it. It allows all god-fearing Enutrofs to be even luckier than usual in treasure hunts.",ep:1,g:39,l:59,wd:true,fm:true,w:1,c:"PG=3",p:10000};
I[1500] = {n:"Carpet Cape",t:17,d:"Made of many different fibres, this magnificent cloak is unique - just look at that patchwork of colour and the way the light plays on its surface.",ep:8,g:8,l:43,wd:true,fm:true,w:16,p:5000};
I[1501] = {n:"Wedding Ring",t:9,d:"With this wedding ring, you\'ll satisfy the most mercenary of fathers-in-law.",ep:2,g:27,l:1,wd:true,fm:true,w:10,p:1};
I[1503] = {n:"Will-o\'-the-Wisp\'s Wand",t:3,d:"It is said that to create this wand, it is put into a warm corpse, which is then buried shortly afterwards. No one dares to imagine by what route exactly the wand is put into the dead body.",ep:3,g:14,l:20,wd:true,fm:true,w:15,an:11,e:[5,3,2,3,30,50,false,true],c:"CI>30",p:1000};
I[1504] = {n:"Billy-Ray\'s Daggers",t:5,d:"Billy-Ray Red Neck was renowned throughout the countryside. One day, as he was yodelling at the top of his voice, someone cut off his head, which is why he got the nickname. The dagger was found but nobody looked for the murderer... Billy-Ray was famous for singing out of tune.",ep:1,g:1,l:30,wd:true,fm:true,w:10,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>30",p:3000};
I[1505] = {n:"Flute",t:20,d:"This exceptional Treechnid wood flute is ideal for entertaining and inspiring your friends.",ep:1,g:6,l:1,wd:true,fm:true,w:1,an:4,e:[0,5,1,1,0,0,false,false],p:50000};
I[1506] = {n:"Strange Symbol",t:15,d:"This playing card represents... Damn! It\'s really difficult to explain. It\'s important though...",ep:1,g:224,l:1,wd:true,fm:true,w:10,p:1};
I[1507] = {n:"1,000 Kek Coupon",t:15,d:"Something is written on this piece of paper:\n" + "\"" + "Congratulations! You are now the proud owner of a KeK coupon, which proves that you are a great adventurer. Come see us, we are waiting for you!" + "\"" + "\nMap coordinates -1,-2",ep:1,g:225,l:1,wd:true,fm:true,w:10,p:1};
