I[1511] = {n:"Nine Tails",t:6,d:"According to the legend describing the Dantesque fight after which he was raised to the rank of God himself, Ecaflip used a weapon made by the ancient principle: " + "\"" + "a tail for a life" + "\"" + ". This series of swords was forged as a tribute to him.",ep:13,g:19,l:80,wd:true,fm:true,w:20,an:14,e:[9,9,1,1,20,20,false,false],c:"CS>99&CA>99&CV>99",p:20000};
