I[1514] = {n:"Forgetfulness Potion: \'Repercussion\'",t:43,d:"Using this potion will cause you to unlearn one level of the Ecaflip spell \'Repercussion\'.",ep:2,g:27,l:1,wd:true,fm:true,w:1,u:true,p:1000};
