I[1557] = {n:"Ga Pa Rune",t:78,d:"This rune is so powerful that it should be hurled off the World by the gods themselves. It makes a weapon so easy to use that you can slay ten warriors while... let\'s see... changing a nappy, sipping a cup of tea, erecting a dry stone wall in your front yard... just about anything.",ep:1,g:55,l:50,wd:true,fm:true,w:1,p:10};
