I[1610] = {n:"Dark Treechnid Bark",t:96,d:"This bark comes from the corpse of a Dark Treechnid.",ep:9,g:231,l:78,wd:true,fm:true,w:1,p:50};
I[1611] = {n:"Dark Treechnid Bud",t:108,d:"This bud comes from the corpse of a dark Treechnid.",ep:9,g:230,l:78,wd:true,fm:true,w:1,p:50};
I[1612] = {n:"Dark Treechnid Root",t:98,d:"This root comes from the corpse of a Dark Treechnid.",ep:9,g:232,l:78,wd:true,fm:true,w:1,p:50};
I[1613] = {n:"Chief Crocodyl Scale",t:59,d:"This fragment of shell will certainly be used to make beautiful boots.",ep:4,g:547,l:69,wd:true,fm:true,w:5,p:100};
I[1614] = {n:"Chief Crocodyl Teeth",t:47,d:"These teeth were extracted with difficulty from the jaw of a Crocodyl... they must be good for something...",ep:4,g:548,l:69,wd:true,fm:true,w:1,p:100};
I[1619] = {n:"The Treemu",t:1,d:"The Treemu is an elegant amulet. If you\'re planning on putting it on, we advise you not to wear any other clothes, as it makes silk look like the wool off a Gobball\'s backside.",ep:9,g:16,l:46,wd:true,fm:true,w:2,p:5700};
I[1620] = {n:"Treebow",t:2,d:"This bow looks as if it were still alive and can almost shoot arrows on its own like a big boy. It could have been the perfect bow for people who are clumsy with their hands but, unfortunately, the arrow always has to be loaded the right way.",ep:9,g:24,l:39,wd:true,fm:true,w:10,an:10,tw:true,e:[5,4,2,5,50,30,false,true],p:4200};
I[1621] = {n:"Skill Boots",t:11,d:"The Skill Boots increase agility and intelligence to the detriment of your strength and chance. Contrary to what many people believe, they won\'t defeat your opponent for you.",ep:4,g:14,l:22,wd:true,fm:true,w:5,p:1500};
I[1622] = {n:"Power Boots",t:11,d:"These Power Boots increase strength and chance to the detriment of your intelligence and agility.  Contrary to what many people believe, they won\'t bring you incredible power.",ep:4,g:14,l:22,wd:true,fm:true,w:5,p:1500};
I[1623] = {n:"Anticipation Boots",t:11,d:"The Anticipation Boots increase strength and agility to the detriment of your intelligence and chance. Contrary to what many people believe, these boots do not enable you to anticipate your enemies\' next moves.",ep:4,g:15,l:22,wd:true,fm:true,w:5,p:1500};
I[1624] = {n:"Nexus\' Boots",t:11,d:"These boots once belonged to the great knight Nexus - the poor bugger was frozen for eternity.",ep:3,g:16,l:17,wd:true,fm:true,w:5,p:1000};
I[1625] = {n:"The Legend of the Cruncher",t:25,d:"This book relates the journey of the last Human who got to meet the Cruncher.",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:150};
I[1626] = {n:"Encyclopedia of Alchemy Appendix A: Professions",t:25,d:"This is an encyclopaedia of alchemy recipes that are useful for unlearning professions.",ep:1,g:2,l:1,wd:true,fm:true,w:1,u:true,p:150};
I[1628] = {n:"Fire Artefact",t:9,d:"The story of this artefact originates from a very ancient legend but its real power is yet to be revealed.",ep:1,g:18,l:1,wd:true,fm:true,w:0,p:1};
