I[1635] = {n:"Emote Scroll: Wind of Panic",t:25,d:"(Double click to learn this emote) \nWith this scroll you can learn how to " + "\"" + "Break Wind" + "\"" + ". Use it in moderation as it can be dangerous for you and your friends.",ep:4,g:9,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[1636] = {n:"Small Evening Star",t:6,d:"This sword was created by a glamorous young lady who wanted a weapon in her own image and endowed it with the her own graceful beauty and passionate nature. Have a look at this piece. Magnificent",ep:1,g:22,l:40,wd:true,fm:true,w:10,an:14,e:[5,4,1,1,40,40,false,false],c:"CA>35&CV>35&CS>11",p:4000};
