I[1652] = {n:"Major Arachnee Leg",t:103,d:"A very thin and very hairy Leg, formerly used in the making of exotic brooms and wigs.",ep:1,g:246,l:39,wd:true,fm:true,w:1,p:1};
I[1653] = {n:"Don Rouann\'s Faith",t:24,d:"This Ring symbolizes the fact you\'re seeking Don Rouann\'s secret. You have now learnt bravery.",ep:2,g:27,l:1,wd:true,fm:true,w:0,p:1};
I[1654] = {n:"Don Rouann\'s Faith",t:24,d:"This Ring symbolizes the fact you\'re seeking Don Rouann\'s secret. Now that bravery and communication are parts of your skills, you only have to learn to be patient.",ep:2,g:27,l:1,wd:true,fm:true,w:0,p:1};
I[1655] = {n:"Don Rouann\'s Faith",t:24,d:"This Ring symbolizes the fact you\'re seeking Don Rouann\'s secret.",ep:2,g:27,l:1,wd:true,fm:true,w:0,p:1};
I[1656] = {n:"Magus Fecalizer",t:9,d:"This ring can protect you from weak magic attacks... In practice, from infantile monsters with something to prove.",ep:1,g:40,l:26,wd:true,fm:true,w:2,p:2000};
I[1657] = {n:"Warrior Fecalizer",t:9,d:"This ring can protect you from weak magic attacks... In practice, from infantile monsters with something to prove.",ep:1,g:41,l:26,wd:true,fm:true,w:2,p:2000};
I[1660] = {n:"Dark Treechnid Amber",t:50,d:"This magnificent amber contains a nasty bug, which was caught in the dripping sap of its master. It\'s a kind of sarcophagus, really, and the Dark Treechnid uses it as a reminder of all its summons long after they are dead.",ep:9,g:638,l:78,wd:true,fm:true,w:2,p:6000};
I[1661] = {n:"Moskito Ambamulet",t:1,d:"Wearing a necklace with a Moskito encased in amber will show your opponents you\'re a fearsome hunter... of Moskitoes! Unless you\'re still a toddler, that\'s got to be embarrassing.",ep:1,g:17,l:40,wd:true,fm:true,w:5,p:4400};
I[1662] = {n:"Arachnee Ambamulet",t:1,d:"Wearing an amber Arachnee around your neck when attacking one of its sisters can be enough to disconcert it. Poor bug though, it\'s what we call the " + "\"" + "irony of fate" + "\"" + ".",ep:1,g:18,l:34,wd:true,fm:true,w:5,p:3225};
I[1663] = {n:"Crocodyl Scale",t:59,d:"This Crocodyl scale is like a little trophy for all beginner Crocodyl hunters. Don\'t hesitate to show it to the drunkards at the Inn. They\'ll be impressed and will offer you a drink to celebrate your success.",ep:4,g:233,l:36,wd:true,fm:true,w:5,p:50};
I[1664] = {n:"Crocodyl Teeth",t:47,d:"When a crocodyl tries to cut its teeth on you, the best solution is to pull one out with determination and vigour, just like a strict dentist would.",ep:4,g:234,l:36,wd:true,fm:true,w:1,p:50};
I[1665] = {n:"Apprenticeship Boots",t:11,d:"These strange boots were first used by young disciples who were one or two socks short of a pair. Ah yes, popular with the Iops.",ep:4,g:68,l:50,wd:true,fm:true,w:10,p:6675};
I[1666] = {n:"Apprentice Summoner Boots",t:11,d:"These boots have been especially made for those who prefer to watch their summons do all the hard work during fights.",ep:12,g:14,l:51,wd:true,fm:true,w:10,p:7000};
I[1667] = {n:"Luthuthu Belt",t:10,d:"This belt takes its name from its creator, a shoemaker who was less renowned and much older than Bowisse, but quite gifted all the same.",ep:8,g:13,l:50,wd:true,fm:true,w:10,p:6700};
I[1668] = {n:"Trembling Dodu Belt",t:10,d:"The Dodu was a Sadida who loved frightening his enemies. He asked Bowisse to make him a belt that matched the colour of his hair... Like many charmers, the Dodu had a rotten heart.",ep:4,g:14,l:55,wd:true,fm:true,w:8,p:8000};
I[1669] = {n:"Event Belt",t:10,d:"This belt was made for the most popular of all the Craettes who often organised parties and wacky events to keep her countless friends and acquaintances on her side. All this between ironing and washing Captain Chafer\'s leather underpants.",ep:8,g:15,l:84,wd:true,fm:true,w:10,p:18300};
I[1670] = {n:"Wind Kwak Pointed Feather",t:53,d:"A Wind Kwak can sometimes have a pointed feather different from the others. As a rule, it\'s magic, but you can nevertheless put it on and then be dressed up as an Indian Chief.",ep:5,g:393,l:24,wd:true,fm:true,w:10,p:100};
I[1671] = {n:"Magic Oats",t:34,d:"This wisp of magic oat straw once belonged to a simple peasant. The poor country fellow was bewitched by a Bwork Magus apprentice, who read his book upside down by mistake.",ep:1,g:550,l:20,wd:true,fm:true,w:10,p:0};
I[1672] = {n:"Darit Hair",t:54,d:"These hairs used to belong to Darit, a young, pretentious wizard who unwisely underestimated his opponent. He forgot to check if  the Prespic had cast a Counter spell before casting \'Ripping Lightning\'.",ep:1,g:555,l:18,wd:true,fm:true,w:1,p:100};
I[1673] = {n:"Magic Arachnee Leg",t:103,d:"This Arachnee Leg is different from the rest - it moves on its own and seems to be well and truly alive, even when amputated from its owner. It could be on the point of starting a family since apparently it is attracted to sewing tools.",ep:1,g:392,l:2,wd:true,fm:true,w:10,p:100};
I[1674] = {n:"Luigie Mushroom",t:15,d:"This great hero was turned into a mushroom thanks to the bumbling magic of the mischievous Soft Oak. Being complete cretins, the Mush-Mush venerate and protect him as one of their gods.",ep:1,g:390,l:46,wd:true,fm:true,w:10,p:100};
I[1675] = {n:"Chafer Foot Soldier\'s Surprising Bone",t:47,d:"This magic Bone allows the Chafer Foot Soldiers to achieve astonishing feats. For instance, while in the middle of a fight, they can take off their briefs, put them on their heads without using their hands, and still avoid being hit by attackers. You will never get never tired of this incredible performance.",ep:3,g:15,l:35,wd:true,fm:true,w:1,p:100};
I[1676] = {n:"Bewitched Wicker",t:15,d:"This piece of Bewitched Wicker will enable you to make a beautiful basket for magic fruits, combining elegance and power... quite the opposite of a bad Liche.",ep:2,g:123,l:69,wd:true,fm:true,w:10,p:100};
I[1677] = {n:"Dantegoulish Potion",t:12,d:"This magic potion is the only one that can cast magic into the lattice-work leather panties of Captain Chafer...It speaks volumes about the power of such a potion.",ep:2,g:139,l:50,wd:true,fm:true,w:10,p:1000};
I[1678] = {n:"traumatised Kokonut",t:46,d:"This Kokonut was traumatised in its childhood. Hatred was its motive to become as powerful as possible...",ep:12,g:552,l:42,wd:true,fm:true,w:2,p:100};
I[1679] = {n:"Crystaloball Stone",t:50,d:"It takes the patience of a saint but this stone can become round and bright like the pompom on a magic hat. Its shape makes it easy to fit almost anywhere.",ep:4,g:240,l:16,wd:true,fm:true,w:10,p:100};
I[1680] = {n:"Burnt Minotoror Horn",t:47,d:"A very powerful incantation has scorched this Minotoror Horn, which makes it a much sought-after magical artefact. Unfortunately, like many things, they only work correctly in pairs...",ep:2,g:245,l:125,wd:true,fm:true,w:10,p:100};
I[1681] = {n:"Magic Green Larva Skin",t:59,d:"Beneath the slimy exterior, a very precious artefact lies. It will bring you the luck of the devil himself, provided you wear it round your head... You\'ll have the temper of a devil too with this wet rag clinging to your skull.",ep:1,g:391,l:7,wd:true,fm:true,w:10,p:100};
I[1682] = {n:"Liroye Merline\'s Bark",t:96,d:"This fragment of bark comes from a tree in the enchanted clearing of Liroye Merline. \nThis fragment fell down when Brouce Boulgoure the lumberjack broke his Boulgourde against one of the enchanted trees.",ep:9,g:542,l:78,wd:true,fm:true,w:1,p:100};
I[1683] = {n:"Bright Sack of Potatoes",t:15,d:"With this magic bag, an artful Sadida carried incredible quantities of peeled potatoes and sold them to prisoners. When he died, his bag passed down from artful Sadida to artful Sadida as a family ritual.",ep:1,g:243,l:12,wd:true,fm:true,w:10,p:100};
I[1684] = {n:"Dark Sack of Potatoes",t:15,d:"The Dark Bag of Spuds is identical to the Bright Bag of Spuds apart from the fact that it has been dipped in some Dark Treechnid sap, thus conferring still more powers upon it.",ep:1,g:244,l:12,wd:true,fm:true,w:10,p:100};
I[1685] = {n:"Last Cheeken Feather",t:53,d:"Beware! You are now the unhappy owner of the last feather from the rump of the last Cheeken in Amakna. It might be a good idea to give it away to a Tailor friend... or a Cheeken fanatic. There\'s a lot of them around lately.",ep:3,g:247,l:32,wd:true,fm:true,w:1,p:100};
I[1686] = {n:"Magic Redness Dye",t:70,d:"This small magic potion gives hair a magnificent red colour. Secondarily, it seems to have some magic effects.",ep:7,g:63,l:10,wd:true,fm:true,w:1,p:500};
I[1687] = {n:"Magic Greenish Dye",t:70,d:"This small magic potion gives hair a magnificent bluish effect. Oh, and it seems to have few magical powers.",ep:1,g:64,l:10,wd:true,fm:true,w:1,p:500};
I[1688] = {n:"Magic Bluish Dye",t:70,d:"This small magic potion gives hair a magnificent bluish effect. Oh, and it seems to have few magical powers.",ep:5,g:65,l:10,wd:true,fm:true,w:1,p:500};
I[1689] = {n:"Magic Orange Dye",t:70,d:"This small magic potion gives a magnificent auburn glow when applied to any kind of hair. Oh, and it seems to have few magical powers as well.",ep:1,g:66,l:10,wd:true,fm:true,w:1,p:500};
I[1690] = {n:"Miliboowolf Hairs",t:54,d:"This fur is quite the same as the Boowolf\'s only a little shorter, less robust and softer.  \nUnfortunately, it smells the same.",ep:1,g:554,l:22,wd:true,fm:true,w:1,p:1};
I[1691] = {n:"Moowolf Hairs",t:54,d:"Rare are the adventurers who have touched these living hairs. \nSomething, something, something, I like eating choc eclairs.",ep:2,g:553,l:198,wd:true,fm:true,w:10,p:200};
I[1692] = {n:"Magic Dark Dye",t:70,d:"This small magic potion gives hair a magnificent bluish effect. Oh, and it seems to have few magical powers.",ep:1,g:67,l:10,wd:true,fm:true,w:1,p:500};
I[1693] = {n:"Jules Yanos\' Cloak",t:17,d:"The famous tailor, Jules Yanos, was particularly renowned for having exchanged his wife for a magic thimble. What a businessman, hmm? Just great!",ep:8,g:8,l:54,wd:true,fm:true,w:1,p:7800};
I[1694] = {n:"Furious Trool Wool",t:57,d:"This piece of Wool comes from the most dangerous Trool of Amakna who, apparently, has been transformed into a bedspread by an unscrupulous tailor, the same tailor who, if you believe what is publicly rumoured, has once exchanged his wife for a magic thimble. I don\'t see the connection.",ep:4,g:27,l:115,wd:true,fm:true,w:10,p:1};
I[1695] = {n:"Elya Wood\'s Cloak",t:17,d:"Some say Captain Chafer tried to steal this cloak to replace his famous leather panties. But it didn\'t suit him at all - it just wasn\'t perverse enough.",ep:8,g:9,l:80,wd:true,fm:true,w:10,s:39,p:16500};
I[1696] = {n:"Moowolf Fabric",t:55,d:"Many years ago, tailors created a simple system for determining the value of a material - the worse it smells, the better it is.",ep:2,g:14,l:198,wd:true,fm:true,w:20,p:300};
I[1697] = {n:"Small Gobbly Wool Bag",t:81,d:"Don\'t expect this bag to make a hero of you. It will keep all your personal items in one place. Better than nothing, I suppose.",ep:1,g:25,l:1,wd:true,fm:true,w:5,p:100};
I[1698] = {n:"Small Harvester Bag",t:81,d:"This bag is specially designed for holding the resources you collect. \nOnly true harvesters can carry it. (level 20 in one of the harvesting professions required).",ep:1,g:26,l:5,wd:true,fm:true,w:5,c:"PJ>2,20|PJ>24,20|PJ>36,20|PJ>28,20|PJ>26,20|PJ>41,20",p:2000};
I[1699] = {n:"Minor Adventurer Bag",t:81,d:"This bag is ideal for those who never wander far from home but take useless things with them when they do. Like ash planks for example.",ep:1,g:27,l:10,wd:true,fm:true,w:5,p:3000};
I[1700] = {n:"Celerity Belt",t:10,d:"Designed by Tengra Reufrus, this aerodynamic belt will make you as nimble as a Tofu and as windy as the breeze. Or is it the opposite?",ep:4,g:17,l:27,wd:true,fm:true,w:15,p:2000};
I[1701] = {n:"Pocket Belt",t:10,d:"This belt has small pockets allowing you to stock more items in your inventory.",ep:1,g:16,l:20,wd:true,fm:true,w:10,p:1300};
I[1702] = {n:"Harvester Bag",t:81,d:"This bag is specially designed for holding the resources you collect. \nOnly true harvesters can carry it (level 40 in one of the harvesting professions required).",ep:8,g:28,l:15,wd:true,fm:true,w:10,c:"PJ>2,40|PJ>24,40|PJ>36,40|PJ>28,40|PJ>26,40|PJ>41,40",p:3000};
I[1703] = {n:"Large Harvester Bag",t:81,d:"This bag is specially designed for holding the resources you collect. \nOnly true harvesters can carry it (level 60 in one of the harvesting professions required).",ep:8,g:29,l:20,wd:true,fm:true,w:10,c:"PJ>2,60|PJ>24,60|PJ>36,60|PJ>28,60|PJ>26,60|PJ>41,60",p:2000};
I[1704] = {n:"Sack of Novist",t:81,d:"Legend whispers of a miner who worked continuously for several months in 4 different mines simultaneously, raising a family in the process and running a successful one-man printing press with his feet... The Hammer-Sickle newspaper hard at work again...",ep:8,g:30,l:20,wd:true,fm:true,w:10,c:"PJ>2,90|PJ>24,90|PJ>36,90|PJ>28,90|PJ>26,90|PJ>41,90",p:10000};
I[1705] = {n:"Adventurer Bag",t:81,d:"It\'s the ideal bag for holding all your bread and potions when you go away for several months... into the labyrinth for example.",ep:8,g:31,l:40,wd:true,fm:true,w:4,p:4000};
I[1707] = {n:"Great Adventurer Bag",t:81,d:"It\'s the ideal bag to keep all your bread and potions when you are on an exotic vacation...like in the Moon Island.",ep:13,g:32,l:60,wd:true,fm:true,w:5,p:6000};
I[1709] = {n:"Bony Montana",t:47,d:"" + "\"" + "Say hello to my little friend" + "\"" + "... the last words of a proud female Enutrof who mistook a Boowolf for her trusty poodle.",ep:1,g:15,l:1,wd:true,fm:true,w:2,p:1};
I[1710] = {n:"Crescent Moon",t:1,d:"The origins of this crescent-shaped amulet, are known to only the very few... \nWho knows what might happen if you put it on...",ep:1,g:19,l:1,wd:false,fm:true,w:10,p:1000};
I[1711] = {n:"Bow Wow",t:18,d:"Take this dog to the park, take him to the toilet, show him to your friends, but whatever you do - and please listen carefully - do not feed him. This pet will remove your arm up to the elbow. \n(THIS PET DOESN\'T LIKE ANY RESOURCES)",ep:1,g:6,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[1712] = {n:"Pahoa Raid Potion",t:12,d:"You\'ll recover between 201 and 400 energy points using this potion.",ep:1,g:140,l:20,wd:true,fm:true,w:1,u:true,p:50};
I[1713] = {n:"Raid Boole Potion",t:12,d:"You\'ll recover between 501 and 1000 energy points using this potion.",ep:1,g:141,l:40,wd:true,fm:true,w:1,u:true,p:100};
I[1715] = {n:"The Kwistmas Gift",t:25,d:"Christmas Bestseller 634. This is essential reading. It\'s a classic!",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:50};
I[1716] = {n:"The Duciel Family",t:25,d:"Other bestseller of the Winter 634, this book is already a reference.",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:50};
I[1717] = {n:"First Christmas",t:25,d:"The odds-on outsider for the beginning of 635, this book has gained a cult following in recent months.",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:50};
I[1718] = {n:"Crocoburio\'s Strength",t:9,d:"The powers given to this ring by the Dark Breath of Grougalorasalar are now considerably weakened. This relic was intended for Crocoburio, the only one capable of mastering it without being dominated himself.",ep:4,g:38,l:40,wd:true,fm:true,w:2,c:"CS>59",p:4000};
I[1719] = {n:"Crocoburio\'s Spirit",t:11,d:"This pair of boots apparently belonged to Crocoburio. Only a few people can put them on and they are immediately plunged into a clever, Machiavellian frame of mind. Legend has it that this evil spell is due to the numerous skulls the boots have crushed.",ep:4,g:12,l:42,wd:true,fm:true,w:10,c:"CI>49",p:5000};
I[1720] = {n:"Crocoburio\'s Power",t:10,d:"Grougalorasalar loved collecting the bone fragments of his most fearsome enemies. His affection for Crocoburio inspired the creation of this ultra-powerful belt.",ep:4,g:18,l:34,wd:true,fm:true,w:15,c:"CV>119",p:3000};
I[1721] = {n:"Forgetfulness Potion: \'Clock\'",t:43,d:"Using this potion will cause you to unlearn one level of the Xelor spell \'Clock\'.",ep:2,g:37,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[1722] = {n:"Treechnid Transformation",t:27,d:"You\'ve been turned into a Treechnid because of the Soft Oak\'s curse. To remove the bewitchment, you have to defeat an adventurer lost in the forest of Treechnids.",ep:1,g:1,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[1723] = {n:"Ultra-Powerful Red Drop",t:28,d:"This drop increases your energy for a short time.",ep:1,g:1,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[1724] = {n:"Courage",t:29,d:"This blessing will increase Strength for your next few fights.",ep:18,g:1,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[1725] = {n:"Discouraged",t:30,d:"This curse will reduce your Strength in your next fight.",ep:1,g:1,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[1726] = {n:"Tuft of Tarche\'s Hair",t:24,d:"This tuft of hair proves your victory against Tarche. You\'re a star!",ep:1,g:30,l:1,wd:true,fm:true,w:0,p:1};
I[1727] = {n:"Threatening Letter",t:24,d:"A threatening letter addressed to Lady Marmalade.",ep:2,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[1728] = {n:"Bow Meow",t:18,d:"The fairer sex of the fairest class will fall under the spell of this cuddly little ball of fluff. For this reason alone it\'s to be avoided.",ep:1,g:1,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[1729] = {n:"Mer Ring",t:9,d:"This ring once belonged to Mer, the laziest piece of stuff in Amakna. He worshipped doughnuts and ribs...",ep:7,g:28,l:25,wd:true,fm:true,w:25,c:"CI<100&CC<100",p:1900};
I[1730] = {n:"Salt Measure",t:48,d:"This salt measure is the ideal quantity to season most family dishes. No meal can be cooked without it.",ep:1,g:261,l:1,wd:true,fm:true,w:1,p:1};
I[1731] = {n:"Dose of Tasty Juice",t:15,d:"A dose of tasty juice, sometimes known as chef\'s special sauce, will make a fine, rustic, slightly salty broth.",ep:1,g:262,l:1,wd:true,fm:true,w:1,p:4};
I[1732] = {n:"Bowl",t:15,d:"There\'s nothing more convenient than a bowl to eat your soup properly, even if the fact of eating properly doesn\'t alter the taste. Unless your fingers are really dirty...",ep:16,g:263,l:1,wd:true,fm:true,w:1,p:6};
I[1733] = {n:"Terrine",t:15,d:"Terrine is like meat... Oooo, that hits the spot. Three cheers for the terrine! Hurrah for the terrine!!! \nGo terrine, it\'s your birthday. \nGo terrine, it\'s your birthday. \n(Extract from the butcher anthem, verse 4)",ep:16,g:264,l:1,wd:true,fm:true,w:1,p:6};
I[1734] = {n:"Cherry",t:46,d:"Xelors often mistake this fruit for a space hopper. Remember them!",ep:1,g:265,l:1,wd:true,fm:true,w:1,p:1};
I[1735] = {n:"Bow Kennel Certificate: Bow Meow",t:77,d:"This certificate describes the characteristics of the Bow Meow you\'ve put in the Bow Kennels.",ep:3,g:24,l:1,wd:false,fm:true,w:1,p:100};
I[1736] = {n:"Lemon",t:46,d:"This juice of this fruit is perfect for hiding the foul smell of rotting flesh. A must-have if you\'re serving leftovers to your guests.",ep:1,g:266,l:1,wd:true,fm:true,w:1,p:2};
I[1737] = {n:"Field Bread",t:33,d:"This Field Bread feels like a stone in your pocket, and in your belly for that matter. But it has at that familiar rustic flavour that any good bread should have.",ep:1,g:68,l:40,wd:true,fm:true,w:3,u:true,ut:true,p:1};
I[1738] = {n:"City Bread",t:33,d:"This bread will give you the appetite of a bulimic giant. It\'ll also fill you very, very quickly. These conflicting properties have killed thousands. Don\'t be next.",ep:1,g:69,l:10,wd:true,fm:true,w:2,u:true,ut:true,p:1};
I[1739] = {n:"Red-Hot Wand",t:3,d:"This wand is searingly hot to the touch. But the most enigmatic thing about it is its ash smell which would make you think it had survived a forest fire.",ep:13,g:24,l:80,wd:true,fm:true,w:1,an:11,e:[5,4,2,3,40,50,false,true],c:"CI>60&CV>40",p:1};
I[1740] = {n:"Crocoburio Transformation",t:27,d:"The Crocobur contains the spirit of Crocoburio. So, the only way of stealing it is to kill Crocoburio. Simple.",ep:4,g:2,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[1741] = {n:"Phoenix Blood",t:14,d:"This phoenix\'s blood can revive a ghost and give it a few Health Points.",ep:18,g:3,l:10,wd:true,fm:true,w:1,c:"Pg=23",ut:true,p:1000};
I[1742] = {n:"Great Phoenix Blood",t:14,d:"This phoenix blood can revive a ghost and give it lots of Health Points.",ep:18,g:3,l:50,wd:true,fm:true,w:1,c:"Pg=23",ut:true,p:2500};
I[1744] = {n:"Tuft of Torche\'s Hair",t:24,d:"This tuft of hair proves your victory against Torche. Magnificent!",ep:1,g:30,l:1,wd:true,fm:true,w:0,p:1};
I[1745] = {n:"Vet\'s Syringe",t:24,d:"One end pointed, a plunger on the other, it\'s a syringe, no doubt about it... You\'ve been warned.",ep:1,g:31,l:1,wd:true,fm:true,w:0,p:1};
I[1746] = {n:"GM Wabbit Blood",t:24,d:"Who would have travelled to Wabbit Island armed with a syringe with the sole aim of extracting some blood from the most genetically modified creature on the island ? You, of course.",ep:8,g:32,l:1,wd:true,fm:true,w:0,p:1};
I[1747] = {n:"GM Wabbit Blood Analysis",t:24,d:"Analysis clearly reveal that the blood comes from a Wabbit\'s hind quarter. After a thorough examination of the sample, the alchemist was able to determine which part of the backside was stung; for your information, it was the right cheek.",ep:5,g:33,l:1,wd:true,fm:true,w:0,p:1};
I[1748] = {n:"Wabbit",t:18,d:"This little Wabbit is domesticated and won\'t bite you. As for strangers, however...",ep:8,g:7,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:11,p:1};
I[1749] = {n:"Trool Fair Token",t:15,d:"You bought this token from Leonzi Trool. His humble dream is to open the biggest public fair the Cania Plains have ever seen.",ep:13,g:737,l:1,wd:true,fm:true,w:1,p:1};
I[1750] = {n:"Breaded Fish",t:41,d:"A cubic fish renowned for its particularly one dimensional thought processes. This piscatorial cretin is exceedingly easy to catch.",ep:2,g:269,l:1,wd:true,fm:true,w:3,p:10};
I[1751] = {n:"Gutted Breaded Fish",t:62,d:"The breaded fish can now be used as an ingredient.",ep:2,g:270,l:1,wd:true,fm:true,w:2,p:1};
I[1752] = {n:"Fried Breaded Fish **",t:49,d:"This tasty stick is made from fat-free pieces of cubic fish. Its taste delights children but it has low nutritional value.",ep:2,g:71,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:60};
I[1753] = {n:"Fried Breaded Fish ***",t:49,d:"This very tasty stick is made from decent, fat-free pieces of cubic fish. Its taste delights children and has good nutritional value.",ep:2,g:72,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:100};
I[1754] = {n:"Igloo Fish",t:41,d:"This rare species of breaded fish usually lives, as its name indicates, in the icy waters of the far North. Because of its polar diet, its flesh is rich in fibre.",ep:1,g:271,l:1,wd:true,fm:true,w:3,p:100};
I[1755] = {n:"Gutted Igloo Fish",t:62,d:"This Igloo Fish can now be used as an ingredient.",ep:1,g:272,l:1,wd:true,fm:true,w:2,p:100};
I[1756] = {n:"Fried Breaded Fish ****",t:49,d:"This incredibly tasty stick is made from the best fat-free pieces of cubic fish. Its taste delights children and it has excellent nutritional value.",ep:1,g:73,l:1,wd:true,fm:true,w:1,c:"Ci<10",u:true,ut:true,p:10000};
I[1757] = {n:"Crab Stick",t:41,d:"This unusually-shaped crab is much appreciated for the great quantity of flesh it yields. It is also the only crab you can catch with a fishing rod because of its natural instinct to cut thread with its claws... which can\'t cut a thing!",ep:2,g:273,l:1,wd:true,fm:true,w:3,p:1};
I[1758] = {n:"Gutted Surimice Crab",t:62,d:"This Surimice Crab can now be used as an ingredient.",ep:2,g:274,l:1,wd:true,fm:true,w:2,p:1};
I[1759] = {n:"Exotic Crab Stick",t:41,d:"Although a distant relative of the Crab Stick, this crab has a few brain cells to throw around... Which explains its rarity.",ep:1,g:275,l:1,wd:true,fm:true,w:3,p:20};
I[1760] = {n:"Gutted Exotic Surimice Crab",t:62,d:"This Exotic Surimice can now be used as an ingredient.",ep:1,g:276,l:1,wd:true,fm:true,w:2,p:20};
I[1761] = {n:"Gutted Kittenfish",t:62,d:"This Kittenfish can now be used as an ingredient.",ep:1,g:278,l:1,wd:true,fm:true,w:1,p:1};
I[1762] = {n:"Tiger Fish",t:41,d:"It\'s the same type of fish as the Kittenfish, just far more dangerous.",ep:1,g:279,l:1,wd:true,fm:true,w:3,p:30};
I[1763] = {n:"Gutted Tiger Fish",t:62,d:"This tiger fish can now be used as an ingredient.",ep:1,g:280,l:1,wd:true,fm:true,w:2,p:30};
I[1764] = {n:"Crab Stick **",t:49,d:"Enjoy it everywhere, but be careful not to eat too much...",ep:2,g:74,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:30};
I[1765] = {n:"Crab Stick ***",t:49,d:"To be enjoyed slowly, very slowly, with some sauce to bring out the flavour.",ep:2,g:75,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:60};
I[1766] = {n:"Crab Stick ****",t:49,d:"Made from exotic Surimice Crab meat, this crab stick is simply disgusting... but it\'s very nutritious.",ep:1,g:76,l:1,wd:true,fm:true,w:1,c:"Ci<30",u:true,ut:true,p:30000};
I[1767] = {n:"Smoked Kittenfish **",t:49,d:"Delicately smoked, this kittenfish makes a marvellous meal. But be careful, its smell will stick to your clothes for several decades.",ep:1,g:78,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:60};
I[1768] = {n:"Smoked Kittenfish ***",t:49,d:"Delicately smoked, this kittenfish makes a marvellous meal. But be careful, its smell will stick to your clothes for several decades.",ep:1,g:79,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:90};
I[1769] = {n:"Smoked Tiger Fish ****",t:49,d:"Firmer than smoked kittenfish, and more refined, this smoked tiger fish will delight lovers of fine cuisine.",ep:1,g:77,l:1,wd:true,fm:true,w:1,c:"Cw<40",u:true,ut:true,p:40000};
I[1770] = {n:"Piece of Coco Blop",t:15,d:"This extract of Blop has a strong smell of coco. How can a monster residue smell like this?",ep:5,g:281,l:34,wd:true,fm:true,w:1,p:1};
I[1771] = {n:"Green Mouse",t:15,d:"A green mouse running across the plains? Whatever you do, don\'t grab its tail...",ep:13,g:282,l:1,wd:true,fm:true,w:2,p:1};
I[1772] = {n:"Coco Blop Flower",t:35,d:"Say it with Coco Flowers or don\'t say it at all!",ep:2,g:283,l:34,wd:true,fm:true,w:2,p:1};
I[1773] = {n:"Piece of Pippin Blop",t:15,d:"A sizeable piece of Blop.",ep:5,g:284,l:34,wd:true,fm:true,w:1,p:1};
I[1774] = {n:"Pippin Blop Flower ",t:35,d:"Say it with Pippin Flowers or don\'t say it at all!",ep:5,g:285,l:34,wd:true,fm:true,w:1,p:1};
I[1775] = {n:"Piece of Cherry Blop",t:15,d:"A sizeable piece of Blop.",ep:5,g:286,l:34,wd:true,fm:true,w:1,p:1};
I[1776] = {n:"Cherry Blop Flower",t:35,d:"Say it with Cherry Flowers or don\'t say it at all!",ep:5,g:287,l:34,wd:true,fm:true,w:1,p:1};
I[1777] = {n:"Piece of Indigo Blop",t:15,d:"A sizeable piece of Blop.",ep:5,g:288,l:34,wd:true,fm:true,w:1,p:1};
I[1778] = {n:"Indigo Blop Flower",t:35,d:"Say it with Indigo Flowers or don\'t say it at all!",ep:5,g:289,l:34,wd:true,fm:true,w:1,p:1};
I[1779] = {n:"Lard Bass",t:41,d:"You can find this type of fish in glacial lakes and rivers. Fishermen really love it because of its size and its fresh flesh.",ep:2,g:290,l:40,wd:true,fm:true,w:3,p:1};
I[1780] = {n:"Gutted Lard Bass",t:62,d:"The Lard Bass can now be used as an ingredient.",ep:2,g:291,l:40,wd:true,fm:true,w:2,p:1};
I[1781] = {n:"Gutted Grawn",t:62,d:"This Grawn can now be used as an ingredient.",ep:1,g:293,l:1,wd:true,fm:true,w:1,p:1};
I[1782] = {n:"Gudgeon",t:41,d:"A small and fast-moving freshwater fish, the gudgeon is often caught by children and novice fishermen. Don\'t expect to feed your family with it.",ep:1,g:294,l:1,wd:true,fm:true,w:3,p:1};
I[1783] = {n:"Gutted Gudgeon",t:62,d:"This Gudgeon can now be used as an ingredient.",ep:1,g:295,l:1,wd:true,fm:true,w:2,p:1};
I[1784] = {n:"Blue Skate",t:41,d:"The Blue Skate rules the sea bed in which, for some mysterious reason, it digs tiny holes all day long. Every once in a while, it returns to the surface. Sometimes long enough for you to catch it.",ep:2,g:296,l:50,wd:true,fm:true,w:3,p:1};
I[1785] = {n:"Gutted Blue Skate",t:62,d:"This Blue Skate can now be used as an ingredient.",ep:2,g:297,l:50,wd:true,fm:true,w:2,p:1};
I[1786] = {n:"Horror Grawn",t:41,d:"Transformation of the Grawn. A distinguishing characteristic of this rare species is that it makes nauseating grunting noises when it moves around.",ep:1,g:298,l:1,wd:true,fm:true,w:3,p:100};
I[1787] = {n:"Gutted Horror Grawn",t:62,d:"This Horror Grawn can now be used as an ingredient.",ep:1,g:299,l:1,wd:true,fm:true,w:2,p:100};
I[1788] = {n:"Farle\'s Ray",t:41,d:"Farle Ingalsse personally discovered this particular species of ray during one of his great adventures. Apparently it has the ability to enchant fish with its deep, southern voice and rhythmic train-like beating of its tail.",ep:1,g:300,l:50,wd:true,fm:true,w:3,p:20};
I[1789] = {n:"Gutted Farle\'s Ray",t:62,d:"This Farle\'s Ray can now be used as an ingredient.",ep:1,g:301,l:50,wd:true,fm:true,w:2,p:20};
I[1790] = {n:"Kiye Gudgeon",t:41,d:"This rare species of gudgeon comes from Kiye Island, off Moon Island. Accustomed to warm currents, it migrates once a year to a hotter clime.",ep:1,g:302,l:1,wd:true,fm:true,w:3,p:1};
I[1791] = {n:"Gutted Kiye Gudgeon",t:62,d:"This Kiye Gudgeon can now be used as an ingredient.",ep:1,g:321,l:1,wd:true,fm:true,w:2,p:1};
I[1792] = {n:"Siktrin Bass",t:41,d:"A cousin of the Lard Bass, the Siktrin Bass is officially an endangered species. The population was hunted enthusiastically ever since some quack idiot doctor claimed that it improved the singing voice.",ep:1,g:303,l:70,wd:true,fm:true,w:3,p:30};
I[1793] = {n:"Gutted Siktrin Bass",t:62,d:"The Siktrin Bass can now be used as an ingredient.",ep:1,g:304,l:40,wd:true,fm:true,w:2,p:30};
I[1794] = {n:"Ediem Carp",t:41,d:"This creature is considered the wisest of all the freshwater fish. It\'s also surprisingly easy to catch... it\'s supreme knowledge of all things plunges many of its kind into an mind-numbing depression.",ep:2,g:305,l:40,wd:true,fm:true,w:3,p:1};
I[1795] = {n:"Gutted Ediem Carp",t:62,d:"This Ediem Carp can now be used as an ingredient.",ep:2,g:306,l:10,wd:true,fm:true,w:2,p:1};
I[1796] = {n:"Small Sandy Carp",t:41,d:"This small carp is sand-coloured, a distinctive feature which in theory should make it invisible to predators. What a pity there\'s not a grain of sand in the lakes of Amakna...",ep:1,g:307,l:40,wd:true,fm:true,w:3,p:1};
I[1797] = {n:"Gutted Small Sandy Carp",t:62,d:"This Small Sandy Carp can now be used as an ingredient.",ep:1,g:308,l:10,wd:true,fm:true,w:2,p:1};
I[1798] = {n:"Gutted Kralove",t:62,d:"This Kralove can now be used as an ingredient.",ep:2,g:310,l:20,wd:true,fm:true,w:1,p:1};
I[1799] = {n:"Unique Kralove",t:41,d:"This Kralove is monogamous. This is surprising when you know its habits.",ep:1,g:311,l:20,wd:true,fm:true,w:3,p:30};
I[1800] = {n:"Gutted Unique Kralove",t:62,d:"This Unique Kralove can now be used as an ingredient.",ep:1,g:312,l:20,wd:true,fm:true,w:2,p:30};
I[1801] = {n:"Perch",t:41,d:"This fish doesn\'t look like much but it is the slyest and quickest of its kind. It\'s worth a try though. Its matchless taste and unique flavour will be ample reward for your efforts.",ep:3,g:313,l:70,wd:true,fm:true,w:3,p:1};
I[1802] = {n:"Gutted Perch",t:62,d:"This Perch can now be used as an ingredient.",ep:3,g:314,l:70,wd:true,fm:true,w:2,p:1};
I[1803] = {n:"Kittenperch",t:41,d:"With the hideousness of its father and the savagery of its mother, this fish is the most difficult of all to catch. It\'s the rarest of its kind, too... Indeed, the mating of a Kittenfish with a Perch was once described by a famous statesman as " + "\"" + "Grotesque, unbelievable, bizarre and unprecedented." + "\"" + " The phrase GUBU has since been coined to describe such scandalous events.",ep:1,g:315,l:70,wd:true,fm:true,w:3,p:50};
I[1804] = {n:"Gutted Kittenperch",t:62,d:"That Kittenperch can now be used as an ingredient.",ep:1,g:316,l:70,wd:true,fm:true,w:2,p:50};
I[1805] = {n:"Shiny Sardine",t:41,d:"Some fish just don\'t know when to put it away... Cover up, get off the stage... Catching this bugger couldn\'t be easier.",ep:2,g:317,l:20,wd:true,fm:true,w:3,p:1};
I[1806] = {n:"Gutted Shiny Sardine",t:62,d:"This Shiny Sardine can now be used as an ingredient.",ep:2,g:318,l:50,wd:true,fm:true,w:2,p:1};
I[1807] = {n:"Dark Sardine",t:41,d:"Unlike the Shiny Sardine, the Dark Sardine is extremely difficult to catch.",ep:1,g:319,l:20,wd:true,fm:true,w:3,p:1};
I[1808] = {n:"Gutted Dark Sardine",t:62,d:"This Dark Sardine can now be used as an ingredient.",ep:1,g:320,l:50,wd:true,fm:true,w:2,p:1};
I[1809] = {n:"Grilled Bass **",t:49,d:"Served on top of lettuce, this fish will fill your belly for a little while. It\'s not the tastiest, though.",ep:2,g:98,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:180};
I[1810] = {n:"Grilled Bass ***",t:49,d:"Served on top of lettuce, this fish will fill your belly for a while. It\'s quite tasty, too.",ep:2,g:80,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:320};
I[1811] = {n:"Grawn Fritters **",t:49,d:"Everybody likes crunchy Grawn Fritters. The problem is that they quickly become addictive.",ep:1,g:81,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:20};
I[1812] = {n:"Grawn Fritters ***",t:49,d:"Everybody likes crunchy Grawn Fritters. The problem is that they quickly become addictive.",ep:1,g:82,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:30};
I[1813] = {n:"Sliced Gudgeon **",t:49,d:"Slices of gudgeon, hard boiled with onions. Quite delightful despite the smell off you for the following few days.",ep:1,g:83,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:20};
I[1814] = {n:"Sliced Gudgeon ***",t:49,d:"Slices of gudgeon, hard boiled with onions. Quite delightful despite the smell off you for the following few days.",ep:1,g:84,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:30};
I[1815] = {n:"Skate Wing **",t:49,d:"When cooked too quickly in black Bwork bwutter, this skate wing releases an eye-watering flavour into the chewing mouth of the muncher. This meal is not a memorable one.",ep:2,g:85,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:180};
I[1816] = {n:"Skate Wing ***",t:49,d:"When cooked in black Bwork bwutter, this skate wing releases a rather bland flavour into the chewing mouth of the muncher. This meal wasn\'t too bad though, all things considered.",ep:2,g:86,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:340};
I[1817] = {n:"Steamed Carp ****",t:49,d:"Steam-cooked to retain the flavour, this small carp\'s flavour will sweep you off your feet!",ep:1,g:87,l:1,wd:true,fm:true,w:1,c:"Cw<60",u:true,ut:true,p:60000};
I[1818] = {n:"Steamed Carp **",t:49,d:"Steam-cooked to retain the flavour, this small carp will make you forget all your troubles. Tomorrow\'s gonna be another day... just enjoy this steamed-carp-flavoured moment!",ep:2,g:88,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:130};
I[1819] = {n:"Steamed Carp ****",t:49,d:"Steam-cooked to retain the flavour, this small carp will make you forget all your troubles. Tomorrow\'s gonna be another day... just enjoy the steamed-carp-flavoured moment!",ep:2,g:89,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:200};
I[1820] = {n:"Grilled Kralove **",t:49,d:"This grilled kralove gives off a strong smell, but it\'s a true delicacy if you manage to overcome your disgust.  \nA small piece of advice... find something long and sharp to eat it with.",ep:2,g:90,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:130};
I[1821] = {n:"Grilled Kralove ***",t:49,d:"This grilled kralove doesn\'t smell too bad, and it\'s a true delicacy if you manage to overcome your indifference.",ep:2,g:91,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:200};
I[1822] = {n:"Seared Perch",t:49,d:"This fish swam a long way, but failed to make it to the spawning grounds. Still, it\'s ready to be eaten, even if it is a little bland.",ep:3,g:93,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:300};
I[1823] = {n:"Seared Perch ***",t:49,d:"This fish swam a long way, and made it to the spawning grounds, where it spawned a few young. It\'s now ready to be eaten, and tastes good.",ep:3,g:94,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:400};
I[1824] = {n:"Seared Perch ****",t:49,d:"This fish swam a long way, and spawned many young in the rivers of Amakna. It\'s now ready to be eaten, and tastes delicious.",ep:1,g:92,l:1,wd:true,fm:true,w:1,c:"Cw<100",u:true,ut:true,p:100000};
I[1825] = {n:"Fried Sardine **",t:49,d:"You won\'t feed the family, or even yourself, with this fried sardine, but it does make an excellent starter.",ep:2,g:96,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:80};
I[1826] = {n:"Fried Sardine ***",t:49,d:"You won\'t feed the family, or even yourself, with this fried sardine, but it does make an excellent main course.",ep:2,g:97,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:140};
I[1827] = {n:"Fried Sardine ****",t:49,d:"You won\'t feed the family, or even yourself, with this fried sardine, but it does make an excellent dessert.",ep:1,g:95,l:1,wd:true,fm:true,w:1,c:"Ci<40",u:true,ut:true,p:40000};
I[1828] = {n:"Grilled Bass ****",t:49,d:"Served on top of lettuce, this fish will fill your belly for a long time. It\'s absolutely delicious!",ep:2,g:99,l:1,wd:true,fm:true,w:1,c:"Cw<70",u:true,ut:true,p:50000};
I[1829] = {n:"Grawn Fritters ****",t:49,d:"Everybody likes Grawn fritters. With a low calorie content, it would stupid to refuse them.",ep:1,g:100,l:1,wd:true,fm:true,w:1,c:"Ci<10",u:true,ut:true,p:10000};
I[1830] = {n:"Sliced Gudgeon ****",t:49,d:"Slices of gudgeon, hard boiled with onions. Quite delightful... And the usual horrible odour is masked by a mysterious scent of fresh flowers too.",ep:1,g:101,l:1,wd:true,fm:true,w:1,c:"Cw<10",u:true,ut:true,p:10000};
I[1831] = {n:"Skate Wing ****",t:49,d:"When cooked with care in black Bwork bwutter, this skate wing releases an incredible flavour into the chewing mouth of the muncher. This meal will truly give you wings.",ep:1,g:102,l:1,wd:true,fm:true,w:1,c:"Ci<70",u:true,ut:true,p:70000};
I[1832] = {n:"Trout FlambÃ© **",t:49,d:"If prepared following the exotic and ancestral recipe of the Lenalds, this kind of fish will help rekindle the fire in your belly... provided you can master the recipe, which is very rare indeed.",ep:1,g:108,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:30};
I[1833] = {n:"Trout FlambÃ© ***",t:49,d:"If prepared following the exotic and ancestral recipe of the Lenalds, this kind of fish will help rekindle the fire in your belly... provided you can master the recipe, which is very rare indeed.",ep:1,g:107,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:60};
I[1834] = {n:"Trout FlambÃ© ****",t:49,d:"If prepared following the exotic and ancestral recipe of the Lenalds, this kind of fish will help rekindle the fire in your belly... provided you can master the recipe, which is very rare indeed.",ep:1,g:109,l:1,wd:true,fm:true,w:1,c:"Cw<20",u:true,ut:true,p:20000};
I[1835] = {n:"Stuffed Pike **",t:49,d:"Your Daddy caught this pike one day during the war. Now he knew if his captain ever saw the fish it\'d be confiscated. Your daddy wanted to bring that fish home to you, so he stuck it up... well, let\'s say he hid it. Your daddy died soon after, so I pulled it out of his... body and hid it in my own... body. Now, little warrior, I give the fish to you.",ep:2,g:132,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:80};
I[1836] = {n:"Stuffed Pike ***",t:49,d:"Your Daddy caught this pike one day during the war. Now he knew if his captain ever saw the fish it\'d be confiscated. Your daddy wanted to bring that fish home to you, so he stuck it up... well, let\'s say he hid it. Your daddy died soon after, so I pulled it out of his... body and hid it in my own... body. Now, little warrior, I give the fish to you.",ep:2,g:133,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:140};
I[1837] = {n:"Stuffed Pike ****",t:49,d:"Your Daddy caught this pike one day during the war. Now he knew if his captain ever saw the fish it\'d be confiscated. Your daddy wanted to bring that fish home to you, so he stuck it up... well, let\'s say he hid it. Your daddy died soon after, so I pulled it out of his... body and hid it in my own... body. Now, little warrior, I give the fish to you.",ep:1,g:134,l:1,wd:true,fm:true,w:1,c:"Cw<40",u:true,ut:true,p:40000};
I[1838] = {n:"Spicy Shark **",t:49,d:"This shark wouldn\'t have the decency to sprinkle you with a few spices before it ate you.",ep:2,g:103,l:1,wd:true,fm:true,w:3,u:true,ut:true,p:300};
I[1839] = {n:"Spicy Shark ***",t:49,d:"This shark wouldn\'t have the decency to sprinkle you with a few hearty spices before it ate you.",ep:2,g:104,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:400};
I[1840] = {n:"Spicy Shark ****",t:49,d:"This shark wouldn\'t have the decency to sprinkle you with a few magic spices before it ate you.",ep:1,g:105,l:1,wd:true,fm:true,w:1,c:"Ci<100",u:true,ut:true,p:100000};
I[1844] = {n:"Trout",t:41,d:"Trout are easy to catch. Experienced fishermen haul them in by threes.",ep:1,g:394,l:1,wd:true,fm:true,w:3,p:0};
I[1845] = {n:"Gutted Trout",t:62,d:"This Trout can now be used as an ingredient.",ep:1,g:396,l:1,wd:true,fm:true,w:2,p:1};
I[1846] = {n:"Ancestral Trout",t:41,d:"This is one of the oldest trout in the world. If the simple passage of time makes you wiser, this trout must be the wisest of all... To be honest, though, that\'s not what I\'ve heard.",ep:1,g:398,l:1,wd:true,fm:true,w:3,p:1};
I[1847] = {n:"Pike",t:41,d:"This pike is a freshwater fish of average size. It\'s a barbecue\'s best friend.",ep:2,g:400,l:10,wd:true,fm:true,w:3,p:1};
I[1848] = {n:"Gutted Pike",t:62,d:"This Pike can now be used as an ingredient.",ep:2,g:401,l:10,wd:true,fm:true,w:2,p:1};
I[1849] = {n:"Tupe-Halett Pike",t:41,d:"This new species - resulting from the cross-breeding of several types of pike by the scientists Halett and Tupe - is supposed to have magical properties. Created only for experimentation, two specimens escaped during a violent argument between the two experts.",ep:1,g:402,l:10,wd:true,fm:true,w:3,p:1};
I[1851] = {n:"Gutted Tupe-Halett Pike",t:62,d:"This Tupe-Halett Pike can now be used as an ingredient.",ep:1,g:403,l:10,wd:true,fm:true,w:2,p:1};
I[1852] = {n:"Gutted Sickle-Hammerhead Shark",t:62,d:"This Sickle-Hammerhead Shark can now be used as an ingredient.",ep:2,g:323,l:80,wd:true,fm:true,w:2,p:1};
I[1853] = {n:"Open-Market Shark",t:41,d:"A cousin of the Sickle-Hammerhead Shark, this animal is more ferocious and doesn\'t have a considerate fish-bone in its body. Catching an Open-Market Shark is the dream of every fisherman - or more precisely, catching one AND staying alive to tell the tale.",ep:1,g:324,l:80,wd:true,fm:true,w:4,p:1};
I[1854] = {n:"Gutted Open-Market Shark",t:62,d:"The Gutted Open-Market Shark can now be used as an ingredient.",ep:1,g:325,l:80,wd:true,fm:true,w:3,p:1};
I[1859] = {n:"Grilled Kralove ****",t:49,d:"This grilled kralove smells delicious. A cold Kikim Inn Beer, sunshine glinting off the Asse sea, a plateful of Grilled Kralove ****. Does life get any better than that?",ep:1,g:91,l:1,wd:true,fm:true,w:1,c:"Ci<50",u:true,ut:true,p:50000};
I[1860] = {n:"Harpoon Fishing Rod",t:20,d:"This very sturdy fishing rod, specially designed to catch sharks, has a hook resembling a bloody harpoon.",ep:1,g:8,l:1,wd:true,fm:true,w:5,an:18,e:[1,6,1,8,100,100,false,false],c:"PJ>36,99",p:20000};
I[1861] = {n:"The Big Pole",t:20,d:"This fishing rod has been specially designed for catching perch.",ep:2,g:8,l:1,wd:true,fm:true,w:5,an:18,e:[1,6,1,8,100,100,false,false],c:"PJ>36,99",p:20000};
I[1862] = {n:"Love Rod",t:20,d:"The wood that this rod is made from smells of resin, and as a result, so does the hook and the wire. This heady scent must be like that of a female Kralove. Why else would all male Kralove rush towards your tackle?",ep:2,g:8,l:1,wd:true,fm:true,w:5,an:18,e:[1,6,1,6,100,100,false,false],c:"PJ>36,59",p:10000};
I[1863] = {n:"Cho\'s Fishing Rod",t:20,d:"Cho was the most renowned cook at the round table. He always provided fresh food for his customers. This rod allowed him to catch the fish he needed for his famous " + "\"" + "Carp at Cho" + "\"" + " dish.",ep:2,g:8,l:1,wd:true,fm:true,w:5,an:18,e:[1,6,1,6,100,100,false,false],c:"PJ>36,59",p:10000};
I[1864] = {n:"Knitting Needle",t:20,d:"The thread of this fishing rod is made of pure wool and a ball of wool replaces the bait. Few Kittenfishes can resist playing with it.",ep:2,g:8,l:1,wd:true,fm:true,w:4,an:18,e:[1,6,1,4,100,100,false,false],c:"PJ>36,29",p:5000};
I[1865] = {n:"Cubic Fishing Rod",t:20,d:"This fishing rod is especially designed to fit the... " + "\"" + "particular" + "\"" + " features of the Breaded Fish.",ep:2,g:8,l:1,wd:true,fm:true,w:4,an:18,e:[1,6,1,4,100,100,false,false],c:"PJ>36,29",p:5000};
I[1866] = {n:"Standard Fishing Rod",t:20,d:"This basic rod will allow young fishermen to catch almost anything provided they are patient enough.",ep:2,g:8,l:1,wd:true,fm:true,w:3,an:18,e:[1,4,1,3,100,100,false,false],c:"PJ>36,9",p:1000};
I[1867] = {n:"Big Fishing Rod",t:20,d:"For professional fishermen only. If you master this hook canon, you\'ll be able to catch small comets from their orbit.",ep:2,g:8,l:1,wd:true,fm:true,w:4,an:18,e:[1,4,1,5,100,100,false,false],c:"PJ>36,39",p:2000};
I[1868] = {n:"Telescopic Fishing Rod",t:20,d:"This fishing rod will go to incredible lengths to catch fish for you, but only if you\'re a master fisherman.",ep:2,g:8,l:1,wd:true,fm:true,w:4,an:18,e:[1,4,1,7,100,100,false,false],c:"PJ>36,69",p:4000};
I[1869] = {n:"Tooth Extractor",t:24,d:"This tooth extractor is specially designed for Gobballs but you can also use it to extract one of your own decayed gnashers. The rest will surely fall out not long after, though.",ep:2,g:34,l:1,wd:true,fm:true,w:0,p:1};
I[1870] = {n:"Gobball Tooth",t:24,d:"This Gobball tooth is so similar to a human one, you\'ll find it hard to tell them apart.",ep:1,g:35,l:1,wd:true,fm:true,w:0,p:1};
I[1871] = {n:"Necklace",t:24,d:"The necklace the Mayor\'s daughter lost. Unfortunately, it\'s in bad condition since its sojourn in a Crow\'s stomach...",ep:2,g:36,l:1,wd:true,fm:true,w:0,p:1};
I[1872] = {n:"Gunpowder",t:24,d:"Gunpowder. There\'s a label with a simple reminder printed on it: \nPowder + Flame = Explosion",ep:2,g:37,l:1,wd:true,fm:true,w:0,p:1};
I[1873] = {n:"Rock Block",t:24,d:"A Plain Crackler\'s rock block, similar to those used in the building of fortifications of Bonta.",ep:2,g:38,l:1,wd:true,fm:true,w:0,p:1};
I[1874] = {n:"Scurvion Venom",t:24,d:"Some Scurvion venom which shouldn\'t fall into foreign hands.",ep:2,g:39,l:1,wd:true,fm:true,w:2,p:1};
I[1875] = {n:"Lord Crow\'s Scythe",t:24,d:"Why cut wheat with this scythe when you can cut granite?",ep:2,g:40,l:1,wd:true,fm:true,w:0,p:1};
I[1876] = {n:"Inspection Form",t:24,d:"This inspection form of the Brakmarian act nÂ°243 enables you to detect whether a man is part of it or not...",ep:2,g:41,l:1,wd:true,fm:true,w:0,p:1};
I[1877] = {n:"Tattered Hood",t:24,d:"The former owner of this hat probably took a few blows too many to the head, which tends to happen when you rebel against Bonta\'s authority.",ep:1,g:42,l:1,wd:true,fm:true,w:0,p:1};
I[1878] = {n:"Special Playing Card",t:24,d:"This playing card has a particular appearance close to perfection. It is apparently a collector\'s card.",ep:2,g:43,l:1,wd:true,fm:true,w:0,p:1};
I[1879] = {n:"Crate of Edged Weapons",t:24,d:"A crate of edged weapons, full of all kinds of blunt instruments.",ep:2,g:44,l:1,wd:true,fm:true,w:500,p:1};
I[1880] = {n:"Kittycare Tin",t:24,d:"Yum! Kittycare! Your Kaniger will leap over the moon with delight.",ep:2,g:45,l:1,wd:true,fm:true,w:0,p:1};
I[1881] = {n:"Mud",t:24,d:"That\'s that taken care of.",ep:2,g:46,l:1,wd:true,fm:true,w:2,p:1};
I[1882] = {n:"Crushed Blop Flowers",t:24,d:"You have picked up a very appetizing Pulpy substance.",ep:2,g:47,l:1,wd:true,fm:true,w:0,p:1};
I[1883] = {n:"Repaired Necklace",t:24,d:"The necklace the Mayor\'s daughter lost, as good as new...",ep:2,g:48,l:1,wd:true,fm:true,w:0,p:1};
I[1889] = {n:"Crow Feather",t:53,d:"Sharpened into quill pens for years, Crow feathers are now used to adorn the rich and famous. No wonder crows are nervous creatures - anyone who knows the value of these feathers will go a long way to get their hands on them.",ep:1,g:327,l:20,wd:true,fm:true,w:1,p:1};
I[1890] = {n:"Kaniger Hair",t:54,d:"The hair of the Kaniger reflects the sun in a strange way, as if it was absorbing some of the rays.",ep:13,g:359,l:70,wd:true,fm:true,w:1,p:1};
I[1891] = {n:"Plisskenskin",t:59,d:"Have you ever dreamt of a magnificent Plissken leather bag? Never? Good on you! It\'s not that resistant anyway!",ep:2,g:361,l:10,wd:true,fm:true,w:1,p:1};
I[1892] = {n:"Lord Crow Feather",t:53,d:"Panic-stricken, Lord Crow spread its wings to fly off and let this feather fall. Nothing special there and yet...",ep:13,g:362,l:160,wd:true,fm:true,w:1,p:1};
I[1893] = {n:"Scurvion Tail",t:65,d:"A fantastic trophy, it\'s a pity it oozes smelly fluid.",ep:14,g:363,l:36,wd:true,fm:true,w:1,p:1};
I[1894] = {n:"Plain Boar Hair",t:54,d:"This type of hair is really disgusting. If you have a closer look at it, you\'ll discover a great microcosm of different parasites living on it... How lucky you are !",ep:13,g:364,l:44,wd:true,fm:true,w:1,p:1};
I[1895] = {n:"Feubuk Beer",t:37,d:"You\'ll recover a few Health Points with this highly alcoholic beer.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:4};
I[1896] = {n:"Bird Meat",t:63,d:"This Tofu leg is proof that hunters can show, although very infrequently, a tiny sunbeam of sensitivity.",ep:1,g:348,l:1,wd:true,fm:true,w:2,p:1};
I[1897] = {n:"Bird Meat **",t:63,d:"Tiny Kwak legs for maximum Kwak-taste.",ep:1,g:349,l:40,wd:true,fm:true,w:2,p:1};
I[1898] = {n:"Larva Flesh",t:63,d:"This yellow and putrid heap represents the true nature of the Larva. Now you understand why their skin is so tough.",ep:1,g:354,l:1,wd:true,fm:true,w:2,p:1};
