I[1902] = {n:"Wabbit Leg",t:63,d:"This cawwot-flavoured Wabbit leg is ideal for stew.",ep:8,g:365,l:20,wd:true,fm:true,w:2,p:1};
I[1903] = {n:"Wabbit Leg **",t:63,d:"A good muscular leg which will make a delightful meal.",ep:8,g:366,l:40,wd:true,fm:true,w:2,p:1};
I[1904] = {n:"White Dreggheadgear",t:16,d:"A White Dreggon Shell padded with leather and wool, this headgear will protect you against basic attacks and the lightning bolts of a stumbling, drunk Bwork Magus. You\'ll also look like you just came out of a Dreggon\'s backside.",ep:11,g:28,l:39,wd:true,fm:true,w:50,p:4200};
I[1905] = {n:"Wabbit Leg ***",t:63,d:"A big leg which will fill you up!",ep:8,g:367,l:60,wd:true,fm:true,w:2,p:1};
I[1907] = {n:"Bunny Ears",t:16,d:"These ears will accentuate your bright smile and get the opposite sex spreading rumours about you...",ep:1,g:30,l:30,wd:true,fm:true,w:9,p:2600};
I[1908] = {n:"Chafer Helmet",t:16,d:"Even Spartapine the Great Reaper doesn\'t have such a helmet, the precious stones and metals used to make it ensure your noggin will be kept safe and sound inside..",ep:13,g:31,l:50,wd:true,fm:true,w:18,p:6500};
I[1910] = {n:"Ouginak Cloak",t:17,d:"This cloak is made from the body parts of an Ouginak, it still has the smell of the creature\'s humid nose. Personally, its taste reminds me of a horny set of Gobball\'s udders... Well, someone told me that... damn...",ep:14,g:33,l:50,wd:true,fm:true,w:10,p:6650};
I[1911] = {n:"Gobbly Leg",t:63,d:"The smell off this small leg disappears when cooked.",ep:1,g:334,l:10,wd:true,fm:true,w:2,p:1};
I[1912] = {n:"Gobball Leg **",t:63,d:"This leg reeks of death... I assure you it was cleared of all involvement in the murder of its owner... Just smells like... Death.",ep:1,g:335,l:20,wd:true,fm:true,w:2,p:1};
I[1913] = {n:"Gobball Leg ***",t:63,d:"This is the leg of a Gobball War Chief. As solid as a Crackler, it could be a very powerful bludgeon, if you can stand the smell...",ep:1,g:336,l:40,wd:true,fm:true,w:2,p:1};
I[1914] = {n:"Gobball Leg ****",t:63,d:"Tender but tough, not too fatty or too dry, this leg improves with age like a good wine.",ep:1,g:337,l:50,wd:true,fm:true,w:2,p:1};
I[1915] = {n:"Insect Flesh",t:63,d:"Don\'t underestimate the value of this slimy and suffocating flesh... It\'s nutritional value, that is.",ep:1,g:370,l:1,wd:true,fm:true,w:2,p:1};
I[1916] = {n:"Insect Flesh **",t:63,d:"Similar to Moskito flesh except there is ten times more of it. Fortunately, some people like it.",ep:3,g:370,l:50,wd:true,fm:true,w:4,p:1};
I[1917] = {n:"Pork Loin",t:63,d:"This choice morsel of boar is quite bloody for the moment but it will make a great meal.",ep:1,g:331,l:30,wd:true,fm:true,w:3,p:1};
I[1918] = {n:"Pork Loin **",t:63,d:"A bit bigger for a bit more happiness, this skilfully carved lump of Plain Boar will delight all kinds of carnivores.",ep:13,g:331,l:50,wd:true,fm:true,w:3,p:1};
I[1919] = {n:"Pork Loin ****",t:63,d:"That piece of Dragon Pig is so tender and soft that you could make a perfect cushion with it. But it\'s still nicer to eat it.",ep:2,g:331,l:80,wd:true,fm:true,w:4,p:1};
I[1920] = {n:"Bontarian Badge",t:24,d:"This badge is used to identify militiamen who have fallen on battlefields. Apparently some people collect them in Brakmar.",ep:2,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[1921] = {n:"Pork Loin ***",t:63,d:"A deliciously tough loin of pork from an athletic pig.",ep:1,g:331,l:60,wd:true,fm:true,w:3,p:1};
I[1922] = {n:"Dragomeat",t:63,d:"Rare high-quality meat, it remains hot hours after roasting. It\'s very convenient for picnics.",ep:2,g:371,l:40,wd:true,fm:true,w:2,p:1};
I[1923] = {n:"Dragomeat **",t:63,d:"This dragomeat, on top of remaining hot, has a  naturally smoky taste.",ep:2,g:371,l:60,wd:true,fm:true,w:2,p:1};
I[1924] = {n:"Dragomeat ***",t:63,d:"Dreggon Dragomeat is a bit hard to chew but is far more nourishing than standard Dragomeat. Some say it has magic properties.",ep:11,g:371,l:70,wd:true,fm:true,w:2,p:1};
I[1925] = {n:"A Day Leave",t:24,d:"This pass gives you a day leave.",ep:2,g:50,l:1,wd:true,fm:true,w:0,p:1};
I[1926] = {n:"Dragomeat ****",t:63,d:"The meat of the Dragon Pig\'s dragon parts (nobody knows their exact location, nor does anybody want to try) is a godsend. Which makes sense given that Dragon Pigs can fly.",ep:2,g:371,l:80,wd:true,fm:true,w:2,p:1};
I[1927] = {n:"Muzzle",t:63,d:"This muzzle of Miliboowolf, with its small firm chops, will perfectly accompany all your salads.",ep:1,g:372,l:30,wd:true,fm:true,w:1,p:1};
I[1928] = {n:"Aggressive Boar Tusk",t:24,d:"The extraction of this Plain Boar tusk certainly required a great deal of know how.",ep:2,g:51,l:1,wd:true,fm:true,w:0,p:1};
I[1929] = {n:"Muzzle **",t:63,d:"This dainty muzzle is synonymous with a lack of will. Consume without moderation.",ep:1,g:373,l:50,wd:true,fm:true,w:2,p:1};
I[1930] = {n:"Muzzle ***",t:63,d:"This tasty meat must be eaten in moderation. There\'s a reason the Moowolf has such terribly bad breath!",ep:2,g:374,l:70,wd:true,fm:true,w:2,p:1};
I[1931] = {n:"Nicked Katana",t:24,d:"It\'s Amayiro\'s weapon. You can easily handle it but it seems to be slightly nicked.",ep:2,g:52,l:1,wd:true,fm:true,w:0,p:1};
I[1932] = {n:"Repaired Katana",t:24,d:"This weapon, which used to be nicked, is now ready to cut whatever you want. Amayiro won\'t be disappointed.",ep:2,g:53,l:1,wd:true,fm:true,w:0,p:1};
I[1933] = {n:"Bird Meat ****",t:63,d:"This small piece of crow is impregnated with powerful magic. Lord Crow himself is responsible for its power.",ep:13,g:350,l:30,wd:true,fm:true,w:2,p:1};
