I[1935] = {n:"Cheque for 100,000 Kamas",t:24,d:"Whoever pays his debts grows rich ok, but this is quite a sum! It would be better to avoid such debt, your children will be grateful...",ep:1,g:54,l:1,wd:true,fm:true,w:0,p:1};
I[1936] = {n:"Hunting Axe",t:20,d:"This axe is especially designed to quickly cut off any part of an animal, living or dead.",ep:1,g:15,l:1,wd:true,fm:true,w:5,an:17,e:[10,4,1,1,30,40,false,false],c:"PJ>41,9",p:1000};
