I[2012] = {n:"Scurvion Blood",t:15,d:"Contrary to received ideas, this very syrupy blood doesn\'t contain poison. What\'s more, it can be used to make powerful preservatives and nice beauty masks.",ep:1,g:389,l:36,wd:true,fm:true,w:1,p:5};
I[2013] = {n:"Nuggets ****",t:69,d:"These little pieces of fried bird are a delight to the taste buds. When they reach your stomach, it\'s a different story altogether.",ep:13,g:117,l:1,wd:true,fm:true,w:1,c:"Cs<20",u:true,ut:true,p:1};
