I[2018] = {n:"Golden Wheat",t:34,d:"This wheat contains a powerful magic.",ep:1,g:474,l:1,wd:true,fm:true,w:2,p:0};
I[2019] = {n:"Golden Wheat Flour",t:52,d:"This flour was made with an Ear of Golden Wheat. Awesome!",ep:1,g:251,l:1,wd:true,fm:true,w:2,p:0};
I[2020] = {n:"Golden Bread",t:33,d:"This Bread has been kneaded with Magic Corn Flour. Selling it is a good way to get rich...",ep:1,g:69,l:10,wd:true,fm:true,w:2,c:"Cv<10",u:true,ut:true,p:1};
I[2021] = {n:"Bright Hop",t:34,d:"This type of hop has a bright and subdued aura revealing the magic Mother Nature has endowed it with.",ep:1,g:475,l:30,wd:true,fm:true,w:2,p:0};
I[2022] = {n:"Bright Hop Flour",t:52,d:"This flour was made with Bright Hops. It contains magical energy for sure!",ep:1,g:253,l:1,wd:true,fm:true,w:2,p:0};
I[2024] = {n:"Briochette",t:33,d:"This small brioche is made from Hops. This explains the huge surge of energy which overcomes you when you eat it.",ep:1,g:8,l:20,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[2025] = {n:"Magic Briochette",t:33,d:"This small brioche is made with Bright Hop Flour. This explains the huge surge of energy which overcomes you when you eat it.",ep:1,g:8,l:20,wd:true,fm:true,w:1,c:"Cv<20",u:true,p:1};
I[2026] = {n:"Storm Flax",t:34,d:"This Flax went through the most terrible storms and rose up again more than seven times. Pretty extraordinary for flax, you must admit. After getting wet every day for more than 148 years by the magic dew of the Great Pahti fields, its fibre might be useful for something.",ep:1,g:476,l:40,wd:true,fm:true,w:1,p:0};
I[2027] = {n:"Storm Flax Flour",t:52,d:"This flour has been made with Storm Flax. It probably has the same properties of resistance.",ep:1,g:254,l:1,wd:true,fm:true,w:1,p:0};
I[2028] = {n:"Magic Solid Bread",t:33,d:"This type of Bread is made with Storm Flax Flour, which gives it a pleasant lightness and a great taste.",ep:1,g:12,l:1,wd:true,fm:true,w:1,c:"Cv<30",u:true,ut:true,p:1};
I[2029] = {n:"Resistant Rye",t:34,d:"This dark cereal can grow under the worst of conditions.",ep:1,g:124,l:50,wd:true,fm:true,w:2,p:0};
I[2030] = {n:"Resistant Rye Flour",t:52,d:"This flour retains all the characteristics of Resisting Rye. Excessive consumption can therefore have chronic laxative effects.",ep:1,g:257,l:1,wd:true,fm:true,w:2,p:0};
I[2031] = {n:"Resistant Rye Bread",t:33,d:"This Bread is prepared with Magic Rye Flour, which gives it an awful flavour but lends it unique nutritional qualities.",ep:1,g:9,l:10,wd:true,fm:true,w:1,c:"Cv<40",u:true,ut:true,p:1};
I[2032] = {n:"Sweet Barley",t:34,d:"This rare type of barley absorbed sweet rainwater during its germination phase, which accounts for its incomparable magical powers.",ep:1,g:477,l:10,wd:true,fm:true,w:2,p:0};
I[2033] = {n:"Sweet Barley Flour",t:52,d:"Sweet Barley flour produces very light bread, so light in fact that it could be blown away by a gust of wind. That\'s no excuse to pig out on it though, OK?",ep:1,g:256,l:1,wd:true,fm:true,w:1,p:0};
I[2034] = {n:"Barley Sugar",t:42,d:"By extracting sugar from sweet barley flour, we obtain this unique magic-flavoured sweetie.",ep:1,g:128,l:1,wd:true,fm:true,w:1,c:"Cv<50",u:true,p:50000};
I[2035] = {n:"Euphoric Hemp",t:34,d:"This Hemp Stem seems to instantly destroy concentration and coordination, causing your enemy to hum ceaselessly, rifle through his sack for anything remotely edible and giggle uncontrollably. Handled by a specialist, it can prove very useful...",ep:1,g:478,l:70,wd:true,fm:true,w:1,p:0};
I[2036] = {n:"Gold-Bearing Oats",t:34,d:"When we look at this kind of oats we get the impression that the grains are covered with gold, the sign of the great magic power that is absorbed during sprouting.",ep:1,g:551,l:20,wd:true,fm:true,w:2,p:0};
I[2037] = {n:"Gold-Bearing Oats Flour",t:52,d:"This flour was obtained using Gold-bearing Oats which impart their soft golden colour and considerable magical powers. They won\'t make a baker-wizard of you, though.",ep:1,g:250,l:1,wd:true,fm:true,w:1,p:0};
I[2038] = {n:"Gold-Bearing Rolled Oat Bread",t:33,d:"This bread with an uber-soft centre is just perfect.",ep:1,g:5,l:10,wd:true,fm:true,w:2,c:"Cv<70",u:true,ut:true,p:1};
I[2039] = {n:"Hunter Test Mark",t:24,d:"You tried to take the test to become a hunter.",ep:1,g:55,l:1,wd:true,fm:true,w:0,p:1};
I[2040] = {n:"Tsog\'s Hidden Chest",t:24,d:"You have found Tsog\'s Chest in a small box. It\'s strange but this box has the same smell as Tsog... yes, that same indescribably horrible smell.",ep:2,g:56,l:1,wd:true,fm:true,w:0,p:1};
I[2041] = {n:"Smelly Gobball Leg",t:24,d:"This leg reeks of death... I assure you it was cleared of all involvement in the murder of its owner... Just smells like... Death.",ep:1,g:64,l:20,wd:true,fm:true,w:0,p:1};
I[2042] = {n:"Mak Gahan\'s Bone",t:24,d:"You took this bone with you after you scattered Mak Gahan\'s body parts all over the room.",ep:1,g:57,l:1,wd:true,fm:true,w:0,p:1};
I[2043] = {n:"Scribbed Name of the Assassin",t:24,d:"The name of the Burnt Cat innkeeper\'s murderer is inscribed on this slimy, smelly piece of paper.",ep:2,g:58,l:1,wd:true,fm:true,w:0,p:1};
I[2044] = {n:"Burnt Cat Inn Beer",t:37,d:"This beer looks too much like cat pee... Or maybe not enough.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:6};
I[2045] = {n:"Receipt for the Box",t:24,d:"This document proves that you\'ve brought back a crate.",ep:2,g:50,l:1,wd:true,fm:true,w:0,p:1};
I[2046] = {n:"Brakmar Key",t:24,d:"This key was stolen by a squirrel for mysterious reasons.",ep:2,g:61,l:1,wd:true,fm:true,w:0,p:1};
I[2047] = {n:"List of soldiers taking a break",t:24,d:"You got this list from the militiaman at the Inn. You can read the following names on it : \nBrank Thoof, Haco Norss, Jack Rottance, Kad Maxy.",ep:2,g:55,l:1,wd:true,fm:true,w:0,p:1};
I[2048] = {n:"List of soldiers taking a break",t:24,d:"You got this list from the militiaman at the Inn. You can read the following names on it : \nHaco Norss, Tink Berval, Brank Thoof, Kad Maxy, Seta Bnamron.",ep:2,g:58,l:1,wd:true,fm:true,w:0,p:1};
I[2049] = {n:"Warrior Xale Dugros\' Confession",t:24,d:"Xale DuGros confesses that he never goes to the Inn. But he regularly has a break.",ep:2,g:55,l:1,wd:true,fm:true,w:0,p:1};
I[2050] = {n:"Warrior Nager Nacmeil\'s Confession",t:24,d:"The warrior Nager Nacmeil confesses that he no longer takes breaks. He\'s been a bit under the weather lately.",ep:2,g:55,l:1,wd:true,fm:true,w:0,p:1};
I[2051] = {n:"Bishom Pot\'s Confession",t:24,d:"Bishom Pot confesses everything. His behaviour is unforgivable.",ep:2,g:55,l:1,wd:true,fm:true,w:0,p:1};
I[2052] = {n:"Signed and Dated Leave",t:24,d:"This document indicates you\'ve got a day off.",ep:2,g:50,l:1,wd:true,fm:true,w:0,p:1};
I[2053] = {n:"Militiaman Allen Tokar\'s Badge",t:24,d:"The Badge of the militiaman Allen Tokar.",ep:2,g:49,l:1,wd:true,fm:true,w:0,p:1};
I[2054] = {n:"Militiaman Yook Aput\'s Badge",t:24,d:"The Badge of the militiaman Yook Aput.",ep:2,g:49,l:1,wd:true,fm:true,w:0,p:1};
I[2055] = {n:"Militiaman Barry Flaye\'s Badge",t:24,d:"The Badge of the militiaman Barry Flaye.",ep:2,g:49,l:1,wd:true,fm:true,w:0,p:1};
I[2056] = {n:"Crow Eye",t:109,d:"A Crow eye is always useful... so long as you know how to avoid the evil eye.",ep:1,g:326,l:20,wd:true,fm:true,w:1,p:100};
I[2058] = {n:"Brandon\'s Heart",t:15,d:"This human heart surely comes from the renowned Lhi, who had a passion for crows.",ep:1,g:328,l:20,wd:true,fm:true,w:5,p:500};
I[2059] = {n:"Dead Crow",t:15,d:"You did good picking it up, it\'s intact. Dead but intact.",ep:1,g:329,l:20,wd:true,fm:true,w:10,p:100};
I[2060] = {n:"Crow Foot",t:103,d:"No need to break the foot of a crow. Especially as you know that, contrary to the Wabbit leg, crow foot brings bad luck.",ep:1,g:330,l:20,wd:true,fm:true,w:1,p:10};
I[2061] = {n:"Crow Cloak",t:17,d:"This cloak, not really nice at first sight, is nevertheless really efficient. Once you get used to the smell of rotting Crow.",ep:1,g:15,l:45,wd:true,fm:true,w:5,p:5600};
I[2062] = {n:"Camouflaging",t:31,d:"You\'ll be nicely hidden until your next fight.",ep:1,g:1,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[2063] = {n:"Winged Boots",t:11,d:"These boots are made from different parts of Crow carcasses. The wearer has a strange feeling of nimbleness comparable to that given by the traditional flying potion made with grilled boletus.",ep:1,g:17,l:41,wd:true,fm:true,w:15,p:4500};
I[2064] = {n:"Camouflaging Scroll",t:14,d:"Thanks to this scroll you\'ll be able to camouflage yourself in the surrounding environment until your next fight. Avoid moving and making strange noises if you don\'t want to be found.",ep:16,g:1,l:10,wd:true,fm:true,w:1,c:"Pg=10&PM=B",u:true,p:250};
I[2065] = {n:"Elite Chafer Helmet",t:24,d:"This Chafer helmet is damaged, but it\'s still effective if you want to be part of the elite.",ep:2,g:59,l:1,wd:false,fm:true,w:0,p:1};
I[2066] = {n:"Kaniger Staff",t:4,d:"This is an approximate replica of a Kaniger\'s staff. It holds many surprises in store - and they\'re not all good.",ep:13,g:22,l:54,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,30,50,false,false],c:"CS>50&CA>40&CC>30",p:5400};
I[2067] = {n:"Forgetfulness Potion: \'Leek Pie\'",t:43,d:"Using this potion will cause you to unlearn one level of the elementary spell \'Leek Pie\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2068] = {n:"Forgetfulness Potion: \'Cawwot\'",t:43,d:"Using this potion will cause you to unlearn one level of the elementary spell \'Cawwot\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2069] = {n:"Forgetfulness Potion: \'Moon Hammer\'",t:43,d:"Using this potion will cause you to unlearn one level of the elementary spell \'Moon Hammer\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2070] = {n:"Shako",t:16,d:"This bone helmet has been in a Kaniger\'s pocket for many years. Worn and scratched it might be, but its properties are as powerful as ever.",ep:9,g:58,l:34,wd:true,fm:true,w:15,p:3200};
I[2071] = {n:"Forgetfulness Potion: \'Release\'",t:43,d:"Using this potion will cause you to unlearn one level of the elementary spell \'Release\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2072] = {n:"Forgetfulness Potion: \'Lightning Strike\'",t:43,d:"Using this potion will cause you to unlearn one level of the elementary spell \'Lightning Strike\'",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2073] = {n:"Forgetfulness Potion: \'Brokle\'",t:43,d:"Using this potion will cause you to unlearn one level of the special spell \'Brokle\'.",ep:2,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[2074] = {n:"Fire Bwak",t:18,d:"This cute little Bwak will soon become an ugly Kwak. No reason to be afraid until then, so keep it with you.",ep:1,g:3,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:2,p:1};
I[2075] = {n:"Water Bwak",t:18,d:"This cute little Bwak will soon become an ugly Kwak. No reason to be afraid until then, so keep it with you.",ep:1,g:2,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:13,p:1};
I[2076] = {n:"Air Bwak",t:18,d:"This cute little Bwak will soon become an ugly Kwak. No reason to be afraid until then, so keep it with you.",ep:1,g:4,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:15,p:1};
I[2077] = {n:"Earth Bwak",t:18,d:"This cute little Bwak will soon become an ugly Kwak. No reason to be afraid until then, so keep it with you.",ep:1,g:5,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:14,p:1};
I[2078] = {n:"Ixa Mustam\'s Will",t:24,d:"This is the will of Oto Mustam\'s father, written in ancient Brakmarian. It\'s such a pity that the sum of your knowledge of the language is one word, " + "\"" + "Guo\'rhalys!" + "\"" + "",ep:2,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[2079] = {n:"Greedovore Wine",t:24,d:"Apparently, it takes about 20 years to distil Greedovore Juice properly. Any less than that, and it\'ll kill you.",ep:2,g:62,l:1,wd:true,fm:true,w:1,p:1};
I[2080] = {n:"Greedovore Juice",t:24,d:"Greedovore Juice is as toxic as Scurvion juice, but if it\'s well distilled, it gives an incomparable taste to wine. Only a few people can actually distil this juice, and most of them are pirates.",ep:2,g:63,l:1,wd:true,fm:true,w:1,p:1};
I[2081] = {n:"Finche Aticus\' Report",t:24,d:"This report written by the spy Finche Aticus gives an exhaustive list of the weapons and warriors in Bonta.",ep:2,g:33,l:1,wd:true,fm:true,w:0,p:1};
I[2082] = {n:"Young Wild Boar",t:32,d:"When a young wild boar witnesses the death of its parents, it begs the murderer to look after it.",ep:13,g:1,l:1,wd:true,fm:true,w:0,m:true,p:10};
I[2083] = {n:"Letter from Oto Mustam",t:24,d:"A letter from your Master addressed to Vil Smisse. It is written in an unknown dialect to prevent nosy parkers like you from reading it.",ep:2,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[2084] = {n:"Vil Smisse\'s Answer",t:24,d:"This is Vil Smisse\'s answer to Oto Mustam, don\'t worry, it is totally incomprehensible to ordinary mortals.",ep:2,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[2085] = {n:"Kikim Inn Beer",t:37,d:"it is not only tasteless but also outrageously expensive.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:5};
I[2086] = {n:"Atyu Sirvis\' Inn Beer",t:37,d:"This Cherry Blop-flavoured beer is sometimes called Manoca.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,p:3};
I[2087] = {n:"Bagrutte Inn Beer",t:37,d:"This beer makes you more valiant for a moment... but be careful... the higher you fly the farther you fall!",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:5};
I[2088] = {n:"Woodenglass Inn Beer",t:37,d:"This is a classic beer and it comes in a wonderfully carved tankard. One of the few cases where the container has more value than the content, though. This is also true of the Iops\' skull and the popular press.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:2};
I[2089] = {n:"Pinchaut Beer",t:37,d:"This beer is hot which makes it hard to drink in summer. On the other hand, it gives off a pleasant smell of toast, thus making it the ideal beer to drink at breakfast when there\'s no bread.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:2};
I[2090] = {n:"Swashbuckler Inn Beer",t:37,d:"This beer tastes of old iron, which is both unpleasant and revitalizing.",ep:16,g:4,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:7};
I[2091] = {n:"How to raise your Bwak",t:25,d:"This Book explains how to raise a Bwak.",ep:3,g:4,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[2092] = {n:"How to raise your Bow Meow",t:25,d:"This Book explains how to raise a Bow Meow.",ep:3,g:3,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[2093] = {n:"How to raise your Wabbit",t:25,d:"This Book explains how to raise a Wabbit.",ep:3,g:5,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[2094] = {n:"Dark Makroute",t:16,d:"The Dark Makroute is a hat created from a Mutilated Makroute stitched together without an anaesthetic. Strangely enough, the master who visited these mutilations upon him is the only one it obeys... it can\'t stand strangers.",ep:14,g:33,l:50,wd:true,fm:true,w:5,p:6600};
I[2095] = {n:"The Bear",t:16,d:"The Bear is a hat made from a head of a dead bear. Its fur is still silky and warm. The tailor who made it must have been really skilled to keep the look of terror on the dead bear\'s face.",ep:14,g:34,l:35,wd:true,fm:true,w:5,p:10000};
I[2096] = {n:"Brave\'s Dark Dora",t:16,d:"Brave the Ghost was the first one to use Dark Wicker in fields other than gastronomy.",ep:14,g:35,l:37,wd:true,fm:true,w:5,p:3800};
I[2097] = {n:"Champo",t:16,d:"The Champo once belonged to one of the greatest Fungi Masters of Amakna. Valiant and brilliant, Gnion the Boletus was the only one of his race who gained the respect of Human beings.",ep:1,g:36,l:43,wd:true,fm:true,w:25,p:5000};
I[2098] = {n:"Bow Kennel Certificate: Earth Bwak",t:77,d:"This certificate describes the characteristics of the Earth Bwak you\'ve put in the Bow Kennels.",ep:3,g:21,l:1,wd:false,fm:true,w:1,p:100};
I[2099] = {n:"Bow Kennel Certificate: Fire Bwak",t:77,d:"This certificate describes the characteristics of the Fire Bwak you\'ve put in the Bow Kennels.",ep:3,g:23,l:1,wd:false,fm:true,w:1,p:100};
I[2100] = {n:"Bow Kennel Certificate: Water Bwak",t:77,d:"This certificate describes the characteristics of the Water Bwak you\'ve put in the Bow Kennels.",ep:3,g:22,l:1,wd:false,fm:true,w:1,p:100};
I[2101] = {n:"Bow Kennel Certificate: Air Bwak",t:77,d:"This certificate describes the characteristics of the Air Bwak you\'ve put in the Bow Kennels.",ep:3,g:20,l:1,wd:false,fm:true,w:1,p:100};
I[2102] = {n:"Bow Kennel Certificate: Wabbit",t:77,d:"This certificate describes the characteristics of the Wabbit you\'ve  put in the Bow Kennels.",ep:3,g:25,l:1,wd:false,fm:true,w:1,p:100};
I[2103] = {n:"Welloy Cab\'s Form",t:24,d:"Paw written by Welloy Cab, this report will delight mathematicians and fans of Namnmnuble Bmbmeckett",ep:1,g:74,l:1,wd:true,fm:true,w:0,p:1};
I[2104] = {n:"Daudgee",t:16,d:"The Daudgee is a disturbing Helmet, made of Ouginak remains and other rubbish. Worn for many years by Gourlo The Terrible, the Daudgee came to symbolise hopeless desolation.",ep:14,g:37,l:48,wd:true,fm:true,w:30,p:6000};
