I[2803] = {n:"Crab Belt",t:10,d:"That strange belt is made entirely of fragments of crab claws and shells. Even with its powerful magic, it will smell of fish forever and ever, you\'d just better get used to it.",ep:1,g:49,l:8,wd:true,fm:true,w:2,p:400};
I[2804] = {n:"Boowish Belt",t:10,d:"The Boowolf donated his precious organs for the making of this incredible belt. Not willingly of course, but we can still be thankful. Don\'t trust its strange appearance, which could unnerve the most depraved Chafer - it\'s very powerful.",ep:2,g:50,l:81,wd:true,fm:true,w:10,p:16800};
I[2805] = {n:"Boowolf Magic Testicles",t:15,d:"Nobody knows exactly when or how it happened but one day these testicles were given magic powers... The extent of their true powers remains shrouded in mystery.",ep:1,g:650,l:80,wd:true,fm:true,w:20,p:1000};
I[2806] = {n:"Moowolf Magic Testicles",t:15,d:"As strange as it may seem, these testicles have magic powers. We don\'t really know to what extent that helped the Moowolf, and to be honest, it\'s probably better not to ask.",ep:2,g:651,l:198,wd:true,fm:true,w:10,p:2000};
I[2807] = {n:"Moowish Belt",t:10,d:"Bowisse the Shoemaker made this belt. He gave it to Brouce Boulgoure when the legendary lumberjack managed to uproot the Soft Oak... You don\'t even deserve to hear about such heroism, child!",ep:2,g:51,l:129,wd:true,fm:true,w:20,p:50000};
I[2808] = {n:"Drasmuty Belt",t:10,d:"Yes my child, it will be hard to resist you with this belt on. Bowisse consequently advises you to never get too close to a Dragon Pig while wearing it. They\'re known to be lusty devils.",ep:2,g:52,l:77,wd:true,fm:true,w:20,s:58,p:16000};
I[2809] = {n:"Chafeerce Belt",t:10,d:"Behind the grotesque name, hides a beautiful creation by Bowisse the Shoemaker. Behind the beautiful creation, hides a grotesque reality... the belt is made of the skin and bones of Bowisse\'s Chafer victims.",ep:3,g:53,l:49,wd:true,fm:true,w:10,p:6500};
I[2810] = {n:"Spicy Belt",t:10,d:"The magical powers of this magnificent red belt will help you concentrate better and learn quicker. Some Iops even manage to hobble to the end of the alphabet before their ignorant lives are extinguished.",ep:1,g:54,l:26,wd:true,fm:true,w:6,p:2000};
I[2811] = {n:"Ouginiakal Belt",t:10,d:"Here\'s a belt that\'ll please the thrill-seekers among you! It was designed to aid the easy and safe hunting of Ouginaks. Mortality rates remained the same as before, but hunters kept wearing the thing. You have to admit it\'s classy though, no?",ep:14,g:55,l:65,wd:true,fm:true,w:10,p:11000};
