I[3203] = {n:"Tribal Ring",t:9,d:"The supposed origin of this ring is doubtful, to say the least. Apparently it once belonged to a clan of Kanniballs of the worst type, the fern eaters. Certainly a story to frighten any young Sadida, and quite a few older Sadidas too.",ep:11,g:49,l:51,wd:true,fm:true,w:5,p:7000};
I[3204] = {n:"Bontarian Belt",t:10,d:"As of last spring, this is officially the trendiest belt on the streets of Bonta. The insignia of a renowned brotherhood of shoemakers adorns the buckle.",ep:3,g:37,l:53,wd:true,fm:true,w:10,c:"Ps=1",p:7400};
I[3205] = {n:"Brakmarian Belt",t:10,d:"It\'s the most fashionable belt in the sewers of Brakmar, perfect if you\'re looking to give the impression that you\'re a hard nut to crack. In your case it\'s just an impression, but it\'s useful nonetheless.",ep:13,g:38,l:53,wd:true,fm:true,w:10,c:"Ps=2",p:7500};
I[3206] = {n:"The Xerbo",t:10,d:"Specially designed to reward skilful knights, the Xerbo must be worn without underwear and in winter only.",ep:13,g:39,l:67,wd:true,fm:true,w:7,p:13000};
I[3207] = {n:"Satisfaction Boots",t:11,d:"These boots are a dramatic improvement on even the most carefully crafted footwear. Comfortable and light, they promise consistent pedal satisfaction with every wear. At the sight of this pair, even your opponent will give a faintly happy, wistfully envious smile.",ep:1,g:38,l:17,wd:true,fm:true,w:10,p:950};
I[3208] = {n:"Bwork Archer Briefs",t:56,d:"The Bwork Archer had the bad habit of putting his arrows away into his leather briefs. This might explain why the Bwork Archer\'s arrows are said to be poisoned.",ep:1,g:649,l:23,wd:true,fm:true,w:1,p:1};
I[3209] = {n:"Magus Bwork Scalp",t:15,d:"Very early in their lives, young Enutrofs set out to hunt for a Bwork Magus Scalp to help them conceal their fast-approaching bald patch. Wearing that thing on their heads, they look even more ridiculous than normal!",ep:4,g:653,l:23,wd:true,fm:true,w:1,p:1};
