I[6428] = {n:"Jurobuti Axe",t:19,d:"#1",ep:2,g:23,l:147,wd:false,fm:true,w:31,et:true,an:17,e:[6,6,1,1,40,30,false,true],c:"CS>153",p:100000};
I[6429] = {n:"Ustuke Axe",t:19,d:"#1",ep:2,g:24,l:148,wd:false,fm:true,w:22,et:true,an:17,e:[7,6,1,1,40,30,false,true],c:"CS>155",p:100000};
I[6430] = {n:"Ototoche Axe",t:19,d:"#1",ep:2,g:24,l:148,wd:false,fm:true,w:36,et:true,an:17,e:[8,6,1,1,40,30,false,true],c:"CS>147",p:100000};
I[6431] = {n:"Stretakug Axe",t:19,d:"#1",ep:2,g:24,l:148,wd:false,fm:true,w:39,et:true,an:17,e:[8,6,1,1,40,30,false,true],c:"CS>159",p:100000};
I[6432] = {n:"Egafube Axe",t:19,d:"#1",ep:2,g:23,l:149,wd:false,fm:true,w:37,et:true,an:17,e:[8,6,1,1,40,30,false,true],c:"CS>149",p:100000};
I[6433] = {n:"Tedosote Axe",t:19,d:"#1",ep:2,g:24,l:149,wd:false,fm:true,w:39,et:true,an:17,e:[7,6,1,1,40,30,false,true],c:"CS>161",p:100000};
I[6434] = {n:"Vucaluie Axe",t:19,d:"#1",ep:2,g:20,l:149,wd:false,fm:true,w:25,et:true,an:17,e:[6,6,1,1,40,30,false,true],c:"CS>174",p:100000};
I[6435] = {n:"Hopap Axe",t:19,d:"#1",ep:2,g:20,l:150,wd:false,fm:true,w:32,et:true,an:17,e:[2,6,1,1,40,30,false,true],c:"CS>143",p:100000};
I[6436] = {n:"Ucibatev Axe",t:19,d:"#1",ep:2,g:23,l:150,wd:false,fm:true,w:39,et:true,an:17,e:[6,6,1,1,40,30,false,true],c:"CS>120",p:100000};
I[6437] = {n:"Ikalugi Axe",t:19,d:"#1",ep:2,g:21,l:150,wd:false,fm:true,w:21,et:true,an:17,e:[2,6,1,1,40,30,false,true],c:"CI>100&CW>7",p:100000};
I[6438] = {n:"Limp Wand",t:3,d:"This Wand is composed of soft materials, making it very tricky to use. However, once produced in combat by an experienced warrior, it reveals its true power.",ep:5,g:33,l:85,wd:true,fm:true,w:10,an:11,e:[10,4,2,4,30,70,false,true],c:"CI>85",p:8500};
I[6439] = {n:"Unreal Wand",t:3,d:"This ethereal wand is the result of a magic mixture of supernatural elements. Sometimes frightening, sometimes whacky, this wand is the epitome of instability.",ep:4,g:32,l:90,wd:true,fm:true,w:12,an:11,e:[10,4,2,3,20,20,false,false],c:"CI>90&CW>30",p:9000};
I[6440] = {n:"Hairy Wand",t:3,d:"This wand is not just an ordinary ball of hair. Its centre absorbs the magic essence of the tufts that fall on it and merges them all together as long hairball. As strange as it may seem, it works!",ep:14,g:31,l:95,wd:true,fm:true,w:12,an:11,e:[5,3,2,5,40,40,false,true],c:"CW>40&CI>40",p:9500};
I[6441] = {n:"Moon Hairs",t:54,d:"These hairs feel incredibly soft and warm when you touch them... almost as though they were still alive.",ep:12,g:656,l:200,wd:true,fm:true,w:2,p:10000};
I[6442] = {n:"Aga Dou\'s Staff",t:4,d:"Always looking for ways to surprise his enemies, the Sadida Aga Dou took care to hang a small doll at the sharp end of his staff. Young Iopettes inevitably rush towards it to get the doll and die from severe impalement.",ep:14,g:31,l:81,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,40,40,false,false],c:"CS>80&CV>50",p:17000};
I[6443] = {n:"Renewed Amulet",t:1,d:"The renowned and hilarious Yamato, a craftsman unjustly despised because of his ridiculous bow, was the first to dare to imbue an amulet with magic... until then it was believed to be impossible.",ep:9,g:57,l:126,wd:true,fm:true,w:20,p:40000};
I[6444] = {n:"Turquoise Amulet",t:1,d:"Apart from its colour, this amulet has no connection whatsoever to the famous Turquoise Dofus. However, it is every bit as powerful. Sometimes you can read a book by its cover...",ep:9,g:58,l:63,wd:true,fm:true,w:10,p:10300};
I[6445] = {n:"Arch Bow",t:2,d:"This bow has been crafted with the utmost care, giving it a perfect curvature. It is said that its creator used the buttocks of a female Gobball as a model. Tragically, she was cut in half when the bow maker accidentally strung the bow with her inside.",ep:14,g:13,l:80,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],c:"CA>70&CC>50",p:16500};
I[6446] = {n:"Chiduc\'s Arc",t:2,d:"Chiduc was a Bow Carver, renowned for his errors of pronunciation. He was incapable of pronouncing the letter " + "\"" + "b" + "\"" + " without adding an " + "\"" + "ow" + "\"" + " behind. Yet another indication of his erratic genius.",ep:12,g:14,l:87,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,6,30,30,false,true],c:"CW>50&CA>80",p:19000};
I[6447] = {n:"Chaferfu\'s Forgetfulness Potion",t:43,d:"With this potion you can unlearn a level of the Chaferfu Summoning Spell.",ep:5,g:36,l:50,wd:true,fm:true,w:1,u:true,p:1000};
I[6448] = {n:"Forgetfulness Potion: \'Arachnee Summoning\'",t:43,d:"Using this potion will cause you to unlearn one level of the Arachnee Summoning Spell.",ep:5,g:36,l:50,wd:true,fm:true,w:1,u:true,p:1000};
I[6449] = {n:"Crowcape",t:17,d:"Personally I can\'t think of a better way of impressing the girls at the bus stop than turning yourself into a shadow or even into Lord Crow. This cape will let you to do just that. It also makes a great pillow... if you\'re lucky.",ep:1,g:54,l:45,wd:true,fm:true,w:26,s:8,p:1000};
I[6450] = {n:"Aman Date Belt",t:10,d:"Aman, a renowned female shoemaker had a lover who often stood her up. As love is blind, she still gave him this magnificent belt as a symbol of their secret love.",ep:14,g:57,l:121,wd:true,fm:true,w:20,p:37255};
I[6451] = {n:"Angel Bow",t:2,d:"Seeing this bow, you have to wonder why it has such a soppy name. Maybe it\'s a respectful prayer to its hordes of victims.",ep:14,g:31,l:82,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],c:"CA>80&CS>50",p:17000};
I[6452] = {n:"Draught Bow",t:2,d:"This strangely-shaped bow is a work of art. The Bow Sculptor who created it is also renowned for having exhibited his most controversial models in Loopine\'s cave, a place forbidden to all but the most hedonistic of bohemians.",ep:9,g:30,l:120,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],c:"CA>200&CS>100&CI>30",p:37000};
I[6453] = {n:"Fishing Bow",t:2,d:"This weapon was inspired by this ancient, incredibly specific, Chinese axiom: " + "\"" + "Many\'s the bow that was useful for catching a flying fish and then cooking it on a slow barbeque for several minutes each side, being particularly handy for turning said fish or plucking it out of the coals should it take a tumble." + "\"" + "",ep:14,g:32,l:70,wd:true,fm:true,w:1,an:10,tw:true,e:[10,4,2,8,30,50,false,true],c:"CS>70&CA>70",p:13000};
I[6454] = {n:"Dark Treestaff",t:4,d:"This Dark Treechnid branch is in fact one of the creature\'s arms. Ideal for arm-wrestling training, it\'s above all an excellent weapon for terrorizing your childhood enemies or torturing the Trunknids.",ep:13,g:23,l:87,wd:true,fm:true,w:10,an:12,tw:true,e:[5,4,1,1,40,50,false,false],c:"CV>150&CW>50",p:20000};
I[6457] = {n:"Kriptonite",t:40,d:"This remarkable Alloy was pulled out of the ground far from here. Use it to decorate the fireplace or, if you wish, to hit a Iop over the head...",ep:1,g:706,l:80,wd:true,fm:true,w:80,p:0};
I[6458] = {n:"Kobalite",t:40,d:"Kobalite is the most impressive alloy ever discovered. The ancient miners thought it was the perfect mixture until they realised it crumbled into dust when it came into contact with Gobball Saliva.",ep:1,g:704,l:100,wd:true,fm:true,w:100,p:0};
I[6459] = {n:"Dark Miner Amulet",t:1,d:"Your only chance to survive in a mine infested with dark miners is to have light. Since you\'ll never manage to steal one of their precious candles, just wear this amulet... at least it\'ll bring you some luck.",ep:14,g:61,l:39,wd:true,fm:true,w:1,c:"CC>30",p:4200};
I[6460] = {n:"Winter Leaf",t:1,d:"This magnificent brooch pays homage to the resistance of the miners of the Grimoth Silver Mine. They spent a winter fighting a Crackler of the worst kind but in the end they were killed by a Tofu who wandered into their hideout on his way home. Boy isn\'t life unfair.",ep:1,g:65,l:98,wd:true,fm:true,w:10,p:25000};
I[6461] = {n:"Spring Leaf",t:1,d:"It was this Amulet, which was especially designed for older Enutrofs, that allowed Setag get rid of all the other miners in the Grimoth mine. Quite heavy-handed, but very effective, it must be said.",ep:7,g:62,l:123,wd:true,fm:true,w:10,p:40000};
I[6462] = {n:"Summer Leaf",t:1,d:"This little brooch is truly lovely. It was made to encourage unlucky people to try their luck at the fun fair, but it\'s also useful when you go on epic hunting expeditions.",ep:13,g:63,l:45,wd:true,fm:true,w:4,p:5400};
I[6463] = {n:"Trav\' Ring",t:9,d:"This ring was made by a famous oriental itinerant, but unfortunately no one could remember his name. He died during an archery contest, putting a Wild Sunflower seed on his head instead of the larger Pumpkin variety.",ep:1,g:50,l:44,wd:true,fm:true,w:5,p:5300};
I[6464] = {n:"Satisfied Summoner\'s Ring",t:9,d:"This ring is an improved version of the celebrated Ring of Satisfaction. It\'s ideal if you want to step out of the blood-red spotlight of dangerous battle.",ep:1,g:51,l:40,wd:true,fm:true,w:5,p:4000};
I[6465] = {n:"Loopine\'s Ring",t:9,d:"Loopine once asked the monster that haunted his cave the secret to making this ring. The monster said he\'d have to do him a few favours in return, and Loopine gladly agreed.  \nLet\'s just say the poor guy never wanted to see another ring in his life after the monster was finished with him, let alone make the bloody things. Blimey!",ep:5,g:52,l:80,wd:true,fm:true,w:10,p:16000};
I[6466] = {n:"Shika Amulet",t:1,d:"This amulet allowed Shika Ingalsse to survive on several occasions when furious Gobballs, bent on making her life a misery, attacked her.",ep:14,g:60,l:29,wd:true,fm:true,w:10,p:2300};
I[6467] = {n:"Ano Neemous Ring",t:9,d:"Nobody knows who the owner of this ring is. He wanted to remain anonymous after a humiliating defeat inflicted by a summoned Arachnee. We must say in his defence that this Arachnee had been compelled by a Iop...",ep:1,g:53,l:70,wd:true,fm:true,w:10,p:13000};
I[6468] = {n:"Young Vald\'s Ring",t:9,d:"While other Iops of his age got presents like a Tabi or a wooden Goultard for their communion, Vald got this ring. It\'s hardly something you can show off to your friends but it\'s very useful for fighting.",ep:1,g:54,l:59,wd:true,fm:true,w:10,p:9275};
I[6469] = {n:"Farle\'s Wedding Ring",t:9,d:"This wedding ring has been worn down by the scratching of barley through hundreds of harvests. It was even there to witness the union of Farle and Shika when they got married in the middle of barley field one spring!",ep:9,g:55,l:87,wd:true,fm:true,w:5,p:20000};
I[6470] = {n:"Gobball Breeder Boots",t:11,d:"These magnificent boots are perfect for kicking Gobballs in the arse when you\'re herding the difficult little runts. Children respond just as well to the same encouragement.",ep:13,g:40,l:68,wd:true,fm:true,w:10,p:12000};
I[6471] = {n:"Patent Lousy Pig Shoes",t:11,d:"These small shoes have been reinforced, repaired and deodorized. They are often used to trap Mush-Mush since the substratum left out by the Lousy Pig seems appetizing to them...",ep:13,g:41,l:30,wd:true,fm:true,w:10,p:2700};
I[6472] = {n:"Golden Dreggheadgear",t:16,d:"This padded Golden Dreggon Shell will protect you from bolts of Bwork Magus lightning. Sadly, it won\'t protect you from real lightning strikes, or the angry, baying mob complaining how, in the good old days of Old Amaknean, lightning strikes used to be called \'strikings\'.",ep:11,g:55,l:57,wd:true,fm:true,w:10,p:8500};
I[6473] = {n:"Sapphire Dreggheadgear",t:16,d:"This shell of Sapphire Dreggon will suit you perfectly. Not everyone is made for it, though... just take a look at the Iops... the bloody idiots don\'t even wear it the right way round!",ep:11,g:57,l:70,wd:true,fm:true,w:10,p:13000};
I[6474] = {n:"Black Dreggheadgear",t:16,d:"This Black Dreggon shell is ideal if you want to remain  discreet by night, and is thus quite popular with two deeply divergent sections of society: peeping Toms in the port of Madrestam and those gentle souls, the Piwi watchers of Amakna. The annual convention is always a hoot, a real hoot.",ep:11,g:56,l:93,wd:true,fm:true,w:20,p:22300};
I[6475] = {n:"Broken Chafer Helmet",t:15,d:"You can\'t use this helmet in such a state. It would hurt your head.  Get a good tailor to put some padding in, and pad his pockets at the same time.",ep:3,g:709,l:40,wd:true,fm:true,w:20,p:1000};
I[6476] = {n:"Dark Miner Magic Candle",t:15,d:"This candle shines even when there\'s no flame and doesn\'t give off heat. Cock your ear and you\'ll hear a slight sputtering, like the noise of breakfast cereal popping in a bowl of milk.",ep:1,g:701,l:40,wd:true,fm:true,w:10,p:10000};
I[6477] = {n:"Dark Miner Hat",t:16,d:"This magnificent hat will help you see everything as bright as daylight, especially during the daytime. It can also be useful to dazzle the beasts haunting the mines or to make Iops believe you\'re... well anything you tell them.",ep:16,g:90,l:103,wd:true,fm:true,w:20,p:27000};
I[6478] = {n:"Mutilated Makroute",t:15,d:"This magic Makroute is in poor condition. It didn\'t stand up to the violence of your attacks and its coat is now dark. A new life could be opening up for it if only you were able to heal it...",ep:14,g:702,l:70,wd:true,fm:true,w:10,p:1000};
I[6479] = {n:"Mutilated Bear",t:15,d:"This small Bear Head is in poor condition. Some string, a bit of fresh tissue and plenty of imagination will transform this horrible thing into a magnificent headgear.",ep:1,g:703,l:70,wd:true,fm:true,w:10,p:1000};
I[6480] = {n:"Dark Wicker",t:15,d:"This Piece of Wicker is as dark as the darkest ghost, as magic as the most magic ghost, as resistant as the most resistant ghost. Just remember ghosts don\'t exist.",ep:14,g:123,l:70,wd:true,fm:true,w:10,p:1000};
I[6481] = {n:"Dora Bora",t:16,d:"This magnificent hat was created on Dora Bora Island, south of Moon Island. Perfectly adapted to fight, it\'s also much appreciated as a fruit basket, for traumatised Kokokos nuts for instance.",ep:12,g:61,l:120,wd:true,fm:true,w:20,p:40000};
I[6482] = {n:"Korko Kousto",t:16,d:"An improved version of the Jouik Kramp, this hat was made out of the best resources found on Moon Island, giving it a rural character. Even if you don\'t look like a Kanniball, you\'ll still give some great headbutts.",ep:12,g:59,l:73,wd:true,fm:true,w:10,c:"PG=10",p:14000};
I[6483] = {n:"Bronze Bwork Helmet",t:16,d:"According to the legend, this impressive helmet turns anyone who wears it into a Bronze Bwork. The helmet was held responsible for a string of incidents where defenceless hobos mysteriously disappeared, leaving only the taste of licked spoon behind them.",ep:20,g:91,l:144,wd:true,fm:true,w:10,p:46625};
I[6484] = {n:"Sram Archer Bow",t:2,d:"When daggers are not enough anymore, when gods are making fun of you, you have to find your own way of fighting. Some followers of Sram have apparently understood, others are still counting on the help of gods...",ep:9,g:40,l:90,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,7,30,50,false,true],c:"CS>90&CA>90&CW>50",p:16000};
I[6485] = {n:"Chafer Archer Bow",t:2,d:"Because of his clattering bones and an obvious lack of dexterity and intelligence, Archer Chafer has never been able to handle such a bow as this one. Although your bones may not shake like his, there\'s no guarantee a beginner like yourself won\'t look just as foolish.",ep:9,g:39,l:120,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,7,30,50,false,true],c:"CA>150&CC>100&CS>100",p:36600};
I[6486] = {n:"Soft Oak Bark",t:96,d:"This bark is more resistant than others, strength emanates from it. But nothing proves it\'s not a fake painted Treechnid bark. Now might be a good time to con a friend...",ep:9,g:666,l:200,wd:true,fm:true,w:10,p:10};
I[6487] = {n:"Soft Oak Bud",t:108,d:"This huge bud of hot and syrupy sap should remind you of your baby\'s bottles if you dare suck its contents. Be careful you might turn into a dead leaf as a side effect.",ep:9,g:665,l:200,wd:true,fm:true,w:10,p:10};
I[6488] = {n:"Soft Oak Root",t:98,d:"Some people make beer with this kind of root. Given that the Soft Oak had no tolerance for the grog, it\'s very inadvisable.",ep:9,g:667,l:200,wd:true,fm:true,w:10,p:10};
I[6489] = {n:"Soft Oak Wood",t:38,d:"This wood has had a few close shaves with Brouce Boulgoure\'s Axe. It has also experienced many other mysterious and dangerous things that even the book of the Bwork Magus does not reveal. You have every reason to expect the worst.",ep:1,g:668,l:200,wd:true,fm:true,w:10,p:10};
I[6490] = {n:"Soft Oak Amber",t:50,d:"This amber contains one of the Soft Oak\'s leaves, trapped for aeons in the sticky sap. This precious treasure is truly a collector\'s item, just like LeChouque\'s yellow and red polkadot socks.",ep:9,g:669,l:200,wd:true,fm:true,w:10,p:10};
I[6491] = {n:"Trunknydum",t:2,d:"This bow is a messed up crossbreed of a Trunknid and a Treechnid. It\'s obviously a failure for a Lumberjack, but a true success for a Bow Carver. Your parents wish they could say the same about you.",ep:9,g:41,l:57,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,7,30,50,false,true],p:8500};
I[6492] = {n:"Wobot Staff",t:4,d:"The distance between the two ends of this staff is identical to the space between the eyes of the Lenalds... Will these howwible Wabbits stop at nothing?",ep:2,g:37,l:60,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,50,50,false,false],c:"CS>60&CV>60",s:11,p:9400};
I[6493] = {n:"Wabbit Flip-Flops",t:11,d:"These wabbits thongs give you the " + "\"" + "cawwot attitude." + "\"" + " They are recommended by experts of ritual dancing, tap-dancing or the Captain Chafer fast tango.",ep:8,g:39,l:60,wd:true,fm:true,w:10,s:11,p:9300};
I[6494] = {n:"Elya Wood\'s Wand",t:3,d:"Used by the most renowned Amaknan Eniripsas, this wand is a great for casting vicious spells at your enemies. Most people use it to make themselves or their friends more intelligent. They say... though I find it hard to believe myself... but they say that someone once turned a Iop into a rat with this. Such an enormous leap in intelligence is unlikely, but try it out!",ep:9,g:39,l:120,wd:true,fm:true,w:10,an:11,e:[10,4,2,4,50,50,false,true],c:"CI>300&CW>100",s:39,p:36800};
I[6495] = {n:"Soft Oak Wand",t:3,d:"Made from the remains of the Soft Oak, this wand is ultra-powerful. Just wave it from right to left according to the specified patterns and it may trigger a shower of toads... or you may look like a perfect idiot.",ep:22,g:42,l:172,wd:true,fm:true,w:10,an:11,tw:true,e:[7,3,3,4,45,70,false,true],c:"CI>400&CC>250&CW>150",p:45000};
I[6496] = {n:"Dark Treechnid Root Wand",t:3,d:"This wand can sometimes turn against its owner. In this case, the best thing you can do is to give it to one of your enemies, or to a Iop - idiots like them will certainly believe it\'s a present.",ep:9,g:40,l:67,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>70&CW>70",p:12000};
I[6497] = {n:"Clearing Balgourde",t:3,d:"Brouce Boulgoure\'s wife, an Eniripsa, always stole her husband\'s famous axe. To stop her, he cut off one of her wings and an arm. Then, when he inevitably regretted it, he gave her this wand. What a gentleman.",ep:9,g:43,l:63,wd:true,fm:true,w:10,an:11,e:[10,4,2,4,30,50,false,true],c:"CI>63&CW>30",p:10325};
I[6498] = {n:"GM Wabbit Y-fwonts",t:10,d:"These briefs of respectable size still sport the marks of their former owner (plus some really strange hairs). On the buttocks or on the head, this garment will bring you unlimited respect around Amakna.",ep:8,g:58,l:60,wd:true,fm:true,w:10,s:11,p:9400};
I[6499] = {n:"Wabbit-tooth Amulet",t:1,d:"The teeth of this amulet have eaten away more Cawwots than Brouce Boulgoure has uprooted trees, so don\'t be surprised if you find Tiwabbits trying to give you kisses on the neck as a result of your powerful Cawwot awoma.",ep:8,g:59,l:60,wd:true,fm:true,w:10,s:11,p:9400};
I[6500] = {n:"Wabbit Ears",t:16,d:"These Ears won\'t improve your hearing but the good news is that your friends will easily spot you in a crowd...and that your enemies will have a good laugh. Keep smiling, this pair of ears will prove essential with time.",ep:8,g:52,l:60,wd:true,fm:true,w:10,s:11,p:9500};
I[6501] = {n:"Cawwot-Bag",t:81,d:"If you carry this bag on your back, you can go on a trip without worrying about food. Even if the Cawwot is as empty as a Iop\'s skull, the leaves on top of it can grow again. Ideal to make herbal tea.",ep:8,g:57,l:60,wd:true,fm:true,w:10,s:11,p:9400};
I[6503] = {n:"Polpullet Hammer",t:7,d:"The Polpullet is the result of a cross breed between an aggressive Fire Kwak and a sickly Tofu. Time out of mind, the Polpullet hunt has been an unchanged ritual. Hunting this horrible creature is a pleasure on many levels.",ep:13,g:35,l:57,wd:true,fm:true,w:20,an:15,e:[6,5,1,1,40,50,false,false],c:"CI>60&CS>20",p:8000};
I[6504] = {n:"Fantal Hammer",t:7,d:"The only things we know about the creator of this hammer are his nickname - a certain Fantal - and his woeful taste. He loved covering himself with Royal Jelly and Tofu feathers... An expensive, useless activity. Some people are starving for God\'s sake.",ep:9,g:36,l:81,wd:true,fm:true,w:20,an:15,e:[10,5,1,1,50,50,false,false],c:"CS>80&CV>70",p:17000};
I[6505] = {n:"Rehadaure Hammer",t:7,d:"This Hammer is ideal for fighting horned beasts... It isn\'t recommended you nail your colours to the mast with it, though...",ep:9,g:37,l:100,wd:true,fm:true,w:20,an:15,tw:true,e:[10,5,1,1,50,50,false,false],c:"CC>100&CW>40&CS>50",p:26000};
I[6506] = {n:"Gogorified Miner Ring",t:9,d:"An Enutrof legend says that a miner is " + "\"" + "gogorified" + "\"" + " when he can\'t stand daylight anymore, a result of spending so much time working down his mine. Never bring a candle close to such a miner, he could turn you into bronze.",ep:1,g:40,l:84,wd:true,fm:true,w:10,c:"PG=3",p:18500};
I[6507] = {n:"Terps Hammer",t:7,d:"The Terps was a very nasty creature, as dangerous and hated as the old Liche, its great rival. Determined to surpass its nemesis, the Terps created this hammer to crush its toes but ended up destroying its feet. The beginning of a great love story.",ep:9,g:38,l:90,wd:true,fm:true,w:10,an:15,e:[10,4,1,1,35,80,false,false],c:"CS>60&CI>60",p:19000};
I[6508] = {n:"Pinambour Hammer",t:7,d:"An exceptional hammer which is ideal to take care either of your darling little Prespic or of your enemies if you\'re a  follower of Chafer Fu.",ep:9,g:39,l:50,wd:true,fm:true,w:20,an:15,e:[6,4,1,1,40,40,false,false],p:6000};
I[6509] = {n:"Crick Hammer",t:7,d:"This magnificent hammer turned the heads of many an Osamodas. It\'s so impressive that people still turn around when they pass by its bearer. You wouldn\'t believe the number of chronic neck injuries this bloody thing has caused.",ep:9,g:40,l:120,wd:true,fm:true,w:20,an:15,tw:true,e:[10,5,1,1,40,50,false,false],c:"CS>100&CI>150",p:36000};
I[6510] = {n:"Castr Hammer",t:7,d:"Kahr was mad for hammer fighting, always fighting with that hammer he was. His pet name for it was \'Quire Boy\', since, like many a 12th century singer, this hammer never did see a nail.",ep:12,g:41,l:120,wd:true,fm:true,w:20,an:15,tw:true,e:[5,5,1,1,50,50,false,false],c:"CC>150&CI>150",p:36000};
I[6511] = {n:"Blarney Hammer",t:7,d:"It\'s the perfect hammer for talking yourself out of sticky situations. You\'ll be an instant success at all the best parties too. Just don\'t abuse its power. Yeah, you know what I mean.",ep:9,g:42,l:120,wd:true,fm:true,w:20,an:15,tw:true,e:[5,5,1,1,40,40,false,false],c:"CI>150&CS>100",p:36000};
I[6512] = {n:"Pog Hammer",t:7,d:"It\'s THE weapon Xelors dreamt of when they were fifteen, especially those looking for thrills and spills. It helps them to get over the endemic Xelor height complex nicely.",ep:14,g:43,l:82,wd:true,fm:true,w:20,an:15,tw:true,e:[10,5,1,1,40,50,false,false],c:"CI>50&CC>50",p:17000};
I[6513] = {n:"Refactor Hammer",t:7,d:"This hammer\'s power comes from a subtle enchantment. You can\'t see it at first sight, nor at second. I thought it was worth pointing it out to increase its value for naive buyers.",ep:1,g:44,l:55,wd:true,fm:true,w:20,an:15,e:[6,4,1,1,50,50,false,false],p:9000};
I[6516] = {n:"Dagger Manic",t:5,d:"A Sram would cut his own parents up if you gave him these daggers at the wrong moment. They cannot resist. Some say they were invented by a powerful group of anti-Sramites who gleefully watch the entire population wipe itself out one by one.",ep:9,g:41,l:121,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CA>150&CS>100&CV>100",p:38000};
I[6517] = {n:"Hischantes Daggers",t:5,d:"Any Srams looking for a new experience would be well advised to get their hands on a pair of these daggers. Their strange powers fill them with treacherous potential... for enemies or friends. The Captain Chafer would have loved them.",ep:7,g:42,l:80,wd:true,fm:true,w:10,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>100&CS>80",p:8000};
I[6518] = {n:"Amrothiline",t:3,d:"Made by a famous sculptor, this wand has won the great N\'hi Wand competition no less than 13 times. It easily beat old Boulgourde models, which were later taken off the market... too dangerous to be used by young Eniripsas.",ep:9,g:44,l:120,wd:true,fm:true,w:10,an:11,e:[6,4,2,4,50,50,false,true],c:"CI>300&CV>100",p:36000};
I[6519] = {n:"Kouartz Wand",t:3,d:"A renowned carver, he changed his name when he started using metal in his creations. Unfortunately, vanity often accompanies genius.",ep:14,g:41,l:80,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>120&CW>40",p:17000};
I[6520] = {n:"The Migraine",t:3,d:"The sculptor of this wand tried many times to change the unfortunate name of his magical weapon, but sales always plummeted. Any publicity is good publicity.",ep:13,g:45,l:85,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>150&CV>100",p:19000};
I[6521] = {n:"Earlik Branch",t:4,d:"People say that this staff would make a female Treechnid blush. We would not recommend you make use of this feature, male Treechnids are very possessive creatures...",ep:9,g:38,l:129,wd:true,fm:true,w:10,an:12,tw:true,e:[5,4,1,1,40,40,false,false],c:"CS>250&CV>200",p:43000};
I[6522] = {n:"Cinati Root",t:4,d:"People say this root is herbivorous. It quickly worms its way through dead leaves and eats young shoots. Very impressive. But, well, unless you\'re fighting Dandelions, it\'s completely useless.",ep:9,g:39,l:120,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,40,40,false,false],c:"CI>200&CS>200&CV>150",p:37000};
I[6523] = {n:"The Hagogue Root",t:4,d:"This very stylish carved root will make an experienced summoner of you. Nothing to write home about in itself, but it\'s a magnet for the female Sadidas.",ep:9,g:40,l:120,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,40,40,false,false],c:"CS>200&CV>150",p:36000};
I[6524] = {n:"Savage Root",t:4,d:"A shy old Sadida tried to lure a young, beautiful female into Hornbeam Wood with this root. He waited for one hundred years but she stood him up. Since that day, walking past some Savage Root on your way to a date is considered a very bad omen.",ep:14,g:41,l:54,wd:true,fm:true,w:10,an:12,e:[5,3,1,1,40,50,false,false],c:"PG=10",p:9000};
I[6525] = {n:"Feca Staff",t:4,d:"The inhabitants of Amakna were fed up of hearing Fecas constantly complaining about their spells, so they made this staff to give them something else to moan about. Blah blah blah, bring 2-turn Immunity back, blah blah blah. Give it a rest, already!",ep:14,g:42,l:94,wd:true,fm:true,w:10,an:12,tw:true,e:[7,5,1,1,40,80,false,false],c:"PG=1",p:25600};
I[6526] = {n:"Hebuse Shovel",t:8,d:"The smith who created this shovel wanted to stay anonymous, as a mark of modesty. But he left a clue in the name of the shovel that would lead devotees of his work to his real identity. These craftsmen are vain after all...",ep:1,g:4,l:94,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,false],c:"CC>200&CV>70&CW>50",p:23000};
I[6527] = {n:"Uftoon Shovel",t:8,d:"Krys Mass was an illustrious Shovel Smith. He was always singing about shovels, out loud and out of tune. This scarred his wife for good, and she transferred the wounds onto the shovel she made him.",ep:1,g:38,l:52,wd:true,fm:true,w:10,an:16,e:[10,5,1,1,20,20,false,false],c:"CC>80&CI>50",p:7100};
I[6528] = {n:"Travel Shovel",t:8,d:"This Shovel has explored all the continents, watched the sun set on the ridge of Crackler Mountain and rise over the tranquil Asse Sea. What? You\'ve never gone further than Moon Island? Shame on you!",ep:12,g:4,l:88,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,false],c:"CI>80&CC>150&CW>40",p:20000};
I[6535] = {n:"Hikule Shovel",t:8,d:"This strange multi-purpose shovel was used to kill lice, to remove dandruff and to get Iops to learn their nine times tables.",ep:9,g:36,l:121,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,false],c:"CC>300&CS>50&CV>100&CW>50",p:37000};
I[6536] = {n:"Dark Miner Shovel",t:8,d:"Dark Miners use this shovel, which is as large as the hand of a Crackler, to crush several Eniripsas at once. Try doing the same, you\'ll feel great.",ep:9,g:34,l:120,wd:true,fm:true,w:10,an:16,e:[10,5,1,1,60,60,false,false],c:"CC>250&CV>100&CS>75",p:34000};
I[6537] = {n:"Mairhe Shovel",t:8,d:"This shovel is really obnoxious. Nobody knows why, but the Mairhes Shovels are always unbearably cheeky. They must have some good qualities... everyone does for god\'s sake...",ep:12,g:37,l:88,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,false],c:"CC>200&CV>100&CA>70",p:20000};
I[6538] = {n:"Vaidaire Shovel",t:8,d:"This shovel allows the Enutrofs to see far into the distance... It\'s not magic or anything, they just stick it in the ground and climb onto it. Ideal for finding your house when you\'re lost in a field of gigantic ferns.",ep:12,g:39,l:84,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,false],c:"CC>200&CV>70",p:18200};
I[6539] = {n:"Gicque Shovel",t:8,d:"This shovel is really different from the others. People will make fun of you if you use it during a fight. One-liner jokes about the Gicque Shovel are really popular at the Inn. I find that kind of humour gross and offensive, but you\'ll probably laugh your thick skull off...",ep:9,g:35,l:71,wd:true,fm:true,w:10,an:16,tw:true,e:[10,4,1,1,25,60,false,false],c:"CS>30&CC>150",p:13000};
I[6540] = {n:"Helabete Shovel",t:8,d:"People say the creator of this shovel truly resembled a beast. A kind of mix between a Boowolf and a Sadida. His shovel is said to have fallen in love with him. What a load of nonsense.",ep:14,g:33,l:87,wd:true,fm:true,w:10,an:16,tw:true,e:[15,5,1,1,30,100,false,false],c:"CC>150&CV>80",p:20000};
