I[6601] = {n:"Fairywork Powder",t:48,d:"When your guests get bored, the best solution is to use the renowned Fairyworks. You can build them yourself thanks to this powder and many other ingredients. This powder will create an explosive atmosphere at your party.",ep:16,g:670,l:1,wd:true,fm:true,w:1,p:100};
I[6602] = {n:"Hyoactive Rat Blood",t:24,d:"Bontarian safety standards request that you keep 100 paces from any Hyoactive substance. If you don\'t, the game will last 3 times longer.",ep:2,g:32,l:1,wd:true,fm:true,w:0,p:1};
I[6603] = {n:"Stuffed Gobball",t:61,d:"This stuffed Gobball is the spitting image of a Gobball; its creators were vicious enough to give it the same smell. So don\'t be surprised if you smell bad when you wake up.",ep:13,g:671,l:1,wd:true,fm:true,w:10,p:1};
I[6604] = {n:"Quaquack",t:18,d:"Beyond the realms of the Tofu, the Gobball and even the Iop, there is a creature dwelling in a dimension of idiocy unimaginable even to your cretinous mind: the Quaquack!",ep:1,g:8,l:1,wd:true,fm:false,w:10,c:"PZ=1",p:1};
I[6605] = {n:"Stuffed Royal Gobball",t:61,d:"This stuffed Gobball is amazing, from the seams to the stuffing, everything\'s been thought about. It\'s an excellent gift for spoilt children or rich brats.",ep:13,g:672,l:1,wd:true,fm:true,w:10,p:1};
I[6606] = {n:"Stuffed Sadida Dopple",t:61,d:"This stuffed Sadida Dopple has a big alarm clock in its stuffing, very useful for Sadidas who find it hard to wake up. It\'s inadvisable to take it under the Hornbeam because you have to take your time in these moments.",ep:13,g:673,l:1,wd:true,fm:true,w:10,p:1};
I[6607] = {n:"Stuffed Ecaflip Dopple",t:61,d:"This stuffed Ecaflip Dopple amuses Ecaflips of all ages.",ep:13,g:674,l:1,wd:true,fm:true,w:10,p:1};
I[6608] = {n:"Stuffed Iop Dopple",t:61,d:"This stuffed Dopple looks just like a real Iop. Too stupid for words and not even the smallest bit of stuffing in its head.",ep:13,g:675,l:1,wd:true,fm:true,w:10,p:1};
I[6610] = {n:"Stuffed Sram Dopple",t:61,d:"This stuffed Sram Dopple was stolen from a young Sram who stole it from one of his friends...",ep:13,g:677,l:1,wd:true,fm:true,w:10,p:1};
I[6611] = {n:"Stuffed Eniripsa Dopple",t:61,d:"This stuffed Eniripsa Dopple could almost fly on its own if its wings were not so worn. It\'s far from new but it makes a nice present all the same.",ep:13,g:678,l:1,wd:true,fm:true,w:10,p:1};
I[6612] = {n:"Stuffed Enutrof Dopple",t:61,d:"Be careful, it\'s very heavy. It\'s stuffed with Bauxite Stones and Golden Nuggets.",ep:13,g:679,l:1,wd:true,fm:true,w:10,p:1};
I[6613] = {n:"Stuffed Feca Dopple",t:61,d:"This stuffed Feca Dopple is almost unbreakable, so it\'s perfect for young, unruly and careless Fecas.",ep:13,g:680,l:1,wd:true,fm:true,w:10,p:1};
I[6614] = {n:"Stuffed Osamodas Dopple",t:61,d:"It is said that this stuffed Osamodas Dopple can summon other soft toys if it\'s correctly maintained. It is in fact an old legend that prevents the young followers of Osamodas from eating it.",ep:13,g:681,l:1,wd:true,fm:true,w:10,p:1};
I[6615] = {n:"Stuffed Cra Dopple",t:61,d:"This stuffed Cra Dopple is made to be hurled onto your playmates, as a kind of boomerang which doesn\'t come back.",ep:13,g:682,l:1,wd:true,fm:true,w:10,p:1};
I[6616] = {n:"Stuffed Xelor Dopple",t:61,d:"This stuffed Xelor Dopple makes a strange noise. It has a clock in its stuffed head, a kind of lullaby to lull young Xelors off to sleep.",ep:13,g:683,l:1,wd:true,fm:true,w:10,p:1};
I[6617] = {n:"Stuffed Boar",t:61,d:"This stuffed Boar looks like a stuffed Boar... Incredible! Please note that its hairs were taken from a real boar. Certainly a token of quality.",ep:13,g:684,l:1,wd:true,fm:true,w:10,p:1};
I[6618] = {n:"Stuffed Tofu",t:61,d:"Who has never dreamt of holding tight a Tofu to his chest? You? Well, in this case, you really buy anything or your friends have no taste when it comes to offer you something.",ep:13,g:685,l:1,wd:true,fm:true,w:10,p:1};
I[6619] = {n:"Stuffed Mush",t:61,d:"This Mush has no painful thorn or paralyzing poison. But it\'s fearsome enough to frighten the most stupid Iops.",ep:13,g:686,l:1,wd:false,fm:true,w:10,p:1};
I[6620] = {n:"Stuffed Prespic",t:61,d:"This stuffed Prespic has no thorn and can\'t turn itself invisible. But it\'s a good toy and will get your friends all envious.",ep:13,g:687,l:1,wd:true,fm:true,w:10,p:1};
I[6621] = {n:"Stuffed Wabbit",t:61,d:"The stuffed Wabbit is indispensable just because it will never go out of fashion. Unlike you.",ep:13,g:688,l:1,wd:true,fm:true,w:10,p:1};
I[6622] = {n:"Dark Vlad\'s Rattle",t:15,d:"This ordinary Rattle once belonged to Dark Vlad, which is enough to make it priceless.",ep:13,g:696,l:1,wd:true,fm:true,w:1,p:2000};
I[6624] = {n:"Stuffed Dragon Pig",t:61,d:"This stuffed Dragon Pig is unique. But be careful, it\'s only suitable for an... experienced... audience.",ep:13,g:689,l:1,wd:true,fm:true,w:10,p:1};
I[6625] = {n:"Lord Crow\'s Cup-and-Ball",t:15,d:"This magnificent toy once belonged to Lord Crow. Too stupid to understand how it worked, he used it to crush his little crows. Everyone has a right to a pastime.",ep:13,g:710,l:1,wd:true,fm:true,w:1,p:2000};
I[6626] = {n:"Captain Chafer\'s Skipping Rope",t:15,d:"Captain Chafer used that skipping rope to keep his finger joints in shape. Since he disappeared from Amakna, it\'s been passing from hand to hand.",ep:13,g:695,l:1,wd:true,fm:true,w:1,p:50};
I[6627] = {n:"Small Multicoloured Fairywork",t:74,d:"This Fairywork will surprise and dazzle the coolest of your friends. Very useful for guild celebrations.",ep:1,g:30,l:1,wd:false,fm:true,w:1,ut:true,p:350};
