I[6642] = {n:"Powerful Urandal Sword",t:6,d:"This sword is only presented to the most accomplished of mercenaries as a kind of conversation piece. That\'s not to say a single swipe wouldn\'t take your leg off...",ep:1,g:25,l:50,wd:false,fm:true,w:20,an:14,tw:true,e:[10,4,1,1,40,40,false,false],c:"Ps=3",p:1};
I[6643] = {n:"Mushden Ice-cream",t:42,d:"This delightful ice-cream is made using traditional methods by the small Mushden farm. The farm tries to impose the Mushd as a basic element in the making of iced desserts.",ep:13,g:143,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:150};
I[6644] = {n:"Wayal Cone",t:42,d:"The upper-part of this ice-cream was inspired by the famous Wa hat.",ep:13,g:144,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:120};
I[6646] = {n:"Bontarian Ice Cream",t:42,d:"This ice-cream, a subtle mixture of fruity flavours, is the result of the \'know-how of angels...\' Well, it\'s what\'s written on the box anyway.",ep:13,g:145,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:90};
I[6647] = {n:"Brakmarian Magma",t:42,d:"This ice-cream combines crunchy and sweet ingredients, and shows \'once again why Brakmar is superior...\' Well, that\'s what\'s written on the box.",ep:13,g:146,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:90};
