I[6653] = {n:"Trool Fair Ticket",t:24,d:"You can get into the fair with this ticket...",ep:13,g:94,l:1,wd:true,fm:true,w:0,p:1};
I[6654] = {n:"Sewer Warden Boots",t:11,d:"Just listen to this... the Sewer Warden was devoured by the female Sewer Warden. He was digested for more than 100 years before he finally died. His boots were fortunately more resistant than he was and they are still in good condition.",ep:16,g:28,l:83,wd:true,fm:true,w:10,p:17800};
I[6655] = {n:"Surprising Lucky Bag",t:89,d:"Whoever put this bag in your bank is really generous. If you take it, they\'ll probably meet you \'by accident\' one dark night and ask for a favour worth twice its value. But hey, enjoy it while you can. (DOUBLE CLICK TO OPEN THE BAG)",ep:1,g:32,l:1,wd:false,fm:true,w:200,u:true,p:500};
I[6656] = {n:"Surprising Lucky Bag",t:89,d:"Whoever put this bag in your bank is really generous. If you take it, they\'ll probably meet you \'by accident\' one dark night and ask for a favour worth twice its value. But hey, enjoy it while you can. (DOUBLE CLICK TO OPEN THE BAG)",ep:1,g:32,l:1,wd:false,fm:true,w:200,u:true,p:500};
I[6657] = {n:"Bag to replace",t:89,d:"ne pas traduire ce texte.",ep:1,g:0,l:1,wd:false,fm:true,w:1,p:1};
I[6658] = {n:"Stuffed Boowolf",t:61,d:"This stuffed Boowolf will keep you warm and will diffuse a pleasant smell of Dead Boowolf sweat in your bedroom.",ep:13,g:699,l:1,wd:true,fm:true,w:10,p:1};
I[6659] = {n:"Fake Quaquack",t:15,d:"Don\'t trust it, it\'s a fake Quaquack. Give it to Skroo Gee - he\'s near the Duck Stall. You will be rewarded.",ep:1,g:700,l:1,wd:true,fm:true,w:1,p:1};
I[6660] = {n:"Groom Hat",t:16,d:"You\'ll be irresistible with this hat. You\'ll break hearts and discover the true meaning of Glory!",ep:2,g:53,l:1,wd:true,fm:true,w:5,c:"PS=0",p:1000};
I[6661] = {n:"Fishing Rod for Quaquack",t:20,d:"Try catching a Quaquack at the Trool Fair with this.",ep:13,g:8,l:1,wd:true,fm:true,w:10,an:18,e:[0,10,1,1,50,2,false,false],p:1};
I[6662] = {n:"Bride Hat",t:16,d:"This wonderful 100% southern larva silk hat, washable in fresh water, will make your beloved melt like a Mint Jelly in the sun.",ep:2,g:54,l:1,wd:true,fm:true,w:5,c:"PS=1",p:1000};
I[6663] = {n:"Bouquet of Demonic Roses",t:6,d:"With this wonderful bouquet of Demonic Roses, you will show your beloved you\'re ready to brave a thousand and one dangers for her/his sweet little face. For a modest sum and without a sore.",ep:2,g:47,l:1,wd:false,fm:true,w:3,an:14,e:[1,4,1,1,50,50,false,true],p:70};
I[6664] = {n:"Class Spell Scroll: Felintion",t:75,d:"(Double click to learn the spell)\nThis scroll will teach Ecaflips the class spell \'Felintion\'.",ep:2,g:5,l:1,wd:true,fm:true,w:1,c:"PG=6",u:true,p:10000};
I[6666] = {n:"Tofu Lollipop",t:42,d:"This tofu-flavoured lollipop is a delight for your taste buds but a cataclysmic nightmare for your breath.",ep:13,g:147,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:30};
I[6667] = {n:"Trool Lollipop",t:42,d:"A really delightful and endless lollipop. To be eaten with your friends, preferably.",ep:13,g:148,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:300};
I[6668] = {n:"Tofu Hot Dog",t:42,d:"With this fatty sausage, you\'ll recover enough strength to digest all the other sausages you ate.",ep:13,g:150,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:300};
I[6669] = {n:"Trool Burger",t:42,d:"This impressive burger could feed an army of starving Chafers. To be eaten in moderation. Overuse of Trool is dangerous.",ep:13,g:149,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:600};
I[6670] = {n:"Wild Sunflower Chips",t:42,d:"These chips are cut out of Wild Sunflower stems. Then, they are cooked in boiling Wild Sunflower oil, for them to feel at home while frying.",ep:13,g:151,l:1,wd:false,fm:true,w:1,u:true,p:300};
I[6671] = {n:"Bean",t:58,d:"...",ep:1,g:471,l:1,wd:true,fm:true,w:1,p:1};
I[6672] = {n:"Xavier the Baker\'s Flour",t:52,d:"This flour is exceptionally fine and light. It\'s so soft that it\'s often used to treat crotch rash. Then it\'s reused afterwards, to give even more taste to the bread.",ep:1,g:250,l:100,wd:true,fm:true,w:1,p:0};
