I[6706] = {n:"Mummy Nova\'s Bandage",t:15,d:"These wrappings are as old as their owner who is himself as old as these wrappings. With the passing of time, they have become soaked with Mummy Nova\'s magic powers... and the smell of her decaying flesh.",ep:1,g:712,l:150,wd:true,fm:true,w:1,p:1000};
I[6707] = {n:"Mummy Nova\'s Cloak",t:17,d:"This stench-soaked cloak is made from pus-impregnated Mummy Nova Bandages. Enough to have the inhabitants of cemeteries for miles around turned on in their graves.",ep:14,g:63,l:75,wd:false,fm:true,w:10,p:14600};
I[6708] = {n:"Dopple Certificate",t:24,d:"This certificate celebrates the date of your last victory over a Dopple.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[6712] = {n:"Horn Cape",t:17,d:"This magnificent cape smells like fruits of the forest. Not enough to drive a Craette mad about you, but enough to drown the stink of a sloppy Sadida.",ep:1,g:82,l:71,wd:true,fm:true,w:10,p:13100};
I[6713] = {n:"Lordsoth Daggers",t:5,d:"Soaked with the blood of the terrible Lordsoth, these daggers helped him bring down the Chafer King during the famous dagger throwing contest at Troolmusement park. The Chafer King never again revealed his leather briefs and went into exile with the illustrious Captain Chafer in the surroundings of the Pandala cemetery.",ep:1,g:34,l:100,wd:false,fm:true,w:10,an:13,e:[10,3,1,1,30,30,false,false],c:"PN~Lordsoth",p:1};
I[6716] = {n:"Nomoon",t:18,d:"This pinchy little monkey seems to like you now. It\'s very docile but it has a huge appetite. It\'ll only eat things that are native to its own island.",ep:3,g:11,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[6717] = {n:"Black Bow Wow",t:18,d:"Take this dog to the park, take him to the toilet, show him to your friends, but whatever you do - and please listen carefully - do not feed him. This pet will remove your arm up to the elbow. \n(THIS LEGENDARY PET DOESN\'T NEED TO EAT)",ep:1,g:10,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[6718] = {n:"White Bow Meow",t:18,d:"The fairer sex of the fairest class will fall under the spell of this cuddly little ball of fluff. For this reason alone it\'s to be avoided.\n(THIS LEGENDARY PET DOESN\'T NEED TO EAT)",ep:1,g:9,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[6719] = {n:"Bearman\'s Headgear",t:16,d:"This strange headgear used to belong to the notorious Bearman. Sewn from the remains of the head of a decomposing bear, the headgear will itself turn heads thanks to the unmistakable whiff-trace that follows you wherever you go.",ep:1,g:64,l:20,wd:true,fm:true,w:10,s:12,p:1300};
I[6720] = {n:"Bearman\'s Cloak",t:17,d:"This beautiful cloak has been worn for years by the famous Bearman. It won\'t turn you into a bear, but you will be able to rival the greatest of fighters.",ep:8,g:58,l:20,wd:true,fm:true,w:10,s:12,p:1300};
I[6721] = {n:"Bearman\'s Boots",t:11,d:"These boots are lined with bear fur: even the coldest-blooded creatures will have toasty warm feet.",ep:2,g:51,l:20,wd:true,fm:true,w:10,s:12,p:1300};
I[6722] = {n:"Bearman\'s Wedding Ring",t:9,d:"The Bearman has vowed never to take off this wedding ring in memory of his dead wife... the besotted groom summoned a bear to impress his newly-wed love. She went to give it a hug... the summoned bear, raised by a distant father and an abusive mother, thought she was trying to beat him... you can guess the rest... The most tragic thing about this story is that Bearman hadn\'t made a single payment on the ring. Man, that has to hurt!",ep:1,g:66,l:20,wd:true,fm:true,w:2,s:12,p:1300};
I[6723] = {n:"Bearman\'s Necklace",t:1,d:"The Bearman was wearing this necklace around his neck when he faced the hooligans of Bimdhul\'s lair. Legend has it that the amulet saved him, but on close inspection, you can see why it\'s just a legend.",ep:1,g:74,l:20,wd:true,fm:true,w:2,s:12,p:1300};
I[6724] = {n:"Bearman\'s Belt",t:10,d:"This little bear hair-covered belt will hide your love handles perfectly. You should wear it always to avoid disappointing your spectators.",ep:1,g:66,l:20,wd:true,fm:true,w:10,s:12,p:1300};
I[6725] = {n:"Bearman\'s Staff",t:4,d:"The Bearman used this staff to tame his summoned Bear and from time to time, to rap his children\'s knuckles when they didn\'t do their homework. Here\'s a man who understood the value of education.",ep:14,g:46,l:20,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,50,50,false,false],c:"CA>50&CV>50",s:12,p:1300};
I[6731] = {n:"Ice Kwakamulet",t:1,d:"With this amulet around your neck, you might fool yourself into thinking people won\'t smell your breath. No chance!",ep:1,g:71,l:42,wd:true,fm:true,w:3,s:13,p:4900};
I[6732] = {n:"Ice Kwakring",t:9,d:"Long ago this small ring was much sought after by Enutrofettes who preferred to use it to decorate their toes. An excellent way of hiding their warts.",ep:1,g:63,l:42,wd:true,fm:true,w:2,s:13,p:4900};
I[6735] = {n:"Ambusher Root",t:98,d:"This tiny root perfectly embodies treachery. Nobody knows why, but everybody knows.",ep:12,g:96,l:22,wd:true,fm:true,w:5,p:200};
I[6736] = {n:"Ambusher Bud",t:108,d:"This small Ambusher bud contains a sticky and syrupy sap. If you have the misfortune to walk on an old Ambusher hidden in the long grass, you may remain caught until it devours your boots entirely. On the other hand, if you manage to take an intact Ambusher bud, you will be able to hush a moaning Feca by pretending it\'s chewing gum.",ep:12,g:97,l:22,wd:true,fm:true,w:5,p:1};
I[6737] = {n:"Ambusher Bark",t:96,d:"The Ambusher doesn\'t really have real branches like any self-respecting tree. However it has a thin bark that is quite hardy and covered by a vast number of bumps. Very practical for creating tool hilts that do not slip through the fingers, or for beating the behind of the most insolent children. In both situations, you are completely satisfied if you are the one who is holding the hilt.",ep:12,g:98,l:22,wd:true,fm:true,w:5,p:200};
I[6738] = {n:"Chief Crocodyl Skull",t:47,d:"This huge skull is testimony to the appalling dental hygiene of Chief Crocodyl. The funny thing is it still seems to contain some magic power since it is still inhabited by the Chief Crocodyl\'s soul. Sometimes it even sheds crocodyl tears if you\'re very nasty to him.",ep:4,g:637,l:70,wd:true,fm:true,w:10,p:1000};
I[6739] = {n:"Crocodyl Skin",t:59,d:"Actually getting a complete piece of Crocodyl skin is almost a miracle. Most of the time, poachers only collect a few scales. Ideal to make bags, this old skin will also be appreciated by tailors who make fighting-underwear.",ep:4,g:601,l:36,wd:true,fm:true,w:10,p:1000};
I[6740] = {n:"Chief Crocodyl Skin",t:59,d:"This skin, made up of many scales, is superior to any other classical Crocodyl skin. Indeed, the outward side of the Chief Crocodyl skin is stronger and covered with dangerously sharp scales while the inward side is particularly soft. The story goes that some old tailors take one side for the other when they make underwear. It does not say if they get more or less customers as a result...",ep:4,g:600,l:69,wd:true,fm:true,w:10,p:1000};
I[6742] = {n:"Deceitful Amulet",t:1,d:"This amulet is made of a mixture of Ambusher leaves and litter from Moon island. It looks more like a garland than a real amulet, but it will help you seduce the wildlife of the island, which almost exclusively consists of abominable creatures. No Ambusher will resist you, they all will fly into your arms to give you a hickey. Only the most unlucky in love will appreciate this piece.",ep:12,g:69,l:33,wd:true,fm:true,w:5,s:16,p:3000};
I[6743] = {n:"Deceitful Wedding Ring",t:9,d:"Take some Ambusher leaves, pile them up, let them macerate in stale alcohol, pierce them, drink the left-over alcohol, stick the leaves around a piece of bark, fix some pieces of Kokoko leaves with a slimy material, and here is a magnificent Deceitful Wedding Ring. It smells really bad and it will be quite handy for you to justify the smell of your fingers overall if you have a tendency to put them everywhere. Especially where you shouldn\'t.",ep:12,g:60,l:33,wd:true,fm:true,w:5,s:16,p:3000};
I[6744] = {n:"Ambusherboots",t:11,d:"Once you\'ve tried these boots on, you won\'t be able to part with them. Not because they are exceptional, but because they are exceptionally sticky. A feature they often share with female Ambushers...",ep:12,g:47,l:34,wd:true,fm:true,w:5,s:16,p:3200};
I[6745] = {n:"Deceitful Belt",t:10,d:"Outstanding handicraft made of remains of Ambushers and litter picked up along the Moon beaches, in the middle of the foul foam, this belt, when worn alone, will give you a really surprising look. Enough to disconcert your enemies or surprise your beloved, you\'ll be able to take advantage of this special moment when, for once, you\'ll have the upper hand.",ep:12,g:62,l:33,wd:true,fm:true,w:5,s:16,p:3000};
I[6746] = {n:"Earth Kwakamulet",t:1,d:"Oto Mustam, the leader of the Brakmar warriors, wore this small amulet long ago... though only at the organised orgies of Brakmar. They say it doubled as a leash!",ep:5,g:72,l:42,wd:true,fm:true,w:3,s:14,p:4900};
I[6747] = {n:"Wind Kwakamulet",t:1,d:"When the wind blows in its feathers, the Wind Kwak feels as free as an eagle, gliding like a dead leaf carried by a gust of wind. In spite of the clumsy description, it really is quite impressive.",ep:5,g:70,l:42,wd:true,fm:true,w:3,s:15,p:4900};
I[6748] = {n:"Earth Kwakring",t:9,d:"Judiciously worn, this ring will make your stubby little fingers look a little longer. Unfortunately for some, it only works on fingers.",ep:5,g:64,l:42,wd:true,fm:true,w:2,s:14,p:4900};
I[6749] = {n:"Wind Kwakring",t:9,d:"This ring is so light that it could be blown off by the least gust of wind. But don\'t expect you\'ll be taken away with it. At best, you\'ll be safe, humiliated and on solid ground.",ep:5,g:62,l:42,wd:true,fm:true,w:2,s:15,p:4900};
I[6750] = {n:"Ice Kwakblade",t:6,d:"Cold and sharp, this blade will revive its users\' most primitive instincts.",ep:1,g:51,l:41,wd:true,fm:true,w:5,an:14,e:[5,5,1,1,50,50,false,false],c:"CC>50&CV>50",s:13,p:4600};
I[6751] = {n:"Earth Kwakblade",t:6,d:"" + "\"" + "This ribbed blade is lubricated for increased pain." + "\"" + " That\'s what the handbook says... What is that supposed to mean?",ep:5,g:53,l:41,wd:true,fm:true,w:5,an:14,e:[5,5,1,1,50,50,false,false],c:"CS>50&CV>50",s:14,p:4600};
I[6752] = {n:"Wind Kwakblade",t:6,d:"Ideal for cutting clouds, this blade will also dissect Moskitoes and split hairs.",ep:5,g:50,l:41,wd:true,fm:true,w:5,an:14,e:[5,5,1,1,50,50,false,false],c:"CA>50&CV>50",s:15,p:4600};
I[6753] = {n:"Ice Kwakaboots",t:11,d:"As perfect as ice-skates on frozen lakes, these boots are very useful for keeping your feet cool, or storing your flask. Recommendations? Don\'t put them by the fire to dry, you\'ll never see them again.",ep:2,g:36,l:40,wd:true,fm:true,w:5,s:13,p:4400};
I[6754] = {n:"Earth Kwakoboots",t:11,d:"" + "\"" + "Nothing\'s better for the feet than a pair of Earth Kwakoboots" + "\"" + " said Rola Ingalsse, the famous ploughwoman. Soon after she somehow shovelled a giant clod of earth into her own eyes and was blind for ever more.",ep:5,g:49,l:40,wd:true,fm:true,w:5,s:14,p:4400};
I[6755] = {n:"Wind Kwakoboots",t:11,d:"Basic but efficient, these surprisingly light boots are sometimes used as wind socks. Listen carefully though... People who find themselves downwind of this improvised apparatus often die.",ep:5,g:48,l:40,wd:true,fm:true,w:5,s:15,p:4400};
I[6756] = {n:"Earth Kwape",t:17,d:"Ideal for camouflaging yourself as a lump of earth, this cloak will help you attack ploughmen by surprise and steal their treasures. It is for this reason that collectors of ancient pottery covet it so fiercely.",ep:8,g:64,l:41,wd:true,fm:true,w:5,s:14,p:4600};
I[6757] = {n:"Wind Kwape",t:17,d:"Light and refined, this creation is also used as a curtain by the most destitute in the region. Mummy Nova herself used to wear this as an evening dress.",ep:8,g:62,l:41,wd:true,fm:true,w:5,s:15,p:4600};
I[6758] = {n:"Earth Kwakelt",t:10,d:"The Earth Kwak is not very social and is especially hunted for its feathers, as everybody knows. If you wear this belt around your hips, you\'ll have the Earth Kwak hunters thinking you\'re an over the hill Kwak. Sometimes appearances can be truer than reality.",ep:12,g:65,l:41,wd:true,fm:true,w:5,s:14,p:4600};
I[6759] = {n:"Wind Kwakelt",t:10,d:"" + "\"" + "The only way to catch an upset old male Wind Kwak is to dress up as an upset female Wind Kwak. Then, the male will try to understand why the female is upset and will try every possible means to satisfy her. Once the male is satisfied with his performance, you should take advantage of his beatitude to fleece him." + "\"" + " This is what one can read in part twelve of book three on Wind Kwak hunting. Besides, it is clearly specified that this belt is an essential element to pass yourself off as a female Wind Kwak. You know what you have to do now.",ep:12,g:63,l:41,wd:true,fm:true,w:5,s:15,p:4600};
I[6760] = {n:"Earth Kwak Headdress",t:16,d:"This Earth Kwak headdress is so heavy it\'ll always keep your feet on the ground. If the ground happens to be soft, well, it\'ll keep your chin on the ground.",ep:13,g:71,l:41,wd:true,fm:true,w:25,s:14,p:4600};
I[6761] = {n:"Wind Kwak Headdress",t:16,d:"To keep your hair streaming in the wind even with a headdress, there\'s nothing like this lovely Wind Kwak Headdress which will certainly enable you to give free rein to your hair in most circumstances. It is enough to take the most blasÃ© of Chafers aback.",ep:13,g:69,l:41,wd:true,fm:true,w:5,s:15,p:4600};
I[6762] = {n:"Ambusher-up",t:4,d:"" + "\"" + "For a punch-up, there\'s nothing like an Ambusher-up." + "\"" + " This is what could be read on the A-Team Travel Agency\'s advertising leaflet. The agency offered to rebuild this staff for their clients themselves from various resources scattered on Moon Island. Some sort of treasure hunt except there are no maps.",ep:12,g:44,l:32,wd:true,fm:true,w:5,e:[15,4,1,1,20,70,false,false],s:16,p:2900};
I[6763] = {n:"Ambusherot",t:17,d:"As the story goes, the dead Ambushers are very comfortable once they have taken the time to rot under the sun. Indeed, they become much more flexible and softer with time. Many adventurers would like to say the same about their beloved.",ep:12,g:61,l:33,wd:true,fm:true,w:5,s:16,p:3000};
I[6764] = {n:"Ambusheadgear",t:16,d:"This headgear isn\'t giving you the smartest look, is it? But you do  still look less stupid with it on. So just keep it!",ep:12,g:68,l:31,wd:true,fm:true,w:5,s:16,p:2800};
I[6765] = {n:"Mimilk",t:79,d:"Warning! As clearly specified on the package you should never give Mimilk to a young Bow Meow - it will ruin the carpets for sure.",ep:1,g:1,l:1,wd:false,fm:true,w:1,p:4};
I[6766] = {n:"Farle\'s Ears",t:1,d:"This apparently simple amulet was made from three magic ears of Corn, covered with the dust of precious stones, and planted in the Snossios plains during the thirteenth harvest of Istrabraq. It gives incredible courage to its bearer, who with its help can reap entire plains and valleys without rest.",ep:1,g:68,l:80,wd:true,fm:true,w:5,s:17,p:16500};
I[6767] = {n:"Farle\'s Magic Bracelet",t:9,d:"Shika covered this bracelet of precious stones with a hempen cloth to avoid drawing the Crows\' attention while Farle sowed his barley.",ep:13,g:61,l:80,wd:true,fm:true,w:5,s:17,p:16500};
I[6768] = {n:"Soki",t:32,d:"Take this miserable Bow Meow with you... That\'ll cheer the little fella up a bit.",ep:1,g:6,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[6769] = {n:"Farle\'s Staff",t:4,d:"This magnificent staff has very beautiful teeth on one end, which makes for an excellent fork. Farle used it to make huge haystacks - higher than the biggest Elm growing in the Eltneg forest of old. It is said that Brouce Boulgoure himself felled the tree for this staff, in return for an unbelievable quantity of oat flakes, which Shika Ingalsse himself offered. He used to gulp down fistfuls before spending days on end hacking entire phyla out of existence.",ep:14,g:43,l:80,wd:true,fm:true,w:10,an:12,tw:true,e:[10,5,1,1,45,45,false,true],c:"CS>100&CV>100",s:17,p:16500};
I[6770] = {n:"Moumouse",t:15,d:"This Moumouse was driven out of Grandma\'s house with a broom.",ep:1,g:282,l:1,wd:true,fm:true,w:10,p:1};
I[6771] = {n:"Tea Ring",t:9,d:"This ring hasn\'t proved itself yet. It is a unique creation made by a jeweller\'s apprentice for an important test. It is made from a standard iron ring plunged into a magic Tea solution.",ep:1,g:1,l:4,wd:false,fm:true,w:1,p:50};
I[6773] = {n:"Tude Amulet",t:1,d:"This amulet was made in the Tude manner, hence its name. It is one of the earliest and simplest forms of jewellery, and so it is used to train apprentice jewellers. It is true that the thing is not very powerful, but you can\'t have it all, can you?",ep:1,g:19,l:1,wd:false,fm:true,w:1,p:25};
I[6774] = {n:"Farle\'s Hooves",t:11,d:"These hooves have been carved from various rare woods, reinforced with leather pieces of priceless value and padded with magic cereals. Light, stylish and comfortable, these hooves will resist the passage of time. Many misogynistic adventurers would like to say the same about their beloved.",ep:9,g:46,l:80,wd:true,fm:true,w:10,s:17,p:16600};
I[6775] = {n:"Farle\'s Cloak",t:17,d:"This cape, a fashionable patchwork of cloth and leather, has allowed Farle Ingalsse to single-handedly sow entire fields for numberless seasons on end. Once folded up and used as a pouch, its capacity seems to be almost unlimited. Nobody really knows the tailor behind this marvel. All the story tells us is that his business went tail-up when his clients began to confuse his cloaks with floor cloths. What a sad end to a fine career!",ep:13,g:70,l:80,wd:true,fm:true,w:10,s:17,p:16500};
I[6776] = {n:"Farlebelt",t:10,d:"This belt served Farle Ingalsse as a butcher\'s apron when slaughtering Gobballs in his makeshift abattoir. A cruel, thankless task which he nevertheless carried out with obvious and undignified pleasure.",ep:4,g:61,l:80,wd:true,fm:true,w:10,s:17,p:16500};
I[6778] = {n:"Farle\'s Straw Hat",t:16,d:"This straw hat has been made with several plaited magic ears, and padded on the inside with various types of hair and fabrics hand sewn by Farle\'s wife, Shika Ingalsse. Classier than the Ninnish, and more stylish than the Doddgy, this hat will protect you from the heat as it did Farle through hundreds of long harvests. In this hat, you\'ll own those fields.",ep:13,g:67,l:80,wd:true,fm:true,w:10,s:17,p:16500};
I[6779] = {n:"Sram Spy\'s Report",t:24,d:"Spy Ztiv Oztin\'s report: taken back with some difficulty from Joe Stonefiddler\'s very hands.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[6780] = {n:"Initiate\'s Sword",t:6,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:96,l:1,wd:true,fm:true,w:10,an:14,e:[5,4,1,1,50,50,false,false],p:1};
I[6781] = {n:"Initiate\'s Wand",t:3,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:8,l:1,wd:true,fm:true,w:10,an:11,e:[5,4,2,3,50,50,false,true],p:1};
I[6782] = {n:"Initiate\'s Staff",t:4,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,50,50,false,false],p:1};
I[6783] = {n:"Initiate\'s Bow",t:2,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:10,tw:true,e:[5,4,2,6,50,50,false,true],p:1};
I[6784] = {n:"Initiate\'s Dagger",t:5,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:10,l:1,wd:true,fm:true,w:10,an:13,e:[5,3,1,1,30,50,false,false],p:1};
I[6785] = {n:"Initiate\'s Hammer",t:7,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:15,e:[5,4,1,1,50,50,false,false],p:1};
I[6786] = {n:"Initiate\'s Shovel",t:8,d:"With this basic-looking weapon, you\'ll feel like you know how to fight.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:16,e:[5,4,1,1,50,50,false,false],p:1};
I[6787] = {n:"Filled and Valid Form",t:80,d:"This little form contains the name of a potential candidate for the baker\'s delivery man job.",ep:1,g:6,l:1,wd:false,fm:true,w:0,c:"PW>1499&CA>49",p:0};
I[6788] = {n:"Cakes",t:24,d:"These cakes are still hot from the oven. You have to deliver them while they\'re still warm. Do you really think you have time to stare? And wipe that dribble off the crust... Disgusting.",ep:1,g:245,l:1,wd:false,fm:true,w:0,p:1};
I[6789] = {n:"Field Amulet",t:1,d:"This small amulet blooms in spring, dries out in summer, fades in autumn, and goes rotten in winter. An ideal opportunity to change your style with the passing seasons.",ep:1,g:73,l:10,wd:false,fm:true,w:5,s:18,p:500};
I[6790] = {n:"Form to fill",t:80,d:"This form looks like a simple sheet of paper. Get this though - one touch and the paper figures out if the person suits the criteria in the heading! Isn\'t that nuts?",ep:1,g:6,l:1,wd:false,fm:true,w:0,ut:true,p:0};
I[6791] = {n:"Country Ring",t:9,d:"With this little ring on your finger, you\'ll be able to walk through fields in the countryside. What do you mean you can do that already? Wow!",ep:1,g:65,l:10,wd:true,fm:true,w:5,s:18,p:500};
I[6792] = {n:"Deflower Staff",t:4,d:"This deflower-shaped staff is made from the remains of wild flowers that were cut down in cruel and bloody battles. All the anger and hatred felt by the poor flowers is concentrated in this tiny tool. This weapon is used by the most treacherous Srams who lure naive females with their \'bunch of deflowers\'...",ep:1,g:45,l:10,wd:true,fm:true,w:10,an:12,e:[7,4,1,1,45,50,false,false],c:"CV>20",s:18,p:500};
I[6793] = {n:"Tea Ring",t:9,d:"This ring has proven its worth, as shown by the little mark made on the inside. It is a unique creation made by a jeweller apprentice for an important test. It is made from a standard iron ring plunged into a magic Tea solution.",ep:1,g:1,l:4,wd:true,fm:true,w:1,p:50};
I[6794] = {n:"Wild Boots",t:11,d:"If you\'re looking for something to trample those flowers growing in your fields, these boots are just the ticket. Your feet mightn\'t smell so bad with them on. It\'s a shame they don\'t come as shorts too.",ep:1,g:50,l:10,wd:true,fm:true,w:10,s:18,p:500};
I[6795] = {n:"Purple Cloak",t:17,d:"If you\'re planning to go to one of those eternally popular BABA theme-nights, this cloak is just what you need.",ep:1,g:65,l:10,wd:true,fm:true,w:10,s:18,p:500};
I[6796] = {n:"Flowery Belt",t:10,d:"With this petal-peppered belt around your waist, you can slip out of a nasty situation while your enemies roll around the ground laughing. This will take care of the most war-weary Chafer army, and instantly reverse the situation to your advantage.",ep:1,g:64,l:10,wd:true,fm:true,w:5,s:18,p:500};
I[6797] = {n:"Florheadgear",t:16,d:"If you have always dreamt of being a florist and having rose-scented breath, it\'s time for you to put this strange headgear on.",ep:1,g:70,l:10,wd:true,fm:true,w:10,s:18,p:500};
I[6798] = {n:"Dizbi Flower",t:24,d:"It has a light, subtle and intoxicating scent... But Sadidas are the only ones who know the true secrets of these flowers.",ep:1,g:117,l:1,wd:false,fm:true,w:0,p:1};
I[6799] = {n:"Chief Bwork Blade",t:6,d:"Sharp as a Bwork blade, the Bwork Chief\'s blade has the advantage of being much heavier. It is certainly less easy to handle, but you just have to make it fall on your opponent and he\'ll be in two pieces. Lifting it up again if you miss is another issue, but your enemy will surely have run off by then.",ep:1,g:48,l:100,wd:true,fm:true,w:100,an:14,tw:true,e:[10,5,1,1,40,50,false,false],c:"CS>200&CA>200&CV>200",s:19,p:25000};
I[6800] = {n:"Basic Cloak",t:17,d:"This cloak is made of Gobball Wool. It\'s neither classy nor attractive. Don\'t bother with it, basically.",ep:1,g:15,l:1,wd:true,fm:true,w:1,p:1};
I[6801] = {n:"Winter Cloak",t:17,d:"A pretty, warm, powerfully smelling lining was sewn beautifully onto an ordinary cape. Around your shoulders, or lain in front of a roaring fire like a Gobball-skin rug, you\'ll find some use for this cape.\nEventually.",ep:1,g:18,l:1,wd:true,fm:true,w:2,p:1};
I[6802] = {n:"Earmuffs",t:16,d:"These very soft earmuffs will keep your big flappy ears nice and warm.",ep:1,g:73,l:1,wd:true,fm:true,w:10,p:1};
I[6803] = {n:"Dizbi Flower Essence",t:24,d:"Just don\'t drink it! Simple.",ep:1,g:82,l:1,wd:false,fm:true,w:0,p:1};
I[6804] = {n:"Chief Bwork Amulet",t:1,d:"Although basic looking, this flinty amulet is endowed with a very powerful magic that can turn a Bwork into a princess... or the opposite, nobody knows.",ep:1,g:66,l:100,wd:true,fm:true,w:1,s:19,p:25600};
I[6805] = {n:"Chief Bwork Bracelet",t:9,d:"With this little thing on your wrist, even your good friends will think you\'ve married a great Bwork Chief. It\'s enough to get you a few free drinks at the local inn... Don\'t be fooled though, they\'ll be pity drinks.",ep:1,g:58,l:100,wd:true,fm:true,w:50,s:19,p:25600};
I[6806] = {n:"Wood Fragment",t:24,d:"This fragment of wood comes from a recent building. Must have been red",ep:1,g:246,l:1,wd:false,fm:true,w:0,p:1};
I[6807] = {n:"Chief Bwork Boots",t:11,d:"These boots just look like ordinary Bwork boots. And yet, they are Chief Bwork\'s boots. Hard-wearing, powerful, and smelly, they will be the deciding factor in any evenly-matched battle.",ep:1,g:44,l:100,wd:true,fm:true,w:50,s:19,p:25600};
I[6808] = {n:"Torn Piece of Fabric",t:24,d:"This white piece of fabric is very soft... and very dirty.",ep:1,g:247,l:1,wd:false,fm:true,w:0,p:1};
I[6809] = {n:"Vague Description",t:24,d:"This description is of a little girl with fair hair dressed in a dark colour.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[6810] = {n:"Neighborhood Report",t:24,d:"This report... reports that no incident was recorded in the neighbourhood on the day of the burglary. \nA dodgy character was spotted that evening, however.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[6811] = {n:"Chief Bwork Cloak",t:17,d:"With this ragged cloak you\'ll look like a battle-weary Bwork warrior. It\'s perfect for stealing lunch-money off the elderly in the village. All the same, if you\'re in search of a soul mate, you might want to change your approach... unless you wear it with nothing else on... Hey, that\'s it... that way, you can keep on scaring the elderly of the village too! Kill two birds with the same stones.",ep:1,g:60,l:100,wd:true,fm:true,w:50,s:19,p:25600};
I[6812] = {n:"Chief Bwork Briefs",t:10,d:"These purple leather briefs are all you need, you can wear them on their own and still look distinguished, provided that they fit you. You\'re better off keeping still in them, though -  even the slightest movement will have you sounding like an old door creaking shut.",ep:1,g:59,l:100,wd:true,fm:true,w:50,s:19,p:25600};
I[6813] = {n:"Chief Bwork Helmet",t:16,d:"If you really want to look like a weakling, this helmet is made for you. In your case, it mightn\'t make too much difference all the same.",ep:1,g:65,l:100,wd:true,fm:true,w:50,s:19,p:25600};
I[6814] = {n:"Collection of bits of wood",t:24,d:"This pile of wood would make a cosy little bed, ideal for a Piwi.",ep:1,g:248,l:1,wd:false,fm:true,w:0,p:1};
I[6815] = {n:"Dragonsly\'s Syringe",t:24,d:"Dragonsly gave you this syringe to take a blood sample from Radlu Minite, the Dark Miner.",ep:1,g:31,l:1,wd:false,fm:true,w:0,p:1};
I[6816] = {n:"Blood Sample",t:24,d:"You finally managed to take a sample of Radlu Minite\'s blood. Mouth-watering.",ep:1,g:102,l:1,wd:false,fm:true,w:0,p:1};
I[6817] = {n:"Chief Crocodyl Amulet",t:1,d:"This amazing amulet was made from a Reptilian Shield, from which all gems were removed. As a result, it\'s a particularly heavy, but very sturdy, piece of jewellery. Your neck will be protected from vampire-bites, as well as from the aggressive advances of female villagers.",ep:4,g:67,l:70,wd:true,fm:true,w:100,s:20,p:12700};
I[6818] = {n:"Severed Demonic Rose",t:35,d:"This flower, once demonic, is now tame enough to make a nice, romantic present. If all you get in return is a blank look, you can always take it home and make some jam.",ep:1,g:118,l:1,wd:false,fm:true,w:1,p:1};
I[6819] = {n:"Chief Crocodyl Bracelet",t:9,d:"This bracelet looks strangely like a glove... it\'s not a glove, it\'s a bracelet.",ep:4,g:59,l:70,wd:true,fm:true,w:20,s:20,p:12800};
I[6820] = {n:"Healing Herb",t:24,d:"This herb used to be the main ingredient in any alchemist\'s traditional remedies. It\'s hardly used at all nowadays. Clover is now favoured because it doesn\'t cause serious burns to the lips, which is quite an advantage, let\'s be honest.",ep:1,g:103,l:1,wd:true,fm:true,w:0,p:1};
I[6821] = {n:"Chief Crocodyl Blade",t:6,d:"Made from the remains of a Chief Crocodyl, this weapon will prove very useful if you are handsome, deft, clever and strong enough to handle it. In your case, I would try to find someone who will trade it for a Twiggy Sword.",ep:4,g:49,l:70,wd:true,fm:true,w:100,an:14,e:[12,6,1,1,40,40,false,false],c:"CA>150&CC>150&CV>100",s:20,p:12800};
I[6822] = {n:"Raizedead Injection",t:24,d:"This syringe contains a potent remedy capable of raising the dead. As a matter of fact, some say the famous undead marauder Hyrkul injected it regularly. We can find no better evidence of its effectiveness.",ep:1,g:31,l:1,wd:false,fm:true,w:0,p:1};
I[6823] = {n:"Plant-based Potion",t:24,d:"This putrid potion could revive a Sadida on a siesta... Well, not quite... Maybe if the Sadida was an infant and just about to wake up.",ep:1,g:500,l:1,wd:true,fm:true,w:0,p:1};
I[6824] = {n:"Healing Stone with vanishing powers",t:24,d:"This healing stone loses its power very quickly. In order to focus the power of the stone and maintain its effectiveness, you have to surround it with a metal that absorbs the appropriate radiation. Standard amulets will do the same trick and they\'re half the price.",ep:1,g:104,l:1,wd:false,fm:true,w:0,p:1};
I[6825] = {n:"Chief Crocodyl Sharp Slippers",t:11,d:"These beautiful slippers, made of Chief Crocodyl\'s skin and scales, come with sharp teeth at their ends. Be careful when you play footsie under the table with your beloved, you might tear off her lovely Tabi woollen stockings.",ep:4,g:45,l:70,wd:true,fm:true,w:20,s:20,p:12700};
I[6826] = {n:"Nicely-set Healing Stone",t:24,d:"This amulet is a healing stone with added vanishing powers, nicely set in a crafted piece of rare metal. Holding it in your hand makes you feel good, all tiredness disappears and your brain is electrified. By the way, when you wear it, you\'ll be perfectly visible at night too.",ep:1,g:105,l:1,wd:false,fm:true,w:0,p:1};
I[6827] = {n:"Joe Stonefiddler\'s Letter",t:24,d:"Joe has entrusted you with the mission of taking this letter to his good friend, Howard the Ibutno. Just to let you know, he\'s a lop sooooo...hum...well... you know yourself.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[6828] = {n:"Sword Hilt",t:24,d:"This hilt won\'t transform you into a master of sword handling but it can help you on your way.",ep:1,g:97,l:1,wd:false,fm:true,w:0,p:1};
I[6829] = {n:"Just-forged Sword",t:24,d:"This sword has just been forged.",ep:1,g:98,l:1,wd:false,fm:true,w:0,p:1};
I[6830] = {n:"Chief Crocodyl Schoolbag",t:81,d:"The first day back to school after the holidays is tough for any child, but for Iops, it\'s as though they die a little inside every time it happens. This bag makes the whole experience that bit easier to bear.",ep:14,g:58,l:70,wd:true,fm:true,w:20,s:20,p:12600};
I[6831] = {n:"Chief Crocodyl Belt",t:10,d:"Too stiff to be used as a whip, too flexible to cause any real bodily harm, this gem-covered belt nevertheless serves one obscure purpose... Armed with this, you\'ll never find your pants around your ankles again. Great or what?",ep:4,g:60,l:70,wd:true,fm:true,w:20,s:20,p:12700};
I[6832] = {n:"Beer Deliveryman",t:32,d:"This beer deliveryman is as important as a security guard. A lot more aggressive, too.",ep:1,g:15,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6833] = {n:"Dubious Pouch of Kamas",t:24,d:"These Kamas seem to come from another dimension. They should be quickly melted down before they go back to where they belong.",ep:1,g:243,l:1,wd:false,fm:true,w:0,p:1};
I[6834] = {n:"Chief Crocodyl Headgear",t:16,d:"If you\'ve always dreamt of looking like a Crocodyl - without becoming one - then this headgear\'s make for you. Don\'t even think about using this headgear to fool your friends and tell them you\'ve actually killed a Crocodyl. They\'ll never believe you.",ep:4,g:66,l:70,wd:true,fm:true,w:20,s:20,p:12600};
I[6835] = {n:"Transmuted Metal",t:24,d:"The pouch of questionable Kamas was deftly transmuted by Dragonsly. A sword can now be forged with this metal...",ep:1,g:241,l:1,wd:true,fm:true,w:0,p:1};
I[6836] = {n:"Rudimentary Sword",t:24,d:"Though this sword was forged by Two-Fingers, it still seems too fragile for your purposes. Dragonsly the Alchemist should be able to do something about that.",ep:1,g:98,l:1,wd:true,fm:true,w:0,p:1};
I[6837] = {n:"Bouncing Sword",t:24,d:"Light and fearsome, this sword is meant for you. But the final touch is missing - something from the Ecaflips perhaps...",ep:1,g:98,l:1,wd:true,fm:true,w:0,p:1};
I[6838] = {n:"Rudimentary Fire Sword",t:24,d:"Apparently the moon water had the desired effect. This solid sword can resist anything, but something from the Ecaflips is missing...",ep:1,g:98,l:1,wd:true,fm:true,w:0,p:1};
I[6839] = {n:"Yingnitiate Sword",t:6,d:"This weapon, on which Meow Meow put his hallmark, could turn you into a legendary Ecaflip, eventually...",ep:1,g:18,l:1,wd:true,fm:true,w:10,an:14,e:[5,4,1,1,50,50,false,false],c:"PG=6&PS=0",p:1};
I[6840] = {n:"Yanguru Sword",t:6,d:"This weapon, on which Meow Meow put his hallmark, could turn you into a legendary Ecaflip... maybe...",ep:1,g:18,l:1,wd:true,fm:true,w:10,an:14,e:[5,4,1,1,50,50,false,false],c:"PG=6&PS=1",p:1};
I[6841] = {n:"Bear Fabric",t:55,d:"This strange fabric smells of bear. You should know that it attracts females...",ep:1,g:121,l:22,wd:true,fm:true,w:1,p:500};
I[6842] = {n:"Bear Tooth",t:47,d:"This strange tooth once belonged to an old Bear. Or to be precise, to a Bear Summon, which is completely different. Imagine that... You are actually holding a summoned tooth in your hands right now. Crazy!",ep:1,g:432,l:22,wd:true,fm:true,w:1,p:500};
I[6843] = {n:"Bear Bone",t:47,d:"This sharp bone broke during a terrible fight against one of the Bearman\'s Bear Summons. It was too late to put a cast on the poor Bear\'s paw who was dying and groaning with pain because of your repeated attacks. You chose to let him die slowly, choking him with Gobball slobber, dismembering him and pulling this bone out while he was still conscious. No mercy for the summoned.",ep:1,g:48,l:22,wd:true,fm:true,w:1,p:500};
I[6844] = {n:"Bear Hair",t:54,d:"Sometimes, the Bearman offers a free waxing session to one of his Bear Summonings to pass the time. He then makes quality underwear with the hairs, which are prized by  lonely hunters for their strong sensations and smells.",ep:1,g:195,l:22,wd:true,fm:true,w:1,p:500};
I[6845] = {n:"Bear Skin",t:59,d:"The rough and hairless quality of this skin is the result of a long and intensive waxing session using boiling-hot oil and a branding iron. Don\'t be surprised if it smells of burnt eyebrow.",ep:1,g:35,l:22,wd:true,fm:true,w:1,p:500};
I[6846] = {n:"Crystal Phial of pale Anthir",t:24,d:"An ordinary phial at first sight, this container has a tremendous power that only the Xelors know how to control.",ep:1,g:99,l:1,wd:false,fm:true,w:0,p:1};
I[6847] = {n:"Sack of Epyss Grain",t:24,d:"A rare sort of grain - rather useless to tell the truth. What did you say? Like a Xelor?",ep:1,g:243,l:1,wd:false,fm:true,w:0,p:1};
I[6848] = {n:"Embellished Wood",t:24,d:"Average quality wood.",ep:1,g:100,l:1,wd:false,fm:true,w:0,p:1};
I[6849] = {n:"Box of Subosycold",t:24,d:"Enutrofs are the only ones who know how to use this box. The reason for this is most likely the fact that no one likes talking to Enutrofs. Especially about their secrets.",ep:1,g:56,l:1,wd:false,fm:true,w:0,p:1};
I[6850] = {n:"Pizznosh",t:24,d:"The great thing about the delicious Astrub speciality, Pizznosh, is that you can theoretically eat it wherever you feel most comfortable. In practice, most people tend to ram it down their throats behind bushes for fear that someone will ask them for a slice... Some talented souls can even eat a whole pizza while sitting next to you without you noticing a thing. Fear these strange folk... for they are the Pocket-Munchers.",ep:1,g:107,l:1,wd:false,fm:true,w:0,p:1};
I[6852] = {n:"Trool Fair Soft Toy",t:24,d:"The stuffed toy Kry Babby won at the Trool fair...",ep:1,g:151,l:1,wd:true,fm:true,w:0,p:1};
I[6853] = {n:"Hurrywood",t:24,d:"This wood has the distinctive feature of growing as straight as an arrow, which is handy for storage...",ep:1,g:100,l:1,wd:true,fm:true,w:0,p:1};
I[6854] = {n:"Blue Larva Skin",t:24,d:"A slimy piece of flesh snatched from a poor helpless larva.",ep:1,g:101,l:1,wd:false,fm:true,w:0,p:1};
I[6855] = {n:"Enileda\'s Small Bow",t:24,d:"Fruit of the famous bow maker Enileda\'s gnarled hands, this small bow is not considered representative of the carver\'s career",ep:1,g:244,l:1,wd:true,fm:true,w:0,p:1};
I[6856] = {n:"Demonic Rose Scissors",t:20,d:"These scissors have been specially designed to cut the stems of demonic roses without damaging the petals, even when it bites into your calf.",ep:1,g:22,l:1,wd:true,fm:true,w:2,an:13,e:[5,3,1,1,20,20,false,false],p:1};
I[6857] = {n:"Astrub Beer",t:37,d:"A six pack of this classic brew is the only six pack you\'ll be seeing for a while.",ep:1,g:4,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:4};
I[6858] = {n:"Filled but invalid Form",t:80,d:"This little form contains the name of a failed candidate for the baker\'s delivery man job. The small red mark at the bottom indicates that the poor sod didn\'t have enough strength or agility for the job.",ep:1,g:6,l:1,wd:false,fm:true,w:0,c:"PW<1500|CA<50",p:0};
I[6859] = {n:"Scissors",t:24,d:"This pair of scissors is not much to look at... Their former owner glued them to his wrists and went around giving ridiculous haircuts to Gobballs. It was totally unprofitable, nobody paid the slightest bit of attention.",ep:1,g:150,l:1,wd:true,fm:true,w:0,p:1};
I[6862] = {n:"Bear Parchment",t:24,d:"This strange parchment explains how the Bearman learnt to summon Bears. Amazing!",ep:1,g:95,l:1,wd:true,fm:true,w:0,p:1};
I[6863] = {n:"Astrub Mercenary Helmet",t:16,d:"The helmet of an Astrubian mercenary.",ep:1,g:72,l:1,wd:false,fm:true,w:10,p:1};
I[6864] = {n:"Dark Rose Petals",t:24,d:"The petals of this rose are so dark that its shadow seems to twinkle in comparison.",ep:2,g:106,l:23,wd:true,fm:true,w:0,p:1};
I[6865] = {n:"Note",t:24,d:"" + "\"" + "Meet me at the edge of the forest for the pick-up" + "\"" + "",ep:1,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[6866] = {n:"Piece of Cloak",t:24,d:"This piece of blue cloak belongs to your attackers. You wouldn\'t think it to look at you, but you can fairly move around on that battlefield",ep:1,g:249,l:1,wd:false,fm:true,w:0,p:1};
I[6867] = {n:"Harvest Note",t:24,d:"In order to remember at what time you have to harvest the Wynd, you wrote it down on this piece of paper... Remember?",ep:1,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[6868] = {n:"Chestnut Plank",t:95,d:"A Handyman could use this plank to make something delightful - a coffin, for example. Just bear that in mind.",ep:1,g:1,l:10,wd:true,fm:true,w:10,p:20};
I[6869] = {n:"Kry Babby",t:32,d:"Kry Babby doesn\'t remember where her home is... You\'ll have to take her.",ep:1,g:14,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6870] = {n:"Nomarow Transplent",t:32,d:"Nomarow Transplent is now under your control. Take him safely to the jailhouse.",ep:13,g:8,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6871] = {n:"Frakacia Leukocytine",t:32,d:"Frakacia is now under your control. Take her safely to the jailhouse.",ep:1,g:11,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6872] = {n:"Nervoes Brakdoun",t:32,d:"Nervoes Brakdoun is now in your custody. Take him to the jail.",ep:1,g:10,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6873] = {n:"Qil Bil",t:32,d:"Qil Bil is now under your control. Take him safely to the jailhouse.",ep:14,g:7,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6874] = {n:"Brumen Tinctorias",t:32,d:"Brumen Tinctorias is now under your control. Take him safely to the jailhouse.",ep:14,g:13,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6875] = {n:"Akornadikt",t:32,d:"Akornadikt is now under your control. Take him safely to the jailhouse.",ep:1,g:12,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6876] = {n:"Ogivol Scarlarcin",t:32,d:"Ogivol is now under your control. Take him safely to the jailhouse.",ep:16,g:9,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[6884] = {n:"Bworker Dungeon Key",t:84,d:"With this key you can enter the Bworker Dungeon. Be careful, it will self-destruct after use.",ep:4,g:713,l:30,wd:true,fm:true,w:1,p:100};
I[6885] = {n:"Bworker Token",t:15,d:"Great for playing heads or tails so you can kill your enemy while the coin spins, this pure gold token will make you happy, but maybe unlucky as well...",ep:13,g:90,l:100,wd:true,fm:true,w:1,p:100};
I[6886] = {n:"Astrub Mercenary Cloak",t:17,d:"The cloak of an Astrubian mercenary... what were you expecting?",ep:1,g:59,l:1,wd:false,fm:true,w:10,p:1};
I[6887] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:false,fm:true,w:4,u:true,p:100};
I[6888] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:false,fm:true,w:4,u:true,p:100};
