I[6891] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:false,fm:true,w:4,u:true,p:100};
I[6892] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:false,fm:true,w:4,u:true,p:100};
I[6893] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:false,fm:true,w:4,u:true,p:100};
I[6894] = {n:"Ultra-powerful Combat Bow Meow (GM)",t:18,d:"This super-mighty fighting Bow Meow is the embodiment of super-might. Very impressive. Beware, it can only be entrusted to the care of Game Masters... because they\'re worth it.",ep:1,g:1,l:1,wd:false,fm:false,w:10,c:"PX=3|PX=5",p:1};
I[6895] = {n:"Small Combat Bow Meow (GM)",t:18,d:"Less super-mighty than the super-mighty fighting Bow Meow, this small fighting Bow Meow is still very powerful. This pet remains a safe bet for Game Masters but it\'s not the least bit house trained and tends to roll around in its own detritus. Don\'t forget to throw some boiling water over it every once in a while so that it retains its splendour.",ep:1,g:9,l:1,wd:false,fm:true,w:10,p:1};
I[6897] = {n:"Blue Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:114,l:1,wd:true,fm:true,w:1,p:10};
I[6898] = {n:"Purple Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:115,l:1,wd:true,fm:true,w:1,p:10};
I[6899] = {n:"Green Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:116,l:1,wd:true,fm:true,w:1,p:10};
I[6900] = {n:"Red Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:117,l:1,wd:true,fm:true,w:1,p:10};
I[6902] = {n:"Yellow Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:118,l:1,wd:true,fm:true,w:1,p:10};
I[6903] = {n:"Pink Piwi Feather",t:53,d:"This Piwi feather was taken from the butt of a hapless Piwi.",ep:1,g:119,l:1,wd:true,fm:true,w:1,p:10};
I[6904] = {n:"Used Bwork Protection",t:15,d:"Love can sometimes be more destructive than war, but that\'s not what Bworker told you.",ep:1,g:714,l:200,wd:true,fm:true,w:1,p:1000};
I[6905] = {n:"Surprise Bwork Pack",t:89,d:"Opening this pack requires a huge amount of serenity on your part... its contents are sensitive.",ep:1,g:42,l:1,wd:true,fm:true,w:4,u:true,p:100};
I[6906] = {n:"Novice Mercenary",t:14,d:"You will be able to join the Mercenaries using this scroll. The one who receives it will have their name added to the Clan register, as a novice.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>59",ut:true,p:1};
I[6907] = {n:"Neutralizer",t:14,d:"Enables you to set the alignment of the targeted character as Neutral.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>79",ut:true,p:1};
I[6908] = {n:"Boar Belt",t:10,d:"Hairy but elegant, this belt should remind you of your lady-love.",ep:1,g:75,l:18,wd:true,fm:true,w:2,s:21,p:1050};
I[6909] = {n:"Boar Feet",t:11,d:"These are the perfect boots for splashing around in the mud or making big dents in an expensive hardwood floor. It\'s forbidden to wear them on dance floors, beaches and in saunas.",ep:1,g:51,l:22,wd:true,fm:true,w:2,s:21,p:1525};
I[6910] = {n:"Boar Ring",t:9,d:"This ring used to be fixed on the legs of rutting boars so that breeders could easily recognize them. Today, you are the one wearing the ring. You can take from with what you wish...",ep:1,g:73,l:19,wd:true,fm:true,w:2,s:21,p:1200};
I[6911] = {n:"Arachnoring",t:9,d:"This ridiculously small ring will help you overcome your Arachnophobia once and for all.",ep:1,g:76,l:5,wd:true,fm:true,w:1,s:22,p:275};
I[6912] = {n:"Arachnobelt",t:10,d:"Made from the rotting remains of decaying Arachnees, you\'ll just love this belt. From time to time, it might come back to life and greedily bite you on the hips. Bloody thing!",ep:1,g:73,l:6,wd:true,fm:true,w:1,s:22,p:305};
I[6913] = {n:"Arachelmet",t:16,d:"With this Arachelmet on, you will look like a wild Arachnee. What will that achieve? Well, you might scare off some flies...",ep:1,g:83,l:6,wd:true,fm:true,w:2,s:22,p:305};
I[6914] = {n:"Arachnee Cutter",t:19,d:"Did you know that Weak Arachnees only have four hairy legs? With only four blows of this axe, you could turn one into an Arachneetrunk. Blimey. Imagine everyone in Amakna doing that. It explains why you don\'t see Weak Arachnees any more, anyway.",ep:1,g:31,l:8,wd:true,fm:true,w:5,an:17,e:[5,4,1,1,50,50,false,false],s:22,p:600};
I[6915] = {n:"Mos Kitano",t:9,d:"This is such a light ring that your hands can perform acrobatic feats when it\'s on. It\'s also quite useful if you want to humiliate somebody smaller than you by smashing their head with your thumb.",ep:1,g:71,l:21,wd:true,fm:true,w:2,s:23,p:1400};
I[6916] = {n:"Small Moskito Schoolbag",t:81,d:"Made out of Moskito skin and wings, this bag used to be a big fad in schools. Today, it is old-fashioned and has been replaced by the Small Chief Crocodyl schoolbag. I don\'t get it - one, a Small Chief Crocodyl bag is much more expensive and two, it\'s HORRIBLE. Kids these days.",ep:1,g:59,l:16,wd:true,fm:true,w:2,s:23,p:900};
I[6917] = {n:"Moskabuto",t:16,d:"This headgear takes its name from the eccentric Enutrof who discovered it while stripping a sick old Moskito for all it had. Extremely useful for inexperienced adventurers, this headgear will help you seduce famished Arachnees.",ep:1,g:80,l:15,wd:true,fm:true,w:2,s:23,p:900};
I[6918] = {n:"Moskito Amulet",t:1,d:"This small amulet is not as effective as the famous Arachnamu. It certainly looks good, though... To be worn on a bare, hairy chest for a great jewel-in-the-roughage look.",ep:1,g:75,l:15,wd:true,fm:true,w:2,s:23,p:800};
I[6919] = {n:"Mush Mush Ring",t:9,d:"The Mush Mush has a reputation for being a nasty piece of work. He\'ll pester and bite you at every opportunity, and he\'s very moody. I was married to someone like that once... Smelled like mushrooms too...",ep:1,g:74,l:3,wd:true,fm:true,w:2,s:24,p:225};
I[6920] = {n:"Mush Mush Wedding Ring",t:9,d:"When a Mush Mush gets married, he gives this wedding ring to his bride. Since the bride has no arms, the ring is put delicately on one of its thorns. If you get hold of this ring, you will forever break the sacred bond between the two creatures. At best, the Mush Mush will take you as his bride to make up for it, and just remember, Mush Mushes spend their whole lives where the sun don\'t shine...",ep:1,g:75,l:3,wd:true,fm:true,w:2,s:24,p:225};
I[6921] = {n:"Musheadgear",t:16,d:"Before the prohibition, Musheadgear was smoked or drunk as tea. This headgear really has it all.",ep:1,g:84,l:9,wd:true,fm:true,w:3,s:24,p:425};
I[6922] = {n:"Mush Mush Cloak",t:17,d:"The only thing more impressive than a livid Mush Mush is a livid Mush Mush in a cloak. Indeed, this particular cloak is the embodiment of a certain kind of ultra-powerful clothing... pretty ugly clothing if you ask me.",ep:1,g:76,l:9,wd:true,fm:true,w:2,s:24,p:450};
I[6923] = {n:"Lars Amulet",t:1,d:"This amulet used to belong to the great robber " + "\"" + "Thisme" + "\"" + " who was famous for his limitless cruelty and idiotic death. A central figure of Eniripsa folklore, he was crushed and drowned to death in an olive press having just come out of jail after a 30-year sentence for the theft of a giant walnut.",ep:1,g:76,l:16,wd:true,fm:true,w:2,s:25,p:900};
I[6924] = {n:"Robber Daggers",t:5,d:"These sharp daggers are very popular among robbers and very unpopular among the elderly for one and the same reason. The daggers cast spells that let them steal Kamas from adversaries. At least that\'s the story their victims tell.",ep:1,g:9,l:12,wd:true,fm:true,w:1,an:13,e:[5,3,1,1,30,50,false,false],s:25,p:600};
I[6925] = {n:"Robber Belt",t:10,d:"This beautiful belt is essential you if you ever decide to become a highwayman. Don\'t wear it round town, though, you\'ll be arrested on sight.",ep:1,g:72,l:15,wd:true,fm:true,w:2,s:25,p:850};
I[6926] = {n:"Prespwig",t:16,d:"With this prespwig on, you\'ll look like Debbie Crockett, the most celebrated huntress of the modern age, but a tragic victim of premature baldness. That\'s not to say that this rat-bitten, off-red wig is any better than a balding nut.",ep:1,g:81,l:36,wd:true,fm:true,w:2,s:31,p:3600};
I[6927] = {n:"Prespic Cloak",t:17,d:"This reddish small cloak can be also used as a rug or doormat so that you can redecorate the house on the cheap.",ep:1,g:75,l:37,wd:true,fm:true,w:3,s:31,p:3800};
I[6928] = {n:"Prespic Ring",t:9,d:"This ring, both simple and original, will seduce adventurers who long for the good things in life but could never afford them. The kind who would beat the daylights out of helpless animals and strip them of anything resembling an ornament. There\'s no shortage of them, believe me.",ep:1,g:72,l:38,wd:true,fm:true,w:1,s:31,p:4000};
I[6929] = {n:"Prespic Belt",t:10,d:"The Prespic Belt is the ideal belt for keeping your hips warm. It itches like hell, though... you wanna be hard to wear this one!",ep:1,g:71,l:33,wd:true,fm:true,w:2,s:31,p:3000};
I[6930] = {n:"Crackler Helmet",t:16,d:"This helmet directly hewed in stone is worth its weight in gold. It will both protect you from the attacks of a Crackrock and allow you to give head butts worthy of that of Desirock. It\'s perfect to make your opponents go off their rocker.",ep:5,g:85,l:44,wd:true,fm:true,w:200,s:26,p:5300};
I[6931] = {n:"Crackler Cloak",t:17,d:"This stone cloak is a bit too stiff, but you\'ll be grateful when you\'re in danger of being spat on by a Crackler.",ep:5,g:77,l:46,wd:true,fm:true,w:1,s:26,p:5800};
I[6933] = {n:"Crackler Boots",t:11,d:"Incredibly heavy but equally effective, these rocky boots will give you a good excuse to drag your feet when you have to defend a Perceptor in a fight you know you can\'t win.",ep:5,g:52,l:47,wd:true,fm:true,w:10,s:26,p:4700};
I[6934] = {n:"Crackler Amulet",t:1,d:"This amulet is as heavy as a bulimic Blop. It has not been designed for weak adventurers. However, once you get used to bearing its heavy weight around your neck, you\'ll sure cut a dash!",ep:5,g:77,l:46,wd:true,fm:true,w:10,s:26,p:4600};
I[6935] = {n:"Crackler Belt",t:10,d:"Wear it on your waist and you\'ll gain the respect of your peers. Wear it on your head and you\'ll be the laughing stock of Astrub",ep:5,g:74,l:45,wd:true,fm:true,w:10,s:26,p:5400};
I[6936] = {n:"Green Scara Helmet",t:16,d:"With this helmet on, you\'ll be able to pretend to be a Scaraleaf hunter.",ep:3,g:78,l:44,wd:true,fm:true,w:2,s:27,p:5200};
I[6937] = {n:"Red Scara Helmet",t:16,d:"With this helmet on, your friends will think that you\'ve joined the elite Scaraleaf hunter clan.",ep:3,g:77,l:44,wd:true,fm:true,w:2,s:28,p:5200};
I[6938] = {n:"White Scara Helmet",t:16,d:"With this helmet on, your friends will think that you\'ve joined the elite Scaraleaf hunter clan.",ep:3,g:79,l:44,wd:true,fm:true,w:2,s:29,p:5200};
I[6939] = {n:"Blue Scara Helmet",t:16,d:"With this helmet on, your friends will think that you\'ve joined the elite Scaraleaf hunter clan.",ep:3,g:76,l:44,wd:true,fm:true,w:2,s:30,p:5200};
I[6940] = {n:"Green Scaracape",t:17,d:"Have you ever dreamt of wearing a cape made of Scaraleaf shells? Well, here\'s your chance! Once equipped, you should feel as if you were a real Scaraleaf and you might even succeed to slide and skid around. This should be enough to take aback a whole herd of Trools.",ep:3,g:74,l:45,wd:true,fm:true,w:2,s:27,p:5500};
I[6941] = {n:"Blue Scaracape",t:17,d:"Who\'s never dreamt of wearing a cloak made of Scareleaf shells? Once equipped, you\'ll probably believe yourself to be a true Scaraleaf, and maybe you\'ll manage to move on by way of slipping and skidding. That\'s enough to take a crowd of Trools aback.",ep:3,g:73,l:45,wd:true,fm:true,w:2,s:30,p:5500};
I[6942] = {n:"Red Scaracape",t:17,d:"Who\'s never dreamt of wearing a cloak made of Scareleaf shells? Once equipped, you\'ll probably believe yourself to be a true Scaraleaf, and maybe you\'ll manage to move along by way of slipping and skidding. That\'s enough to take a crowd of Trools aback.",ep:3,g:72,l:45,wd:true,fm:true,w:2,s:28,p:5500};
I[6943] = {n:"White Scaracape",t:17,d:"Who\'s never dreamt of wearing a cloak made of Scareleaf shells? Once equipped, you\'ll probably believe yourself to be a true Scaraleaf, and maybe you\'ll manage to move along by way of slipping and skidding. That\'s enough to take a crowd of Trools aback.",ep:3,g:71,l:45,wd:true,fm:true,w:2,s:29,p:5500};
I[6944] = {n:"Green Scararing",t:9,d:"When you\'ll wear this ring, you\'ll spare a thought for all the Scaraleaves you have wiped out. You then maybe ask yourself if it is worth this slaughter... Yeah, of course it is worth it!",ep:3,g:69,l:43,wd:true,fm:true,w:2,s:27,p:5000};
I[6945] = {n:"Red Scararing",t:9,d:"When you\'ll wear this ring, you\'ll spare a thought for all the Scaraleaves you have wiped out. You then maybe ask yourself if it is worth this slaughter... Yeah, of course it is worth it!",ep:3,g:68,l:43,wd:true,fm:true,w:2,s:28,p:5000};
I[6946] = {n:"White Scararing",t:9,d:"When you\'ll wear this ring, you\'ll spare a thought for all the Scaraleaves you have wiped out. You then maybe ask yourself if it is worth this slaughter... Yeah, of course it is worth it!",ep:3,g:67,l:43,wd:true,fm:true,w:2,s:29,p:5000};
I[6947] = {n:"Blue Scararing",t:9,d:"When you\'ll wear this ring, you\'ll spare a thought for all the Scaraleaves you have wiped out. You then maybe ask yourself if it is worth this slaughter... Yeah, of course it is worth it!",ep:3,g:70,l:43,wd:true,fm:true,w:2,s:30,p:5000};
I[6948] = {n:"Green Scarabelt",t:10,d:"The Scarabelt was worn as an indicator of a warrior\'s fist-fighting skills. With a Green Scarabelt, your enemy knew you were a beginner. A red one meant that you were a lusty warrior who ate the uncooked internal organs of your enemies just for fun... And the white one indicated that you were really tough. A blue one meant you didn\'t spend long enough saving up for one of the others.",ep:3,g:67,l:46,wd:true,fm:true,w:2,s:27,p:5600};
I[6949] = {n:"White Scarabelt",t:10,d:"The Scarabelt was worn as an indicator of a warrior\'s fist-fighting skills. With a Green Scarabelt, your enemy knew you were a beginner. A red one meant that you were a lusty warrior who ate the uncooked internal organs of your enemies just for fun... And the white one indicated that you were really tough. A blue one meant you didn\'t spend long enough saving up for one of the others.",ep:3,g:69,l:46,wd:true,fm:true,w:2,s:29,p:5600};
I[6950] = {n:"Red Scarabelt",t:10,d:"The Scarabelt was worn as an indicator of a warrior\'s fist-fighting skills. With a Green Scarabelt, your enemy knew you were a beginner. A red one meant that you were a lusty warrior who ate the uncooked internal organs of your enemies just for fun... And the white one indicated that you were really tough. A blue one meant you didn\'t spend long enough saving up for one of the others.",ep:3,g:68,l:46,wd:true,fm:true,w:2,s:28,p:5600};
I[6951] = {n:"Blue Scarabelt",t:10,d:"The Scarabelt was worn as an indicator of a warrior\'s fist-fighting skills. With a Green Scarabelt, your enemy knew you were a beginner. A red one meant that you were a lusty warrior who ate the uncooked internal organs of your enemies just for fun... And the white one indicated that you were really tough. A blue one meant you didn\'t spend long enough saving up for one of the others.",ep:3,g:70,l:46,wd:true,fm:true,w:2,s:30,p:5600};
I[6952] = {n:"Boowolf Headgear",t:16,d:"With this Boowolf hat on your head, you\'ll have a good excuse for your stinky breath!!",ep:1,g:131,l:61,wd:true,fm:true,w:4,s:32,p:10000};
I[6953] = {n:"Boowolf Boots",t:11,d:"These boots are coated with Boowolf hair. They are extremely useful for cleaning dusty wooden floors or fixing up the heads of your enemies as they lie dead on the battle field.",ep:1,g:76,l:61,wd:true,fm:true,w:2,s:32,p:9700};
I[6954] = {n:"Boowolf Cloak",t:17,d:"This Boowolf fur makes for excellent protection against the cold... and also adventurers with a highly developed sense of smell.",ep:1,g:99,l:64,wd:true,fm:true,w:5,s:32,p:11000};
I[6955] = {n:"Boowolf Thong",t:10,d:"Used as a whip, this thong can be a lot more efficient than it looks to motivate your fellow travellers when they\'ve lost the will to live.",ep:1,g:92,l:49,wd:true,fm:true,w:2,s:32,p:6500};
I[6956] = {n:"Boowolf Ring",t:9,d:"Beware! This ring will make your finger stink. Although this foul smell may cover a worse smell... This may be the best thing that could happen to your finger... and your hands in general in fact.",ep:1,g:103,l:51,wd:true,fm:true,w:2,s:32,p:7000};
I[6957] = {n:"Crackler Blade",t:6,d:"This sword used to cut the granite blocks for the city walls of Bonta and Brakmar. Nowadays, it\'s used to crush creatures in battle.",ep:5,g:54,l:37,wd:true,fm:true,w:10,an:14,tw:true,e:[5,6,1,1,50,50,false,true],s:26,p:3800};
I[6958] = {n:"Brilliant Hermiturtlook",t:16,d:"Eternally fashionable, this hat will give you a unique look - a long, discreet look up the skirts of the Cra women. Perfect for those warm summer night parties.",ep:5,g:82,l:22,wd:true,fm:true,w:12,p:1525};
I[6961] = {n:"Gangster Ring",t:9,d:"This ring is as popular with dentists as it is with gangsters. They both use it to  break the teeth of careless people... They both use similar drills too, but let\'s not dwell on that...",ep:1,g:77,l:17,wd:true,fm:true,w:2,s:25,p:1000};
I[6962] = {n:"Dofusian Present",t:89,d:"We won\'t spoil the surprise and tell you what\'s inside! Just have fun my friend and don\'t party too much!",ep:1,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[6963] = {n:"Minotoball\'s Balls",t:12,d:"These incredibly big balls are delicious. You\'ll think there\'s no end to them, but isn\'t that a good thing?",ep:1,g:143,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[6964] = {n:"Brakmarian Intercity-Express Potion",t:12,d:"This rice-based potion enables Brakmarians to return to their hometown instantaneously.",ep:1,g:145,l:1,wd:true,fm:true,w:1,c:"Ps=2|Ps=0|Ps=3",u:true,p:1};
I[6965] = {n:"Bontarian Intercity-Express Potion",t:12,d:"This rice-based potion enables Bontarians to return to their hometown instantaneously.",ep:1,g:144,l:1,wd:true,fm:true,w:1,c:"Ps=1|Ps=0|Ps=3",u:true,p:1};
I[6966] = {n:"Class Spell Scroll: Jinx",t:75,d:"(Double click to learn the spell)\nThis scroll will teach Srams the class spell \'Jinx\'.",ep:1,g:14,l:1,wd:true,fm:true,w:1,c:"PG=4",u:true,p:10000};
I[6967] = {n:"Apprentice Mercenary Induction Scroll",t:14,d:"With this parchment, a Mercenary can be promoted to Apprentice.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>59",ut:true,p:1};
I[6968] = {n:"Mercenary Induction Scroll",t:14,d:"With this parchment, an apprentice Mercenary can be promoted to Mercenary.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>79",ut:true,p:1};
I[6969] = {n:"Great Mercenary Induction Scroll",t:14,d:"With this parchment, a Mercenary can be promoted to Great Mercenary.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>79",ut:true,p:1};
I[6970] = {n:"Master Mercenary Induction Scroll",t:14,d:"With this parchment, a Mercenary can be promoted to Master Mercenary.",ep:1,g:5,l:1,wd:true,fm:true,w:0,c:"Ps=3&Pa>79",ut:true,p:1};
I[6971] = {n:"Mercenary Disciple\'s Clint",t:16,d:"This hat is quite a good replica of the famous Clint. It will perfectly suit mercenary disciples who are convinced they are master material.",ep:1,g:38,l:1,wd:false,fm:true,w:20,c:"Ps=3",p:1};
I[6975] = {n:"Novice Mercenary\'s Clint",t:16,d:"This ultra-powerful hat is the Mercenary emblem. It has the power to protect you from both the rain and the sun... a good start at least.",ep:1,g:38,l:1,wd:false,fm:true,w:20,p:1};
I[6978] = {n:"Peki",t:18,d:"From a distance, this creature looks just like a Bow Wow. A simple glance at its head and you can see it\'s been through terrible trials... which eventually led it to become a vegetarian and to subscribe for life to the Pet Sanctuary Foundation. As such, it will only eat vegetables and plants that grow on Pandala island.",ep:3,g:12,l:60,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[6980] = {n:"Vulbis Dofus",t:23,d:"This Dofus was laid by a dragon which decided to remain anonymous. Even the wisest adventurers still wonder why.",ep:11,g:4,l:6,wd:false,fm:true,w:1,p:1};
I[6981] = {n:"Ice Daggers",t:5,d:"The blade of these daggers is made of ice. Reminds me of an old incident that had the detectives working overtime... A fella called Tum Sellick stabbed his buddy with one of these things over a couple of Kamas... Nice crime... They found the novelty ice-cube maker in his house though... NICKED!",ep:19,g:44,l:150,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CA>250&CS>150",p:15};
I[6982] = {n:"Dagg\'Onies",t:5,d:"These daggers are soaked in the blood of various evil creatures, such as children. They are very special.",ep:18,g:50,l:46,wd:true,fm:true,w:15,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>60",p:5775};
I[6983] = {n:"Dagg\'Ressif",t:5,d:"Only sharpened once every ten years, these daggers retain their lethal edge because of the dark magic that possesses them. They can sometimes be seen walking the streets at the weekend, playing loud music and staring threateningly at passersby.",ep:19,g:47,l:143,wd:true,fm:true,w:15,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CS>250&CA>100",p:15};
I[6984] = {n:"Gobbly Killer Apprentice Daggers",t:5,d:"These daggers belonged to a Sadida whose dazzling ascent will be remembered forever in Amaknan history. From a young age, this Sadida dedicated his humble life to Gobbly hunting... the villagers found it hilarious... word spread and soon folk came from all around to watch him hunt those ridiculous balls of wool. His revenge was terrible and long-lived. When the price of Gobbly skins skyrocketed, he became so rich that he paid to have every last villager who mocked him hunted down and murdered. He\'s storing their skins too, but the stock market isn\'t going his way.",ep:18,g:46,l:113,wd:true,fm:true,w:15,an:13,tw:true,e:[5,3,1,1,25,50,false,false],c:"CS>300&CA>100",p:32750};
I[6986] = {n:"Broken Mount Stinkky Shield",t:82,d:"This shield has seen a few battles too many, in this state it is good for nothing. Perhaps Bouwada, in Pandala village, could replace it for you.",ep:18,g:1,l:1,wd:false,fm:true,w:20,c:"BI=non Ã©quipable",p:5400};
I[6987] = {n:"Risky Soul Stone for Small Souls",t:83,d:"You\'ll have a limited chance of capturing level 50 souls using this soul stone.",ep:5,g:1,l:1,wd:false,fm:true,w:1,tw:true,p:1250};
I[6988] = {n:"Sulik",t:16,d:"The sister of a wild Xelor who was kidnapped by unscrupulous slave drivers used to wear this thing for her nightly shows, the nature of which I will not repeat here.",ep:19,g:92,l:172,wd:true,fm:true,w:10,p:56100};
I[6989] = {n:"Nee Cap",t:16,d:"This hat was made a long time ago by apprentice tailors who wanted to protect themselves from the violent fits of rage of Mirko, their boss. This fine business man was often forced to kick his apprentices in the head when they didn\'t work fast enough. From what I\'ve heard, that was far too good for the lazy bast...",ep:19,g:86,l:120,wd:true,fm:true,w:20,p:37025};
I[6990] = {n:"Mothat",t:16,d:"This hat is a tribute to the distant cousins of the Moskitoes: the Moths. A lot bigger and a lot kinder than the Moskitoes, the Moths took such good care of their livestock that they soon became extinct from self-inflicted famine. From this tragic story, we have the common insult \'Moth\' as in, \'Poor bloody Moth\', which describes a fellow who discovers his spouse is devastatingly gluttonous...",ep:19,g:87,l:113,wd:true,fm:true,w:10,p:32925};
I[6991] = {n:"Guavhat",t:16,d:"This strange-looking hat looks like a big dehydrated rotting fruit... A bit like you after a night out at the pub.",ep:18,g:88,l:46,wd:true,fm:true,w:10,p:5800};
I[6992] = {n:"Kannipiwi",t:16,d:"An improved version of the famous Kanniball mask, the Kannipiwi will make you look like a real Piwi hunter to your friends.",ep:12,g:89,l:55,wd:true,fm:true,w:5,p:8000};
I[6993] = {n:"Hallelujah Cloak",t:17,d:"Lonard Kohen, the famous minstrel with the voice of a castrated Crackler (which is still incredibly low) was burnt alive in front of the bank of Bonta after causing a moral scandal with his latest, and last, song " + "\"" + "Tower of Thong" + "\"" + ". A full recording was made of his cries of agony, which he had the vision to frame in C#m, modulate to Fb, and resolve in a risquÃ© but manageable G#. Niiice.",ep:18,g:79,l:46,wd:true,fm:true,w:10,p:5600};
I[6994] = {n:"Hooded Cloak",t:17,d:"This hood-cloak hybrid is just amazing. If it was made of leather, Captain Chafer would have loved it.",ep:1,g:80,l:58,wd:true,fm:true,w:10,p:8875};
I[6995] = {n:"Graytess Cape",t:17,d:"You just can\'t stay inside this cape, it\'ll throw you out whether you want to go or not.",ep:18,g:81,l:105,wd:true,fm:true,w:10,p:28300};
I[6996] = {n:"Ring o\'Stradamus",t:9,d:"Stradamus was an old drunken Enutrof who could read the future in pints of beer. Legend has it he was buried standing up in a wall of the Brakmar inn upon his own request, " + "\"" + "so that no drunkard can ever spill his beer over my grave" + "\"" + ". This has been told at least once a week by every drunk in every inn in Brakmar. That\'s a lot. God I hate that story.",ep:18,g:78,l:48,wd:true,fm:true,w:5,p:6075};
I[6997] = {n:"Conno Ring",t:9,d:"The woman who created this ring was convinced the end of the world was near due to plummeting food supplies. She used to spend entire days engraving messages on wooden tables with her motto \'No steak but what we bake\'. Time proved her wrong.",ep:18,g:79,l:70,wd:true,fm:true,w:5,p:12730};
I[6998] = {n:"Elya Wood\'s Wedding Ring",t:9,d:"This small wedding ring will fit an Eniripsa\'s little fingers perfectly. For Iops, however, it\'s almost unusable. Their fingers are too fat and they can\'t get it into their heads that it\'s not a bracelet.",ep:18,g:84,l:120,wd:true,fm:true,w:15,s:39,p:36000};
I[6999] = {n:"Lahilama Medal",t:1,d:"Lahilama was a great spiritual guide who kept his temple right in the heart of the mountains. He was so bored that he spent his days sewing little yellow hats for his disciples. They just had nothing to talk about. They all slowly went mad years of awkward conversation.",ep:18,g:83,l:31,wd:true,fm:true,w:3,p:2800};
I[7000] = {n:"Bambamulet",t:1,d:"This ridiculous little piece of bamboo has the strangest magical powers. It used to be worn by young Pandawas, once their puberty came to an end. You might want to wait another couple of years yourself before you slip it around your neck...",ep:18,g:78,l:40,wd:true,fm:true,w:5,p:4400};
I[7001] = {n:"Bow\'hee Talisman",t:1,d:"" + "\"" + "I, I am the kheeng, you, you are the quheen, whee can be heeroes just for one daaaayyyy..." + "\"" + " \nDavyd, famous minstrel, was singing his head off on his way back from Moon Island...",ep:18,g:84,l:55,wd:true,fm:true,w:10,p:8000};
I[7002] = {n:"Lil\' Resin",t:1,d:"This amulet of Bamboo resin will spread a nice smell all around you. It comes in handy when you\'re practising your Wind of Panic.",ep:18,g:85,l:94,wd:true,fm:true,w:5,p:22800};
I[7003] = {n:"Elya Wood\'s Talisman",t:1,d:"This Talisman was created with stardust and precious stones, encased in Ancestral Treechnid Amber. The mixture can be quite explosive, so it is not recommended you try to make it yourself. Leave it to a Jeweller you don\'t like.",ep:18,g:86,l:135,wd:true,fm:true,w:10,s:39,p:45600};
I[7004] = {n:"Risky Soul Stone for Average Souls",t:83,d:"You\'ll have a limited chance of capturing level 100 souls using this soul stone.",ep:5,g:8,l:1,wd:false,fm:true,w:1,tw:true,p:2500};
I[7005] = {n:"Risky Soul Stone for Big Souls",t:83,d:"You\'ll have a limited chance of capturing level 150 souls using this soul stone.",ep:5,g:9,l:1,wd:false,fm:true,w:1,tw:true,p:3750};
I[7006] = {n:"Risky Soul Stone for Huge Souls",t:83,d:"You\'ll have a limited chance of capturing level 200 souls using this soul stone.",ep:16,g:10,l:1,wd:false,fm:true,w:1,tw:true,p:5000};
I[7007] = {n:"Regular Soul Stone for Small Souls",t:83,d:"You\'ll have an even chance of capturing level 50 souls using this soul stone.",ep:5,g:2,l:1,wd:false,fm:true,w:1,tw:true,p:2500};
I[7008] = {n:"Regular Soul Stone for Average Souls",t:83,d:"You\'ll have an even chance of capturing level 100 souls using this soul stone.",ep:5,g:12,l:1,wd:false,fm:true,w:1,tw:true,p:5000};
I[7009] = {n:"Regular Soul Stone for Big Souls",t:83,d:"You\'ll have an even chance of capturing level 150 souls using this soul stone.",ep:16,g:13,l:1,wd:false,fm:true,w:1,tw:true,p:7500};
I[7010] = {n:"Full Soul Stone",t:85,d:"This soul stone contains the souls of a group of monsters whose only wish is to come back to life to tear your body to pieces. It can only be used in special arenas, located in big cities.",ep:1,g:1,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[7011] = {n:"Desire o\'Ball Cloak",t:17,d:"This cloak is made of red beard hair... it is quite unique. Animated by extraordinarily powerful magic that renders it all but living, it adores playing practical jokes on the unfortunate bugger who puts it on. It\'s favourite trick? It unfindably conceals itself when it senses you need it most. If you do ever manage to discipline it, it can be very powerful in fights. As the Wabbits like to say it\'s a " + "\"" + "weal good instwument of wawfawe" + "\"" + ".",ep:13,g:83,l:67,wd:false,fm:true,w:10,s:38,p:11875};
I[7012] = {n:"Smoothitch o\'Bal",t:1,d:"This Amulet is, in fact, a candy. It might have been edible if it hadn\'t been carefully rolled under female Bworker armpits for 36 generations as part of some bizarre ritual.",ep:7,g:87,l:77,wd:true,fm:true,w:10,s:38,p:15425};
I[7013] = {n:"Bamboo Wood",t:38,d:"Unlike reed, bamboo can break when bent. Most of the time, it\'s the teeth of a careless adventurer that will break first. These bloody dentists even have nature on their side... I tell you.",ep:18,g:673,l:50,wd:true,fm:true,w:5,p:0};
I[7014] = {n:"Holy Bamboo Wood",t:38,d:"You wouldn\'t think to look at it, but this wood is sacred. Normally, only the finest Pandawas can get their hands on a piece but sometimes, sometimes, lumberjack tourists take a little souvenir of their trip to Pandala island. Bloody tourists.",ep:18,g:671,l:100,wd:true,fm:true,w:5,p:0};
I[7015] = {n:"Bamboo Shoots",t:38,d:"Being completely tasteless, these bamboo shoots are not a popular foodstuff. You should cut them down with a well-rusted scythe and marinate them for a couple years in Greedovore juice before you serve them up to your friends. Another tip from unscrupulous restaurateurs willing to feed you anything at all.",ep:1,g:676,l:50,wd:true,fm:true,w:2,p:5};
I[7016] = {n:"Dark Bamboo Wood",t:38,d:"Walloh, a young Pandawa once asked his father: " + "\"" + "what\'s the difference between Bamboo and Dark Bamboo daddy?" + "\"" + " His dad slapped him in the face for asking such a stupid question. Everyone knows that the difference between Bamboo and Dark Bamboo is the size of their seeds.",ep:18,g:672,l:60,wd:true,fm:true,w:5,p:0};
I[7017] = {n:"Golden Bamboo Wood",t:38,d:"Walloh, a young Pandawa once asked his father: \'what\'s the difference between Bamboo and Golden Bamboo daddy?\'. His dad smacked him for asking such a stupid question. Everyone knows that the difference between Bamboo and Golden Bamboo is the size of their roots.",ep:18,g:669,l:45,wd:true,fm:true,w:5,p:20};
I[7018] = {n:"Rice",t:34,d:"Either sticky or slimy, rice is a long-time favourite with young, starving Pandawas.",ep:18,g:10,l:20,wd:true,fm:true,w:2,p:0};
I[7020] = {n:"Lotus Flower",t:38,d:"Some say it\'s the oldest known flower. It symbolizes fertility as well as detachment since it can submerge itself in water without getting wet. Some Pandawa Chiefs use this symbol to make their followers understand they have to live their life in the world without falling under its influence...",ep:1,g:141,l:30,wd:true,fm:true,w:1,p:2};
I[7022] = {n:"Sangroku\'s Staff",t:4,d:"This Staff belonged to Sangroku\'s grandfather, Sangrokrane, famous for his big head. Legend says this magic staff has the ability to stretch to any length desired... use it to flatten your enemies or stick it down your pants, you\'re always a winner with this thing...",ep:18,g:47,l:120,wd:true,fm:true,w:10,an:12,e:[10,4,1,1,50,60,false,false],c:"CA>250&CV>300",p:36620};
I[7023] = {n:"Aquamarine Stone",t:51,d:"This stone is usually found around Pandala Island. Pandawas are convinced it has special powers. Just like the rumours about Iops and their hidden intelligence, no one has proven this myth.",ep:1,g:75,l:60,wd:true,fm:true,w:5,p:600};
I[7024] = {n:"Topaz Stone",t:51,d:"Batches of this weird-looking stone were once used feed the young Crackrocks of Pandala breeders. Believe it or not, the stones are now endangered, so this practice has been discontinued.",ep:5,g:76,l:70,wd:true,fm:true,w:5,p:700};
I[7025] = {n:"Agathe Stone",t:51,d:"This stone has been named after a Pandala river in which great quantities of it used to be found. But times have changed and the intensive exploitation of the past now means it is difficult to find.",ep:5,g:128,l:80,wd:true,fm:true,w:5,p:1};
I[7026] = {n:"Aquamarine",t:50,d:"This precious, slightly blue, transparent stone is so bright that it can hide the most ravine-like wrinkles when worn as a necklace. Pandawas even tell tourists: " + "\"" + "With this stone, keep your man happy and watch with pity the ravages of time misshape your loved ones." + "\"" + " A nice way to kill two birds with one stone!",ep:1,g:101,l:60,wd:true,fm:true,w:5,p:600};
I[7027] = {n:"Topaz",t:50,d:"For some dubious reasons, Topaz is still the most popular jewel among jewellers. It attracts quite a lot of Crows in the Cania Plains.",ep:5,g:102,l:70,wd:true,fm:true,w:5,p:700};
I[7028] = {n:"Agathe",t:50,d:"This stone has been named after a very famous female Pandawa: Agathe Pahtes. She could be found in places of debauchery such as the Sufokia Pirates\' Pub, where she spent her last years dancing, chained up to a big mast in the middle of the pub.",ep:5,g:103,l:80,wd:true,fm:true,w:5,p:800};
I[7029] = {n:"Sangroku\'s Belt",t:10,d:"Sangroku ate way too many magic beans one time. Forever more, it was a constant struggle to restrain the winds of panic that erupted from his britches without the slightest warning... Those very same winds made him famous the length and breadth of Amakna.",ep:13,g:80,l:86,wd:false,fm:true,w:10,c:"CS>100",p:18400};
I[7030] = {n:"Kaniger Skin",t:59,d:"Once shaved, Kaniger skin is very soft, a bit like a female Sadida\'s.",ep:13,g:47,l:70,wd:true,fm:true,w:5,p:1};
I[7031] = {n:"Flooey\'s Clock",t:1,d:"Poor Flooey lost his mind after a terrible fight against Many. Fortunately, his amulet didn\'t suffer. It kept both its mesmerizing properties and its laxative powers. To be taken only when absolutely necessary.",ep:18,g:90,l:46,wd:false,fm:true,w:2,p:5600};
I[7032] = {n:"Silicate",t:39,d:"This ore probably comes from the depths of the Pandala island mines where Gardan Framine fell head over heels in love with a female Pandawa ghost. Love really doesn\'t know any boundaries!",ep:16,g:111,l:70,wd:true,fm:true,w:5,p:0};
I[7033] = {n:"Dolomite",t:39,d:"Irko, the Dark Miner, had great respect for Dolomite. \'The hard and unbreakable rock\' he used to call it.",ep:16,g:110,l:80,wd:true,fm:true,w:5,p:0};
I[7034] = {n:"Master Nabur Helmet",t:16,d:"Passed down from generation to generation, this misshapen helmet was even worn by Crail himself. Many adventurers think it has mysterious powers. As with many divinities and modern heroes, the magical powers of this helmet have all the potency of a shoe...",ep:16,g:93,l:97,wd:false,fm:true,w:10,p:23000};
I[7035] = {n:"Pyrute",t:40,d:"This alloy was used to forge blades which wouldn\'t rust when in contact with the blood and drool of its victims",ep:16,g:708,l:100,wd:true,fm:true,w:100,p:0};
I[7036] = {n:"Brassic",t:40,d:"A shiny alloy, Brassic is tolerated by bankrupt jewellers who can\'t afford precious stones. They usually make very competitively priced alloys. Comes in handy when you want to marry for money.",ep:16,g:707,l:100,wd:true,fm:true,w:100,p:0};
I[7037] = {n:"Granny Candy\'s Stick",t:4,d:"This stick used to belong to Granny Candy, one of the three famous Love Priestesses. Sharpened at one end and shiny at the other, this stick is renowned for its versatility and its annoying tendency to turn up just about anywhere. None can resist its power.",ep:18,g:48,l:98,wd:true,fm:true,w:15,an:12,e:[5,5,1,1,50,50,false,false],c:"CS>100&CV>300",p:24500};
I[7038] = {n:"King Jellix\'s Crown",t:16,d:"This crown belonged to the famous King Jellix, renowned for his unbounded romanticism and his seductive power which left its mark on many female Jellies... Some even say he is the father of all the Jellies of the region of Amakna, proof (if needed) of his stamina and legendary fecundity.",ep:7,g:94,l:79,wd:true,fm:true,w:15,p:15000};
I[7039] = {n:"Frank Lee Bruce\'s Black Belt",t:10,d:"A famous Sunday fighter, Frank crossed over into martial arts after he failed miserably at his stone-cutter apprenticeship.",ep:13,g:81,l:47,wd:true,fm:true,w:5,p:5900};
I[7040] = {n:"Kuri Bow",t:2,d:"This bow belonged to Kuri, the famous Love Priestess and left-hand woman of Granny Candy. Never turn your back on a Love Priestess. One arrow from this bow is enough to tear your heart to shreds, or your arse if you have actually turned around.",ep:18,g:43,l:56,wd:true,fm:true,w:10,an:10,tw:true,e:[15,5,2,6,20,40,false,true],p:8300};
I[7041] = {n:"MacSheth",t:30,d:"Also called the Duncan Flonuts, The Soil and Bubble or the Pandawa Trots, the MacSheth is a Pandala speciality! Symptoms: an urgent need to get to the throne, violent yanking on the chain of command and a ruthless desire to evacuate all that blocks your passage...",ep:18,g:8,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[7042] = {n:"Pandawa Headgear",t:14,d:"Unlike the Pandawa of Amakna, the Pandawa from Pandala won\'t make you big-headed, but will arouse an inexplicable urge to throw fertilizer around the place!",ep:18,g:31,l:1,wd:false,fm:true,w:1,c:"PG!12",u:true,p:1000};
I[7043] = {n:"Ice Dofus",t:23,d:"Legend says that this magnificent Dofus came out of the frozen hole of the Water dragon Aguabrial. Legend does not say if he had a cold that day, though it\'s highly likely.",ep:1,g:5,l:1,wd:false,fm:true,w:1,p:1};
I[7044] = {n:"Fake Dofus",t:24,d:"This Dofus looks like no other... Wait a minu...",ep:18,g:256,l:1,wd:false,fm:true,w:0,p:1};
I[7045] = {n:"Pandaburg Flask",t:79,d:"Pandaburg is a tasty drink which could very slowly make you blind, mute and deaf. How convenient! Pandawas aren\'t the speedy kind.",ep:18,g:2,l:1,wd:true,fm:true,w:1,p:1};
I[7046] = {n:"Pandapiler Flask",t:79,d:"According to the erudite Hel Munster, this genuine nectar delights the goddess Pandawa herself, making her completely euphoric. Any true Pandawa should give his Pandapilers away to the venerated goddess.",ep:1,g:3,l:1,wd:true,fm:true,w:1,p:1};
I[7047] = {n:"Pandapils Flask",t:79,d:"One of the more sensible Pandawan traditions goes like this: Clink glasses with your neighbour, throw sugar on your hair and burp the following line - " + "\"" + "Pandapils, Pandapils, tralalalaHIHOO!" + "\"" + ".",ep:18,g:4,l:1,wd:true,fm:true,w:1,p:1};
I[7051] = {n:"Pandarium Tremens Flask",t:79,d:"" + "\"" + "Pandarium Tremens proves Pandawa\'s love and her will to make us happy." + "\"" + " This thanking prayer addressed to the goddess is an evidence of peace between all Pandawas.",ep:0,g:9,l:1,wd:true,fm:true,w:1,p:5000};
I[7055] = {n:"Pandneken Flask",t:79,d:"" + "\"" + "It\'s true that Bwaks have short legs, but there\'d be no point making them longer" + "\"" + ". This is the type of conversation you end up having after consuming Pandneken. That\'s why Pandawas now prefer to keep it for their libations to Pandawa.",ep:18,g:12,l:1,wd:true,fm:true,w:1,p:1};
I[7056] = {n:"Kracker Cap",t:16,d:"This unique hat used to belong to a Xelor grandmaster, known the world over for his explosive theories and his incessant meddling with time. His death was as explosive and untimely as his life... Jealous of his neighbour\'s hat, whose magic powers were said to be even greater than his, he rashly unleashed a Wind of Panic to remove it forever, forgetting about his own. He was blown into a million little pieces when his hat exploded like a giant firecracker.",ep:19,g:95,l:149,wd:true,fm:true,w:10,p:45850};
I[7057] = {n:"Shaman\'s Assistant",t:32,d:"Bring the assistant to the goddess, he will be grateful...",ep:18,g:0,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[7058] = {n:"Octovius",t:16,d:"This headgear is made of dead dried Kralove leftovers. Be careful, it can come back to life if you use it as a bathing cap.",ep:18,g:96,l:77,wd:true,fm:true,w:10,p:15475};
I[7059] = {n:"Pandkin Seed",t:58,d:"This humongous seed is filled with a heavy but magical oil. Its shell is said to be unbreakable and many craftsmen use it to enchant their weapons. Others stick wiggly eyes on it and put it on the dashboard of their cart...",ep:18,g:67,l:100,wd:true,fm:true,w:10,p:10};
I[7060] = {n:"Pandapiler Special",t:24,d:"Lenald the Wise gave you this Pandapiler to bring to the Pandawushu Master of the water path.",ep:18,g:501,l:1,wd:false,fm:true,w:0,p:1};
I[7061] = {n:"Bow Meow Curse",t:31,d:"The water from the source juice-sane-ki-oak of the Bow Meow temporarily turned you into a Bow Meow. The slightest shock will make you go back to normal.",ep:18,g:21,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[7062] = {n:"Poochan",t:32,d:"You must take Poochan to her future husband.",ep:18,g:21,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[7063] = {n:"Imp Flower",t:35,d:"This pretty flower only grows in the Imp village, a bit like an Impette, only not as mean.",ep:1,g:634,l:40,wd:true,fm:true,w:2,p:10};
I[7064] = {n:"Itchy Orchid",t:35,d:"This magnificent orchid is very well-known for the enraging itch that grips anyone who dares to prune it.",ep:1,g:633,l:40,wd:true,fm:true,w:2,p:10};
I[7068] = {n:"Rice Flour",t:52,d:"This flour is perfect for making cement or even bedding for your dog.",ep:18,g:7,l:50,wd:true,fm:true,w:2,p:0};
I[7069] = {n:"Smashed Sidimote Shield",t:82,d:"This shield has seen a few battles too many, in this state it is good for nothing. Perhaps Bouwada, in Pandala village, could replace it for you.",ep:18,g:8,l:1,wd:false,fm:true,w:10,c:"BI=non Ã©quipable",p:15650};
