I[7077] = {n:"Sponghield",t:82,d:"This porous but absorbent yellow shield was made from the remains of a creature who used to live in a Pineapple Mask at the bottom of the sea.",ep:1,g:10,l:1,wd:true,fm:true,w:10,s:63,p:1};
