I[7097] = {n:"Training Shield",t:82,d:"This Shield is given to disciples who don\'t know how to correctly use a Shield yet.",ep:14,g:1,l:1,wd:true,fm:true,w:1,p:1};
I[7098] = {n:"Shield Smith\'s Hammer",t:7,d:"This hammer is indispensible to blacksmiths.",ep:18,g:2,l:1,wd:true,fm:true,w:10,an:15,e:[5,6,1,1,50,50,false,false],p:500};
I[7102] = {n:"Ice Knight Sword",t:6,d:"The Ice Knight was famous for being one of the greatest sword smiths in all of Amakna. Only Liche the unmerciful refused to recognize his talent. Offended by this creature\'s ignorance, the Ice Knight stopped working, refusing to forge so much as a teaspoon until she agreed to publicly recognize his talent. The Ice Knight worked the bars around Amakna for a  couple of hundred years, but the local economy never crumbled as he had expected, nor did Amakna\'s military influence waver... as he had also expected. When he finally took up his rusty hammer once more, he found he\'d completely forgotten his former skill. This ridiculous sword was his last usable creation.",ep:1,g:51,l:12,wd:true,fm:true,w:10,an:14,e:[5,6,1,1,40,60,false,false],p:575};
I[7103] = {n:"The Xyothine",t:3,d:"This Wand was used to behead all the ninnies in Amakna. Suffice it to say it\'s seen a lot of action. It\'s interesting to note how much it resembles a staff or even a walking stick... It might have even been used to satisfy the wicked fantasies of the owner who named it. No one will ever have the last final word on this sordid story.",ep:19,g:53,l:145,wd:true,fm:true,w:15,an:11,tw:true,e:[7,4,3,5,30,50,false,true],c:"CI>450&CV>200",p:10000};
I[7104] = {n:"Flee-Flops",t:11,d:"These flee-flops were used to practice various martial arts. Not quite revolutionary and artistically speaking, a failure, they were only good for running away, a bit like yourself...",ep:18,g:58,l:67,wd:true,fm:true,w:5,p:11700};
I[7105] = {n:"Pandala Amulet",t:24,d:"At first sight, this looks like a simple Amulet but it actually holds a mystery that only a dying Pandawa can understand...",ep:18,g:48,l:0,wd:true,fm:true,w:0,p:1};
I[7106] = {n:"Larvamulet",t:1,d:"With this Larva head round your neck, you look like Stive Irween, the famous modern-day larva tamer.",ep:5,g:88,l:26,wd:true,fm:true,w:5,s:33,p:1950};
I[7107] = {n:"Larvaboots",t:11,d:"You probably never dreamt of putting your feet right inside the guts of a Larva... But here is your chance... Seize it!",ep:1,g:53,l:33,wd:true,fm:true,w:10,s:33,p:3150};
I[7108] = {n:"Larvabag",t:81,d:"This plain bag used to be very fashionable a very long time ago. It is the best example of your ancestors\' bad taste.",ep:5,g:60,l:27,wd:true,fm:true,w:10,s:33,p:2150};
I[7109] = {n:"Larvhat",t:16,d:"You finally have the chance to look like a real larva. You will be able to openly show the world your larvian lifestyle.",ep:5,g:103,l:34,wd:true,fm:true,w:10,s:33,p:3225};
I[7110] = {n:"Larvaresque Wand",t:3,d:"This terrific Wand is made of larva guts which are firstly dried, then enchanted and finally rehydrated. It\'s totally shapeless. A bit like you, except you\'re not even enchanted.",ep:5,g:19,l:40,wd:true,fm:true,w:5,an:11,e:[5,3,2,4,40,50,false,true],s:33,p:4000};
I[7112] = {n:"Black-Spotted Dofus",t:23,d:"The only way to get an egg like this is to force a black dragon to mate with a white dragon. Although some people paint ordinary eggs this colour at home... You may have been tricked.",ep:1,g:8,l:6,wd:true,fm:true,w:1,p:50000};
I[7113] = {n:"Dofawa",t:23,d:"This Dofus is worryingly similar to a wild Dragoturkey egg... For once, appearances might not be misleading.",ep:1,g:9,l:6,wd:false,fm:true,w:1,p:10};
I[7114] = {n:"Ebony Dofus",t:23,d:"As dark as darkness can be, as solid as a rock, the Dragon which laid such an egg probably didn\'t forget too quickly.",ep:1,g:7,l:6,wd:true,fm:true,w:10,p:50000};
I[7115] = {n:"Ivory Dofus",t:23,d:"The Ivory Dofus is incomparably white, which isn\'t surprising given that Dardondakal the White Dragon whitened it with his breath every morning (an old trick passed on to him from his Dragon grandmother).",ep:1,g:11,l:6,wd:true,fm:true,w:10,p:50000};
I[7116] = {n:"Omerta Ring",t:9,d:"The enchantment in this ring is very strange - once around your finger, the only person you\'ll be able to talk to will be the jeweller who made it.",ep:18,g:91,l:59,wd:true,fm:true,w:5,p:9155};
I[7117] = {n:"Ostarr Ring",t:9,d:"A particularly talentless group of cosmopolitan minstrels used this type of ring to keep time at their shows after their original drummer left them. They would all put a ring on a toe, and beat in time. Needless to say, it was the percussion that always let them down.",ep:18,g:92,l:53,wd:true,fm:true,w:5,p:7150};
I[7118] = {n:"Ugle Ring",t:9,d:"This big moth-shaped ring won\'t make your hands pretty, but isn\'t that a good thing?",ep:18,g:94,l:90,wd:true,fm:true,w:5,p:20775};
I[7119] = {n:"Nonsenz Ring",t:9,d:"The jeweller who created this masterpiece is no relative of the famous Sword Smith, despite appearances. No one ever understood what the designer said about using the ring...",ep:18,g:85,l:58,wd:true,fm:true,w:5,p:8750};
I[7120] = {n:"Ignoah Ring",t:9,d:"Contrary to common misunderstanding, this ring has nothing to do with the beautiful Karin, whose regular live shows at Sufokia Pirates\' Inn raised many a visiting spirit from the dead. The namesake of this jewel is a musician who breeds Tofus in his spare time...  so what, you ask. Well, with this ring, it\'ll sound like there\'s a dying tofu attached to your finger.",ep:18,g:86,l:44,wd:true,fm:true,w:2,p:5350};
I[7121] = {n:"Nozokomial Ring",t:9,d:"This living ring has a terrible curse that makes even the toughest of adventurers seriously ill. They say it was originally designed to heal the person who wore it, but since warriors brought it to the most disreputable locations in the land, its sense of dignity led it to become more and more dangerous and aggressive.",ep:18,g:87,l:50,wd:true,fm:true,w:5,p:6655};
I[7122] = {n:"Blubba Ring",t:9,d:"This ring is made for tearful novices. It also symbolizes some ancient, unspeakable traditions. It\'s made for you! Perfect.",ep:16,g:88,l:18,wd:true,fm:true,w:2,p:1100};
I[7123] = {n:"Ab\'ho Ring",t:9,d:"For experienced adventurers only. It might shock your family and friends to know it\'s composed of young, innocent creatures.",ep:18,g:95,l:70,wd:true,fm:true,w:2,p:12900};
I[7124] = {n:"Milk Chocolate Dofus",t:42,d:"This Dofus has exceptional power: it can make you drool with joy.",ep:1,g:27,l:1,wd:false,fm:true,w:1,p:1};
I[7125] = {n:"White Chocolate Dofus",t:42,d:"This Dofus has exceptional power: it can make you drool with joy.",ep:1,g:28,l:1,wd:false,fm:true,w:1,p:1};
I[7127] = {n:"Dofus Shell",t:42,d:"...",ep:1,g:30,l:1,wd:false,fm:true,w:1,p:1};
I[7128] = {n:"Okaringa",t:9,d:"Spiteful gossips claim that this ring is the most useful fashion accessory in the world. The wings attached to it can be quite a pain when you need to get a tissue out of your pocket. Now, Iops neither have tissues nor pockets... so, it\'s just fine.",ep:18,g:89,l:54,wd:true,fm:true,w:5,p:7700};
I[7129] = {n:"Chocolate Panda",t:42,d:"Don\'t underestimate this chocolaty treat - not only does it taste fantastic, its shape gives it even more flavour as well. Try a chocolate Ouassingue and you\'ll understand what I mean.",ep:0,g:31,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[7130] = {n:"Chocolate Dofus Recipe",t:24,d:"The recipe for the Chocolate Dofus is a must if you want to impress your friends.",ep:1,g:250,l:1,wd:false,fm:true,w:0,p:100};
I[7131] = {n:"Pota Ring",t:9,d:"Many other adventurers dreamt of getting their paws on this jewel long before you came along. Indeed, it\'s said to have many powers, such as the power to turn fierce warriors into good-for-nothing dreamers. It says in my book to never put it near fire. Doesn\'t say why...",ep:16,g:90,l:57,wd:true,fm:true,w:5,p:8475};
I[7132] = {n:"O-Ring Ami",t:9,d:"This ring owes its name to the last words pronounced by its creator: " + "\"" + "O\' Ring Ami! You\'re such a friend!" + "\"" + " he said in a painful but bewitching rattle. It is interesting to note that this Bamboo ring was actually made before Bamboo evolved. Another mystery which will not be solved for another ten years or so!",ep:16,g:96,l:49,wd:true,fm:true,w:5,p:6300};
I[7133] = {n:"Mixomawose",t:30,d:"As any Wabbit will tell you - if you don\'t want to see red, avoid the Mixomawose like the plague.",ep:1,g:9,l:1,wd:false,fm:true,w:0,p:1};
I[7134] = {n:"Rabies",t:30,d:"Some say Rabies completely changes the affected beings. Warriors become docile, and calm persons become aggressive. However, persons who dribbled will not change.",ep:1,g:10,l:1,wd:false,fm:true,w:0,p:1};
I[7135] = {n:"Maloria",t:30,d:"This is a disease transmitted by Moskitoes from tropical regions. Maloria is so called because the disease can be transmitted by Moskito spit as well.",ep:1,g:11,l:1,wd:false,fm:true,w:0,p:1};
I[7136] = {n:"Aykido Medal",t:1,d:"This medal used to belong to a famous Pandawa master at an old martial arts school who taught his disciples the principles of defence using their opponents\' strength. His school finally closed down because his opponents were no longer strong enough.",ep:19,g:89,l:125,wd:true,fm:true,w:10,p:40425};
I[7137] = {n:"Cape Huccino",t:17,d:"This Cape was hand-sewn for one single reason: to stop you from sleeping for weeks on end. It is so rigid that it will keep you standing still and upright no matter what happens. Just don\'t try to tie your shoelaces.",ep:16,g:15,l:44,wd:true,fm:true,w:15,p:5300};
I[7138] = {n:"Nettlez",t:17,d:"Worn by the most important people in the world, this cloak is famous for its legendary softness which means you don\'t have to put on underwear in the warm season. An elegant way to expose yourself...",ep:19,g:91,l:125,wd:true,fm:true,w:15,p:40175};
I[7139] = {n:"Ditchy Belt",t:10,d:"The shoemaker loved strolling in the fields, looking for improbable love. Instead of finding her soul mate, she died falling into a huge ditch full of filth, close to the Pig Zone. Her body was found seventy years later, when they finally emptied the ditch. Her brother apparently said: " + "\"" + "We all have to go sometime" + "\"" + ", before falling into the ditch himself.",ep:19,g:82,l:125,wd:true,fm:true,w:15,p:39975};
I[7140] = {n:"Xenature",t:10,d:"Contrary to appearances, Xena was not a warrior, but a shoemaker. Her generous figure and her unlimited passion for housework strongly suggested a brilliant career in the inns of Amakna. But it wasn\'t to be.",ep:19,g:83,l:125,wd:true,fm:true,w:15,p:40125};
I[7141] = {n:"Himune",t:16,d:"This strange hat will protect you from sun beams, especially when its dark. Be careful though, every thirty years it comes to life and tries to suffocate its owner... It doesn\'t say when the last time... I wouldn\'t worry about it...",ep:19,g:111,l:122,wd:true,fm:true,w:10,p:37925};
I[7142] = {n:"Paperb\' Hat",t:16,d:"This hat was used by some Xelors to hide their hereditary baldness. Enutrofs used it to hide their wives\' faces. In fact, the only male syndrome it doesn\'t treat is prostate cancer...",ep:19,g:112,l:145,wd:true,fm:true,w:15,p:46980};
I[7143] = {n:"Solomonk",t:16,d:"The Solomonk hat was worn by the Chief of a Pandawa tribe. Experts in laxative potions, low-ranking Pandawas were often obliged to test the potions for the alchemists. When banished to the jungle for these trials, this hat doubled as a chamber pot, reducing their load considerably.",ep:19,g:123,l:120,wd:true,fm:true,w:50,p:36880};
I[7144] = {n:"Palishat",t:16,d:"This wedding hat has gone out of fashion, its lace is no longer considered stylish. If it was recycled into knickers and worn on a hairy head, it might still get a reaction out of a Chafer.",ep:19,g:116,l:108,wd:true,fm:true,w:15,p:29775};
I[7145] = {n:"Gaddie\'s Hat",t:16,d:"Gaddie, a strange creature from an imaginary world, always stood out for its incredible cunning, its total aversion to plants and its ability to fast for days on end in times of war. A creature that complex to understand was obviously impossible to control. It was abandoned in the depths of the Mines of Kruup where its only friend was an old, Gobbly devouring Liche.",ep:19,g:115,l:106,wd:true,fm:true,w:15,p:26375};
I[7146] = {n:"Lullibye",t:16,d:"This headgear looks like any old wig, but it is powerful indeed. It has one prior owner who had the strange and despicable habit of dressing up as other people, and conning the elderly into signing over items of tiny value. Once he convinced a gentle old man that he was his dead wife returned to life, proceeded to \'remarry\' him, had six of his children (which even I can\'t explain) and then, ten years later, just as they were about to renew their vows on a scenic cliffside, he broke the news. It is said he ran off with three party poppers and a half-eaten ball of Stracciatella ice-cream, laughing wildly... still laughing as he tripped and fell over the cliff and laughing to this day if you believe the popular but unlikely sea shanty, \'The crazy fool took my Stracciatella\'.",ep:18,g:114,l:81,wd:true,fm:true,w:10,p:16925};
I[7148] = {n:"A square of white chocolate",t:42,d:"...",ep:1,g:33,l:1,wd:false,fm:true,w:1,p:1};
I[7149] = {n:"Square of Dark Chocolate",t:42,d:"Directly extracted from cocoa beans, this square of dark chocolate is very tasty. Be careful not to eat too much of it, it\'ll give you the spotty skin of a 13 year old, chain-smoking truck-driver.",ep:1,g:34,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:200};
I[7150] = {n:"Krutch",t:16,d:"This hat, strangely named, belonged to a poor Ecaflip who became mute after a traumatic event. An artist through and through, he was compelled to follow a Brewer training.  When he turned 14, he drowned in a barrel of beer and tears. Fortunately, beer was not wasted as the priest who was in charge of the funeral fell into an alcoholic coma for many years before he could take his office right where he had stopped it.",ep:19,g:109,l:111,wd:true,fm:true,w:20,p:31725};
I[7151] = {n:"Koloss",t:16,d:"On the box of this helmet, it said: \'This giant clay protective headgear will turn you into a giant with a head of clay\'. Upon further study, you\'ll realize the helmet is not made of clay, but of lead. Every year, many adventurers die, trapped under the helmet like nipples under a Chinese fire cup...",ep:19,g:108,l:120,wd:true,fm:true,w:15,p:36925};
I[7152] = {n:"Wheritz Hat",t:16,d:"This basin-shaped hat was used by the firemen of Amakna when there were fires on cereal fields. Nowadays it is mainly used by brewers and pub waitresses who are treated like walking barrels.",ep:19,g:110,l:120,wd:true,fm:true,w:20,p:36675};
I[7153] = {n:"Metal Hammer",t:7,d:"This huge hammer makes a very loud noise when hitting a Iop\'s skull as it tends to amplify sound. As surprising as it is effective.",ep:19,g:51,l:126,wd:true,fm:true,w:15,an:15,tw:true,e:[5,4,1,1,50,50,false,false],c:"CC>200",p:40200};
I[7154] = {n:"Toy Hammer",t:7,d:"This light hammer is designed for small beings. Xelors used to find great pleasure in squashing Arachnees with this implement. Its use quickly changed and it became a little toy for young Iop Handymen.",ep:18,g:46,l:107,wd:true,fm:true,w:15,an:15,e:[5,4,1,1,40,50,false,false],c:"CI>350&CV>200&CW>100",p:29475};
I[7155] = {n:"Hammer Ingthaiphoons",t:7,d:"For fifty long years, the famous Captain Adock used this terrible Hammer to slay anyone who got in his way - including women and children. In spite of his legendary bad temper and his addiction to alcohol, he won the respect of all warriors - both friend and enemy.",ep:18,g:48,l:113,wd:true,fm:true,w:15,an:15,e:[10,4,1,1,40,60,false,false],c:"CI>150&CW>100&PG=5",p:32650};
I[7156] = {n:"Hammer Ican",t:7,d:"This rusty hammer is perfect for all your smashing needs - pulverize maple trees, atomize Moskitoes, this hammer does it all.",ep:18,g:50,l:107,wd:true,fm:true,w:20,an:15,tw:true,e:[10,3,1,1,30,100,false,false],c:"CI>150&CV>150&(PG=2|PG=5)",p:100000};
I[7157] = {n:"Toll Hammer",t:7,d:"This hammer was used to sound the bell of the Church of Amakna every Sunday. In these times of war, it\'s used much more often than that.",ep:19,g:49,l:124,wd:true,fm:true,w:15,an:15,tw:true,e:[5,5,1,1,50,50,false,false],c:"CI>250",p:29400};
I[7158] = {n:"Trikidiki Hammer",t:7,d:"This hammer was crafted by a famous alchemist during his sentence in the prison of Brakmar. He planned to steal his competitors\' secrets and get rich when he got out. This hammer was the first in a collection of devilish instruments.",ep:19,g:47,l:143,wd:true,fm:true,w:20,an:15,tw:true,e:[5,5,1,1,50,50,false,false],c:"CA>250&PG=5",p:46550};
I[7159] = {n:"Cogito Hammer",t:7,d:"As the Enutrof philosopher Traincartes once said, " + "\"" + "I think, therefore I hammer." + "\"" + " It sums up the way this greedy bunch sees the world.",ep:19,g:52,l:135,wd:true,fm:true,w:20,an:15,tw:true,e:[5,5,1,1,50,50,false,false],c:"CC>200&CV>300",p:41200};
I[7160] = {n:"Doozi Bow",t:2,d:"Many ages ago, this Bow was occupied with a very dark magic, a mysterious force that strikes fear into both its owners and its targets in equal measure.",ep:19,g:44,l:120,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,7,30,50,false,true],c:"CA>150&CI>400&PG=9",p:36900};
I[7161] = {n:"Young Wild Bow",t:2,d:"This bow was mainly used to hunt Plain Boars. Indeed, it is so powerful that it can kill several young boars with one single arrow, provided that they stand still in a line. Well it could happen!",ep:18,g:45,l:107,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,8,30,50,false,true],c:"CI>250&CA>150",p:29325};
I[7162] = {n:"Placee Bow",t:2,d:"This Bow belonged to an independent group of Minstrels mainly famous for their war cries which destroyed their enemies\' ear drums. They were firstly banished to Pandala, but after driving generations of Pandawa nuts, they were finally brought to the Great Sorlok to be slowly digested for more than 752 years.",ep:19,g:46,l:130,wd:true,fm:true,w:15,an:10,tw:true,e:[10,5,3,6,30,50,false,true],c:"CA>200&CC>70&PG=9",p:30000};
I[7163] = {n:"Runaway Bow",t:2,d:"This bow was used as a dissuasive weapon. The owner of the Runaway Bow claimed that he was using poisoned arrows so any cowards he met would take off instantly.",ep:19,g:47,l:124,wd:true,fm:true,w:15,an:10,tw:true,e:[10,5,2,6,30,50,false,true],c:"PG=9&CA>250",p:39050};
I[7164] = {n:"Marilyn Mun Bow",t:2,d:"Light and fragile, this bow appeals to adventurers who are more concerned about appearances than substance.",ep:19,g:48,l:143,wd:true,fm:true,w:15,an:10,e:[5,5,2,6,30,50,false,true],c:"CA>120&CI>120&CC>120&CV>300",p:46025};
I[7165] = {n:"Kilih Wand Jaro",t:3,d:"This explosive wand was dipped into the lava of an erupting volcano before being sculpted, and then enchanted. It goes without saying that it\'s very powerful... despite its ridiculous appearance.",ep:18,g:54,l:105,wd:true,fm:true,w:15,an:11,e:[5,4,3,6,50,50,false,true],c:"CI>300",p:28625};
I[7167] = {n:"Wand Hering",t:3,d:"The craftsman who created this wand had many apprentices. He made them work all day long. He was supposed to teach them the tricks of the trade but as it turned out, he was a terrible teacher. He always started sentences, trailed off, fell asleep, dreamt he was a goat and started licking the blackboard. I\'m not suggesting that there\'s a link between the last two... I\'m just reading the... psychiatric... report. OH MAN, this guy was messed up in the head... Blimey!",ep:18,g:50,l:43,wd:true,fm:true,w:5,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>60",p:5000};
I[7168] = {n:"Pinted Wand",t:3,d:"Once sculpted, this wand was soaked in beer for many decades \'to put a few magical powers into it\', as the people who made it said. Unfortunately, it started to rot, but it has a few magical properties... it can lure worms to the earth\'s surface for example. Are you into fishing by any chance?",ep:18,g:51,l:63,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>150",p:4800};
I[7169] = {n:"Sparkly Wand",t:3,d:"Ideal for lighting a fire, or indeed lighting up a dreary party. With this wand, you just might get the chance to shine once in your life. An opportunity not to be missed.",ep:18,g:52,l:81,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,50,50,false,true],c:"CI>200",p:17000};
I[7170] = {n:"Creizy-Stufh Wand",t:3,d:"Creizy the pastry chef was nuts... he married Stufh the Lumberjane and choked her to death the very next day with his fat-stuffed pastries. Ever since, the phrase " + "\"" + "Creizy Stufh" + "\"" + " is used to express an unhappy surprise after a great celebration.",ep:18,g:46,l:112,wd:true,fm:true,w:15,an:11,tw:true,e:[5,2,3,4,30,50,false,true],c:"CI>350&CV>200",p:32330};
I[7171] = {n:"Wand Heroff",t:3,d:"The designer of this wand kept forgetting to pick his kids up at school. Conscious of his absent-mindedness, he sculpted a wand that would come to life everyday and remind him to pick his kids up. After a while, he kept thinking the wand was waking him up to remind him to go to the bathroom. His children were taken away from him not long after.",ep:19,g:47,l:127,wd:true,fm:true,w:15,an:11,tw:true,e:[10,4,4,6,40,60,false,true],c:"CI>300&CV>300",p:43125};
I[7172] = {n:"Boogey Wand",t:3,d:"This magic wand is still used today to empty septic tanks, clean out ditches and pick noses. Most informed sculptors will tell you that it derives all its magic from all the filthy waste it\'s been dragged through... in reality, it\'s the dirty gunge from your snout.",ep:18,g:49,l:105,wd:true,fm:true,w:20,an:11,tw:true,e:[10,4,2,4,30,60,false,true],c:"CI>200&CW>50",p:28375};
I[7173] = {n:"Strangly Wand",t:3,d:"This terrific Wand can wrap itself round your opponent\'s neck and strangle them slowly but surely. An original and distinguished way of killing enemies you don\'t respect.",ep:18,g:48,l:27,wd:true,fm:true,w:10,an:11,e:[5,3,2,4,50,50,false,true],c:"CI>50",p:2100};
I[7174] = {n:"Pandawushu Cloak",t:17,d:"This cloak is essential if you want to practice Pandawushu...",ep:1,g:89,l:10,wd:true,fm:true,w:5,p:10};
I[7175] = {n:"Shamanic Certificate",t:24,d:"This medical certificate is essential if you want to practice Pandawushuka.",ep:18,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[7176] = {n:"Root Well",t:4,d:"Maxx Evanz, master staff carver, is the fellow who created this little wonder. It can darken the sky with raging cloud and draw the blood of your enemies... even if they don\'t have any. Legend says it took him nine years to carve. Even your enemies will have to complement you on this beautiful piece of stuff.",ep:19,g:53,l:143,wd:true,fm:true,w:15,an:12,e:[10,4,1,1,45,70,false,false],c:"CS>150&CV>400&CI>50&CA>50",p:46600};
I[7177] = {n:"Pandawushu Headband",t:16,d:"With this Pandawushu Headband around your skull, you\'ll be able to scare away young Lenalds pretending to be martial arts Masters. Don\'t forget to bawl a bit of a war cry to be more convincing.",ep:1,g:102,l:1,wd:false,fm:true,w:5,p:10};
I[7178] = {n:"Froot Root",t:4,d:"If it wasn\'t for the incessant arguing over whether this thing is a fruit or a root, it would be an excellent weapon.",ep:18,g:58,l:86,wd:true,fm:true,w:10,an:12,e:[5,3,1,1,50,50,false,false],c:"CI>150",p:19100};
I[7179] = {n:"Path and Trail: Damned Forest",t:25,d:"This book contains the best tourist itineraries in the maze of the Damned Forest... a must! That\'s what it says on the cover, anyway.",ep:2,g:19,l:1,wd:true,fm:true,w:1,u:true,p:50};
I[7181] = {n:"Red Root Chileepaperz",t:4,d:"Red was a young Sadidette. She loved singing, though she had a terrible voice. She always dreamt of travelling to Chili. She was often sent packing but never got anywhere...",ep:18,g:54,l:106,wd:true,fm:true,w:15,an:12,tw:true,e:[10,4,1,1,50,50,false,false],c:"CV>250&CW>60",p:28575};
I[7182] = {n:"Black Mel Root",t:4,d:"Mel was quite unlucky. Her husband was a lazy cad, incapable of assuming his status as the head of the family. She was convinced that incessant nagging was the way to go... " + "\"" + "You\'ll get no strawberry jelly if you don\'t go harvest that barley" + "\"" + " or " + "\"" + "You\'ll get no tobacco till you\'ve sheared those Gobballs" + "\"" + " and so on. Obviously, this story has nothing to do with this very powerful root... unless it starts to nag you too...",ep:18,g:60,l:103,wd:true,fm:true,w:15,an:12,tw:true,e:[15,4,1,1,25,50,false,false],c:"CV>200",p:27280};
I[7183] = {n:"Lady Root",t:4,d:"This Root has a purity that is the essence of perfection for some wide-eyed craftsmen. I can tell you from experience that this root is the single greatest cause of marital breakdown in the entire region.",ep:18,g:55,l:88,wd:true,fm:true,w:15,an:12,e:[5,4,1,1,50,50,false,false],c:"CV>70",p:20000};
I[7184] = {n:"Disast Root",t:4,d:"This terrible root is mainly known for its capacity to provoke climatic disasters at the exact place where it\'s been used. Avoid using it to kick your enemies around... It is an abuse which could see you and all your friends burnt to a crisp, drowned in a flood, blown to bits, frozen solid, misted to... well the last one wouldn\'t be so bad, but just don\'t use it okay!",ep:18,g:56,l:86,wd:true,fm:true,w:15,an:12,e:[5,4,1,1,50,50,false,false],c:"CV>100",p:18945};
I[7185] = {n:"Root \'Een",t:4,d:"Using this root during a fight is supposed to be very easy. Nevertheless, it can happen that the root somehow comes to life and does whatever it wants... that\'s generally when the owner yells " + "\"" + "This is not the usual Root \'Een, is it?" + "\"" + ". Well, it is indeed the usual Root \'Een.",ep:18,g:57,l:103,wd:true,fm:true,w:20,an:12,e:[5,5,1,1,50,50,false,false],c:"CV>200&CW>150",p:27425};
I[7186] = {n:"Level Passage",t:24,d:"On this piece of paper, you can read the last date when you gained a few Pandawashuka levels.",ep:18,g:58,l:0,wd:true,fm:true,w:0,p:1};
I[7187] = {n:"Dubya Bow",t:2,d:"This bow is reviled the land over for leading its archers into battle at the slightest sign of unusual behaviour. Drinking loudly, shaking hands for longer than is proper, and wearing hats - a few examples of what can make the bow start shooting wildly.",ep:19,g:50,l:124,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,4,6,30,2,false,true],c:"CA>100&CC>100&PG=9",p:40000};
I[7188] = {n:"Citrus Daggers",t:5,d:"These Daggers are often used to cut the ground right out from under your enemies\' feet. An original way to surprise them which often comes to a messy end.",ep:18,g:48,l:113,wd:true,fm:true,w:10,an:13,tw:true,e:[8,3,1,1,35,50,false,false],c:"CA>100&CI>100",p:32575};
I[7189] = {n:"Thrusty Staff",t:4,d:"This strange staff is an improved version of the famous God Rod. Indeed, this staff was designed and made according to the numerous tests done on the God Rod by the Love Priestesses. This model was even used by Kuri herself, which makes it a unique piece.",ep:19,g:59,l:176,wd:true,fm:true,w:15,an:12,tw:true,e:[7,4,1,1,30,100,false,false],c:"CI>450",p:57000};
I[7190] = {n:"Maydhyn China Daggers",t:5,d:"When a precocious Sramette princess couldn\'t find a single dagger that suited her, she offered a challenge to the dagger smiths of Amakna: the one who forged her a set capable of killing a Tofu in one blow would spend three nights in her bed... Unfortunately, not a single smith took up her challenge. By the time she found a willing craftsman, a retiree of the trade who never should have started in the first place, she\'d been advertising her offer among other things on the streets of Madrestam for 17 years... Let\'s just say that time hadn\'t been kind to the proud Sramette.",ep:18,g:45,l:100,wd:true,fm:true,w:10,an:13,tw:true,e:[15,3,1,1,35,50,false,false],c:"CS>150&CA>150",p:21800};
I[7191] = {n:"Ramougre\'s Setter",t:5,d:"Ramougre was an old Sram who became a jewellery master. He used this setter to perfect his creations as well as to murder his clients when he got bored. He was known for his bad temper, sometimes destroying his setter and his most beautiful creations. Today, when people with these daggers get angry, they pay tribute to Ramougre by cutting off some family jewels.",ep:19,g:49,l:127,wd:true,fm:true,w:15,an:13,tw:true,e:[10,3,1,1,30,30,false,false],c:"CA>200&CS>200",p:40825};
I[7192] = {n:"Grizmine Claw",t:6,d:"Grizmine never succeeded in properly using this Claw - she was always too drunk.",ep:18,g:59,l:111,wd:true,fm:true,w:15,an:14,e:[5,5,1,1,50,50,false,false],c:"CS>300&CA>120",p:31625};
I[7193] = {n:"Dark Vlad Sword",t:6,d:"No one but Dark Vlad himself can use this sword properly, but if you carry it round town at least people will know you\'re not one of those pathetic fools who died under its blade.",ep:19,g:61,l:126,wd:true,fm:true,w:20,an:14,e:[12,5,1,1,50,100,false,false],c:"CV>250&CI>300&PG=8",p:40625};
I[7194] = {n:"Arkanum Bow",t:2,d:"This bow proves that collaboration between technology and magic can lead to excellent results. This bow was quickly forgotten for some strange reason and its creator, Arkanum, had to close down his store.",ep:18,g:49,l:96,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,2,6,30,50,false,true],c:"CI>200&CA>60&PG=9",p:23500};
I[7195] = {n:"Furritung",t:6,d:"This legendary sword was forged early one morning by a drunken Enutrof army, deep in the mines of Grimoth. It has a very powerful aura as well as a potent hum of beer.",ep:19,g:60,l:158,wd:true,fm:true,w:15,an:14,tw:true,e:[10,5,1,1,50,80,false,false],c:"CV>300&CA>300&PG=8",p:51100};
I[7197] = {n:"Hammer Sheys",t:7,d:"This hammer was used to break chocolate blocks into dust for so many years, it eventually gained a delicious flavour. One more reason to give your enemies a taste!",ep:19,g:53,l:150,wd:true,fm:true,w:100,an:15,tw:true,e:[10,5,1,1,50,50,false,false],c:"CI>150&CV>200&(PG=5|PG=2)",p:100000};
I[7198] = {n:"Evening Razor",t:6,d:"Any old Enutrof will tell you that a well-maintained beard is every woman\'s dream. This razor is so sharp it\'ll even take care of that thick, curly back hair.",ep:18,g:62,l:106,wd:true,fm:true,w:15,an:14,e:[10,4,1,1,50,50,false,false],c:"CS>200&CA>100",p:28925};
I[7199] = {n:"Abatz Sword",t:6,d:"This sword belonged to a butcher called Franky Abatz who used it to disembowel his enemies for sausage meat. I used to go to that stall... Believe me, I made sure the dirty mongrel paid for every sausage he ever sold...",ep:19,g:63,l:135,wd:true,fm:true,w:15,an:14,e:[5,4,1,1,50,50,false,false],c:"CS>200&CA>120&CV>300",p:44225};
I[7200] = {n:"Shodanwa Sabre",t:6,d:"This magnificent sabre is used by Pandawushuka disciples when they reach the Shodanwa level alive.",ep:18,g:55,l:40,wd:true,fm:true,w:10,an:14,e:[5,4,1,1,50,50,false,false],c:"CS>60",p:4300};
I[7201] = {n:"Nidanwa Sabre",t:6,d:"This magnificent Sabre is used by Pandawushuka disciples when they reach the Nidanwa level alive.",ep:18,g:56,l:66,wd:true,fm:true,w:15,an:14,e:[10,5,1,1,50,50,false,false],c:"CA>80",p:11300};
I[7202] = {n:"Sandanwa Sabre",t:6,d:"This magnificent sabre is used by Pandawushuka disciples when they reach the Sandanwa level alive.",ep:18,g:57,l:83,wd:true,fm:true,w:10,an:14,e:[10,5,1,1,50,50,false,false],c:"CS>120",p:17800};
I[7203] = {n:"Yondanwa Sabre",t:6,d:"This magnificent sabre is used by Pandawushuka disciples when they reach the Yondanwa level alive.",ep:18,g:58,l:93,wd:true,fm:true,w:10,an:14,e:[7,5,1,1,50,50,false,false],c:"CA>100",p:22175};
I[7204] = {n:"Shodanwa Staff",t:4,d:"This Staff is normally used by Pandawushuka disciples when they reach Shodanwa level without losing the use of their arms in the process.",ep:18,g:49,l:46,wd:true,fm:true,w:15,an:12,e:[5,4,1,1,40,50,false,false],c:"CV>30&CW>10",p:5775};
I[7205] = {n:"Nidanwa Staff",t:4,d:"This Staff is normally used by Pandawushuka disciples when they reach Nidanwa level without losing the use of their arms in the process.",ep:18,g:50,l:62,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,50,50,false,false],c:"CS>100",p:10125};
I[7206] = {n:"Sandanwa Staff",t:4,d:"This Staff is normally used by Pandawushuka disciples when they reach Sandanwa level without losing the use of their arms in the process.",ep:18,g:51,l:80,wd:true,fm:true,w:10,an:12,e:[10,4,1,1,30,50,false,false],c:"CA>100&CV>70",p:16700};
I[7207] = {n:"Yondanwa Staff",t:4,d:"This Staff is normally used by Pandawushuka disciples when they reach Yondanwa level without losing the use of their arms in the process.",ep:18,g:52,l:93,wd:true,fm:true,w:10,an:12,tw:true,e:[5,4,1,1,50,50,false,false],c:"CS>250",p:22500};
I[7208] = {n:"Shodanwa Axe",t:19,d:"This Axe is used by Pandawushuka disciples when they reach the Nidanwa level. It makes short work of Bamboo Forests, including anything that may be hiding in the undergrowth.",ep:18,g:37,l:36,wd:true,fm:true,w:10,an:17,e:[5,6,1,1,50,50,false,false],p:3550};
I[7209] = {n:"Nidanwa Axe",t:19,d:"This Axe is used by Pandawushuka disciples when they reach the Nidanwa level. It makes short work of Bamboo Forests, including anything that may be hiding in the undergrowth.",ep:18,g:36,l:59,wd:true,fm:true,w:10,an:17,e:[5,6,1,1,50,50,false,false],c:"CS>100&CV>50",p:9000};
I[7210] = {n:"Sandanwa Axe",t:19,d:"This Axe is used by Pandawushuka disciples when they reach the Nidanwa level. It makes short work of Bamboo Forests, including anything that may be hiding in the undergrowth.",ep:18,g:35,l:83,wd:true,fm:true,w:10,an:17,e:[5,6,1,1,50,50,false,false],p:17800};
I[7211] = {n:"Yondanwa Axe",t:19,d:"This axe is used by Pandawushuka disciples when they reach the Yondawa level. It makes short work of Bamboo forests, including anything that may be hiding in the undergrowth.",ep:18,g:34,l:98,wd:true,fm:true,w:10,an:17,e:[5,5,1,1,50,50,false,false],c:"CI>150&CS>75&CV>85",p:24500};
I[7212] = {n:"Bamboo Slayer",t:19,d:"Equipped with this light and elegant Axe you\'ll be able to progress more easily through the Bamboo Forests of Pandala. It will serve as sufficient protection against the warlike Pandis who never get tired of attacking lone Lumberjacks who wander through their lands.",ep:18,g:33,l:26,wd:true,fm:true,w:10,an:17,e:[5,6,1,1,50,50,false,false],p:2000};
I[7213] = {n:"Splitting Shovel",t:8,d:"This Shovel is supposed to cut through the soil at an incredible speed. Those who know how to handle it usually split their enemies\' skulls open instead.",ep:19,g:41,l:142,wd:true,fm:true,w:15,an:16,tw:true,e:[10,5,1,1,40,70,false,false],c:"CC>400&CV>250",p:46050};
I[7214] = {n:"Cruella Sandals",t:11,d:"These Sandals belonged to the Macians, an Ouginak tribe, which became extinct. They were so close to the Pandawas that, as the generations passed by, their fur slowly changed colour. One day, they were all killed by a horrible woman who wanted to make a coat out of them.",ep:18,g:59,l:30,wd:true,fm:true,w:10,p:2650};
I[7215] = {n:"Siren Thong",t:11,d:"These thong sandals were formerly used by female Pandits to seduce lost adventurers and lure them into traps.",ep:19,g:60,l:121,wd:true,fm:true,w:20,p:37400};
I[7216] = {n:"Sandals Koholiks",t:11,d:"Those sandals are given to sick Pandawas for those special emergencies... we\'re talking the dreaded McSheth, which usually comes a knocking when they drink too much down at the Inn.",ep:18,g:61,l:58,wd:true,fm:true,w:10,p:8975};
I[7217] = {n:"Still Sandals",t:11,d:"Pandawas have always been attracted by alcoholic beverages. As time went by, they discovered how best to conserve and flavour them. These sandals were made especially for alcoholic Pandawas. They\'re ballasted at the sole so that you can keep your feet firmly on the ground, most of the time. Good for fighting, terrible for running away...",ep:19,g:62,l:159,wd:true,fm:true,w:50,p:50800};
I[7218] = {n:"Sandals Adin",t:11,d:"Adin was a young Pandawa who loved collecting lamps, but he was far from being a genius.",ep:18,g:63,l:76,wd:true,fm:true,w:15,p:14900};
I[7219] = {n:"Sandals Ailuya",t:11,d:"Those sandals were awarded to young Pandits at the end of religious rituals. Nowadays they are mainly used for tap-dancing championships.",ep:18,g:64,l:56,wd:true,fm:true,w:15,p:8200};
I[7220] = {n:"Lottery Ticket",t:15,d:"Between your fat little fingers you\'re greedily clutching a superb Lottery Ticket. Hold on to it. You might be the lucky winner at the great draw!",ep:1,g:717,l:2,wd:true,fm:true,w:1,p:1};
I[7221] = {n:"TanukouÃ¯ San Collar",t:1,d:"TanukouÃ¯ Sans wear this collar from early childhood. Given what these monsters are capable of, it\'s no wonder this jewellery is so valuable.",ep:19,g:92,l:152,wd:true,fm:true,w:10,p:49030};
I[7222] = {n:"Water Pandawushu Artefact",t:50,d:"This magic artefact is used by the Pandawushu disciples to enchant their equipment.",ep:1,g:104,l:1,wd:true,fm:true,w:1,p:1};
I[7223] = {n:"Air Pandawushu Artefact",t:50,d:"This magic artefact is used by the Pandawushu disciples to bewitch their equipment.",ep:18,g:105,l:1,wd:true,fm:true,w:1,p:1};
I[7224] = {n:"Earth Pandawushu Artefact",t:50,d:"This magic artefact is used by the Pandawushu disciples to enchant their equipment.",ep:18,g:106,l:1,wd:true,fm:true,w:1,p:1};
I[7225] = {n:"Fire Pandawushu Artefact",t:50,d:"This magic artefact is used by the Pandawushu disciples to enchant their equipment.",ep:18,g:107,l:1,wd:true,fm:true,w:1,p:1};
I[7226] = {n:"Akwadala Hat",t:16,d:"From a distance, you\'ll look like a Pandawushuka from the village of Akwadala with this hat on your head. Up close, you\'ll look like an idiot.",ep:18,g:146,l:43,wd:true,fm:true,w:2,s:34,p:5100};
I[7227] = {n:"Terrdala Hat",t:16,d:"From a distance, you\'ll look like a Pandawushuka from the village of Terrdala with this hat on your head. Up close, you\'ll look like an idiot.",ep:18,g:147,l:75,wd:true,fm:true,w:10,s:36,p:14575};
I[7228] = {n:"Feudala Hat",t:16,d:"From a distance, you\'ll look like a Pandawushuka from the village of Feudala with this hat on your head. Up close, you\'ll look like an idiot.",ep:18,g:145,l:98,wd:true,fm:true,w:20,s:37,p:24800};
I[7229] = {n:"Aerdala Hat",t:16,d:"From a distance, you\'ll look like a Pandawushuka from the village of Aerdala with this hat on your head. Up close, you\'ll look like an idiot.",ep:18,g:148,l:64,wd:true,fm:true,w:10,s:35,p:10100};
I[7230] = {n:"Akwadala Cloak",t:17,d:"This cloak comes from Akwadala. It can be used as a doormat or even as a floorcloth if you\'ve just come out of water.",ep:18,g:113,l:41,wd:true,fm:true,w:10,s:34,p:4550};
I[7231] = {n:"Terrdala Cloak",t:17,d:"This cloak comes from Terrdala Village. It can be used as a doormat or even as a towel if you\'ve just come out of the water.",ep:18,g:112,l:63,wd:true,fm:true,w:15,s:36,p:10305};
I[7232] = {n:"Feudala Cloak",t:17,d:"This cloak comes from Feudala. It can be used as a doormat or even as a towel if you\'ve just come out of the water.",ep:18,g:111,l:92,wd:true,fm:true,w:10,s:37,p:21750};
I[7233] = {n:"Aerdala Cloak",t:17,d:"This cloak comes from Aerdala. It can be used as a doormat or even as a floorcloth if you\'ve just come out of water.",ep:18,g:114,l:65,wd:true,fm:true,w:10,s:35,p:11200};
I[7234] = {n:"Swallowed Akwadala Shield",t:82,d:"This shield has seen a few battles too many, in this state it is good for nothing. Perhaps Bouwada, in Pandala village, could replace it for you.",ep:18,g:31,l:1,wd:false,fm:true,w:2,c:"BI=non Ã©quipable",p:5350};
I[7235] = {n:"Buried Terrdala Shield",t:82,d:"This shield has seen a few battles too many, in this state it is good for nothing. Perhaps Bouwada, in Pandala village, could replace it for you.",ep:18,g:32,l:1,wd:false,fm:true,w:10,c:"BI=non Ã©quipable",p:14100};
I[7236] = {n:"Burnt Feudala Shield",t:82,d:"This shield has seen a few battles too many, in this state it is good for nothing. Perhaps Bouwada, in Pandala village, could replace it for you.",ep:18,g:33,l:1,wd:false,fm:true,w:15,c:"BI=non Ã©quipable",p:27100};
