I[7242] = {n:"Akwadala Geta",t:11,d:"These wooden Getas were made by the best shoemakers of the village of Akwadala. Since they\'re quite open, your warts will be able to take a breath of fresh air and enjoy the landscape.",ep:18,g:54,l:35,wd:true,fm:true,w:10,s:34,p:3350};
I[7243] = {n:"Terrdala Geta",t:11,d:"These wooden Getas were made by the best shoemakers in the village of Terrdala. Let your warts take a breath of fresh air and enjoy the landscape.",ep:18,g:55,l:76,wd:true,fm:true,w:15,s:36,p:15000};
