I[7246] = {n:"Akwadala Wedding Ring",t:9,d:"This Wedding Ring comes from the village of Akwadala. More likely to be a lucky charm than a magic relic, you\'ll still be able to make your friends believe you found your soul mate.",ep:1,g:80,l:37,wd:true,fm:true,w:2,s:34,p:3800};
