I[7250] = {n:"Akwadala Amulet",t:1,d:"The only people allowed to wear this amulet were the inhabitants of the village of Akwadala, as it was considered to be one of the most important parts of their traditional costume. Seen close up, you have to ask yourself why.",ep:18,g:79,l:41,wd:true,fm:true,w:2,s:34,p:5050};
I[7251] = {n:"Amulet Terrdala",t:1,d:"The only people allowed to wear this amulet were the inhabitants of the village of Terrdala, as it was considered to be one of the most important parts of their traditional costume. Seen close up, you have to ask yourself why.",ep:18,g:80,l:80,wd:true,fm:true,w:10,s:36,p:16550};
I[7252] = {n:"Feudala Amulet",t:1,d:"The only people allowed to wear this amulet were the inhabitants of the village of Feudala, as it was considered to be one of the most important parts of their traditional costume. Seen close up, you have to ask yourself why.",ep:18,g:81,l:91,wd:true,fm:true,w:10,s:37,p:21225};
I[7253] = {n:"Aerdala Amulet",t:1,d:"The only people allowed to wear this amulet were the inhabitants of the village of Aerdala, as it was considered to be one of the most important parts of their traditional costume. Seen close up, you have to ask yourself why.",ep:18,g:82,l:62,wd:true,fm:true,w:10,s:35,p:10000};
I[7254] = {n:"Akwadala Staff",t:4,d:"This staff was used to give young boisterous Pandawa a trashing. Three raps on the knuckles, fifteen lashes across the back, sixty blows to the head, two pokes in the eyes, that would be enough to calm them down a bit.",ep:18,g:61,l:43,wd:true,fm:true,w:15,an:12,e:[5,3,1,1,50,50,false,false],c:"CC>50",s:34,p:5040};
I[7255] = {n:"Axe Terrdala",t:19,d:"This axe, from the very beginning, was designed to cut living beings. Be careful! A single miscalculation and you could be cut in half!",ep:18,g:32,l:83,wd:true,fm:true,w:10,an:17,e:[5,6,1,1,50,50,false,false],s:36,p:17635};
I[7256] = {n:"Aerdala Daggers",t:5,d:"As sharp as Moowolf claws, these daggers will turn you into a perfect apprentice assassin.",ep:18,g:51,l:62,wd:true,fm:true,w:10,an:13,e:[10,3,1,1,30,50,false,false],c:"CA>150&CS>50",s:35,p:10105};
I[7257] = {n:"Feudala Sabre",t:6,d:"This Sabre was forged by Hotari Honza himself. It\'s said to be one of his last creations before he took an intensive cooking course and became a chef. A collector\'s item for sure!",ep:18,g:64,l:76,wd:true,fm:true,w:1,an:14,e:[5,6,1,1,50,50,false,false],c:"CI>200&CA>60",s:37,p:14900};
I[7258] = {n:"Pandikaze Hairs",t:54,d:"These extremely thin hairs seem to have been pulled out of the rump of a female Sadida, but don\'t be mistaken, they haven\'t.",ep:16,g:556,l:40,wd:true,fm:true,w:1,p:10};
I[7259] = {n:"Pandikaze Fabric",t:55,d:"This heap of hairs is almost intact despite the punishment you must have inflicted on this poor Pandikaze Ghost to pull it out.",ep:18,g:124,l:40,wd:true,fm:true,w:1,p:10};
I[7260] = {n:"Pandikaze Skin",t:59,d:"This skin is still slightly covered by a down as smooth as that on the armpit of an Eniripsa but.. without the sweaty smell.",ep:18,g:40,l:40,wd:true,fm:true,w:2,p:10};
I[7261] = {n:"Magic Bamboo Wood",t:38,d:"This amazing magic piece of Bamboo can move. A tribal legend says that every night it wanders round the village and knocks on the doors of people who abandon themselves to nightly pleasures. Pandawas often chain their Magic Bamboo before going to bed to prevent all kind of disappointments.",ep:18,g:670,l:220,wd:true,fm:true,w:5,p:20};
I[7262] = {n:"Bulbiflor Root",t:98,d:"This Bulbiflor Root is not like other roots. It can be chewed for ages and you won\'t lose your teeth. Be careful though, unlike real sweets, it tastes awful!",ep:18,g:142,l:26,wd:true,fm:true,w:2,p:20};
I[7263] = {n:"Bulbush Root",t:98,d:"This Bulbush Root is not like other roots. It can be chewed for ages and you won\'t lose your teeth. Be careful though, unlike real sweets, it tastes awful!",ep:18,g:143,l:42,wd:true,fm:true,w:2,p:20};
I[7264] = {n:"Bulbamboo Root",t:98,d:"This Bulbamboo Root is not like other roots. It can be chewed for ages and you won\'t lose your teeth. Be careful though, unlike real sweets, it tastes awful!",ep:18,g:145,l:67,wd:true,fm:true,w:2,p:20};
I[7265] = {n:"Bulbig Root",t:98,d:"This Bulbig Root is not like other roots, well, apart from Bulbiflor Roots, Bulbush Roots and Bulbamboo Roots, that is. Like them, it can be chewed for ages and you won\'t lose your teeth. Be careful though, unlike real sweets, it tastes awful! I think you knew that already, though.",ep:18,g:144,l:150,wd:true,fm:true,w:2,p:20};
I[7266] = {n:"Bulbiflor Flower",t:35,d:"This flower only grows on the head of the Bulbiflor, so don\'t try putting on yours... the substrate is not rich enough.",ep:18,g:119,l:26,wd:true,fm:true,w:1,p:10};
I[7267] = {n:"Bulbush Leaf",t:36,d:"These leaves only grow in one place, on the heads of Bulbush, so do not attempt to grow one on your own head, it would fade very quickly.",ep:18,g:55,l:42,wd:true,fm:true,w:2,p:10};
I[7268] = {n:"Bulbamboo Shoot",t:36,d:"This shoot can grow on the head of the of the Bulbamboo. Don\'t try putting it on your head, it wouldn\'t find anything to eat there.",ep:18,g:56,l:67,wd:true,fm:true,w:2,p:10};
I[7269] = {n:"Bulbig Magic Bark",t:96,d:"This magic bark is as resistant as a Captain Amakna Shield. It\'s not half as beautiful though...",ep:18,g:105,l:150,wd:true,fm:true,w:2,p:10};
I[7270] = {n:"Bulbiflor Magic Bark",t:96,d:"This bark is so thin and fragile that it could be used to make naughty lace underwear.",ep:18,g:106,l:26,wd:true,fm:true,w:2,p:10};
I[7271] = {n:"Bulbush Magic Bark",t:96,d:"This gnarled bark is perfect for non-slip soles.",ep:18,g:107,l:42,wd:true,fm:true,w:2,p:10};
I[7272] = {n:"Magical Bulbamboo Bark",t:96,d:"This smooth bark is perfect for making dance floors.",ep:18,g:108,l:67,wd:true,fm:true,w:2,p:10};
I[7273] = {n:"Grass Snake Skin",t:59,d:"This skin will slip through your fingers more than any other skin would. Don\'t make shoes from this skin, you mightn\'t be able to take them off!",ep:18,g:41,l:67,wd:true,fm:true,w:2,p:10};
I[7274] = {n:"Magic Grass Snake Tooth",t:47,d:"This tooth is different from the rest. Its smell is just awful, as if the breath of the Grass Snake had soaked into it over time.",ep:18,g:16,l:67,wd:true,fm:true,w:2,p:100};
I[7275] = {n:"Kitsou Nae Hairs",t:54,d:"Those Kitsou Nae\'s hairs are as soft as the rump of a female Trool. Something which can remind you of good memories...",ep:16,g:560,l:29,wd:true,fm:true,w:1,p:10};
I[7276] = {n:"Kitsou Nufeu Hairs",t:54,d:"These hairs are as soft as the rump of a female Trool, and remind you of some great nights in the Cania plains.",ep:18,g:557,l:111,wd:true,fm:true,w:1,p:10};
I[7277] = {n:"Kitsou Nere Hairs",t:54,d:"Those Kitsou Nae\'s hairs are as soft as the rump of a female Trool. Something which can remind you of good memories...",ep:16,g:558,l:80,wd:true,fm:true,w:1,p:10};
I[7278] = {n:"Kitsou Nakwa Hairs",t:54,d:"Those Kitsou Nae\'s hairs are as soft as the rump of a female Trool. Something which can remind you of good memories...",ep:1,g:559,l:60,wd:true,fm:true,w:1,p:10};
I[7279] = {n:"Kitsou Nae Skin",t:59,d:"This top quality skin can be cut into thin strips to make a really efficient whip. The ideal gift for parents of boisterous and insolent kids.",ep:18,g:46,l:19,wd:true,fm:true,w:2,p:10};
I[7280] = {n:"Kitsou Nufeu Skin",t:59,d:"This top quality skin can be cut into thin strips to make a really efficient whip. The ideal gift for parents of boisterous and insolent kids.",ep:18,g:44,l:111,wd:true,fm:true,w:2,p:10};
I[7281] = {n:"Kitsou Nere Skin",t:59,d:"This top quality skin can be cut into thin strips to make a really efficient whip. The ideal gift for parents of boisterous and insolent children.",ep:18,g:45,l:80,wd:true,fm:true,w:2,p:10};
I[7282] = {n:"Kitsou Nakwa Skin",t:59,d:"This top quality skin can be cut into thin strips to make a really efficient whip. The ideal gift for parents of boisterous and insolent kids.",ep:1,g:43,l:60,wd:true,fm:true,w:2,p:10};
I[7283] = {n:"TanukouÃ¯ San Skin",t:59,d:"This thick, stretched TanukouÃ¯ San skin would make a perfect purse for your Kamas",ep:1,g:2,l:85,wd:true,fm:true,w:2,p:100};
I[7284] = {n:"TanukouÃ¯ San Hairs",t:54,d:"These TanukouÃ¯ San hairs stink but who cares! They\'re the hairs of a TanukouÃ¯ San!",ep:1,g:3,l:85,wd:true,fm:true,w:2,p:100};
I[7285] = {n:"Araknawa Leg",t:103,d:"This small leg will keep wriggling a long time after you pull it out of an Araknawa\'s body. Put it in your enemies\' pants to unsettle them during fights - that way you\'ll win easily.",ep:18,g:716,l:43,wd:true,fm:true,w:2,p:100};
I[7286] = {n:"Bambooto Wood",t:38,d:"Bambooto Wood is almost as expensive as Wobbly Wood yet it\'s a lot more common. It doesn\'t make sense, does it?",ep:18,g:675,l:47,wd:true,fm:true,w:2,p:100};
I[7287] = {n:"Bambooto Leaf",t:36,d:"Bambooto leaves are quite thick and large, a bit like the female Bwork except less aggressive.",ep:18,g:69,l:47,wd:true,fm:true,w:2,p:1};
I[7288] = {n:"Holy Bambooto Leaf",t:36,d:"This big leaf is so hard and heavy that it could squash you alive if you happened to fall asleep under a Holy Bambooto in autumn.",ep:18,g:68,l:120,wd:true,fm:true,w:2,p:100};
I[7289] = {n:"Holy Bambooto Wood",t:38,d:"You must be careful with this wood. Not everyone should have it in their hands. But no one knows why.",ep:18,g:674,l:120,wd:true,fm:true,w:10,p:100};
I[7290] = {n:"Magic Bambooto Root",t:98,d:"This root allows the Bambooto to draw its magic from the soil before a fight.",ep:18,g:100,l:20,wd:true,fm:true,w:2,p:10};
I[7291] = {n:"Magic Holy Bambooto Root",t:98,d:"This root allows the Holy Bambooto to draw its magic from the soil before a fight.",ep:18,g:99,l:87,wd:true,fm:true,w:2,p:100};
I[7292] = {n:"Maho Firefoux Hairs",t:54,d:"These hairs come from a Maho Firefoux. The creature looks like something from a Bwork\'s nightmare, but don\'t judge a book by its cover - it\'s about as deadly as a book, in fact.",ep:18,g:202,l:150,wd:true,fm:true,w:2,p:1};
I[7293] = {n:"Soryo Firefoux Hairs",t:54,d:"These hairs were ripped off the back of a horrible red creature.",ep:18,g:203,l:130,wd:true,fm:true,w:10,p:1};
I[7294] = {n:"Yokai Firefoux Hairs",t:54,d:"These thick and stinky hairs were ripped off the back of a horrible red creature.",ep:18,g:204,l:110,wd:true,fm:true,w:10,p:10};
I[7295] = {n:"Pandora Hairs",t:54,d:"These mysterious hairs aid the sewing of magical hats and capes with surprising magic effects.",ep:18,g:2,l:200,wd:true,fm:true,w:10,p:200};
I[7297] = {n:"Pandulum Hairs",t:54,d:"These little magic hairs are strong enough to bring a broken clock back to life.",ep:18,g:206,l:150,wd:true,fm:true,w:1,p:1};
I[7298] = {n:"Maho Firefoux Skin",t:59,d:"This thin, smooth skin offers excellent protection against the various magic attacks that the Maho Firefoux faces when his own spells backfire.",ep:18,g:42,l:150,wd:true,fm:true,w:1,p:100};
I[7299] = {n:"Soryo Firefoux Skin",t:59,d:"In times gone by, people used this to make underwear for children with sensitive skin. Soryo Firefoux Skin underwear has been approved by Captain Chafer\'s descendants.",ep:18,g:38,l:130,wd:true,fm:true,w:1,p:100};
I[7300] = {n:"Yokai Firefoux Skin",t:59,d:"This thick skin is a good protection against bamboo blows.",ep:18,g:37,l:110,wd:true,fm:true,w:1,p:100};
I[7301] = {n:"Leopardo Skin",t:59,d:"This skin was used by Pandawa to make light and minimalist underwear.",ep:18,g:36,l:40,wd:true,fm:true,w:1,p:10};
I[7302] = {n:"Pandora Skin",t:59,d:"If you\'re a shoemaker, Pandora Skin has more than one surprise in store for you.",ep:18,g:1,l:200,wd:true,fm:true,w:10,p:100};
I[7303] = {n:"Pandulum Skin",t:59,d:"The colour of this rough skin regularly changes, but no one knows why.",ep:18,g:39,l:100,wd:true,fm:true,w:1,p:10};
I[7304] = {n:"Maho Firefoux Fabric",t:55,d:"This red fabric has a magic power. I would be glad to say the same about you, but...",ep:18,g:11,l:150,wd:true,fm:true,w:1,p:100};
I[7305] = {n:"Soryo Firefoux Fabric",t:55,d:"This medium size fabric can be used to plug the holes under old doors when Winter comes.",ep:18,g:10,l:130,wd:true,fm:true,w:1,p:10};
I[7306] = {n:"Yokai Firefoux Fabric",t:55,d:"This fabric comes from the most sensitive parts of the Yokai Firefoux Ghost... these also happen to be the smelliest parts too. And no, I\'m not talking about his moustache.",ep:18,g:9,l:110,wd:true,fm:true,w:1,p:10};
I[7307] = {n:"Pandora Fabric",t:55,d:"This fabric is almost as rare as a pleasant surprise from a Pandora\'s box.",ep:18,g:125,l:200,wd:true,fm:true,w:10,p:10};
I[7308] = {n:"Pandulum Fabric",t:55,d:"This Fabric is not edible, despite what people say. The last person who tried to cook it ended up as a TanukouÃ¯ San. Quite a stroke of luck, really!",ep:18,g:12,l:100,wd:true,fm:true,w:1,p:10};
I[7309] = {n:"Pandikaze Key",t:84,d:"This key enables you to enter the Pandikaze Dungeon. Be careful, it will self-destruct after use.",ep:13,g:229,l:1,wd:true,fm:true,w:1,p:100};
I[7310] = {n:"Bulb Cavern Key",t:84,d:"With this key, you can gain access to the Bulb Cavern. Be careful, it will self-destruct after use.",ep:1,g:230,l:1,wd:true,fm:true,w:1,p:100};
I[7311] = {n:"Kitsou Dungeon Key",t:84,d:"With this key, you can enter the Kitsou Dungeon. Be careful, it will self-destruct after use.",ep:1,g:231,l:1,wd:true,fm:true,w:1,p:100};
I[7312] = {n:"Firefoux Dungeon Key",t:84,d:"With this key you can enter the Firefoux Dungeon. Be careful, it will self-destruct after use.",ep:2,g:232,l:1,wd:true,fm:true,w:1,p:100};
I[7313] = {n:"The Pandawushu Art",t:25,d:"Every practicing Pandawushu should know this book by heart...",ep:18,g:19,l:1,wd:true,fm:true,w:2,u:true,p:1};
