I[7368] = {n:"Star Wand",t:3,d:"The designer of this wand kept forgetting to pick his kids up at school. Conscious of his absent-mindedness, he sculpted a wand that would come to life everyday and remind him to pick his kids up. After a while, he kept thinking the wand was waking him up to remind him to go to the bathroom. His children were taken away from him not long after.",ep:19,g:55,l:126,wd:true,fm:true,w:15,an:11,e:[5,4,2,4,50,50,false,true],c:"CS>100&CV>150&CI>300",p:39355};
I[7369] = {n:"Bambooto Amber",t:50,d:"This Amber is usually hung on top of the Bambooto. It is mainly decorative, but it can be dangerous if the Bambooto decides to fall on you, for example. What a clever creature!",ep:18,g:2,l:40,wd:true,fm:true,w:2,p:100};
I[7370] = {n:"Holy Bambooto Amber",t:50,d:"This amber is the Holy Bambooto\'s sole treasure. That might explain why it\'s so bitter and mean to the tourists who venture on Pandala island.",ep:18,g:1,l:120,wd:true,fm:true,w:2,p:100};
