I[7379] = {n:"Pandikaze Ghost Fabric",t:55,d:"This heap of hairs is almost intact despite the punishment you must have inflicted on this poor Pandikaze Ghost to pull it out.",ep:19,g:4,l:100,wd:true,fm:true,w:1,p:10};
I[7380] = {n:"Maho Firefoux Ghost Fabric",t:55,d:"This red-coloured magic fabric is impregnated with an ultra-powerful magic. Not quite a feature you share!",ep:19,g:1,l:100,wd:true,fm:true,w:1,p:10};
I[7381] = {n:"Soryo Firefoux Ghost Fabric",t:55,d:"This medium size fabric can be used to plug the holes under old doors when Winter comes.",ep:19,g:2,l:100,wd:true,fm:true,w:1,p:10};
I[7382] = {n:"Leopardo Ghost Fabric",t:55,d:"This fabric is not as soft as the Leopardo\'s music but it should still be useful. For what? That\'s the real question...",ep:19,g:7,l:100,wd:true,fm:true,w:1,p:10};
I[7383] = {n:"Yokai Firefoux Ghost Fabric",t:55,d:"This fabric comes from the most sensitive parts of the Yokai Firefoux Ghost... these also happen to be the smelliest parts too. And no, I\'m not talking about his moustache.",ep:19,g:3,l:100,wd:true,fm:true,w:1,p:10};
I[7384] = {n:"Pandulum Ghost Fabric",t:55,d:"Contrary to vicious rumour, this fabric is not edible. The last ones who tried to cook it were turned into TanukouÃ¯ San. Quite a stroke of luck for some of them!",ep:19,g:5,l:100,wd:true,fm:true,w:1,p:10};
I[7385] = {n:"TanukouÃ¯ San Ghost Fabric",t:55,d:"This fabric comes from the armpits of the TanukouÃ¯ San Ghost, famous for their softness and their smell, which resemble that of rotting Crow meat... and that\'s a best case scenario.",ep:19,g:6,l:100,wd:true,fm:true,w:1,p:10};
I[7386] = {n:"TanukouÃ¯ San Testicles",t:15,d:"These humongous testicles are covered with a very soft down which works wonders in resisting magic attacks as well as the self harm TanukouÃ¯ San causes himself when summoning a Tanuki Chan. In any case, what you\'re holding in your hands is something!",ep:1,g:2,l:120,wd:true,fm:true,w:200,p:10};
I[7387] = {n:"The Mercenary Clan",t:25,d:"Find out everything there is to know about the Mercenaries! This work was written by the clan\'s founder and Grand Master.",ep:1,g:19,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[7388] = {n:"Skill Loss Potion: Axe",t:45,d:"With this potion, you will forget some of your Axe Skills.",ep:3,g:2,l:1,wd:true,fm:true,w:1,u:true,p:1000};
