I[7399] = {n:"Tough",t:29,d:"This blessing will increase Earth resistance for your next few fights.",ep:18,g:7,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[7400] = {n:"Tied Scroll",t:87,d:"This Scroll enables you to locate your target so that you can hunt it down.",ep:1,g:2,l:10,wd:false,fm:true,w:1,c:"Ps!0&PP>0",u:true,p:1};
I[7401] = {n:"Virgin Scroll",t:87,d:"This Scroll enables you to " + "\"" + "mark" + "\"" + " a target so that you can hunt it down.",ep:16,g:1,l:10,wd:false,fm:true,w:1,c:"Ps!0&PP>0",u:true,ut:true,p:100};
I[7402] = {n:"Pack of Ten Virgin Scrolls",t:87,d:"With this Pack you\'ll be able to " + "\"" + "mark" + "\"" + " <b>one single target</b> that you\'ll be able to hunt down many times.",ep:16,g:3,l:10,wd:false,fm:true,w:10,c:"Ps!0&PP>0",u:true,ut:true,p:500};
I[7403] = {n:"Leopardo Ghost Bone",t:47,d:"The Imps once used this small pointy bone as a nasal decoration. An elegant way to enhance a hooked nose, for instance.",ep:19,g:3,l:100,wd:true,fm:true,w:1,p:10};
I[7404] = {n:"Maho Firefoux Ghost Bone",t:47,d:"This bone is still imbued with a magic that can best be described as \'home-made\', so do not be surprised if it comes back to life and tries to find the remains of its owner.",ep:19,g:8,l:100,wd:true,fm:true,w:1,p:10};
I[7405] = {n:"Pandikaze Ghost Bone",t:47,d:"This bone is the only thing left from the ghost you\'ve just exterminated. Bad luck for you, it doesn\'t seem to have any magic.",ep:19,g:4,l:100,wd:true,fm:true,w:1,p:10};
I[7406] = {n:"Pandora Ghost Bone",t:47,d:"This bone hasn\'t come out of the Pandora\'s Box... yet, we have every reason to believe it has.",ep:19,g:5,l:100,wd:true,fm:true,w:1,p:10};
I[7407] = {n:"Pandulum Ghost Bone",t:47,d:"Finely carved, this bone can be used as a hand for a giant clock. Just essential.",ep:19,g:6,l:100,wd:true,fm:true,w:1,p:10};
I[7408] = {n:"Soryo Firefoux Ghost Bone",t:47,d:"The first time the Soryo Firefoux broke a bone, he tried to take his revenge on the first man that came along. At that very moment, Jon Lemon, minstrel by trade, was walking and singing when he came across the Soryo Firefoux. No one knows what happened next. The only thing that could be noticed afterwards was that his voice had become even more high-pitched.",ep:19,g:7,l:100,wd:true,fm:true,w:1,p:10};
I[7410] = {n:"TanukouÃ¯ San Ghost Bone",t:47,d:"By dint of bearing the immeasurable weight of their humongous testicles, the bones of the TanukouÃ¯ San ended up being extremely tough.",ep:19,g:1,l:100,wd:true,fm:true,w:1,p:10};
I[7411] = {n:"Yokai Firefoux Ghost Bone",t:47,d:"This bone could have been used to crack cheeky adventurers\' skulls open, or to drive Enutrofs into the ground like asparagus. But now it\'s in your hands, its destiny risks being a little more modest.",ep:19,g:2,l:100,wd:true,fm:true,w:1,p:10};
I[7412] = {n:"Pack of a Hundred Virgin Scrolls",t:87,d:"With this Pack you\'ll be able to " + "\"" + "mark" + "\"" + " <b>one single target</b> that you\'ll be able to hunt down many times.",ep:16,g:3,l:10,wd:false,fm:true,w:100,c:"Ps!0&PP>0",u:true,ut:true,p:3500};
I[7413] = {n:"Emote Scroll: Point Your Finger",t:25,d:"(Double click to learn this emote)\nWith this scroll you\'ll be able to " + "\"" + "Point your finger" + "\"" + " either to show the way or to denounce cheaters.",ep:18,g:9,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7414] = {n:"Little White Bow Meow",t:18,d:"This fluffy ball of hair scratches, bites, and pinches everything that comes close, including the hand that feeds it! It\'s a terrifying yet irresistibly likeable and fascinating creature. Be careful, not only is this creature quick-tempered but it\'s also quite picky about its diet. It only eats fresh meat from hunted creatures.",ep:3,g:9,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7415] = {n:"Little Black Bow Wow",t:18,d:"This odd little creature only eats fresh fish. But don\'t worry, its wholesome company more than makes up for the dehydrated-fish breath.",ep:3,g:10,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7417] = {n:"Bow Kennel Certificate: Peki Peki",t:77,d:"This Certificate describes the characteristics of the Peki Peki you\'ve  put in the Bow Kennel.",ep:3,g:26,l:1,wd:false,fm:true,w:1,p:100};
I[7418] = {n:"Bow Kennel Certificate: Little White Bow Meow",t:77,d:"This Certificate describes the characteristics of the Bow Meow you\'ve  put in the Bow Kennel.",ep:3,g:27,l:1,wd:false,fm:true,w:1,p:100};
I[7419] = {n:"Bow Kennel Certificate: Little Black Bow Wow",t:77,d:"This Certificate describes the characteristics of the Bow Wow you\'ve  put in the Bow Kennel.",ep:3,g:28,l:1,wd:false,fm:true,w:1,p:100};
I[7420] = {n:"Bow Kennel Certificate: Nomoon",t:77,d:"This Certificate describes the characteristics of the Nomoon you\'ve  put in the Bow Kennel.",ep:3,g:35,l:1,wd:false,fm:true,w:1,p:100};
I[7421] = {n:"Unlearning Potion for Profession: Shield Smith",t:44,d:"This Potion will make you unlearn the profession of Shield Smith.",ep:18,g:3,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[7422] = {n:"Pineapple Mask",t:16,d:"This exotic, fruit-shaped Mask is a real collector\'s item. It has absolutely no use but you\'ll look pretty original and tasty. People appreciate the effort.",ep:1,g:117,l:1,wd:true,fm:true,w:1,s:74,p:10};
I[7423] = {n:"Golden Larva Egg",t:12,d:"As strange as it may seem, these Golden Larva Eggs are not laid by Golden Larvae but by more common sorts -  green, orange or even blue. Nature is full of disappointing surprises.",ep:1,g:715,l:10,wd:true,fm:true,w:1,u:true,p:1};
I[7425] = {n:"Little Golden Larva",t:32,d:"This larva has just hatched. As its very first image of the world was your face, it considers you as its mother.",ep:1,g:5,l:1,wd:true,fm:true,w:10,m:true,p:1};
