I[7493] = {n:"Jewelmagus\' Setter",t:5,d:"This Setter will make the jewels you\'ve created even more dazzling.",ep:2,g:52,l:1,wd:true,fm:true,w:15,an:13,e:[5,6,1,1,40,40,false,false],c:"PJ=63",p:1000};
