I[7495] = {n:"Shoemagus Leather Cutter",t:5,d:"This magic Leather Cutter will enable you to cut leather and scrape skins better. It\'s an ideal tool to improve old boots and belts.",ep:2,g:53,l:1,wd:true,fm:true,w:15,an:13,e:[5,6,1,1,40,40,false,false],c:"PJ=62",p:1000};
I[7496] = {n:"Mass Resurrection Potion",t:14,d:"This potion enables you to resurrect all the allies present around you.",ep:0,g:60,l:1,wd:false,fm:true,w:1,c:"Pg>23,4",u:true,p:10};
I[7497] = {n:"Mass Liberation Potion",t:14,d:"This potion enables you to free the souls of your enemies to send them directly to their cemetery, without giving them a chance to be resurrected.",ep:0,g:59,l:1,wd:false,fm:true,w:1,c:"Pg>23,4",u:true,p:10};
I[7498] = {n:"Small Mass Healing Potion",t:14,d:"This potion enables you to heal all allies present on the map.",ep:0,g:58,l:1,wd:true,fm:true,w:1,c:"Pg>23,2",u:true,p:10};
I[7499] = {n:"Village Potion: Ice Kwak Village",t:12,d:"This potion enables you to teleport to the Ice Kwak Village, if you happen to own it.",ep:0,g:5,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7500] = {n:"Village Potion: Fire Kwak Village",t:12,d:"This potion enables you to teleport to the Fire Kwak Village, if you happen to own it.",ep:0,g:4,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7501] = {n:"Village Potion: Wind Kwak Village",t:12,d:"This potion enables you to teleport to the Wind Kwak Village, if you happen to own it.",ep:0,g:6,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7502] = {n:"Rallying Potion",t:12,d:"This Potion allows you to create a rallying point so that aligned adventurers can join you for either the attack or protection of a village. This magic potion also allows you to save the position of anyone who joined you so they can return to their starting point quickly.",ep:0,g:21,l:1,wd:false,fm:true,w:1,p:1};
I[7505] = {n:"Unlearning Potion for Profession: Costumagus",t:44,d:"This Potion will make you unlearn the profession of Costumagus.",ep:9,g:4,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[7506] = {n:"Unlearning Potion for Profession: Jewelmagus",t:44,d:"This Potion will make you unlearn the profession of Settmagus.",ep:2,g:15,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[7507] = {n:"Unlearning Potion for Profession: Shoemagus",t:44,d:"This Potion will make you unlearn the profession of Shoemagus.",ep:2,g:7,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[7508] = {n:"Signature Rune",t:50,d:"This rune allows the best craftsmen to put their signature on their creations. \n(To be used along with the ingredients when crafting items.)",ep:18,g:37,l:1,wd:true,fm:true,w:1,p:1};
I[7509] = {n:"First part of the Dragon Pig Maze Key",t:84,d:"If this snout doesn\'t appeal to you, don\'t try to make something out of it. You\'ll get slapped all the way home.",ep:13,g:1,l:1,wd:true,fm:true,w:1,p:100};
I[7510] = {n:"Second part of the Dragon Pig Maze Key",t:84,d:"This might be part of the key which opens the treasure chest you\'ve always dreamt of. It may also be the key to your grave.",ep:13,g:2,l:1,wd:true,fm:true,w:1,p:100};
I[7511] = {n:"Dragon Pig Maze Key",t:84,d:"If you think this key will attract your dirty pig-friends, you really haven\'t got it... The only thing it will do is open is the den of the Dragon Pig. \nBe careful, it self-destructs after use.",ep:13,g:3,l:1,wd:true,fm:true,w:1,p:100};
I[7512] = {n:"Porcine Spirit",t:24,d:"This trophy proves your love for pigs. Scrub yourself down with boiling water before going home in the evening, unless you want to sleep with the Gobballs.",ep:1,g:0,l:1,wd:false,fm:true,w:0,p:1};
I[7513] = {n:"Sandal Titude",t:11,d:"Titude, a modest Enutrof Shoemaker, was even smaller than a Xelor. Legend says he created these sandals to be able to kiss his lady-love, a legless Eniripsa, on the lips.",ep:20,g:67,l:122,wd:true,fm:true,w:10,p:37800};
I[7514] = {n:"Harry Boots",t:11,d:"Harry was an old wise man who spent his days fishing on the docks of Sufokia. His great moustache made him look like Danous Kwaide, famous actor of a theatre company that used to play at the Amakna Tavern. All this was only a prelude to incredible beer and meat ball orgies.",ep:20,g:70,l:123,wd:true,fm:true,w:10,p:37850};
I[7515] = {n:"Cape Tenfuture",t:17,d:"This cape doesn\'t come from your Galaxy but it seems to match the colour of your Gobbly-wool fishnet stockings all the same.",ep:20,g:92,l:148,wd:true,fm:true,w:10,p:47925};
I[7516] = {n:"Bimd\'Oule Hat",t:16,d:"It was an old unlucky bitter Enutrof who first discovered this terrible hat, hidden at the bottom of an alcove in the Bimd\'Oule caves. Later, the Enutrof exiled himself far away from the Amakna lands to escape boredom and discover new horizons. Legend tells that he comes back to his native land once a century to make fun of his old friends... but we all know he\'s a bit nostalgic.",ep:20,g:121,l:110,wd:true,fm:true,w:10,p:31675};
I[7517] = {n:"Ripate Beer",t:37,d:"This beer is so acidic it can hardly be drunk. Indeed, the acidity gives the pint the life shelf-life of an overweight Moskito...",ep:7,g:4,l:1,wd:false,fm:true,w:1,u:true,p:5};
I[7518] = {n:"Ghast",t:18,d:"This surprising creature comes from the afterlife and is not willing to go back there, unless it takes you with it...",ep:3,g:13,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7519] = {n:"Pink Dragoone",t:18,d:"This little dragon\'s skin is as pink as a female Bwork\'s backside, making it a risk-free and cheap way to fantasize in a private corner or to remind yourself of all those happy memories. This dragon isn\'t just the object of your fantasies though, it\'s also a very powerful and wise creature. However, you must be careful, as its hunger for other pets is as great as a Chafer\'s perversion during a full moon.",ep:3,g:14,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7520] = {n:"Croum",t:18,d:"A retired toy soldier, this metal creature suddenly came to life one day. It will follow you everywhere you go, risking its life to save yours. All you have to do in return is feed the little guy. This doesn\'t mean he\'ll fight your fights for you, though... he\'ll never replace those naive Astrubian adventurers!",ep:3,g:15,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7521] = {n:"Ghast Gift",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7522] = {n:"Minimino",t:18,d:"Tamed and cleaned, this baby Minimino can be fed and petted without the loss of fingers, hands or elbow bones. You should remain careful though, as sometimes nature can reclaim control of its tamed manners. There is nothing worse than a Minimino being itself. To be safe, feed it only very rarely and beat it regularly with... well anything hard. Just treat him like you would your own child and everything might be fine.",ep:3,g:21,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7523] = {n:"Ginger Bow Meowette",t:18,d:"No tomcat can resist this lovely ginger creature... not even the most happily married of them!\n(THIS LEGENDARY PET DOES NOT NEED TO EAT).",ep:1,g:40,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7524] = {n:"Tabby Bow Meow",t:18,d:"This surprising creature is the result of crossbreeding between a White Bow Meow and a Black Bow Meow. It only eats fish.",ep:3,g:41,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7525] = {n:"Gift: Pink Dragoone",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7526] = {n:"Gift: Croum",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders. \n(WARNING: this gift is very heavy. You might be overweight when you open it. Remember to take your heavy items off, or to ask a friend to help you.)",ep:1,g:42,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7527] = {n:"Gift: Minimino",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7528] = {n:"How to raise your Ghast",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise a Ghast.",ep:3,g:10,l:1,wd:false,fm:true,w:1,u:true,p:200};
