I[7552] = {n:"Turkocape",t:17,d:"Sometimes, when true love joins a warrior and a Dragoturkey, weird things can happen. This cape proves it since there are Dragoturkey wings sewn on it. The Dragoturkey sacrificed itself for the making of this cape offered to the famous minstrel Pol Akartney on their wedding day. Apparently Jon Lemon even wrote a song about it.",ep:2,g:90,l:50,wd:true,fm:true,w:5,s:42,p:25000};
I[7553] = {n:"Turkohat",t:16,d:"If you ever dreamt of looking like a turkey, this is your chance! However, if you want to remain healthy, we advise you not to wear this hat on the streets of Amakna during the Christmas season.",ep:2,g:118,l:50,wd:true,fm:true,w:10,s:42,p:15000};
I[7554] = {n:"Turkoboots",t:11,d:"Your friends are definitely going to be jealous. Those boots will take you all the way to the ambassador\'s party for one of those wonderful little golden chocolates.",ep:2,g:65,l:50,wd:true,fm:true,w:3,s:42,p:5000};
I[7555] = {n:"Turkoring",t:9,d:"Gobble, gobble.",ep:2,g:97,l:50,wd:true,fm:true,w:1,s:42,p:1000};
I[7556] = {n:"Gift: Turko",t:89,d:"This Gift Box contains one part of a famous costume. It will surely make your Dragoturkey friends jealous.",ep:1,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7557] = {n:"Treechnid Dungeon Key",t:84,d:"This key made of Treechnid bark could take root in any warm and humid microsystem. Like a Bwork\'s crotch for example.",ep:1,g:4,l:1,wd:true,fm:true,w:1,p:100};
I[7558] = {n:"Bworky Hairs",t:24,d:"These hairs won\'t stay long in your bag... Well, I really hope so anyway.",ep:14,g:29,l:1,wd:false,fm:true,w:0,p:1};
