I[7581] = {n:"Pineapple Bag",t:81,d:"This bag looks just like a magic pineapple... maybe it\'s a magic pineapple that turned into a bag for some reason. It has happened before. Unlike the Cawwot bag, the pineapple bag has not been hollowed out, so you can\'t put anything in it. And it\'s very heavy. Contrary to \'popular belief\', this bag is not part of the famous Pineapple set. Yes, I lied to you once again. Hahaha. I love this job.",ep:1,g:1,l:1,wd:true,fm:true,w:10,p:10};
I[7590] = {n:"Ash Drinking Trough",t:93,d:"This Drinking Trough is a refreshing spot, a mount\'s paradise, it can either quench its thirst or have a quick dip if the season is hot. Filled up with water and a few drops of magic potion, it will help your special friend grow big and strong.",ep:1,g:1,l:1,wd:true,fm:true,w:10,ut:true,p:1};
