I[7702] = {n:"Hunting Bow Wow",t:18,d:"This Bow Wow is in a class of its own. The result of generations of breeding, it\'s a noble-blooded hunting hound. Its extraordinary nose and perky yelping will help you flush out the biggest game in the forest... It will equally help the biggest game flush you out of the forest... Use with care.",ep:1,g:0,l:1,wd:false,fm:true,w:10,c:"PZ=1",p:1};
I[7703] = {n:"Baby Crowdzilla",t:18,d:"This dark bird is especially renowned for its love of cemeteries and white-skinned adventurers. It loves to break the bones it finds in graves with its huge beak.",ep:3,g:18,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:8,p:1};
I[7704] = {n:"Mischievous Squirrel",t:18,d:"This squirrel is a real acorn twister. It\'ll tickle your monkey nuts one minute and break \'em the next. The crazy thing only eats seed.",ep:3,g:16,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7705] = {n:"Leopardo",t:18,d:"This magnificent creature is somehow related to the famous Lenalds from Wabbit Island. More reckless and a lot more unruly, it will help you in combat but will prove incredibly deceitful if you don\'t treat it well. This creature only eats meat.",ep:3,g:27,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7706] = {n:"Bilby",t:18,d:"Bilby, short for Bilbiblabaloo, is a little jelly in search of big adventures. Particularly attached to Vald, it has remarkable powers for its size due to its strict diet of flowers.",ep:3,g:43,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7707] = {n:"Young Wild Boar",t:18,d:"This wild little piggy has an immeasurably large snout, adapted to sniffing out acorns. It seemed to find you quite easily. This devourer of souls feeds off the remains of Lousy Pigs, piglets and boars.",ep:1,g:20,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7708] = {n:"Blue Piwin",t:18,d:"This little Piwin is not like the others, one look at its colour and that is clear. However, it seems to share the same inexplicable interest in pecking posteriors. Don\'t be shocked when I tell you that some people actually enjoy being aggressed by the little creatures. This pet only eats seeds.",ep:1,g:19,l:1,wd:true,fm:true,w:10,p:1};
