I[7714] = {n:"Atooin",t:18,d:"Rumour has it that this turtle has been raised by a Martial Arts Master who resembled a Grossewer Rat. If you feed it with fish, it will be nice to you and will help you heal injured adventurers. If you feed it with meat, it will be aggressive and will help you fight your enemies.",ep:2,g:17,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:9,p:1};
