I[7879] = {n:"Hyrkul\'s Advent",t:25,d:"Domen\'s Colossal, Immoral, Unusual Annals will send shivers down your spine. Must be read according to prescription. Side effects: cold sweats and bed wetting.",ep:16,g:19,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[7880] = {n:"Gobkool Amulet",t:1,d:"This Amulet was worn by adventurers who said they wanted to make tea, not war. Each to their own.",ep:20,g:93,l:20,wd:true,fm:true,w:5,s:43,p:1300};
I[7881] = {n:"Gobkool Ring",t:9,d:"This ring will enable you to cause even more pain when doling out those well-deserved spankings to your little darlings.",ep:20,g:98,l:38,wd:true,fm:true,w:5,s:43,p:4000};
I[7882] = {n:"Gobkool Hammer",t:7,d:"This hammer is great for expressing your pacifism... all over your enemy\'s face.",ep:20,g:54,l:41,wd:true,fm:true,w:10,an:15,e:[5,5,1,1,40,40,false,false],s:43,p:4520};
I[7883] = {n:"Gobkool Boots",t:11,d:"Stuffed with Gobkool wool, these boots are just fantastic. Light and warm for the cold season and cool for the hot one, they will please even the pickiest of adventurers.",ep:20,g:66,l:38,wd:true,fm:true,w:15,s:43,p:3925};
I[7884] = {n:"Gobkool Cape",t:17,d:"If you\'re the kind of person who always thinks positive, this cape is made for you. It\'s so thick and comfy that it can be used as an improvised bed when you feel extremely sleepy. Its smoked Kaliptus odour even repels insects and other unwanted creatures.",ep:20,g:93,l:55,wd:true,fm:true,w:15,s:43,p:8030};
I[7885] = {n:"Gobkool Belt",t:10,d:"Wrapped around your hips, this belt will give you the appearance of a peace-loving adventurer. This enables you to surprise your enemies with a dagger in their back.",ep:20,g:84,l:37,wd:true,fm:true,w:10,s:43,p:3800};
I[7886] = {n:"Gobkool Headgear",t:16,d:"Let\'s be honest, as headwear goes, this cap is about as fashionable as a mullet hairdo. You never know though, look what happened to drainpipe jeans.",ep:20,g:119,l:47,wd:true,fm:true,w:15,s:43,p:6000};
I[7887] = {n:"Koolich Headgear",t:16,d:"This headgear once belonged to the famous Koolich, renowned for his clay feet and his legendary good mood.",ep:20,g:122,l:82,wd:true,fm:true,w:10,s:44,p:18375};
I[7888] = {n:"Koolich Bag",t:81,d:"The Koolich uses this bag to keep its Kaliptus leaves fresh or to suffocate Koalaks that are a bit too enterprising.",ep:20,g:2,l:69,wd:false,fm:true,w:10,s:44,p:12278};
I[7889] = {n:"Koolich Boots",t:11,d:"These boots used to belong to the Koolich - even if you can\'t tell, you can smell! These boots are so comfortable that you\'ll almost forget how miserable your existence is.",ep:20,g:69,l:73,wd:true,fm:true,w:10,s:44,p:13775};
I[7890] = {n:"Koolich Staff",t:4,d:"This staff is really an emptied bone of one of the Koolich\'s ancestors. Pierced on both ends, it can be used as a Kaliptus pipe but also as a shepherd\'s stick. Ahhhh... sticks, eh! What would we do without them?",ep:20,g:62,l:75,wd:true,fm:true,w:10,an:12,tw:true,e:[10,4,1,1,20,50,false,false],s:44,p:14675};
I[7891] = {n:"Mini Wa",t:18,d:"This little Wabbit is in fact a secret son of the notorious Wa Wabbit. Maybe one day it will be its tuwn to weaw his father\'s cwown. Ha!",ep:3,g:28,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7892] = {n:"Willy Peninzias",t:18,d:"Willy Peninzias is a nasty creature indeed. He had a very tough childhood. Since then, he soothes his seething anger by eating any and all stuffed animals he comes across.",ep:3,g:29,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[7893] = {n:"Mini Wa Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:18,l:1,wd:true,fm:true,w:1,p:1};
I[7894] = {n:"Willy Peninzias Ghost",t:90,d:"This Peninzias hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:17,l:1,wd:true,fm:true,w:1,p:1};
I[7895] = {n:"Bow Kennel Certificate: Mini Wa",t:77,d:"This certificate describes the characteristics of the Mini Wa you\'ve put in the Bow Kennel.",ep:3,g:34,l:1,wd:false,fm:true,w:1,p:100};
I[7896] = {n:"Bow Kennel Certificate: Willy Peninzias",t:77,d:"This certificate describes the characteristics of the Willy Peninzias you\'ve  put in the Bow Kennel.",ep:3,g:29,l:1,wd:false,fm:true,w:1,p:100};
I[7897] = {n:"Gift: Mini Wa",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.\n(WARNING: this gift is very heavy. You might be overweight when you open it. Remember to take your heavy items off, or to ask a friend to help you.)",ep:1,g:42,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7898] = {n:"Gift: Willy Peninzias",t:89,d:"If you stick your ear to this gift or if you shake it energetically, you might hear strange noises that will reveal the presence of a living creature. Don\'t waste any more time! Open it! You\'ll find a wonderful pet inside it as well as a book which will explain to you how to raise it, some resources it can be fed with and the Eniripsa powders you\'ll need to heal it.\n(WARNING: this gift contains very heavy items. You might be overweight when you open it. Remember to take your heavy items off, or to ask a friend to help you.)",ep:1,g:42,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[7899] = {n:"How to raise your Mini Wa",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise a Mini Wa.",ep:1,g:10,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[7900] = {n:"How to raise your Willy Peninzias",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise Willy Peninzias.",ep:1,g:10,l:1,wd:true,fm:true,w:1,u:true,p:200};
I[7902] = {n:"Golden Lady\'s Belt",t:10,d:"An old legend extracted from the famous old book titled " + "\"" + "Everything You Need To Know About Women" + "\"" + " says that this belt once belonged to a golden lady, a lot more interested in wealth than in power. In the non-censored version of this book, we also learn that she was keen on cracking dirty jokes. I guess she wasn\'t that different from most women...",ep:2,g:86,l:71,wd:true,fm:true,w:5,p:13300};
I[7903] = {n:"Kaliptus Leaf",t:36,d:"Delicately inserted in nostrils, these leaves will unblock any nose. Some tribal legends even say that this technique works for other orifices.",ep:20,g:1,l:1,wd:true,fm:true,w:1,p:10};
I[7904] = {n:"Kaliptus Flower",t:35,d:"When you burn it, this flower gives off a thick hallucinogenic smoke. When you chew it, it tends to make you impotent. And if you use it to make an infusion, it will have great laxative effects. The best thing to do would be not to touch it at all.",ep:14,g:1,l:1,wd:true,fm:true,w:1,p:10};
I[7905] = {n:"Gobkool Wool",t:57,d:"This wool looks like Gobball wool but isn\'t. This wool doesn\'t smell.",ep:20,g:1,l:1,wd:true,fm:true,w:1,p:10};
I[7906] = {n:"Gobkool Horn",t:47,d:"According to an old legend, when you grind this horn down, the powder is said to have aphrodisiac powers. The same legend specifies that it can also have surprising side effects. Another reason to try it out!",ep:20,g:9,l:1,wd:true,fm:true,w:1,p:10};
I[7907] = {n:"Gobkool Leather",t:56,d:"This multicoloured leather is perfect for you to make multicoloured leather underpants. You\'ll make the most blasÃ© of Chafers jealous.",ep:20,g:1,l:1,wd:true,fm:true,w:1,p:10};
I[7908] = {n:"Koolich Dungeon Key",t:84,d:"This key of bone will enable you to enter the Koolich dungeon even if you haven\'t been invited.",ep:13,g:5,l:1,wd:true,fm:true,w:1,p:10};
I[7911] = {n:"Bloody Koalak",t:18,d:"This little Koalak seems harmless but that\'s far from the truth. Tortured when he was young, the bullies\' favourite game was to hit him in the face with boomerangs. He hates boomerangs. He eats them whole just so he doesn\'t have to look at them.",ep:3,g:30,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:46,p:1};
I[7913] = {n:"Animagi (GM)",t:9,d:"This mysterious item, forgotten by the world, used to belong to a great magus... People say it gives you the ability to speak to certain animals...",ep:1,g:22,l:1,wd:false,fm:true,w:1,p:1};
I[7917] = {n:"Compensation Gift",t:89,d:"To make up for the recent problems that you\'ve encountered, the Amakna Team offers you this gift-box including:\n- 5 Wise Compensation Candies\n- 5 Lucky Compensation Candies\n- 10 Energy Compensation Candies\n- 10 Eniripsa Powders",ep:1,g:32,l:1,wd:true,fm:true,w:1,c:"PO!7801&PO!7800",u:true,p:1};
I[7918] = {n:"Tofu Dungeon Key",t:84,d:"This key, made of Tofu feathers, can tickle the inside of many locks into hysterics of... opening. It will grant you access to Farle Ingalsse\'s Tofu House.",ep:1,g:6,l:1,wd:true,fm:true,w:1,p:100};
I[7919] = {n:"Game Master Token",t:15,d:"You can probably exchange this beautiful token for precious gifts at the Trool Fair.",ep:1,g:737,l:1,wd:true,fm:true,w:1,p:100};
I[7920] = {n:"Tournament Wand (GM)",t:3,d:"This modest wand allows Game Masters to teleport adventurers into areas reserved for tournaments.",ep:1,g:8,l:1,wd:false,fm:true,w:1,e:[5,6,1,1,50,50,false,false],u:true,p:100};
I[7921] = {n:"Royal Tofu\'s Crown",t:16,d:"This crown is almost impossible to hold... No surprise, it belongs to the Royal Tofu! Doesn\'t seem to suit your small head, though. I think it just might be out of your league. LOSER!!!",ep:13,g:154,l:128,wd:true,fm:true,w:10,p:42625};
I[7922] = {n:"Stuffed Sacrier Dopple",t:61,d:"This stuffed Sacrier Dopple is just perfect for young Sacriers. It\'s great for mopping up blood and can even be washed at high temperatures.",ep:0,g:1,l:1,wd:true,fm:true,w:10,p:1};
I[7923] = {n:"Stuffed Pandawa Dopple",t:61,d:"This stuffed Pandawa Dopple smells like alcohol and wet Pandawa hair... Ah, just like mummy.",ep:1,g:2,l:1,wd:true,fm:true,w:10,p:1};
I[7924] = {n:"Labyrinth of the Minotoror Key",t:84,d:"This wonderful key will allow you to get into the Labyrinth of the Minotoror. It won\'t help you get out again, though.",ep:13,g:7,l:1,wd:true,fm:true,w:1,p:100};
I[7925] = {n:"Kaliptus Wood",t:38,d:"This scented wood can be used to build nice-smelling houses even if their owners stink. It\'s a pity it isn\'t supple enough to make underwear.",ep:20,g:1,l:50,wd:true,fm:true,w:2,p:0};
I[7926] = {n:"Lord Crow Dungeon Key",t:84,d:"With this key, you\'ll get to meet Lord Crow himself. If you\'re lucky, he might invite you to share a piece of cheese in his company.",ep:1,g:8,l:1,wd:true,fm:true,w:1,p:100};
I[7927] = {n:"Crackler Dungeon Key",t:84,d:"This key is almost unbreakable but it is a little worn from opening so many doors. It looks like it\'s been created from the intimate parts of a Crackler. Just shocking!",ep:1,g:9,l:1,wd:true,fm:true,w:1,p:100};
I[7928] = {n:"Pet Sanctuary Key",t:84,d:"With this key, you\'ll be able to get into the Pet Sanctuary. There, you\'ll find all the pets that died from hunger, exhaustion or torture as well as those who have been devoured, tickled to death, poisoned with Dragomilk, suffocated in a chest, or simply abandoned on the side of the road.",ep:1,g:10,l:1,wd:true,fm:true,w:1,p:100};
I[7929] = {n:"How To Be A Perfect Mercenary In Astrub",t:25,d:"This book, written by the famous Igor Ant, Mercenary Chief of Astrub, is bedside reading for those who respect the law as well as for those who flout it.",ep:1,g:10,l:1,wd:false,fm:true,w:1,u:true,p:5};
I[7930] = {n:"How To Make Friends And Keep Them",t:25,d:"Some advice and tips to make yourself nice and loyal friends, written by Acidrik Gutsplitter.",ep:1,g:10,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[7931] = {n:"Dragon Era - Found Fragments III",t:25,d:"Part III of the Fragments of the History of the World, found by the erudite Acidrik Gutsplitter and rewritten by the same.",ep:1,g:19,l:1,wd:false,fm:true,w:1,u:true,p:50};
I[7932] = {n:"Miss Astrub Scroll",t:25,d:"This year, the voluptuous Miss Astrub reveals the charms she used to seduce the jury.",ep:1,g:9,l:1,wd:false,fm:true,w:1,u:true,p:100};
I[7933] = {n:"Chip Pan Dealer Scroll",t:25,d:"These extraordinary dancers liven up the trendiest parties of the region.",ep:0,g:9,l:1,wd:false,fm:true,w:1,u:true,p:69};
I[7934] = {n:"How To Travel Without Ever Losing Your Way",t:25,d:"Wally Elconom wrote this book for adventurers who don\'t know their compass from their Zaaps.",ep:1,g:10,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[7935] = {n:"Sapphire Brooch",t:24,d:"This jewel was stuck in someone\'s hair for months . The inscription on it explains that it can be used as a key once reunited with its cousin brooches...",ep:20,g:109,l:1,wd:true,fm:true,w:0,p:100};
I[7936] = {n:"Emerald Brooch",t:24,d:"This jewel was stuck in someone\'s hair for months . The inscription on it explains that it can be used as a key once reunited with its cousin brooches...",ep:20,g:110,l:1,wd:false,fm:true,w:0,p:100};
