I[7939] = {n:"How To Become A Brakmarian Inductee",t:25,d:"The life of a Brakmarian militiaman, written by the recruiting sergeant Oto Mustam.",ep:1,g:10,l:1,wd:false,fm:true,w:1,u:true,p:0};
I[7940] = {n:"How To Become A Bontarian Recruit",t:25,d:"The life of a Bontarian militiaman, written by Amayiro, the famous Bonta Militia Chief.",ep:1,g:10,l:1,wd:false,fm:true,w:1,u:true,p:0};
