I[7999] = {n:"Pineapple Cape",t:17,d:"Some adventurers say that this cape is as rough as a Crocodyl\'s skin, and still others say that it\'s even rougher than a female Bwork\'s bottom. Be sure to wear it the right way round if you don\'t want to be pared to a point like a pencil.",ep:1,g:94,l:1,wd:true,fm:true,w:10,s:74,p:100};
I[8000] = {n:"Bworky",t:18,d:"This small creature is a Bwork. It was locked inside a jar for several decades. As it grew, it took the shape of the jar and will now be a cylindrical dwarf its whole life. Its legendary good humour makes for the perfect companion when you know you\'re going to die soon or for boisterous social occasions.",ep:3,g:31,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8001] = {n:"Koalak Warrior Bandage",t:15,d:"This bandage is normally wrapped around the Koalak Warrior\'s arms. This way, he can blow his nose without using any handkerchiefs. When this bandage is old and worn out, you hang it on the ceiling of your house to catch passing Moskitoes.",ep:20,g:719,l:70,wd:true,fm:true,w:5,p:100};
I[8002] = {n:"Dok Alako Fabric",t:55,d:"This fabric seems to be impregnated with an ancestral magic that is quite unpredictable and uncontrollable: another thing in common with your beloved.",ep:20,g:720,l:40,wd:true,fm:true,w:5,p:1};
I[8003] = {n:"Koalak Amulet",t:1,d:"This amulet does not look like any other amulet, simply because no other amulet looks like it.",ep:20,g:94,l:60,wd:true,fm:true,w:10,s:46,p:9425};
I[8004] = {n:"Koalak Ring",t:9,d:"This beautiful ring is worn by the most foolhardy of all Koalaks... the ones who stole it in Astrub.",ep:20,g:99,l:53,wd:true,fm:true,w:10,s:46,p:7375};
I[8005] = {n:"Koalak Bow",t:2,d:"This bow enables you to steal your opponents\' life and sometimes, to steal your opponents from life. (Don\'t spend too long trying to understand, that doesn\'t mean anything.)",ep:20,g:52,l:61,wd:true,fm:true,w:10,an:10,tw:true,e:[5,4,2,4,50,50,false,true],s:46,p:9775};
I[8006] = {n:"Koalak Boots",t:11,d:"These boots are in fact real Koalak feet that were brutally pulled off their owners, then emptied of their content before being padded with Koalak hairs. Both terrifying and attractive, these boots will make you the terror of Astrub.",ep:20,g:71,l:60,wd:true,fm:true,w:10,s:46,p:9600};
I[8007] = {n:"Koalak Cloak",t:17,d:"This cloak will protect you from most attacks, but not from being ridiculous.",ep:20,g:95,l:61,wd:true,fm:true,w:10,s:46,p:9675};
I[8008] = {n:"Koalak Belt",t:10,d:"This Kalitpus leaf belt diffuses a delightful smell, that will hide all others. Besides, this belt is perfect for hiding your chubbiness.",ep:20,g:87,l:60,wd:true,fm:true,w:10,s:46,p:9508};
I[8009] = {n:"Koalak Headgear",t:16,d:"This headgear is adorned with huge Koalak ears which has the effect of amplifying sounds. Be careful, it can destroy your eardrums if your friends are fond of the Wind of Panic.",ep:20,g:125,l:60,wd:true,fm:true,w:10,s:46,p:9425};
I[8010] = {n:"Dismantler",t:93,d:"Enables you to reclaim any piece of equipment installed a paddock.",ep:1,g:96,l:1,wd:false,fm:true,w:10,ut:true,p:1};
I[8011] = {n:"Prophets, Cults and Faith",t:25,d:"Some great stories about cults that will delight the aspiring mystic.",ep:1,g:19,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[8012] = {n:"Resurrection Powder",t:48,d:"This powder will bring a ghost pet back to life, provided you know how to feed a ghost pet.",ep:20,g:51,l:1,wd:true,fm:true,w:1,p:100};
I[8013] = {n:"Bow Meow Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8015] = {n:"Immature Koalak",t:18,d:"As the name indicates, this young Koalak is still enjoying the blood-red sunrise of its life. Maybe it will never stop growing and become taller than you are. The leash will be round the other throat then, my friend...",ep:1,g:0,l:1,wd:false,fm:true,w:10,c:"PZ=1",p:1};
I[8016] = {n:"Bloody Koalak Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:43,l:1,wd:true,fm:true,w:1,p:1};
