I[8050] = {n:"Immature Koalak Skin",t:59,d:"The little immature Koalak who\'s skin you tore off didn\'t want you to treat him that way... but hey, you\'re stronger and crueller than he is.",ep:20,g:3,l:1,wd:true,fm:true,w:1,p:10};
I[8052] = {n:"Koalak Master Skin",t:59,d:"This old and worn skin used to protect the Koalak Master\'s behind. It still has some nice reddish traces, ample proof of a crazy, restless life.",ep:20,g:5,l:1,wd:true,fm:true,w:1,p:10};
I[8053] = {n:"Koalak Rider Skin",t:59,d:"This torn skin was worn out against that of the Koalak Rider\'s Mount. Obviously, this is a proof of its good quality.",ep:20,g:6,l:1,wd:true,fm:true,w:1,p:10};
I[8054] = {n:"Drakoalak Skin",t:59,d:"This skin\'s smell should remind you of that of the sheds of the Castle of Amakna. Very handy for scaring sensitive souls away and killing them before they decide to come with you to a dungeon.",ep:20,g:7,l:1,wd:true,fm:true,w:1,p:10};
I[8055] = {n:"Mama Koalak Bone",t:47,d:"Mama Koalak has particularly solid bones that don\'t break under her weight. The same cannot be said for the famous minstrel Jon Lemon who lost the use of both his arms when he got squashed by Mama Koalak\'s humongous thighs.",ep:20,g:638,l:1,wd:true,fm:true,w:1,p:10};
I[8056] = {n:"Wild Koalak Femur",t:47,d:"Once carved and shaped like a dagger, this bone makes a great a boil-piercer.",ep:20,g:639,l:1,wd:true,fm:true,w:1,p:10};
I[8057] = {n:"Koalak Gravedigger Shinbone",t:47,d:"This bone can be used as a shovel to unearth corpses and strip them off, if you like spending your holidays next to cemeteries. Incidentally, it\'s also the Koalak Gravedigger\'s shinbone.",ep:20,g:640,l:1,wd:true,fm:true,w:1,p:10};
I[8058] = {n:"Koalak Mummy Ulna",t:47,d:"Thanks to the Koalak Mummy\'s numerous wrappings, which give good protection against the most powerful magic attacks, this bone has kept all of its splendour.",ep:20,g:641,l:1,wd:true,fm:true,w:1,p:10};
I[8059] = {n:"Cherry Koalak Hairs",t:54,d:"These hairs are covered with Blop pollen, which gives them a delectable taste, but a foul smell.",ep:20,g:660,l:1,wd:true,fm:true,w:1,p:10};
I[8060] = {n:"Coco Koalak Hairs",t:54,d:"These hairs are covered with Blop pollen, which gives them a delectable taste, but a foul smell.",ep:20,g:662,l:1,wd:true,fm:true,w:1,p:10};
I[8061] = {n:"Pippin Koalak Hairs",t:54,d:"These hairs are covered with Blop pollen, which gives them a delectable taste, but a foul smell.",ep:20,g:661,l:1,wd:true,fm:true,w:1,p:10};
I[8062] = {n:"Indigo Koalak Hairs",t:54,d:"These hairs are covered with Blop pollen, which gives them a delectable taste, but a foul smell.",ep:20,g:659,l:1,wd:true,fm:true,w:1,p:10};
I[8063] = {n:"Bloody Koalak Tail",t:65,d:"This ridiculous tiny tail is so insignificant it could only have belonged to you. But this is not the case... consider yourself lucky!",ep:20,g:641,l:1,wd:true,fm:true,w:1,p:10};
I[8064] = {n:"Bloody Koalak Boomerang",t:15,d:"This weirdly shaped piece of wood travelled for a long time through the air between enemy ranks before breaking. Rumour has it that it will always fly back to its owner, but rarely into their hands...",ep:20,g:721,l:1,wd:true,fm:true,w:1,p:10};
I[8065] = {n:"Brown Warko Beard Hairs",t:54,d:"These hairs are urticant enough to change simple Brown Warko kisses into weapons of mass destruction. Very urticant indeed.",ep:20,g:657,l:1,wd:true,fm:true,w:1,p:10};
I[8066] = {n:"Purple Warko Beard Hairs",t:54,d:"These hairs are urticant making this beard a war weapon a lot more destructive than the Bwork breath, if we were to compare them. Shocking!",ep:20,g:658,l:1,wd:true,fm:true,w:1,p:10};
I[8067] = {n:"Champion Boots",t:11,d:"Some adventurers say that these boots enable you to walk on traps without activating them. But be careful, this might be a trap in itself...",ep:1,g:72,l:1,wd:false,fm:true,w:10,s:45,p:10};
I[8068] = {n:"Champion Cape",t:17,d:"This splendid cape comes with shoulder pads as standard so you\'ll finally look like a real champion.",ep:1,g:96,l:1,wd:false,fm:true,w:10,s:45,p:10};
I[8069] = {n:"Champion Helmet",t:16,d:"With this imposing helmet, you\'ll become big-headed for sure, if you aren\'t already!",ep:1,g:127,l:1,wd:true,fm:true,w:100,s:45,p:10};
I[8070] = {n:"Champion Belt",t:10,d:"With this low-slung belt around your hips, you\'ll finally be able to hide that pickle-sized bulge in your trousers. Will that stop the girls laughing? I doubt it.",ep:1,g:88,l:1,wd:false,fm:true,w:10,s:45,p:10};
I[8071] = {n:"Mini Champion",t:18,d:"This small creature only follows champions... you might get a few days out of it before it realizes you\'re a hopeless imposter. From that moment on, you\'ll be wearing the leash.",ep:1,g:32,l:1,wd:true,fm:true,w:10,c:"PZ=1",s:45,p:1};
I[8072] = {n:"Kaliptus Dofus",t:23,d:"No one knows exactly which dragon created this Dofus, but the rumours suggest it ingested an incredible quantity of Kaliptus leaves before laying the egg and then dying of acute aerophagia.",ep:1,g:10,l:6,wd:false,fm:true,w:1,p:100000};
I[8073] = {n:"Skeunk\'s Hideout Key",t:84,d:"Rigroulak gave you this key in exchange for the Koolich set. This key will enable you to enter Skeunk\'s Hideout.",ep:13,g:11,l:1,wd:true,fm:true,w:1,p:100};
I[8075] = {n:"Dok Alako Boomerang",t:15,d:"This weirdly shaped piece of wood travelled for a long time through the air between enemy ranks before breaking. Rumour has it that it will always fly back to its owner, but rarely into their hands...",ep:20,g:722,l:1,wd:true,fm:true,w:1,p:10};
I[8076] = {n:"Koalak Master Boomerang",t:15,d:"This weirdly shaped piece of wood travelled for a long time through the air between enemy ranks before breaking. Rumour has it that it will always fly back to its owner, but rarely into their hands...",ep:20,g:723,l:1,wd:true,fm:true,w:1,p:10};
I[8077] = {n:"Brown Warko Boomerang",t:15,d:"This weirdly shaped piece of wood travelled for a long time through the air between enemy ranks before breaking. Rumour has it that it will always fly back to its owner, but rarely into their hands...",ep:20,g:724,l:1,wd:true,fm:true,w:1,p:10};
I[8078] = {n:"Kaliptus Plank",t:95,d:"A Handyman could use this plank to make something delightful - a coffin, for example. Just bear that in mind.",ep:20,g:22,l:70,wd:true,fm:true,w:10,p:10};
I[8079] = {n:"Little White Bow Meow Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8080] = {n:"Little Black Bow Wow Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8081] = {n:"Bag of Hornbeam",t:100,d:"This huge bag contains an impressive quantity of Hornbeam.",ep:1,g:55,l:1,wd:true,fm:true,w:250,u:true,p:100};
I[8082] = {n:"Reapalak Fabric",t:55,d:"This fabric smells like death, whereas you smell as if you were dead. The difference is worth noting.",ep:20,g:13,l:1,wd:true,fm:true,w:1,p:100};
I[8083] = {n:"Fisheralak Bone",t:47,d:"This bone is quite spongy and enables the Fisheralak to float if it falls in while pulling up a big catch.",ep:20,g:10,l:1,wd:true,fm:true,w:1,p:100};
I[8084] = {n:"Piralak Skin",t:59,d:"This scar-covered skin became more resistant than a rock but remained extremely supple. It\'s the perfect for whips and tasteless sandals.",ep:20,g:8,l:1,wd:true,fm:true,w:1,p:100};
I[8085] = {n:"Koalak Forester Hairs",t:54,d:"These hairs are covered in Kaliptus sap, giving them a shiny glint. Unfortunately, they cannot be used for haute couture as they smell like rotting Dragoturkey.",ep:20,g:4,l:1,wd:true,fm:true,w:1,p:100};
I[8086] = {n:"Shredded Drakoalak Headgear",t:15,d:"This weird looking headgear used to hide the premature baldness of the Drakoalak. With a little practice, it might soon be able to hide yours.",ep:20,g:725,l:1,wd:true,fm:true,w:1,p:100};
I[8087] = {n:"Spell Scroll: Axe Skill",t:73,d:"(Double click to learn the spell) \nThis scroll will teach you a spell that will enable you to cause more damage when you use an axe.",ep:20,g:8,l:20,wd:false,fm:true,w:1,u:true,p:10000};
I[8088] = {n:"Gyver Wand",t:3,d:"This wand, made out of useless office stationery, holds incredible magical powers. Legend tells that it can move of its own will, choose its target and protect its master even when death is seemingly inevitable.",ep:20,g:56,l:128,wd:true,fm:true,w:10,an:11,e:[5,5,2,5,40,50,false,true],c:"CI>250",p:41257};
I[8089] = {n:"Iots Wand",t:3,d:"Iots was a parrot who repeated just about anything you could say. Rumour has it that this wand was carved from its beak.",ep:20,g:57,l:138,wd:true,fm:true,w:20,an:11,tw:true,e:[5,4,3,4,40,50,false,true],c:"CI>150&CA>100&CC>100&CS>100",p:44125};
I[8090] = {n:"Caribbean Staff",t:4,d:"Legend has it that this staff bites people, or was it that people always bit it? Something about biting anyway...",ep:20,g:64,l:114,wd:true,fm:true,w:10,an:12,tw:true,e:[5,5,1,1,35,50,false,true],c:"CI>200&CA>150",p:33520};
I[8091] = {n:"Palm Cane",t:4,d:"This palm cane celebrates a famous festival in the South East. Unfortunately this one isn\'t made of gold.",ep:20,g:65,l:134,wd:true,fm:true,w:20,an:12,tw:true,e:[20,4,1,1,150,150,false,true],c:"CS>150&CA>150&CI>150",p:43550};
I[8092] = {n:"Ostwogoth Daggers",t:5,d:"The Ostwogoth is neither sharp nor smart but when he has his daggers to hand, no one dares face this monster.",ep:20,g:56,l:135,wd:true,fm:true,w:20,an:13,tw:true,e:[10,3,1,1,30,50,false,true],c:"CS>250&CA>100",p:43510};
I[8093] = {n:"Mick Dagger",t:5,d:"Carrying these daggers will not necessarily make a hero of you... they could quickly leave you looking like a heroine if you carry them in your pants however.",ep:0,g:64,l:58,wd:true,fm:true,w:1,e:[-1,-1,1,-1,-1,-1,false,false],p:4253};
I[8094] = {n:"Killarity Sword",t:6,d:"This sword perfectly illustrates the old Iop saying " + "\"" + "In a slain enemy is a sword\'s hilarity" + "\"" + ".",ep:20,g:66,l:169,wd:true,fm:true,w:30,an:14,e:[10,5,1,1,50,50,false,true],c:"CS>450&CV>450",p:49010};
I[8095] = {n:"Andy War Sword",t:6,d:"This conversation piece is mass-produced according to an unchanging style. Since it\'s also quite deadly, it\'s often used in combat. In this case, art doesn\'t imitate life, it tears it out at the roots.",ep:20,g:67,l:143,wd:true,fm:true,w:20,an:14,e:[15,4,1,1,80,50,false,true],c:"CI>300&CS>130&(PG=6|PG=8|PG=11)",p:44587};
I[8096] = {n:"Dunb Hammer",t:7,d:"Its previous owner used to dance with Moowolves. One day he was wolfed down altogether.",ep:20,g:56,l:140,wd:true,fm:true,w:20,an:15,e:[5,5,1,1,30,45,false,true],c:"CI>250&CC>250",p:44541};
I[8097] = {n:"Hammer O\'In",t:7,d:"Even your enemies will be asking to be hit again and again with this weapon.",ep:20,g:57,l:129,wd:true,fm:true,w:30,an:15,e:[5,4,1,1,40,15,false,true],c:"CS>250&CI>150",p:42658};
I[8098] = {n:"Blade O\'Ven",t:19,d:"This axe is really special. Its vibrating blade plays beautiful music while you slice the life out of your enemies.",ep:0,g:38,l:1,wd:false,fm:true,w:1,an:17,e:[10,4,1,1,50,50,false,true],p:1};
I[8099] = {n:"Axe of Lies",t:19,d:"Rumour has it this weapon has been dipped into a fountain of pure lightning and then sprinkled with stardust. Other rumours entirely contradict this story.",ep:20,g:39,l:116,wd:true,fm:true,w:10,an:17,tw:true,e:[7,5,1,1,35,50,false,false],c:"CA>120&CV>150",p:34562};
I[8100] = {n:"The Warf Axe",t:19,d:"This axe has been pierced in many different places making it whistle pleasantly while you slice your enemies. As the old song goes \'Whistle while you Whack.\'",ep:20,g:40,l:112,wd:true,fm:true,w:15,an:17,e:[5,4,1,1,40,50,false,false],c:"CS>150&CW>150",p:30300};
I[8101] = {n:"Kape Axe",t:19,d:"This troublesome axe claims it comes from a mysterious land far away... Don\'t listen to its rambling, though, it has made peace-loving fools out of more than one fine warrior. What a shame.",ep:20,g:41,l:128,wd:true,fm:true,w:1,an:17,e:[5,4,1,1,20,30,false,false],c:"CI>230&CA>60&CV>250",p:444};
I[8102] = {n:"Legendary Crackler Rock",t:51,d:"This rock is said to be the heart of the Legendary Crackler. What we do know is that the Legendary Crackler never had a heavy heart. Therefore, this rock is incredibly light making it possible to create suitable items for characters who favour mobility, agility and protection. Just perfect!",ep:5,g:457,l:120,wd:true,fm:true,w:50,p:100};
I[8103] = {n:"Web Bow",t:2,d:"This bow is made from fossilised hair of a Sadida who slept for so long that Arachnees spun a film of tough webs around it.",ep:20,g:53,l:121,wd:true,fm:true,w:20,an:10,tw:true,e:[5,5,2,6,30,50,false,true],c:"CS>100&CA>100&CI>100&CC>100&CV>200",p:34857};
I[8104] = {n:"Chtelion Bow",t:2,d:"This bow is a bizarre colour but is perfect to show off at the Zaap of Bonta. You won\'t pass off as a rooster, but you\'ll surely attract all the chicks! Sometimes amazing, sometimes disgusting, it might even overcome your enemies without your needing to shoot a single arrow.",ep:20,g:54,l:129,wd:true,fm:true,w:20,an:10,tw:true,e:[7,4,2,6,35,40,false,true],c:"CI>300&CV>300&CA>100",p:42510};
I[8106] = {n:"Unlearning Potion for Profession: Handyman",t:44,d:"This Potion will let you unlearn the profession of Handyman.",ep:7,g:21,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[8107] = {n:"ne pas traduire",t:25,d:"ne pas traduire",ep:1,g:19,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[8108] = {n:"Tofu Amulet",t:1,d:"As light as a Tofu feather, this amulet can be worn around your neck or around your forehead if you want to be original.",ep:3,g:95,l:22,wd:true,fm:true,w:5,s:50,p:1525};
I[8109] = {n:"Tofu Ring",t:9,d:"This ridiculously small ring can end up being essential... your enemies might pity you so much they\'ll finish you off instead of letting you agonize. Let\'s be positive!",ep:3,g:100,l:21,wd:true,fm:true,w:5,s:50,p:1350};
I[8110] = {n:"Tofu Wand",t:3,d:"Unlike what some adventurers may think, this wand is not used by Tofus - they\'re way too stupid to know how to use such a weapon - but to fight them. Indeed, this wand is made of Tofu feathers which enable hunters to simulate the Tofu mating dance and catch them. What else will these terrible hunters invent to satisfy their murderous instinct?",ep:3,g:58,l:25,wd:true,fm:true,w:10,an:11,e:[5,6,2,2,50,50,false,false],s:50,p:100};
I[8111] = {n:"Tofu Slippers",t:11,d:"Light and soft, these slippers are warm in winter and cool in summer. Unfortunately, they can\'t stand being washed in washing machines.",ep:3,g:73,l:23,wd:true,fm:true,w:10,s:50,p:1575};
I[8112] = {n:"Tofu Cloak",t:17,d:"This weird cloak has been cut in half. But why would somebody cut it in half? No one knows... though everybody has his own little idea about it.",ep:3,g:97,l:26,wd:true,fm:true,w:10,s:50,p:2000};
I[8113] = {n:"Tofu Belt",t:10,d:"This belt is the ideal tool for strangling Tofus but hunters also use it to whip any adventurers who stray onto their land in hunting season.",ep:3,g:89,l:22,wd:true,fm:true,w:5,s:50,p:1553};
I[8114] = {n:"Helmetofu",t:16,d:"This safety helmet became a very fashionable item that every pretty lady adventurer should have. What\'s wrong in this world?",ep:3,g:128,l:23,wd:true,fm:true,w:5,s:50,p:1575};
I[8116] = {n:"Golden Scara Helmet",t:16,d:"This helmet will hide your teenage acne or your ugly face.",ep:6,g:129,l:58,wd:true,fm:true,w:10,s:51,p:8900};
I[8117] = {n:"Golden Scaracape",t:17,d:"More golden than a classical Scaracape and less black than a Black Scaracape, this cape is perfect to hide your outgrowths. The Scarabugly used to use it to hide its awful hump, for example. These days, this cape is mainly used to hide terrible-looking behinds. No need to point out that this cape is very popular.",ep:6,g:98,l:58,wd:true,fm:true,w:10,s:51,p:8980};
I[8118] = {n:"Golden Scarabugly Wand",t:3,d:"This magic wand is perfect for dusting old furniture or old people.",ep:6,g:59,l:59,wd:true,fm:true,w:10,an:11,e:[10,4,2,4,30,60,false,false],s:51,p:9300};
I[8119] = {n:"Golden Scarabelt",t:10,d:"If you love running naked on the paradisiacal Moon Island beaches, you\'ll surely fall in love with this belt.",ep:6,g:90,l:51,wd:true,fm:true,w:10,s:51,p:6825};
I[8120] = {n:"Golden Scarabugly Amulet",t:1,d:"Worn on a hairy torso, this amulet just looks fantastic! Hair tufts are just the perfect match for this amulet.",ep:6,g:96,l:45,wd:true,fm:true,w:5,s:51,p:5375};
I[8121] = {n:"Golden Scarabugly Ring",t:9,d:"Scarabuglys are strange creatures. Born hunchbacked and ugly, they inevitably become the laughing stock of the other Scaraleaves. Maybe that\'s why you feel so close to this creature.",ep:6,g:101,l:43,wd:true,fm:true,w:5,s:51,p:5000};
I[8122] = {n:"Golden Scaraboots",t:11,d:"These hooked boots make it easy for you to climb the sheerest of cliffs or to plough your fields without a plough.",ep:6,g:74,l:54,wd:true,fm:true,w:10,s:51,p:7725};
I[8123] = {n:"Farmer Amulet",t:1,d:"This amulet smells of Wild Sunflower oil and herbs. You can use it as a lure to trap dangerous rummagers... like Gobballs, or your mother-in-law.",ep:1,g:97,l:20,wd:true,fm:true,w:5,s:47,p:1255};
I[8124] = {n:"Farmer Beltudas",t:10,d:"With its complementary pair of linen Bermuda shorts attached, the Beltudas is simply a must have. This belt is designed for those who need to get their clothes off in a heartbeat and burst into action just as fast. Be careful though. For reasons of hygiene, it is forbidden to wear it in public swimming pools... we don\'t want a repeat of the Bonta incident... I almost lost my sight that time...",ep:1,g:91,l:20,wd:true,fm:true,w:10,s:47,p:1300};
I[8125] = {n:"Farmer Sunhat",t:16,d:"If you need protection from the sun while working in the fields, what you really need is a Slob Headgear. If you need protection from the sun while working in the fields and you\'re poor, the famous Farmer\'s Sunhat will have to do.",ep:1,g:130,l:19,wd:true,fm:true,w:10,s:47,p:1200};
I[8126] = {n:"Farmer Moth-Eaten Mittens",t:9,d:"These moth-eaten mittens are a real treasure. They\'re said to be covered with diamond dust which gives them extraordinary resistance. They are also abrasive on one side, perfect for putting the finishing touches to that latest DIY project.",ep:1,g:102,l:12,wd:true,fm:true,w:5,s:47,p:600};
I[8127] = {n:"Damaged Farmer Scythe",t:22,d:"This robust but damaged scythe doesn\'t cut very well, it\'s seen far too many harvests. However, it\'s extremely effective if you\'re looking to yank some veins out of a rival\'s arm... Nice and blunt...",ep:1,g:2,l:17,wd:true,fm:true,w:1,an:17,e:[5,3,1,1,50,50,false,false],s:47,p:950};
I[8128] = {n:"Farmer Boots",t:11,d:"These boots are padded with wheat straw, absorbing perspiration and allowing the portable and low-cost cultivation of toxic mushrooms. Thanks to their soft sole, they\'ve been recommended by all the great Gobbowl players.",ep:1,g:75,l:18,wd:true,fm:true,w:5,s:47,p:1100};
I[8129] = {n:"Boowolfulet",t:1,d:"Behind this stupid name, you\'ll find an extremely powerful amulet, made with Boowolf fangs and bones which explains why it smells so bad. If it doesn\'t suit your neck, it will perfectly suit your breath.",ep:1,g:98,l:57,wd:true,fm:true,w:10,s:32,p:8550};
I[8130] = {n:"Boowolf Axe",t:19,d:"This terrible axe has beheaded many foolhardy adventurers even if it does not cut very well. Indeed, a dozen attempts can be necessary to finish cutting a resistant neck.",ep:1,g:42,l:55,wd:true,fm:true,w:10,an:17,tw:true,e:[5,6,1,1,50,50,false,false],s:32,p:8125};
I[8131] = {n:"Farmer Bag",t:81,d:"This bag is very fashionable among school kids and is ideal for storing animal and vegetable flours. Once opened, unfolded and torn along the seams, you\'ll be able to use this bag as a skirt, just shave those legs, for Iop\'s sake.",ep:1,g:3,l:19,wd:true,fm:true,w:1,s:47,p:1153};
I[8132] = {n:"Black Scarabelt",t:10,d:"This belt is anything but original... funny, it seems to match your hairdo.",ep:6,g:93,l:43,wd:true,fm:true,w:10,s:49,p:4955};
I[8133] = {n:"Black Scara Helmet",t:16,d:"This helmet is perfect for those who see the world through opaque black glasses.",ep:6,g:132,l:53,wd:true,fm:true,w:10,s:49,p:7350};
I[8134] = {n:"Black Scaracape",t:17,d:"If you can\'t afford to buy a Mastralis Croak, but you like to scare Arachnees by wearing black clothes, this is the cape for you!",ep:6,g:100,l:53,wd:true,fm:true,w:10,s:49,p:7575};
I[8135] = {n:"Bwork Dungeon Key",t:84,d:"This interesting key will allow you to drag open the door of the Bwork Dungeon... It can\'t promise you\'ll get out of there alive though.",ep:1,g:234,l:1,wd:true,fm:true,w:1,p:100};
I[8136] = {n:"Black Scararing",t:9,d:"This beautiful ring can be worn around your big toe. It\'s perfect to hide your warts and your ingrown nails.",ep:6,g:104,l:48,wd:true,fm:true,w:10,s:49,p:6200};
I[8137] = {n:"Golden Scarabugly Entrails",t:15,d:"These entrails are responsible for the difficult digestions of the Golden Scarabugly. You are entitled to fry them without feeling remorse.",ep:6,g:726,l:70,wd:true,fm:true,w:5,p:100};
I[8138] = {n:"Black Scaraleaf Carapace",t:107,d:"Once upside down, this carapace can be used as an ashtray.",ep:6,g:727,l:40,wd:true,fm:true,w:5,p:100};
I[8139] = {n:"Scaraleaf Dungeon Key",t:84,d:"This wonderful golden key will grant you access to the Scaraleaf Dungeon. And you thought you\'d seen it all...",ep:1,g:233,l:1,wd:true,fm:true,w:1,p:100};
I[8140] = {n:"Black Scaraleaf Antennas",t:15,d:"The Black Scaraleaf never knew himself why he was given these antennae. Nature can be cruel sometimes.",ep:6,g:728,l:40,wd:true,fm:true,w:1,p:100};
I[8141] = {n:"Black Scaraleaf Wings",t:104,d:"Unlike what some adventurers may think, Black Scaraleaf Wings are not black, but white. Another mystery Mother Nature gave us to discuss at the Inn.",ep:6,g:729,l:40,wd:true,fm:true,w:1,p:100};
I[8142] = {n:"Secret Key to the Royal Tofu House",t:84,d:"With this key you\'ll be able to pay a visit to the Royal Tofu House. You\'ll get the thrashing of your life there too.",ep:3,g:12,l:1,wd:true,fm:true,w:1,p:1};
I[8143] = {n:"Field Key",t:84,d:"This key will let you into the Field Dungeon... It won\'t let you out again, though.",ep:1,g:13,l:1,wd:true,fm:true,w:1,p:100};
I[8144] = {n:"Moowolf Mojo",t:15,d:"This small flask contains the virile power of the Moowolf in liquid form. Be careful though, it\'s not edible.",ep:2,g:730,l:1,wd:true,fm:true,w:1,p:1};
I[8145] = {n:"Bwork Beer",t:37,d:"Bwork Beer will render a Feca drunk from 12 paces. No one knows if it\'s made of Bworks or by Bworks, but knowing the Bworks, it\'s probably a bit of both.",ep:1,g:1,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8146] = {n:"Legendary Crackler Boots",t:11,d:"If you like to break a few toes when you take your date out to dance, these boots are made for you!",ep:5,g:77,l:86,wd:true,fm:true,w:10,s:52,p:19150};
I[8147] = {n:"Legendary Crackler Helmet",t:16,d:"This is an improved version of the Crackler Helmet. This rock will efficiently protect you from falling rocks, but not from hair loss.",ep:5,g:133,l:80,wd:true,fm:true,w:10,s:52,p:16530};
I[8148] = {n:"Legendary Crackler Hammer",t:7,d:"This huge hammer is in fact a Crackler sword, adorned with a rock from the Legendary Crackler. This shocking creation will stun your opponents, just before squashing them.",ep:5,g:58,l:81,wd:true,fm:true,w:10,an:15,e:[7,5,1,1,40,50,false,false],c:"CA>100&CI>50",s:52,p:16850};
I[8149] = {n:"Legendary Cracklering",t:9,d:"This rock, set with precious stones, is perfect if you want to leave a permanent mark on the forehead of an enemy.",ep:18,g:105,l:80,wd:true,fm:true,w:10,s:52,p:16775};
I[8150] = {n:"Legendary Crackler Amulet",t:1,d:"This amulet has quite a modest look though it contains many secrets including the one telling what secrets it contains.",ep:5,g:99,l:84,wd:true,fm:true,w:10,s:52,p:18350};
I[8151] = {n:"Gobtubby",t:18,d:"This little monster will follow you everywhere and devour the remains of his fellow creatures. By turns terrifying and entertaining, it\'ll brighten up your long, sombre days. Although it could just as easily shorten your long, sombre days considerably.",ep:3,g:35,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8152] = {n:"Legendary Crackler Belt",t:10,d:"The Legendary Crackler wears this belt around his toes and you around his waist, or ankle maybe...",ep:5,g:94,l:80,wd:true,fm:true,w:10,s:52,p:16506};
I[8153] = {n:"Treechster",t:18,d:"This young Treechnid could no longer stand his family, and like yourself, has decided to rebel. Today, he\'s coming with you to count how many of his close relatives you can exterminate.",ep:3,g:34,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8154] = {n:"El Scarador",t:18,d:"This charming little beetle is in fact a thoroughly fearsome creature. Humiliated by his friends when he was younger, he decided to take his revenge. Just tell him if a Scaraleaves is giving you grief and he\'ll be glad to sort it out for you.",ep:3,g:36,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8155] = {n:"Minifoux",t:18,d:"This magnificent creature is somehow related to the famous Lenalds of Wabbit Island. More reckless and a lot more unruly, it will help you in combat and, with unspeakable treachery, will also help you defeat members of his own family.",ep:3,g:37,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8156] = {n:"Canidae Dungeon Key",t:84,d:"With this key you\'ll be able to enter this terrible Canidae Dungeon. Once inside, you\'ll most likely be gutted in a relaxing, low-key atmosphere.",ep:1,g:235,l:1,wd:true,fm:true,w:1,p:1};
I[8157] = {n:"Magic Famished Sunflower Petal",t:35,d:"Just like any magical item, this one is impressive. The petal emits an aura that is as powerful as the incredulity of any onlookers.",ep:1,g:2,l:20,wd:true,fm:true,w:1,p:100};
I[8158] = {n:"Greasy Tofurby Feather",t:53,d:"The Tofurby regularly smears himself with grease to stop his feathers falling off his plumage. A technique as old as the hills, which enables some Enutrofs to keep some of their hair beyond puberty.",ep:3,g:1,l:50,wd:true,fm:true,w:1,p:10};
I[8159] = {n:"Golden Scarabugly Carapace",t:107,d:"Put it on your head and this carapace will protect you from bad weather and guano drops.",ep:6,g:731,l:70,wd:true,fm:true,w:5,p:100};
I[8160] = {n:"Golden Scarabugly Antennas",t:15,d:"If you want to look like Korgamone the Carpathian Capon, it\'s very simple - stick these antennae in your nostrils and sing out loud.",ep:6,g:732,l:70,wd:true,fm:true,w:1,p:100};
I[8161] = {n:"Golden Scarabugly Wings",t:104,d:"If you\'ve always dreamt of flying like a fat Piwi, stick these wings to your belt and jump from the Tower of Orders in Brakmar. As well as giving the locals a laugh, you\'ll make a great meal for Crows.",ep:6,g:733,l:70,wd:true,fm:true,w:1,p:100};
I[8162] = {n:"Pumpkwin Head",t:16,d:"With this magic Pumpkwin on your head, you\'ll look even more idiotic than usual. But remember the Al Howin curse... yes, the curse that transforms creatures into misshapen beasts... \nIt seems that this headgear is the only thing that can protect you from this terrible curse.",ep:1,g:134,l:1,wd:true,fm:true,w:1,p:1};
I[8163] = {n:"Kabuto",t:16,d:"Formerly worn by the authorities of the greatest cities, this helmet is now used to intimidate rebels and those who are a bit too curious about the rulers of the universe.",ep:20,g:135,l:101,wd:true,fm:true,w:10,p:26000};
I[8164] = {n:"Gift: Gobtubby",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open it. You\'ll find a wonderful pet inside, as well as a book explaining how to raise it, some food and some healing Eniripsa powders.",ep:1,g:2,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8165] = {n:"Gift: Treechster",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open it. You\'ll find a wonderful pet inside, as well as a book explaining how to raise it, some food and some healing Eniripsa powders.",ep:1,g:2,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8166] = {n:"Gift: El Scarador",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open it. You\'ll find a wonderful pet inside, as well as a book explaining how to raise it, some food and some healing Eniripsa powders.",ep:1,g:2,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8167] = {n:"Gift: Minifoux",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open it. You\'ll find a wonderful pet inside, as well as a book explaining how to raise it, some food and some healing Eniripsa powders.",ep:1,g:2,l:1,wd:false,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8168] = {n:"Al Howin\'s Gift",t:89,d:"Al Howin was the greatest Pumpkwin farmer on the continent. Unfortunately, this Bwork Magus was also an amateur enthusiast of all things arcane. In order to win the \'Biggest Pumpkwin cultivated with Lousy Pig slurry\' contest, Al Howin enlisted the Bwork Magus who decided to test a new incantation on the Pumpkwins... as a result of his idiocy, anyone who ate these bewitched fruits wound up transformed into strange, misshapen creatures for several days ...  this still happens every year around the same time. Apparently, the curse can only be warded off by wearing a Pumpkwin on your head. The most surprising thing of all is that this seems to work.",ep:1,g:1,l:1,wd:false,fm:true,w:1,p:1};
I[8169] = {n:"Jack o\'Gobball Transformation",t:27,d:"You\'ve been turned into a Jack O\' Gobball. To get rid of this terrible curse, you\'ll have to choose one of your fellow adventurers and beat the living daylights out of him.",ep:1,g:4,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8170] = {n:"Jack o\'Tofu Transformation",t:27,d:"You\'ve been turned into a Jack O\' Gobball. To get rid of this terrible curse, you\'ll have to pick one of your adventurer friends and beat the living daylights out of him.",ep:1,g:4,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8171] = {n:"Treechster Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:34,l:1,wd:true,fm:true,w:1,p:1};
