I[8181] = {n:"Legendary Crackler Cloak",t:17,d:"This cloak of big stone chunks will turn you into a big stone chunk.",ep:5,g:101,l:84,wd:true,fm:true,w:10,s:52,p:18200};
I[8184] = {n:"Minifoux Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
