I[8211] = {n:"Pingoku",t:18,d:"This creature must have escaped from a zoo or some a remote island. He is known to improve the damage of his master in combat, indeed, he shares his most distinguishing feature with his master... his rotting-fish breath which comes from his strict fish diet. We suggest that you nail his mouth closed whenever you want to go to sleep.",ep:3,g:38,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
