I[8231] = {n:"Red Piwi Cape",t:17,d:"If you\'re small enough, this cape of Piwi feathers may cover up your behind. Some modest protection that will at least draw attention away from your greasy hair and horrible warts.",ep:1,g:103,l:1,wd:true,fm:true,w:10,s:60,p:100};
