I[8237] = {n:"Red Piwi Belt",t:10,d:"This small belt will accentuate your hips if you\'re fighting in front of important people. It\'s also handy for holding your guts in if a plain boar rips you open in the depths of a forest.",ep:1,g:96,l:1,wd:true,fm:true,w:1,s:60,p:1};
