I[8249] = {n:"Drinker Feather",t:53,d:"This alcohol-soaked feather is extremely inflammable. It\'s very useful for roasting Drinkers.",ep:13,g:2,l:1,wd:true,fm:true,w:1,p:1};
I[8250] = {n:"Crowfox Hair",t:54,d:"The Crowfox loves to dress up as a Crow. No one really knows why, but most people have something to say on the subject.",ep:13,g:5,l:1,wd:true,fm:true,w:1,p:1};
I[8251] = {n:"Peki Hair",t:54,d:"Who would have believed that a Peki would accept to give away a bunch of hair just to please you? No one, besides Garlik Jorisk, famous doofus of Amakna, renowned for his dishonesty, and his pathological affection for stuffed Pekis.",ep:18,g:6,l:1,wd:true,fm:true,w:1,p:1};
I[8252] = {n:"Tamed Crow Feather",t:53,d:"This greasy feather belongs to a Tamed Crow who spent most of his life locked up and force-fed until he became fat enough to completely fill the space of his cage.",ep:13,g:3,l:1,wd:true,fm:true,w:1,p:1};
I[8253] = {n:"Sponge Amulet",t:1,d:"This amulet is often mistaken for a lucky-bag gift... It\'s actually something you win at the shooting range.",ep:1,g:106,l:11,wd:true,fm:true,w:2,s:63,p:525};
I[8254] = {n:"Sponge Ring",t:9,d:"Offered as a wedding ring, this ring sends two subliminal messages to the wearer: " + "\"" + "I love you" + "\"" + " and " + "\"" + "Go do the dishes" + "\"" + ". Perfect for those who hate wasting their time repeating the same things over and over again.",ep:1,g:112,l:10,wd:true,fm:true,w:2,s:63,p:500};
I[8255] = {n:"Sponge Shovel",t:8,d:"Many inexperienced adventurers will remember this terribly powerful weapon, used as a defence against sods of earth. If you wet it, it becomes soft and can be rolled about, though it generally takes at least two weaklings like yourself to manage it.",ep:1,g:44,l:10,wd:true,fm:true,w:10,an:16,e:[5,5,1,1,50,50,false,true],s:63,p:500};
I[8256] = {n:"Sponge Boots",t:11,d:"With these boots, Eniripsas can walk on water... which is quite useless since they can fly anyway, but it always impresses the crowds. Normal folk can always use these boots to exfoliate their feet while they sit around the house...",ep:1,g:84,l:11,wd:true,fm:true,w:5,s:63,p:525};
I[8257] = {n:"Sponge Belt",t:10,d:"This belt allowed Vald to take his seasonal bath without putting his life in danger. Indeed, no Iop ever succeeded in learning so much as the doggy paddle.",ep:1,g:102,l:10,wd:true,fm:true,w:5,s:63,p:500};
I[8258] = {n:"Sponge Cape",t:17,d:"This cape is perfect for camouflaging yourself in the natural environment. Well, it\'s more like you\'ll be adding a pleasant touch to the countryside, but hey, who wants to be invisible anyway?",ep:1,g:109,l:10,wd:true,fm:true,w:1,s:63,p:505};
I[8259] = {n:"Sponge Helmet",t:16,d:"Instructions: " + "\"" + "Offer this helmet to your husband. Firmly attach it to his head and drag him by his feet around your kitchen. You now have a clean, shining floor. Be careful not to drown him when rinsing the helmet off." + "\"" + " This sums up the state of the modern marriage. Bloody feminists.",ep:1,g:143,l:11,wd:true,fm:true,w:10,s:63,p:525};
I[8260] = {n:"Kaliptus Headband",t:16,d:"This headband will make Iops more handsome than ever!",ep:20,g:124,l:133,wd:true,fm:true,w:10,p:43500};
I[8262] = {n:"Amoolet",t:1,d:"The Amoolet holds a strange substance that is only found in the guts of a Moowolf. Some say it\'s the monster\'s essence, others say it\'s just the semi-digested remains of a Kirball.",ep:20,g:107,l:143,wd:true,fm:true,w:1,s:55,p:44850};
I[8263] = {n:"Moowolf Ring",t:9,d:"Beware! This ring will make your finger stink, although the foul smell may cover a worse odour. Actually, that might be the best thing that could happen to your finger, your hands, and the people around you, to be honest.",ep:20,g:113,l:126,wd:true,fm:true,w:10,s:55,p:40190};
I[8264] = {n:"Moowolf Boots",t:11,d:"Ubiquitous boots that are still driven by the voracious appetite of the Moowolf. If your feet smell of Clakoss, these boots will probably bite them.",ep:18,g:85,l:131,wd:true,fm:true,w:20,s:55,p:42840};
I[8265] = {n:"Moowolf Cape",t:17,d:"The Moowolf\'s beautiful, fluffy tail is so long that it trails on the ground. Driven into a jealous rage, some adventurers pulled it off and they now wear it to increase fertility.",ep:20,g:110,l:139,wd:true,fm:true,w:10,s:55,p:44500};
I[8266] = {n:"Moowolf Belt",t:10,d:"This coloured belt has a wonderful purple tuft on the front and if you wear it back to front you can pretend to be a Wabbit.",ep:20,g:103,l:125,wd:true,fm:true,w:1,s:55,p:1};
I[8267] = {n:"Moowolf Headgear",t:16,d:"While dismembering the Moowolf, hunters discovered that it only has one big horn going right through its skull. That doesn\'t seem to bother Iops, who wear it proudly anyway.",ep:4,g:144,l:141,wd:true,fm:true,w:10,s:55,p:44600};
I[8268] = {n:"Minotoror Necklace",t:1,d:"This necklace protected the Minotoror from getting fleas, ticks and even lice. You can be the judge of whether you need it or not.",ep:18,g:112,l:111,wd:true,fm:true,w:1,s:54,p:31260};
I[8269] = {n:"Minotoror Ring",t:9,d:"Unlike what some adventurers may think, this ring was never worn by the Minotoror who was unable to fit such a delicate thing around his hoofs.",ep:21,g:117,l:105,wd:true,fm:true,w:1,s:54,p:28010};
I[8270] = {n:"Minotot Bracelet",t:9,d:"This bracelet fully protects the arm of an Eniripsa, but triples its weight.",ep:21,g:116,l:151,wd:true,fm:true,w:10,s:57,p:45425};
I[8271] = {n:"Dragon Pig Ring",t:9,d:"This ring of leather and ivory makes it easier for you to stimulate your partner.",ep:18,g:115,l:108,wd:true,fm:true,w:1,s:58,p:29600};
I[8272] = {n:"Minotot Necklace",t:1,d:"This necklace protects the Minotot\'s cervical vertebrae from lethal Wabbit punches.",ep:21,g:111,l:158,wd:true,fm:true,w:20,s:57,p:47800};
I[8273] = {n:"Dragon Pig Necklace",t:1,d:"This necklace comes with a small loop so the owner of the Dragon Pig can attach a leash to it. It also does wonders for Dragon Pig lice.",ep:21,g:110,l:100,wd:true,fm:true,w:1,s:58,p:25470};
I[8274] = {n:"Minotoror Axe",t:19,d:"This very axe actually beheaded one of the most dangerous Minotorors in the province of Amakna. What I can\'t believe is that you don\'t seem to care!",ep:21,g:44,l:109,wd:true,fm:true,w:10,an:17,tw:true,e:[5,5,1,1,40,50,false,true],s:54,p:30110};
I[8275] = {n:"Minotot Sceptre",t:4,d:"This sceptre with a Serpentine head made of precious stones at one end enables you to scare away young adventurers and kick their pinky butts.",ep:21,g:67,l:151,wd:true,fm:true,w:50,an:12,tw:true,e:[5,4,1,1,40,50,false,false],s:57,p:46200};
I[8276] = {n:"Minotoror Boots",t:11,d:"You won\'t go winning the legendary race of Amakna Bay with these terrible boots of Minotoror Hair and leather. You might manage to break the competitors\' toes on the starting line, though.",ep:21,g:89,l:113,wd:true,fm:true,w:40,s:54,p:32290};
I[8277] = {n:"Minotot Sandals",t:11,d:"These incredible sandals will enable you to bathe in the most dangerous waters without hurting your feet. However, be careful they\'re said to scratch the bottom of bathtubs.",ep:21,g:88,l:163,wd:true,fm:true,w:20,s:57,p:48400};
I[8278] = {n:"Dragon Pig Mules",t:11,d:"A good pair of mules at your side and you\'ll feel stronger, more powerful and deadlier than ever. They\'re just ordinary mules, though. It must be the vibes they give off...",ep:20,g:87,l:93,wd:true,fm:true,w:5,s:58,p:22800};
I[8279] = {n:"Minotoror Cloak",t:17,d:"Take a Minotoror. Firmly tie him up. Take a giant plane and peel his back at one go. There! You\'ve got your Minotoror Cloak!",ep:21,g:117,l:109,wd:true,fm:true,w:10,s:54,p:30500};
I[8280] = {n:"Minotot Cloak",t:17,d:"This is the perfect cloak to go out or practice your seduction skills at the Captain Chafer\'s masked ball.",ep:21,g:116,l:156,wd:true,fm:true,w:40,s:57,p:48850};
I[8281] = {n:"Dragon Pig Cloak",t:17,d:"This cloak will not turn you into a Piglet but at least you\'ll be able dress up for one night and seduce a beautiful sow.",ep:20,g:118,l:103,wd:true,fm:true,w:10,s:58,p:27500};
I[8282] = {n:"Minotoror Belt",t:10,d:"This supple belt can be used to whip unruly kids\' bottoms. Its buckle might even mark their skin but this would only teach them their lesson once and for all.",ep:21,g:106,l:111,wd:true,fm:true,w:1,s:54,p:1};
I[8283] = {n:"Minotot Belt",t:10,d:"The Minotot used this stiff belt to hold his huge potbelly in, preventing him from toppling over every time he felt a draught.",ep:21,g:105,l:149,wd:true,fm:true,w:30,s:57,p:49950};
I[8284] = {n:"Minotot Headgear",t:16,d:"This headgear has been passed down from generation to generation through the Minotot family. This partially explains why it smells like rotting dandruff.",ep:21,g:151,l:157,wd:true,fm:true,w:20,s:57,p:47652};
I[8285] = {n:"Dragon Pig Headgear",t:16,d:"With this huge skull on, you\'ll look like a stiff-bristled Grizball, but with no hair. Your admirers will be speechless.",ep:20,g:150,l:98,wd:true,fm:true,w:10,s:58,p:24500};
I[8286] = {n:"Dreggon Cape",t:17,d:"According to the legend, this scale-covered cape will protect you from lightning, beans and femmes fatales, whatever they are.",ep:11,g:115,l:127,wd:true,fm:true,w:10,s:56,p:41000};
I[8287] = {n:"Dreggon Helmet",t:16,d:"A little angel like you could easily pass for a merciless warrior with such a terrifying and disproportionate helmet on. If that doesn\'t work, it\'ll make a great cloak rack.",ep:11,g:149,l:128,wd:true,fm:true,w:10,s:56,p:41500};
I[8288] = {n:"Dreggon Belt",t:10,d:"The most perverted minds in Amakna used to say that this belt could be used as a fake limb. Fortunately the rumour was exposed as lied... it\'s just a plain Dreggon Belt.",ep:20,g:104,l:124,wd:true,fm:true,w:1,s:56,p:1};
I[8289] = {n:"Dreggon Ring",t:9,d:"This ring, directly cut in the shape of a giant Dreggon scale will protect a small part of your phalanx. Maybe the most important part...",ep:20,g:114,l:128,wd:true,fm:true,w:10,s:56,p:41468};
I[8290] = {n:"Dreggon Amulet",t:1,d:"Made of Dreggon scales, this amulet will efficiently protect your Adam\'s apple or your tonsils. It will make all the difference on a battlefield.",ep:11,g:108,l:124,wd:true,fm:true,w:1,s:56,p:38930};
I[8291] = {n:"Dreggon Boots",t:11,d:"These boots are perfect to kill Gobballs while playing Gobbowl or to make your enemies suffer some more during Spanking sessions.",ep:20,g:86,l:129,wd:true,fm:true,w:20,s:56,p:41500};
I[8292] = {n:"Dreggon Sword",t:6,d:"You\'ll end up without a nose if you use this sword to shave your face. Save it for your back.",ep:11,g:68,l:127,wd:true,fm:true,w:30,an:14,e:[8,5,1,1,40,50,false,true],c:"CS>200&CA>200",p:41025};
I[8293] = {n:"Dreggon Axe",t:19,d:"This axe cuts through skulls like a hot knife through butter.",ep:20,g:43,l:126,wd:true,fm:true,w:20,an:17,tw:true,e:[5,4,1,1,40,50,false,false],c:"CC>180&CW>80",p:40854};
I[8294] = {n:"Dreggon Hammer",t:7,d:"Heavier than an empty Munchor Skull, but less solid than a Cave-dwelling Kirball femur, this hammer is nevertheless quite a fearsome weapon.",ep:20,g:59,l:123,wd:true,fm:true,w:30,an:15,e:[10,5,1,1,45,50,false,true],c:"CI>200&CC>100",p:38542};
I[8295] = {n:"Dreggon Bow",t:2,d:"This bow is so powerful that it can send Dreggon eggs over the great wall of Brakmar. What a wonderful waste of food!",ep:20,g:55,l:122,wd:true,fm:true,w:20,an:10,tw:true,e:[10,5,2,8,40,50,false,true],c:"CS>300&CV>250",p:38015};
I[8296] = {n:"Dreggon Wand",t:3,d:"This wand seems to be a lot more effective when it\'s used as a club or as a Moskito swatter!",ep:21,g:60,l:124,wd:true,fm:true,w:10,an:11,e:[5,3,2,5,30,30,false,true],c:"CI>100&CA>200",p:37884};
I[8297] = {n:"Dreggon Staff",t:4,d:"One end of this staff is armed with a long, sharp point. No one knows where it came from, but you can guess where it usually goes.",ep:20,g:66,l:124,wd:true,fm:true,w:30,an:12,tw:true,e:[5,5,1,1,30,50,false,true],c:"CS>300&CA>150&CV>300",p:39800};
I[8298] = {n:"Shika\'s Ears",t:1,d:"Shika used to help Farle at harvest time by picking up the magic grain his scythe swiped. She used it to make necklaces. Though their roots and stalks have been cut off, these magic ears keep on ripening every year around the same time.",ep:18,g:113,l:80,wd:true,fm:true,w:5,s:53,p:16500};
I[8299] = {n:"Shika\'s Magic Bracelet",t:9,d:"This bracelet covered up Shika\'s arms. This way it protected her from sunburn and Crow pecks... the little creatures were attracted by her stunning beauty and many claim to have gotten lucky with her.",ep:21,g:118,l:80,wd:true,fm:true,w:5,s:53,p:16500};
I[8300] = {n:"Shika\'s Staff",t:4,d:"This custom made staff helped Shika make the highest haystacks in all of Amakna. Legend has it that they were so big that sailors used them as markers to tell how far they were from land. Now you know why sailors have a fear of harvesting.",ep:20,g:69,l:80,wd:true,fm:true,w:10,an:12,e:[10,5,1,1,45,45,false,false],s:53,p:16500};
I[8301] = {n:"Shika\'s Clogs",t:11,d:"These clogs were created for Shika so that she wouldn\'t trample the seedbeds of the Snossios plains. The high-heels make it easier to run in the stubble without hurting her ankles and stop the dew getting in.",ep:21,g:91,l:80,wd:true,fm:true,w:10,s:53,p:16600};
I[8302] = {n:"Shika\'s Cape",t:17,d:"Flowers from harvest time have been sewn to this cape made of woven magic cereals. It\'s driven by such a powerful magic that Shika used to use it for protection against lightning on stormy nights!",ep:20,g:120,l:80,wd:true,fm:true,w:10,s:53,p:16500};
I[8303] = {n:"Shika\'s Belt",t:10,d:"This belt of leather used to protect Shika\'s thighs when she ran across the wheat fields to bring back to their herd lost Gobballs. Covered with pollen from magic cereals, legend says that it used to shimmer in the moonlight and ensured Farle didn\'t cut his wife\'s legs while reaping fields of cereals at night.",ep:21,g:107,l:80,wd:true,fm:true,w:10,s:53,p:16500};
I[8304] = {n:"Shika\'s Hat",t:16,d:"Covered with a multitude of flowers, this hat made Shika look happy and bright when she left at the crack of dawn to plough the Church Hills.",ep:20,g:156,l:80,wd:true,fm:true,w:10,s:53,p:16500};
I[8305] = {n:"Mumminotor Relic",t:24,d:"This strange relic is essential for you to meet the Minotoror.",ep:21,g:119,l:1,wd:false,fm:true,w:0,p:1};
I[8306] = {n:"Deminoball Relic",t:24,d:"This strange relic is essential for you to meet the Minotoror.",ep:21,g:120,l:1,wd:false,fm:true,w:0,p:1};
I[8307] = {n:"Key to the Minotot Room",t:84,d:"Crafted from diverse materials, this key will grant you an audience with the terrifying Minotot. If you go the distance, it\'ll make a great story for the taverns and picnic tables of the land. You\'ll also have a sore ass, or perhaps the remnants of a sore ass, if you do live to tell the tale... Good luck!",ep:13,g:15,l:1,wd:true,fm:true,w:1,p:10};
I[8308] = {n:"Scaratos Shell",t:107,d:"This small shiny shell is very useful for creating nice jewellery at a low cost... You\'ll be able to sell it to an Astrubian for a fortune once you convince them it can make you fly.",ep:21,g:735,l:1,wd:true,fm:true,w:1,p:10};
I[8309] = {n:"Quetsnakiatl Feather",t:53,d:"This feather is covered with magic stone dust which explains why one unit of Quetsnakiatl feather is heavier than three units of Tofu feathers. It\'s all logical, you know.",ep:21,g:4,l:1,wd:true,fm:true,w:10,p:1};
I[8310] = {n:"Jellidice Jelly",t:110,d:"This jelly pot contains some repulsive-smelling substance with an appalling taste, and yet, you secretly dream to spread it all over your body, don\'t you. Your perversion is even greater than your gluttony.",ep:21,g:736,l:1,wd:true,fm:true,w:1,p:1};
I[8311] = {n:"Minokid Hair",t:54,d:"This hair seems to be covered with short-haired-Tuftie-musk based brylcreem and cave Kirball grease. They almost look appetizing.",ep:21,g:9,l:1,wd:true,fm:true,w:1,p:1};
I[8312] = {n:"Minoskito Skin",t:59,d:"Worn out by the sand and the sea salt, this skin is as thin as an old sock worn out by... sand and sea salt. Does that mean a healthy Minoskito looks like a fresh sock? Yes it does.",ep:21,g:604,l:1,wd:true,fm:true,w:1,p:1};
I[8313] = {n:"Minotoror Femur",t:47,d:"This bone is sturdy enough to be used as a girder or to break bricks in packs of ten. It comes in handy if you want to destroy your neighbour\'s house. Useless for people of sound mind.",ep:2,g:644,l:1,wd:true,fm:true,w:1,p:1};
I[8314] = {n:"Khamelerost Skin",t:59,d:"This roasted skin protects sensitive skins from rays of sunshine. It\'s a particularly close-fitting skin.",ep:21,g:603,l:1,wd:true,fm:true,w:1,p:1};
I[8315] = {n:"Manderisha Skin",t:59,d:"This spotted skin is said to be covered with a poison capable of changing anyone into a dried Karaball.",ep:21,g:602,l:1,wd:true,fm:true,w:1,p:1};
I[8316] = {n:"How to raise your Minifoux",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise a Minifoux.",ep:3,g:10,l:1,wd:false,fm:true,w:1,u:true,p:20};
I[8317] = {n:"How to raise your El Scarador",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise El Scarador.",ep:3,g:10,l:1,wd:false,fm:true,w:1,u:true,p:20};
I[8318] = {n:"How to raise your Treechster",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise a Treechster.",ep:3,g:10,l:1,wd:false,fm:true,w:1,u:true,p:20};
I[8319] = {n:"How to raise your Gobtubby",t:25,d:"This book was written by Oshimo Bigglip. It explains how to raise a Gobtubby.",ep:3,g:10,l:1,wd:false,fm:true,w:1,u:true,p:20};
I[8320] = {n:"Key to the Dragon Pig Den",t:84,d:"After getting lost in the Dragon Pig maze, you realised that you had forgotten the key to the Dragon Pig Den. Fortunately, your Porco pals had a spare with them.",ep:15,g:16,l:1,wd:true,fm:true,w:1,p:100};
I[8321] = {n:"Deminoball Hair",t:54,d:"It\'s useless insisting! These hairs are not edible.",ep:21,g:664,l:100,wd:true,fm:true,w:1,p:10};
I[8322] = {n:"Mumminotor Hair",t:54,d:"Under its bandages, the Mumminotor hides a very soft down that would make the most coquettish of princesses jealous.",ep:21,g:663,l:100,wd:true,fm:true,w:1,p:10};
I[8323] = {n:"Deminoball Leather",t:56,d:"This rough, cracked leather will remind you of your beloved\'s cheeks.",ep:21,g:657,l:100,wd:true,fm:true,w:1,p:10};
I[8324] = {n:"Mumminotor Leather",t:56,d:"The Mumminotor always had sensitive skin, that\'s why he has to cover himself up with bandages. Spiteful gossips say that it\'s to hide other shocking things....",ep:21,g:656,l:100,wd:true,fm:true,w:1,p:10};
I[8325] = {n:"Mumminotor Headgear",t:16,d:"If you want to protect your pretty face from the ravages of time, we suggest this headgear. It makes a great adult nappy too...",ep:0,g:157,l:110,wd:false,fm:true,w:10,s:59,p:100};
I[8326] = {n:"Mumminotor Bandage",t:15,d:"Wrapped up around the horns but especially around the private parts of the Mumminotor, this bandage became impregnated with the Mumminotor\'s magic with the passing years. Smelly and terrifying, this bandage is much sought after by the fetiologists of the world.",ep:21,g:734,l:100,wd:true,fm:true,w:1,p:10};
I[8327] = {n:"Deminoball Horn",t:47,d:"At first sight, this impressive horn does not seem to be very useful. And even when you take a closer look at it, it doesn\'t seem very useful - a bit like an army of ticks.",ep:21,g:643,l:100,wd:true,fm:true,w:1,p:10};
I[8328] = {n:"Mumminotor Horn",t:47,d:"Wrapped up in a magic bandage, this horn must be extremely expensive, very precious, awfully smelly and cursed. A bit like a mummy would be.",ep:21,g:642,l:100,wd:true,fm:true,w:1,p:10};
I[8329] = {n:"TEST",t:84,d:"x",ep:1,g:0,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8330] = {n:"Flying Dreggon Headgear",t:16,d:"This small headgear enables the Flying Dreggon to attack his enemies without bumping his head. It\'s been used for a long time on the greater worksite of Amakna. This headgear became quite popular after the invasion of Astrub by Moowolves coming from the Kruup Mountain. There\'s no logic in this story... so what?",ep:13,g:152,l:72,wd:true,fm:true,w:10,p:16000};
I[8331] = {n:"Dragostess Hat",t:16,d:"With this hat on, you\'ll be able to dress up and seduce any naive Astrubian you find... Just offer him a hot date for 100 Kamas, and Bob\'s your uncle, his wallet\'s empty.",ep:18,g:153,l:95,wd:true,fm:true,w:10,p:23000};
I[8333] = {n:"Santa Jaws Cape",t:17,d:"This mysterious cape only comes out once a year, but the scammers always use it to get a fast buck from the kiddies.",ep:1,g:119,l:19,wd:true,fm:true,w:10,p:1205};
I[8334] = {n:"Santa Jaws Hat",t:16,d:"This hat will hide the scars all over your head. That way, no more toddlers will be injured trying to flee in terror from your Santa stall.",ep:1,g:155,l:22,wd:true,fm:true,w:10,p:1478};
I[8335] = {n:"Tiny Kwismas Present",t:89,d:"The Amakna Team sends you its warmest season\'s greetings. This present will make you happier than you\'ve ever been before... Won\'t it?",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8336] = {n:"Small Kwismas Present",t:89,d:"The Amakna Team sends you its warmest season\'s greetings. This present will make you happier than you\'ve ever been before... Won\'t it?",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8337] = {n:"Kwismas Present",t:89,d:"The Amakna Team sends you its warmest season\'s greetings. This present will make you happier than you\'ve ever been before... Won\'t it?",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8338] = {n:"Kwismas Sword",t:6,d:"This strange sword sure won\'t make you invincible... In fact, people have died trying to kill snowmen with it.",ep:1,g:69,l:1,wd:false,fm:true,w:1,an:14,e:[1,1,1,1,2,2,false,true],p:1};
I[8339] = {n:"Big Kwismas Present",t:89,d:"The Amakna Team sends you its warmest season\'s greetings. This present will make you happier than you\'ve ever been before... Won\'t it?",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8340] = {n:"Incredible Kwismas Present",t:89,d:"The Amakna Team sends you its warmest season\'s greetings. This present will make you happier than you\'ve ever been before... Won\'t it?",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8341] = {n:"Pineapple Boots",t:11,d:"These boots smell of pineapple juice marinated with wet socks. The great thing is that when you visit your friends, they will never ask you to take your shoes off.",ep:1,g:90,l:1,wd:true,fm:true,w:10,s:74,p:100};
I[8342] = {n:"Dreggon Sanctuary Key",t:84,d:"This key, made of pressure-bonded Dreggon shells, will give you access to the terrible Dreggon Sanctuary, reputed for its awkwardly silent inhabitants.",ep:10,g:18,l:1,wd:true,fm:true,w:1,p:100};
I[8343] = {n:"Dreggon Dungeon Key",t:84,d:"You thought you\'d seen it all in the Dreggon Sanctuary, but NO! Not by a long shot. In fact, I\'m betting this key leads you to your death.",ep:10,g:17,l:1,wd:true,fm:true,w:1,p:100};
I[8344] = {n:"Black Dragoss Horn",t:47,d:"It\'s not as pointy as a Xelor clock-hand but it\'s a lot more solid. This horn enables the Dragoss to transform a Spanking session into a Cracking one.",ep:11,g:648,l:50,wd:true,fm:true,w:1,p:10};
I[8345] = {n:"Sapphire Dragoss Horn",t:47,d:"It\'s not as pointy as a Xelor clock-hand but it\'s a lot more solid. This horn enables the Dragoss to transform Spanking session into a Cracking one.",ep:11,g:647,l:50,wd:true,fm:true,w:1,p:10};
I[8346] = {n:"White Dragoss Horn",t:47,d:"It\'s not as pointy as a Xelor clock-hand but it\'s a lot more solid. This horn enables the Dragoss to transform Spanking session into a Cracking one.",ep:11,g:646,l:50,wd:true,fm:true,w:1,p:10};
