I[8348] = {n:"Black Dragoss Shell",t:111,d:"You can use this shell to protect what\'s most precious to you.",ep:11,g:738,l:50,wd:true,fm:true,w:1,p:10};
I[8349] = {n:"Sapphire Dragoss Shell",t:111,d:"You can use this shell to protect what\'s most precious to you.",ep:11,g:739,l:50,wd:true,fm:true,w:1,p:10};
I[8350] = {n:"White Dragoss Shell",t:111,d:"You can use this shell to protect what\'s most precious to you.",ep:11,g:740,l:50,wd:true,fm:true,w:1,p:10};
I[8351] = {n:"Golden Dragoss Shell",t:111,d:"You can use this shell to protect what\'s most precious to you.",ep:11,g:741,l:50,wd:true,fm:true,w:1,p:10};
I[8352] = {n:"Black Dragoss Scale",t:59,d:"You could use this scale to make a very nice pair of boots or fighting underwear.",ep:11,g:606,l:50,wd:true,fm:true,w:1,p:10};
