I[8354] = {n:"White Dragoss Scale",t:59,d:"You could use this scale to make a very nice pair of boots or fighting underwear.",ep:11,g:607,l:50,wd:true,fm:true,w:1,p:10};
I[8355] = {n:"Golden Dragoss Scale",t:59,d:"You could use this scale to make a very nice pair of boots or fighting underwear.",ep:11,g:605,l:50,wd:true,fm:true,w:1,p:10};
I[8356] = {n:"Dragostess Skin",t:59,d:"Smooth and perfumed with young adventurers\' blood, this skin makes Dragostesses irresistible. Used to make boots or belts, this skin can be washed in a washing machine at any temperature.",ep:11,g:609,l:70,wd:true,fm:true,w:1,p:1};
I[8357] = {n:"Dragostess Horn",t:47,d:"The Dragostess has two small horns at the back of her head with which she detects the love waves that float through the air during mating season... which never really ends for the Dreggons.",ep:11,g:649,l:70,wd:true,fm:true,w:1,p:10};
I[8358] = {n:"Dragostess Protection",t:111,d:"This pair of Dreggon shells protects the Dragostess from love at first sight. Males can also use it, but they\'ll have to wear it below the belt.",ep:11,g:742,l:70,wd:true,fm:true,w:1,p:10};
I[8359] = {n:"Flying Dreggon Wing",t:104,d:"Even when this wing is damaged, torn and burnt, the Flying Dreggon can still freely fly above void like a young carefree Moskito.",ep:11,g:743,l:80,wd:true,fm:true,w:1,p:10};
I[8360] = {n:"Flying Dreggon Skin",t:59,d:"This dark skin is covered with a multitude of small scales that are supposed to improve the aerodynamics of the Flying Dreggon. In fact, they\'re useless and only make people talk.",ep:11,g:610,l:70,wd:true,fm:true,w:1,p:10};
I[8361] = {n:"Flying Dreggon Horn",t:47,d:"The Flying Dreggon uses this horn as an aiming device to help him hit his targets when he drinks and flies.",ep:11,g:650,l:70,wd:true,fm:true,w:1,p:10};
I[8362] = {n:"Dreggon Warrior Skin",t:59,d:"Tough enough to resist its own blade, Dreggon Warrior skin is also renowned for being edible... you\'ll have to boil it for several years first though.",ep:11,g:611,l:80,wd:true,fm:true,w:1,p:10};
I[8363] = {n:"Dreggon Warrior Horn",t:47,d:"The Dreggon Warrior has three different horns: two on the back of his head and a third one on his snout. After a fight, a horn usually ends up in the behind of his victim and the two others stuck up in the nostrils of the foolhardy challenger. But from time to time, the Dreggon Warrior mistakes the behind for the nostrils. This only makes it worse for his victims.",ep:11,g:651,l:80,wd:true,fm:true,w:1,p:10};
I[8364] = {n:"Dreggon Warrior Leather Strap ",t:15,d:"This leather strap enables the Dreggon Warrior to attach his shoulder pad or to replace his shoulder strap.",ep:11,g:744,l:80,wd:true,fm:true,w:1,p:10};
I[8365] = {n:"Crocabulia\'s Broken Horn",t:47,d:"Crocabulia broke her horn in a terrible fight while protecting the egg from which Crocoburio hatched some 15 years later.",ep:11,g:652,l:400,wd:true,fm:true,w:1,p:10};
I[8366] = {n:"Little Red Waddling Cape",t:17,d:"This cape used to belong to a famous Capon, a long-feathered bird that loved to dance in front of the Bonta Zaap where all the gullible poultry and immature chicken hang out.",ep:22,g:121,l:171,wd:true,fm:true,w:10,p:49200};
I[8367] = {n:"Crocabulia Skin",t:59,d:"You could use this red skin to make a Little Red Waddling Cape, but your tailor would be very confused. " + "\"" + "This recipe has produced nothing!" + "\"" + " they would cry, somewhat awkwardly.",ep:11,g:612,l:400,wd:true,fm:true,w:1,p:10};
I[8368] = {n:"Crocabulia Tooth",t:47,d:"This huge tooth was pulled out at the very last minute, right before Crocabulia closed her mouth for the very last time.",ep:11,g:653,l:400,wd:true,fm:true,w:1,p:10};
I[8369] = {n:"Terrakubiack the Warrior Shell Fragment",t:111,d:"This shell fragment belonging to Terrakubiack the Warrior should help you make a key to access the Dreggon Sanctuary.",ep:10,g:750,l:80,wd:true,fm:true,w:1,p:10};
I[8370] = {n:"Ignilicrobur the Warrior Shell Fragment",t:111,d:"This shell fragment belonging to Ignilicrobur the Warrior should help you make a key to access the Dreggon Sanctuary.",ep:10,g:749,l:80,wd:true,fm:true,w:1,p:10};
I[8371] = {n:"Aeroktor the Warrior Shell Fragment",t:111,d:"This shell fragment belonging to Aeroktor the Warrior should help you make a key to access the Dreggon Sanctuary.",ep:10,g:748,l:80,wd:true,fm:true,w:1,p:10};
I[8372] = {n:"Aquabralak the Warrior Shell Fragment",t:111,d:"This shell fragment belonging to Aquabralak the Warrior should help you make a key to access the Dreggon Sanctuary.",ep:10,g:747,l:80,wd:true,fm:true,w:1,p:10};
I[8373] = {n:"Stone of Ignirkocropos the Famished",t:51,d:"This stone can release a powerful magic wave that will activate and open a magic door, if and only if it is combined with the three other missing stones.",ep:10,g:463,l:100,wd:true,fm:true,w:1,p:10};
I[8374] = {n:"Stone of Aqualikros the Merciless",t:51,d:"This stone can release a powerful magic wave that will activate and open a magic door, if and only if it is combined with the three other missing stones.",ep:10,g:460,l:100,wd:true,fm:true,w:1,p:10};
I[8375] = {n:"Stone of Terraburkahl the Perfidious",t:51,d:"This stone can release a powerful magic wave that will activate and open a magic door, if and only if it is combined with the three other missing stones.",ep:10,g:461,l:100,wd:true,fm:true,w:1,p:10};
I[8376] = {n:"Stone of Aerogoburius the Malicious",t:51,d:"This stone can release a powerful magic wave that will activate and open a magic door, if and only if it is combined with the three other missing stones.",ep:10,g:462,l:100,wd:true,fm:true,w:1,p:10};
I[8377] = {n:"Handyman Rune",t:88,d:"Handymen use this stone to give their position to clients.",ep:18,g:12,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8378] = {n:"Magic Fragment",t:88,d:"This fragment contains some magic transferred by an ancient object. You should be able to get a few magic runes out of it at least.",ep:1,g:44,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8379] = {n:"Vie Rune",t:78,d:"This small rune will make you more hardy.",ep:1,g:59,l:20,wd:true,fm:true,w:1,p:10};
I[8380] = {n:"Peki Fabric",t:55,d:"This fabric used to cover up the Peki\'s hairy behind until you rubbed it up the wrong way.",ep:18,g:721,l:400,wd:true,fm:true,w:10,p:100};
I[8381] = {n:"Magic Peki Tail",t:65,d:"This tail is so magic that it still wiggles even after it\'s been cut, dried and stuffed! It you\'re smart enough, you\'ll find it another use for it than hanging it above your fireplace.",ep:18,g:751,l:400,wd:true,fm:true,w:10,p:100};
I[8383] = {n:"Moon Skin",t:59,d:"Deprived of his soft skin, poor Moon was taken by surprise and could only run away in the jungle screaming with pain. This is a nice bedtime story you\'ll enjoy telling your kids to make them go to sleep.",ep:12,g:613,l:200,wd:true,fm:true,w:1,p:10};
I[8384] = {n:"Magic Moon Fabric",t:55,d:"This fabric seems to be magic and you find it hard to believe. But one day, you\'ll have to face the truth... You\'re just too stupid to tell if something\'s magic or not. Do not follow your Astrubian killer instinct... trust all these descriptions.",ep:12,g:722,l:200,wd:true,fm:true,w:1,p:100};
I[8385] = {n:"Shin Larva Skin",t:59,d:"This Shin Larva skin is even more sticky and slimy than you\'d have ever imagined. It reminds you of the last princess you rescued.",ep:5,g:614,l:100,wd:true,fm:true,w:1,p:10};
I[8386] = {n:"Shin Larva Tooth",t:47,d:"No one would have ever believed that a Shin Larva would actually have a mouth full of teeth. It\'s probably because Shin Larvae only have one tooth.",ep:5,g:654,l:100,wd:true,fm:true,w:1,p:10};
I[8387] = {n:"Vibrating Royal Tofu Feather",t:53,d:"More royal than the Royal Tofu feather, more vibrating than the Vibrating Kirball of the Kruup mines, this feather will tickle whoever you want, wherever you want. The instructions say that it should be easy to look after.",ep:3,g:645,l:200,wd:true,fm:true,w:1,p:10};
I[8388] = {n:"Bworkette Skin",t:59,d:"The Bworkette let you take some of her skin in exchange for your clemency. But she forgot to tell you that she told her big brother Bworker... he might want some of yours in exchange!",ep:4,g:615,l:100,wd:true,fm:true,w:1,p:10};
I[8389] = {n:"Bworkette Hair",t:54,d:"The Bworkette has very soft skin everywhere but under her arms. Well, the little cookies she makes have to be flavoured somehow, don\'t they?",ep:4,g:665,l:100,wd:true,fm:true,w:1,p:10};
I[8390] = {n:"Farle\'s Pig Skin",t:59,d:"If you believe the breeders, Farle was the greatest breeder of all. But then again, they were all jealous of Shika. Anyway, what\'s certain is Farle is the one who created Farle\'s Pigs. Another certainty is that he wasn\'t the most handsome creature - the pigs were created in his own image.",ep:15,g:616,l:50,wd:true,fm:true,w:1,p:10};
I[8391] = {n:"Dorgan Ation Skin",t:59,d:"Dorgan Ation has once more been extremely generous with you in spite of his bad temper. He gave you his skin before leaving and moaning like a Lousy Pig. What a nerve!",ep:15,g:617,l:60,wd:true,fm:true,w:1,p:10};
I[8392] = {n:"Blodz Uker Skin",t:59,d:"You used a cheese grater to scrape this skin off a poor Blodz Uker. No doubt he will remember that terrible event for life. Don\'t count on him to tell you the way next time you get lost in his maze.",ep:15,g:618,l:60,wd:true,fm:true,w:1,p:10};
I[8393] = {n:"Dragon Pig Hair",t:54,d:"Though you\'ve searched thoroughly, you couldn\'t find out where this Dragon Pig hair came from. Search some more. The Dragon Pig\'s anatomy is full of surprises...",ep:2,g:666,l:100,wd:true,fm:true,w:1,p:10};
I[8394] = {n:"Mega Legendary Crackler Rock",t:51,d:"This humongous rock looks like a rock from the Legendary Crackler, but it is not. It\'s a lot more special than that!",ep:5,g:464,l:100,wd:true,fm:true,w:1,p:10};
I[8396] = {n:"Boowolf Mojo",t:15,d:"This small flask contains all the virile power of the Boowolf. Be careful! Its contents are not edible.",ep:1,g:752,l:1,wd:true,fm:true,w:1,p:1};
I[8397] = {n:"Wa Wabbit Hair",t:54,d:"The Wa Wabbit is usually quite miserly and balks at sharing its hairs. Exceptionally, to reward your courage (or buy your clemency), he has decided to give you one of his body parts. How touching!",ep:2,g:667,l:100,wd:true,fm:true,w:1,p:10};
I[8398] = {n:"Wa Wabbit Fabric",t:55,d:"No one really knows where the Wa Wabbit got this fabric and no one seems to be willing to know either. Disturbing and disquieting, the origin of the fabric remains one of the greatest mysteries of all Amakna.",ep:2,g:723,l:100,wd:true,fm:true,w:1,p:10};
I[8399] = {n:"Pandora Master Hair",t:54,d:"Once again, the Pandora Master tried to show off. Another lesson he won\'t forget. He\'d have been better off in his box.",ep:18,g:668,l:100,wd:true,fm:true,w:1,p:10};
I[8400] = {n:"Pandora Master Fabric",t:55,d:"Whether protecting the nape of his neck or his ample behind, this fabric saved the Pandora Master\'s life more than once! \nBut not this time, however...",ep:18,g:724,l:100,wd:true,fm:true,w:1,p:10};
I[8401] = {n:"Pandora Master Skin",t:59,d:"Worn out by magic attacks, dried out by the wind from Pandala Island, this skin is now of a very poor quality. But you seem to be attached to it as if you were trying to keep a precious memory from this courageous Pandora Master, who tried to kill you many times. It\'s at times like these that we see the difference between a real monster and a sissy.",ep:18,g:619,l:100,wd:true,fm:true,w:1,p:10};
I[8402] = {n:"Koolich Stone",t:51,d:"Though the Koolich is quite a generous thing, he wasn\'t exactly happy about giving you his big stone. And it\'s understandable, given what you\'re going to do with it.",ep:20,g:465,l:100,wd:true,fm:true,w:10,p:10};
I[8403] = {n:"Koolich Braid",t:15,d:"This huge braid was made by the Koolich himself, some years ago. With the passing years, it became as stiff as a rock. However, it still holds a foul, slimy liquid that attracts Moskitoes from time to time. The most surprising thing is that this braid used to perfectly suit the Koolich. Like a big Slob, you had the ridiculous idea to steal it.",ep:20,g:753,l:100,wd:true,fm:true,w:10,p:10};
I[8404] = {n:"Skeunk Skin",t:59,d:"This piece of skin probably comes from Skeunk\'s heels which can explain its nice yellowish colour. Though this old skin won\'t enable you to make fashionable clothes, you\'ll still be able to create " + "\"" + "retro" + "\"" + " ones that younger generations will love.",ep:20,g:620,l:400,wd:true,fm:true,w:1,p:100};
I[8405] = {n:"Skeunk Hair",t:54,d:"Skeunk thinks nothing of a full body-shave. Here\'s the proof.",ep:20,g:669,l:400,wd:true,fm:true,w:10,p:100};
I[8406] = {n:"Minotot Wool",t:57,d:"This wool is particularly thin making it possible for the Minotot not to have frizzy hair all over his body. No one knows why he has it. Maybe you should try to make hair grafts out of this wool so that you\'ll be able to display an abundant growth of brown hair on your chest. See, even your childhood dreams can come true!",ep:21,g:656,l:400,wd:true,fm:true,w:10,p:100};
I[8407] = {n:"Minotot Leather",t:56,d:"Almost as rare as Gobball leather, this leather is perfect for creations that require supple seams... leather masks, for example.",ep:21,g:658,l:100,wd:true,fm:true,w:1,p:10};
I[8408] = {n:"Minotot Hoof",t:47,d:"An enormous number of adventurers have been trampled by this hoof, but then so have many huge turds scattered around the Labyrinth of the Minotoror. You must understand that it\'s not easy for a charging Minotot to distinguish between the two at first glance.",ep:21,g:754,l:400,wd:true,fm:true,w:10,p:100};
I[8409] = {n:"Minotot Horn",t:47,d:"From a distance, this horn looks like a giant, extremely powerful Gobball horn. Surprisingly enough, from up close, it looks like a Minotot Horn.",ep:21,g:655,l:400,wd:true,fm:true,w:1,p:10};
I[8410] = {n:"Minotot Femur",t:47,d:"This impressive bone succeeded to bear the excess weight of the Minotot for centuries. Such a feet always deserves to be pointed out.",ep:21,g:656,l:400,wd:true,fm:true,w:10,p:100};
I[8411] = {n:"Mumminotor Amulet",t:1,d:"This cursed, bandage-covered amulet might help you overcome the curse of the Labyrinth of the Minotoror, but there\'s no guarantee... it might just be some tourist-stall junk. Who knows.",ep:0,g:114,l:111,wd:false,fm:true,w:5,s:59,p:31300};
I[8412] = {n:"Mumminotor Ring",t:9,d:"This ugly, stench-ridden ring is made out of Mumminotor bandages. It makes a great Band Aid when you catch your finger in one of the doors of the Labyrinth of the Minotoror - possibly the least of all your worries, but a comfort nonetheless.",ep:0,g:119,l:111,wd:false,fm:true,w:10,s:59,p:31525};
I[8413] = {n:"Mumminotor Hammer",t:7,d:"The rock at the end of this hammer is rolled in absorbent Mumminotor bandages for those home-based assassinations.",ep:0,g:60,l:112,wd:false,fm:true,w:10,an:15,tw:true,e:[5,4,1,1,50,50,false,false],c:"CC>100&CI>200&CW>150",s:59,p:100};
I[8414] = {n:"Dreggon Daggers",t:5,d:"These daggers are perfect for cutting the top off a soft-boiled Dreggon egg. They\'re also very light which enables you to run fast when the Dreggon community realizes what you\'ve done.",ep:20,g:58,l:128,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,30,false,true],c:"CS>150&CI>150&CA>100",p:39854};
I[8415] = {n:"Mumminotor Boots",t:11,d:"Padded and decorated with Mumminotor bandages, these boots are comfy and warm. They might even remind you of long-forgotten mother-cuddles.",ep:0,g:92,l:110,wd:false,fm:true,w:10,s:59,p:31255};
I[8416] = {n:"Mumminotor Cape",t:17,d:"Made from plaited Mumminotor bandages, this cape will give you a slow, sad, undead look. You\'ll be the envy of the town.",ep:0,g:122,l:111,wd:false,fm:true,w:10,s:59,p:31780};
I[8417] = {n:"Alani Shovel",t:8,d:"This small shovel was once given to a young Enutrof. He liked it so much that he took up digging full time. He dug his own grave when he was twenty eight and healthy... dug himself a whole graveyard, he still didn\'t die. His body was lost at sea first time he left home. How ironic.",ep:20,g:43,l:131,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,30,false,true],c:"CC>250&CA>100",p:42514};
I[8418] = {n:"Mumminotor Belt",t:10,d:"The origin of this large Mumminotor bandage is unknown. Its use is even more mysterious, since it actually speeds up decomposition. Great for an April Fool\'s Day trick. Just make sure you keep a list of all the good friends you give it to so you can tell them to take it off again.",ep:0,g:108,l:112,wd:false,fm:true,w:10,s:59,p:32255};
I[8419] = {n:"Shovel Ijah",t:8,d:"Captain Mayhav is said to have used this very shovel to rip open the great white Kralove known is Dopy Mick.",ep:20,g:42,l:115,wd:true,fm:true,w:20,an:16,tw:true,e:[10,4,1,1,50,50,false,true],c:"CC>200",p:33653};
I[8420] = {n:"Dreggon Shovel",t:8,d:"Dreggons like to dig networks of underground passages but they never use these shovels. The Enutrof community studied this enigma but concluded that it was less important to know where they came from than how to hit someone with one.",ep:20,g:45,l:127,wd:true,fm:true,w:20,an:16,tw:true,e:[10,4,1,1,40,40,false,true],c:"CC>200&CS>100",p:42154};
I[8421] = {n:"Bow Kennel Certificate: Baby Crowdzilla",t:77,d:"This certificate mentions all the characteristics of the Baby Crowdzilla you\'ve put in the Bow Kennels.",ep:3,g:41,l:1,wd:false,fm:true,w:1,p:100};
I[8424] = {n:"Breeder\'s Compensation Gift",t:89,d:"This gift is only meant for Breeders - it contains all kinds of breeding machines for your paddock. (Warning! The items contained in this gift are very heavy. You might be overweight when you open it.)",ep:1,g:32,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8425] = {n:"Purse of 10,000 Kamas",t:100,d:"This purse is very heavy - it must be worth a fortune. A tradesman will be happy to exchange it for its value in Kamas.",ep:1,g:56,l:1,wd:true,fm:true,w:10,u:true,p:100000};
I[8428] = {n:"Cloudy Invisibility Potion",t:12,d:"This potion allows you to return to your last save point without a trace.",ep:0,g:26,l:1,wd:true,fm:true,w:1,c:"(PX=3)|(PX=4)",u:true,ut:true,p:1};
I[8430] = {n:"Magic Yellow Balloon",t:94,d:"Unlike the fake ones you\'ll find at the Trool fair, this balloon can take off with grace and ease. A beauty to behold, it\'s handmade with Strawberry Jelly eyelid, according to the traditions of the great magus Betsy Krokerr.",ep:1,g:4,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8431] = {n:"Cyclonic Smoke Potion",t:12,d:"This smoke potion creates a whirling smoke screen which hides all your actions with style.",ep:0,g:29,l:1,wd:true,fm:true,w:1,c:"(PX=3)|(PX=4)",u:true,p:1};
I[8435] = {n:"Magic Red Balloon",t:94,d:"Unlike the fake ones you\'ll find at the Trool fair, this balloon can take off with grace and ease. A beauty to behold, it\'s handmade with Strawberry Jelly eyelid, according to the traditions of the great magus Betsy Krokerr.",ep:1,g:5,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8436] = {n:"Soft Oak Dungeon Key",t:84,d:"This key will grant you to access to the most intimate parts of the Soft Oak\'s anatomy... I bet you won\'t even know it when you get to the special place. As disturbing and exciting as the much loved Amaknan sport of naked Judo, this trip will not leave you empty handed, that\'s for sure...",ep:1,g:236,l:1,wd:true,fm:true,w:1,p:100};
I[8437] = {n:"Sand Dungeon Key",t:84,d:"This key, made of marine waste and sea shells, will grant you access to the beach with the whitest sand of all the Asse Sea Coast. (See \'Dedicated Asse-tourist\' Vol 1.8: \'An Asse with a view\')",ep:1,g:237,l:1,wd:true,fm:true,w:1,p:100};
I[8438] = {n:"Brakmarian Rat Dungeon Key",t:84,d:"This key will let you into the Rat dungeon located deep in the sewers of Brakmar. No need for a disguise, you\'ll go unnoticed even if you\'re not a Brakmarian.",ep:1,g:238,l:1,wd:true,fm:true,w:1,p:100};
I[8439] = {n:"Bontarian Rat Dungeon Key",t:84,d:"This key will let you into the Rat dungeon located deep in the sewers of Bonta. No need for a disguise, you\'ll go unnoticed even if you\'re not a Bontarian.",ep:1,g:239,l:1,wd:true,fm:true,w:1,p:100};
I[8441] = {n:"Billalo",t:16,d:"Bill wanted a halo. He screamed so loud and threw such a tantrum that he finally got it. A real little devil.",ep:22,g:159,l:100,wd:true,fm:true,w:1,p:25540};
I[8442] = {n:"Black Rat Mask",t:16,d:"Brouce Boulgoure used this mask to discreetly infiltrate a Grossewer rats\' den and cut down an elm by the roots. On the way out, he squashed every single rat in the den with his wooden clogs.",ep:2,g:158,l:102,wd:true,fm:true,w:1,s:68,p:17222};
I[8443] = {n:"Black Rat Cape",t:17,d:"This cape can be made with any sort of animal hair provided that it\'s very dirty. They are plaited together and then cemented with various secretions. The smell is unfortunately not optional.",ep:13,g:123,l:105,wd:true,fm:true,w:5,s:68,p:18356};
I[8444] = {n:"Black Rat Daggers",t:5,d:"Badly damaged, but extremely sharp, these dagger blades will slice off a limb with disconcerting ease. They\'ll sink through bones like butter, allowing you to carve your enemies up like spring chickens. What a pity they aren\'t rusty, poisoned and white-hot too!",ep:8,g:59,l:108,wd:true,fm:true,w:5,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CA>250&CW>100&CV>300",s:68,p:19358};
I[8445] = {n:"Black Rat Necklace",t:1,d:"The rat who used to own this necklace thought he would become the chief of his clan. He was devoured by a rabid Lenald.",ep:18,g:115,l:103,wd:true,fm:true,w:5,s:68,p:17650};
I[8446] = {n:"Black Rat Boots",t:11,d:"Be careful when you put on these boots, as there might still be a foot or two of the previous owner inside them.",ep:13,g:93,l:101,wd:true,fm:true,w:10,s:68,p:18700};
I[8447] = {n:"Black Rat Belt",t:10,d:"Unlike his white Bontarian cousin, the Black rat is discreet and wears a simple fabric belt. But he also likes to take a lot of weapons with him and it all makes a terrible clinking noise at each of his steps.",ep:13,g:109,l:101,wd:true,fm:true,w:5,s:68,p:18934};
I[8448] = {n:"Black Rat Ring",t:9,d:"Turn this ring to the right if you\'re shaking hands with an enemy and to the left if you\'re shaking hands with a friend. Make sure you stay away from any situation where you may be forced to clap.",ep:20,g:120,l:98,wd:true,fm:true,w:5,s:68,p:16980};
I[8449] = {n:"Treechnid Dungeon Transformation",t:27,d:"A Treechnid bit you and passed on a strange curse.",ep:9,g:1,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8450] = {n:"White Rat Sword",t:6,d:"This weapon is the symbol of the White Rat. It will slice both enemies and allies with the same ease.",ep:16,g:71,l:109,wd:true,fm:true,w:10,an:14,tw:true,e:[5,5,1,1,40,50,false,false],c:"CA>150&CS>100",s:67,p:17542};
I[8451] = {n:"White Rat Hat",t:16,d:"With this hat on, the White Rat looks like a real White Rat of Bonta. Without it, he looks like a real White Rat of Bonta without a hat.",ep:13,g:160,l:105,wd:true,fm:true,w:10,s:67,p:18451};
I[8452] = {n:"White Rat Cape",t:17,d:"This cape is the unmistakable banner of the Bonta white sewer rat network. It is the reward the rat gets after a long and difficult series of examinations and is proudly worn until he pants his final ratty breath... which usually isn\'t a long time.",ep:14,g:124,l:102,wd:true,fm:true,w:5,s:67,p:17025};
I[8453] = {n:"White Rat Necklace",t:1,d:"Plumbers wear this necklace when descending into the intestine-like sewers of our cities. If you wear it as a belt, it will protect your allies from your sewer-like intestines.",ep:18,g:116,l:103,wd:true,fm:true,w:5,s:67,p:18900};
I[8454] = {n:"White Rat Gauntlet",t:9,d:"This Gauntlet used to belong to Julia Dilch, master cook at the Bonta palace. After a while, she never took it off - a Gobball that refused to have its throat cut, a tough fillet of lamb, even the odd head of lettuce, all fell victim to her vicious blows.",ep:18,g:121,l:101,wd:true,fm:true,w:5,s:67,p:17150};
I[8455] = {n:"White Rat Belt",t:10,d:"Though his Black Brakmarian cousin may not agree, the white rat likes to be as discreet as possible.... he padded the metallic links of this belt with tar so it doesn\'t make any noise... unless the person wearing it trips and falls... which happens a lot given it weighs about a ton.",ep:16,g:110,l:102,wd:true,fm:true,w:150,s:67,p:18850};
I[8456] = {n:"White Rat Boots",t:11,d:"With these boots, your balance will be perfect... they\'re very popular with drunk drivers, they practically walk along the yellow line for you. Saying the alphabet backwards... that\'s another story.",ep:3,g:94,l:99,wd:true,fm:true,w:10,s:67,p:17650};
I[8457] = {n:"Lord of the Rats\' Ceremonial Hat",t:16,d:"This hat has nothing to do with a Dora, a Brave\'s Dark Dora, a Dora Bora or a Doro L. Blak... Absolutely nothing! So don\'t bother spreading rumours about its designer being slack or uninspired! It\'s just a very nice looking hat.",ep:13,g:173,l:133,wd:true,fm:true,w:10,s:64,p:43300};
I[8458] = {n:"Lord of the Rats\' Ceremonial Cape",t:17,d:"This colourful cape turns you into an ideal target. Only quick and nimble adventurers can wear it for more than a few minutes.",ep:14,g:125,l:130,wd:true,fm:true,w:10,s:64,p:42030};
I[8459] = {n:"Lord of the Rats\' Ceremonial Necklace",t:1,d:"To dissuade greedy thieves, this necklace is secured around the neck of the heir to the Lord of the Rats at his birth. The only way to remove it is to take off his head... This doesn\'t seem to dissuade the thieves...",ep:18,g:117,l:134,wd:true,fm:true,w:5,s:64,p:45842};
I[8460] = {n:"Lord of the Rats\' Ceremonial Ring",t:9,d:"This ring was designed at a time when the Lord of the Rats only had one finger left after mutilating all the others. The unfortunate lords that followed had all of theirs.",ep:20,g:122,l:131,wd:true,fm:true,w:5,s:64,p:42542};
I[8461] = {n:"Lord of the Rats\' Ceremonial Belt",t:10,d:"The colours on this belt will have people thinking you\'re on fire. The optical illusion is so powerful that you shouldn\'t be surprised when complete strangers throw water all over you. Amazingly enough, this corresponds exactly to the ceremony\'s ritual.",ep:16,g:111,l:133,wd:true,fm:true,w:10,s:64,p:43358};
I[8462] = {n:"Lord of the Rats\' Ceremonial Boots",t:11,d:"The very first Lord of the Rats died when he stepped in a pool of molten lava. To pay tribute to him, his lords wear these boots. By the way, they are not in the least bit fireproof.",ep:13,g:95,l:134,wd:true,fm:true,w:10,s:64,p:43541};
I[8463] = {n:"Ancestral Treechelmet",t:16,d:"The mushrooms pushing up on this helmet spread a nice exhilarating smell that makes you want to take roots. They are also quite tasty but might definitely bury you.",ep:9,g:174,l:114,wd:true,fm:true,w:10,s:65,p:33150};
I[8464] = {n:"Ancestral Treecape",t:17,d:"In summer, the Ancestral Treechnid likes to sunbathe but as its wood is accustomed to dark forests, it doesn\'t stand it very well. This cape is made of his bark peelings.",ep:18,g:126,l:114,wd:true,fm:true,w:5,s:65,p:33524};
I[8465] = {n:"Ancestral Torc",t:1,d:"Worn around your neck with a low-cut top, this torc will accentuate your beard beautifully. If you don\'t have one... well... you only have yourself to blame.",ep:20,g:118,l:110,wd:true,fm:true,w:10,s:65,p:31542};
I[8466] = {n:"Ancestral Ring",t:9,d:"If you\'ve had a little too much to drink, you might see the Moskito embedded in this ring wink at you. But don\'t tell your friends, the little beast will deny everything.",ep:9,g:123,l:113,wd:true,fm:true,w:5,s:65,p:33241};
I[8467] = {n:"Ancestral Shin Guards",t:11,d:"With these wooden Shin Guards on, your legs will be fully protected. You cannot wear boots at the same time.",ep:20,g:96,l:110,wd:false,fm:true,w:10,s:65,p:31524};
I[8468] = {n:"Ancestral Treechelt",t:10,d:"This belt is supposed to inspire you with ancestral virility. Whether this was ever true or not, the effect has now surely gone without a trace.",ep:9,g:112,l:111,wd:true,fm:true,w:10,s:65,p:32101};
I[8469] = {n:"Soft Oak Talisman",t:1,d:"This piece of wood extracted from the very heart of the Soft Oak is extremely powerful. Indeed, it can even enrage the Soft Oak.",ep:20,g:119,l:138,wd:true,fm:true,w:10,s:66,p:44521};
I[8470] = {n:"Soft Oak Ring",t:9,d:"This ring is made of Soft Oak faeces. It\'s wooden alright, but the smell remains the same.",ep:9,g:124,l:139,wd:true,fm:true,w:5,s:66,p:43014};
I[8471] = {n:"Soft Oak Flip-Flops",t:11,d:"On Sundays, the Soft Oak takes a long nap and when he wakes up he likes to have an obedient Trunknid bring him his flip-flops. Fortunately, he doesn\'t have any feet so they\'re still brand new.",ep:20,g:97,l:136,wd:true,fm:true,w:5,s:66,p:43521};
I[8472] = {n:"Worn Soft Oak Cape",t:17,d:"200 years ago, some fabric got stuck in the Soft Oak\'s branches. As the tree grew, it impregnated the fabric with its magic. The cloth is now an integral part of this huge piece of wood and though it makes it hard to handle and highly flammable, its power can\'t be denied.",ep:18,g:127,l:142,wd:true,fm:true,w:10,s:66,p:44578};
I[8473] = {n:"Autumnal Soft Oak G-String",t:10,d:"In autumn, the Soft Oak wears its G-string to protect his precious acorns. In summer time, he likes to go commando.",ep:9,g:113,l:141,wd:true,fm:true,w:10,s:66,p:44514};
I[8474] = {n:"Soft Oak Hat",t:16,d:"No matter how you wear this hat, it will always look like it\'s on sideways.",ep:9,g:166,l:145,wd:true,fm:true,w:10,s:66,p:45241};
I[8476] = {n:"First key to Sphincter\'s Dungeon",t:24,d:"This key alone won\'t let you into Sphincter\'s dungeon. You\'ll need the other one too.",ep:1,g:502,l:1,wd:false,fm:true,w:0,p:100};
I[8477] = {n:"Second key to Sphincter\'s Dungeon",t:24,d:"This key alone won\'t let you enter the Sphincter\'s dungeon. You\'ll need the other one too.",ep:1,g:503,l:1,wd:false,fm:true,w:0,p:100};
I[8478] = {n:"Bootlicker Potion",t:12,d:"This highly illegal potion is feared even by the strongest Pandawa warriors. A single gulp and you\'ll be obsessed with the idea of licking all footwear in sight. \nStudents who are worried about their grades often use a similar potion for their teachers. Their breath smells slightly different though.",ep:0,g:36,l:1,wd:false,fm:true,w:0,p:10};
I[8480] = {n:"Bootlicker Potion",t:24,d:"This highly illegal potion is feared even by the strongest Pandawa warriors. A single gulp and you\'ll be obsessed with the idea of licking all footwear in sight. \nStudents who are worried about their grades often use a similar potion for their teachers. Their breath smells slightly different though.",ep:2,g:32,l:1,wd:true,fm:true,w:0,p:10};
I[8481] = {n:"Grossewer Rat Hair",t:54,d:"This hair is dirty and stinky. It roamed the most disgusting sewers of the area. And yet, it\'s still shiny.",ep:2,g:670,l:42,wd:true,fm:true,w:1,p:10};
I[8482] = {n:"Grossewer Rat Skin",t:59,d:"This scars all over this skin are actual proof of the Grossewer Rat\'s difficult childhood. You could at least feel sorry for him.",ep:2,g:621,l:42,wd:true,fm:true,w:1,p:10};
I[8483] = {n:"Grossewer Shaman Skin",t:59,d:"Once washed, this skin can be used as a carpet or a doormat.",ep:2,g:622,l:40,wd:true,fm:true,w:1,p:10};
I[8484] = {n:"Grossewer Shaman Hair",t:54,d:"They were once used to make fake moustaches, but they can also be used for fake armpit hair.",ep:2,g:671,l:40,wd:true,fm:true,w:1,p:10};
I[8485] = {n:"Black Rat Fabric",t:55,d:"Coiled around a soft wooden strip, this fabric can be used as a sponge or as a butt-scratcher. To each their own.",ep:2,g:725,l:100,wd:true,fm:true,w:1,p:10};
I[8486] = {n:"White Rat Fabric",t:55,d:"This fabric as greasy as a Wabbit Hair that has been dipped into Blop grease efficiently protects you from the cold. Especially if you set it on fire.",ep:2,g:726,l:100,wd:true,fm:true,w:1,p:10};
I[8487] = {n:"Sphincter Cell Fabric",t:55,d:"This fabric seems to be covered in a strange chemical... It definitely has side-effects, but I really don\'t know what they are.",ep:2,g:727,l:200,wd:true,fm:true,w:10,p:100};
I[8488] = {n:"Black Rat Ulna",t:47,d:"This rat bone can be emptied, pierced and carved. Then it can be used as a musical instrument... or a little place to keep change if you\'re not into music.",ep:2,g:658,l:100,wd:true,fm:true,w:10,p:10};
I[8489] = {n:"White Rat Tooth",t:47,d:"This tooth is actually a horrible fang that enabled the White Rat to transmit many diseases to his victims when he bit them. A way among others to make sure his victims would die even if he couldn\'t finish them off. All means are good when you want to be respected.",ep:2,g:659,l:100,wd:true,fm:true,w:10,p:10};
I[8490] = {n:"Sphincter Cell Femur",t:47,d:"Sphincter was not kind to bones and would break them in two, three, four and sometimes even five pieces when he had to buck up his sleepy students.",ep:2,g:657,l:200,wd:true,fm:true,w:10,p:10};
I[8491] = {n:"Black Rat Skin",t:59,d:"The Black Rat was well-known for his bad breath but also for his rough butt skin. The creature evolved this way after generations of slipping off toilet seats. Unfortunately, since he lived right in the sewers, this black rat never needed to go to the toilets.",ep:2,g:623,l:100,wd:true,fm:true,w:1,p:10};
I[8492] = {n:"White Rat Skin",t:59,d:"The White Rat loved to mope round the sewers and waited for some nice person to come and comfort him. Then he would abuse the naivety and credulity of his victims to skin them alive, stuff them with cashew nuts and roast them. Poor little cashew nuts.",ep:2,g:624,l:100,wd:true,fm:true,w:1,p:10};
I[8493] = {n:"Sphincter Cell Skin",t:59,d:"Who would have believed that one day you\'ll be holding the famous Sphincter skin? Well, not Sphincter for sure. His self-confidence led him to his death.",ep:2,g:625,l:200,wd:true,fm:true,w:10,p:100};
I[8494] = {n:"Ancestral Treechnid Bark",t:96,d:"This bark got loose from the Ancestral Treechnid without your having to tear it off with your teeth.",ep:9,g:667,l:200,wd:true,fm:true,w:10,p:10};
I[8495] = {n:"Ancestral Treechnid Bud",t:108,d:"This shrivelled up bud was completely drained of its sap by a hungry creature. If you plunge it into water, you\'ll see it resume its original form, swell, and then if you wait a long time, rot.",ep:9,g:755,l:200,wd:true,fm:true,w:1,p:10};
I[8496] = {n:"Ancestral Treechnid Root",t:98,d:"Even if you snatch it from its owner, this root can whip you or twist your ankles. Mean thing!",ep:9,g:668,l:200,wd:true,fm:true,w:1,p:10};
I[8497] = {n:"Filtounga Recipe",t:24,d:"This book contains the secret to a good Filtounga.... The mythic dish created by Mouss Bouff.",ep:16,g:95,l:1,wd:true,fm:true,w:0,u:true,p:10};
I[8498] = {n:"Kaniger Meat",t:63,d:"This meat is as tender as the brain of a Mushd.",ep:13,g:375,l:80,wd:true,fm:true,w:1,p:1};
I[8499] = {n:"Koalak Meat",t:63,d:"Most of the time, Koalak meat is quite firm. You can make it a bit more tender if you strike it with a Kaliptus trunk. Just like you\'d do with an unruly child.",ep:20,g:376,l:60,wd:true,fm:true,w:1,p:1};
I[8500] = {n:"Crocodyl Meat",t:63,d:"This tasteless meat can be preserved in mud for many years before it rots. Maybe then it\'ll have a bit of flavour.",ep:4,g:377,l:70,wd:true,fm:true,w:1,p:1};
I[8501] = {n:"Preserved Kaniger Meat",t:64,d:"This Kaniger meat can now be preserved for many days before being used for a dish.",ep:13,g:387,l:80,wd:true,fm:true,w:1,p:1};
I[8502] = {n:"Preserved Koalak Meat",t:64,d:"This Koalak meat can now be preserved for many days before being used.",ep:20,g:388,l:120,wd:true,fm:true,w:1,p:1};
I[8503] = {n:"Preserved Crocodyl Meat",t:64,d:"This Crocodyl meat can now be preserved for many days before being used for a dish.",ep:4,g:389,l:70,wd:true,fm:true,w:1,p:1};
I[8504] = {n:"Kaniger Steak",t:69,d:"Either hot or cold, this Angeroo steak will satisfy the most voracious of appetites.",ep:13,g:132,l:80,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[8505] = {n:"Koalak Steak",t:69,d:"This piece of meat will fill bottomless stomachs to the brim.",ep:20,g:133,l:120,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[8506] = {n:"Crocodyl Steak",t:69,d:"This impressive piece of meat is obviously extremely hard to digest. But just as your eyes are always hungrier than your stomach, so your stomach is always bigger than your brain. Fool!",ep:4,g:134,l:70,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[8507] = {n:"Filtunga Dish",t:69,d:"The Filtunga is a unique dish. Its perfect mÃ©lange of ingredients lends it a heavenly taste. Serve warm with a dash of cream and a sprig of fresh parsley.",ep:1,g:136,l:100,wd:true,fm:true,w:1,c:"Cv<100",u:true,ut:true,p:1};
I[8508] = {n:"Filtounga Dish",t:24,d:"This dish is for the witch Paindep.",ep:1,g:120,l:1,wd:true,fm:true,w:0,p:1};
I[8509] = {n:"Bwork Beer Recipe",t:25,d:"The great Bworknroll Magus reveals his sacred Bwork beer recipe, without leaving out a single secret and even giving a few tips on how best to enjoy it.",ep:1,g:130,l:10,wd:false,fm:true,w:5,u:true,p:500};
I[8511] = {n:"Overpowered Uberleet Dark Crossbow of the Shadows",t:102,d:"....",ep:0,g:0,l:1,wd:false,fm:true,w:0,an:10,tw:true,e:[20,7,4,12,50,30,true,true],p:1};
I[8513] = {n:"Bworknroll\'s Scalpel",t:5,d:"Collecting " + "\"" + "pieces" + "\"" + " of creatures with the Bworknroll\'s scalpel will ensure you a good work since it preserves the vitality of the torn off limbs. Use it in fight to collect the parts you want.",ep:1,g:60,l:40,wd:true,fm:true,w:10,an:13,e:[10,4,1,1,30,50,false,false],c:"Qa=166",p:100};
I[8514] = {n:"Vampire Brain",t:15,d:"Always overloaded with fresh globules, a vampire brain sucks in all the red blood cells it can. That\'s why vampires are so pale. As for Iops, it kind of explains their red feet.",ep:3,g:492,l:20,wd:true,fm:true,w:2,u:true,p:10};
I[8515] = {n:"Trool Bone",t:47,d:"If we consider the weight and solidity of a Trool bone, it\'s easy to understand why it hurts so bad when they smack you during Trool-playing games.",ep:4,g:640,l:5,wd:true,fm:true,w:50,p:50};
I[8516] = {n:"Bworcelain\'s Heart",t:15,d:"This heartless Bworkette, who got rid of her son Krazybwork and threw him in a pit, was cursed by Bworknroll when she refused his love. Locked up in a cellar, she feeds herself with her own heart. Every night, it grows back and starts beating again.",ep:4,g:518,l:33,wd:true,fm:true,w:33,p:33};
I[8517] = {n:"Mumussel",t:15,d:"This beautiful and fresh Mumussel is a great companion to Bworks when they go plundering away from their wives.",ep:3,g:756,l:1,wd:true,fm:true,w:3,p:21};
I[8518] = {n:"Mumussel and Fries",t:69,d:"From the depths of the Asse Sea, Mumussels collect kelp and roll it under their armpits. Once the material is shaped like French Fries, they reach the beach to brown them in the sun before eating them.",ep:3,g:135,l:1,wd:true,fm:true,w:2,u:true,ut:true,p:1};
I[8519] = {n:"Troofle",t:69,d:"This traditional Trool mess sponge cake is made according an old Bwork recipe. Only a Bwork who\'s defeated a Trool with his bare hands is allowed to eat it. If he survived such a fight, he could eat just about anything!",ep:1,g:136,l:5,wd:true,fm:true,w:20,u:true,p:1};
I[8520] = {n:"Fattrool",t:60,d:"You can use this thick and nutritious grease to cook most types of food in old pots  without ruining the dish. Some Osamodas also use it to slip Tofus into places that the Iop moral code condemns.",ep:1,g:1,l:1,wd:true,fm:true,w:10,p:10};
I[8521] = {n:"The Red Cape",t:17,d:"The red cape is the favourite artefact of megalomaniacs. Once on their frail shoulders, they believe they are Superman or an ultra-powerful magician. Until they meet a Minotoror at least.",ep:1,g:128,l:9,wd:false,fm:true,w:1,p:200};
I[8522] = {n:"Magic Effect Thrower",t:74,d:"This surprising item contains a dark, concentrated magic that is said to be highly unstable. No one can foretell the effects it might have, but what\'s certain is that you shouldn\'t wait too long before using it... Or throwing it away.",ep:1,g:31,l:1,wd:false,fm:true,w:0,ut:true,p:1};
I[8523] = {n:"Kin\'s Relic",t:24,d:"This family item is extremely powerful. Usually passed from generation to generation, it hasn\'t lost any of its powers. There are very few artefacts that contain such power. Some say it has even been in contact with a Dofus...",ep:1,g:714,l:200,wd:true,fm:true,w:0,p:1};
I[8524] = {n:"Pingoku Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:45,l:1,wd:true,fm:true,w:1,p:1};
I[8525] = {n:"Piwi Egg",t:69,d:"Piwi eggs are a real treat for those who have a sweet tooth! However, they hatch very quickly when they\'re close to a source of heat. That\'s why you shouldn\'t leave it in your pocket or in your mouth for too long! A mini Piwi could come out of its shell when you\'re just about to swallow. And trust me, having a starving Piwi stuck between your teeth or swimming through your intestines its way is not what you need if you\'re ticklish.",ep:4,g:38,l:1,wd:true,fm:true,w:1,p:1};
I[8526] = {n:"Bow Kennel Certificate: Bloody Koalak",t:77,d:"This certificate mentions the characteristics of the Bloody Koalak you\'ve put in the Bow Kennels.",ep:3,g:42,l:1,wd:false,fm:true,w:1,p:100};
I[8527] = {n:"Gobtrotter",t:11,d:"These Goblin skin boots were created by Planbworksek to charge the enemy (if possible from behind) extremely quickly. These boots saved many a Bwork comrade in wartime.",ep:4,g:98,l:14,wd:true,fm:true,w:20,p:400};
I[8528] = {n:"Pancake Recipe",t:25,d:"Thanks to Gordo McRamsay, you\'ll finally be able to make the perfect pancake dough to feed your little ones and send them quickly off to sleep. What\'s the secret ingredient of this filling and mildly narcotic recipe? Magical Cure, of course!",ep:1,g:9,l:1,wd:false,fm:true,w:1,u:true,p:0};
I[8529] = {n:"Zaap Hammer",t:24,d:"Nothing\'s better than this hammer to fix a broken Zaap.",ep:1,g:8,l:1,wd:false,fm:true,w:0,p:1};
I[8530] = {n:"Ruskie Hat",t:16,d:"This hat keeps your ears warm and absorbs the alcohol on your breath. What else could you ask for?",ep:22,g:167,l:151,wd:true,fm:true,w:10,p:46280};
I[8531] = {n:"Coney Cap",t:16,d:"Who would dare wear such a ridiculous cap? No one, if not you.",ep:1,g:168,l:33,wd:true,fm:true,w:6,p:3000};
I[8532] = {n:"Indifferent Coney Cape",t:17,d:"The power of this cape? When you turn your back to someone, your utter indifference will cause them to weep instantly. Only for the very spiteful among you.",ep:1,g:129,l:14,wd:true,fm:true,w:1,p:775};
I[8533] = {n:"Flud",t:16,d:"The Flud is not really a hat. It\'s more of a parasite that tends to develop on loud or aggressive people\'s heads. Its disgusting appearance repels all and sundry, compelling its wearer to scream even louder which is useless since these people have nothing to say anyway...",ep:1,g:169,l:1,wd:true,fm:true,w:1,s:69,p:100};
I[8534] = {n:"Cape S\'loque",t:17,d:"This padded cape absorbs all surrounding noise, plunging the wearer into a lifetime of incredibly awkward silences.",ep:1,g:130,l:1,wd:true,fm:true,w:10,s:69,p:100};
I[8535] = {n:"Crashers",t:11,d:"These getas are so light that they make their owner run and jump all over the place whenever some action starts. Experienced adventurers just hate them... Every Tom Dick and Harry comes and crashes their fights uninvited.",ep:1,g:99,l:1,wd:true,fm:true,w:1,s:69,p:1};
I[8536] = {n:"Muffin Belt",t:10,d:"This belt must be worn tight... so tight that it forces its wearer to stammer, shake and generally jerk around in the inimitable style of Thrustin Timbertake.",ep:1,g:114,l:1,wd:true,fm:true,w:1,s:69,p:1};
I[8537] = {n:"Pluswan",t:9,d:"This small ring has no use beside making you look extremely flashy. Now people might actually want to talk to you.",ep:1,g:125,l:1,wd:true,fm:true,w:1,s:69,p:1};
I[8538] = {n:"Issa Mess",t:1,d:"After several nights of hard work, the most famous jeweller in Astrub, also known for being raised by Bworks, announced to an astounded crowd: " + "\"" + "c u l8r @ d gld hs" + "\"" + ". Even the renowned historian Champo Lhyon didn\'t manage to decipher the jeweller\'s message.",ep:1,g:120,l:1,wd:true,fm:true,w:1,s:69,p:1};
I[8539] = {n:"Apprentice Lumberjack\'s Axe",t:19,d:"Even if you don\'t handle axes very well, you won\'t hurt yourself with this blunt thing. If you hit hard enough and for long enough, you might be able to knock some trees down.",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,40,40,false,false],p:0};
I[8540] = {n:"Apprentice Farmer\'s Scythe",t:22,d:"This is a scythe of average quality but don\'t complain... It reaps and it\'s bloody well free. What else do you want?",ep:1,g:1,l:1,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,50,50,false,false],p:1};
I[8541] = {n:"Apprentice Fisherman\'s Rod",t:20,d:"Well, this fishing rod used to be in much better shape. Though the string is a bit frayed and the hook dull, you\'ll have no problem netting a few gudgeons.",ep:1,g:8,l:1,wd:true,fm:true,w:4,an:18,e:[1,4,1,1,100,100,false,false],p:1};
I[8542] = {n:"Apprentice Alchemist\'s Gloves",t:20,d:"You can tell those gloves come from money. You can hardly smell the sweat of the previous owner, it\'s almost impossible to get your fingers into them, you\'d swear they didn\'t have a hole at all. \nAll in all, those gloves just suck.",ep:1,g:5,l:1,wd:true,fm:true,w:5,e:[5,3,1,1,30,50,false,true],p:1};
I[8543] = {n:"Incarnam Lemonade",t:79,d:"This lemonade, made by the gods, is a mixture of water, bubbles, and animal extracts. It invigorates young souls on their arrival in Incarnam. For everyone else, this sparkling, vaguely yellow trash is just about good enough to use when training for burping contests.",ep:1,g:4,l:1,wd:true,fm:true,w:1,c:"PL<16",u:true,ut:true,p:1};
I[8544] = {n:"Bow Kennel Certificate: Pingoku",t:77,d:"This certificate mentions the characteristics of Pingoku that you\'ve just put in the Bow Kennel.",ep:3,g:43,l:1,wd:false,fm:true,w:1,p:100};
I[8545] = {n:"Incarnam Dungeon Key",t:84,d:"This key allows you access to the Incarnam Dungeon where the dreadful Snoowolf lives.",ep:1,g:19,l:1,wd:true,fm:true,w:1,p:10};
I[8546] = {n:"Snoowolf Skin",t:59,d:"Slightly curly, this skin will make a wonderful bedside rug. I\'m sure someone around Incarnam will want it. Find out who it is... and get as many Kamas as you can for it!",ep:1,g:3,l:1,wd:true,fm:true,w:10,p:1};
I[8547] = {n:"Skiril Trinsfirmitinik",t:31,d:"Cirsid hizilnits irik nik gidik fir yik.",ep:1,g:19,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8548] = {n:"Tiwabbit Twansfowmation",t:31,d:"Cuwsed cawwots awe bad fow youw health.",ep:8,g:19,l:1,wd:false,fm:true,w:0,m:true,p:1};
