I[8557] = {n:"Batofu Feather",t:53,d:"This feather was plucked from the Batofu\'s armpit and it smells like a marinated ancestral Doobitchoo.",ep:3,g:120,l:20,wd:true,fm:true,w:1,p:10};
I[8558] = {n:"Coney Hat",t:16,d:"If you\'re planning to communicate with Wabbits, this might be the hat you need. If you want to look good, put it on someone next to you.",ep:1,g:170,l:6,wd:true,fm:true,w:10,p:12000};
I[8559] = {n:"The HmmMmmmMmmm",t:16,d:"Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.",ep:2,g:171,l:42,wd:true,fm:true,w:1,p:420};
I[8561] = {n:"Pandawa Cub",t:18,d:"This cute Pandawa Cub will gladly travel round the world with you and discover its mysteries with its big, round eyes. This tamed pet eats rice, but can also be fed with hazelnuts.",ep:3,g:42,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8563] = {n:"Litol Goblait",t:32,d:"Litol must meet his future magic teacher.",ep:1,g:18,l:1,wd:true,fm:true,w:0,m:true,p:1};
I[8564] = {n:"Bow Kennel Certificate: Pandawa Cub",t:77,d:"This certificate describes the characteristics of the Pandawa Cub you\'ve put in the Bow Kennels.",ep:3,g:44,l:1,wd:false,fm:true,w:1,p:100};
I[8565] = {n:"Pandawa Cub Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:44,l:1,wd:true,fm:true,w:1,p:1};
I[8566] = {n:"Pingoku Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:1,m:true,p:1};
I[8567] = {n:"Pandawa Cub Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:1,m:true,p:1};
I[8568] = {n:"Gift: Pandawa Cub",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8569] = {n:"Doro L. Blak",t:16,d:"This cap used to belong to a little Xelorette who got a kick out of disrupting the passage of time. Legend has it that she once stole several days off the inhabitants of Amakna. She had to hand out quite a few candies to make up for that little trick.",ep:22,g:172,l:129,wd:true,fm:true,w:10,p:42512};
I[8570] = {n:"Bontarian Rat Hair",t:54,d:"This hair used to belong to the Bonta sewer rats. Indeed, they were the only ones to have hair tufts which matched the colour of their city wall.",ep:2,g:672,l:40,wd:true,fm:true,w:1,p:10};
I[8571] = {n:"Brakmarian Rat Hair",t:54,d:"This hair used to belong to the Brakmar sewer rats. Indeed, they were the only ones to have hair tufts which matched the colour of their city wall.",ep:2,g:673,l:40,wd:true,fm:true,w:1,p:10};
I[8572] = {n:"Forgetfulness Potion: \'Mount Taming\'",t:43,d:"Using this potion will cause you to unlearn one level of the spell \'Mount Taming\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[8573] = {n:"Forgetfulness Potion: \'Perfidious Boomerang\'",t:43,d:"Using this potion will cause you to unlearn one level of the spell \'Perfidious Boomerang\'.",ep:5,g:36,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[8574] = {n:"Dofus Seasoning",t:23,d:"Either with or without bacon, this Dofus is delicious.",ep:0,g:13,l:1,wd:false,fm:true,w:1,p:1};
I[8575] = {n:"First Blood Staff",t:4,d:"A famous Feca warrior who lived in the jungle of Pandala was often heard to say: " + "\"" + "To win the war, you have to become the war" + "\"" + ".",ep:1,g:71,l:200,wd:false,fm:true,w:20,an:12,tw:true,e:[7,3,1,2,42,42,false,true],c:"PN~xxramboplxx",p:100000};
I[8576] = {n:"Yse Vewybad\'s Recommendation Scroll",t:24,d:"Yse Vewybad gave you this scroll to thank you for your favours.",ep:2,g:26,l:20,wd:false,fm:true,w:0,p:1};
I[8588] = {n:"Rogue Emblem",t:24,d:"This emblem, given by a rogue, might be the key to enter their den.",ep:2,g:86,l:1,wd:true,fm:true,w:0,p:1};
I[8590] = {n:"Contract between Vil Smisse and Yse Vewybad",t:24,d:"This contract proves Yse Vewybad\'s treachery. All you have to do now is to bring it to the right person.",ep:1,g:26,l:1,wd:true,fm:true,w:0,p:1};
I[8593] = {n:"Wa Wabbit Transformation Potion",t:27,d:"Uba Tesse gave you this potion. It will turn you into a Wabbit and this should let you pass yourself off as Allisteria\'s suitor.",ep:2,g:5,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8594] = {n:"Wa Wabbit Twansfowmation Potion",t:27,d:"Uba Tesse gave you this potion. It will turn you into a Wabbit and this should let you pass yourself off as Allisteria\'s suitor.",ep:2,g:5,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8595] = {n:"Obese Tofu Egg",t:24,d:"This egg contains an obese Tofu... a creature that may defeat the Pwince of Wa in the future.",ep:1,g:122,l:1,wd:true,fm:false,w:0,p:1};
I[8596] = {n:"Crimson Claw",t:6,d:"This sharp sword gained this elegant crimson colour after gutting thousands of Bworks. Before, it was just purplish.",ep:22,g:72,l:145,wd:true,fm:true,w:15,an:14,tw:true,e:[8,6,1,1,45,100,false,false],c:"CS>350&CV>400",p:52000};
I[8597] = {n:"Force-feeding Potion",t:24,d:"This potion will permit Vil Smisse to force-feed the obese Tofu that you brought him.",ep:3,g:2,l:1,wd:true,fm:true,w:0,p:1};
I[8598] = {n:"Emment Daggers",t:5,d:"These blades have holes all over them so that they make a nice little whistling noise when handled quickly. The holes are also extremely useful when it comes to gutting your enemies.",ep:22,g:61,l:67,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,50,false,true],c:"CA>100",p:10654};
I[8599] = {n:"Clawettes",t:5,d:"These daggers were forged for a manicure-addict Ecaflipette. She didn\'t like those heavy swords that didn\'t match her perfectly varnished claws.",ep:22,g:62,l:69,wd:true,fm:true,w:10,an:13,e:[15,3,1,1,30,30,false,true],c:"CA>100&CS>100",p:11254};
I[8600] = {n:"Too Lazy To Go Upstairs",t:30,d:"No wonder you\'re exhausted, you\'ve been shouting at the top of your voice all this time. Wait 6 minutes or so... Maybe then you won\'t be so lazy.",ep:1,g:1,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8603] = {n:"Wabbit Prince\'s Servant\'s Livery",t:24,d:"With this livery, the Wabbit Prince\'s servant will be very trendy.",ep:2,g:715,l:1,wd:true,fm:true,w:0,p:1};
I[8604] = {n:"Stalk Sword",t:6,d:"This shiny sword is perfect for trimming flowers and trees, even if the plants fight back.",ep:22,g:73,l:100,wd:true,fm:true,w:10,an:14,e:[15,8,1,1,40,50,false,false],c:"CS>250&CI<1",p:25654};
I[8605] = {n:"Rubber Sword",t:6,d:"This blade has been lubricated to slip into its sheath more easily. However, it cannot be cleaned after use and must be thrown away, especially if it\'s covered in blood. Bear in mind that its main use is to protect you.",ep:22,g:74,l:73,wd:true,fm:true,w:15,an:14,e:[5,5,1,1,40,50,false,true],c:"CS>80&CI>80&CA>80",p:14000};
I[8606] = {n:"Wedding Dress",t:24,d:"The bride\'s wedding dress has been carefully wrapped in this gorgeous package. It just needs to be brought to the steward San Lavalss.",ep:2,g:715,l:1,wd:true,fm:true,w:0,p:1};
I[8607] = {n:"Studded Staff",t:4,d:"It\'s a big staff with nails knocked into it. Do not hope for something else in this staff, it\'s simple and loosens your enemies\' teeth nicely.",ep:22,g:72,l:107,wd:true,fm:true,w:15,an:12,tw:true,e:[7,4,1,1,30,50,false,true],c:"CA>150&CI>150",p:29856};
I[8608] = {n:"Scrap Staff",t:4,d:"Rumour has it that a Sadida named Fraye used this staff to protect his wife and son from an enraged flock of Gobballs. What a pity that he also mistook his family for the monsters during the fight.",ep:22,g:73,l:85,wd:true,fm:true,w:10,an:12,tw:true,e:[10,4,1,1,35,40,false,true],c:"CW>150&CV>200",p:20000};
I[8609] = {n:"Bushi\'Bow",t:2,d:"This bow is light, delicate, elegant and smells of cherry tree flowers. But watch out, if you use it properly it can also be lethal.",ep:22,g:56,l:81,wd:true,fm:true,w:15,an:10,tw:true,e:[5,4,3,7,30,50,false,true],c:"CA>200",p:16900};
I[8610] = {n:"Bow Liwood",t:2,d:"If you hold this bow high and joyfully say " + "\"" + "Pampulilu!" + "\"" + ", you\'ll look absolutely ridiculous.",ep:22,g:57,l:79,wd:true,fm:true,w:10,an:10,tw:true,e:[7,5,4,7,30,50,false,true],c:"CI>150&CC>150",p:15320};
I[8611] = {n:"Wand Else?",t:3,d:"This wand belongs to a famous Grinegau who makes excellent coffee, but who just can\'t get the ladies.",ep:22,g:61,l:72,wd:true,fm:true,w:15,an:11,e:[5,3,2,4,15,50,false,true],c:"CI>100&CC>100",p:16500};
I[8612] = {n:"The Bidjiz",t:3,d:"With the Bidjiz, you\'ll stay alive probably because your opponents will start dancing when they see the disco ball at the end of this wand.",ep:22,g:62,l:79,wd:true,fm:true,w:10,an:11,tw:true,e:[10,4,2,5,40,50,false,true],c:"CA>150",p:18000};
I[8613] = {n:"Shovel Minster",t:8,d:"Created like a Smithmagic masterpiece, this shovel digs really bad, except when it\'s your opponents\' heads.",ep:22,g:46,l:70,wd:true,fm:true,w:10,an:16,tw:true,e:[5,4,1,1,30,50,false,false],c:"CC>100",p:13540};
I[8614] = {n:"RIP Shovel",t:8,d:"This shovel is a great invention. It can dig up a grave and be left on top as a cross, provided only one adventure fellow dies at the time... Or else you\'ll have to dig the other graves with your hands.",ep:22,g:47,l:66,wd:true,fm:true,w:1,an:16,tw:true,e:[5,4,1,1,20,30,false,false],c:"CI>100&CC>50",p:1};
I[8615] = {n:"Red Hammer",t:7,d:"This Hammer easily crushes skulls to pulp... which is exactly why it\'s tinted with a nice red tomato colour.",ep:22,g:61,l:83,wd:true,fm:true,w:10,an:15,e:[10,4,1,1,40,50,false,false],c:"CI>100&CV>100",p:17560};
I[8616] = {n:"Stephammer",t:7,d:"This hammer was created during the reign of King Stephan, a terrible tyrant who terrorised trillions of people.",ep:22,g:62,l:178,wd:true,fm:true,w:10,an:15,tw:true,e:[5,5,1,1,40,50,false,true],c:"CI>350&CW>180",p:10000};
I[8617] = {n:"Purrin Axe",t:19,d:"Your pet, our passion.",ep:22,g:45,l:62,wd:true,fm:true,w:10,an:17,e:[5,4,1,1,20,30,false,false],c:"CV>150",p:10200};
I[8618] = {n:"Koss Axe",t:19,d:"This strange axe is designed to easily behead Bworks. The ease with which it can also behead Astrub\'s inhabitants clearly indicates that there\'s a connection between these two populations. But no one has discovered just what it is yet.",ep:22,g:46,l:80,wd:true,fm:true,w:10,an:17,tw:true,e:[10,4,1,1,50,50,false,true],c:"CC>120&CA>60",p:16700};
I[8619] = {n:"Hat Ariutokinabot",t:16,d:"Thanks to this warrior hat, Iops really cut a fine figure. The only problem is that it hides some of their field of vision and prevents them from hearing their opponents\' words. This hat is designed for those who like to strike before they think.",ep:22,g:175,l:40,wd:true,fm:false,w:1,s:81,p:10000};
I[8620] = {n:"",t:28,d:"",ep:0,g:2,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8621] = {n:"Cuwsed Cawwot",t:94,d:"This appetizing cawwot looks pwetty owdinawy but it stinks of evil fwom 50 paces. Will you wesist the temptation to devouw it?",ep:8,g:6,l:21,wd:true,fm:true,w:1,u:true,ut:true,p:100};
I[8624] = {n:"Magic Blue Balloon",t:94,d:"Unlike the fake ones you\'ll find at the Trool fair, this balloon can take off with grace and ease. A beauty to behold, it\'s handmade with Strawberry Jelly eyelid, according to the traditions of the great magus Betsy Krokerr.",ep:1,g:7,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8625] = {n:"Magic Green Balloon",t:94,d:"This green balloon is a delicacy made by force-feeding a Luidegit mushroom a green larva. The eyes of the larva roll out in the process and are sold to Bworks as appetizers. This balloon inspired Betsy Krokerr in some of her most famous recipes.",ep:1,g:8,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8626] = {n:"Cirsid Hizilnit",t:94,d:"Tis ippitiziknik hizilnik sims ti bik kitik nirmik bik is inik ficik ixtrimilik ivik. Wilik yik risiksitik tik timptitinik ti nibblik itik ik?",ep:6,g:9,l:21,wd:false,fm:true,w:1,u:true,ut:true,p:100};
I[8627] = {n:"Sarr Ys\' Flute",t:3,d:"Colleague and friend of the famous Guy-Guy (close parent of the Soft Oak), Sarr Ys is a minstrel whose enchanting melodies have been engraved in Amakna\'s collective unconscious. Unfortunately, this brilliant artist had a tragic Quaquack accident after a particularly humid new year\'s eve celebration.",ep:1,g:63,l:1,wd:false,fm:true,w:10,an:11,e:[10,6,2,3,100,30,false,true],p:1};
I[8628] = {n:"Ukando Hat",t:16,d:"This headgear bestows self confidence and temerity on whoever wears it. Thanks to it you\'ll always keep going thinking you can actually make exploits. Remember to take it off from time to time or it will take you into inextricable situations!",ep:22,g:185,l:40,wd:true,fm:false,w:1,s:88,p:10000};
I[8629] = {n:"Hat Tsokey",t:16,d:"Every time an opponent comes to face this headgear, he turns as silent as the grave. No one dares ask what it is supposed to be. But that\'s ok, Srams aren\'t known for their sensitivity.",ep:22,g:179,l:40,wd:true,fm:false,w:1,s:89,p:10000};
I[8630] = {n:"Hatter Lily",t:16,d:"This hat looks like the Sulik and the Paperb\' Hat. But since it\'s very comfy and Xelors never take it off - even when they sleep, it is commonly called Hatter Lily. It gives off a nice pleasant white water lily smell which helps you get to sleep. However, it also provokes snores as unbearable as the Toads\' song during the mating season.",ep:22,g:177,l:40,wd:true,fm:false,w:1,s:86,p:10000};
I[8631] = {n:"Hat Wisholdoo",t:16,d:"Thanks to this hat, Eniripsas always know how to deal with emergencies. Indeed, all the first aid tips are discreetly written on the lining. It makes them look as if they just graduated even though no one would normally wear such a ridiculous hat even for a school ceremony!",ep:22,g:184,l:40,wd:true,fm:false,w:1,s:83,p:10000};
I[8632] = {n:"Cap Ricott",t:16,d:"Given its name, you\'d think this cap would be a nice orange colour. Well, not at all! Moreover, this fashion accessory is more of a mask than a hat. So why did its creators name it this way? To make curious people talk, of course!",ep:22,g:178,l:40,wd:true,fm:false,w:1,s:90,p:10000};
I[8633] = {n:"Cap Rayer",t:16,d:"The sharpened points coming out of this cap not only enable you to hurt your enemy but also increase your chances of being struck on the head by lightning during a storm. Indeed, Sacriers are a class who love to hurt others as much as themselves. A nice smell of grilled meat: nothing\'s better to start your day!",ep:22,g:180,l:40,wd:true,fm:false,w:1,s:87,p:10000};
I[8634] = {n:"Cool Hood",t:16,d:"Thanks to this headgear, you\'ll really look like a horny beast. People will turn round to admire the huge pair on your head. This roomy hood can also keep food fresh like hay for Gobballs or bread for Tofus.",ep:22,g:181,l:40,wd:true,fm:false,w:1,s:84,p:10000};
I[8635] = {n:"Helmet Hicc",t:16,d:"This helmet can make wearers make promises they instantly forget. Is it because it exerts pressure on the part of the brain which deals with memory or language? No one truly knows. What matters is to only take into account the less extravagant words.",ep:22,g:176,l:40,wd:true,fm:false,w:1,s:92,p:10000};
I[8636] = {n:"Robbie Hoodie Cap",t:16,d:"Robbie Hood was a famous Cra who lived in the woods. This explains the camouflage green colour of the cap. He wanted to take the law into his own hands and spent all his time stealing money from the rich for a good cause: himself!",ep:22,g:186,l:40,wd:true,fm:false,w:1,s:82,p:10000};
I[8637] = {n:"Zinda Hood",t:16,d:"With this hood on, Fecas increase their chance as well as that of their allies. If you\'ve hired a Feca who\'s wearing the Zinda Hood, you\'re sure to arrive safe and sound.",ep:22,g:182,l:40,wd:true,fm:false,w:1,s:91,p:10000};
I[8638] = {n:"Sthood",t:16,d:"This hood can be used to fend off the bad weather, but it\'s also great for cooking. It allows you to regulate the strength of a flame with a tip of the head. Now you know why Enutrofs have such muscular necks.",ep:22,g:183,l:40,wd:true,fm:false,w:1,s:85,p:10000};
I[8639] = {n:"Cloak Orporal",t:17,d:"The floating cape will give you the aura of a warrior, especially when you turn your back to your enemy. Some think it\'s reinforced by a metal sheet capable of staving off the slyest attacks.",ep:22,g:131,l:80,wd:true,fm:false,w:1,s:81,p:10000};
I[8640] = {n:"Cape of Spades",t:17,d:"Cut from a soft and strong fabric, this cape gives the Ecaflips the impression that they\'re always the best, no matter what happens. When they win, they love to wear this piece of clothing and claim their reward: " + "\"" + "And now, gimme the cash!" + "\"" + "",ep:22,g:133,l:80,wd:true,fm:false,w:1,s:88,p:10000};
I[8641] = {n:"F-Ha(r)t",t:17,d:"This cape is so light and thin that the slightest wind, wind of any sort, will blow it off... It\'s anything but discreet especially after a meal of veggies and fermented drinks.",ep:22,g:140,l:80,wd:true,fm:false,w:1,s:89,p:10000};
I[8642] = {n:"Cap Cape",t:17,d:"The dark colour of this cape makes it easy to match any other cloth, of any colour. Since it\'s a very wide cape, it can also protect your head and nose.",ep:22,g:141,l:80,wd:true,fm:false,w:1,s:86,p:10000};
I[8643] = {n:"Cape Sulitis",t:17,d:"Place the cape lightly on your shoulders to prevent stiff joints, stiff upper lips and other stiffness-related problems.",ep:22,g:134,l:80,wd:true,fm:false,w:1,s:83,p:10000};
I[8644] = {n:"Cape o\'Tbelly",t:17,d:"This item is used to hide the Sadidas\' weight problem. Because they spend most of their time sleeping instead of practicing sports, the characters of this class tend to become rather stout. If Sadidettes actually have anti-starvation supplies flatteringly placed in the eyes of men, Sadidas usually use this cape to hide theirs.",ep:22,g:139,l:80,wd:true,fm:false,w:1,s:90,p:10000};
I[8645] = {n:"Cape Ytal",t:17,d:"This piece of clothing plays an essential part in the Sacriers\' style. They use it to bandage their wounds, to clean off blood, to warm their feet during the cold seasons. We cannot say it enough - this class is terrified of frozen ground!",ep:22,g:138,l:80,wd:true,fm:false,w:1,s:87,p:10000};
I[8646] = {n:"Cape Anama",t:17,d:"This soft cape is sometimes used by the Osamodettes as a wide-brimmed hat. Male Osamodas only use it as a cape. Thanks to the drawing which decorates this piece of clothing, this character class has inherited the reputation of being frank... they can\'t laugh up their sleeves since the laugh has actually been sewn onto the cape!",ep:22,g:137,l:80,wd:true,fm:false,w:1,s:84,p:10000};
I[8647] = {n:"Cape Wuera",t:17,d:"Pandawas use this cape as protection against bad weather and as a dance accessory. They put it on the floor, in the middle of a circle of tipsy dancers. Then they start their improvised choreography during which their feet can\'t leave the cloth.",ep:22,g:142,l:80,wd:true,fm:false,w:1,s:92,p:10000};
I[8648] = {n:"Cape Hulco",t:17,d:"Let me tell you about Hulco, a very strange Cra. He couldn\'t find his way to his own bathroom because everything he saw looked like a tropical beach at sunset. At least he never had to pay for a sun holiday.",ep:22,g:132,l:80,wd:true,fm:false,w:1,s:82,p:10000};
I[8649] = {n:"Cape Adossia",t:17,d:"This cape\'s warm and comforting colours take its wearer on an imaginary journey to sunny lands, full of canyons carved by the elements, and cave paintings hidden amongst wind-blasted rocks and weathered cliffs. This is extremely useful way of forgetting the cold, grey, rainy weather that normally blights Amakna. At least it never snows, though - well, only at Kwismas. Funny, that.",ep:22,g:136,l:80,wd:true,fm:false,w:1,s:91,p:10000};
I[8650] = {n:"Cape Hernaum",t:17,d:"Enutrofs have the habit of drawing a map on their cape. They live in such a mess that they can barely find the toilets and this is quite a problem, especially when nature calls urgently.",ep:22,g:135,l:80,wd:true,fm:false,w:1,s:85,p:10000};
I[8651] = {n:"Bloody Belt",t:10,d:"This beautiful belt adds to the prestige of the Iops\' appearance. Some say that the central cross can become a detachable weapon when their swords aren\'t within reach. Obviously this is a legend. Only Srams are deceitful enough to have such things.",ep:22,g:116,l:130,wd:true,fm:false,w:1,s:81,p:10000};
I[8652] = {n:"Belt Sterous",t:10,d:"When an Ecaflip is bored, he usually takes his cards from his belt and starts a game of solitaire. In fight, he can also use the cards as projectiles. He draws a card faster than his shadow and once victory is his, there\'s always time for a little game!",ep:22,g:117,l:130,wd:true,fm:false,w:1,s:88,p:10000};
I[8653] = {n:"Clinkin Belt",t:10,d:"The name of this belt comes from the particular noise it makes. The bones decorating the belt bang together, preventing the Srams, even those who are invisible, from going unnoticed. Then, you could easily hear such a dialogue: " + "\"" + "Surprising someone wearing the Clinkin Belt? You\'ve got a hope!" + "\"" + "",ep:22,g:118,l:130,wd:true,fm:false,w:1,s:89,p:10000};
I[8654] = {n:"Sleepless Belt",t:10,d:"The incessant ticking sound of the clock system of this belt prevents Xelors from sleeping when fights last forever. It is strongly advised that you take this belt off before going to bed.",ep:22,g:119,l:130,wd:true,fm:false,w:1,s:86,p:10000};
I[8655] = {n:"Blub Belt",t:10,d:"Though it won\'t stop the sobbing, this belt will hold lots of medical supplies. This is especially important for Eniripsas... when they have a sore throat, they can\'t cast their spells properly. And when they\'re voiceless ... well, they\'re as useful as a bear skin jacket in a heat wave.",ep:22,g:120,l:130,wd:true,fm:false,w:1,s:83,p:10000};
I[8656] = {n:"Belt Atio",t:10,d:"The reason the designers of this fashion accessory put the doll head next to the crotch is still unknown.",ep:22,g:121,l:130,wd:true,fm:false,w:1,s:90,p:10000};
I[8657] = {n:"Strap Pado",t:10,d:"Warriors of an ancient tribe renowned for their love for blood, the Pados may have been the first worshippers of the goddess Sacrier. Despite its harmless appearance, this belt is a real sophisticated instrument of torture.",ep:22,g:122,l:130,wd:true,fm:false,w:1,s:87,p:10000};
I[8658] = {n:"Diezzle Belt",t:10,d:"Osamodas are known to be quite impulsive. They tend to be quite touchy. The numerous buckles on this belt are meant to help them put a cap on their spontaneity. " + "\"" + "Before you light up your anger and inject your eyes with blood, touch each and every horn on your fantastic Diezzle Belt!" + "\"" + "",ep:22,g:123,l:130,wd:true,fm:false,w:1,s:84,p:10000};
I[8659] = {n:"Sticky Strap",t:10,d:"This belt helps Pandawas stand up straight (or almost) when they\'re drunk which they are, most of the time. In these moments, they tend to feel like they\'re stuck to the ground though gravity has no link whatsoever to this sensation. Gravity is way too busy knocking out scientists with apples.",ep:22,g:124,l:130,wd:true,fm:false,w:1,s:92,p:10000};
I[8660] = {n:"Targ Belt",t:10,d:"This belt enables you to keep up baggy clothes (so as not to scare away sensitive souls) and it also offers a target to apprentice Cras. Indeed, they\'re taught to shoot right in the centre but never below the belt.",ep:22,g:125,l:130,wd:true,fm:false,w:1,s:82,p:10000};
I[8661] = {n:"Girdle Belt",t:10,d:"Provident, Fecas keep their survival supplies in a small bag, which mainly include Crackrock bread. That\'s why this food can last for so long. The Sekuritee Belt firmly secures the bag around their waist, because there are still way too many accidents linked to this bag falling, either due to negligence or just plain stupidity.",ep:22,g:126,l:130,wd:true,fm:false,w:1,s:91,p:10000};
I[8662] = {n:"Belt Urgid",t:10,d:"This belt is a very handy fashion accessory used by male Enutrofs. Thanks to the map sewn onto it, they can hide their little accidents when they got lost looking for the toilets.",ep:22,g:127,l:130,wd:true,fm:false,w:1,s:85,p:10000};
I[8663] = {n:"Boot-a-Hoop",t:11,d:"With these boots on, the Iops are always the first to get to the battlefield and start livening the place up. It\'s common knowledge that this class love to amuse the crowd with their warrior exploits. But they\'re never taken seriously because of their intelligence, which is inversely proportional to their strength.",ep:22,g:100,l:100,wd:true,fm:false,w:1,s:81,p:10000};
I[8664] = {n:"Sleephairs",t:11,d:"It is said that Sadidas never feel lonely, since they can summon lots of dolls to keep them company. Thanks to these shoes, you too can say goodbye to loneliness! Not only will you be able to talk to them, but they\'ll be great for hiding aces when you\'re playing poker. Once you\'re wearing them, you\'ll feel really good, even if you are a little ashamed to actually go out with them on.",ep:22,g:105,l:100,wd:true,fm:false,w:1,s:88,p:10000};
I[8665] = {n:"Boots Hox",t:11,d:"Impregnated with a revolutionary firming agent, these boots will perfect the curvature of your legs and fight the good fight against your death-like Sram complexion. This cream has spectacular effects on Sramettes but seems to be absolutely useless on Srams. Could it be a hormonal problem?",ep:22,g:102,l:100,wd:true,fm:false,w:1,s:89,p:10000};
I[8666] = {n:"Shal\'Hal Boots",t:11,d:"Created by a Xelor artist, these boots should enable him to paint more quickly. And well, it does! However, they tend to distort the vision, meaning the artist was incapable of drawing anything but curvy females.",ep:22,g:103,l:100,wd:true,fm:false,w:1,s:86,p:10000};
I[8667] = {n:"Boots Ulism",t:11,d:"Thanks to these boots, you\'ll always be protected from the toxins that come from the ground. You can never be suspicious enough of microbes and other germs that hang about. Some fine observers say that these shoes have more of a slipper than a boot look. But well, that\'s what the Eniripsas call them. Is it because of their small size that they see everything from a different point of view?",ep:22,g:104,l:100,wd:true,fm:false,w:1,s:83,p:10000};
I[8668] = {n:"Boots Hanik",t:11,d:"Thanks to their recognition system, these boots prevent Sadidas from crushing rare plants. However they won\'t prevent you from stepping in various sort of excrements if you don\'t watch where you\'re going.",ep:22,g:101,l:100,wd:true,fm:false,w:1,s:90,p:10000};
I[8669] = {n:"Nailed Thongs",t:11,d:"Unlike the other classes, Sacriers love to live with a thorn in their foot and do not wish to have it taken out. The pain they feel reminds them that they\'re alive and give them the raging energy they need to slaughter their enemies. Besides, the drops of blood they leave behind mean they always find their way back home.",ep:22,g:106,l:100,wd:true,fm:false,w:1,s:87,p:10000};
I[8670] = {n:"Wawka Boots",t:11,d:"Crocodyl Dandy lost many a good opportunity and many a wife through his undying urge to wander round the outback. His fame grew fast and he was even offered a sponsorship deal by the famed shoemakers of Aerdala, but when he saw what they had on offer, he threw them back and shouted " + "\"" + "That\'s not a pair of boots... THIS is a pair of boots." + "\"" + "",ep:22,g:107,l:100,wd:true,fm:false,w:1,s:84,p:10000};
I[8671] = {n:"Great Coralator Relic",t:24,d:"This impressive relic might make you forget all of your worries.",ep:22,g:152,l:1,wd:true,fm:true,w:0,p:1};
I[8672] = {n:"Gourlo the Terrible Relic",t:24,d:"This impressive relic might make you forget all of your worries.",ep:22,g:153,l:31,wd:true,fm:true,w:0,p:1};
I[8673] = {n:"Greater Bherb Relic",t:24,d:"This impressive relic might make you forget all of your worries.",ep:22,g:154,l:61,wd:true,fm:true,w:0,p:1};
I[8674] = {n:"Tynril Relic",t:24,d:"This impressive relic might make you forget all of your worries.",ep:22,g:155,l:101,wd:true,fm:true,w:0,p:1};
I[8675] = {n:"Kimbo Relic",t:24,d:"This impressive relic might make you forget all of your worries.",ep:22,g:156,l:141,wd:true,fm:true,w:0,p:1};
I[8676] = {n:"Wicked Sword",t:6,d:"Vlad fell in love with this wonderful sword. He entered the most terrifying of all Dragokart races to get enough money to buy it. Unfortunately, he didn\'t know that the sword was cursed...",ep:1,g:75,l:95,wd:true,fm:true,w:1,an:14,tw:true,e:[10,4,1,1,40,50,false,false],c:"CV>50&CA>50&CS>50",p:9500};
I[8677] = {n:"Ross",t:18,d:"This cute Coney is the favourite pet of the famous Master Nero Jack. Do not be fooled by appearances, he can be really fearsome in battle. This pet only eats Cawwots and other plants.",ep:3,g:44,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8678] = {n:"Satanass Hat",t:16,d:"Long ago, Satanass was a figure skater slicing up Holyball on Ice on the rinks of the Second Zone. While recovering from an injury to the coccyx he had a life-changing revelation: his destiny was to be the most talented Dragokart driver of his generation! A little bump can sometimes leave a hefty lump.",ep:1,g:187,l:36,wd:true,fm:true,w:20,p:3550};
I[8679] = {n:"Ross Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:46,l:1,wd:true,fm:true,w:1,p:1};
I[8680] = {n:"Slimy Scale",t:59,d:"This slimy, slippery scale allowed its owner to escape capture by strange adventurers who fished with their teeth. Unfortunately, it was no use against the well-placed swipe of a rusty sword.",ep:1,g:626,l:10,wd:true,fm:true,w:1,p:1};
I[8681] = {n:"Raul Mops\' Skin",t:59,d:"Raul Mops has a real weakness. He loves to smear himself with water, wine and vinegar. What he loves most of all is rolling  peanuts along the road with his nose. Dry roasted, by the way, just in case you ever feel like doing him a favour.",ep:1,g:627,l:40,wd:true,fm:true,w:1,p:1};
I[8682] = {n:"Sponge Mob Skin",t:59,d:"Either side of this skin can be used for your DIY projects. The soft side is for cleaning delicate surfaces, and the rough side for scouring all your previously inaccessible body parts.",ep:1,g:628,l:10,wd:true,fm:true,w:1,p:1};
I[8683] = {n:"Gift: Pingoku",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[8684] = {n:"Bow Kennel Certificate: Ross",t:77,d:"This certificate describes the characteristics of the Ross you\'ve put in the Bow Kennels.",ep:3,g:45,l:1,wd:false,fm:true,w:1,p:100};
I[8685] = {n:"Bow Kennel Certificate: Bilby",t:77,d:"This certificate describes the characteristics of the Bilby you\'ve put in the Bow Kennels.",ep:3,g:46,l:1,wd:false,fm:true,w:1,p:100};
I[8686] = {n:"Gift: Ross",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8687] = {n:"Gift: Bilby",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8688] = {n:"Ross Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8691] = {n:"Victory Mark",t:24,d:"You easily defeated the disciple. He agreed and gave you this scroll.",ep:2,g:253,l:1,wd:true,fm:true,w:0,p:1};
I[8692] = {n:"Transformation Potion Formula",t:24,d:"This book contains theories from various alchemists about the possibility of Wabbit Twansfowmation. All it does is show how little they\'ve done on the subject.",ep:2,g:95,l:1,wd:true,fm:true,w:0,p:1};
I[8693] = {n:"Feanor",t:18,d:"Thanks to this pet, all your classmates will be giving you puppy eyes. Here\'s a tip: don\'t count your chickens before they hatch! You\'ll soon realize that your lover has been hypnotized by FÃ«anor. It won\'t even be an advantage: the one you once had eyes for will begin to munch on raw Snapper and rub up against your legs... Not the best. This pet only eats fish.",ep:3,g:45,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[8694] = {n:"Candied Chilli",t:42,d:"This candied chilli is as explosive as the strainings from the devil\'s jockstrap. This mind bending mixture of sugar and fire led one Dragoturkey to a string of controversial victories in a the world Dragokart championships before being banned by all major sporting associations. You can use it as a suppository if you need to make a quick exit or as a pill if getting in is your problem.",ep:1,g:111,l:1,wd:true,fm:true,w:1,c:"PO!1723",u:true,p:1};
I[8695] = {n:"Sword Hikk",t:6,d:"Like Brice said: " + "\"" + "It\'s not the size that counts, it\'s the sharpness." + "\"" + "",ep:22,g:76,l:177,wd:true,fm:true,w:10,an:14,e:[5,3,1,1,50,50,false,false],c:"CM>5",p:50050};
I[8696] = {n:"",t:23,d:"",ep:0,g:14,l:1,wd:false,fm:true,w:1,p:1};
I[8697] = {n:"OlolÂ² Dofus",t:23,d:"description",ep:0,g:0,l:1,wd:false,fm:true,w:1,p:1};
I[8698] = {n:"Cloudy Dofus",t:23,d:"description",ep:0,g:16,l:1,wd:false,fm:true,w:1,p:1};
I[8699] = {n:"Tynril Hat",t:16,d:"With this hat on, you\'ll always have an out-of-bed look, even if you spent hours brushing your hair. One must notice that the Tynril bark-type hair curls when the weather is humid, then making it the surest weather forecast in the world. However, it fears fire. Therefore, be extremely careful and keep it away from flames if you don\'t want to become a human torch.",ep:22,g:188,l:164,wd:true,fm:true,w:10,p:51250};
I[8700] = {n:"Emerald Shell",t:16,d:"This headgear has been crafted from a broken Emerald Dofus. The egg is not quite empty, so treat yourself to a nice, energising hair mask while you\'re at it.",ep:1,g:189,l:21,wd:true,fm:true,w:5,p:1400};
I[8701] = {n:"Nicked Sword",t:6,d:"This sumptuous sword used to belong to a famous thief who was renowned for getting nicked every time he committed a crime.",ep:0,g:77,l:95,wd:false,fm:true,w:10,an:14,tw:true,e:[10,4,1,1,40,50,false,false],c:"CV>50&CA>50&CS>50",p:9500};
I[8702] = {n:"",t:4,d:"",ep:0,g:74,l:1,wd:false,fm:true,w:1,an:12,tw:true,e:[0,0,1,1,0,0,false,false],p:1};
I[8703] = {n:"",t:5,d:"",ep:0,g:63,l:1,wd:false,fm:true,w:1,an:13,e:[1,0,1,1,1,1,false,false],p:1};
I[8704] = {n:"Jester Hat",t:16,d:"If you shake your two little bells, you might be able to play music.",ep:22,g:190,l:160,wd:true,fm:true,w:10,p:47625};
I[8706] = {n:"FÃ«anor Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:48,l:1,wd:true,fm:true,w:1,p:1};
I[8707] = {n:"Bow Kennel Certificate: FÃ«anor",t:77,d:"This certificate describes the characteristics of the Finer you\'ve put in the Bow Kennels.",ep:3,g:47,l:1,wd:true,fm:true,w:1,p:100};
I[8708] = {n:"Bow Kennel Certificate: Atooin",t:77,d:"This certificate describes the characteristics of the Atooin you\'ve put in the Bow Kennels.",ep:3,g:24,l:1,wd:true,fm:true,w:1,p:100};
I[8709] = {n:"FÃ«anor Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8711] = {n:"FÃ«anor Gift",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8712] = {n:"Piece of Goldemort",t:110,d:"Congratulations! You managed to steal a piece of Goldemort\'s corpse. You\'d make a vulture proud!",ep:1,g:490,l:1,wd:true,fm:true,w:1,p:1};
I[8713] = {n:"Getas Bernacles",t:11,d:"In some countries, it seems that the Getas Bernacle are thrown at the feet of enemies  to propose a duel... kind of like hitting your opponent with a pair of gloves. The advantage of the Getas Bernacles is that they add the stench factor to the actual blow. Pandawas never were famous for their foot hygiene...",ep:22,g:108,l:100,wd:true,fm:false,w:1,s:92,p:10000};
I[8714] = {n:"Honoh Ring",t:9,d:"Wearing this ring is an honour. It shows that you\'re a faithful worshipper of the goddess Cra, the only one to reveal how to harden your muscle more quickly to be able fire more effectively.",ep:22,g:126,l:150,wd:true,fm:false,w:1,s:82,p:10000};
I[8715] = {n:"Blaber Ring",t:9,d:"Ecaflips have the gift of the gab. They can talk you into almost any bet you can think of. This ring celebrates their business smarts. It can also be used as a spare dice or to scratch yourself...",ep:22,g:127,l:150,wd:true,fm:false,w:1,s:88,p:10000};
I[8716] = {n:"Lion Ring",t:9,d:"Osamodettes love this ring which gives an extra feline touch to their walk. Because they\'re always so close to monsters, they\'re starting to behave like real animals themselves. But in reality, they\'re as devoted and caring as lioness mothers.",ep:22,g:128,l:150,wd:true,fm:false,w:1,s:84,p:10000};
I[8717] = {n:"Ring Bellious",t:9,d:"Spiteful gossips claim that this ring is the least useful fashion accessory in the world. The wings attached to it are very awkward when you need to get a tissue out of your pocket. Now, as Iops have neither tissues nor pockets, they don\'t care. Instead, they prefer shredding their enemies\' flesh with the wings during close combat. Thinking about it, you wonder why this isn\'t the Sacriers\' ring instead.",ep:22,g:129,l:150,wd:true,fm:false,w:1,s:81,p:10000};
I[8718] = {n:"Memo Ring",t:9,d:"Fecas use the mini shields on this ring as memo boards to write love notes and to-do lists. This jewel has been nicknamed the anti-forgetfulness shield. However, it does not protect you from stammering or slips of the tongue.",ep:22,g:130,l:150,wd:true,fm:false,w:1,s:91,p:10000};
I[8719] = {n:"Rememb Ring",t:9,d:"Thanks to this item, Enutrofs can remember their happy times whenever they want. They just need to extract the shovel driven into it. To make the remembrance even more genuine, you\'d need to add a specific smell to it... Good luck!",ep:22,g:131,l:150,wd:true,fm:false,w:1,s:85,p:10000};
I[8720] = {n:"Chee Ring",t:9,d:"The goddess Eniripsa gave this item to her worshippers as a sign of their spiritual union during the class spell initiation session. Incidentally, Eniripsas can also use it as a sponge bracelet to clean off the blood of their allies.",ep:22,g:132,l:150,wd:true,fm:false,w:1,s:83,p:10000};
I[8721] = {n:"Ear Ring",t:9,d:"This jewel tends to turn Pandawas into insulting devils after two or three beers... just remember the old proverb  " + "\"" + "Sticks and stones may break my bones, but a drunken bear-like creature will never hurt me." + "\"" + "",ep:22,g:133,l:150,wd:true,fm:false,w:1,s:92,p:10000};
I[8722] = {n:"Elkebi Ring",t:9,d:"This jewel with a skull on it was traditionally offered to all Sram kids to reward them for their treachery and blows below the belt. The other classes seem to discredit this practice which tends to overexcite the kids and turn them into little devils.",ep:22,g:134,l:150,wd:true,fm:false,w:1,s:89,p:10000};
I[8723] = {n:"Subma Ring",t:9,d:"This ring is the only jewel that can tell the time and which is perfectly waterproof. Some believe that if you enlarge it a few hundred times, it\'ll make a submarine too. A submarine that can tell the time.",ep:22,g:135,l:150,wd:true,fm:false,w:1,s:86,p:10000};
I[8724] = {n:"Hai Ring",t:9,d:"Contrary to the rumour, Sadidas do not let their hair down... This hair has just been adjusted round a wonderful ring to reinforce its benefits. Never ever cut it! Thanks to the Hai Ring, you\'ll always be perfect!",ep:22,g:136,l:150,wd:true,fm:false,w:1,s:90,p:10000};
I[8725] = {n:"Ring Neinwonwon",t:9,d:"If you see a character who\'s not a Sacrier wear the Ring Neinwonwon, take him directly to intensive care. Indeed, this jewel is extremely harmful. In general, people lose their cool when they face the pool of blood caused by this ring.",ep:22,g:137,l:150,wd:true,fm:false,w:1,s:87,p:10000};
I[8726] = {n:"Crusuede Shoes",t:11,d:"These shoes enable their wearer to dance all night long, despite blisters and corns! They dance to the rhythm of the night and make a little " + "\"" + "beep beep" + "\"" + " sound when they\'re next to religious artefacts. You\'ll be bright as a button the next day too, ready for a bit of slaughter.",ep:22,g:109,l:100,wd:true,fm:false,w:1,s:85,p:10000};
I[8727] = {n:"Relief Boots",t:11,d:"When Fecas are embarrassed and wish to change the subject, they always mention their Relief Boots. They talk about the way you can pace up and down all sorts of landscapes with them on. When their allies are in trouble on the battlefield, these comfy boots help them recover and ward off the threat.",ep:22,g:110,l:100,wd:true,fm:false,w:1,s:91,p:10000};
I[8728] = {n:"Veggie Boots",t:11,d:"The numerous straps around these shoes can be used as spare bow strings. Young Craettes also use them to cook vegetables. The smell of feet doesn\'t seem to bother them.",ep:22,g:111,l:100,wd:true,fm:false,w:1,s:82,p:10000};
I[8729] = {n:"Worn Coral",t:51,d:"Coral only loosens itself from the Coralator when the weather\'s dry. Coral is a beautiful substance and is often used to make jewellery. Other brutes actually eat it... but only because they mistake it for crab sticks.",ep:22,g:2,l:40,wd:true,fm:true,w:10,p:1};
I[8730] = {n:"Coralator Coccyx",t:47,d:"This strategically-located bone enables the Coralator to sit down with dignity. Now that he\'s dead, you can use it to establish your own authority upon his fellow creatures.",ep:16,g:12,l:40,wd:true,fm:true,w:1,p:1};
I[8731] = {n:"Great Coral",t:51,d:"The only difference between the Worn Coral and the Great Coral is their size and what you can do with them. However, a whole lot of worn Corals will never replace a Great Coral.",ep:22,g:9,l:150,wd:true,fm:true,w:10,p:1};
I[8732] = {n:"Kurasso Coral",t:51,d:"The outstanding colour of this coral comes from the unhealthy diet of the Craboral. Someone else who forgot to eat all of his 5 fruits and veg a day!",ep:16,g:3,l:40,wd:true,fm:true,w:10,p:1};
I[8733] = {n:"Mahlibuh Coral",t:51,d:"The outstanding colour of this coral comes from the unhealthy diet of the Craboral. Another one who forgot to eat all of his 5 fruits and veggies a day!",ep:16,g:4,l:40,wd:true,fm:true,w:10,p:1};
I[8734] = {n:"Passaoh Coral",t:51,d:"The outstanding colour of this coral comes from the unhealthy diet of the Craboral. Another one who forgot to eat all of his 5 fruits and veggies a day!",ep:16,g:5,l:40,wd:true,fm:true,w:10,p:1};
I[8735] = {n:"Mojeeto Coral",t:51,d:"The outstanding colour of this coral comes from the unhealthy diet of the Craboral. Another one who forgot to eat all of his 5 fruits and veggies a day!",ep:16,g:6,l:40,wd:true,fm:true,w:10,p:1};
I[8736] = {n:"Polished Stone Heart",t:51,d:"The only thing that can differentiate a Crackler\'s heart from that of a polished Crackler is the delicacy with which the item can break between your toes when you least expect it.",ep:16,g:7,l:80,wd:true,fm:true,w:1,p:1};
I[8737] = {n:"Polished Ball",t:51,d:"From what part of the Crackrock\'s anatomy does this ball come? And why do they always come in pairs?",ep:16,g:8,l:80,wd:true,fm:true,w:1,p:1};
I[8738] = {n:"Great Sacrum",t:47,d:"The Coralator offers you a bone from its backside. It doesn\'t have much use for it anyway.",ep:22,g:11,l:150,wd:true,fm:true,w:1,p:1};
I[8739] = {n:"Sparo\'s Humerus",t:47,d:"Even though this bone\'s called a humerus, it\'s hard to tell if it actually comes from Sparo\'s arm. When he died, his skeleton was put in a barrel and smashed up. It sounds painful, even for a bone.",ep:22,g:18,l:80,wd:true,fm:true,w:1,p:1};
I[8740] = {n:"Flib\'s Stump",t:47,d:"If I were you I wouldn\'t pick this thing up - the mouth it came from is about as clean as the devil\'s crotch. But well, you\'re the adventurer, you know your business!",ep:22,g:19,l:80,wd:true,fm:true,w:1,p:1};
I[8741] = {n:"Kido Beak",t:47,d:"This beak is so fragile that Otomai\'s disciples used it to make training arrows with blunt ends.",ep:16,g:22,l:80,wd:true,fm:true,w:1,p:1};
I[8744] = {n:"Craboral Pincer",t:47,d:"Just avoid shaking a Craboral on the pincer! You might lose your hand to politeness.",ep:22,g:17,l:40,wd:true,fm:true,w:1,p:1};
I[8745] = {n:"Kurasso Petal",t:35,d:"The colour of this petal reveals its doubtful origin. Alcohol abuse can even be noticed in Otomai\'s disciples\' creations.",ep:22,g:3,l:40,wd:true,fm:true,w:1,p:1};
I[8746] = {n:"Mahlibuh Petal",t:35,d:"The colour of this petal reveals its doubtful origin. Alcohol abuse can even be noticed in Otomai\'s disciples\' creations.",ep:22,g:5,l:40,wd:true,fm:true,w:1,p:1};
I[8747] = {n:"Passaoh Petal",t:35,d:"The colour of this petal reveals its doubtful origin. Alcohol abuse can even be noticed in Otomai\'s disciples\' creations.",ep:22,g:4,l:40,wd:true,fm:true,w:1,p:1};
I[8748] = {n:"Mojeeto Petal",t:35,d:"The colour of this petal suggests its doubtful origin. Alcohol abuse can even be noticed in the creations of Otomai\'s disciples.",ep:22,g:6,l:40,wd:true,fm:true,w:1,p:1};
I[8749] = {n:"Kurasso Bulb",t:36,d:"The Palmflower doesn\'t grow from a seed but a bulb soaked in alcohol. Why? Just because!",ep:22,g:3,l:40,wd:true,fm:true,w:1,p:1};
I[8750] = {n:"Mahlibuh Bulb",t:36,d:"The Palmflower doesn\'t grow from a seed but a bulb soaked in alcohol. Why? Just because!",ep:22,g:6,l:40,wd:true,fm:true,w:1,p:1};
I[8751] = {n:"Passaoh Bulb",t:36,d:"The Palmflower doesn\'t grow from a seed but a bulb soaked in alcohol. Why? Just because!",ep:22,g:4,l:40,wd:true,fm:true,w:1,p:1};
I[8752] = {n:"Mojeeto Bulb",t:36,d:"The Palmflower doesn\'t grow from a seed but a bulb soaked in alcohol. Why? Just because!",ep:22,g:5,l:40,wd:true,fm:true,w:1,p:1};
I[8753] = {n:"Mane in Bloom",t:36,d:"This mane is an improbable hybrid of hairs and flower petals, which means it\'s doubly allergenic. So keep away if you\'re sensitive... a single sneeze could send your brain flying out your nose.",ep:22,g:2,l:80,wd:true,fm:true,w:1,p:1};
I[8754] = {n:"Barbrossa\'s Ridiculous Beard",t:54,d:"This tiny hair tuft will remind you of your holidays thanks to its smell of sand, sunscreen and alcohol. What a pity it stinks so much of gunpowder too!",ep:22,g:10,l:80,wd:true,fm:true,w:1,p:1};
I[8755] = {n:"Flib\'s Red Tuft",t:54,d:"No one knows whether the colour of this tuft is natural or due to some untimely bush fire.",ep:22,g:11,l:80,wd:true,fm:true,w:1,p:1};
I[8756] = {n:"Kilibriss Down",t:54,d:"Kilibriss down is light and much sought after for the making of mattresses.",ep:22,g:12,l:80,wd:true,fm:true,w:1,p:1};
I[8757] = {n:"Barbrossa\'s Shirt",t:15,d:"Do you need an insect repellent? Just put Barbrossa\'s Shirt on! One side effect is that people will vomit automatically if they come within five feet of you.",ep:22,g:11,l:80,wd:true,fm:true,w:1,p:1};
I[8758] = {n:"Gourlo\'s Wrecked Shorts",t:15,d:"No one ever found an intact pair of Gourlo\'s shorts - he was a pyromaniac, and frequently burnt his clothes right off his body.",ep:22,g:12,l:200,wd:true,fm:true,w:1,p:1};
I[8759] = {n:"Flib\'s Cursed Little Box",t:15,d:"This box is shaped like Flib... unless it\'s the opposite! In any case, it\'s still a cursed little chest.",ep:22,g:13,l:80,wd:true,fm:true,w:1,p:1};
I[8760] = {n:"Sparo\'s Scarf",t:15,d:"This scarf is an essential accessory for both the summer and winter seasons. It will give you an original look, though a bit kitsch. Its flashy colour will certainly excite male Gobballs, but is that really what you want?",ep:22,g:14,l:80,wd:true,fm:true,w:1,p:1};
I[8761] = {n:"Gourlo\'s Explosive Powder",t:48,d:"To compensate for the cannon he couldn\'t transplant as an arm, Gourlo never goes out without his weapon. He can\'t shoot very quickly since he must wait for the powder to dry each time.",ep:22,g:1,l:200,wd:true,fm:true,w:1,p:1};
I[8762] = {n:"Polished Brain Fragment",t:50,d:"Thanks to this fragment, you\'ll learn the Cracklers\' good manners: hand crushing to say hi.",ep:16,g:3,l:80,wd:true,fm:true,w:1,p:1};
I[8763] = {n:"Mufafah Moustache",t:15,d:"Marylork the painter prefers his brushes to be made from thick, luxuriant Mufafah Moustache, rather than the slightly wispy Kittenfish Moustache, which is liable to blow away in the slightest of breezes.",ep:22,g:15,l:80,wd:true,fm:true,w:1,p:1};
I[8764] = {n:"Greater Bherb Eyebrow",t:15,d:"To prove that he\'s the Boss, the eyebrows of the Greater Bherb are always frowning, even beyond death.",ep:22,g:16,l:400,wd:true,fm:true,w:1,p:1};
I[8765] = {n:"Kilibriss Staff",t:15,d:"Thanks to its length, this staff will enable you to reach the most difficult places to access and to scratch yourself all over.",ep:22,g:17,l:100,wd:true,fm:true,w:1,p:1};
I[8766] = {n:"Kido Rear Feather",t:53,d:"One of Otomai\'s greatest riddles was inspired by this resource: what\'s the heaviest? One hundred pods of Kido feathers or one hundred pods of Pyrute?",ep:22,g:5,l:80,wd:true,fm:true,w:1,p:1};
I[8767] = {n:"Plain Pikoko Wing",t:104,d:"The Pikoko never was famous for its grace in flight. Once you\'ve seen its wings, well, you\'ll understand why.",ep:22,g:1,l:80,wd:true,fm:true,w:1,p:1};
I[8768] = {n:"Torn Pumbaa Ear",t:106,d:"If you stick this ear to yours, you\'ll be able to hear the plain boar gallop instead of the  roar of the sea.",ep:22,g:1,l:80,wd:true,fm:true,w:1,p:1};
I[8769] = {n:"Plain Pikoko Nut",t:111,d:"There\'s no milk in this Pikoko Nut but you\'ll find some brain juice with a few floating neurones.",ep:16,g:1,l:80,wd:true,fm:true,w:1,p:1};
I[8770] = {n:"Tynril Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:1,l:500,wd:true,fm:true,w:1,p:1};
I[8771] = {n:"Floramor Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:2,l:120,wd:true,fm:true,w:1,p:1};
I[8772] = {n:"Rotaflor Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:5,l:120,wd:true,fm:true,w:1,p:1};
I[8773] = {n:"Gwass Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:3,l:100,wd:true,fm:true,w:1,p:1};
I[8774] = {n:"Barkritter Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:6,l:100,wd:true,fm:true,w:1,p:1};
I[8775] = {n:"Warguerite Bark",t:96,d:"This bark is curiously curved. It looks like it went through a rasp.",ep:22,g:4,l:100,wd:true,fm:true,w:1,p:1};
I[8776] = {n:"Dark Pikoko Nut",t:111,d:"There\'s no milk inside this Pikoko Nut, just brain juice. If you\'re lucky, you might find a few neurons floating on the surface.",ep:22,g:2,l:120,wd:true,fm:true,w:1,p:1};
I[8777] = {n:"Tynril Pistil",t:36,d:"Should a Sacrier be lucky enough to remove several of these sexual organs from the four Tynrils after a long, arduous fight, the rest of his teammates would be well within their rights to refer to them as " + "\"" + "The Sac\'s Pistils" + "\"" + ". Whether they should or not is another matter altogether.",ep:22,g:7,l:500,wd:true,fm:true,w:1,p:1};
I[8778] = {n:"Floramor Stamen",t:36,d:"The stamen is the male organ of a plant. Yep! Despite appearances, it seems that Floramor is a male...",ep:22,g:8,l:100,wd:true,fm:true,w:1,p:1};
I[8779] = {n:"Rotaflor Carpel",t:36,d:"A little biology lesson: the flowers are the plants\' sexual organs and the pistil is part of the flower while the carpel is part of the pistil... I\'ll let you decide what does what.",ep:22,g:9,l:100,wd:true,fm:true,w:1,p:1};
I[8780] = {n:"Gwass Sepal",t:36,d:"This part of the Gwass\' body is always green, no matter what. Is it due to some excess of chlorophyll or to something else?",ep:22,g:10,l:80,wd:true,fm:true,w:1,p:1};
I[8781] = {n:"Barkritter Calyx",t:36,d:"Don\'t bother trying to use the Barkritter Calyx to drink anything. It might resemble a cup, but it\'s about as solid as a sieve.",ep:22,g:12,l:100,wd:true,fm:true,w:1,p:1};
I[8782] = {n:"Warguerite Bract",t:36,d:"The Warguerite bract refers to an area that decency prevents me from uttering.",ep:22,g:11,l:100,wd:true,fm:true,w:1,p:1};
I[8783] = {n:"Dark Pikoko Tonsils",t:15,d:"The Dark Pikoko is not as nuts once he\'s got his tonsils removed. Well, this is no surprise since the surgery usually kills him.",ep:22,g:18,l:100,wd:true,fm:true,w:1,p:1};
I[8784] = {n:"Dark Treeckler\'s Achilles\' Heel",t:15,d:"You won\'t defeat the Dark Treeckler by shooting an arrow in his Achilles\' heel. But you can always try...",ep:22,g:19,l:100,wd:true,fm:true,w:1,p:1};
I[8785] = {n:"Dark Treeckler Seed",t:58,d:"With a lot of patience, time, water and fertilizer, you might manage to grow a Treeckler in your garden so that you can practice fighting against him. It would be easier to just catch a boat to Otomai Island..",ep:22,g:1,l:100,wd:true,fm:true,w:1,p:1};
I[8786] = {n:"Cheeken Plait",t:15,d:"This thick and harsh hair can be used as a mop if not to hide your baldness. But you\'ll have to wash it many, many times before.",ep:22,g:20,l:80,wd:true,fm:true,w:1,p:1};
I[8787] = {n:"Cheeken Cloaca",t:15,d:"No, it\'s not disgusting! It\'s nature!",ep:22,g:21,l:80,wd:true,fm:true,w:1,p:1};
I[8788] = {n:"Air Pikoko Rump",t:15,d:"This rump will enable you to create items that will cover up your own backside.",ep:22,g:22,l:80,wd:true,fm:true,w:1,p:1};
I[8789] = {n:"Kimbo Sock",t:15,d:"Despite appearances, Kimbo does wear socks, but he just doesn\'t wear them on his feet. He prefers rolling them and then placing them in strategic places.",ep:22,g:23,l:500,wd:true,fm:true,w:1,p:1};
I[8790] = {n:"Moopet Stuffing",t:15,d:"Nature having been only modestly generous to the Moopet, the creature has to resort to artifice to pass for a living thing. At times, he uses it to make his bed pass for a bed too.",ep:22,g:24,l:110,wd:true,fm:true,w:1,p:1};
I[8791] = {n:"Moopet Fabric",t:55,d:"This fabric has a strange texture but will quickly dress any modest monster.",ep:22,g:16,l:110,wd:true,fm:true,w:1,p:1};
I[8792] = {n:"Air Pikoko Nut",t:111,d:"There\'s no milk in this Pikoko Nut but you\'ll find some brain juice with a few floating neurones.",ep:22,g:3,l:110,wd:true,fm:true,w:1,p:1};
I[8793] = {n:"Snailmet Shell",t:111,d:"Round and shiny, this shell has been polished with slobber for several centuries.",ep:22,g:4,l:110,wd:true,fm:true,w:1,p:1};
I[8795] = {n:"Kimbo Wig",t:54,d:"To hide his premature baldness, Kimbo puts on this stupid wig. Fortunately for him, the coconut covers most of it.",ep:22,g:13,l:500,wd:true,fm:true,w:1,p:1};
I[8796] = {n:"Light Treeckler Knot",t:38,d:"Captain Chafer heard the name of this object, and for ever more, the Treeckler was known as " + "\"" + "Knob Head" + "\"" + ".",ep:22,g:2,l:120,wd:true,fm:true,w:1,p:1};
I[8797] = {n:"Light Treeckler Stump",t:38,d:"A stump unlike any other stump, and yet, it spins.",ep:22,g:3,l:120,wd:true,fm:true,w:1,p:1};
I[8798] = {n:"Greater Bherb Feathered Tail",t:65,d:"One by one, year after year, the number of feathers on the Bherb\'s tail increases. You can tell its age by the bushiness of its brush.",ep:22,g:1,l:500,wd:true,fm:true,w:1,p:1};
I[8799] = {n:"Pumbaa Armpit Hair",t:54,d:"Even if he often shaves it off, his hair always grows back thick and smelly. So the smell is not due to sweat.",ep:22,g:14,l:100,wd:true,fm:true,w:1,p:1};
I[8800] = {n:"Zoth Fabric",t:55,d:"Made of a soft and resistant material, this fabric is perfectly adapted to the Zoths\' figure and hides what needs to be hidden.",ep:22,g:17,l:110,wd:true,fm:true,w:1,p:1};
I[8801] = {n:"Ouassingue Fabric",t:55,d:"This cloth has more holes in it than a block of Swiss cheese and wipes up dirt quicker than an epileptic Gobball.",ep:5,g:18,l:80,wd:true,fm:true,w:1,p:1};
I[8802] = {n:"Zoth Warrior Shinbone",t:47,d:"Just like all the other bones of the Zoth Warrior, this shinbone has been broken many times. It healed perfectly and became even stronger. If it could talk it would say: " + "\"" + "What doesn\'t kill you, makes you stronger." + "\"" + "",ep:22,g:20,l:120,wd:true,fm:true,w:1,p:1};
I[8803] = {n:"Zoth Disciple\'s Kneecap",t:47,d:"Since the Zoth Disciple always attacks with his knees, the kneecaps became extremely large and tough. I know tortoises who\'d trade their shells for one of these things.",ep:22,g:21,l:120,wd:true,fm:true,w:1,p:1};
I[8804] = {n:"Zoth Master\'s Fly",t:15,d:"The Zoth Master\'s fly is outstanding. It\'s been specially designed not to cut you.",ep:22,g:25,l:120,wd:true,fm:true,w:1,p:1};
I[8805] = {n:"Zoth Girl\'s Handkerchief",t:15,d:"The Zoth girl does not use this handkerchief to wipe away her tears but to clean off her enemies\' blood.",ep:22,g:27,l:120,wd:true,fm:true,w:1,p:1};
I[8806] = {n:"Zoth Sergeant\'s Tab",t:15,d:"This embroidered tab is more of a childhood memory than a military insignia.",ep:22,g:757,l:120,wd:true,fm:true,w:1,p:1};
I[8807] = {n:"Ouassingue Juice",t:15,d:"Unless you\'re flaming drunk, there\'s no way you\'ll confuse Ouassingue juice with any drinkable liquid you can name. The nauseating stench will dissuade the blind from knocking back a mouthful.",ep:5,g:758,l:80,wd:true,fm:true,w:1,p:1};
I[8808] = {n:"Mopy King Fabric",t:55,d:"This cloth has more holes in it than a block of Swiss cheese and wipes up dirt quicker than an epileptic Gobball.",ep:22,g:19,l:200,wd:true,fm:true,w:1,p:1};
I[8809] = {n:"Mopy King Inside Out Shorts",t:15,d:"Taking after their ancestor, Mopy King Dagobert, all Mopy Kings wear their shorts inside out. What\'s confusing is that it doesn\'t turn their stomachs inside out as well.",ep:22,g:759,l:200,wd:true,fm:true,w:1,p:1};
I[8810] = {n:"Dried Mopeat Peat",t:15,d:"Made from rotting vegetables, this peat has incredible powers of absorption. Mama Bworks save them for Auntie Floe\'s monthly visits.",ep:22,g:760,l:80,wd:true,fm:true,w:1,p:1};
I[8811] = {n:"Miremop Double Chin",t:15,d:"The Miremop spends a lot of his time taking mud baths in the hopes of slimming down. He has never lost an ounce, but at least his double chin evens out his figure.",ep:22,g:761,l:80,wd:true,fm:true,w:1,p:1};
I[8812] = {n:"Gigantic Kralove Ink",t:15,d:"Slimy and dense, the Kralove ink can be used either to write romantic letters or to paint your room a depressing black depending on how your love-life\'s going.",ep:22,g:762,l:999,wd:true,fm:true,w:1,p:1};
I[8813] = {n:"Gigantic Kralove Sucker",t:15,d:"Given the size of this sucker, there\'s no doubt about its grip. And when you remove it, the slurping noise is deafening.",ep:22,g:763,l:999,wd:true,fm:true,w:1,p:1};
I[8814] = {n:"Purse of 5,000 Kamas",t:100,d:"This purse is heavy - it must be worth a fair bit. A tradesman will be happy to exchange it for its value in Kamas.",ep:1,g:56,l:1,wd:true,fm:true,w:10,u:true,p:50000};
I[8815] = {n:"Purse of 1,000 Kamas",t:100,d:"This purse is quite heavy - it must be worth something. A tradesman will be happy to exchange it for its value in Kamas.",ep:1,g:56,l:1,wd:true,fm:true,w:10,u:true,p:10000};
I[8816] = {n:"Gift: Wicked Sword",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8817] = {n:"Gift: Satanass\' Hat",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[8818] = {n:"Mopy King Sovereign Cape",t:17,d:"Made from Mopy King Fabric, this cape is riddled with micro-holes that allow sweat to escape more easily during periods of intense exercise, during aggressive melees in steamy swamps, for example. Even though this cape lets the humidity out, it keeps the heat in. This way you\'re always dry, no matter the situation. What a pity the stench of mould is so hard to shift, though.",ep:22,g:143,l:152,wd:true,fm:true,w:10,s:78,p:46520};
I[8819] = {n:"Ouassingue Cape",t:17,d:"Even though this cape is not as powerful as the fancier Mopy King version, it still has the same sweat evacuation system. You\'ll be able to face any situation wearing it, as long as you\'re able to fight while holding your breath, that is. The stench is truly unbearable!",ep:22,g:144,l:97,wd:true,fm:true,w:10,s:77,p:27650};
I[8820] = {n:"Zoth Sergeant Mask",t:16,d:"Thanks to this mask, you\'ll face all sorts of dangers without fear! But it\'s normal since it blocks the view.",ep:22,g:191,l:133,wd:true,fm:true,w:10,p:43340};
I[8821] = {n:"Zoth Disciple Hat",t:16,d:"From a distance, this hat looks like a lampshade with two holes for the eyes. It looks the same up close actually.",ep:22,g:192,l:128,wd:true,fm:true,w:10,p:41688};
I[8822] = {n:"Light Treeckler Mask",t:16,d:"This mask won\'t help you avoid or heal hangovers, but at least it gives you some chance of hiding the effects.",ep:22,g:193,l:134,wd:true,fm:true,w:10,s:79,p:42200};
I[8823] = {n:"Dark Treeckler Mask",t:16,d:"This mask won\'t help you avoid or heal hangovers, but at least it gives you some chance of hiding the effects. The dark touch simply indicates that you\'re in a bad mood... and that you should not be annoyed and you\'re ready to throw a flurry of blows to anyone who does not respect that!",ep:22,g:194,l:95,wd:true,fm:true,w:10,s:80,p:23150};
I[8824] = {n:"Snailmet",t:16,d:"With this on, you\'ll look like a Snailmet. Of course it will protect your head from blows, but does that make up for the slobber all over your head?",ep:22,g:195,l:123,wd:true,fm:true,w:10,s:96,p:43250};
I[8825] = {n:"Great Coralator Mace",t:7,d:"Bigger, heavier and more powerful, this mace makes a louder noise when smashing the enemies. But curiously, it\'s lighter and has a better grip to it. The Coralator we used to make it wasn\'t great for no reason!",ep:22,g:63,l:125,wd:true,fm:true,w:8,an:15,tw:true,e:[10,5,1,1,100,50,false,false],c:"CA>130&CC>130&CW>130",p:40150};
I[8826] = {n:"Zoth Girl Hammer",t:7,d:"Despite her small size, the Zoth Girl carries a huge hammer. It\'s a way to reinforce her muscle structure. No need to add weights round her wrists and ankles to increase her strength. Dragging the hammer is quite enough!",ep:22,g:64,l:132,wd:true,fm:true,w:10,an:15,e:[10,4,1,1,45,45,false,false],c:"CA>250&CW>150",s:93,p:43140};
I[8827] = {n:"Zoth Warrior Axe",t:19,d:"The Zoth Warrior is used to carrying two axes because he can\'t reach his enemy\'s left side with his right hand. It\'s hard to tell whether it is due to a lack of self-confidence or if he was just born clumsy!",ep:22,g:47,l:139,wd:true,fm:true,w:10,an:17,tw:true,e:[5,5,1,1,60,50,false,false],c:"CW>250&CV>500",s:95,p:44350};
I[8828] = {n:"Cheeken Wig",t:16,d:"The Cheeken is an awkward winged creature which has as much energy as if it had the avian flu and is as intelligent as  a Tofu. No need to say that it was not especially proned to survive. However, some people seem to just love its weird hair looking like a plaited mop. Human nature is an infinite mystery!",ep:0,g:196,l:1,wd:false,fm:true,w:1,p:1};
I[8829] = {n:"Barbrossa\'s Hat",t:16,d:"This hat is large enough to hide Barbrossa\'s ridiculously hairless head and beard. But it won\'t cover big-headed skulls.",ep:22,g:197,l:79,wd:true,fm:true,w:1,p:16455};
I[8832] = {n:"Snailmet Slobber",t:15,d:"This Snailmet slobber won\'t break a Pikoko\'s bones, but it\'ll certainly keep one glued to the ground.",ep:22,g:6,l:110,wd:true,fm:true,w:1,p:1};
I[8833] = {n:"Coralator Mace",t:7,d:"This hammer took its nice colour from the pieces of Coralator used to make it. Unlike what people think, it was not originally used to crush Iops and other enemies, it a door knocker for the hard of hearing.",ep:22,g:65,l:85,wd:true,fm:true,w:10,an:15,tw:true,e:[10,4,1,1,50,50,false,false],c:"CC>100&CA>100&CV>150",p:18650};
I[8834] = {n:"Dark Treeckler Branch",t:3,d:"This branch was apparently used to scrape some otherwise inaccessible body part. But don\'t worry, the dark colour is authentic, it\'s got nothing to do with the various sorts of deposits contained in the inaccessible cavities of the Treeckler.",ep:22,g:64,l:97,wd:true,fm:true,w:1,an:11,tw:true,e:[5,5,2,4,40,40,false,true],c:"CS>100&CI>100",s:80,p:25000};
I[8835] = {n:"Light Treeckler Branch",t:3,d:"This branch was apparently used to scrape some otherwise inaccessible body part. This might explain the stick\'s stickiness.",ep:22,g:65,l:132,wd:true,fm:true,w:5,an:11,tw:true,e:[4,5,2,5,10,50,false,true],c:"CA>200&CS>200",s:79,p:43225};
I[8836] = {n:"Rotaflor Stem",t:4,d:"Rotaflors use their stem to clean their ears. However, staff carvers prefer to use them as a weapon. Proof, if needed, that there\'s no accounting for tastes.",ep:22,g:75,l:119,wd:true,fm:true,w:10,an:12,tw:true,e:[5,3,1,1,45,45,false,false],c:"CA>200&CI>200",p:36025};
I[8837] = {n:"Zoth Master Staff",t:4,d:"This staff completely binds the Zoth Master, making him fearless and therefore formidable. When it comes to eating though, it makes an awful mess.",ep:22,g:76,l:158,wd:true,fm:true,w:10,an:12,e:[15,5,1,1,40,50,false,false],c:"CI>180&CS>100",s:94,p:47300};
I[8838] = {n:"Tynril Rhizome",t:4,d:"Just like weeds, Tynrils can breed infinitely thanks to this simple piece of rhizome. After making this discovery some greedy staffmakers make a staff from Tynril and tried to breed it. It was a miserable failure.",ep:22,g:77,l:186,wd:true,fm:true,w:10,an:12,e:[5,4,1,1,40,50,false,false],c:"CI>250&CS>200",p:51248};
I[8839] = {n:"Thierry Voodoo Mask",t:16,d:"This is reputed to be the only mask that allows you to eat while you wear it.",ep:22,g:199,l:158,wd:true,fm:true,w:10,p:49000};
I[8840] = {n:"Jav Voodoo Mask",t:16,d:"When Jav Kanniballs feel a little blue, they dye their hair this colour. Is it due to frustrated love or something else? Hard to know for sure, but It would be great if they could just wear the mask and stop telling everyone how sad they were.",ep:22,g:200,l:158,wd:true,fm:true,w:10,p:49000};
I[8841] = {n:"Sarbak Voodoo Mask",t:16,d:"Many moons ago, the Kannibal\'s were travelling actors respected for their comedies and tragedies, as represented by two masks - one laughing, the other cruel. When their chief lost the happy mask, the Kannibals descended into savagery.",ep:22,g:201,l:158,wd:true,fm:true,w:10,p:49000};
I[8842] = {n:"Archer Voodoo Mask",t:16,d:"Kanniball archers can\'t concentrate and aim right unless they are very angry. They painted their masks red so they\'d be fuming all the time.",ep:22,g:202,l:158,wd:true,fm:true,w:10,p:49000};
I[8843] = {n:"Crocodyl Dandy\'s Hat",t:16,d:"When he puts on this hat, Crocodyl Dandy thinks he\'s at the forefront of fashion. Fashion must be pretty dull if that\'s the case. However, it\'d be best if you didn\'t let him know how ridiculous he looks, after all, he is particularly touchy...",ep:22,g:203,l:180,wd:true,fm:true,w:10,p:50475};
I[8844] = {n:"Mopy King Sovereign Hood",t:16,d:"This hood, a royal headdress, shares the same virtues as the Mopy King Sovereign Cape. Its micro-vents allow sweat to drain away more easily, so you\'ll always have a cool head. Unfortunately, it also has the same defects as the cape: its foul stench is so strong, you could almost cut it with a knife.",ep:22,g:204,l:168,wd:true,fm:true,w:10,s:78,p:48800};
I[8845] = {n:"Ouassingue Hood",t:16,d:"Though it is less efficient than the royal hood, this one allows for a good draining of the sweat. Maybe too good, actually. As a result, whether you wear it or not, it doesn\'t make any difference.",ep:22,g:205,l:104,wd:true,fm:true,w:10,s:77,p:27650};
I[8846] = {n:"Zoth Girl Hat",t:16,d:"The Zoth girl\'s hat makes her see double. Strange. This is the reason she lisps.",ep:22,g:206,l:128,wd:true,fm:true,w:10,s:93,p:41950};
I[8847] = {n:"Zoth Warrior Helmet",t:16,d:"This helmet has the same advantages as other Zoth hats - it\'ll protect you from the sun no matter how hot it is, from blows dealt on the head, and it prevents the wearer from being aware of the danger by restricting his visual field. Anyway, this is the perfect warrior headgear.",ep:22,g:207,l:134,wd:true,fm:true,w:100,s:95,p:44000};
I[8848] = {n:"Zoth Master Hat",t:16,d:"The Zoth Master hat has the great advantage of almost completely restricting your field of vision... This way, you have to hit out wildly, so you\'ve some chance of hitting something.",ep:22,g:208,l:156,wd:true,fm:true,w:10,s:94,p:46900};
I[8849] = {n:"Barkritter Root",t:4,d:"This stick is a firm favourite with the trunk-women. But it\'ll seduce any old kind of girl. Probably.",ep:22,g:78,l:138,wd:true,fm:true,w:10,an:12,e:[7,4,1,1,40,50,false,false],c:"CV>500",p:44200};
I[8850] = {n:"Floramor Root",t:4,d:"If you\'re superstitious and always need to knock on wood, use the Floramor Root! On the other hand, you should try to be careful not to saw the branch you\'re sitting on and especially not to get your fingers in the way!",ep:22,g:79,l:144,wd:true,fm:true,w:10,an:12,tw:true,e:[10,2,1,1,40,50,false,false],p:45125};
I[8851] = {n:"Worn Treasure Map",t:24,d:"Even though your eyes are wet with joy, you are still able to read that the treasure is hidden somewhere along the road of enslaved waters.",ep:7,g:6,l:1,wd:false,fm:true,w:0,c:"SI=1001",p:1};
I[8854] = {n:"Crack Sparrow\'s Own Withered Hat",t:16,d:"You say that a kraken, with the foulest breath you\'ve ever seen, follows you wherever you go? Well, deal with it: it\'s only a tiny inconvenience that comes with the hat!",ep:7,g:5,l:1,wd:false,fm:true,w:13,c:"SI=1001",p:1};
I[8855] = {n:"Sharkal Shield",t:82,d:"This shield is protecting you for now, but don\'t be fooled, it won\'t last.",ep:16,g:35,l:11,wd:true,fm:true,w:25,c:"PK>790000",p:1};
I[8856] = {n:"Bherbal Bherb Belt",t:10,d:"When the Bherb has got butterflies, he wears his Bherbal belt and healthily eliminates them.",ep:22,g:115,l:182,wd:true,fm:true,w:10,p:51020};
I[8858] = {n:"Boots Kwish",t:11,d:"These boots create a disgusting suction noise with each step, which will remind you of a rutting Trool\'s love chant if you\'ve ever heard it. A painful memory that you could easily live without.",ep:22,g:112,l:100,wd:true,fm:true,w:10,s:77,p:25775};
I[8859] = {n:"Mopy King Sovereign Seal",t:9,d:"This seal indicates that its owner is the undisputed sovereign of the Bottomless Peat Bog of Otomai Island. It\'s hard to imagine a more pastoral kingdom...",ep:22,g:138,l:158,wd:true,fm:true,w:10,s:78,p:44581};
I[8860] = {n:"Coral Ring",t:9,d:"This ring has been pulled off the still warm finger of a freshly slaughtered Coralator. His mother was expecting him for dinner, until she saw her kid being transformed into a tombstone. Coral is not always as stone-hearted as people think.",ep:22,g:139,l:60,wd:true,fm:true,w:60,p:9500};
I[8861] = {n:"Round Kimbo Sandals",t:11,d:"Only Kimbos, with their weird feet, feel comfortable in these sandals. However, they\'re not the only ones who can benefit from their powers. But be careful not to wear them the wrong way!",ep:22,g:113,l:195,wd:true,fm:true,w:10,p:57325};
I[8862] = {n:"Parkinn Pan Pikokowal Belt",t:10,d:"Parkinn Pan truly believed that he could fly thanks to this belt trimmed with Pikoko wings, but didn\'t know that very few Pikokos can fly. That\'s why every time he jumped off the Tree Keeholo he systematically crashed on the ground. His nickname " + "\"" + "Cake" + "\"" + " comes from " + "\"" + "falling as flat as a pancake" + "\"" + ".",ep:22,g:128,l:148,wd:true,fm:true,w:20,p:78780};
I[8863] = {n:"Zothulet",t:1,d:"This amulet is just a piece of wood with a strip of torn fabric. But Zoths are absolutely convinced that it has powers. Old fools!",ep:22,g:124,l:162,wd:true,fm:true,w:10,p:55420};
I[8864] = {n:"Snailmet Bow",t:2,d:"This bow string is made of Snailmet slobber, not too dry with a unique elasticity. However, its slimy and gooey texture reminds you of ... well, nothing really, but it\'s quite unpleasant.",ep:22,g:58,l:122,wd:true,fm:true,w:10,an:10,tw:true,e:[10,5,5,10,30,50,false,true],c:"CC>250",s:96,p:43125};
I[8865] = {n:"Snailmet Ring",t:9,d:"Carved in a Snailmet carapace, this ring can resist anything or anyone.",ep:22,g:140,l:120,wd:true,fm:true,w:10,s:96,p:28500};
I[8866] = {n:"Powerful Dazzling Cloak",t:17,d:"Weaved from Zoth fabrics, this cape has extraordinary power of unknown origin.",ep:22,g:145,l:110,wd:true,fm:true,w:10,p:45000};
I[8867] = {n:"Moopet Cape",t:17,d:"With this cape on, you\'ll be craving for some vinaigrette.",ep:22,g:146,l:61,wd:true,fm:true,w:12,p:9675};
I[8868] = {n:"Cheeken Axe",t:19,d:"The Cheeken Beak on this weapon is absolutely useless, and can be more of a handicap than anything else. \nFortunately, it is quite powerful.",ep:22,g:48,l:137,wd:true,fm:true,w:10,an:17,tw:true,e:[10,5,1,1,120,50,false,false],p:15400};
I[8869] = {n:"Wooden Treeckler Boots",t:11,d:"These boots are so heavy that they should actually be categorised as weapons. Indeed, they make the slightest kick lethal.",ep:22,g:114,l:136,wd:true,fm:true,w:50,s:79,p:43850};
I[8870] = {n:"Dark Treeckler Belt",t:10,d:"Carved in a Dark Treeckler, this belt isn\'t pliable enough to let you move around easily, but at least, it\'ll protects you.",ep:22,g:129,l:92,wd:true,fm:true,w:10,s:80,p:21975};
I[8871] = {n:"Light Treeckler Belt",t:10,d:"Carved from a Light Treeckler, this belt won\'t afford you great protection, but at least it is soft enough to let you move around freely.",ep:22,g:130,l:128,wd:true,fm:true,w:10,s:79,p:41755};
I[8872] = {n:"Ring Dikuloos",t:9,d:"This jewel is not precious but is the perfect size to balance the moorgale in a nice belgroot flavoured with a hint of Glaviooze.",ep:16,g:141,l:46,wd:true,fm:true,w:9,p:3630};
I[8873] = {n:"Krabelt",t:10,d:"Finally a good excuse to smell of the sea!",ep:22,g:131,l:39,wd:true,fm:true,w:1,p:4225};
I[8874] = {n:"Ouassulet",t:1,d:"This jewel sometimes tries to steal some of your food when you\'re eating, so don\'t let it hang down too low.",ep:22,g:125,l:105,wd:true,fm:true,w:10,s:77,p:28452};
I[8876] = {n:"Inky Veil",t:17,d:"This strange cape seems to be made of black ink, but oddly enough, it behaves just like fabric - it doesn\'t run. As for stains, well, that\'s another matter. Your backside will never be clean again.",ep:22,g:147,l:191,wd:true,fm:true,w:15,p:52000};
I[8877] = {n:"Kringlove",t:9,d:"Once round your finger, you won\'t be able to take it off, ever. Its suckers are way too powerful.",ep:22,g:142,l:199,wd:true,fm:true,w:10,s:97,p:49000};
I[8878] = {n:"Kidommer",t:7,d:"This hammer is not handy, not particularly good looking, not very ergonomic, not powerful, too light, too fragile, unbalanced, too shiny and smelly. But at least it\'s got pretty colours.",ep:22,g:66,l:79,wd:true,fm:true,w:10,an:15,tw:true,e:[5,5,1,1,50,50,false,false],p:16100};
I[8879] = {n:"Polished Ring",t:9,d:"Unfortunately, this ring is only polished on the outside. You put your finger through a hole full of sharp rock fragments. It is recommended for Sacriers.",ep:16,g:143,l:66,wd:true,fm:true,w:1,p:4755};
I[8880] = {n:"Amufafah",t:1,d:"It\'s the Mufafah moustaches that cause the wearer of this necklace to bellow so loudly. Why? They hang down and tickle the nipples constantly.",ep:22,g:126,l:84,wd:true,fm:true,w:10,p:18225};
I[8881] = {n:"Solo\'s Ring",t:9,d:"Solo was a nice good-for-nothing, and he admitted as much himself. That didn\'t stop him from being hanged on the village square for stealing a thong belonging to the chief\'s wife. Solo wasn\'t a bright guy, no, but he was a nice guy all the same..",ep:22,g:144,l:31,wd:true,fm:true,w:12,p:2625};
I[8883] = {n:"Guild House Potion",t:12,d:"This potion enables you to get back to your guild house.",ep:5,g:152,l:1,wd:true,fm:true,w:2,c:"PZ=1",u:true,p:100};
I[8885] = {n:"Tabby Bow Meow Ghost",t:90,d:"This Tabby Bow Meow hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:20,l:1,wd:true,fm:true,w:1,p:1};
I[8886] = {n:"Tabby Bow Meow Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:20,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[8887] = {n:"Bow Kennel Certificate: Tabby Bow Meow",t:77,d:"This certificate describes the characteristics of the Tabby Bow Meow you\'ve put in the Bow Kennels.",ep:3,g:48,l:1,wd:true,fm:true,w:1,p:100};
I[8888] = {n:"Bow Kennel Certificate: Mischievous Squirrel",t:77,d:"This certificate describes the characteristics of the Mischievous Squirrel you\'ve put into the Bow Kennels.",ep:3,g:49,l:1,wd:true,fm:true,w:1,p:100};
I[8889] = {n:"Bow Kennel Certificate: Leopardo",t:77,d:"This certificate describes the characteristics of the Leopardo you\'ve put in the Bow Kennels.",ep:3,g:50,l:1,wd:true,fm:true,w:1,p:100};
I[8890] = {n:"Gift: Tabby Bow Meow",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8891] = {n:"Gift: Mischievous Squirrel",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8892] = {n:"Gift: Leopardo",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:1,g:42,l:1,wd:true,fm:true,w:1,c:"PZ=1",u:true,p:1};
I[8893] = {n:"Gift: Pineapple Mask",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:1,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
