I[8913] = {n:"Bulbish Potion",t:12,d:"This potion has been made from extracts of bulbs that soaked in Kloug mash. The most audacious alchemists use rice flour instead of Kloug mash, which can no longer be found. Even though it might seem impossible, you\'ll get used to its taste.",ep:22,g:23,l:110,wd:true,fm:true,w:1,u:true,ut:true,p:10};
I[8914] = {n:"Handyman Information Card",t:24,d:"This card contains all the necessary information to find the handyman described herein.",ep:0,g:176,l:1,wd:false,fm:true,w:0,c:"PJ>65,50",p:1};
I[8915] = {n:"Empty Handyman Information Card",t:80,d:"This empty card should be filled with all the necessary information to find a Handyman.",ep:0,g:6,l:1,wd:false,fm:true,w:1,ut:true,p:1};
I[8916] = {n:"Tynril Amber",t:50,d:"This amber is different from any other. If you close your eyes, shake it and dance the manic tango of Captain Chafer, you might feel it vibrate and glow as if a mysterious spirit inhabited it. To be honest though, you\'ll look like an idiot. A shiny, vibrating idiot.",ep:22,g:1,l:100,wd:true,fm:true,w:10,p:1};
I[8917] = {n:"Grotto Hesque Key",t:84,d:"This strange key will let you enter the Grotto Hesque in one piece.",ep:22,g:244,l:1,wd:true,fm:true,w:1,p:1};
I[8918] = {n:"Improved Helmet",t:16,d:"In theory, this helmet should keep your wig on your head if you decide to go ride a Scaraleaf. Simply priceless!",ep:22,g:25,l:1,wd:true,fm:true,w:10,p:1};
I[8919] = {n:"Improved Wooden Wings",t:17,d:"These improved wooden wings have been padded and made lighter thanks to feathers and high-quality fabric. Since the frame is still in wood, it will be hard not to crash!",ep:22,g:22,l:30,wd:true,fm:true,w:10,p:2633};
I[8922] = {n:"Purse of Kamas",t:24,d:"This purse contains a considerable amount of Kamas. Choose carefully who you bribe.",ep:2,g:243,l:1,wd:true,fm:true,w:0,p:1};
I[8923] = {n:"Bag of Potatoes",t:24,d:"A bag of potatoes? What are you doing with a bag of potatoes? Idiot.",ep:2,g:243,l:1,wd:true,fm:true,w:0,p:1};
I[8924] = {n:"Rahm Bow",t:2,d:"Once upon a time, a man named Rahm got lost in the jungle. Have you heard of Viet Rham?",ep:22,g:59,l:151,wd:true,fm:true,w:10,an:10,e:[10,3,2,7,30,50,false,true],c:"CA>200",p:46105};
I[8925] = {n:"Little Bow Sleep",t:2,d:"This strange bow was carved by a Sadidette during a very productive sleep-stroll. Just looking at it makes you feel sleepy - that goes for the archer as well as the target.",ep:22,g:60,l:185,wd:true,fm:true,w:15,an:10,tw:true,e:[10,4,3,8,30,50,false,true],c:"CA>300&CI>300",p:51125};
I[8926] = {n:"Dagg\'Adou",t:5,d:"These daggers are perfect for pushing pineapples and shaking trees, or pushing pineapples and grinding coffee, if that\'s what takes your fancy. Just remember: to the left, to the right, jump up and down and to the knees.",ep:22,g:65,l:175,wd:true,fm:true,w:10,an:13,tw:true,e:[7,3,1,1,30,30,false,false],c:"CA>250&CC>250&CS>150",p:49775};
I[8927] = {n:"Gaga Daggers",t:5,d:"Long ago there lived a mad Sram called Gaga... this guy, he robbed from the poor and gave to the rich.",ep:22,g:66,l:171,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CS>350&CA>200",p:49280};
I[8928] = {n:"Porkeez Daggers",t:5,d:"Porkeez is a better drinker than he is a fighter, and let me tell you he doesn\'t get any better as time passes by. All the same I wouldn\'t go around looking like a cork when he\'s got his daggers out.",ep:22,g:67,l:158,wd:true,fm:true,w:10,an:13,e:[15,2,1,1,30,50,false,false],c:"CA>300",p:47275};
I[8929] = {n:"Kriss Tobal",t:5,d:"This should not be mistaken for the famous staff of similar name. The blades on this implement spill far more blood.",ep:22,g:68,l:149,wd:true,fm:true,w:10,an:13,tw:true,e:[10,3,1,1,30,50,false,false],c:"CI>250&CC>250",p:45875};
I[8930] = {n:"Fuchsia",t:6,d:"Many a proud adventurer refused this weapon because of its colour. Many the same died by its blade.",ep:22,g:78,l:163,wd:true,fm:true,w:10,an:14,e:[7,5,1,1,30,50,false,false],c:"CA>300&CI>300",p:48245};
I[8931] = {n:"Az\'tech",t:6,d:"This sword used to belong to an old power hungry Enutrof. Just like his ego, it\'s made of solid gold.",ep:22,g:79,l:186,wd:true,fm:true,w:10,an:14,tw:true,e:[7,5,1,1,45,50,false,false],c:"CA>200&CC>200&CS>200",p:51275};
I[8932] = {n:"Kukri Kura",t:6,d:"Smile! Say cheese! Perfect! Sliced in half!",ep:22,g:80,l:179,wd:true,fm:true,w:10,an:14,e:[7,4,1,1,40,50,false,false],c:"CS>300&CA>150",p:50330};
I[8933] = {n:"Sick Axe",t:19,d:"Ourag\'han was an old Pandawa with skin so soft he was known as Slippiderm. His odour on the other hand gave rise to another name altogether. He christened his trusty axe likewise.",ep:22,g:49,l:162,wd:true,fm:true,w:10,an:17,tw:true,e:[10,5,1,1,50,50,false,false],c:"CW>250&CS>300",p:47900};
I[8934] = {n:"Michael Dougle Axe",t:19,d:"Driven into a horticidal rage when a mischievous squirrel stole a grain of his rice during a summer holiday on Pandawa Island, Brouce Boulgour used this axe to flatten each and every bamboo shoot the squirrel hopped onto. The Pandawas in the village had to feed him half their stock of bamboo wine to keep him from razing the entire forest. Trust old Broucey.",ep:22,g:50,l:158,wd:true,fm:true,w:10,an:17,e:[7,5,1,1,50,50,false,false],c:"CC>150&CA>150&CI>150",p:47542};
I[8935] = {n:"Hickory Shovel",t:8,d:"Even as a young Iopette, Mel dreamt of slaying dragons. With a spade for a sword and a rock for a dragon, she honed her skills in the back yard. The mere mention of a shovel now has the poor rock in convulsions.",ep:22,g:48,l:176,wd:true,fm:true,w:10,an:16,e:[7,4,1,1,35,50,false,false],c:"CC>250&CI>250",p:49985};
I[8936] = {n:"Shovel Shattkitou",t:8,d:"This is a wild shovel which tries to bite its owner each time it\'s picked up. It makes the most unusual sounds when it\'s happy and can only be pacified with the soothing sound of chimes.",ep:22,g:49,l:137,wd:true,fm:true,w:10,an:16,tw:true,e:[5,4,1,1,40,50,false,false],c:"CC>150&CA>200",p:43945};
I[8937] = {n:"Shovel Egant",t:8,d:"A cunning Enutrof became a pirate after noticing that there were more treasures to be found on fresh corpses than in rotten graves. This blood-red shovel was his symbol and filled the sailors of the Asse Sea with terror.",ep:22,g:50,l:156,wd:true,fm:true,w:10,an:16,e:[7,5,1,1,20,50,false,false],c:"CS>250&CI>250",p:49455};
