I[8988] = {n:"Hippi-Ho for Treechster and Minimino",t:116,d:"With this powerful pill, you can increase the characteristics of your Treechster or Minimino for good. Be careful, though. Don\'t give it more than one dose or you\'ll have a dead Treechster or Minimino on your hands. Speaking of which, both meats are very, very tasty. It\'s best to leave it marinade for... okay, I\'ll stop talking...",ep:1,g:11,l:1,wd:true,fm:true,w:1,c:"PO=8153|PO=7522",u:true,p:1};
I[8989] = {n:"Air Pikoko Helmet",t:16,d:"With this helmet on, you can hope to fly in the air if you spin around at the speed of sound. As for the landing, you\'ll have to sort it out.",ep:22,g:209,l:154,wd:true,fm:true,w:10,p:44350};
I[8990] = {n:"Prism of Conquest",t:112,d:"This magical stone can fill the darkest corner with a shimmering glow - no need to waste your precious urine to mark your territory. Not to be used in moderation if you have a conquering spirit. Warning! You can place a prism only if you clearly display your rank (with the player versus player mode activated), and if you are in an area with no other prisms. The area where you want to place a conquest prism must be adjoining at least a 5-minute old ally area.",ep:4,g:1,l:1,wd:true,fm:true,w:10,c:"PL>9&PP>2",u:true,p:1};
I[8991] = {n:"Head Band",t:9,d:"This cold, slimy ring never stops sucking on your finger from the minute you slip it on. If you can see past its flaws, however, its great powers are yours to wield.",ep:22,g:145,l:189,wd:true,fm:true,w:10,s:97,p:55000};
I[8992] = {n:"Blord Warrior\'s Cursed Scythe",t:22,d:"This blade cuts wheat as well as enemies, but it also makes your allies extremely jealous. That\'s the destiny of powerful people.",ep:22,g:3,l:200,wd:true,fm:true,w:10,an:17,tw:true,e:[10,5,1,1,100,50,false,false],p:58000};
I[8993] = {n:"Blord Warrior\'s Cursed Sword",t:6,d:"This sword holds an immense power of which the many victims fill chapters in the history books. On the other hand, wielding this weapon has proven mortally dangerous. Is there someone who can tame its vicious force?",ep:20,g:83,l:200,wd:true,fm:true,w:10,an:14,tw:true,e:[10,5,1,1,100,2,false,false],p:58000};
I[8994] = {n:"Coralator Fabric",t:55,d:"This humid rag was long hidden underwater where particles of coral covered its surface thread by thread. It\'s a pity it\'s as hard as stone - it would have made a nice hanky.",ep:22,g:728,l:150,wd:true,fm:true,w:1,p:100};
I[8995] = {n:"Gourlo the Terrible Fabric",t:55,d:"Used in the past as a blister bandage by Gourlo the Terrible, this fabric is still impregnated with a dizzying stench. The funny thing is, one sniff and you\'ll be overcome with an irresistible hunger.",ep:22,g:729,l:150,wd:true,fm:true,w:1,p:100};
I[8996] = {n:"Greater Bherb Skin",t:59,d:"This skin is softer than a Kilibris\' bottom. Fat lot of good it will do you.",ep:22,g:48,l:250,wd:true,fm:true,w:1,p:100};
I[8997] = {n:"Lacerated Tynril Skin",t:59,d:"This skin probably covered a sensitive area of the Tynril. Poor lad.",ep:22,g:629,l:400,wd:true,fm:true,w:1,p:100};
I[8998] = {n:"Kimbo\'s Precious Stone",t:50,d:"Let me tell you a little story... for many long years, the Kimbo sucked on this precious stone to soften it up. Then he shoved it up his nostril. Hmm, sometimes mother nature suckles her runts.",ep:22,g:109,l:900,wd:true,fm:true,w:1,p:100};
I[9000] = {n:"",t:82,d:"",ep:0,g:10,l:1,wd:false,fm:true,w:10,c:"PP>5",p:1};
I[9001] = {n:"Sidimote Shield",t:82,d:"This shield will remind your opponents you grew up in the Sidimote moors. That alone could be enough to scare them away.",ep:18,g:8,l:5,wd:true,fm:true,w:10,c:"PP>4",p:15650};
I[9002] = {n:"Phtalmo",t:82,d:"This shield is covered with peepers to allow you to give one of those devastating multi-evil-eyes. Unstoppable.",ep:18,g:5,l:5,wd:true,fm:true,w:10,c:"PP>4",p:33000};
I[9003] = {n:"Inn Shield",t:82,d:"The Innkeeper at the Feubuk Brewery in Bonta was bored to death one day when he suddenly got the idea of equipping his bouncers with neon advertising shields.",ep:18,g:6,l:4,wd:true,fm:true,w:10,c:"PP>3",p:16200};
I[9004] = {n:"Akwadala Shield",t:82,d:"To stave off wicked or tough hits, this shield from Akwadala should do.",ep:14,g:31,l:3,wd:true,fm:true,w:2,c:"PP>2",s:34,p:5350};
I[9005] = {n:"Fan Shield",t:82,d:"When your allies run out of breath, or when you want to clear the air after an unexpected wind of panic, this shield can save your life. The only thing you need to do is to shake it energetically in all directions, like you\'d do with a hungry baby.",ep:18,g:11,l:9,wd:true,fm:true,w:10,c:"PP>8",p:54450};
I[9006] = {n:"Sadida Shield",t:82,d:"Originally, this shield was used as a stool by the Sadidas when they needed to rest. If you tuck in your feet, it will protect you from a wide range of attacks. Nothing will protect you from the cruel laughter of your opponents though.",ep:18,g:12,l:7,wd:true,fm:true,w:10,c:"PP>6",p:18700};
I[9007] = {n:"Shield in Briefs",t:82,d:"This surprising creation is covered in the Leather Briefs of the Lancer Chafer, which have been boiled, cleaned and stretched so that they hug the arm as perfectly as they did the full, generous curves of Lancer Chafer\'s... I think that\'s quite enough of that actually.",ep:18,g:13,l:6,wd:true,fm:true,w:10,c:"PP>5",p:26700};
I[9008] = {n:"Asse Shield",t:82,d:"This magnificent shield contains a few drops from the Asse Sea. Not only does it bring good luck but it can also be used as a flask.",ep:18,g:16,l:8,wd:true,fm:true,w:10,c:"PP>7",p:32450};
I[9009] = {n:"Treechnid Shield",t:82,d:"Hidden behind this shield, some naÃ¯ve adventurers could mistake you for a Treechnid and run off screaming. Most will attack all the more eagerly, thinking they can get some amber out of you.",ep:18,g:19,l:3,wd:true,fm:true,w:10,c:"PP>2",p:5950};
I[9010] = {n:"Pandawa Shield",t:82,d:"Perfect if you want to fit in on Pandala, or to stand out anywhere else! The biggest advantage of this shield is that it\'s entirely covered with hypoallergenic Pandawa hair, so now you don\'t need to pack your underwear and your armour in separate suitcases when you take your vacation.",ep:18,g:22,l:3,wd:true,fm:true,w:10,c:"PP>2",p:5600};
I[9011] = {n:"Fire Dial",t:82,d:"This special shield will protect you from the Fire element and will also give your opponents plenty of time... Time to make their last wishes that is!",ep:18,g:24,l:2,wd:true,fm:true,w:10,c:"PP>1",p:2000};
I[9012] = {n:"Air Dial",t:82,d:"This special shield will protect you from the Air element and will also give your opponents plenty of time... Time to make their last wishes that is!",ep:18,g:26,l:2,wd:true,fm:true,w:10,c:"PP>1",p:2000};
I[9013] = {n:"Earth Dial",t:82,d:"This special shield will protect you from the Earth element and will also give your opponents plenty of time... Time to make their last wishes that is!",ep:18,g:27,l:1,wd:true,fm:true,w:10,c:"PP>0",p:2000};
I[9014] = {n:"Water Dial",t:82,d:"This special shield will protect you from the Water element and will also give your opponents plenty of time... Time to make their last wishes that is!",ep:18,g:25,l:1,wd:true,fm:true,w:10,c:"PP>0",p:2000};
I[9015] = {n:"Lumberjack Shield",t:82,d:"This shield used to protect Lumberjacks from falling trees. Its function quickly changed and now it is more often used to it to protect warriors from enemies who tend to land on them without warning!",ep:18,g:4,l:2,wd:true,fm:true,w:10,c:"PP>1",p:1200};
I[9016] = {n:"Mount Stinkky Shield",t:82,d:"Greenish and smelly, this shield remains a first choice for protection when it comes to fighting the creatures of green and smelly Mount Stinkky.",ep:18,g:1,l:3,wd:true,fm:true,w:20,c:"PP>2",p:5400};
I[9017] = {n:"Imp Shield",t:82,d:"If your dearest dream is to become a real imp, this is the shield you need. Passed down from generation to generation, it will enable you to rob all the young Astrubian adventurers you like without getting hurt.",ep:18,g:9,l:7,wd:true,fm:true,w:10,c:"PP>6",p:30700};
I[9018] = {n:"Heart Quarter",t:82,d:"A renowned adventurer spent his whole life looking for all four quarters of this shield. Some say that when the shield is complete, it has the exact opposite effect as that of breaking a mirror.",ep:18,g:7,l:4,wd:true,fm:true,w:10,c:"PP>3",p:13000};
I[9019] = {n:"Bawbawian Shield",t:82,d:"Not all Wabbits are nice little creatures. In fact, all Wabbits are vile creatures. Some get their kicks smashing up cawwots with this huge shield and taking baths in the juice.",ep:18,g:2,l:4,wd:true,fm:true,w:15,c:"PP>3",p:10500};
I[9020] = {n:"Derma Tho",t:82,d:"This shield of skin will fit you like a glove. Don\'t forget to treat its warts and furuncles from time to time to prevent them from getting worn.",ep:18,g:3,l:3,wd:true,fm:true,w:10,c:"PP>2",p:2200};
I[9021] = {n:"Captain Amakna Shield",t:82,d:"A young adventurer once dreamt of joining the Bonta militia to protect the oppressed. Considered morally unfit for service, he was contacted by an Amakna Alchemist who took advantage of his good nature, using him as a guinea-pig for his potions. You\'ll be glad to know that this is one story that ends... well, the middle bit is happy. He became so strong that he was known forever more as Captain Amakna and had this reputedly indestructible shield forged for him. The end... well, you don\'t wanna know the end.",ep:18,g:14,l:10,wd:true,fm:true,w:30,c:"PP>9",p:63200};
I[9022] = {n:"Kloome",t:82,d:"This huge shield saved the famous adventurer Kloome from an awful death: squashed under the weight of a Crackler who was in love with him. The legend doesn\'t say if he survived the side effects of his subsequent romance with the stony beast.",ep:18,g:15,l:5,wd:true,fm:true,w:10,c:"PP>4",p:22100};
I[9023] = {n:"Flying Shield",t:82,d:"As strange as it might sound, some say this shield of wood and hair enables the lightest adventurers to become airborne for a brief moment... a final attempt to shock their enemies before falling flat on their faces.",ep:18,g:17,l:1,wd:true,fm:true,w:1,c:"PP>0",p:1200};
I[9024] = {n:"LeChouque\'s Shield",t:82,d:"LeChouque used this shield to protect himself from the friendly cannonballs his friends regularly tossed him. Some crazy stories tell that some of those balls were alive.",ep:18,g:18,l:7,wd:true,fm:true,w:10,c:"PP>6",p:36850};
I[9025] = {n:"Gobball Shield",t:82,d:"Although it\'s all but useless, its stench alone will spread your fame far and wide. This shield accompanies many young adventurers on their first quests - maybe that\'s why so few make it to thirty...",ep:1,g:20,l:1,wd:true,fm:true,w:10,c:"PP>0",p:400};
I[9026] = {n:"Bowisse\'s Shield",t:82,d:"This shield is a tribute to Bowisse\'s Cloak which itself was a tribute to a famous relic composed of three triangular shapes. God all this history is putting me to sleep.",ep:18,g:21,l:4,wd:true,fm:true,w:10,c:"PP>3",p:10150};
I[9027] = {n:"Crackler Shield",t:82,d:"This stone shield is in fact made from a Crackler\'s head, smashed by the foot of a Minotoror. A perfect combination of big head and smelly feet.",ep:5,g:23,l:3,wd:true,fm:true,w:10,c:"PP>2",p:6300};
I[9028] = {n:"Terrdala Shield",t:82,d:"To stave off wicked or tough hits, this shield from Terrdala should do.",ep:18,g:32,l:4,wd:true,fm:true,w:10,c:"PP>3",s:36,p:14100};
I[9029] = {n:"Feudala Shield",t:82,d:"To stave off wicked or tough hits, this shield from the village of Feudala should do.",ep:18,g:33,l:6,wd:true,fm:true,w:15,c:"PP>5",s:37,p:27100};
I[9030] = {n:"Aerdala Shield",t:82,d:"To stave off wicked or tough hits, this Shield from the village of Aerdala should do.",ep:18,g:30,l:5,wd:true,fm:true,w:10,c:"PP>4",s:35,p:11600};
I[9031] = {n:"Gore Master\'s Ring (Gms Only)",t:9,d:"In his time, Gore Master was very strong and had all he needed - money, women, and more. He didn\'t quite deserve all of it since he got his strength from his nice ring. Until the day he carelessly crossed the street. And BAM! No more Gore Master. Since then, unscrupulous people pass it on to other unscrupulous people.",ep:0,g:1,l:1,wd:false,fm:true,w:1,p:1};
I[9035] = {n:"Guild Paddock Potion",t:12,d:"This potion enables you to go back to your guild paddock.",ep:5,g:25,l:1,wd:true,fm:true,w:2,c:"PZ=1",u:true,p:100};
I[9036] = {n:"Village Potion: Zoth Village",t:12,d:"This potion enables you teleport to the Zoth Village, if you happen to own it.",ep:0,g:24,l:1,wd:true,fm:true,w:1,c:"Ps=1|Ps=2",u:true,p:10};
I[9037] = {n:"Discovery Potion",t:14,d:"This potion enables you to unveil all the invisible characters surrounding you.",ep:0,g:0,l:1,wd:true,fm:true,w:1,p:10};
I[9038] = {n:"Small Attack Potion",t:14,d:"This potion will make you so angry that you\'ll automatically attack enemies that get too close.",ep:0,g:32,l:1,wd:true,fm:true,w:1,c:"Pg=21",u:true,p:10};
I[9039] = {n:"Prism Call Potion",t:12,d:"This potion lets you teleport yourself to the closest ally prism.",ep:0,g:34,l:1,wd:true,fm:true,w:1,c:"Ps=1|Ps=2",u:true,p:10};
I[9040] = {n:"Average Attack Potion",t:14,d:"This potion will make you so angry that you\'ll automatically attack enemies that get too close.",ep:0,g:33,l:1,wd:true,fm:true,w:1,c:"Pg>21,1",u:true,p:10};
I[9041] = {n:"Large Attack Potion",t:14,d:"This potion will make you so angry that you\'ll automatically attack enemies that get too close.",ep:0,g:34,l:1,wd:true,fm:true,w:1,c:"Pg>21,2",u:true,p:10};
I[9042] = {n:"Powerful Attack Potion",t:14,d:"This potion will make you so angry that you\'ll automatically attack enemies that get too close.",ep:0,g:36,l:1,wd:false,fm:true,w:1,c:"Pg>21,3",u:true,p:10};
I[9043] = {n:"Mega Attack Potion",t:14,d:"This potion will make you so angry that you\'ll automatically attack enemies that get too close.",ep:0,g:35,l:1,wd:false,fm:true,w:1,c:"Pg>21,4",u:true,p:10};
I[9044] = {n:"Iop Disguise Potion",t:14,d:"This potion will allow you to take on the appearance of your choosing. Watch out, your mum might call the police if she finds you in your bed tomorrow morning.",ep:0,g:43,l:1,wd:false,fm:true,w:1,c:"Pg>10,3",u:true,p:10};
