I[9057] = {n:"Bontarian Disguise Potion",t:14,d:"This potion will allow you to take on the appearance of your choosing. Watch out, your mum might call the police if she finds you in your bed tomorrow morning.",ep:0,g:55,l:1,wd:false,fm:true,w:1,c:"Pg>10,4",u:true,p:10};
I[9058] = {n:"Rogue Disguise Potion",t:14,d:"This potion will allow you to take on the appearance of your choosing. Watch out, your mum might call the police if she finds you in your bed tomorrow morning.",ep:0,g:56,l:1,wd:true,fm:true,w:1,u:true,p:10};
I[9059] = {n:"",t:24,d:"",ep:1,g:11,l:1,wd:false,fm:true,w:0,p:1};
I[9060] = {n:"Torn-up piece of paper",t:24,d:"Part of a letter someone has torn up. Upon it, you read: \'... as we arranged, I\'ll make sure the investigation into this merchant goes nowhere. Come and pay me the amount we agreed where we usually meet... where the women are pretty...\' \nThe letter is signed X.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9061] = {n:"Exoram",t:32,d:"Exoram has to be escorted out of the goblin camp and up to the Sram temple.",ep:1,g:9,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[9062] = {n:"Document about Xephires",t:24,d:"This document contains lots of interesting information about a guy named Xephires. What\'s most amazing is the amount of time he spends in the Drunken Pandawa Inn.",ep:2,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9063] = {n:"Milone\'s List",t:24,d:"This incredible list was given to you by Milone the Jeweller. It tells you of the objects necessary to create a sumptuous jewel. ",ep:16,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9064] = {n:"Royal Gobball Slobber",t:24,d:"Is it really any different to ordinary slobber? It certainly doesn\'t look like it. ",ep:1,g:32,l:1,wd:false,fm:true,w:0,p:1};
I[9065] = {n:"Letter for Milone",t:24,d:"This hastily written letter explains to Milone that the jewel is in danger... so why are you still reading this? Get going!!!",ep:16,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9066] = {n:"Letter from the Chief Thief",t:24,d:"This was found on one of the burglars you beat at Milone\'s house:\nMilone the jeweller has just created a very valuable jewel. Steal it by whatever means necessary. Fortunately, Milone gave them a copy, but it\'s no thanks to you.\nOn the back of the message, though, there is a guide to their hideout. A friendly visit? Why yes! Still, you probably shouldn\'t go alone.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9067] = {n:"Letter for Xephires",t:24,d:"This letter from Oto Mustam explains to Xephires the plan in detail.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9068] = {n:"Milone\'s Jewel",t:24,d:"You and Milone the Jeweller joined forces to create this jewel. It\'ll sell for a fortune... if you ever manage to find anyone who wants it, that is.",ep:16,g:717,l:1,wd:false,fm:true,w:0,p:1};
I[9069] = {n:"New Letter for Xephires",t:24,d:"Oto describes the conditions for corrupting Xephires. ",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9070] = {n:"Strange Sword",t:24,d:"This sword really is unusual. You\'ve never seen such a thing in Bonta.",ep:1,g:718,l:1,wd:false,fm:true,w:0,p:1};
I[9071] = {n:"Innkeeper Feubuk\'s Notes",t:24,d:"Innkeeper Feubuk received the Ecaflips who mentioned Loudac\'s name. ",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9072] = {n:"Innkeeper Pinchaut\'s Notes",t:24,d:"Innkeeper Pinchaut heard some guards talking about their problems with a gang of Ecaflips.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9073] = {n:"Bandit Ecaflip\'s Emblem",t:24,d:"You found this emblem on the Ecaflip Plain Bandits around Cania.",ep:16,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[9074] = {n:"Amayiro\'s Jewel",t:24,d:"This jewel will be just perfect for luring the bandit chief into your trap.",ep:1,g:111,l:1,wd:false,fm:true,w:0,p:1};
I[9075] = {n:"Xelor\'s Letter",t:24,d:"This letter was transmitted to you through Marge the Jeweller. Bring the jewel to Ekysoy Kubnan in the Woodenglass Inn. It\'ll be quicker for us and more profitable for you.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9076] = {n:"Amayiro\'s Jewel (Fake)",t:24,d:"This jewel looks just like the one Amayiro sent you to get. ",ep:1,g:110,l:1,wd:false,fm:true,w:0,p:1};
I[9077] = {n:"Feca Skull",t:47,d:"This Feca skull will make a perfect bookend.",ep:1,g:34,l:1,wd:true,fm:false,w:1,p:1};
I[9078] = {n:"Osamodas Skull",t:47,d:"A Tofu here, a Magus Bwork there... This Osamodas disciple just lost his head!",ep:1,g:33,l:1,wd:true,fm:false,w:2,p:1};
I[9079] = {n:"Enutrof Skull",t:47,d:"This trophy was already old before it became a trophy.",ep:1,g:32,l:1,wd:true,fm:false,w:2,p:1};
I[9080] = {n:"Sram Skull",t:47,d:"This trophy was already morbid before became a trophy.",ep:1,g:31,l:1,wd:true,fm:false,w:2,p:1};
I[9081] = {n:"Xelor Skull",t:47,d:"This skull is often mistaken for that of the famous mummy Tuthan Kamha. But don\'t be fooled, these bandages are not made with melted Kamas, but with some papier-mÃ¢chÃ©.",ep:1,g:30,l:1,wd:true,fm:false,w:2,p:1};
I[9082] = {n:"Ecaflip Skull",t:47,d:"That\'s enough of heads or tails. How about a game of knucklebones instead!",ep:1,g:29,l:1,wd:true,fm:false,w:2,p:1};
I[9083] = {n:"Eniripsa Skull",t:47,d:"Don\'t be cruel ... this isn\'t a sparrow\'s skull!",ep:1,g:28,l:1,wd:true,fm:false,w:2,p:1};
I[9084] = {n:"Iop Skull",t:47,d:"This trophy is as empty now as it was when it was supposed to be living...",ep:1,g:27,l:1,wd:true,fm:false,w:1,p:1};
I[9085] = {n:"Cra Skull",t:47,d:"This cute Cra skull seems to be coming out of a recent archaeological dig.",ep:1,g:26,l:1,wd:true,fm:false,w:2,p:1};
I[9086] = {n:"Sadida Skull",t:47,d:"What? There\'s actually a skull underneath this huge bunch of hair?!",ep:1,g:25,l:1,wd:true,fm:false,w:2,p:1};
I[9087] = {n:"Sacrier Skull",t:47,d:"This Sacrier can\'t show off anymore with his thousands of health points.",ep:1,g:24,l:1,wd:true,fm:false,w:2,p:1};
I[9088] = {n:"Pandawa Skull",t:47,d:"One could have thought that after being hung over such a long period of time, the Pandawa would have appreciated to be placed in a coffin!",ep:1,g:23,l:1,wd:true,fm:false,w:2,p:1};
I[9089] = {n:"Bontarian Patrol Insignia",t:24,d:"You found this insignia during the (very easy) skirmish with Bontarian forces.",ep:16,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[9090] = {n:"Brakmarian Patrol Insignia",t:24,d:"You found this insignia during the skirmish with Brakmarian forces.",ep:16,g:76,l:1,wd:false,fm:true,w:0,p:1};
I[9092] = {n:"",t:24,d:"",ep:16,g:86,l:1,wd:false,fm:true,w:0,p:1};
I[9094] = {n:"Bwork Poison",t:24,d:"This stuff looks more like mint jelly than poison. Bworks aren\'t known for making jelly, though... and neither are Brakmarian spies, which is even more worrying.",ep:4,g:32,l:1,wd:false,fm:true,w:0,p:1};
I[9096] = {n:"Bontarian Tactician",t:32,d:"The tactician agreed to follow you to your leader.",ep:16,g:22,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[9097] = {n:"Powerful Militiaman\'s Badge",t:24,d:"You found this badge on a particularly frightening militiaman who vanquished several warriors from Brakmar. His equipment seemed very strange.",ep:16,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[9098] = {n:"Nara\'s Hammer",t:24,d:"This hammer will prove to Oto that you\'ve vanquished the mercenary smith of Bonta.",ep:16,g:8,l:1,wd:false,fm:true,w:0,p:1};
I[9099] = {n:"Request for Help from Amayiro",t:24,d:"Signed by Amayiro, this letter is a request for official help.",ep:3,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9100] = {n:"Lenglad\'s Underpants",t:24,d:"Lenglad won\'t want people gossiping about him for a very long time.",ep:1,g:84,l:1,wd:false,fm:true,w:0,p:1};
I[9101] = {n:"Nara\'s Toolbox",t:24,d:"In this toolbox are all the tools that Nara the blacksmith forgot.",ep:3,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[9103] = {n:"Plan of Attack",t:24,d:"This letter, dated to a week ago, explains in detail the plan to attack Bonta. You\'ll need to be careful though, because a note at the end says the plan is still to be confirmed and may be changed in the coming days by officer Kapp Tenn. As a result, you\'ll have to find out what\'s happening with the plan at the moment.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9104] = {n:"Cemetery Patrol Insignia",t:24,d:"You found this insignia on a Brakmarian patrol you attacked at the Cemetery of the Tortured.",ep:16,g:76,l:1,wd:false,fm:true,w:0,p:1};
I[9105] = {n:"Danathor\'s Letter",t:24,d:"Someone slipped this letter into your bag while Amayiro was giving you your mission: Retrieve the documents, but bring them back to me rather than Amayiro. You will be rewarded. Danathor.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9106] = {n:"Secret Bontarian Documents",t:24,d:"These documents contains lots of information on Bonta\'s defence system. But who are you going to give them to?",ep:16,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9107] = {n:"Bontarian Spy\'s Directions",t:24,d:"Break into the Tower of Brakmar at midnight and collect up all the documents that you find on the second floor. Come back to Bonta via the East road.\nNo, that\'s not what YOU have to do, they\'re the instructions for the spy you have to save.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9108] = {n:"Secret Brakmarian Documents",t:24,d:"These documents contains lots of secret information on the Fogornleg Horn.",ep:14,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9109] = {n:"Ragged Bandana",t:24,d:"This tattered old bandana is in a right state. It\'s covered in phlegm, like it\'s been used as a handkerchief by generations of Wabbits. It belongs to Elturt, that much is obvious, as despite the stink of cawwots, you can still smell rotten herring. It must contain very powerful magic if it still smells that bad after so many years.",ep:8,g:748,l:1,wd:false,fm:true,w:0,p:1};
I[9110] = {n:"Fogornleg Horn",t:24,d:"You tried blowing in it, but nothing much happened.",ep:16,g:720,l:1,wd:false,fm:true,w:0,p:1};
I[9112] = {n:"Brakmarian Spy\'s Orders",t:24,d:"Break into the Tower of Bonta at midnight, cut the throats of anyone that tries to stop you, and collect all the documents you find on the first floor. Then return to Brakmar by road.\nNo, that\'s not what YOU have to do, those were the instructions for the spy that you have to find.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9113] = {n:"Stolen Secret Documents",t:24,d:"These are the documents that the injured spy recovered from the Tower of Bonta.",ep:13,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9114] = {n:"Crumpled Secret Documents",t:24,d:"The secret documents that the injured spy found in the tower of Bonta. They were slightly crumpled during your fight against the Bontarian forces.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9115] = {n:"Salad laced with Pollen",t:24,d:"This salad was prepared in the primordial cauldron, which has given it special qualities. To find out what they are, you\'ll have to taste it. Sadly, it\'s destined for Elturt\'s consumption. Life can be so cruel sometimes.",ep:12,g:719,l:1,wd:false,fm:true,w:0,p:1};
I[9116] = {n:"Crate of Equipment",t:24,d:"A weapon, a helmet, a shield: this crate contains rudimentary but effective equipment for warriors.",ep:16,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[9117] = {n:"Ougaammer",t:7,d:"It was only a matter of time before they started making hammers from the head of this thick-skulled dummy.",ep:23,g:67,l:180,wd:true,fm:true,w:15,an:15,e:[10,4,1,1,50,50,false,false],c:"CV>1200",s:118,p:50000};
I[9122] = {n:"Cherry Blop Ring",t:9,d:"Once it wraps its Bloppish way round your finger, it\'s impossible to get rid of this ring.",ep:5,g:149,l:50,wd:true,fm:true,w:10,s:98,p:4000};
I[9123] = {n:"Pippin Blop Ring",t:9,d:"Once it wraps its Bloppish way round your finger, it\'s impossible to get rid of this ring.",ep:5,g:150,l:50,wd:true,fm:true,w:10,s:99,p:1000};
I[9124] = {n:"Coco Blop Ring",t:9,d:"Once it wraps its Bloppish way round your finger, it\'s impossible to get rid of this ring.",ep:5,g:151,l:50,wd:true,fm:true,w:10,s:100,p:1000};
I[9125] = {n:"Indigo Blop Ring",t:9,d:"Once it wraps its Bloppish way round your finger, it\'s impossible to get rid of this ring.",ep:5,g:152,l:50,wd:true,fm:true,w:10,s:101,p:1000};
I[9126] = {n:"Royal Cherry Blop Ring",t:9,d:"Kroula had a plan. He was going to put this ring on his big toe, get Blops to lick his feet and collect litres of Royal Blop juice. Well, the ring didn\'t fit.",ep:5,g:153,l:80,wd:true,fm:true,w:10,s:102,p:15000};
I[9127] = {n:"Royal Pippin Blop Ring",t:9,d:"Kroula had a plan. He was going to put this ring on his big toe, get Blops to lick his feet and collect litres of Royal Blop juice. Well, the ring didn\'t fit.",ep:5,g:154,l:80,wd:true,fm:true,w:10,s:103,p:15000};
I[9128] = {n:"Royal Coco Blop Ring",t:9,d:"Kroula had a plan. He was going to put this ring on his big toe, get Blops to lick his feet and collect litres of Royal Blop juice. Well, the ring didn\'t fit.",ep:5,g:155,l:80,wd:true,fm:true,w:10,s:104,p:15000};
I[9129] = {n:"Royal Indigo Blop Ring",t:9,d:"Kroula had a plan. He was going to put this ring on his big toe, get Blops to lick his feet and collect litres of Royal Blop juice. Well, the ring didn\'t fit.",ep:5,g:156,l:80,wd:true,fm:true,w:10,s:105,p:15000};
I[9130] = {n:"Ougaamulet",t:1,d:"This rough copy of the Big Ougaa is worn around the neck... a hungry stare and a well-kept beard are essential.",ep:23,g:127,l:181,wd:true,fm:true,w:15,s:118,p:58000};
I[9131] = {n:"Colette\'s Ring",t:9,d:"A young Craette named Colette once lost her head in Eltneg Wood. The poor girl stepped in the way of Brouce Boulgoure\'s hatchet which he threw thinking she was a giant fern. Lucky she didn\'t live, she would have died if she\'d found out she looked like a giant fern.",ep:23,g:146,l:188,wd:true,fm:true,w:10,s:119,p:57950};
I[9132] = {n:"Tash Ring",t:9,d:"Are your fingers too young to get into the good clubs? Are they nervous around the girls? Well, stick this ring on, it\'ll add a few years to their age and do wonders for their self-confidence.",ep:23,g:147,l:180,wd:true,fm:true,w:10,s:121,p:57822};
I[9133] = {n:"Fungal Ring",t:9,d:"Dangle your fingers in front of any enemies who are allergic to mushrooms. Makes for a quick fight.",ep:23,g:148,l:186,wd:true,fm:true,w:10,s:107,p:56000};
I[9134] = {n:"Beddy Bow",t:2,d:"This bow is made from sharp, thin and very flexible slats that are more often used to make beds than deadly weapons. Now they\'re used to bring on a more permanent sort of sleep. Quite a coincidence.",ep:23,g:61,l:187,wd:true,fm:true,w:15,an:10,tw:true,e:[10,5,2,7,30,50,false,true],c:"CS>300&CI>300",p:58421};
I[9135] = {n:"Wanderelle",t:3,d:"This trumpet-shaped fungal wand was used long ago to call the wandering minstrel, Jon Lemon to the scene of battle. When he began singing, everyone who hadn\'t blocked their ears died on the spot. When the insufferable song and dance man began getting too popular, the gods blocked the trumpet and transformed it into a relatively harmless wand.",ep:23,g:66,l:184,wd:true,fm:true,w:10,an:11,e:[5,4,2,4,45,50,false,true],c:"CI>300&CA>300",p:54284};
I[9136] = {n:"Mush Mishish Staff",t:4,d:"The three points of this staff can attract the particles of Plasmogrine present in the quadramental breeze. To do this, you must carefully lick the points of the stick, align them with the hands of an inverted Xelor clock, count to sixty (try six if you\'re a Iop) and squeeze your lower cheeks. You\'ll have a fifty fifty chance of making a thunder bolt... and changing your enemies into grizzly Kirballs.",ep:23,g:80,l:191,wd:true,fm:true,w:10,an:12,tw:true,e:[5,4,1,1,50,50,false,false],c:"CS>200&CC>200&CI>100",p:55000};
I[9137] = {n:"Mush Cuteers",t:5,d:"These knives were used to scrape the feet of kings and queens, relieving them of the worms and fungi that cling to anyone with a bit of power.",ep:23,g:69,l:187,wd:true,fm:true,w:10,an:13,tw:true,e:[8,3,1,1,30,50,false,false],c:"CA>450",s:119,p:57000};
I[9138] = {n:"Canni Blade",t:19,d:"The triple blades of this axe had been used for many years for cutting hams and cheeses three times faster than usual. If you see a warrior carrying one about, though, run away very fast... you\'ve most likely just seen a cannibal.",ep:23,g:51,l:176,wd:true,fm:true,w:15,an:17,e:[5,4,1,1,50,50,false,false],c:"CC>450",s:120,p:54854};
I[9139] = {n:"Ta Boots",t:11,d:"These toeless boots are perfect for teaching a good lesson to those who dare speak of the forbidden things.",ep:23,g:115,l:175,wd:true,fm:true,w:10,s:120,p:54852};
I[9140] = {n:"Spore Boots",t:11,d:"Contrary to popular misconception, the holes in these shoes are not there to let your feet breathe, but to let the spawn of your foot fungus escape and infect the feet of other footloose adventurers.",ep:23,g:116,l:181,wd:true,fm:true,w:15,s:121,p:57000};
I[9141] = {n:"Ragoat",t:17,d:"If there wasn\'t so much mould on this rag, it would make a great tablecloth. Not to worry, you can always dry the dishes with it when your guests aren\'t watching.",ep:23,g:154,l:181,wd:true,fm:true,w:10,s:119,p:58000};
I[9142] = {n:"Deadly Night Cape",t:17,d:"One more glass for the road? Ah, well, roads are long and nights are short, so this cape is usually used to keep the barflies warm as they finish their endless rounds of night caps. It\'ll kill them in the end, you know.",ep:23,g:150,l:190,wd:true,fm:true,w:10,s:107,p:60000};
I[9143] = {n:"Stringsecticide",t:10,d:"As its name suggests, this string assassinates any flies that get too close to your sweet spots. Just one piece of advice - never, ever pull it off a loved one with your teeth.",ep:23,g:132,l:192,wd:true,fm:true,w:20,s:107,p:48000};
I[9144] = {n:"Fungas Belt",t:10,d:"The best way to solve crotch fungus is to lure it elsewhere. As there\'s no longer any more room between your toes to accommodate other fungi, you can use this belt, a truly impressive residence for any fungus worthy of the name.",ep:23,g:133,l:177,wd:true,fm:true,w:10,s:121,p:58444};
I[9145] = {n:"Slice of Undergrowth",t:10,d:"Take an Elm, strip the bark off, soak it for a few months in a muddy puddle, cover it with fungal infections, stick it under your bed for a week while you sleep on the floor, basting it regularly with Blop fat. All you need to know to make an Elm belt that stinks. Are you happy now?",ep:23,g:134,l:179,wd:true,fm:true,w:10,s:120,p:68420};
I[9146] = {n:"Ougaabelt",t:10,d:"The tag on this belt says \'Sorry, but if you\'re looking for a way to get Ougaa\'s power, this belt is not for you.\' \nWell that\'s just great, isn\'t it.",ep:23,g:135,l:185,wd:true,fm:true,w:10,s:118,p:56000};
I[9147] = {n:"Mush Ombrero",t:16,d:"Take a Dora, cover it in Gobball spit and Iop sweat, let it stew for a couple of weeks and you\'ll get an idea of the intoxicating effects of the Mush Ombrero. Try to stay away from heavy machinery while you wear it. In fact, stay away from anything that\'s heavy.",ep:23,g:221,l:185,wd:true,fm:true,w:10,s:119,p:48521};
I[9148] = {n:"Royal Rainbow Blop Ring",t:9,d:"Instead of cutting down on impure Blop juice, Shika Ingalsse pressed on with her harvest through her inebriated state. One day, as she was stumbling and falling through the golden fields, Shika landed on this ring. Whoever said that impure Blop juice should be taken in moderation?",ep:5,g:157,l:90,wd:true,fm:true,w:10,s:106,p:20000};
I[9149] = {n:"Cherry Amublop",t:1,d:"When Lorkos set off on his trip to the Labyrinth of the Minotoror, the first thing he did was put on his Amublop. No one ever found out why.",ep:5,g:128,l:50,wd:true,fm:true,w:10,s:98,p:1000};
I[9150] = {n:"Pippin Amublop",t:1,d:"When Lorkos set off on his trip to the Labyrinth of the Minotoror, the first thing he did was put on his Amublop. No one ever found out why.",ep:5,g:129,l:50,wd:true,fm:true,w:10,s:99,p:1000};
I[9151] = {n:"Coco Amublop",t:1,d:"When Lorkos set off on his trip to the Labyrinth of the Minotoror, the first thing he did was put on his Amublop. No one ever found out why.",ep:5,g:130,l:50,wd:true,fm:true,w:10,s:100,p:1000};
I[9152] = {n:"Indigo Amublop",t:1,d:"When Lorkos set off on his trip to the Labyrinth of the Minotoror, the first thing he did was put on his Amublop. No one ever found out why.",ep:5,g:131,l:50,wd:true,fm:true,w:10,s:101,p:1000};
I[9153] = {n:"Royal Cherry Amublop",t:1,d:"This Amublop costs a lot more to make than an ordinary Amublop, but look on the bright side... it will sell for a lot more too, especially if you offload it on an Astrubian.",ep:5,g:132,l:80,wd:true,fm:true,w:10,s:102,p:15800};
I[9154] = {n:"Royal Pippin Amublop",t:1,d:"This Amublop costs a lot more to make than an ordinary Amublop, but look on the bright side... it will sell for a lot more too, especially if you offload it on an Astrubian.",ep:5,g:133,l:80,wd:true,fm:true,w:10,s:103,p:15800};
I[9155] = {n:"Royal Coco Amublop",t:1,d:"This Amublop costs a lot more to make than an ordinary Amublop, but look on the bright side... it will sell for a lot more too, especially if you offload it on an Astrubian.",ep:5,g:134,l:80,wd:true,fm:true,w:10,s:104,p:15800};
I[9156] = {n:"Royal Indigo Amublop",t:1,d:"This Amublop costs a lot more to make than an ordinary Amublop, but look on the bright side... it will sell for a lot more too, especially if you offload it on an Astrubian.",ep:5,g:135,l:80,wd:true,fm:true,w:10,s:105,p:15800};
I[9157] = {n:"Royal Rainbow Amublop",t:1,d:"They have to put heaps of artificial colorants and flavourings into this amulet to stop it coming out white when it\'s crafted. A word of advice, it might look great and smell delicious, but don\'t try to eat it.",ep:5,g:136,l:90,wd:true,fm:true,w:10,s:106,p:21000};
I[9158] = {n:"Cherry Bloopts",t:11,d:"Does it make your mouth feel funny when you say the name of this object? Well, let me tell you, if you find yourself face to face with a highway robber who asks you for your \'Boot.. Bloops... Bloo...\', you\'ll be glad to have just enough time to scurry off while he figures out how to pronounce the word. So stop your complaining.",ep:5,g:117,l:50,wd:true,fm:true,w:10,s:98,p:1000};
I[9159] = {n:"Pippin Bloopts",t:11,d:"Does it make your mouth feel funny when you say the name of this object? Well, let me tell you, if you find yourself face to face with a highway robber who asks you for your \'Boot.. Bloops... Bloo...\', you\'ll be glad to have just enough time to scurry off while he figures out how to pronounce the word. So stop your complaining.",ep:5,g:118,l:50,wd:true,fm:true,w:10,s:99,p:1000};
I[9160] = {n:"Coco Bloopts",t:11,d:"Does it make your mouth feel funny when you say the name of this object? Well, let me tell you, if you find yourself face to face with a highway robber who asks you for your \'Boot.. Bloops... Bloo...\', you\'ll be glad to have just enough time to scurry off while he figures out how to pronounce the word. So stop your complaining.",ep:5,g:119,l:50,wd:true,fm:true,w:10,s:100,p:1000};
I[9161] = {n:"Indigo Bloopts",t:11,d:"Does it make your mouth feel funny when you say the name of this object? Well, let me tell you, if you find yourself face to face with a highway robber who asks you for your \'Boot.. Bloops... Bloo...\', you\'ll be glad to have just enough time to scurry off while he figures out how to pronounce the word. So stop your complaining.",ep:5,g:120,l:50,wd:true,fm:true,w:10,s:101,p:1000};
I[9162] = {n:"Royal Cherry Bloopts",t:11,d:"Say the word Bloopts ten times fast while spinning round in circles. Now you know what it feels like to be a Iop.",ep:5,g:121,l:80,wd:true,fm:true,w:10,s:102,p:16000};
I[9163] = {n:"Royal Pippin Bloopts",t:11,d:"Say the word Bloopts ten times fast while spinning round in circles. Now you know what it feels like to be a Iop.",ep:5,g:122,l:80,wd:true,fm:true,w:10,s:103,p:16000};
I[9164] = {n:"Royal Coco Bloopts",t:11,d:"Say the word Bloopts ten times fast while spinning round in circles. Now you know what it feels like to be a Iop.",ep:5,g:123,l:80,wd:true,fm:true,w:10,s:104,p:16000};
I[9165] = {n:"Royal Indigo Bloopts",t:11,d:"Say the word Bloopts ten times fast while spinning round in circles. Now you know what it feels like to be a Iop.",ep:5,g:124,l:80,wd:true,fm:true,w:10,s:105,p:16000};
I[9166] = {n:"Royal Rainbow Bloopts",t:11,d:"Some people let the grass grow under their feet. With these boots, you\'ll have enough foliage for four weddings and a funeral.",ep:5,g:125,l:90,wd:true,fm:true,w:10,s:106,p:20000};
I[9167] = {n:"Cherry Blop Belt",t:10,d:"Behind the silly name is a belt. A belt that we don\'t know much about. Its original design and its magical ability to conceal the worst love-handles known to science ensure this is always a favourite with image-conscious middle-aged men.",ep:5,g:136,l:50,wd:true,fm:true,w:10,s:98,p:1000};
I[9168] = {n:"Pippin Blop Belt",t:10,d:"Behind the silly name is a belt. A belt that we don\'t know much about. Its original design and its magical ability to conceal the worst love-handles known to science ensure this is always a favourite with image-conscious middle-aged men.",ep:5,g:137,l:50,wd:true,fm:true,w:10,s:99,p:1000};
I[9169] = {n:"Coco Blop Belt",t:10,d:"Behind the silly name is a belt. A belt that we don\'t know much about. Its original design and its magical ability to conceal the worst love-handles known to science ensure this is always a favourite with image-conscious middle-aged men.",ep:5,g:138,l:50,wd:true,fm:true,w:10,s:100,p:1000};
I[9170] = {n:"Indigo Blop Belt",t:10,d:"Behind the silly name is a belt. A belt that we don\'t know much about. Its original design and its magical ability to conceal the worst love-handles known to science ensure this is always a favourite with image-conscious middle-aged men.",ep:5,g:139,l:50,wd:true,fm:true,w:10,s:101,p:1000};
I[9171] = {n:"Royal Cherry Blop Belt",t:10,d:"The tiniest bluesman in the world is playing the blues for this belt on the tiniest guitar in the world. It lost its buckle. If belts could cry, this one would never stop sobbing.",ep:5,g:140,l:80,wd:true,fm:true,w:10,s:102,p:16000};
I[9172] = {n:"Royal Pippin Blop Belt",t:10,d:"The tiniest bluesman in the world is playing the blues for this belt on the tiniest guitar in the world. It lost its buckle. If belts could cry, this one would never stop sobbing.",ep:5,g:141,l:80,wd:true,fm:true,w:10,s:103,p:16000};
I[9173] = {n:"Royal Coco Blop Belt",t:10,d:"The tiniest bluesman in the world is playing the blues for this belt on the tiniest guitar in the world. It lost its buckle. If belts could cry, this one would never stop sobbing.",ep:5,g:142,l:80,wd:true,fm:true,w:10,s:104,p:16000};
I[9174] = {n:"Royal Indigo Blop Belt",t:10,d:"The tiniest bluesman in the world is playing the blues for this belt on the tiniest guitar in the world. It lost its buckle. If belts could cry, this one would never stop sobbing.",ep:5,g:143,l:80,wd:true,fm:true,w:10,s:105,p:16000};
I[9175] = {n:"Royal Rainbow Blop Belt",t:10,d:"If you tighten this belt fully, you can shut down your digestive system completely. Why you would want to do this is another question entirely.",ep:5,g:144,l:90,wd:true,fm:true,w:10,s:106,p:20000};
I[9176] = {n:"Day\'inda Knife",t:5,d:"Jon Lemon created his last and greatest song as he was being slaughtered by the Bworker and this very blade. Goes a little something like - \'I heard the news today oh boy, Ten thousand holes all over meeeee...\' Thank the gods that the Bworker had the good sense to jot down the words and music of the ditty.",ep:22,g:70,l:182,wd:true,fm:true,w:10,an:13,e:[7,4,1,1,30,40,false,false],c:"CS>200&CI>150&CC>150&CA>150",s:108,p:58000};
I[9177] = {n:"Pot-Bellied Bracelet",t:9,d:"The three points of this bracelet represent the three major weaknesses of the Bworker: Thirst for vengeance, thirst for victory and, well, thirst for liquids.",ep:22,g:158,l:179,wd:true,fm:true,w:10,s:108,p:54000};
I[9178] = {n:"Nose Ring",t:9,d:"This ring is covered in little bits of nose rubble from the Bworker\'s shnoz. The dirty creature uses the sharp points to achieve that perfect pick.",ep:22,g:159,l:179,wd:true,fm:true,w:10,s:109,p:54000};
I[9179] = {n:"Memori Amulet",t:1,d:"When a certain Captain Chafer met the Bworker for the first time, he took the liberty of saying \'Wow, is that your backside or is it your face?\' Nobody has seen the good Captain, or his famous moulded underwear, since. This amulet was created in his memory.",ep:22,g:137,l:184,wd:true,fm:true,w:10,s:108,p:52458};
I[9180] = {n:"Chee Cape",t:17,d:"The story goes that the Bworker sewed this cape from Rushu\'s butt skin. The story would be entirely believable if the Bworker actually knew how to sew.",ep:22,g:151,l:185,wd:true,fm:true,w:10,s:108,p:58000};
I[9181] = {n:"Batouta Helmet",t:16,d:"This helmet holds its fair share of secrets. It was once a kind, gentle, pure creature, but after many years of violent adventures with the Bworker, it slowly became bitter and twisted. Then, it died. The legend says a mischievous Ecaflip found the dead hat and dyed it grey using a Payntshup Potion and some Kralove ink. He fooled the inhabitants of Imp Village by claiming it had fantastic powers but he was rumbled when it rained and the dye washed out.",ep:22,g:212,l:189,wd:true,fm:true,w:10,s:109,p:59000};
I[9182] = {n:"Pierced Boots",t:11,d:"A long, long time ago, Danous Kwaide wanted to be clever and beat the Bworker in a baiting contest: " + "\"" + "Your boots are covered with earrings because you\'re too stupid to realise that you\'re not supposed to put boots in your ears" + "\"" + ", he teased. The Bworker replied by crushing Danous\' skull with his axe. Do you blame him? Do you even understand what Danous was going on about? No, neither do I.",ep:22,g:126,l:184,wd:true,fm:true,w:10,s:109,p:58000};
I[9183] = {n:"Biibl Belt",t:10,d:"This belt is used in the feast of the Dofus eggs which celebrates the gift of the six eggs, as recorded in the Biibl, an ancient text written by a Bontarian Joiner. Most people just paint ordinary eggs to look like Dofus and give them to one another, but some go a bit further, wearing this painful belt for the forty days and nights which precede the feast.",ep:22,g:145,l:181,wd:true,fm:true,w:10,s:109,p:58000};
I[9184] = {n:"Galgarion\'s Helmet",t:16,d:"In spite of appearances, this helmet won\'t help your hearing. It\'ll help you see farther, though. Just watch out for any strong winds or you\'ll be taken away like a little feather.",ep:1,g:213,l:33,wd:true,fm:true,w:10,p:3000};
I[9185] = {n:"Goultard\'s Headgear",t:16,d:"This headgear won\'t really make you any more fearsome, and definitely not more powerful... And if you think for a moment that some naÃ¯ve souls will mistake you for Goultard, well you\'re crazy. Your enemies will see you coming from miles away, that\'s all.",ep:1,g:214,l:30,wd:true,fm:true,w:10,p:2600};
I[9186] = {n:"Flash Gorgon\'s Belt",t:10,d:"Beyond his love for porcelain vases, there\'s little we know about Flash Gorgone. One legend says he was always in such a hurry that he could out run a Tofu... He learnt his lesson when he rushed out of bed one morning and tied his belt round his ankles. His porcelain collection still remembers that like it was yesterday.",ep:1,g:146,l:48,wd:true,fm:true,w:30,p:6075};
I[9187] = {n:"Master Black Jack\'s Headgear",t:16,d:"Master Black Jack, the Eniripsa, was a dedicated follower of fashion. So much so, that he was even able to give stitches to real people after a while! A friend to tailors, they say that his inspiration for this headgear was a cruel tailor who once exterminated a tribe of Ouginaks called the Macians. What a lovely story.",ep:1,g:215,l:33,wd:true,fm:true,w:10,p:3075};
I[9188] = {n:"Pepitoo\'s Sombrero",t:16,d:"This sombrero is the last trace left behind by a dark, heroic Xelor who is said to have disappeared suddenly. The last time he was sighted, he was serenading his beloved. What is more, they say his fiancÃ©e\'s brothers were in the know about the whole thing. Still others say he was whisked away into a parallel dimension just like that. The mystery shows no signs of solving itself.",ep:1,g:216,l:40,wd:true,fm:true,w:10,p:5000};
I[9189] = {n:"XVII\'s Horns",t:16,d:"If you keep trying to butt the horns off your enemies, you\'re the one whose head will start to resemble a sieve! XVII\'s horns have the same effect - they make you forget everything. Except dinner time, maybe.",ep:1,g:217,l:20,wd:true,fm:true,w:4,p:1300};
I[9190] = {n:"Cra\'s Burnt Headgear",t:16,d:"This headgear is just perfect for Cras who don\'t mind looking average. Careful though, you will look very silly, stupid even. Usually this headgear is given to retired combatants who\'ve lost a good portion of their brain-cells.",ep:1,g:218,l:35,wd:true,fm:true,w:5,p:10000};
I[9191] = {n:"Pym\'s Blade",t:6,d:"This blade was stolen from a sword smith\'s shop window where it had laid for many years. Let\'s hope it sees more use in your hands than it did in the shop, because I think we both know that nobody will pay money for it.",ep:1,g:84,l:35,wd:true,fm:true,w:10,an:14,e:[10,4,1,1,30,50,false,false],c:"CV>10&CS>10&CA>10",p:3500};
I[9192] = {n:"Fasstroid Belt",t:10,d:"The bigger your love handles are the better with this attractive and delicious belt.",ep:1,g:147,l:45,wd:true,fm:true,w:2,s:110,p:5600};
I[9193] = {n:"Tartamulet",t:1,d:"This amulet will remind you of the happy days, the picnic days, the days before you turned into... this.",ep:1,g:138,l:43,wd:true,fm:true,w:2,s:110,p:5000};
I[9194] = {n:"K Cap",t:16,d:"Lice used to eat your head. Not anymore, this new range of confectionary headgear will divert the nasty creatures. Now they\'ll graze on your hat instead, like a herd of tiny, white cows.",ep:1,g:219,l:44,wd:true,fm:true,w:2,s:110,p:5200};
I[9195] = {n:"K Cape",t:17,d:"Roll it up in fruity jam, cover it in jelly and resist the temptation to scoff it. This treat is best enjoyed as a suppository.",ep:1,g:152,l:45,wd:true,fm:true,w:2,s:110,p:5500};
I[9196] = {n:"Beanie Cape",t:17,d:"Made from enormous coffee beans, this cape smells like a Pikoko\'s armpit. It really gets the blood flowing before a battle... and it\'s cheap, too.",ep:1,g:153,l:45,wd:true,fm:true,w:2,s:111,p:5500};
I[9197] = {n:"Beanie Hat",t:16,d:"Pop in two sugars, give it a quick stir and quench your thirst with this revitalizing hat.",ep:1,g:220,l:44,wd:true,fm:true,w:2,s:111,p:5200};
I[9198] = {n:"Beanie Ring",t:9,d:"If you find yourself stuck with a tasteless beer or coffee, stick this ring in there for a while.",ep:1,g:160,l:45,wd:true,fm:true,w:2,s:111,p:5600};
I[9199] = {n:"Beanie Boots",t:11,d:"Look what you\'ve done. Just look. Trying to smash coffee cups with your boots... what were you thinking?",ep:1,g:127,l:43,wd:true,fm:true,w:2,s:111,p:5000};
I[9200] = {n:"Spell Scroll: Summoning of Chaferfu",t:75,d:"(Double click to learn the spell) \nThis Scroll teaches you the spell \'Summoning of Chaferfu\'.",ep:1,g:17,l:1,wd:true,fm:true,w:1,u:true,p:10000};
I[9201] = {n:"Spell Scwoll: Cawwot",t:75,d:"This Scwoll weveals how to teach youwself, in 101 simple lessons, the basics of the famous but not particulawly secwet Wa Wabbit technique.",ep:1,g:21,l:1,wd:true,fm:true,w:1,u:true,p:10000};
I[9202] = {n:"Gore Master\'s Other Ring",t:9,d:"Even in death, the Gore Master kept crafting items that were out of kilter with the cosmic order of the universe. He always complained that he made his second ring too late. That he could have travelled the world if he\'d made it sooner. In the end, a demon stole it from him and hid it in the mortal world for feeble adventurers.",ep:1,g:9,l:1,wd:false,fm:true,w:1,p:0};
I[9203] = {n:"",t:24,d:"",ep:1,g:706,l:1,wd:false,fm:true,w:0,p:1};
I[9207] = {n:"Tip of a strap",t:24,d:"This piece of leather appears to have been snatched from the strap of a bag.",ep:16,g:753,l:1,wd:false,fm:true,w:0,p:1};
I[9210] = {n:"Gwenolaz Barnumuze\'s message",t:24,d:"A piece of paper for the judge Satirev Onivin on which Gwenolaz Barnumuze wrote that she was not for sale.",ep:1,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9211] = {n:"Enileda\'s message",t:24,d:"A sheet of paper for the attention of judge Satirev Onivin on which Enileda uses very flowery words to express her refusal.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9212] = {n:"Ma Cleopatra\'s message",t:24,d:"A letter of refusal to submit to the judge Satirev Onivin from Ma Cleopatra on which is written \'We do not have the same values...\'",ep:1,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9213] = {n:"Maskara\'s message",t:24,d:"A draft paper for the judge Satirev Onivin on which Maskara scrawled that she refused to become his puppet.",ep:1,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9214] = {n:"Kwartzwatch\'s message",t:24,d:"A message written by Kwartzwatch for Satirev Onivin. The text suggests that she\'d never take off her bandages for him.",ep:1,g:55,l:1,wd:false,fm:true,w:0,p:1};
