I[9227] = {n:"Onivin\'s wedding list",t:24,d:"This list has been provided by Satirev Onivin, and details the Astrubian women he\'d like you to talk to on his behalf: Ma Cleopatra, Enileda, Gwenolaz Barnumuze, Maskara, Kwartzwatch.",ep:16,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9228] = {n:"Miss Yelliott\'s testimony",t:24,d:"Miss Yelliott\'s testimony is written down on this piece of paper.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9229] = {n:"Miss Yelliot\'s dubious testimony",t:24,d:"Miss Yelliott\'s somewhat dubious testimony is written down on this piece of paper.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9231] = {n:"",t:24,d:"",ep:6,g:46,l:1,wd:false,fm:true,w:0,p:1};
I[9233] = {n:"Livitinem Cape",t:113,d:"This living polymorphous object can either be a predator or a symbiote of inanimate capes. (This cape is a living thing. You must feed it other capes to keep it healthy and strong. Give it a meal, say, every 12 hours.)",ep:1,g:149,l:1,wd:true,fm:false,w:1,p:1};
I[9234] = {n:"Livitinem Hat",t:113,d:"This living polymorphous object can either be a predator or a symbiote of inanimate hats.  \n(This hat is a living thing. You must feed it other hats to keep it healthy and strong. Give it a meal, say, every 12 hours.)",ep:1,g:211,l:1,wd:true,fm:false,w:1,p:1};
I[9235] = {n:"Kit\'s dodgy version",t:24,d:"This letter shows that you think there\'s something dodgy about Kit Dingaround\'s version of events.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9236] = {n:"Kit\'s believable version",t:24,d:"This letter shows that you think Kit Dingaround\'s version of events is to be believed.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9237] = {n:"Miss Yelliot\'s believable testimony",t:24,d:"This letter shows that you find Miss Yelliott to be a credible witness, unless it\'s her so-called " + "\"" + "music" + "\"" + " that you enjoy.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9238] = {n:"Miss Yelliott\'s dodgy testimony",t:24,d:"This letter shows that you find Miss Yelliott\'s version of events to be suspicious, unless it\'s simply because you do not like the way she speaks... or sings.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9239] = {n:"Gnirreh is to be believed",t:24,d:"This letter shows that you think Gnirreh didn\'t do it. What? Smelling of fish can be good, sometimes...",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9240] = {n:"Gnirreh is a collaborator",t:24,d:"This letter shows that you think Gnirreh actually slipped the secret document into Kit Dingaround\'s bag, or maybe it\'s revenge for the terrible odour that accompanies him.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9241] = {n:"Verdict: Kit Dingaround is guilty.",t:24,d:"This letter shows that you believe Kit Dingaround is guilty of treason.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9242] = {n:"Verdict: Kit Dingaround is innocent.",t:24,d:"This letter shows that you believe Kit Dingaround is innocent.",ep:16,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[9243] = {n:"Kit Dingaround: guilty",t:24,d:"This letter shows that you pleaded against Kit Dingaround. Danathor was pleased with your choice.",ep:16,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9244] = {n:"Kit Dingaround: innocent",t:24,d:"This letter shows that you pleaded in Kit Dingaround\'s favour. Amayiro was pleased with your choice.",ep:16,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9245] = {n:"Case Dismissed",t:24,d:"This letter shows that you were not very convincing during the trial of Kit Dingaround and that the case against him has been dismissed. No need to wait for Danathor or Amayiro\'s recognition.",ep:16,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9247] = {n:"Key to the Fungus Dungeon",t:84,d:"This key grants you access to the terrible Fungus Dungeon.",ep:13,g:247,l:1,wd:true,fm:true,w:1,p:1};
I[9248] = {n:"Key to the Blop Dungeon",t:84,d:"This key grants you access to the Blop Dungeon.",ep:5,g:248,l:1,wd:true,fm:true,w:1,p:1};
I[9249] = {n:"Cherry Key Fragment",t:84,d:"If you find the other pieces of this key, you\'ll have to go and fight the Rainbow Blop. If you don\'t want to look for the other pieces anymore after hearing that, I understand.",ep:5,g:250,l:1,wd:true,fm:true,w:1,p:1};
I[9250] = {n:"Pippin Key Fragment",t:84,d:"If you find the other pieces of this key, you\'ll have to go and fight the Rainbow Blop. If you don\'t want to look for the other pieces anymore after hearing that, I understand.",ep:5,g:251,l:1,wd:true,fm:true,w:1,p:1};
I[9251] = {n:"Coco Key Fragment",t:84,d:"If you find the other pieces of this key, you\'ll have to go and fight the Rainbow Blop. If you don\'t want to look for the other pieces anymore after hearing that, I understand.",ep:5,g:252,l:1,wd:true,fm:true,w:1,p:1};
I[9252] = {n:"Indigo Key Fragment",t:84,d:"If you find the other pieces of this key, you\'ll have to go and fight the Rainbow Blop. If you don\'t want to look for the other pieces anymore after hearing that, I understand.",ep:5,g:249,l:1,wd:true,fm:true,w:1,p:1};
I[9254] = {n:"Key to the Rainbow Blop Lair",t:84,d:"This key grants you access to the Rainbow Blop Dungeon.",ep:5,g:253,l:1,wd:true,fm:true,w:1,p:1};
I[9255] = {n:"Livitinem Amulet",t:113,d:"This living polymorphous object can either be a predator or a symbiote of inanimate amulets. (This amulet is a living thing. You must feed it other amulets to keep it healthy and strong. Give it a meal, say, every 12 hours.)",ep:1,g:139,l:1,wd:true,fm:false,w:1,p:1};
I[9256] = {n:"Livitinem Ring",t:113,d:"This living polymorphous object can either be a predator or a symbiote of inanimate rings. (This ring is a living thing. You must feed it other rings to keep it healthy and strong. Give it a meal, say, every 12 hours.)",ep:1,g:161,l:1,wd:true,fm:false,w:1,p:1};
