I[9263] = {n:"Mushnid Bark",t:96,d:"A parasite never feels so at home as when he\'s lodged in the bark of a Mushnid. From time to time the creature will scratch itself, tearing off a part of its diseased skin which can turn into a mushroom itself if it falls in the right place. This mushroom will then find the nearest Mushnid to parasite... as vicious circles go, this one is pretty gruesome.",ep:23,g:109,l:113,wd:true,fm:true,w:1,p:10};
I[9264] = {n:"",t:32,d:"",ep:1,g:28,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[9265] = {n:"Miteters",t:24,d:"Here are some Miteters, those strange things you sometimes find on the heads of Cracklers with dubious personal hygiene.",ep:5,g:727,l:1,wd:false,fm:true,w:0,p:1};
I[9266] = {n:"Royal Jelly Blubber",t:24,d:"This blubber came from a Royal Jelly. It\'s an essential ingredient of paralysis potions.",ep:7,g:32,l:1,wd:false,fm:true,w:0,p:1};
I[9267] = {n:"Trumperelle Trunk",t:15,d:"This Trumperelle trunk still has the toxic breath of its former owner. Now it\'s usually used as a phony musical instrument to kill whole audiences at \'assassination concerts.\'",ep:23,g:764,l:125,wd:true,fm:true,w:1,p:10};
I[9268] = {n:"Spiritless Hammer of Light",t:24,d:"This Hammer of Light seems to have lost the spirit that gave it its power. As such, it doesn\'t look particularly impressive.",ep:3,g:8,l:1,wd:false,fm:true,w:0,p:1};
I[9269] = {n:"Mushmunch Tongue",t:15,d:"The Mushmunch has a tongue of incredible length and softness for licking spores off its companions. If I\'m not mistaken, it\'s the only enviable trait they have.",ep:23,g:765,l:134,wd:true,fm:true,w:1,p:1};
I[9270] = {n:"Replacement Doll",t:24,d:"A doll made by Maskara\'s skilled hands to replace the one that the Spirit of Light lost.",ep:1,g:680,l:1,wd:false,fm:true,w:0,p:1};
I[9271] = {n:"Maskara\'s Promise",t:24,d:"This simple ring symbolises the promise Maskara made. She will play dolls with you (and especially be your doll) whenever she can. This makes it one of the most valuable assets in the world.",ep:1,g:730,l:1,wd:false,fm:true,w:0,p:1};
I[9272] = {n:"Bontarian Crate",t:24,d:"You dared to steal this crate from your own Tower of Orders to give it to the Rogues, without even knowing what it contains. To do so is to betray the trust that your Order Master put in you.",ep:1,g:44,l:1,wd:false,fm:true,w:0,p:1};
