I[9277] = {n:"Mush Mish Eye",t:109,d:"The Mush Mish has the annoying habit of scratching its itchy eyes. The habit is a little more than annoying when he has his pointy weapon in his hand at the time.",ep:23,g:587,l:152,wd:true,fm:true,w:1,p:1};
I[9278] = {n:"Mush Tup\'s Blade",t:15,d:"The Mush Tup has two arms, two legs and two heads. All this means is that it\'s two times dumber than you\'d expect.",ep:23,g:766,l:144,wd:true,fm:true,w:1,p:1};
I[9279] = {n:"Mush Rhume Slobber",t:15,d:"This spit is delicious, if a little slimy. It\'s often used to grease weapons. Or warriors if they enjoy fighting with no clothes on.",ep:23,g:45,l:149,wd:true,fm:true,w:1,p:1};
I[9280] = {n:"Ougaad",t:15,d:"This beast only has four spines on its head, but what spines... sharp as gads they are!",ep:23,g:40,l:900,wd:true,fm:true,w:1,p:1};
I[9281] = {n:"Ougaat Fragment",t:15,d:"Ougaa has stunning headgear, and you\'re holding a piece of its special hat in your hands.",ep:23,g:41,l:900,wd:true,fm:true,w:1,p:1};
