I[9366] = {n:"Pink Tutu",t:10,d:"This pink tutu will be ideal for showing your little behind off at the New Year\'s festivities. Made of ancestral cotton and stretchy Sponge Mob mousse, soft and comfortable with a swishing skirt, this piece could be the first in a long line of tutus for a future star dancer.",ep:22,g:148,l:49,wd:true,fm:true,w:5,p:300};
