I[9379] = {n:"Choc\'Box",t:42,d:"You should offer this small box to the one you love. If you\'re the kind who hates everyone, you may as well eat it yourself!",ep:1,g:3,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[9380] = {n:"Heart-shaped Fairywork",t:74,d:"This special Fairywork will spread some love in this World for the tough, but shower you with hugs in this World of love",ep:1,g:32,l:1,wd:false,fm:true,w:1,ut:true,p:1};
I[9381] = {n:"Greedoblop Flower",t:35,d:"Gluttonous Greedoblops get so hungry that they\'ll even consider eating their own flowers. Fortunately, their snappy jaws always seem to stumble upon a wandering adventurer just in time.",ep:5,g:7,l:50,wd:true,fm:true,w:1,p:1};
I[9382] = {n:"Blopshroom Flower",t:35,d:"This flower has been plucked from the head of a Blopshroom. Don\'t worry about it, the Blopshroom never liked it anyway.",ep:5,g:8,l:40,wd:true,fm:true,w:1,p:1};
I[9383] = {n:"Trunkiblop Root",t:98,d:"The Trunkiblop has great big roots which draw up anything adventurers throw on the ground.",ep:5,g:1,l:40,wd:true,fm:true,w:1,p:1};
I[9384] = {n:"Royal Cherry Blop Flower",t:35,d:"If this flower wasn\'t royal, I bet you would have thrown it out by now.",ep:5,g:12,l:100,wd:true,fm:true,w:1,p:1};
I[9385] = {n:"Royal Coco Blop Flower",t:35,d:"If this flower wasn\'t royal, I bet you would have thrown it out by now.",ep:5,g:9,l:100,wd:true,fm:true,w:1,p:1};
I[9386] = {n:"Royal Indigo Blop Flower",t:35,d:"If this flower wasn\'t royal, I bet you would have thrown it out by now.",ep:5,g:11,l:100,wd:true,fm:true,w:1,p:1};
I[9387] = {n:"Royal Pippin Blop Flower",t:35,d:"If this flower wasn\'t royal, I bet you would have thrown it out by now.",ep:5,g:10,l:100,wd:true,fm:true,w:1,p:1};
I[9388] = {n:"Royal Blop Leaf",t:36,d:"When dried, rolled and smoked, this leaf can evoke hallucinations in the weakest adventurers, as well as an implacable urge for... relief. An overdose can lead to speedy death.",ep:5,g:13,l:100,wd:true,fm:true,w:1,p:1};
I[9389] = {n:"Royal Rainbow Blop Leaf",t:36,d:"This leaf feeds on the grey matter of the Royal Rainbow Blop. It\'s a good thing it\'s not too greedy!",ep:5,g:14,l:150,wd:true,fm:true,w:1,p:1};
I[9390] = {n:"",t:113,d:"",ep:0,g:211,l:1,wd:false,fm:true,w:0,p:1};
I[9391] = {n:"Royal Rainbow Blop Flower",t:35,d:"This flower was hidden in the cranial box of the Royal Rainbow Blop. It plugged up all the holes in the creature\'s memory.",ep:5,g:13,l:150,wd:true,fm:true,w:1,p:1};
I[9394] = {n:"Mitch Shroom",t:16,d:"This headgear will give Mitcho-class style to anyone who wears it. It does have a strong smell of undergrowth that your friends could do without.",ep:22,g:222,l:152,wd:true,fm:true,w:15,p:45782};
I[9395] = {n:"Royal Bloprown",t:16,d:"This headgear was worn by Kuri herself for a few years. Until she decided to stop wearing crappy headgear, that is.",ep:22,g:223,l:161,wd:true,fm:true,w:10,p:47750};
I[9396] = {n:"Zawooin\'s Seal",t:9,d:"Called \'Zawooin Ling\' in the ancient language of the Lenalds... rumour has it that this item was forged in a volcano beneath Fire Pandala by Zeewon, a mysterious Wabbit.",ep:1,g:7,l:1,wd:false,fm:true,w:1,c:"PX=3|PX=5",p:1};
I[9398] = {n:"",t:24,d:"",ep:2,g:27,l:1,wd:false,fm:true,w:0,p:1};
I[9399] = {n:"",t:24,d:"",ep:16,g:61,l:1,wd:false,fm:true,w:0,p:1};
I[9401] = {n:"Bworker Hide",t:59,d:"This skin has been through the wars and yet it has emerged unscathed. It should be just as useful now it\'s been removed from its former owner.",ep:14,g:9,l:400,wd:true,fm:true,w:10,p:1};
I[9402] = {n:"Beezers",t:11,d:"The little wings attached to these slippers will give smelly feet some fresh air... But be careful, don\'t use them to play Gobbowl... Gobballs may not particularly like getting stung on the arse...",ep:1,g:128,l:34,wd:true,fm:true,w:5,s:112,p:3200};
I[9403] = {n:"Hamm\'Ornet",t:7,d:"The little wings attached to this hammer make it lighter and easier to handle... It can even fly on its own and hit you on the head while you\'re sleeping. Hilarious.",ep:1,g:68,l:27,wd:true,fm:true,w:12,an:15,e:[10,4,1,1,45,50,false,false],c:"CI>17&CC>5",s:112,p:2100};
I[9404] = {n:"Beezing Cape",t:17,d:"The sting at the end of this cape will prevent your enemies from kicking your arse! However, you won\'t be able to sit down without getting hurt...",ep:1,g:155,l:33,wd:true,fm:true,w:5,s:112,p:3000};
I[9405] = {n:"Bee Hat",t:16,d:"By wearing this hat, you have to accept that you\'re running the risk of being hit by a Moskitoswatter...",ep:1,g:224,l:37,wd:true,fm:true,w:9,s:112,p:3825};
I[9406] = {n:"Piggibits",t:16,d:"These Lousy Pig\'s ears are still warm and essential for you to seduce any Lousy Pig you\'ll come across. Don\'t laugh, you still don\'t know how lonely you can get in the Countryside of Amakna.",ep:1,g:225,l:36,wd:true,fm:true,w:2,s:113,p:3600};
I[9407] = {n:"Cork Cloak",t:17,d:"Some people actually call this cape " + "\"" + "Cloak Screw" + "\"" + " and just hate anyone who calls it anything else. No matter what you call this cape, one thing\'s sure, it\'s useless for opening up bottles!",ep:1,g:156,l:37,wd:true,fm:true,w:3,s:113,p:3800};
I[9408] = {n:"Lousy Ring",t:9,d:"This ring will turn you into a Lousy Pig, which should satisfy your closest friends.",ep:1,g:162,l:40,wd:true,fm:true,w:3,s:113,p:500};
I[9409] = {n:"Lardine Belt",t:10,d:"This little cork-screw shaped tail will bring out the jealousy of the people around you.",ep:1,g:149,l:39,wd:true,fm:true,w:1,s:113,p:4225};
I[9410] = {n:"Eastern Wood Hat",t:16,d:"Not as trendy as the Clint is, but a lot more elegant, this hat will show the others how sophisticated you are.",ep:1,g:226,l:40,wd:true,fm:true,w:25,s:114,p:1000};
I[9411] = {n:"Eastern Wood Cape",t:17,d:"This cape will protect your back from getting sunburnt. But be careful, it doesn\'t go all the way down to the behind of every adventurer.",ep:1,g:157,l:36,wd:true,fm:true,w:10,s:114,p:6500};
I[9412] = {n:"Eastern Wood Belt",t:10,d:"The sling of this belt is tightly tied to it, so tightly tied that you won\'t be able to take it off. It will only impress highwayboys you\'ll meet.",ep:1,g:150,l:32,wd:true,fm:true,w:10,s:114,p:3000};
I[9413] = {n:"Eastern Wood Boots",t:11,d:"The spurs on these boots will enable you to cut up your Dragoturkey when you decide it\'s time to eat it.",ep:1,g:129,l:30,wd:true,fm:true,w:10,s:114,p:2700};
I[9414] = {n:"Lemon Hat",t:16,d:"Your head will easily fit this humongous emptied lemon and the little pip inside it will feel at home!",ep:1,g:227,l:30,wd:true,fm:true,w:9,s:115,p:2600};
I[9415] = {n:"Citrus Cape",t:17,d:"This cape was made from the peels of lots of different citrus fruits. It\'s a pretty, refreshing cape, but unfortunately it doesn\'t glow in the dark.",ep:1,g:158,l:30,wd:true,fm:true,w:8,s:115,p:2525};
I[9416] = {n:"Zest Ring",t:9,d:"If your water becomes tasteless, just stick this ring on your finger, stick your finger in the glass and vigorously stir it in until it falls off. There you go! A delicious blood orange and lemon mixture... and one finger less. You can\'t have it all, you know...",ep:1,g:163,l:20,wd:true,fm:true,w:4,s:115,p:1300};
I[9417] = {n:"Strawaff",t:4,d:"If you ever dreamt of drinking your enemies\' blood while hitting them, this staff\'s made for you!",ep:1,g:81,l:32,wd:true,fm:true,w:1,an:12,e:[5,2,1,1,30,50,false,false],c:"CI>32&CA>10",s:115,p:2900};
I[9418] = {n:"Crist\'Hat\'Lin",t:16,d:"The next barber who tries to give you a haircut will be lucky not to break their comb.",ep:1,g:228,l:22,wd:false,fm:true,w:12,s:125,p:1525};
I[9451] = {n:"Cristalline Cape",t:17,d:"This huge piece of crystal can be used as a rigid cape, though it won\'t make you stronger... But the next monster that will try to devour you, will choke on it.",ep:1,g:159,l:21,wd:false,fm:true,w:10,s:125,p:1400};
I[9452] = {n:"Cristall\'Ring",t:9,d:"This ring will make your finger radiant.",ep:1,g:164,l:30,wd:false,fm:true,w:4,s:125,p:2600};
I[9453] = {n:"Cristalline Belt",t:10,d:"With this belt around your hips, no one will ever dare pinch you again for fear of having their fingers cut off.",ep:1,g:151,l:48,wd:false,fm:true,w:30,s:125,p:6075};
I[9454] = {n:"Bobblamulet",t:1,d:"This amulet can be used as a bib for both the young and the old.",ep:1,g:140,l:27,wd:false,fm:true,w:5,s:124,p:2200};
I[9455] = {n:"Bobblering",t:9,d:"You can wear this ring as a toe ring if you need to snuff out your foot odour.",ep:1,g:165,l:30,wd:false,fm:true,w:4,s:124,p:2600};
I[9456] = {n:"Bobblecape",t:17,d:"If you think your backside never had the attention it deserved, just put on this long cape which will dress it up and catch everyone\'s attention.",ep:1,g:160,l:33,wd:false,fm:true,w:5,s:124,p:3075};
I[9457] = {n:"Bobbl\'Hat",t:16,d:"This hat smells of Demonic Roses which should rid you off your lice, and any other form of parasites that squats your head.",ep:1,g:229,l:33,wd:false,fm:true,w:5,s:124,p:3000};
I[9458] = {n:"",t:24,d:"",ep:16,g:3,l:1,wd:false,fm:true,w:0,p:1};
I[9459] = {n:"Wish List for Santa Jaws",t:24,d:"Santa Jaws gets a twisted pleasure-pang when he reads the wish list of a child he\'s devoured.\nYou haven\'t written yours yet, so here\'s a sample.",ep:1,g:41,l:1,wd:false,fm:true,w:0,p:0};
I[9460] = {n:"Pik Apple",t:24,d:"This is one Pokipik who\'ll never see the light of day. Aren\'t you ashamed of yourself?",ep:1,g:123,l:1,wd:false,fm:true,w:0,p:0};
I[9461] = {n:"The Kim",t:16,d:"The Kimbo is said to wear this wig to pay tribute to a handsome, perfectly tanned young man that he met on his island. What a wonderful smile he had! Anyway, he hides the ridiculous wig under his coco.",ep:22,g:230,l:196,wd:true,fm:true,w:10,p:60000};
I[9463] = {n:"Amunita",t:1,d:"This jewel is so powerful that it\'d kill a Moskito from 30 steps, if only its smell didn\'t prevent anything from getting that close!",ep:23,g:141,l:189,wd:true,fm:true,w:10,s:107,p:58000};
I[9464] = {n:"Kralomansion",t:1,d:"This scary amulet was hidden away in a remote mansion for ages. When it was alive, it used to dream of travelling around the world and all the places it would see. In the end, the only place it got to go around is your neck, the poor thing!",ep:22,g:142,l:194,wd:true,fm:true,w:30,s:97,p:58411};
I[9465] = {n:"",t:76,d:"",ep:0,g:20,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[9468] = {n:"Shovel Emlaka",t:8,d:"This dangerous shovel will steal your vitality, your youth, the water in your body and your precious Troofles.",ep:22,g:51,l:191,wd:true,fm:true,w:10,an:16,e:[5,4,1,1,35,50,false,false],c:"CC>450",p:58401};
I[9469] = {n:"Sword Indinz",t:6,d:"Built up with fungi, this sword is perfect to infect your enemies\' bowels.",ep:23,g:85,l:184,wd:true,fm:true,w:10,an:14,e:[10,4,1,1,50,50,false,false],c:"CC>300&CA>300",p:58456};
I[9471] = {n:"Sane Luvenby\'s Day Hat",t:16,d:"To all the Luvenbys who are looking for their soul mate, this elegant but simple hat will be a recognition sign. This magic hat can only be worn by adventurers who are not married yet. That\'s how you\'ll know who\'s a heart to take.",ep:1,g:231,l:1,wd:false,fm:true,w:1,c:"PR=0",p:1};
I[9472] = {n:"Passion Shigekax",t:42,d:"Renowned for its aphrodisiac virtues, this sweet candy is the perfect gift for your beloved.\nThis candy gives between 11 and 20 HP and has a surprise!",ep:1,g:4,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[9473] = {n:"",t:94,d:"",ep:0,g:14,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[9474] = {n:"Risky Soul Stone for Sublime Souls",t:83,d:"You\'ll have a limited chance of capturing level 2000 souls using this soul stone.",ep:0,g:17,l:1,wd:false,fm:true,w:1,tw:true,p:23000};
I[9475] = {n:"Regular Soul Stone for Sublime Souls",t:83,d:"You\'ll have an even chance of capturing level 2000 souls using this soul stone.",ep:0,g:16,l:1,wd:false,fm:true,w:1,tw:true,p:50000};
I[9476] = {n:"Lucky Soul Stone for Sublime Souls",t:83,d:"You\'ll have a good chance of capturing level 2000 souls using this soul stone.",ep:0,g:18,l:1,wd:false,fm:true,w:1,tw:true,p:75000};
I[9477] = {n:"",t:14,d:"",ep:0,g:6,l:10,wd:false,fm:true,w:1,c:"Ps=1|Ps=2|Ps=3",u:true,p:1};
I[9478] = {n:"",t:14,d:"",ep:0,g:1,l:10,wd:false,fm:true,w:1,c:"PX=4|PX=5",u:true,p:1};
I[9479] = {n:"Poshat",t:16,d:"If nothing else, the pin nailed into this hat will shrink a big-head...",ep:1,g:232,l:45,wd:true,fm:true,w:23,s:123,p:1000};
I[9480] = {n:"Caposh",t:17,d:"With such a nice target sewn upon your cape, your enemies will have no excuse for missing you.",ep:1,g:161,l:33,wd:true,fm:true,w:10,s:123,p:3000};
I[9481] = {n:"Poshield",t:82,d:"The pin nailed into this shield can be used as an extra-close combat weapon and kill your enemies.",ep:1,g:36,l:1,wd:true,fm:true,w:1,s:123,p:1};
I[9482] = {n:"Shield Kada",t:82,d:"If you don\'t want to scare your friends away with your ugly face, just hide it behind this nice, welcoming shield.",ep:1,g:37,l:1,wd:true,fm:true,w:1,s:122,p:1};
I[9483] = {n:"Boh-Bihn Shield",t:82,d:"When Iops get stars from their teachers for good work, they stick them to this shield. From time to time, they would stick them all over themselves to show off in front of their schoolmates.",ep:1,g:38,l:1,wd:true,fm:true,w:1,p:1};
I[9484] = {n:"Pac-Tiger Shield",t:82,d:"This shield isn\'t quite a full protection guarantee for the owner, but it is great at chasing ghosts.",ep:1,g:39,l:1,wd:true,fm:true,w:1,p:1};
I[9485] = {n:"Cicapeda",t:17,d:"The three little balls at the bottom of this cape will enable you to give great headbutts if you learn how to spin!!",ep:1,g:162,l:30,wd:true,fm:true,w:10,s:122,p:2500};
I[9486] = {n:"Cicad\'Hat",t:16,d:"Either with or without this hat, you\'ll look like a buffoon...But with it, at least, you\'ll have an excuse!",ep:1,g:233,l:33,wd:true,fm:true,w:10,s:122,p:3075};
I[9487] = {n:"Alignment Conversion Certificate",t:24,d:"This certificate was given to you by Morgan Faym\'n. It contains some details which may interest you and it attests to your conversion.",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9488] = {n:"The Bonta Register",t:24,d:"This register belongs to Morgan Faym\'n and contains many documents, some of which explain how to become a Bontarian. Inside is a page that you must fill in yourself.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[9489] = {n:"The Brakmar Register",t:24,d:"This register belongs to Morgan Faym\'n and contains many documents, some of which explain how to become a Brakmarian. Inside is a page that you must fill in yourself.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[9490] = {n:"Order Certificate No. 5",t:24,d:"This certificate states that you belong to an order. If you want to join another order, you have to wait seven days from the date you received your certificate. Even warriors get to change their mind from time to time. Don\'t make a habit of it, though!",ep:16,g:33,l:1,wd:false,fm:true,w:0,p:1};
I[9491] = {n:"Chocrosis Curse",t:30,d:"You now see life through rose-tinted glasses, and you\'re happy as a noob with a compensation candy.",ep:1,g:2,l:1,wd:false,fm:true,w:0,m:true,p:1};
