I[9523] = {n:"Mercenary Mission Large Reward",t:14,d:"This scroll certifies that you deserve a large reward for your commitment in completing the Mercenary missions.",ep:0,g:6,l:1,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[9524] = {n:"Gift: Pac-Tiger Shield",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:1,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[9525] = {n:"Sane Luvenby\'s Day Gift",t:89,d:"This gift is a survival kit you might want to hold onto while going on dangerous love missions.",ep:1,g:4,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[9526] = {n:"Memo about threats",t:24,d:"You wrote a note on this piece of paper to remind yourself that you should never threaten an Astrubian when there are armed village guards nearby.",ep:0,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[9527] = {n:"Powdered Ingrown Toenails",t:24,d:"Some old, powdered ingrown toenails which used to belong on the toes of an Enutrof. Many years have passed since it was ground down, but the powder still smells of feet. It makes you wonder if you might have been tricked...",ep:1,g:37,l:1,wd:false,fm:true,w:0,p:1};
I[9528] = {n:"Lear\'s Amulette",t:24,d:"This powerful amulet used to belong to Lear, the leader of a long-defunct cult. Apparently he communicated with extra-dimensional beings and was able to clone souls. He was also able to resurrect himself... which must have been pretty handy when there were no priests about.",ep:9,g:48,l:1,wd:false,fm:true,w:0,p:1};
I[9529] = {n:"Forced Resurrection Potion",t:24,d:"Sometimes souls can\'t or even don\'t want to be reincarnated. This potion is useful for forcing them to regain their original forms.",ep:0,g:2,l:1,wd:false,fm:true,w:0,p:1};
I[9530] = {n:"Enchanted Fishing Rod for Snappers",t:24,d:"With a bit of luck, you\'ll be catching Gabby Tongues instead of Snappers with this rod.",ep:0,g:739,l:1,wd:false,fm:true,w:0,p:1};
I[9531] = {n:"Gabby Tongue",t:24,d:"This strange organ is sometimes used as part of the Gabby Tongue interrogation technique.\nThis underhanded method involves forcing the victim to swallow a Gabby Tongue, rendering them unable to speak without flailing around like a madman, as if they were moshing, or worse, slam-dancing. This tires them out very quickly, and then the secondary effects kick in - the victim mistakes the very first person they see for their best friend in the whole world. Getting information out of them when they\'re in this state is a piece of cake.",ep:1,g:740,l:1,wd:false,fm:true,w:0,p:1};
I[9532] = {n:"Statuette of Sumens",t:24,d:"This is one of the two statuettes Maimane gave to Sumens and represents the goods and evils of mankind. It owes its appearance to a spell Sumens cast on it, who wanted to keep it safe from greedy hands.\nTwo questions remain: does this statuette represent good or evil? And most importantly, why does it look so ridiculous?",ep:14,g:738,l:1,wd:false,fm:true,w:0,p:1};
I[9533] = {n:"Cokesoul Stone",t:24,d:"This soul stone was enchanted by the master of the Order of the Putrid Eye himself and will coax souls into letting themselves be caught of their own free will.",ep:2,g:732,l:1,wd:false,fm:true,w:0,p:1};
I[9534] = {n:"Terra Bitya\'s Soul Stone",t:24,d:"This soul stone contains the soul of Terra Bitya the Enutrof. You should take good care of it if you don\'t want your own soul to end up inside it.",ep:2,g:732,l:1,wd:false,fm:true,w:0,p:1};
I[9535] = {n:"Transgenesis Potion",t:24,d:"If you manage to use it correctly, this potion can accelerate the growth of plants by modifying their genes. No one knows if there are any side affects when the plants are eaten, but shhhhh. What the customers don\'t know can\'t hurt them!\nYou\'ll need two peasants and two alchemists to carry out the operation.",ep:0,g:2,l:1,wd:false,fm:true,w:0,p:1};
I[9536] = {n:"Transgenesis Scroll",t:24,d:"This scroll activates the effects of the Transgenesis potion when it\'s poured on oat cereals.",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9537] = {n:"Erzal\'s Blessing",t:24,d:"This book doesn\'t only contain twisted stories of walking and talking dead, it also describes the ritual for forcing a soul to return to its body.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[9538] = {n:"Recollection Potion",t:24,d:"This potion allows you to recall a memory that was inadvertently lost.",ep:0,g:82,l:1,wd:false,fm:true,w:0,p:1};
I[9539] = {n:"Renegade Chief\'s Badge",t:24,d:"You took this badge from a Bontarian renegade who didn\'t deserve to have it.",ep:0,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[9540] = {n:"The Godfather\'s Cape",t:17,d:"This cape will protect your neck from the wintry weather and your behind from low blows...",ep:0,g:163,l:48,wd:true,fm:true,w:10,s:126,p:6200};
I[9541] = {n:"The Godfather\'s Fedora",t:16,d:"This special hat will make you look like the Godfather. You should be proud!",ep:0,g:234,l:43,wd:true,fm:true,w:10,s:126,p:5100};
I[9542] = {n:"The Godfather\'s Polished Oxfords",t:11,d:"These shoes are very shiny even when they\'re worn out. They\'re perfect for impressing your opponents when they get them right in their faces.",ep:0,g:130,l:40,wd:true,fm:true,w:10,s:126,p:4450};
I[9543] = {n:"The Godfather\'s Ring",t:9,d:"This heavy ring will give more power to your slaps and more passion to your caresses...",ep:0,g:166,l:40,wd:true,fm:true,w:10,s:126,p:0};
I[9544] = {n:"Darkness\' Tormentator",t:114,d:"This fearsome magic weapon was made by the famous handyman Hissering. It channels the magic energy of its user before shooting it out with great force. It also changes the appearance of its user and gives them new spells to use. With this weapon, you\'ll just become another person and your Tormentator your sole friend, until you decide you\'re done with it.",ep:0,g:1,l:30,wd:true,fm:false,w:10,an:1,e:[5,6,2,4,50,50,false,false],p:1};
