I[9549] = {n:"The Godfather\'s Pants \'n\' Suspenders",t:10,d:"The motto of the tailor who made this wonder was " + "\"" + "Even in the heart of the action, your pants must always remain up your behind which they will thanks to these high quality flax suspenders" + "\"" + ". This really isn\'t a good motto...",ep:0,g:152,l:48,wd:true,fm:true,w:10,s:126,p:6175};
I[9550] = {n:"Field Location",t:24,d:"Merlanmagus told you where the Militiaman is going to use the Transgenesis spell. You must hurry and get there before it\'s too late.",ep:0,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[9551] = {n:"Modified Scurvion Seed",t:24,d:"These Scurvion seeds were modified, but you can\'t tell the difference between them now and them in their original form. The real problem is that you definitely can see the difference between these seeds and Poppy Seeds. Only an idiot would make that mistake!",ep:0,g:405,l:1,wd:false,fm:true,w:0,p:1};
I[9552] = {n:"Gift: Darkness\' Tormentator",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
