I[9557] = {n:"Key to the Safe",t:24,d:"This key opens the safe which, according to Terra Tibya, holds Sumens\' statuettes.",ep:1,g:3,l:1,wd:false,fm:true,w:0,p:1};
I[9558] = {n:"Spamouflage Potion",t:14,d:"This potion reveals all invisible characters around you.",ep:0,g:73,l:1,wd:false,fm:true,w:1,c:"Pg>23,3",u:true,p:1};
I[9559] = {n:"",t:24,d:"",ep:3,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9562] = {n:"Strange object",t:24,d:"This strange object is really strange. But the strangest thing is the strange feeling that you could use it to access a strange place in the vicinity. Strange, no?",ep:0,g:69,l:1,wd:false,fm:true,w:0,p:1};
I[9563] = {n:"Brakmartian Hair",t:24,d:"The tuft of hair was torn from an unknown creature bearing the insignia of Brakmar. It\'s irrefutable proof that you saw it, at least.",ep:0,g:29,l:1,wd:false,fm:true,w:0,p:1};
I[9564] = {n:"Psychopath\'s Badge",t:24,d:"You have recovered this badge from the still-quivering body of a psychopathic Brakmarian. Do you have such little shame that you\'ll even rob the dead?",ep:0,g:76,l:1,wd:false,fm:true,w:0,p:1};
I[9565] = {n:"",t:24,d:"",ep:0,g:49,l:1,wd:false,fm:true,w:0,p:1};
I[9566] = {n:"Raydi Shield",t:82,d:"They say that the very first Raydi shield was forged in one of Pandala\'s taverns and that Pandawa herself, goddess of goddesses, had a hand in its making. Some say it protects from the ray while others say it was made from it. Reality or fiction? Marketing stunt by the Shield Smiths...? Who knows... only time will tell.",ep:0,g:34,l:1,wd:false,fm:true,w:1,p:5000};
I[9567] = {n:"Black Wab Hat",t:16,d:"With this hat on, you\'ll resemble a masked avenger unless it is an asked manger? You know how Wabs are...",ep:0,g:235,l:49,wd:true,fm:true,w:10,s:127,p:6325};
I[9569] = {n:"Black Wab Cape",t:17,d:"The little pompom at the end of this cape is the greatest duster ever... It\'s so small that it can even fit under your furniture. Don\'t forget to take it off when you go work in the fields.",ep:0,g:164,l:46,wd:true,fm:true,w:10,s:127,p:5600};
I[9570] = {n:"Sesanabolic Seed",t:58,d:"This magically altered seed dramatically increases muscle mass. Conversely, it dramatically decreases brain mass. That explains why it is an essential ingredient in the diets of young Iops.",ep:0,g:3,l:1,wd:false,fm:true,w:1,p:1};
I[9573] = {n:"Sesanabolic Seed recipe",t:24,d:"Only a handful of alchemists know this recipe. Merlinmagus decided to give it to you anyway because he was fed up with being bothered all the time. \n7 Sesame Seeds. \n5 Mushrooms. \n1 Motor Pike. \nTo make a Motor Pike, you\'ll need a fishmonger to mix 2 Gutted Pike, 7 Scurvion Seeds, 2 Boowolf Mojos, 1 Preserved Crocodyl Meat and 2 Kitsou Entrails.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9574] = {n:"",t:24,d:"",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9575] = {n:"Black Wab Belt",t:10,d:"This belt is reversible and can be worn according to what you wish to hide or show...",ep:0,g:153,l:46,wd:true,fm:true,w:10,s:127,p:5600};
I[9576] = {n:"Black Wab Boots",t:11,d:"Made from Black Wabbit backside skin, you\'ll be able to take your revenge on those nasty little creatures with these butt skin boots, as they\'ll feel like they\'re kicking their own butt every time you kick something. It\'s the simple pleasures that count.",ep:0,g:131,l:47,wd:true,fm:true,w:10,s:127,p:5850};
I[9577] = {n:"Leprechaun Curse",t:30,d:"Your new favourite colour is green... It might bring you luck, or not!",ep:0,g:5,l:1,wd:false,fm:true,w:0,m:true,p:1};
