I[9582] = {n:"Armoured Dragoturkey",t:97,d:"This certificate authorizes you to pick up your mount at a stable. \nWarning! This certificate will only be valid for 20 days. Once this time limit is over, your mount will be sent back to the wild and your certificate will no longer be valid. You will not be able to reclaim your mount. Always leave your mount in a stable if you go away for a long time.",ep:0,g:93,l:60,wd:false,fm:true,w:1,c:"PL>59",p:1};
