I[9594] = {n:"The Godfather\'s Gobtubby",t:18,d:"This Gobtubby seems to be perfectly normal... However, its wool seems to turn black in places... Give it time and you might be surprised!",ep:0,g:46,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9595] = {n:"The Godfather\'s Gobtubby Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:35,l:1,wd:true,fm:true,w:1,p:1};
I[9596] = {n:"Gift: The Godfather\'s Gobtubby",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:0,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[9597] = {n:"The Godfather\'s Gobtubby Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:0,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[9598] = {n:"Bow Kennel Certificate: The Godfather\'s Gobtubby",t:77,d:"This certificate describes the characteristics of the pet you\'ve put in the Bow Kennel.",ep:0,g:51,l:1,wd:false,fm:true,w:1,p:100};
