I[9617] = {n:"Angora Bow Meow",t:18,d:"This little ball of fur is more resistant to the cold than an ordinary Bow Meow. It\'s softer to stroke, but it\'s even more annoying than its short-haired cousin... first of all it refuses to eat anything but fish and meat.",ep:0,g:50,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9618] = {n:"Gift: The Godfather\'s Ring",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:0,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
I[9619] = {n:"Tiwabbit Wosungwee",t:18,d:"This creature is a little stupid. The only way to make it move forward is to attach a cawwot and stick to its back. Fortunately it has been quite well trained and you won\'t get any nasty surprises from its bottom end, like some other creatures I could name. This soul muncher will happily feed off the remains of other Wabbits.",ep:0,g:51,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9620] = {n:"Miniminotot",t:18,d:"This Minimino was brought up by Minotot himself... so it\'s now a Miniminotot. Unfortunately, the beast\'s character rubbed off on the innocent creature along with some nasty body odours. This ravenous soul chewer will feed off the remains of creatures from Minotoror Island.",ep:0,g:49,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9621] = {n:"Third Gift from the Sun",t:89,d:"This bag wasn\'t here a minute ago... what\'s inside? (DOUBLE CLICK TO OPEN).",ep:0,g:32,l:1,wd:false,fm:false,w:1,u:true,p:0};
I[9622] = {n:"Tempus Bloomus",t:36,d:"This plant is as mysterious and improbable as its name. It\'s both here and there at the same time, but not at the moment, fortunately, or we wouldn\'t understand it at all. You should take it to the Xelor temple, which can be found at coordinates 3,1. Xelors are the only ones visionary enough to divine the essence of this flower\'s existence.",ep:0,g:638,l:1,wd:false,fm:false,w:1,p:0};
I[9623] = {n:"Crocodyl",t:18,d:"Don\'t be fooled, the pointed teeth of this creature will end up in your backside one day, that is for sure. This pet only eats fish and meat.",ep:0,g:47,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9624] = {n:"Black Dragoone",t:18,d:"Take one Pink Dragoone, plunge it into a pot of black dye, throw some gold dust at it, dip it in oil, then water and if it hasn\'t died of suffocation, you\'ll have yourself a Black Dragoone. This soul swallower will only feed on the remains of Dreggons.",ep:0,g:48,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9625] = {n:"Almond Shigekax",t:28,d:"Rediscover the savour and sweetness of the candy of old with this traditionally prepared sweetie. Mmm... This Shigekax just melts in your mouth.  \nThis candy increases your prospecting by 30 points for 30 fights.",ep:0,g:3,l:1,wd:true,fm:true,w:0,m:true,p:1};
