I[9785] = {n:"Rushu\'s Shushu",t:18,d:"This demon will accompany you throughout all of your wandering, from the Astrub Zaap to the cemetery and maybe even to the cemetery from the Astrub Zaap. It is also full of bitter hatred for Ouassingues... it\'s a long story, but it has something to do with a dirty floor and a bucket of hot water. If you attack a Ouassingue, this demon will be happy to help!",ep:0,g:52,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[9786] = {n:"Rushu\'s Shushu Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:49,l:1,wd:true,fm:true,w:1,p:1};
