I[9921] = {n:"Slamdance Bracelet",t:9,d:"They say this bracelet is shiny, but only when you\'re in an inn or in the middle of the night.",ep:0,g:168,l:45,wd:true,fm:true,w:10,s:132,p:5525};
I[9922] = {n:"Slamdance Belt",t:10,d:"This belt has an incredibly powerful piece of metal with polarized attraction and repulsion properties built in to it which keeps it shut without a buckle. It\'s often used as added protection along with a chastity belt.",ep:0,g:154,l:38,wd:true,fm:true,w:10,s:132,p:4050};
I[9923] = {n:"Slamdance Shoes",t:11,d:"The headspinners among you will have very little use for these shoes, but if you use your feet from time to time, they\'re just what you need.",ep:0,g:135,l:40,wd:true,fm:true,w:10,s:132,p:4300};
I[9924] = {n:"Bedazzling Horns",t:16,d:"The legend says that these horns were used as a lightning conductor, concentrating lightning for several hours and then projecting bolts towards any unwary people who approached too closely. Another legend says they just make their wearer look ridiculous.",ep:0,g:239,l:42,wd:true,fm:true,w:10,s:139,p:4825};
I[9925] = {n:"Bedazzling Fist",t:9,d:"This ring is closer to a glove or a mitten than a wedding ring, but who cares, no one will ever shake your hand the same way again.",ep:0,g:169,l:44,wd:true,fm:true,w:10,s:139,p:4400};
I[9926] = {n:"Bedazzling Double Hakken Axe",t:19,d:"This double-headed axe can cut off two heads in one swing, which equates to an eighth of a sixteen-headed hydra.",ep:0,g:57,l:39,wd:true,fm:true,w:10,an:17,e:[3,5,1,1,20,50,false,false],c:"CC>60&CV>50&CW>30",s:139,p:3900};
I[9927] = {n:"Bedazzling Boots",t:11,d:"If you wear these boots when climbing Mount Jifu, you\'re almost guaranteed to see strange UFO flying across the sky.",ep:0,g:136,l:42,wd:true,fm:true,w:10,s:139,p:4805};
I[9928] = {n:"Siks Wonn Ein Boots",t:11,d:"These boots take approximately 12 hours to tie up and slightly longer to get off. That gives you just enough time to get some sleep every day or so, so long as you\'re single, unemployed, and very good with your hands.",ep:0,g:137,l:42,wd:true,fm:true,w:10,s:131,p:4750};
I[9929] = {n:"Siks Wonn Ein Belt",t:10,d:"The Achilles heel isn\'t always below the knees, you know. Sometimes it\'s just below the waist. In that case, this heavy but effective belt will give all those wieners among you peace of mind and sackfulls of confidence.",ep:0,g:155,l:41,wd:true,fm:true,w:10,s:131,p:4825};
I[9930] = {n:"Siks Wonn Ein Mask",t:16,d:"This mask not only gives you appearance of a terrifying, murderous man-eater, it\'ll also protect your delicate rosy cheeks from harsh wind and hot sun.",ep:0,g:240,l:38,wd:true,fm:true,w:10,s:131,p:4000};
I[9931] = {n:"Slamdance Mullet Hairdo",t:16,d:"Long at the back, short on top, this hairdo has a bad reputation, but you\'ll surely change all that.",ep:0,g:241,l:39,wd:true,fm:true,w:10,s:132,p:4255};
I[9932] = {n:"Tuft of Inkeeper Bagrutte\'s Hair",t:24,d:"This tuft of mangy hair was pulled out of one of Innkeeper Bagrutte\'s armpit. The smell of it makes you never want to smell anything ever again.",ep:0,g:30,l:1,wd:false,fm:true,w:0,p:1};
I[9933] = {n:"Siks Wonn Ein Cape",t:17,d:"Every catcher knows the most dangerous part of wrestling is the crowd. So when the chairs and bottles come flying into the ring, wrap this Pikoko fur cape around yourself and curl up into the foetal position.",ep:0,g:167,l:42,wd:true,fm:true,w:10,s:131,p:4825};
I[9934] = {n:"Key to the Paddock",t:24,d:"The goblins are equipped with basic tools, so they recycle as much as they can, and this is no exception. Who would have thought that a simple bone could open their paddock? Not you in any case.",ep:0,g:57,l:1,wd:false,fm:true,w:0,p:1};
I[9935] = {n:"Climbing Rope",t:15,d:"This is some good string, and has the number one seller for climbers who go up for many long years. It also goes down, but this use is less popular. People from Amakna often use it to play greasy pig.",ep:0,g:170,l:1,wd:false,fm:true,w:5,p:1};
I[9936] = {n:"Darth Vaydhat",t:16,d:"This helmet is perfect for people who look too kind. That can be very dangerous in the World of Twelve.",ep:0,g:242,l:37,wd:true,fm:true,w:10,s:117,p:3825};
I[9937] = {n:"The Chatlin",t:16,d:"This hat comes with a fake toothbrush moustache, which is nice until you find yourself mistaken for a great dictator.",ep:0,g:243,l:37,wd:true,fm:true,w:10,s:116,p:3700};
I[9938] = {n:"Swodor",t:6,d:"This sword\'s blade was soaked in concentrated firefly juice for 18 months to make it glow in the dark. It now stinks in the dark too, by the way.",ep:0,g:91,l:38,wd:true,fm:true,w:10,an:14,tw:true,e:[5,4,1,1,50,50,false,false],c:"CV>30&CS>20&CW>20",s:117,p:3800};
I[9939] = {n:"The Chapstick",t:4,d:"This flexible bamboo cane is definitely not for leaning on... try twirling it round in the air instead.",ep:0,g:88,l:37,wd:true,fm:true,w:10,an:12,e:[5,3,1,1,40,50,false,false],c:"CC>25",s:116,p:3700};
I[9940] = {n:"Raw Mother of Pearl",t:51,d:"This mother of pearl will be beautiful when polished.",ep:0,g:10,l:20,wd:true,fm:true,w:1,p:10};
I[9941] = {n:"Mother of Pearl",t:50,d:"This material is made from aragonite crystals and shellite. It was unknown up until Otomai Island was discovered and shellite was found. This element is very precious to alchemists, although the recipes in which it\'s used are always jealously guarded.",ep:0,g:4,l:50,wd:true,fm:true,w:10,p:5000};
I[9942] = {n:"Ring of Death",t:9,d:"This ring is also known as the Black Band, but in spite of its two names, it remains unfinished. Even so, it\'s powerful enough to destroy a small planet.",ep:0,g:170,l:36,wd:true,fm:true,w:10,s:117,p:3600};
I[9943] = {n:"Pair o\'Shuplins",t:11,d:"These shoes are rumoured to have been eaten by a starved gold miner only to be stitched back together when they came out the other end. That must be why they\'re so shiny.",ep:0,g:138,l:43,wd:true,fm:true,w:10,s:116,p:4975};
I[9944] = {n:"The Chavate",t:1,d:"This charm is an amulet and a cravat in one, and it\'ll give you the air of a gentleman even when you\'re down and out.",ep:0,g:145,l:43,wd:true,fm:true,w:10,s:116,p:5000};
I[9945] = {n:"Newddha the Prophet\'s Bag",t:81,d:"Newddha the Prophet is famous for renouncing his family\'s wealth and sitting under a Kokonut tree, waiting for enlightenment to dawn upon him. Instead, a giant Kokonut cracked him on the head, leading him to leave all that spiritual nonsense behind for good.",ep:0,g:33,l:38,wd:true,fm:true,w:10,s:117,p:4050};
I[9946] = {n:"Kain Dharyn Crystal",t:24,d:"Kain Dharyn\'s fame as a treasure hunter spread far and wide through Amakna. He discovered many crystals with incredible properties, including the power to uncross his eyes without using his hands. Kain told no one where the crystals were to be found, and to this day many Enutrofs seek it still.",ep:0,g:744,l:1,wd:false,fm:true,w:0,p:1};
I[9947] = {n:"Enchanted Kain Dharyn Crystal",t:24,d:"This Kain Dharyn Crystal was enchanted so as to multiply the greed of anyone who sees it.",ep:0,g:717,l:1,wd:false,fm:true,w:0,p:1};
I[9948] = {n:"Chief Thief\'s Tibia",t:24,d:"The Chief Thief will have a hard time walking with one Tibia less! Well, that\'ll teach him a lesson.",ep:0,g:57,l:1,wd:false,fm:true,w:0,p:1};
I[9949] = {n:"Tra Khben Paste",t:110,d:"This paste was invented by the famous Tra Khben, a geologist who specialised in ecosystems and harvests, and who suffered from arthritis of the back from a young age. This paste is remarkable for its ability to make any organic substance it touched rock hard. Tra Khben used this property to help himself stand up straight. When the geologist died, it became very popular with Enutrofs, for an entirely different reason. Its only downside is its smell which explains the ferociously bad breath of many Enutrof miners.",ep:0,g:42,l:1,wd:false,fm:true,w:1,p:1};
I[9950] = {n:"Impure Blue Corruptah Stone",t:51,d:"This stone will attain its full potential when polished.",ep:0,g:151,l:1,wd:false,fm:true,w:5,p:1};
I[9951] = {n:"Impure Yellow Corruptah Stone",t:51,d:"This stone will attain its full potential when polished.",ep:0,g:145,l:1,wd:false,fm:true,w:5,p:1};
I[9952] = {n:"Impure Green Corruptah Stone",t:51,d:"This stone will attain its full potential when polished.",ep:0,g:76,l:1,wd:false,fm:true,w:5,p:1};
I[9953] = {n:"Blue Corruptah Stone",t:50,d:"This stone can corrupt unwilling souls, which is useful for transforming Tofus into Evil Tofus. When combined with other Corruptah Stones, it has the potential to give the bearer complete control over the souls.",ep:0,g:460,l:50,wd:false,fm:true,w:10,p:100};
I[9954] = {n:"Yellow Corruptah Stone",t:50,d:"This stone can corrupt unwilling souls, which is useful for transforming Tofus into Evil Tofus. When combined with other Corruptah Stones, it has the potential to give the bearer complete control over the souls.",ep:0,g:463,l:50,wd:false,fm:true,w:10,p:100};
I[9955] = {n:"Green Corruptah Stone",t:50,d:"This stone can corrupt unwilling souls, which is useful for transforming Tofus into Evil Tofus. When combined with other Corruptah Stones, it has the potential to give the bearer complete control over the souls.",ep:0,g:461,l:50,wd:false,fm:true,w:10,p:100};
I[9956] = {n:"Stone of Corrupted Souls",t:24,d:"This stone comes from the Well of the Corrupted Souls. It can be used to control the souls of creatures trapped inside.",ep:0,g:462,l:1,wd:false,fm:true,w:0,p:1};
I[9957] = {n:"Crocobur",t:114,d:"You are in possession of Crocoburio\'s soul. This blade, that you pulled out of the mythical stone in the depths of the marshes, can only to be handled by a select few. Passing it on to someone else would be an affront to the memory of Crocoburio himself.",ep:0,g:6,l:40,wd:false,fm:false,w:15,an:14,tw:true,e:[3,5,1,1,45,90,false,true],p:1};
I[9958] = {n:"Crate of Bontarian Equipment",t:24,d:"This crate contains the kit of the perfect little militiaman. If the contents of the crate are of a similar quality to the crate itself, it wouldn\'t be surprising if it took less than a day to defeat the Bontarian militia.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[9959] = {n:"Expert Report",t:24,d:"As you expected, this expert report confirms the poor quality of the Bontarian militia\'s equipment. Oto Mustam will be delighted with the news.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9960] = {n:"Keys to the Warehouse",t:24,d:"This glass bowl contains what\'s left of what was lodged in Sennuig\'s stomach. The good news is that the keys to the warehouse are in there too somewhere. All you have to do now is stick your hand in there and pull the keys out. Don\'t forget to lick your fingers afterwards!",ep:0,g:32,l:1,wd:false,fm:true,w:0,p:1};
I[9961] = {n:"Hurrian Hammer",t:7,d:"This stone hammer was invented to lure smiths into believing that they were holding a hammer of excellent quality. It is strongly advised that you do not touch it, better still, do absolutely nothing with it at all.",ep:0,g:2,l:1,wd:true,fm:false,w:5,an:15,e:[5,4,1,1,60,20,false,false],p:10};
I[9962] = {n:"Crate of Ore",t:24,d:"You stole this crate of ore so that Latem Sa wouldn\'t be able to use it to forge new equipment for the Bontarian militia.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[9963] = {n:"Smith\'s Hammer",t:24,d:"You stole this hammer from Latem Sa and replaced it with a Hurrian Hammer. Latem Sa is so incompetent that he probably won\'t know the difference.",ep:0,g:8,l:1,wd:false,fm:true,w:0,p:1};
I[9964] = {n:"Gift: Khamelerost Dragoturkey",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[9965] = {n:"Canine Training Technique",t:24,d:"This technique, developed by the famous Bow Meow trainer Roy Sigfred, tells you how to tame a Whitish Fang and make it man\'s best friend. It still won\'t think much of women, though.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[9966] = {n:"Loot from the Convoy",t:24,d:"You got this booty in the attack on the Bontarian convoy. Stampitor the Boor, who you can find in the Brakmarian Militia Headquarters, will surely repay you well for your efforts. He might even let you go in one piece.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[9967] = {n:"How To Make Glutoburg",t:24,d:"Laura Soho, waitress at the Amakna Tavern, wrote down on this scrap of paper how to prepare a bottle of Glutoburg with an alchemist\'s help.\n- 5 Pandaburg Flasks.\n- 1 Greedo Rum.\n- 10 Salad.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9968] = {n:"Bottle of Glutoburg",t:79,d:"This ultra-powerful mix of alcohol rips out your tongue, scrapes away your palate, burns your oesophagus and causes your stomach to explode before boiling your brain. In other words, it\'s a drink for real Pandawas. In tiny writing on the base of the bottle you can just about make out the following: " + "\"" + "Consumption of alcoholic beverages may cause health problems. Drink in moderation, except when as an offering to the goddess" + "\"" + ".",ep:0,g:177,l:1,wd:false,fm:true,w:0,u:true,p:1};
I[9969] = {n:"Poisoned Fishy Salad",t:15,d:"Wake up and smell the coffee, or so the saying goes. Well, this salad does not smell of coffee. It smells of fish. Fish and sweaty feet. This is quite useful, really, because it masks the smell of poison, which, once gulped down, induces projectile vomiting. Great for livening up a boring wedding or playing a trick on your favourite guild leader.",ep:0,g:80,l:1,wd:false,fm:true,w:1,p:1};
I[9970] = {n:"Fishy Salad Recipe",t:24,d:"Gropinson Cruaule wrote the recipe for Fishy Salad in the sand on the beach and you copied it down onto a piece of paper.\n- A fishmonger (putting them in the dish is optional).\n- 2 Lard Bass.\n- 3 Crab Stick ***. \n- 2 Lemons. \n- 4 Salad. \n- 1 Rasputin Cake (your own personal touch).",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9971] = {n:"Mulic Bere\'s Keys",t:24,d:"These keys belong to Muric Bere. They unlock the door to his special forge where, amongst other things, he creates extraordinary items for very ordinary people like you.",ep:0,g:61,l:1,wd:false,fm:true,w:0,p:1};
I[9972] = {n:"Scratcher Smith Hammer",t:7,d:"This hammer, to be used in a forge, was created for a specific purpose, which makes it difficult to use for anything else. Only someone desperate or on the margins of society would use it to make weapons.",ep:0,g:2,l:1,wd:true,fm:true,w:20,an:15,e:[5,4,1,1,50,50,false,false],c:"PJ>20,49",p:150};
I[9973] = {n:"Back-Scratcher Tip",t:15,d:"This Back-Scratcher Tip has several joints to make it easier to use. It has several prongs, and can double up nicely as an Osamoda\'s...hey, who writes this stuff?!",ep:0,g:716,l:1,wd:false,fm:true,w:1,p:1};
I[9974] = {n:"Handle Slasher",t:5,d:"This slasher is for slashing handles, not candles. You can dangle a candle on your sandals, you vandal, but the scandal would be too much for Randall to handle. And no, I don\'t know who Randall is, either.",ep:0,g:17,l:1,wd:true,fm:true,w:5,e:[5,4,1,1,50,50,false,false],c:"PJ>19,49",p:150};
I[9975] = {n:"Back-Scratcher Handle",t:15,d:"On its own, this handle is of no use to you whatsoever. You could attach a scratcher to its tip, but that wouldn\'t be much use to you either. You\'d be correct in assuming that only someone pretty twisted would know what to do with it.",ep:0,g:52,l:1,wd:false,fm:true,w:5,p:1};
I[9976] = {n:"Incomplete Back-Scratcher",t:15,d:"This back-scratcher is almost perfect. Almost, but not quite. Only a highly-skilled smith could complete it, and unfortunately, you don\'t know one.",ep:0,g:52,l:1,wd:false,fm:true,w:10,p:1};
I[9977] = {n:"Spentox Back-Scratcher",t:24,d:"This very pointy back-scratcher will shape itself to your body\'s contours, reaching the parts other back-scratchers cannot. Yes, even there.",ep:0,g:745,l:1,wd:false,fm:true,w:0,p:1};
I[9978] = {n:"Army of Plain Boar Ticks",t:24,d:"Fatter than Gobball ticks, Plain Boar ticks can devour up to 100 times their own weight in blood. Vampires and even Dark Vlad himself would turn pale with envy.",ep:0,g:727,l:1,wd:false,fm:true,w:0,p:1};
I[9979] = {n:"Longevity Potion",t:12,d:"Nileza the Alchemist created this potion hoping it would grant him immortality. Unfortunately, he died before he could use it, mistaking some Unikron Blood (which was in the bottle next to it on the shelf) for it.",ep:0,g:40,l:1,wd:false,fm:true,w:1,p:1};
I[9980] = {n:"Plate of Scrampi",t:49,d:"This dish perfectly illustrates Donna Kerbabben\'s favourite saying: " + "\"" + "If it isn\'t for frying, it\'s not worth trying" + "\"" + ".",ep:0,g:82,l:1,wd:false,fm:true,w:5,u:true,ut:true,p:1};
I[9981] = {n:"Funky Flour",t:52,d:"Xavier the Baker used this flour to make the bread served at each of the funerals of the famous singer Jon Lemon.",ep:0,g:7,l:1,wd:false,fm:true,w:1,p:1};
I[9982] = {n:"Kerbbaben Salad",t:69,d:"The name of this salad is a celebration of the day it was first created. It was served for the first time during the dubbing ceremony of the famous Iopette Donna Kerbabben. As with all foods destined for consumption by knights, it is strongly recommended that vegetarians give it a very wide berth.",ep:0,g:129,l:1,wd:false,fm:true,w:5,u:true,ut:true,p:1};
I[9983] = {n:"Vaulting Rye Bread",t:33,d:"Served at the funerals of the famous singer Jon Lemon, this bread\'s taste and smell is so revolting that it would wake the dead, or kill the living. This explains Jon Lemon\'s many comebacks.",ep:0,g:13,l:1,wd:false,fm:true,w:2,u:true,ut:true,p:1};
I[9984] = {n:"List of Yesteryear\'s Ingredients",t:24,d:"Here\'s the list Oto Mustam gave you:\n- 1 Vaulting Rye Bread\n- 1 Kerbabben Salad\n- 1 Plate of Scrampi\n- 1 Longevity Potion",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[9985] = {n:"Vaulting Rye Bread Recipe",t:24,d:"- 2 Funky Flour.\n- 5 Water.\n- 2 Baker\'s Yeast.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9986] = {n:"Funky Flour Recipe",t:24,d:"- 1 Xavier the Baker\'s Flour. \n- 1 Eniripsa Powder. \n- 4 Onions.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9987] = {n:"Kerbabben Salad Recipe",t:24,d:"- 5 Brawn Salad ***.\n- 20 Blop Pollen.\n- 10 Treechnid Buds.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9988] = {n:"Plate of Scrampi Recipe",t:24,d:"- 10 Grawn Fritters ***. \n- 5 Lemons. \n- 10 Salad.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9989] = {n:"Longevity Potion Recipe",t:24,d:"- 2 Unikron Blood.\n- 10 Potions of Old Age.\n- 2 Memory Potions.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[9990] = {n:"Cheeka\'s Brooch",t:24,d:"This Brooch was given to you by Cheeka for your valiant actions during the attack on the convoy. It also seals her promise to thank you in person when she returns to Bonta.",ep:0,g:69,l:1,wd:false,fm:true,w:0,p:1};
I[9993] = {n:"Sabine",t:32,d:"You must bring Sabine to the Militia buildings in Brakmar.",ep:0,g:25,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[9995] = {n:"Tied Mercenary Scroll",t:87,d:"This scroll will tell you the location of a target, allowing you to track them more easily.",ep:0,g:2,l:10,wd:false,fm:true,w:1,c:"Ps=3",u:true,p:1};
I[9997] = {n:"Key to the Bandit Hideout",t:24,d:"This is the key to the bandits\' hideout. Grimpil told you about a mechanism that closes the door automatically when someone enters. This is why everyone who associates with the gang has a copy of the key.",ep:0,g:790,l:1,wd:false,fm:true,w:0,p:1};
I[9999] = {n:"Copy of the Key to the Bandit Hideout",t:84,d:"This copy of the key to the Ecaflip bandits\' hideout is about to shatter. If you try to use it like it is, it will probably break. All this, plus the fact that there\'s no safety certificate, leads you to believe that the key is a forgery. You\'d be right!",ep:0,g:61,l:1,wd:false,fm:true,w:1,p:1};
I[10000] = {n:"Tuft of Grimpil\'s Fur",t:24,d:"When you hold this tuft of fur in your hand you seems to sense activity inside. You look closer, and yes... no... it\'s not fur at all, it\'s a tuft of enormous lice and ticks.",ep:0,g:30,l:1,wd:false,fm:true,w:0,p:1};
I[10003] = {n:"Nowaine Jelly",t:110,d:"Liroye Merline alone knows the recipe to this artificial jelly. When it\'s mixed with wet turf the jelly hardens and takes on the form of anything that\'s slid into it. This product is very useful for creating moulds.",ep:0,g:47,l:1,wd:false,fm:true,w:0,p:1};
I[10004] = {n:"How To Use Nowaine Jelly",t:24,d:"This document on 1,001 uses for Nowaine Jelly was written by Liroye Merline. Here\'s what she says about copying keys on the cheap:\n- 1 Nowaine Jelly\n- 1 unit of Wild Grass\n- 1 unit of Bakelelite",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[10005] = {n:"Confidential Documents",t:24,d:"A list of confidential Bontarian documents. You might ask what these secret papers are doing in the bandits\' hideout.",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[10006] = {n:"Suspicious Report",t:24,d:"This report is very bad news for you. It accuses you of being disloyal to Bonta and implicates you in numerous dodgy dealings. Only an expert can tell you if the document is authentic or not.",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[10007] = {n:"Flask of Brakmarian Poison",t:24,d:"This flask of Brakmarian poison has been prepared just like grandma used to do it. The label tells you to \'keep it out of reach of everyone. Unless they\'re Bontarian.\'",ep:0,g:39,l:1,wd:false,fm:true,w:0,p:1};
I[10008] = {n:"Client Register",t:24,d:"This register lists all the clients who\'ve visited the Alchemist\'s workshop in Brakmar these last few weeks. The problem is that it\'s all written in Brakmarian - you can\'t understand a bloody word it\'s saying.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[10009] = {n:"Xephires",t:32,d:"Bring Xephires the traitor before Amayiro. They have a few things to... discuss.",ep:0,g:24,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10010] = {n:"Gaming Room Key",t:24,d:"This key will unlock the door to the Burnt Cat Inn\'s gaming room.",ep:0,g:61,l:1,wd:false,fm:true,w:0,p:1};
I[10011] = {n:"Petra\'s Heart",t:24,d:"This is Petra\'s still-beating heart. It still bothers you that a disciple of Sram didn\'t put up any resistance when you took her life, but, after thinking about it, you tell yourself that the result would have been the same if she had have done, so, with a light heart, you take this heart to your beloved master.",ep:0,g:518,l:1,wd:false,fm:true,w:0,p:1};
I[10012] = {n:"Petra\'s Heart",t:24,d:"This is Petra\'s still-beating heart. It still bothers you that a disciple of Sram didn\'t put up any resistance when you took her life, but, after thinking about it, you tell yourself that the result would have been the same if she had have done, so, with a light heart, you take this heart to your beloved master.",ep:0,g:518,l:1,wd:false,fm:true,w:0,p:1};
I[10013] = {n:"Petra\'s Heart",t:24,d:"This is Petra\'s still-beating heart. It still bothers you that a disciple of Sram didn\'t put up any resistance when you took her life, but, after thinking about it, you tell yourself that the result would have been the same if she had have done, so, with a light heart, you take this heart to your beloved master.",ep:0,g:518,l:1,wd:false,fm:true,w:0,p:1};
I[10014] = {n:"Petra\'s Cheque",t:24,d:"This cheque, made out to Oto Mustam, was written by Petra. It\'s a pity it\'s not a pile of glittering Kamas, you could have discreetly helped yourself to some.",ep:0,g:54,l:1,wd:false,fm:true,w:0,p:1};
I[10015] = {n:"Oto Mustam\'s Shopping List",t:24,d:"Oto Mustam is making you pay the price for failing the test of ill will so miserably. He wants you to find the following items:\n- 1 Bag of Bronze.\n- 1 Bag of Malt.\n- 1 Bag of Hemp Flowers.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10016] = {n:"Celt\'Axe",t:24,d:"This hatchet looks very basic, as if from another age. It\'s of such low quality that it would be impossible to cut a Trunknid with it.",ep:0,g:746,l:1,wd:false,fm:true,w:0,p:1};
I[10017] = {n:"Nara\'s Katana",t:24,d:"This Katana was made by Nara when he passed his apprenticeship exam. There is none other like it... it is up there with the Celt\'axe for quality.",ep:0,g:53,l:1,wd:false,fm:true,w:0,p:1};
I[10018] = {n:"Blueprint for a Clothes Peg",t:15,d:"This blueprint is so simple that even a young Iop could understand it. Well... let\'s not exaggerate. In the hands of a handyman, it can be used to make objects. If the handyman is a Iop, however, get ready for trouble. You\'ll need this blueprint, 10 Planks of Kaliptus Wood and 10 Aluminite.",ep:0,g:767,l:1,wd:false,fm:true,w:1,p:1};
I[10019] = {n:"Bucket of Clothes Pegs",t:15,d:"This bucket contains enough clothes pegs to hang up the underwear of the entire Amakna garrison. You could also use them to dry the skins of freshly-slain monsters, or the skin of your mother-in-law.",ep:0,g:768,l:1,wd:false,fm:true,w:10,p:1};
I[10020] = {n:"Roughed-up Doll",t:24,d:"You have a hard time believing that this ugly, smelly doll was once a Bwork Mage. Then you remember Bwork Mages are even uglier and smellier than the doll is.",ep:0,g:747,l:1,wd:false,fm:true,w:0,p:1};
I[10021] = {n:"Patched-up Doll",t:24,d:"You ask yourself if the doll was better off before or after it was patched up by Maskara. One thing\'s for sure, only a god could make a doll more beautiful than it was originally. Now you know why the Bwork Mage was in such a bad mood and decided to shut himself up in a cave for years on end.",ep:0,g:747,l:1,wd:false,fm:true,w:0,p:1};
I[10022] = {n:"Enchanted Doll",t:24,d:"It\'s enchanting to see this enchanted doll back in the hands of the enchanter who enchanted it by the enchanted lakes. If he was still alive, the singer Jon Lemon would certainly have written an unpopular song about it.",ep:0,g:747,l:1,wd:false,fm:true,w:0,p:1};
I[10023] = {n:"Register of Rounds",t:24,d:"Contrary to what its name suggests, this register isn\'t about Bwork Mamas, but the routes of Brakmarian patrols. There are many choices for an ambush on here.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[10024] = {n:"Old Bwork Spellbook",t:24,d:"This old spellbook belonged to a cavern-dwelling Bwork Mage, so the illustrations in it will be difficult for modern cavern-dwelling Bwork Mages to understand, and even more so for an ordinary Bwork Mage. Let\'s just hope that Danathor will find some use for it. It would be a shame to have gone to so much trouble for nothing, wouldn\'t it.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[10025] = {n:"Greedoburg Fever",t:30,d:"You were warned: the consumption of Greedoburg may cause health problems.",ep:0,g:6,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10026] = {n:"Fishy Salad Recipe",t:24,d:"Gropinson Cruaule wrote the recipe for Fishy Salad in the sand on the beach and you copied it down onto a piece of paper.\n- A fishmonger (putting them in the dish is optional).\n- 2 Lard Bass\n- 3 Crab Stick ***.\n- 2 Lemons.\n- 4 Salad.\n- 2 Greenjely (your own personal touch).",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10028] = {n:"Magic Patch Recipe",t:24,d:"This recipe was developed by the tailor Sosh to patch up magic clothing. Experienced tailors can use it to create a fabric that will withstand both the test of time and bad weather. (action Sew a Cape) \n- 5 Magus Bwork Beard Hairs. \n- 5 Black Tiwabbit Hairs. \n- 3 Gwandpa Wabbit Beard Hairs. \n- 3 Miliboowolf Hairs. \n- 1 Silk String.",ep:0,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[10029] = {n:"Magic Blood Orange Dye Recipe",t:24,d:"This recipe was developed by the famous alchemist Uba Tesse. No one has used it yet because Uba Tesse left it at his friend Sosh\'s house. Sosh generously gave it to you.\n- 1 Magic Redness Dye.\n- 1 Magic Orange Dye.\n- 10 Gobball Blood.\n- 5 Shiny Sardines.",ep:0,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[10030] = {n:"Magic Patch",t:55,d:"This synthetic fabric, invented by the tailor Sosh, allows magic clothing to be patched up without affecting their powers. That might explain why experienced tailors value it so highly.",ep:0,g:434,l:1,wd:false,fm:true,w:1,p:1};
I[10031] = {n:"Magic Blood Orange Dye",t:70,d:"This magic dye, invented by Uba Tesse, is particularly aggressive. It seems to be possessed of a willpower of its own, driving it to do harm. You have to wonder why it\'s just so aggressive, though.",ep:0,g:63,l:1,wd:false,fm:true,w:1,p:1};
I[10032] = {n:"Patched Bandana",t:24,d:"This bandana is in a much better state than it was when you first found it. It smells less of cawwot and more of fish, which shows it\'s back to how it was before. Elturt will be happy to have it back in such good condition.",ep:0,g:749,l:1,wd:false,fm:true,w:0,p:1};
I[10033] = {n:"Warrant",t:24,d:"This warrant, signed by Kaffra Keeper, says that Brakmarians should hand over documents to Seci Ves at the foot of the Brakmarian Tower of Orders.",ep:0,g:33,l:1,wd:false,fm:true,w:0,p:1};
I[10034] = {n:"Magus Ax\' List",t:24,d:"Here is the list of items to bring to the Revelation Ritual:\n- 5 Drizzle Potions.\n- 10 Water.\n- 10 Pandkin Seed.\n- 4 Magical Cure.\n- 2 Hornbeam Wood.\n- 4 Draught Potions.\n- 2 Trusted Friends.\n- NO sulphur.",ep:0,g:74,l:1,wd:false,fm:true,w:0,p:1};
I[10035] = {n:"Result of the Revelation",t:24,d:"Magus Ax has written the outcome of the Revelation Ritual on this parchment. To use the Fogornleg Horn, simply sling it over your shoulder and sing " + "\"" + "Doo-DAH! Doo-DAH!" + "\"" + ".",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[10036] = {n:"Playful Claw Fairywork",t:74,d:"When she was living in the Tower of Tough Love, Mily once ordered a huge number of Fairyworks from a famous craftsman to illuminate her garden parties. She still has some left and when she\'s in a good mood, she gives them out for free.",ep:0,g:30,l:1,wd:false,fm:true,w:1,ut:true,p:1};
