I[10043] = {n:"Wanna Be Fair",t:30,d:"An extremely powerful beauty cream turned you into... wow! Just remember that being this hot can be dangerous!",ep:0,g:2,l:1,wd:false,fm:false,w:0,m:true,p:1};
I[10044] = {n:"Mily\'s Beauty Cream",t:12,d:"Mily slaps this cream on her body every morning to keep herself looking young and beautiful. Just try it and the results will amaze you! Make sure you don\'t get into any fights while you have it on, though - the least effort will leave you looking like an old hag.",ep:0,g:40,l:1,wd:false,fm:true,w:1,u:true,p:1};
