I[10052] = {n:"Forgetfulness Potion: \'Spiritual Leash\'",t:43,d:"Using this potion will cause you to unlearn one level of the special spell \'Spiritual Leash\'.",ep:0,g:31,l:1,wd:true,fm:true,w:1,u:true,p:1000};
I[10053] = {n:"",t:9,d:"",ep:0,g:172,l:50,wd:false,fm:true,w:1,p:1};
I[10054] = {n:"Vampyre Ring",t:9,d:"This ring spent three years in a pool of Borbat guano. It\'s still magic, though.",ep:0,g:171,l:42,wd:true,fm:true,w:10,c:"PO!10119",s:130,p:4703};
I[10055] = {n:"Vampyre Amulet",t:1,d:"This amulet is supposed to stop Vampyres sucking your blood. The idea is that they\'re meant to believe you\'re a Vampyre too.",ep:0,g:146,l:45,wd:true,fm:true,w:10,c:"PO!10119",s:130,p:5500};
I[10056] = {n:"Vampyre Belt",t:10,d:"This belt not only glows in the dark, it also glows in the light, although it\'s hard to be sure.",ep:0,g:156,l:42,wd:true,fm:true,w:10,c:"PO!10119",s:130,p:4805};
I[10057] = {n:"Hunting Rune",t:78,d:"In the words of Lezan the Wise - " + "\"" + "Well, bad hunters just see something, right, and then they shoot it like. And then though, good hunter, like, see something and shoot it. Good hunters." + "\"" + "  \nYou can check if all this is true with this rune.",ep:0,g:60,l:10,wd:false,fm:true,w:1,p:10};
I[10058] = {n:"Vampyre Cape",t:17,d:"Bram was right after all, you should watch out for grown men who prance around with makeup and long, flowing capes.",ep:0,g:168,l:41,wd:true,fm:true,w:5,c:"PO!10119",s:130,p:4550};
I[10059] = {n:"",t:38,d:"",ep:0,g:138,l:1,wd:false,fm:true,w:5,p:1};
I[10060] = {n:"",t:15,d:"",ep:0,g:97,l:1,wd:false,fm:true,w:1,p:1};
I[10061] = {n:"Vampyre Boots",t:11,d:"They say that Countess Bathory herself used to wear these boots. Knowing her, they should be nice and soft... just hope there aren\'t too many pimples on them.",ep:0,g:139,l:41,wd:true,fm:true,w:10,c:"PO!10119",s:130,p:4550};
