I[10069] = {n:"Barrel of Shambrosia",t:24,d:"The barrel contains a strong, potent alcohol, based on Grass Snake venom and Moowolf earwax. Drinking even the tiniest of sips causes severe brain damage. It is very popular with Iops who can consume it with no ill-effects whatsoever.",ep:0,g:165,l:1,wd:false,fm:true,w:0,p:1};
I[10070] = {n:"Bombu Barrel",t:15,d:"This barrel, made of Bombu Wood, is surrounded by ebonite. As this alloy is transformed into poison over time, Bombu Barrels are mainly used for the fermentation and storage of alcohol, giving it a special flavour and side effects that are just as special.",ep:0,g:165,l:1,wd:false,fm:true,w:5,p:1};
I[10071] = {n:"Access Map to Gordo McRamsay\'s wine cellar",t:24,d:"This map shows how to access Gordo McRamsay\'s wine cellar, located south of the Amakna Village Zaap. Two people are needed to clear the entrance: a person equipped with a Layte\'s Slicer and a Miner equipped with a pick and capable of mining silver.\nYou also need a Bombu Barrel to transport the Shambrosia. A handyman will know how to make one.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10072] = {n:"Rump Feather",t:24,d:"This feather, which appears to be giving off alcoholic fumes, was brutally torn from the rump of a wandering drunk. He knows now that alcohol abuse is dangerous for his health.",ep:0,g:754,l:1,wd:false,fm:true,w:0,p:1};
I[10073] = {n:"Hispanian Shield",t:82,d:"The legendary Dal-Uk-Wet, who unified the Kingdom of Hispania, had a magic shield! Sir-Dal, his great grand-son, had copies forged to reward his best warriors. This shield is one of these copies.",ep:0,g:40,l:1,wd:false,fm:true,w:1,p:1};
I[10074] = {n:"Letter from the Chief Thief",t:24,d:"This was found in combat against the burglars at Milone\'s house:\nMilone the jeweller has just created a very valuable jewel. Steal it by whatever means necessary. Fortunately, Milone gave them a copy, but it\'s no thanks to you.\nOn the back of the message, though, there is a guide to their hideout. Revenge beckons, but you won\'t be able to do it alone.",ep:0,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[10075] = {n:"Horrible Sludge",t:24,d:"This horrible sludge appeared in your pocket as if by filthy magic.",ep:0,g:2,l:1,wd:false,fm:true,w:0,p:1};
I[10076] = {n:"Unique Hispanian Shield",t:82,d:"The legendary Dal-Uk-Wet, who unified the Kingdom of Hispania, concentrated all his powers into his shield to his enemies\' great displeasure. Years later, Sir-Dal, his great grand-son, had copies forged to reward his best warriors... but this is the genuine and most powerful shields of all!",ep:0,g:40,l:10,wd:false,fm:true,w:30,c:"PP>9",p:63200};
I[10077] = {n:"Terra Cogita",t:32,d:"Escort Terra Cogita around before taking him to meet Justfa Lafs.",ep:0,g:22,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10078] = {n:"Deni Hoobe",t:32,d:"You need to escort and protect Deni Hoobe. It\'s almost as if the gods have been fighting against you ever since he\'s been with you.",ep:0,g:13,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10079] = {n:"Intre Bread",t:33,d:"This bread is highly prized by the Iop community for its ability to fill warriors with overwhelming courage. The numerous deaths caused by its consumption are proof that it works. Xavier the Baker stopped making it when a company of limp-wristed troubadours terrorised the region for an entire winter.",ep:0,g:13,l:100,wd:true,fm:true,w:1,u:true,ut:true,p:1};
I[10080] = {n:"Renegade Message",t:24,d:"This message convenes the renegades to the Scaraleaf dungeon. You should go there yourself to find out more.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10081] = {n:"Renegade Chief\'s Message",t:24,d:"In this message, the chief of the renegades requests that they meet him in the South of the bandit territory. This is your chance to get rid of this traitor.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10082] = {n:"Mojeetov Cocktail",t:24,d:"What do you get when you crush a Mojeeto Petal? Alcoholic sap that is used to make a wide range of cocktails. Otomai\'s disciples are very fond of these drinks and consume many litres during the summer festivals. Guaranteed to set the party on fire.",ep:0,g:762,l:1,wd:false,fm:true,w:0,p:1};
I[10083] = {n:"Fishy Salad",t:49,d:"Wake up and smell the coffee, or so the saying goes. Well, this salad does not smell of coffee. It smells of fish. Fish and sweaty feet. Do not eat it in front of a rutting Lousy Pig, unless you\'re a female Lousy pig, that is.",ep:0,g:80,l:1,wd:false,fm:true,w:3,u:true,ut:true,p:1};
I[10084] = {n:"Warning Whistle",t:24,d:"This whistle, crafted according to Roy Sigfred\'s Canine Breeding Technique, is used to call tamed Whitish Fangs. You can\'t imitate the master of a Whitish Fang which does not belong to you, though. It also works on wild Whitish Fangs.",ep:0,g:755,l:1,wd:false,fm:true,w:0,p:1};
I[10085] = {n:"Order of Execution",t:87,d:"There\'s no mistaking the orders. Go and find the target.",ep:0,g:2,l:10,wd:false,fm:true,w:1,c:"Ps!0&PP>0",u:true,p:0};
I[10086] = {n:"Plain Bandit Canine Tooth",t:24,d:"The fight with the Plain Bandits was so violent that one of them lost a tooth.",ep:0,g:13,l:1,wd:false,fm:true,w:0,p:1};
I[10087] = {n:"Xarthan\'s Meeting",t:24,d:"This note was written by a Brakmarian. It says that Xarthan is to come to the Tower of Bonta after his next meeting. That means that he may be already there.",ep:0,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[10088] = {n:"Used Handkerchief",t:24,d:"You found this handkerchief during your battle with Xephires. It\'s a nice little souvenir, and could come in handy if you get a cold. You could also make a knot hat out of it, if you don\'t mind looking a bit crazy.",ep:0,g:756,l:1,wd:false,fm:true,w:0,p:1};
I[10089] = {n:"Crate of Merchandise",t:24,d:"Xephires asked you to deliver this crate of merchandise to Counsellor Boyowa, at Grandapan\'s place, to show your \'goodwill\'. You\'re not sure what\'s in there, but you know whatever it is valuable.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[10090] = {n:"Nara\'s List of Supplies",t:24,d:"Nara made a list of what he needs for his new forge.  20 Oak Wood, 1 Sulphur Pouch, 30 Iron, 1 Kouartz, 5 Bakelelite and 10 Wild Plain Boar Leather.",ep:0,g:41,l:1,wd:false,fm:true,w:0,p:1};
I[10091] = {n:"Notes on Erazal\'s Malediction",t:24,d:"Erazal\'s Malediction indicates how to bring a soul back to life against its will. You\'ll need 1 unit of Phoenix Blood, 5 units of Magical Cure and 1 Lear Amulet, from a Treechnid and Dark Treechnid corpses.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10092] = {n:"Cancellation Order",t:24,d:"This letter, dated to a few hours ago, tells that the assault on Bonta has been cancelled due to improvements to their militiamen\'s equipment, and the capture of the traitor Xephires.",ep:0,g:33,l:1,wd:false,fm:true,w:0,p:1};
