I[10102] = {n:"Vampyre Mask",t:16,d:"This mask will protect you from the sun if nothing else.",ep:0,g:244,l:42,wd:true,fm:true,w:10,c:"PO!10119",s:130,p:4725};
I[10103] = {n:"Letter for Fidji Merline",t:24,d:"Ebru Of El entrusted you with this letter for Fidji Merline. You have to follow the Brakmarian Handywoman\'s instructions exactly.",ep:0,g:65,l:1,wd:false,fm:true,w:0,p:1};
I[10104] = {n:"Modified Manger",t:24,d:"This manger was modified to hide aubergines. You really don\'t want to be stuck on top of a mount who has eaten from it. The gases released by the excessive consumption of aubergines have been known to lead to horrific accidents.",ep:0,g:759,l:1,wd:false,fm:true,w:0,p:1};
I[10105] = {n:"Hairy Leg",t:24,d:"This leg is covered in Arachnee and Bow Meow hairs and can make a frightening weapon when Shush Tercesasti is confronted with it.",ep:0,g:11,l:1,wd:false,fm:true,w:0,p:1};
I[10106] = {n:"Vampyrina",t:18,d:"This terrifying creature takes cruel pleasure in sucking the blood out of her victims, and you\'ll be next if you\'re not careful. What she likes most of all, though, is sinking her teeth into a big filthy Skeleton and nibbling every last edible morsel off their bones. We told you she was terrifying.",ep:0,g:53,l:1,wd:true,fm:true,w:1,p:1};
I[10107] = {n:"Borbat",t:18,d:"This pet had a long, hard childhood, starting with its name. Maybe all this explains why its only obsession in life is killing Ouassingues and eating anything left on their bones.",ep:0,g:54,l:1,wd:true,fm:true,w:1,p:1};
I[10108] = {n:"Vampyrina Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:53,l:1,wd:true,fm:true,w:1,p:1};
