I[10118] = {n:"Newly Tamed Whitish Fang",t:32,d:"This Whitish Fang was trained according to Roy Sigfred\'s canine training technique.",ep:0,g:23,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10119] = {n:"Ghoulified",t:30,d:"All of a sudden you feel different...",ep:0,g:1,l:1,wd:false,fm:true,w:0,m:true,c:"POX10055&POX10054&POX10056&POX10061&POX10058&POX10102",p:0};
I[10120] = {n:"Description of a stranger",t:24,d:"Robin Gaywould wrote down the description of the stranger who was talking to Kit Dingaround. Strangely, it doesn\'t match the description he gave you when he first told you. Something\'s not quite right here...",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10121] = {n:"Little Pebble",t:51,d:"This little pebble\'s purpose is to activate the magic tiles and awaken the water spirit. It\'s easy to use, simply place the pebble on a tile and the magic will do the rest. Simple and effective. Even a Iop could do it, as long as there\'s no enemy around for them to throw the pebble at.",ep:0,g:267,l:1,wd:false,fm:true,w:1,p:1};
I[10122] = {n:"Nurb\'s List",t:24,d:"Norb made a list of what you have to bring to Nara. You\'ll need 2 Bakelelite, 10 Manganese, 20 Bauxite, 15 Dolomite and 20 Oliviolet Wood.",ep:0,g:41,l:1,wd:false,fm:true,w:0,p:1};
I[10123] = {n:"Gnirreh",t:32,d:"You need to escort this Sram to Amayiro, and quickly, because his stench is attracting Bow Meows from all over town.",ep:0,g:9,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10124] = {n:"Hypnomeow",t:32,d:"You must take this Hypnomeow to Roy Sigfred, the Hypnomeow trainer. Be very careful not to look this terrible creature in the eyes, or you might fall under its spell and become as stupid as an Eniripsa.",ep:0,g:6,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10125] = {n:"Bandit Archer Bow",t:2,d:"This bow belonged to a bandit archer of old who used it to finish his victims off from a distance, so as not to get his clothes dirty. The magic which animates it is of such power that it can turn the heart of a saint into the gut of a daring bandit archer.",ep:0,g:67,l:30,wd:true,fm:false,w:10,an:10,tw:true,e:[2,6,3,5,40,40,false,true],p:3000};
I[10126] = {n:"Swashbuckling Bandit Sword",t:6,d:"This sword belonged to a legendary swashbuckler who couldn\'t stand chasing after his enemies. He learnt how to creep and crawl, and then took to cutting their legs off in the night. The magic which animates it is of such power that it can turn the heart of a saint into the gut of a daring swashbuckler.",ep:0,g:92,l:30,wd:true,fm:false,w:10,an:14,tw:true,e:[5,5,1,1,40,40,false,false],p:3000};
I[10127] = {n:"Wandering Bandit Staff",t:4,d:"The wandering bandit who used to own this staff was terrible for the drink, and used to use his trusty pole to hold himself up while he practiced his noble profession - picking pockets.  The magic which animates it is of such power that it can turn the heart of a saint into the gut of a daring bandit.",ep:0,g:89,l:30,wd:true,fm:false,w:10,an:12,e:[5,6,1,1,40,40,false,false],p:3000};
