I[10131] = {n:"Gift: Vampyrina",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10132] = {n:"Gift: Borbat",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10133] = {n:"Bandit Sorcerer\'s Wand",t:3,d:"Long, long ago this wand belonged to a Bandit Sorcerer who used it to reduce his enemies to ashes. The magic which animates it is of such power that it can turn the heart of a saint into the gut of a daring Bandit Sorcerer.",ep:0,g:72,l:30,wd:true,fm:false,w:10,an:11,tw:true,e:[2,5,2,4,40,40,false,true],p:3000};
