I[10155] = {n:"Amlugo",t:1,d:"This amulet is meant to protect you from random beheadings, but it increases your chances of dying from a random hanging.",ep:0,g:147,l:43,wd:true,fm:true,w:10,s:134,p:5030};
I[10156] = {n:"Slugo",t:11,d:"These slippers are more comfortable than your average footwear, but it\'s hard to say why... perhaps the parasites that infest them massage your feet.",ep:0,g:140,l:41,wd:true,fm:true,w:10,s:134,p:4575};
I[10157] = {n:"Belugo",t:10,d:"This belt was made using the leftovers from spools of Flax String. It ties up rubbish bags too.",ep:0,g:157,l:43,wd:true,fm:true,w:10,s:134,p:5025};
I[10158] = {n:"Trophy Dark Vlad Shield",t:82,d:"Hold it high and proud, because this trophy is all that will be left of your glory when you\'re gone.",ep:0,g:43,l:1,wd:true,fm:false,w:1,ce:true,p:1};
