I[10168] = {n:"Chisp Boots",t:11,d:"Ponch polished his boots every morning before mounting his Dragoturkey and leaving on missions to save widows and orphans. Especially widows... Ponch was quite the charmer.",ep:0,g:141,l:42,wd:true,fm:true,w:10,s:138,p:4850};
I[10169] = {n:"Chisp Shield",t:82,d:"Ponch proudly wore this shield as he sat mounted on his Dragoturkey and ensured the safety of the streets of Bonta.",ep:0,g:41,l:1,wd:true,fm:true,w:10,s:138,p:4800};
I[10170] = {n:"Chisp Helmet",t:16,d:"This helmet will protect the skull of its wearer should they fall off a Dragoturkey. It also makes you look like an idiot, even if you aren\'t one.",ep:0,g:246,l:40,wd:true,fm:true,w:10,s:138,p:4400};
I[10171] = {n:"Chisp Fingerless Gloves",t:9,d:"These leather fingerless gloves are perfect for dishing out a first-class spanking.",ep:0,g:173,l:44,wd:true,fm:true,w:10,s:138,p:4800};
I[10172] = {n:"Slugly Amulet",t:1,d:"This amulet will feed a vorpal slug for two days, or three days if it accompanied by a puree of your head.",ep:0,g:148,l:42,wd:true,fm:true,w:10,s:137,p:4900};
I[10173] = {n:"Slugly Boots",t:11,d:"The soles of these boots are covered with a sticky slime and the interior is filled with a slippery slime. At least it\'s not the other way round.",ep:0,g:142,l:39,wd:true,fm:true,w:10,s:137,p:4105};
I[10174] = {n:"Slugly Cloak",t:17,d:"The pores of this cape exude a sticky slime. You\'ll look classy if you lie on your back and let it carry you along the floor.",ep:0,g:169,l:42,wd:true,fm:true,w:10,s:137,p:4800};
I[10175] = {n:"Slugly Helmet",t:16,d:"This slimy, dripping helmet will nourish your scalp and keep your hair shiny, if not healthy. The two eyes attached to the top can be connected to your skull if you agree to have the nerve endings inserted into your ears.",ep:0,g:247,l:42,wd:true,fm:true,w:10,s:137,p:4800};
I[10176] = {n:"Old, worn-out book",t:24,d:"This book\'s cover is as worn and as wrinkled as the skin of a centenarian Enutrof. A quick look inside is enough to confirm that it is intended for Iops. There are very few words, but lots of pictures, because everybody knows that the average Iop is illiterate, just like the newly incarnated souls in Astrub.",ep:0,g:763,l:1,wd:false,fm:true,w:0,p:1};
I[10177] = {n:"Dark Treechnid Dark Bark",t:24,d:"Darker than Dark Treechnid bark, this bark owes its brilliance to the unsavoury substances released by the Dark Treechnid\'s body. It is these same substances that give it its mysterious powers.",ep:0,g:231,l:1,wd:false,fm:true,w:0,p:1};
I[10178] = {n:"Carved Dark Bark",t:24,d:"In order not to damage it, you placed the carved dark bark into this box.",ep:0,g:56,l:1,wd:false,fm:true,w:0,p:1};
I[10179] = {n:"Bloody Master Vampire\'s Tight-fitting Leather Briefs",t:24,d:"To protect himself from critical hits at critical points, the Bloody Vampire Master uses his leather briefs when he goes hunting. These briefs also protect critical areas from sunburn.",ep:0,g:621,l:1,wd:false,fm:true,w:0,p:1};
I[10180] = {n:"The Esteban",t:1,d:"This medallion acts as the key to a mysterious, forgotten city.",ep:0,g:149,l:42,wd:true,fm:true,w:10,s:136,p:4800};
I[10181] = {n:"Solaris Ring",t:9,d:"This ring was found in a mysterious city where nobody knew of its existence until they began frantically searching for it.",ep:0,g:174,l:41,wd:true,fm:true,w:10,s:136,p:4600};
I[10182] = {n:"Solaris Shield",t:82,d:"This shield will reflect the sun right into the eyes of your opponent. Instead of dazzling them with your blinding wit, blind them with this dazzling shi...eld.",ep:0,g:42,l:1,wd:true,fm:true,w:10,s:136,p:4750};
I[10183] = {n:"Solaris Mask",t:16,d:"This mask will capture the sunlight and concentrate it on your face so you can stay nice and brown all year round, even if you live to the North of Amakna.",ep:0,g:248,l:42,wd:true,fm:true,w:10,s:136,p:4750};
I[10184] = {n:"Noke\'s Mask",t:16,d:"Noke loved to put on this mask and hide in the woods to terrify lost ramblers. She died a long time ago after seeing her reflection in a puddle.",ep:0,g:249,l:42,wd:true,fm:true,w:10,s:135,p:4700};
I[10185] = {n:"Noke\'s Cloak",t:17,d:"Noke dreamt of becoming a big, bad wolf. Sadly, with this cloak on her shoulders, she was more like one of the three little pigs.",ep:0,g:170,l:41,wd:true,fm:true,w:10,s:135,p:4600};
I[10186] = {n:"Noke\'s Necklace",t:1,d:"This boar-tooth necklace will terrify boars, and by extension, your mother-in-law.",ep:0,g:150,l:41,wd:true,fm:true,w:10,s:135,p:4525};
I[10187] = {n:"Noke\'s Daggers",t:5,d:"A long time ago, there was an aggressive boar that dreamt of becoming a stag. These daggers were used to carve it up.",ep:0,g:76,l:41,wd:true,fm:true,w:10,an:13,tw:true,e:[12,3,1,1,30,45,false,false],c:"CS>50&CW>50&CV>80",s:135,p:4000};
I[10188] = {n:"Oxo Helmet",t:16,d:"This helmet has a very useful device which helps you translate the Oxon language. It\'s also soundproof.",ep:0,g:250,l:43,wd:true,fm:true,w:10,s:133,p:5075};
I[10189] = {n:"Oxo Ring",t:9,d:"This ring used to belong to the Oxon King. He liked to play with the sunbeams reflecting on the ring and used to say " + "\"" + "Watch out for the Oxon Laser!\'" + "\"" + "",ep:0,g:175,l:37,wd:true,fm:true,w:10,s:133,p:3875};
I[10190] = {n:"Oxo Boots",t:11,d:"Don\'t forget to put these boots on when you have your heads in the clouds, they\'ll keep you high. Even though they\'re cool, don\'t wear them to go dancing if you want to keep your feet on the ground.",ep:0,g:143,l:38,wd:true,fm:true,w:10,s:133,p:3925};
I[10191] = {n:"Oxo Belt",t:10,d:"This belt is perfect when you need to rest and digest your granny\'s Oxo Bucco.",ep:0,g:158,l:37,wd:true,fm:true,w:10,s:133,p:373};
I[10192] = {n:"Gift: Siks Wonn Ein Cape",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
