I[10195] = {n:"Gift: Siks Wonn Ein Boots",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10196] = {n:"Location of the Ecaflip tile",t:24,d:"According to Grizmine, the Ecaflip tile is at the centre of Minotoror Island.\nOnly an Ecaflip equipped with an Ecaflip\'s Luck and having a Piece of the Crackpot Treasure can open the cave by standing on the tile.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10197] = {n:"Location of the Xelor tile",t:24,d:"Kwartzwatch hid the Xelor tile somewhere in the village of Feudala.\nOnly a Xelor equipped with a Xelor\'s Past and having a Temporal Powder can open the cave by standing on the tile.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10198] = {n:"Location of the Enutrof tile",t:24,d:"According to Annapelle, her husband Nystig buried the Enutrof tile north-east of their house at the foot of a Dragoturkey statue.\nOnly a Enutrof equipped with an Enutrof\'s Memento and having a Crackler\'s Golden Tooth can open the cave by standing on the tile.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10199] = {n:"Notes concerning Nosilla Budois\' vision",t:24,d:"According to Nosilla Budois, the Spirit of Light would have crossed the Amakna Forest and the mountains to settle in what appears to be the Cemetery of the Tortured. Nosilla also spoke of a city with an alchemist\'s house, an Eniripsa standing in front of it, and of a Sadida making dolls. You have noted the description.",ep:0,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[10200] = {n:"Spirit of Light",t:32,d:"This Spirit of Light is not very radiant. Apparently, being torn from his hammer has tarnished his lustre. You\'d better hurry and take him to Ebru Of El.",ep:0,g:26,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10201] = {n:"Plain Boar",t:32,d:"it seems that this Plain Boar is too fat, or too sick, or both. Anyway, it decided not to follow you and so you have to drag it along behind you, which slows you down considerably. In addition, it seems ready to leave at the slightest opportunity.",ep:0,g:27,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10202] = {n:"Stolen Fragment of Time",t:24,d:"This Fragment of Time was stolen from Xelor\'s Clock by the Demons of the Hours. It would be best not to boast about possessing such an object if you want to avoid the wrath of said god.",ep:0,g:801,l:1,wd:false,fm:true,w:0,p:1};
I[10203] = {n:"Torn up mission papers",t:24,d:"This piece of torn paper indicates the end of a mission: " + "\"" + "... and take him to the Brakmar jail for interrogation." + "\"" + "\nIt looks like it was lost quite recently.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10204] = {n:"How to access Dardondakal\'s lair",t:24,d:"To enter the lair of Dardondakal, hidden in the Cania Forest, you will need: 10 White Dreggon Shells, 5 White Dreggon Eggs and 1 Dreggon Warrior Skin.",ep:0,g:55,l:1,wd:false,fm:true,w:0,p:1};
I[10205] = {n:"Wyrmwell",t:24,d:"Who would have thought that a Wyrmwell belonging to a dragon could look so mundane? Surely not you.",ep:0,g:46,l:1,wd:false,fm:true,w:0,p:1};
I[10206] = {n:"Sacred Water",t:24,d:"This water comes from an underground source in Akwadala. The alcohol vapours continuously steaming from it confirm its sacred nature.",ep:0,g:764,l:1,wd:false,fm:true,w:0,p:1};
I[10207] = {n:"Bunch of Keys",t:24,d:"The long bits on these keys are very flexible, but they soon lose their agility, and only regain their magical properties after a week. With this bunch in your pocket, you\'ll be able get through any dungeon door you like.",ep:0,g:774,l:1,wd:false,fm:true,w:0,p:0};
I[10208] = {n:"Pandawa Elixir",t:12,d:"A good slug of this and you\'ll be teleported to your class temple. Known side effects: hiccups, apparition of in-laws, hair-loss, dog breath, untied shoelaces, successive red traffic lights.",ep:0,g:153,l:1,wd:true,fm:true,w:1,c:"PG=12",u:true,p:0};
