I[10220] = {n:"Dontase Mebro Shovel instruction manual",t:24,d:"This book, translated into 198 languages and dialects, explains how and under what circumstances to use the Dontase Mebro Shovel. The pages written in Bwork and Iop are also the ones with most pictures.",ep:0,g:95,l:1,wd:false,fm:true,w:0,p:1};
I[10221] = {n:"Transmuted Water",t:15,d:"This water, transmuted by Dragonsly, is a mix of Sacred Water and Moon Water. The result is simply... surprising.",ep:0,g:769,l:1,wd:false,fm:true,w:1,p:1};
I[10223] = {n:"Dontase Mebro Shovel",t:8,d:"This shovel is primarily intended for medical use, despite being used very controversially by the Enutrof known as Resat as a weapon of self defence.",ep:0,g:10,l:40,wd:false,fm:true,w:25,an:16,tw:true,e:[15,4,1,1,50,50,false,false],p:1000};
I[10224] = {n:"Lost thought",t:24,d:"This chrysalis contains a thought lost by Solar, and a beautiful golden flutterthought will soon hatch from it, as long as it is not destroyed or sold beforehand.",ep:0,g:765,l:1,wd:false,fm:true,w:0,p:1};
I[10227] = {n:"Sponge Mob Spiritual Gem",t:85,d:"This gem is awarded after a certain number of victories in duels, and it contains the soul of a monster. Keep in a cool, dry, dark place, away from strong odours. Shake well before use.",ep:0,g:2,l:1,wd:true,fm:true,w:1,u:true,p:0};
