I[10271] = {n:"Sag Dratsum\'s list",t:24,d:"Sag Dratsum has told you the items you need for a tailor to make a Sag Mask.\n6 Invisible Fabric, 2 Rutile, 20 Hemp Fibre, 1 Plain Pikoko Nut and 50 Black Gobbly Leather.",ep:0,g:41,l:1,wd:false,fm:true,w:0,p:1};
I[10272] = {n:"Sag Mask",t:15,d:"Sag was a ingenuous Enutrof who wasn\'t afraid of anything. This mask allowed him to survive in the foul air of Brakmar\'s deepest mines. He had forgotten, however, that even though the seal is tight, this mask does not protect from volcanic eruptions.",ep:0,g:772,l:1,wd:false,fm:true,w:1,p:1};
I[10274] = {n:"Sacrier\'s Tears",t:24,d:"This water comes from a pool created by the tears of the goddess Sacrier. Apart from its origin, nothing distinguishes it from conventional water, except for its slight salty taste.",ep:0,g:764,l:1,wd:false,fm:true,w:0,p:1};
I[10275] = {n:"Stroken",t:24,d:"Behind the strange name, a few tough fights surely hide... You win them in battle and you trade them with one of the Sacre siblings in the militias of the rival cities.",ep:0,g:766,l:1,wd:true,fm:true,w:0,p:0};
I[10276] = {n:"Ticket to the Isle O\'Anstitch",t:15,d:"This ticket entitles you to a round trip to the Isle O\'Anstitch. It is only valid with Nikos Monote, in Cania Bay.",ep:0,g:770,l:1,wd:false,fm:true,w:1,p:1};
I[10277] = {n:"Danathor\'s instructions",t:24,d:"These are Danathor\'s instructions on how to forge the Dawn Shard.\nUse the tickets to the Isle O\'Anstitch with Nikos Monote in Cania Bay.\nRetrieve a Frozen Crystal and make a Frost Potion with it, and use the Wyrmwell in a cave to get the Memory Fragments.\nTravel to the island\'s heart to forge the Dawn Shard.\nYou\'ll need the help of a member of the Order of the Salvatory Spirit who is at least a Follower of Writing, a Xelor who knows the spell \'Clock\', and a Sacrier who knows the spell \'Flying Sword\'.\nThe following master craftsmen are necessary, and the same person may hold several jobs: Jewelmagus and Jeweller, Staff Carver and Staff Carvmagus, Dagger Smith and Dagger Smithmagus, Alchemist.\nUse 5 Diamond Stones, 1 Crystal, 1 Mother of Pearl and 1 Tsunami Potion.\nTake the Dawn Shard to Danathor.",ep:0,g:26,l:1,wd:false,fm:true,w:0,p:1};
I[10278] = {n:"Crocabulia Spiritual Gem",t:85,d:"This gem is awarded after a certain number of victories in duels, and it contains the soul of a monster. Keep in a cool, dry, dark place, away from strong odours. Shake well before use.",ep:0,g:2,l:1,wd:true,fm:true,w:1,u:true,p:0};
I[10279] = {n:"Frozen Crystal",t:15,d:"This crystal is formed from condensed ice and phlegm. It would be better not expose it to too high a temperature or it could melt and stain your inventory.",ep:0,g:98,l:1,wd:false,fm:true,w:1,p:1};
I[10280] = {n:"Frost Potion",t:12,d:"This potion will instantly freeze any liquid it comes into contact with. There is only a small amount because the ingredients necessary for its preparation are difficult to obtain.",ep:0,g:82,l:1,wd:false,fm:true,w:1,p:1};
I[10281] = {n:"Memory Fragments",t:24,d:"If one day you were told that it was possible to steal a fragment of memory, and forge a weapon with it, you wouldn\'t have believed it. Now that you\'re telling this story, it\'s others who don\'t believe it.",ep:0,g:802,l:1,wd:false,fm:true,w:0,p:1};
I[10283] = {n:"Dawn Shard",t:24,d:"The magic from this weapon is so powerful that you can feel it vibrating in the air. If Jiva wasn\'t renowned for being such a fierce fighter, you might think that this object was intended for other use altogether... if thoughts like that ever reached Danathor\'s ears, you\'d end up being stoned to death in a public square.",ep:0,g:803,l:1,wd:false,fm:true,w:0,p:1};
I[10284] = {n:"Kitsou Entrails",t:15,d:"At first glance, these entrails are definitely not very appetising. At second glance, even less so.",ep:0,g:445,l:50,wd:false,fm:true,w:1,p:1};
I[10285] = {n:"Motor Pike",t:49,d:"Ah, Motor Pike, what a delicious fish dish. It\'s even better if accompanied by a Side Carp.",ep:0,g:132,l:1,wd:false,fm:true,w:1,p:140};
I[10287] = {n:"The Four Bandit Brothers\' Magic Formula",t:24,d:"This magic formula was elaborated by the four bandit brothers: Smirkerth, Amlock, Dusolair and Firetellini. It will allow you to rob your enemies or young fans without a trace! \nOnce the formula is pronounced, its effects will spread to the World of Twelve... before fading away.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:0};
