I[10552] = {n:"Ughat",t:16,d:"This headwear will keep your ears protected from cold and bad jokes.",ep:0,g:245,l:41,wd:true,fm:true,w:10,s:134,p:4525};
I[10553] = {n:"Toot\'s Helmet",t:16,d:"Only a Gobbowl player would come up with the crazy idea of disguising themselves as a Tofu to intimidate their opponent. Mind you, this helmet\'s aerodynamic shape allows the wearer to slice through the air like a missile. Maybe it\'s not such a crazy idea after all. Well, whatever, you\'ll certainly stand out from the crowd.",ep:0,g:252,l:41,wd:false,fm:true,w:10,s:142,p:4550};
I[10554] = {n:"Benji\'s Helmet",t:16,d:"It\'s the integrated red sunglasses that make this the helmet of choice for any self-respecting Lamechester United player.",ep:0,g:253,l:41,wd:false,fm:true,w:10,s:143,p:4550};
I[10555] = {n:"Real Gobbly Shield",t:82,d:"This imposing shield bears the marks of many a Gobbowl match. However, despite its robust, intimidating appearance, it\'d be of no use at all in a real fight. You\'d be better off using it to play peek-a-boo with Gobblies.",ep:0,g:54,l:1,wd:false,fm:true,w:10,c:"PP>0",s:142,p:1};
I[10556] = {n:"Lamechester United Shield",t:82,d:"This imposing shield perfectly sums up today\'s youth: style over substance - all bark, and no bite. It\'d be good for nothing in a real fight, unless your opponent was coming at you with a ball.",ep:0,g:53,l:1,wd:false,fm:true,w:10,c:"PP>0",s:143,p:1};
I[10557] = {n:"Real Gobbly Glove",t:9,d:"This battered old glove helps you catch Gobbowl balls, or any other round thing covered in wool, for that matter. What you do with it as result concerns you, and you only...",ep:0,g:176,l:43,wd:true,fm:true,w:10,s:142,p:4500};
I[10558] = {n:"Lamechester United Glove",t:9,d:"With this glove on your hand, you can pretend you\'re a famous Gobbowl player when you\'re playing fetch with your BowWow.",ep:0,g:177,l:43,wd:true,fm:true,w:10,s:143,p:4500};
I[10559] = {n:"Toot\'s Belt",t:10,d:"Gobbowl matches are brutal, and this belt was designed to protect players from muscular blows. However, you can also use it as a life-belt when you\'re taking a bath. Who\'d have thought?",ep:0,g:159,l:41,wd:false,fm:true,w:10,s:142,p:4600};
I[10560] = {n:"Monty\'s Belt",t:10,d:"They say that Gobbowl is a game for real men. This belt\'s for real men too, with plenty of protective padding to soften low blows. It\'s also great for training young Srams.",ep:0,g:160,l:41,wd:false,fm:true,w:10,s:143,p:4600};
I[10561] = {n:"Real Gobbly Boots",t:11,d:"These boots have been around for a while, you can certainly smell that. Plant them on your feet and you\'ll look just like a real Gobbowl player. Plant their crampons in the rump of a few Gobblies, and the fans will come flocking.",ep:0,g:144,l:42,wd:false,fm:true,w:10,s:142,p:4825};
I[10562] = {n:"Lamechester United Boots",t:11,d:"" + "\"" + "Fashionable footwear feeds fascinated fan\'s frenzy" + "\"" + ", reads the latest headline, and for once, the papers aren\'t wrong. When properly polished, these boots help make it look like your opponent pushed you over, when in fact, you slipped. Congratulations! You\'ve just learnt one of the basics of Gobbowl.",ep:0,g:145,l:42,wd:false,fm:true,w:10,s:143,p:4825};
