I[10598] = {n:"Gift: Jellufo",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:0,g:42,l:1,wd:true,fm:true,w:1,u:true,p:1};
