I[10621] = {n:"The Sacre\'s Orders",t:24,d:"This torn piece of paper lists all the instructions of the Sacre Family. They are quite simple. They order you to track and execute a target. And do not come back before 10 minutes after the fight.",ep:0,g:176,l:1,wd:true,fm:true,w:0,p:0};
I[10622] = {n:"Grute\'s Sword",t:6,d:"This sword allowed Grute the Bwork to cut his opponents\' nuts in two, which is usually enough to make anyone give up a fight. This magical weapon is still imbued with the personality of Grute. If you equip it, you may well become him.",ep:0,g:94,l:41,wd:true,fm:false,w:10,an:0,e:[5,5,1,1,50,50,false,false],s:144,p:4600};
I[10623] = {n:"Grute\'s Amulet",t:1,d:"Grute the Bwork wasn\'t very smart. In fact, he was as thick as two short planks. Fortunately, traditional teaching methods work equally well on Bworks than on children. After a few well-deserved strokes of the cane over the years, Grute became a real little brute.",ep:0,g:153,l:42,wd:true,fm:true,w:10,s:144,p:4900};
I[10624] = {n:"Grute\'s Belt",t:10,d:"Those who have had to face Grute the Bwork will tell you, " + "\"" + "Don\'t bother aiming for the head, it\'s empty" + "\"" + ". This advice also applies to all those who face Iops, Goblins or mothers-in-law.",ep:0,g:163,l:40,wd:true,fm:true,w:10,s:144,p:4300};
I[10625] = {n:"Grute\'s Boots",t:11,d:"Grute\'s Boots give off such a pungent aroma that you\'ll be able to knock your opponents out with one quick kick to their head. These boots were forbidden in combat situations by the Sufokia Convention a long time ago, a convention which, it has to be said, has saved many, many lives.",ep:0,g:150,l:44,wd:true,fm:true,w:10,s:144,p:5250};
I[10626] = {n:"Koksiks\' Sword",t:6,d:"The life of a Chafer Foot Soldier is not as rosy as you\'d think. Although I\'m not sure you\'ve ever thought about it. Iop knows I\'ve never thought of it myself, the life of a good, long, tall, strong Chafer Foot Soldier like Koksiks. In fact, I often lie awake at night, not thinking of the life of a Chafer Foot Soldier. Wonderful lads.\nAnyway, enough of that. This sword is still infused with the spirit of Koksiks, and by equipping it, you could become him.",ep:0,g:95,l:41,wd:true,fm:false,w:10,an:0,e:[5,5,1,1,50,50,false,false],s:145,p:4600};
I[10627] = {n:"Koksiks\' Ring",t:9,d:"This ring belonged to Koksiks himself, and a lovely ring it is too. He let me have it once... but took it back some months later. Ahh. When I think of it now...",ep:0,g:179,l:41,wd:true,fm:true,w:10,s:145,p:4650};
I[10628] = {n:"Koksiks\' Boots",t:11,d:"You should have seen Koksiks go in these boots. A sight to behold he was. Dancing. We danced once, but that was... a long time ago.",ep:0,g:149,l:42,wd:true,fm:true,w:10,s:145,p:4800};
I[10629] = {n:"Koksiks\' Belt",t:10,d:"Chafer Koksiks the infantryman had two dreams in life: to climb Crackler mountain and to become a full-time minstrel. Life was very cruel to him - he ended up playing support for Jon Lemon... who made his name, and his entire career, playing unpaid charity gigs.",ep:0,g:164,l:42,wd:true,fm:true,w:10,s:145,p:4900};
I[10630] = {n:"Goboff\'s Staff",t:4,d:"This staff looks very much like a lance... in fact, Goboff the Goblin used it to cut the tops off his boiled Giant Tofu eggs, back when the birds existed. What he used for toast soldiers is anyone\'s guess. \nThis magic weapon is still imbued with the spirit of Goboff. If you equip it, you could perhaps become him.",ep:0,g:90,l:43,wd:true,fm:false,w:10,an:0,e:[10,5,1,1,50,50,false,false],s:146,p:5040};
I[10631] = {n:"Goboff\'s Amulet",t:1,d:"A popular saying amongst Goblins is " + "\"" + "Sometimes you get the bear, sometimes the bear gets you" + "\"" + ". If you look at Goblins closely, this saying is better summarised as " + "\"" + "Sometimes the bear gets you" + "\"" + ".",ep:0,g:152,l:42,wd:true,fm:true,w:10,s:146,p:4837};
I[10632] = {n:"Goboff\'s Belt",t:10,d:"Goboff the Goblin loved to gobble rotten eggs. His digestive tract might have been able to deal with this atrocious habit, but those unlucky enough to get a whiff of his foul breath weren\'t, and fell like Moskitoes. Those unlucky enough not to be rendered unconscious immediately would grab onto this belt to stop themselves hitting the floor.",ep:0,g:165,l:42,wd:true,fm:true,w:10,s:146,p:4800};
I[10633] = {n:"Goboff\'s Ring",t:9,d:"Goboff the Goblin was a keen gardener. He loved nothing more than whacking trespassers around the head with his rake. He found this ring on the finger of an impudent rambler who\'d dared to trample his Salad leaves.",ep:0,g:180,l:44,wd:true,fm:true,w:10,s:146,p:5250};
I[10634] = {n:"Lektor\'s Bow",t:2,d:"Kanniball Lektor used this weapon to hunt his prey, and send a few arrows his children\'s\' way when he was in a playful mood. This magic weapon is still imbued with the spirit of Kanniball Lektor. If you equip it, you could perhaps become him.",ep:0,g:68,l:41,wd:true,fm:false,w:10,an:0,tw:true,e:[10,5,1,5,30,50,false,false],s:147,p:2000};
I[10635] = {n:"Lektor\'s Amulet",t:1,d:"When the two small balls attached to this amulet collide, they produce a slight rattling noise, which means a Kanniball is very close by. When you hear this noise, it is usually too late to escape, but there is still time to choose which sauce you want to be devoured with.",ep:0,g:151,l:41,wd:true,fm:true,w:10,s:147,p:4525};
I[10636] = {n:"Lektor\'s Ring",t:9,d:"The ring is infused with secret spices, used for flavouring broth when stirred by hand. The spices are so good that once you put the ring on, there\'s a real risk you\'ll bite your own fingers off, they\'ll be that tasty.",ep:0,g:178,l:42,wd:true,fm:true,w:10,s:147,p:4837};
I[10637] = {n:"Lektor\'s Boots",t:11,d:"Kanniball Lektor wore these boots for several years before trading them in for a tourist on Moon Island. Look, he was hungry, alright?",ep:0,g:148,l:43,wd:true,fm:true,w:10,s:147,p:5050};
I[10638] = {n:"Stroy Zemol\'s Sword",t:6,d:"Pandit Stroy Zemol used to hit his adversaries with the flat of this weapon\'s blade in order to knock them out without causing a scratch. Cursed for years with taunts about his name, the Pandit did not want to destroy them all, just render them unconscious for a while. This weapon is still infused with the spirit of Stroy Zemol, and by equipping it, you could become him.",ep:0,g:93,l:41,wd:true,fm:false,w:10,an:0,e:[3,5,1,1,30,50,false,false],s:148,p:4600};
I[10639] = {n:"Stroy Zemol\'s Amulet",t:1,d:"Stroy Zemol had a sister, Faye Pworme. She liked travelling alone and exploring dark, foul-smelling tunnels.",ep:0,g:154,l:41,wd:true,fm:true,w:10,s:148,p:4525};
I[10640] = {n:"Stroy Zemol\'s Belt",t:10,d:"This belt is allegedly reversible, only no one\'s ever dared try it as they don\'t want to be the first to discover that it isn\'t actually reversible.",ep:0,g:161,l:40,wd:true,fm:true,w:10,s:148,p:4475};
I[10641] = {n:"Stroy Zemol\'s Boots",t:11,d:"Stroy Zemol made these boots himself, from a few blocks of wood and a little bit of fabric. They might not look like other boots, but blimey, they\'re certainly magical nevertheless.",ep:0,g:147,l:41,wd:true,fm:true,w:10,s:148,p:4550};
I[10642] = {n:"Fyred Ampe\'s Pickaxe",t:21,d:"Fyred Ampe the Dark Miner used this pickaxe to carve out the famous bottomless Kruup mine, in which Gaddie lived for several years. This weapon is still impregnated with the spirit of Fyred Ampe. By equipping it, you could become him.",ep:0,g:2,l:41,wd:true,fm:false,w:10,an:0,e:[5,5,1,1,50,50,false,false],s:149,p:4600};
I[10643] = {n:"Fyred Ampe\'s Ring",t:9,d:"When it comes into contact with warm, sticky liquids, this ring changes colour, which explains why Fyred Ampe the Dark Miner loved it so much.",ep:0,g:181,l:43,wd:true,fm:true,w:10,s:149,p:5107};
I[10644] = {n:"Fyred Ampe\'s Boots",t:11,d:"The soles of these magic boots magic allow you to shatter blocks of coal by vibrating at its resonant frequency (look it up). The user guide indicates that they are even able to vibrate on their own when Slamdance music is played nearby.",ep:0,g:146,l:41,wd:true,fm:true,w:10,s:149,p:4575};
I[10645] = {n:"Fyred Ampe\'s Belt",t:10,d:"This belt, reinforced with several different metals, was strong enough to support the weight of Fyred Ampe the Dark Miner\'s enormous sack. Don\'t worry, though, it should be just as useful for tiny packets too.",ep:0,g:162,l:43,wd:true,fm:true,w:10,s:149,p:5050};
I[10646] = {n:"Swashbuckling Bandit Amulet",t:1,d:"Boo",ep:0,g:76,l:30,wd:false,fm:true,w:1,p:1};
