I[10657] = {n:"Ogrine Seeker",t:18,d:"This strange pet is the result of cross-breeding Amakna\'s greatest truffle hunters. Its enormous snout allows it to locate Ogrine, even if it is hidden underwater. It took Otomai several years to create this beast. It is said he used it to find something he thought he\'d lost, something that had escaped from him. In doing so, he fixed one of his many mistakes. \nNo one knows for sure. What is certain is the process of hunting Ogrine is so complicated and uses so much energy, that this creature is obliged to eat monster souls to develop. It was raised on the beaches of Otomai\'s Island and will only eat the souls of the creatures that live there.",ep:0,g:56,l:1,wd:true,fm:true,w:10,p:1};
I[10658] = {n:"Ogrine Seeker Ghost",t:90,d:"This Ogrine Seeker Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:56,l:1,wd:true,fm:true,w:1,p:1};
I[10659] = {n:"Ogrine Seeker Egg",t:72,d:"This strange egg contains a tiny magical creature. Keep it warm, and it\'s sure to hatch.",ep:0,g:206,l:1,wd:false,fm:true,w:0,u:true,p:1};
I[10660] = {n:"Gift: Ogrine Seeker Egg",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10661] = {n:"Bow Kennel Certificate: Ogrine Seeker",t:77,d:"This certificate describes the characteristics of the Ogrine Seeker you\'ve put in the Bow Kennel.",ep:0,g:68,l:1,wd:false,fm:true,w:1,p:100};
I[10662] = {n:"Pa Prospe Rune",t:78,d:"This Rune will increase your luck in finding rare items.",ep:0,g:79,l:20,wd:true,fm:true,w:1,p:10};
I[10663] = {n:"Gobball-meat Pasty",t:33,d:"You\'ll need a strong stomach to swallow this pasty. The gobball meat used in it, not always the freshest cut it has to be said, gives it a flavour akin to oysters in chocolate. Bworks go mad for it.",ep:0,g:71,l:20,wd:true,fm:true,w:1,c:"Sc=1",u:true,ut:true,p:1};
I[10664] = {n:"Treechorn",t:94,d:"If you rub this tiny acorn gently, it will begin to swell, and after a short time, if you rub a little more, the treechnid trapped inside it will come bursting out.",ep:0,g:15,l:1,wd:true,fm:true,w:0,c:"Sc=2&(PB=4|PB=22|PB=33|PB=169|PB=170|PB=486|PB=168)",u:true,p:0};
I[10665] = {n:"Jorbak\'s Chest",t:94,d:"Jorbak lost his entire fortune, could it be hidden inside this strange trunk? Open it and find out.",ep:0,g:16,l:1,wd:true,fm:true,w:1,u:true,p:0};
I[10667] = {n:"Jorbak\'s Imprint",t:24,d:"You\'ve noted down when Jorbak\'s spirit will be visible. No need to rush things.",ep:0,g:251,l:1,wd:true,fm:true,w:0,p:0};
I[10668] = {n:"Jorbak\'s Good Fortune",t:28,d:"For a short time, you\'ll benefit from Jorbak\'s luck.",ep:0,g:16,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10669] = {n:"Prancing Chimera Potion",t:12,d:"That\'ll teach you to drink whatever is put in front of you!",ep:0,g:18,l:1,wd:true,fm:true,w:1,c:"Sc=4",u:true,p:0};
I[10670] = {n:"Percimol\'s Scroll",t:94,d:"As easy to follow as a Wabbit\'s Wecipe, this scroll\'s instructions reveal a bewitching secret.",ep:0,g:17,l:1,wd:true,fm:true,w:1,c:"Sc=5",u:true,p:0};
I[10673] = {n:"HmmMmmMmmm Potion",t:12,d:"HmmMmmMmmm.",ep:0,g:191,l:1,wd:true,fm:false,w:1,c:"Sc=7",u:true,ut:true,p:1};
I[10674] = {n:"Mmmmm",t:28,d:"Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.",ep:0,g:18,l:1,wd:true,fm:true,w:0,m:true,p:0};
I[10675] = {n:"Dofusian Present",t:89,d:"We won\'t spoil the surprise and tell you what\'s inside! Just have fun my friend and don\'t party too much!",ep:1,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10676] = {n:"Kill Coos Double Effect",t:28,d:"Your prospecting and your wisdom are increased for a few fights.",ep:0,g:19,l:1,wd:false,fm:true,w:0,m:true,p:0};
I[10677] = {n:"Kill Coos Shigekax",t:42,d:"Rediscover the savour and sweetness of the candy of old with this traditionally prepared sweetie.  \nThis candy increases both prospecting and wisdom by 100 points for 20 fights.",ep:0,g:32,l:1,wd:false,fm:true,w:1,c:"PO!10676",u:true,p:1};
I[10678] = {n:"How to travel without ever losing your way",t:25,d:"Arpagnagrobis wrote this book for any adventurer who doesn\'t know how to use their compass and Zaaps.",ep:0,g:10,l:1,wd:false,fm:true,w:1,u:true,p:10};
I[10679] = {n:"Primitive Potion",t:12,d:"This ethereal potion can only be consumed by the person who finds it. It will strengthen the link between their soul and their body.",ep:0,g:716,l:1,wd:false,fm:true,w:0,c:"Qf=485",u:true,p:1};
I[10680] = {n:"Goultarminator\'s Bloody Souvenir",t:24,d:"You tore this still-beating heart out of the body of Goultard\'s Evil Essence. You can now put it on your desk as a souvenir.",ep:0,g:518,l:1,wd:false,fm:true,w:0,p:1};
I[10681] = {n:"Prancing Chimera Transformation",t:31,d:"Well done!",ep:0,g:2,l:1,wd:false,fm:true,w:0,m:true,p:0};
I[10682] = {n:"Percimol\'s Secret",t:29,d:"Luck and happiness go hand-in-hand.",ep:0,g:5,l:1,wd:false,fm:true,w:0,m:true,p:0};
I[10683] = {n:"Visionary Potion",t:12,d:"This potion grants the drinker visionary talents, which allows them to find treasures more easily. Unfortunately, the effect is temporary and lasts only 10 fights.",ep:0,g:716,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10684] = {n:"Visionary Talents",t:29,d:"With these visionary talents you\'ll find treasures more easily. Unfortunately, the effect isn\'t permanent.",ep:0,g:5,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10685] = {n:"Haks Or Mask",t:16,d:"Equipped with this golden helmet, your head will soon be up for auction and worth its weight in gold.",ep:0,g:254,l:52,wd:false,fm:true,w:10,s:151,p:7325};
I[10686] = {n:"Haks Or Cloak",t:17,d:"This fabric cloak, coated with a thin layer of gold, is magical. It attracts attention and reflects light directly into the pupils of dishonest types who try to stab you from behind. Indispensable if you have Sram friends.",ep:0,g:171,l:54,wd:false,fm:true,w:10,s:151,p:7750};
I[10687] = {n:"Haks Or Ring",t:9,d:"This ring is so heavy that it greatly increases the inertia of your fist when you distribute blows to your opponents. When you begin punishing peasants, it will be virtually impossible to stop you.",ep:0,g:182,l:51,wd:false,fm:true,w:10,s:151,p:6862};
I[10688] = {n:"Haks Or Belt",t:10,d:"This belt is perfect to hang your gold bars around your waist, they\'ll pass unnoticed.",ep:0,g:166,l:53,wd:false,fm:true,w:10,s:151,p:7525};
I[10689] = {n:"Gift: Grute\'s Sword",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
