I[10715] = {n:"Creashun Powder",t:48,d:"Following the spell cast by Silouate, the Minotoror Protector of the month of Aperirel, a humble alchemist called Creashun had a flash of genius as to how to save the pets from the plague that was decimating them. While the Protector was napping one day, Creashun took advantage of his slumber to take a sample of his muscle mass and synthesised it to be used at a later date to administer to the pets and make them stronger.",ep:0,g:670,l:1,wd:true,fm:true,w:1,p:100};
I[10716] = {n:"Atooin Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:0,g:200,l:1,wd:true,fm:true,w:1,p:10};
