I[10784] = {n:"Novice Amulet",t:1,d:"No one has a clue what powers this amulet brings, but everyone knows what it takes away: your credibility.",ep:0,g:7,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10785] = {n:"Novice Ring",t:9,d:"You\'ve heard of the game " + "\"" + "Pick it, lick it, roll it, flick it" + "\"" + ", right? Well this ring will protect you from the flicked stuff.",ep:0,g:7,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10786] = {n:"Perfect Immature Koalak Skin",t:24,d:"The little immature Koalak who\'s skin you tore off didn\'t want you to treat him that way... but hey, you\'re stronger and crueller than he is.",ep:20,g:811,l:1,wd:true,fm:true,w:1,p:10};
I[10787] = {n:"Perfect Wild Ginger Dragoturkey Wing",t:24,d:"This Wing smells like sulphur. Any Dragoturkey breeder will tell you it\'s the most tender part for a barbecue. Just don\'t forget to season it because the Wing is also the most tasteless part.",ep:2,g:812,l:29,wd:true,fm:true,w:1,p:1};
I[10788] = {n:"Perfect Dragoturkey Wing",t:24,d:"The domestic Dragoturkey tastes much better than its wild cousin. It doesn\'t taste like sulphur and the meat is delightfully flavourful. That\'s why it\'s the favourite meal of all children.",ep:2,g:813,l:29,wd:true,fm:true,w:1,p:1};
I[10789] = {n:"Irritating Koalak Forester Hairs",t:24,d:"These hairs are covered in Kaliptus sap, giving them a shiny glint. Unfortunately, they cannot be used for haute couture as they smell like rotting Dragoturkey.",ep:20,g:814,l:1,wd:true,fm:true,w:1,p:100};
I[10790] = {n:"Magic Mama Koalak Bone",t:24,d:"Mama Koalak has particularly solid bones that don\'t break under her weight. The same cannot be said for the famous minstrel Jon Lemon who lost the use of both his arms when he got squashed by Mama Koalak\'s humongous thighs.",ep:20,g:815,l:1,wd:true,fm:true,w:1,p:10};
I[10791] = {n:"Irritating Brown Warko Beard Hairs",t:24,d:"These hairs will give you beard rash. They change simple Brown Warko kisses into weapons of mass destruction.",ep:20,g:816,l:1,wd:true,fm:true,w:1,p:10};
I[10792] = {n:"Novice Healing Potion",t:12,d:"This flask once contained a urine sample. Now it contains a potion that\'ll give you back some HP. Was it washed beforehand? Dare you to find out!",ep:0,g:2,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[10793] = {n:"Novice Bread",t:33,d:"It\'s bone-dry, you\'ll break your teeth on it, it smells of unwashed Bwork underpants, but it\'ll give you back some HP, so stop pulling that face and swallow it down.",ep:0,g:6,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[10794] = {n:"Novice Boots",t:11,d:"Warm on the inside and cold on the outside, these boots will let you kick snowmen\'s arses without melting their pert little buttocks.",ep:0,g:2,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10795] = {n:"Novice Fish",t:49,d:"If you hit this fish, you\'ll hear it echo. Hit yourself while you\'re eating it and you\'ll transform yourself into a musical instrument.",ep:0,g:92,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[10796] = {n:"Novice Pasty",t:69,d:"Take a small amount of anything indigestible you can find in the country of Amakna, blend it up with some red-hot spices, wrap it in rancid, sweaty pastry, and you\'ll end up with this nigh-on inedible pasty. Pushed into a young Feca\'s mouth, it makes a great dummy, though.",ep:0,g:113,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[10797] = {n:"Novice Sword",t:6,d:"Unsheathed from its scabbard, this sword can cut ham, Enutrofs, one-legged men, dancers and one-legged, Enutrof dancers wrapped in a slice of ham. Sadly though, it\'s useless for killing monsters.",ep:0,g:96,l:1,wd:false,fm:true,w:1,an:14,e:[5,4,1,1,40,50,false,false],s:150,p:1};
I[10798] = {n:"Novice Shield",t:82,d:"This shield won\'t protect you from your own stupidity.",ep:0,g:55,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10799] = {n:"Novice Belt",t:10,d:"Having problems hiding your dagger in your underwear? No problem, you can wedge it between your love handles and this belt.",ep:0,g:10,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10800] = {n:"Novice Cloak",t:17,d:"You\'ll be able to fly with this cape around your shoulders. Just close your eyes, clench your fists, open your mouth, stretch out your arms and jump off a cliff shouting " + "\"" + "I can fly!" + "\"" + ". Moments later, you\'ll wake up with two broken legs.",ep:0,g:3,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10801] = {n:"Novice Hat",t:16,d:"This shoddy hat admirably hides your baldness. Unfortunately, it\'s not big enough to hide your false modesty.",ep:0,g:2,l:1,wd:false,fm:true,w:1,s:150,p:1};
I[10802] = {n:"Golden Dragoone",t:18,d:"More golden than a Black Dragoone, less pink than a Pink Dragoone, and rarer than a Skeleton Dragoone, this pet will draw all eyes towards you, even if you\'re as ugly as a Piwi. This soul-devourer will only eat the Dopples that can be found in class temples.",ep:0,g:57,l:1,wd:false,fm:true,w:10,c:"PZ=1",s:151,p:1};
I[10803] = {n:"",t:32,d:"",ep:0,g:0,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10804] = {n:"Gift: Golden Dragoone",t:89,d:"If you shake this object vigorously and hold your ear to it, you\'ll hear a strange noise... like a tiny animal weeping... yeah, actually maybe you don\'t want to shake it... Ahhh, just open the damn thing. You\'ll find a wonderful pet inside it, as well as some food and healing Eniripsa powders.",ep:0,g:42,l:1,wd:false,fm:true,w:1,u:true,p:1};
I[10805] = {n:"Golden Dragoone Ghost Transformation",t:27,d:"You\'ve been transformed into a ghost to be able to get in the Pet Sanctuary.",ep:0,g:3,l:1,wd:false,fm:true,w:0,m:true,p:1};
I[10806] = {n:"Bow Kennel Certificate: Golden Dragoone",t:77,d:"This certificate describes the characteristics of the Golden Dragoone that you\'ve put in the Bow Kennel.",ep:0,g:69,l:1,wd:false,fm:true,w:1,p:100};
I[10807] = {n:"Golden Dragoone Ghost",t:90,d:"This Golden Dragoone Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:61,l:1,wd:false,fm:true,w:1,p:1};
I[10808] = {n:"Golden Dragoone Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:0,g:240,l:1,wd:true,fm:true,w:1,p:10};
