I[10812] = {n:"Anonymous Message",t:24,d:"" + "\"" + "If you\'re looking for easy, well-paid work, head to the north of the city, east of the Statue of the god Sram. Come alone." + "\"" + "",ep:0,g:50,l:1,wd:false,fm:true,w:0,p:1};
I[10813] = {n:"List of Names",t:24,d:"You found this list of names in Pandale Soft\'s house. It seems they\'re all Pandawas.",ep:0,g:74,l:1,wd:false,fm:true,w:0,p:1};
I[10814] = {n:"Crate for Pandette",t:24,d:"You must deliver this crate to Pandette, in Akwadala village. Its contents remain a mystery.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
