I[10827] = {n:"Larval Healing Potion",t:12,d:"A bubbly, orange liquid that no one would want to drink.",ep:0,g:192,l:1,wd:true,fm:true,w:1,c:"Sc=7",u:true,ut:true,p:0};
I[10828] = {n:"Gobbowl Helmet",t:16,d:"They say sticks and stones may break your bones, but names will never hurt you. With this helmet on, you\'ll certainly challenge that misconception...",ep:0,g:253,l:29,wd:false,fm:true,w:10,c:"Sc=10",p:2400};
I[10829] = {n:"Phishing Rod",t:20,d:"Having a dispute over money? Thanks to this rod, there\'ll only be one winner: you!",ep:0,g:91,l:40,wd:false,fm:true,w:10,an:12,e:[7,3,1,1,40,50,false,false],c:"Sc=13",p:4200};
I[10830] = {n:"Banana Cape",t:17,d:"Is that a Banana Cape in your pocket or are you just pleased to see me?",ep:0,g:172,l:28,wd:false,fm:true,w:10,c:"Sc=14",p:2305};
I[10831] = {n:"Bananapple",t:46,d:"FlambÃ©ed or sliced, topped with melted chocolate or just on its own, this fruit is a delicious dessert.",ep:0,g:1,l:1,wd:true,fm:true,w:1,p:1};
I[10832] = {n:"Cracklerock",t:94,d:"This polished stone contains a Crackler who is anything but polished.\nIt appears that you can only use it near other Cracklers or Crackrocks...",ep:0,g:18,l:1,wd:false,fm:true,w:20,c:"Sc=15&(PB=2|PB=96|PB=480)&(Sc!1003|PB!2)&(Sc!1006|PB!96)",u:true,p:0};
I[10833] = {n:"Catbread",t:33,d:"This bread is amazing! When you bite it, it meows!",ep:0,g:4,l:1,wd:false,fm:true,w:2,c:"Sc=16",u:true,ut:true,p:0};
I[10834] = {n:"Barking M\'hat",t:16,d:"It doesn\'t take much to make you look like an Ouginak. Watch out for fleas.",ep:0,g:256,l:11,wd:false,fm:true,w:10,c:"Sc=17",p:530};
I[10835] = {n:"Hazing Stone",t:50,d:"Trampled, chewed, crushed, washed, ironed, dried, you\'ve had everything done to you. Not only is your body bruised, but your ego too.",ep:0,g:707,l:1,wd:false,fm:true,w:1,p:0};
I[10836] = {n:"Gobbamu",t:1,d:"You wear this amulet proudly, as a symbol of your participation in this great sporting event. You need it to stay proud having been through a scrum with B.C. Trool.",ep:0,g:158,l:64,wd:false,fm:true,w:1,c:"Sc=18",p:11765};
I[10838] = {n:"Tingo",t:30,d:"You know when you\'ve been Tingoed!",ep:0,g:1,l:1,wd:false,fm:true,w:0,m:true,p:0};
I[10839] = {n:"Monster Bread",t:33,d:"Sometimes, when you eat very stale bread, you might lose a tooth. If you eat this bread, stale or not, you\'ll lose all of your teeth.",ep:0,g:12,l:1,wd:false,fm:true,w:100,c:"Sc=8",u:true,p:0};
I[10840] = {n:"Usable Monster Bread",t:33,d:"This one is more tender. Bon appÃ©tit!",ep:0,g:12,l:1,wd:true,fm:true,w:1,c:"Sc=8",u:true,ut:true,p:0};
I[10841] = {n:"Chestnut",t:30,d:"Didn\'t anyone warn you about the side effects?",ep:0,g:1,l:1,wd:true,fm:true,w:0,m:true,p:0};
I[10842] = {n:"Bow Meow Transformation",t:31,d:"Well, that\'s what happens! If you start coughing up hairballs, you\'ve only got yourself to blame.",ep:0,g:21,l:1,wd:false,fm:true,w:0,m:true,c:"Sc=16",p:0};
I[10843] = {n:"Note on Krtek",t:24,d:"You\'ve noted down at what time Krtek took a beating. That way, you\'ll know when to return to give him another one.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10844] = {n:"Mmmmm",t:31,d:"Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.",ep:0,g:19,l:1,wd:true,fm:false,w:0,m:true,p:1};
I[10845] = {n:"Whoever reads this is an idiot",t:12,d:"He who smelt it may have dealt it but he who spoke the rhyme did not do the crime.",ep:0,g:716,l:1,wd:false,fm:false,w:0,ut:true,p:1};
I[10846] = {n:"Phero-Cape",t:17,d:"Driven into a strange frenzy, any Tofus that you meet will want to rub up against your leg. Are you sure it\'s the cape that attracts them?",ep:0,g:173,l:61,wd:false,fm:true,w:10,c:"Sc=19",p:9700};
I[10847] = {n:"Hulkrap\'s Boots",t:11,d:"Hulkrap slipped these comfortable boots on to his ample feet once a year, but he took them off every day, which suggests they might be magic.",ep:0,g:151,l:53,wd:true,fm:true,w:10,s:152,p:7400};
I[10848] = {n:"Klume\'s Boots",t:11,d:"These boots can also be used as anvils. Their former owner urges you not to dance while wearing them.",ep:0,g:152,l:52,wd:false,fm:true,w:10,s:153,p:7175};
I[10849] = {n:"Hulkrap\'s Belt",t:10,d:"This belt is constructed around a magnetic metal frame which attracts the purses of those careless enough to rub up against you.",ep:0,g:169,l:51,wd:true,fm:true,w:10,s:152,p:6825};
I[10850] = {n:"Klume\'s Belt",t:10,d:"Klume had three weaknesses: Arachnees, being tickled, and tickly Arachnees.",ep:0,g:167,l:52,wd:false,fm:true,w:10,s:153,p:7100};
I[10851] = {n:"Kloug\'s Belt",t:10,d:"This belt is still covered in flour, perhaps because Kloug the Dark Baker used it as an apron. Mind you, it might not be flour, it could be the powder he uses to soothe his embarrassing rash.",ep:0,g:168,l:51,wd:false,fm:true,w:10,s:154,p:6928};
I[10852] = {n:"Hulkrap\'s Amulet",t:1,d:"Hulkrap stole this amulet from Ted Gonztipay, an anally retentive goblin with absolutely no sense of humour whatsoever.",ep:0,g:156,l:53,wd:true,fm:true,w:10,s:152,p:7405};
I[10853] = {n:"Kloug\'s Amulet",t:1,d:"This amulet allows you to knead the skin on your neck without using your hands.",ep:0,g:155,l:53,wd:false,fm:true,w:10,s:154,p:7400};
I[10854] = {n:"Klume\'s Ring",t:9,d:"Gontran Klume the smith traded a sword belonging to Dame Antium for this ring.",ep:0,g:183,l:54,wd:false,fm:true,w:10,s:153,p:7650};
I[10855] = {n:"Kloug\'s Ring",t:9,d:"This ring has been dipped in a multitude of different yeasts. It is said that it is capable of transforming those who wear it into mould. Some adventurers don\'t see any difference after slipping it on.",ep:0,g:184,l:51,wd:false,fm:true,w:10,s:154,p:6975};
I[10856] = {n:"Hulkrap\'s Axe",t:19,d:"Hulkrap was a terrible bandit riddled with remorse, and felt obliged to give back what he\'d stolen. This magical weapon is still imbued with the soul of Hulkrap the Bandit. You may be able to become him if you equip it.",ep:0,g:58,l:47,wd:true,fm:false,w:10,an:17,e:[5,4,1,1,40,50,false,false],s:152,p:5900};
I[10857] = {n:"Klume\'s Hammer",t:7,d:"This hammer was used to forge a Kriptonit zipper for Captain Chafer. This magical weapon is still imbued with the spirit of the Dark Smith Klume. By equipping it, you may be able to embody him.",ep:0,g:724,l:51,wd:false,fm:false,w:10,an:15,e:[5,4,1,1,40,50,false,false],s:153,p:7000};
I[10858] = {n:"Kloug\'s Wand",t:3,d:"Kloug liked to make himself appear generous by handing out bread to those who dared to speak to him. He used this wand to judge and punish the innocent. This weapon is still imbued with the magic of the Kloug the Dark Baker. You may be able to successfully embody him by equipping this weapon.",ep:0,g:73,l:53,wd:false,fm:false,w:10,an:11,e:[5,4,3,5,50,50,false,false],s:154,p:5000};
I[10860] = {n:"Name-change Potion",t:12,d:"You can use this potion to change your name. No one will remember that you used to be called Xx-Haxor-naruto-killer-feca-xX-pl. A new life, free from teasing and name-calling, awaits you. Finally, you will be someone.",ep:0,g:718,l:1,wd:false,fm:true,w:0,u:true,p:0};
I[10861] = {n:"Colour-change Potion",t:12,d:"Pink hair, mauve shoes, fuchsia skin. Mother Nature wasn\'t kind to you, but now you\'ve finally got the opportunity to have your revenge.",ep:0,g:717,l:1,wd:false,fm:true,w:0,u:true,p:0};
I[10862] = {n:"Sex-change Potion",t:12,d:"This potion, to be drunk directly from the bottle, will allow you to become him if you were her, or to become her if you were him. To be consumed without moderation.",ep:0,g:719,l:1,wd:false,fm:true,w:0,u:true,p:0};
I[10863] = {n:"Tarzantula",t:18,d:"Tarzantula is incredibly badly behaved, she jumps around everywhere, she screams all the time, she bites anyone she meets - but you love her all the same, even though you don\'t know why. Mother Nature blessed her with a ferocious appetite, and so this soul eater loves devouring Moskitoes and Larvae.",ep:0,g:58,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[10864] = {n:"Smush",t:18,d:"This unique Mush Mush was raised by a pack of Boowolves, which still doesn\'t explain why he has such hairy armpits. This soul eater loves seafood, and as such, will only eat beach creatures.",ep:0,g:59,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[10865] = {n:"Tofrazzle",t:18,d:"This Tofu was struck by lightning 11 times while she was growing up. She\'ll give you an electric shock if you stroke her, and she\'ll give you an electric shock if you don\'t stroke her. It\'s up to you to choose. This soul eater detests rats, and so will jump at the chance to devour them if they\'re available.",ep:0,g:60,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[10866] = {n:"Sting",t:18,d:"Sting the Prespic loves artichoke hearts smothered in Bherb Blood, endives with Pikoko Hair, and the songs of Jon Lemon. He seems to enjoy your company as well. This soul eater is quite fussy about the creatures he eats, however, and only likes the taste of creatures from the Dark Jungle.",ep:0,g:61,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[10867] = {n:"Tarzantula Ghost",t:90,d:"This Tarzantula Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:57,l:1,wd:true,fm:true,w:1,p:1};
