I[10899] = {n:"Manitou Zoth\'s Staff",t:4,d:"The Manitou Zoth was a former stevedore - he moved problems instead of solving them. In spite of that, the Zoth community were scared of him because he shouted louder than all the others, which was enough to make him the Zoth chief. This staff is still animated by his spirit. You may be able to successfully embody it if you equip this weapon.",ep:0,g:91,l:50,wd:false,fm:false,w:10,an:12,e:[5,3,1,1,40,50,false,false],p:6000};
I[10900] = {n:"Eggshell",t:24,d:"What you\'re holding in your hands is all that remains of the enormous eggshells that appeared on the Dreggon Peninsula. It wouldn\'t even make a decent ashtray.",ep:0,g:767,l:1,wd:false,fm:true,w:0,p:0};
I[10901] = {n:"Enormous Fang",t:24,d:"Grasmera and Grozilla clashed in an epic battle. All that remains is this enormous fang. Who will believe that you were there?",ep:0,g:13,l:1,wd:false,fm:true,w:0,p:0};
I[10902] = {n:"Manitou Zoth\'s Tight Leather Briefs",t:24,d:"Now you can truthfully say that the Manitou Zoth is naked under his kilt.",ep:0,g:621,l:1,wd:false,fm:true,w:0,p:1};
I[10903] = {n:"Key to Manitou Zoth\'s Den",t:24,d:"Using this key will allow you to fight the Manitou Zoth.",ep:0,g:790,l:1,wd:false,fm:true,w:0,p:1};
I[10904] = {n:"Grozillamulet",t:1,d:"You won this amulet thanks to your incomparable capacity for breaking eggs without making an omelette.",ep:0,g:157,l:51,wd:false,fm:true,w:10,p:7050};
I[10906] = {n:"Scale Shield",t:82,d:"Fashioned from one of Grozilla\'s scales, this is a heavy shield of exceptional stature. Only rare and fearsome fighters may proudly wear it.",ep:0,g:51,l:1,wd:false,fm:false,w:10,p:0};
I[10907] = {n:"Grofus",t:23,d:"Well, there you are. You did it: took part in the greatest Dragonic birth-control exercise ever. As a result, you\'re going to have to eat omelette for weeks to come.",ep:0,g:17,l:1,wd:false,fm:true,w:10,p:0};
I[10908] = {n:"Dofus 2.0 Beta Test Dungeon Gift",t:89,d:"You\'ve been given this gift because you spent more time in the DOFUS 2.0 Beta Test dungeons than any other mortal.",ep:0,g:42,l:1,wd:false,fm:true,w:0,u:true,p:1};
I[10909] = {n:"Tofu Pheromone",t:48,d:"This dehydrated, powdered pheromone can attract a Tofu from several kilometres away, as long as your own pheromones don\'t asphyxiate it first.",ep:0,g:241,l:1,wd:false,fm:true,w:1,p:1};
I[10910] = {n:"DOFUS 2.0 Collector\'s Edition Gift",t:89,d:"This set will make a star of you, if you can keep your mouth shut. But don\'t worry, even if you can\'t, it\'ll still impress the inhabitants of Astrub.",ep:0,g:42,l:1,wd:false,fm:true,w:0,u:true,p:1};
I[10911] = {n:"Mr. Scouty\'s Recall Potion",t:12,d:"Twice as creamy and twice as unctuous a " + "\"" + "classic" + "\"" + " recall potion, Mr. Scouty\'s Recall Potion will allow you to teleport to the Astrub Zaap from anywhere. The potion\'s double effect ensures you will live long and prosper. \n" + "\"" + "Mr. Scouty\'s Recall Potion" + "\"" + " is a registered trademark of Keurk & Spouky Enterprises.",ep:0,g:26,l:1,wd:false,fm:false,w:0,c:"Sc=666",u:true,p:0};
I[10912] = {n:"Ridiculous Kwismas Present",t:89,d:"Not all Kwismas presents are the same size. Timid adventurers only get ridiculous presents, as well as teased, or the right to burst into tears.",ep:0,g:2,l:6,wd:false,fm:true,w:10,u:true,p:1};
I[10913] = {n:"Satisfactory Kwismas Present",t:89,d:"Whoever wrapped this present saw you coming, they knew you\'d be stupid enough to think its contents might somehow be better than they actually are.",ep:0,g:2,l:7,wd:false,fm:true,w:20,u:true,p:1};
I[10914] = {n:"Potentially Overpowered Kwismas Present",t:89,d:"If you believe what\'s written on the label, this present has potential. However, as any experienced adventurer will tell you - never trust what\'s written on the label.",ep:0,g:2,l:8,wd:false,fm:true,w:30,u:true,p:1};
I[10915] = {n:"Harry Kwismas\' Orders",t:24,d:"Harry Kwismas has revealed the identity of one of the monsters responsible for the break-in at Father Kwismas\' workshop. If you aren\'t able to defeat the monster in two hours, you can head back to Harry and get a new order.",ep:0,g:33,l:1,wd:false,fm:true,w:0,p:1};
I[10916] = {n:"Harry Kwismas\' Congratulations",t:24,d:"Harry Kwismas greatly appreciated your victory. Come back in 24 hours, he\'ll need your help again if all the boxes of presents still haven\'t been found.",ep:0,g:176,l:1,wd:false,fm:true,w:0,p:1};
I[10917] = {n:"Small box of presents",t:24,d:"This small box comes from Father Kwismas\' workshop. You\'ll be a true hero if you return it to him.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[10918] = {n:"Box of presents",t:24,d:"This box comes from Father Kwismas\' workshop. You\'ll be a true hero if you return it to him.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[10919] = {n:"Large box of presents",t:24,d:"This large box comes from Father Kwismas\' workshop. You\'ll be a true hero if you return it to him.",ep:0,g:44,l:1,wd:false,fm:true,w:0,p:1};
I[10920] = {n:"Kwismas Biscuits",t:24,d:"This delicious, hand-made biscuits were baked with love. It\'s a shame you can\'t taste them.",ep:0,g:245,l:1,wd:false,fm:true,w:0,p:1};
I[10921] = {n:"Minotoball\'s Sealed Present",t:24,d:"No one knows what this present contains. The Minotoball took the secret to his grave, as if you needing reminding that was your fault. You must be sick to death of hearing it, right?",ep:0,g:715,l:1,wd:false,fm:true,w:0,p:1};
I[10922] = {n:"Master Lumberjack\'s Shield",t:82,d:"This shield shows all other adventurers that you were a pioneer in establishing your profession.",ep:0,g:85,l:1,wd:false,fm:false,w:10,ce:true,c:"PJ=2,100",p:1};
