I[10955] = {n:"The Black Crow\'s Ring",t:9,d:"There\'s nothing unusual about a bird being ringed!",ep:0,g:187,l:33,wd:false,fm:true,w:10,s:155,p:3150};
I[10956] = {n:"The Black Crow\'s Boots",t:11,d:"Like the rest of the Black Crow set, this pair of boots has been passed down, foot to foot, through the generations. That explains the strong smell of Clakoss...",ep:0,g:154,l:32,wd:false,fm:true,w:10,s:155,p:2850};
I[10957] = {n:"The Black Crow\'s Cloak",t:17,d:"Some thread, a needle, a few feathers taken from the remains of decaying Crows, and voilÃ ! You\'re in possession of the most chic of cloaks!",ep:0,g:179,l:35,wd:false,fm:true,w:10,s:155,p:3400};
I[10958] = {n:"The Black Crow\'s Helmet",t:16,d:"You can\'t hide, you\'ve been unmasked! So, the Black Crow is you after all! You would have gotten away with it too, if it weren\'t for those meddling kids!",ep:0,g:287,l:32,wd:false,fm:true,w:10,s:155,p:2900};
I[10959] = {n:"The Black Crow\'s Piercing Lance",t:6,d:"It might have taken you a while, but here it is, in your hands at last: the Black Crow\'s Lance!",ep:0,g:97,l:39,wd:false,fm:true,w:10,an:14,e:[13,5,1,1,40,50,false,false],c:"CA>60&CV>60",s:155,p:4400};
I[10960] = {n:"Gift: The Black Crow\'s Ring",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg. Please note, this gift can only be opened on a DOFUS 2.0 server.",ep:0,g:42,l:1,wd:false,fm:true,w:1,c:"Sc=997",u:true,p:1};
I[10961] = {n:"Gift: The Black Crow\'s Piercing Lance",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg. Please note, this gift can only be opened on a DOFUS 2.0 server.",ep:0,g:42,l:1,wd:false,fm:true,w:1,c:"Sc=997",u:true,p:1};
I[10962] = {n:"Plunder\'s Staff",t:4,d:"There\'s nothing better than this staff for unblocking drains, or the nostrils of your fallen opponents. This weapon is still imbued with Plunder\'s magic. You may be able to successfully embody him if you equip it.",ep:0,g:92,l:30,wd:false,fm:false,w:10,an:12,e:[6,3,1,1,50,50,false,false],c:"CV>30",s:156,p:2650};
I[10963] = {n:"Plunder\'s Boots",t:11,d:"The sole of these boots is spongy, so can absorb sewage sludge and release it again at every step, allowing you to retrace your steps easily.",ep:0,g:156,l:32,wd:false,fm:true,w:10,s:156,p:2900};
I[10964] = {n:"Plunder\'s Belt",t:10,d:"Plunder hung his booty from this belt. You can make out a small valve on the inside. This valve allows the belt to be inflated, transforming it into a buoy. An essential item when venturing into the sewers.",ep:0,g:172,l:31,wd:false,fm:true,w:10,s:156,p:2800};
I[10965] = {n:"Plunder\'s Amulet",t:1,d:"This amulet was specially designed not to get stuck in Plunder\'s neck hairs, so you can wear it without fear under your armpit or even keep it in your hand.",ep:0,g:160,l:31,wd:false,fm:true,w:10,s:156,p:2800};
I[10966] = {n:"Larva Transformation",t:31,d:"Gossips insinuate that your inner nature has been revealed. Might they actually be right?",ep:0,g:19,l:1,wd:false,fm:true,w:0,m:true,c:"Sc=21",p:0};
I[10967] = {n:"Larva Brain",t:69,d:"You\'d need to be really desperate to eat this. No, don\'t do it!",ep:0,g:113,l:1,wd:false,fm:true,w:0,c:"Sc=21",u:true,ut:true,p:1};
I[10968] = {n:"Wabbit Twansfowmation",t:31,d:"Somewhat surprisingly, you\'re not that partial to Cawwots at the moment.",ep:0,g:19,l:1,wd:false,fm:true,w:0,m:true,c:"Sc=22",p:0};
I[10969] = {n:"Wefweshing Potion",t:12,d:"The sweetness of a Cawwot, the freshness of a Dragoturkey marathon runner. There\'s nothing better for getting you back on your feet. Good health, up the empire, cheers!",ep:0,g:141,l:20,wd:false,fm:true,w:1,c:"Sc=22",u:true,ut:true,p:1};
I[10970] = {n:"Dragoturkey Sweat",t:15,d:"Holy Bwork! How did you manage to get that? And, more to the point, why? You\'re really weird.",ep:0,g:773,l:1,wd:false,fm:true,w:1,p:1};
I[10971] = {n:"Cheeky Bag",t:81,d:"With this bag slung at a jaunty angle over your shoulder, you\'ll be able to muck about while still keeping that charming smile on your face, you cheeky little monkey!",ep:0,g:25,l:20,wd:false,fm:true,w:10,c:"Sc=23",p:1};
I[10972] = {n:"Crow Follower",t:31,d:"Although very affectionate, you suspect this volatile avian will fly off at the first sign of danger.",ep:0,g:25,l:1,wd:false,fm:true,w:0,m:true,c:"Sc=24",p:0};
I[10973] = {n:"Potion: Destination Unknown",t:12,d:"Your instinct tells you not to swallow the contents of this jar. Not just your instincts, either. Your nose, too. The mixture smells like a centenarian Bwork\'s armpit.",ep:0,g:189,l:20,wd:false,fm:true,w:1,p:10};
I[10974] = {n:"Festive Fairywork",t:74,d:"PAR-TAY! PAR-TAY! PAR-TAY!",ep:0,g:32,l:1,wd:false,fm:true,w:1,c:"Sc=26",ut:true,p:1};
I[10975] = {n:"Phong Huss\'s Sword",t:6,d:"It might smell of stale Champmane but there\'s nothing stale about this sword\'s blade. This weapon is still imbued with Phong Huss\'s magic. You may be able to successfully embody him if you equip it.",ep:0,g:97,l:33,wd:false,fm:false,w:10,an:14,e:[12,6,1,1,40,60,false,false],c:"CS>50",s:157,p:3100};
I[10976] = {n:"Phong Huss\'s Ring",t:9,d:"Fungi generally have collars, but Phong Huss preferred rings, possibly so that he could boast about having fingers.",ep:0,g:185,l:33,wd:false,fm:true,w:10,s:157,p:3150};
I[10977] = {n:"Phong Huss\'s Belt",t:10,d:"Phong Huss wore this belt somewhat sloppily. He tried to wear it as a shoulder strap so he could sheath his sword in it. The belt pinched his nipples on multiple occasions, but other than that, was of no use whatsoever.",ep:0,g:170,l:30,wd:false,fm:true,w:10,s:157,p:2650};
I[10978] = {n:"Phong Huss\'s Boots",t:11,d:"The feet of fungi are rarely very clean - they are often covered with mycelium. Phong Huss\'s feet were no exception to this rule and he took care to hide them with his boots. They don\'t smell particularly good, but they are well suited for growing mushrooms. Which of your stomach or your nose will win?",ep:0,g:153,l:32,wd:false,fm:true,w:10,s:157,p:2900};
I[10979] = {n:"Ektope\'s Hammer",t:7,d:"Ektope took great pleasure in dragging this weapon behind him. He was well-known for being as lazy as a Gobball, but he mainly wanted to warn his opponents of his sensational arrival. This weapon is still imbued with Ektope\'s magic. You may be able to successfully embody him if you equip it.",ep:0,g:74,l:30,wd:false,fm:false,w:10,an:15,e:[5,4,1,1,50,50,false,false],c:"CA>50",s:158,p:2800};
I[10980] = {n:"Ektope\'s Amulet",t:1,d:"This ghost\'s amulet must be extremely powerful, if one believes the legends about ghosts, that is.",ep:0,g:159,l:32,wd:false,fm:true,w:10,s:158,p:2900};
I[10981] = {n:"Ektope\'s Ring",t:9,d:"It\'s a well-known fact that real ghosts don\'t have fingers. So how does that explain this ring?",ep:0,g:186,l:32,wd:false,fm:true,w:10,s:158,p:2970};
I[10982] = {n:"Ektope\'s Belt",t:10,d:"A drunken Captain Kradoc once stumbled into Ektope leaving a party at the Ripate Inn. " + "\"" + "Ectoplasm on skates!" + "\"" + " he ejaculated. Poor Captain Kradoc, the alcohol was playing tricks on him, Ektope has never had wheels.",ep:0,g:171,l:32,wd:false,fm:true,w:10,s:158,p:2900};
I[10984] = {n:"",t:1,d:"",ep:0,g:0,l:50,wd:false,fm:true,w:50,an:0,tw:true,c:"CS>50",p:50};
I[10985] = {n:"Snow Bow Meow",t:18,d:"This Bow Meow has known the winter of the far north, even if it has never actually seen the far north. Nobody knows how it arrived in Amakna, although the elders claim that it was imported from the island of Frigost to counter the ever-expanding Wabbit population. As such, this soul devourer will only eat Wabbits.",ep:0,g:62,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[10986] = {n:"Snow Bow Meow Ghost",t:90,d:"This Snow Bow Meow Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:62,l:1,wd:true,fm:true,w:1,p:1};
I[10987] = {n:"Frost Belt",t:10,d:"This belt cools the hips, organs and ardour of all those who dare to wear it. To be given to your most stubborn suitors.",ep:0,g:0,l:35,wd:false,fm:true,w:10,s:141,p:3500};
I[10988] = {n:"Frost Hat",t:16,d:"This hat is ideal for keeping your head cool and your ideas fresh. That said, if you don\'t want to look like an ugly ice cube, you\'ll have to find something else.",ep:0,g:0,l:35,wd:false,fm:true,w:10,s:141,p:3450};
I[10989] = {n:"Frost Cape",t:17,d:"Jon Lemon wore a similar cape during his famous concert in Brouce Boulgoure\'s Clearing. Those who weren\'t deafened still remember the concert\'s climax, when he stopped singing after becoming trapped in the ice because of his own cape.",ep:0,g:0,l:33,wd:false,fm:true,w:10,s:141,p:3150};
I[10990] = {n:"Frost Boots",t:11,d:"Heavy and stiff, these boots don\'t look particularly special, but their icy sole will have you ice-skating without the need for ice. Of course, you\'ll need to find a surface covered with ice-skate blades, but in these crazy times, that shouldn\'t be too difficult.",ep:0,g:0,l:33,wd:false,fm:true,w:10,s:141,p:3000};
I[10991] = {n:"Gift: Snow Bow Meow",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg. \nPlease note, this gift can only be opened on a DOFUS 2.0 server.",ep:0,g:42,l:1,wd:false,fm:true,w:1,c:"Sc=997",u:true,p:1};
I[10992] = {n:"Gift: Frost Belt",t:89,d:"If you shake this gift box vigorously, you\'ll find it\'s not empty. For once, the gods might not have been pulling your leg.\nPlease note, this gift can only be opened on a DOFUS 2.0 server.",ep:0,g:42,l:1,wd:false,fm:true,w:1,c:"Sc=997",u:true,p:1};
