I[11049] = {n:"Grillian\'s Hat",t:16,d:"Grillian was a great magician. Having forgotten how to make Vanishing Powder, he successfully reinvented it. He never did find the missing half of his assistant, though.",ep:0,g:0,l:32,wd:false,fm:true,w:10,s:161,p:2900};
I[11050] = {n:"Grillian\'s Cape",t:17,d:"This cape is supposed to protect your posterior from the bites of carnivorous plants.",ep:0,g:0,l:32,wd:false,fm:true,w:10,s:161,p:2850};
I[11051] = {n:"Grillian\'s Amulet",t:1,d:"Grillian wore this amulet around his neck when... When... What does it matter? He died and now this amulet is yours.",ep:0,g:0,l:32,wd:false,fm:true,w:10,s:161,p:2925};
I[11052] = {n:"Grillian\'s Boots",t:11,d:"Grillian the magician traded a magic ring for this pair of boots. It seems he lost out on the deal as they aren\'t even padded.",ep:0,g:0,l:34,wd:false,fm:true,w:10,an:0,s:161,p:3205};
I[11053] = {n:"",t:31,d:"",ep:0,g:0,l:1,wd:false,fm:true,w:0,p:0};
