I[11055] = {n:"Gadjet\'s Hat",t:16,d:"Gadjet was one of the most creative handymen in the World of 12. Unfortunately he was also one of the most absent-minded. They say he mixed up his anvil and the head of his wife more than once and she did not complain.",ep:0,g:0,l:41,wd:false,fm:true,w:10,an:0,s:162,p:4553};
I[11056] = {n:"Gadjet\'s Cape",t:17,d:"Gadjet made this cape hoping it might enable him to fly and thus more easily escape the punishment administered daily by his wife.",ep:0,g:0,l:42,wd:false,fm:true,w:10,an:0,s:162,p:4875};
I[11057] = {n:"Gadjet\'s Belt",t:10,d:"By wearing this belt upside down and pressing on it hard enough, you may be able to activate the integrated retromagic module. It has never worked, but you can activate it anyway. You can then sell it to someone as naive as you.",ep:0,g:0,l:40,wd:false,fm:true,w:10,an:0,s:162,p:4305};
I[11058] = {n:"Gadjet\'s Ring",t:9,d:"Worn by several generations of handymen, this ring will protect you from striking your knuckle with your hammer. Unfortunately, it is never sold in packs of five.",ep:0,g:0,l:43,wd:false,fm:true,w:10,an:0,s:162,p:5100};
