I[11465] = {n:"Komet",t:18,d:"A lover of Goblimps\' warped sense of humor, Komet was charmed by your own, and decided to leave the snowy forests of Kwismas Island so he could accompany you on many a rousing adventure. What\'s his secret to making his magnificent antlers grow back so quickly after shedding? " + "\"" + "Wood" + "\"" + " you believe it\'s eating... wood! The harder on the teeth, the bigger the antlers!",ep:0,g:62,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
