I[11471] = {n:"T\'Youb",t:17,d:"This cloak is very special indeed, as it allows its wearer to display anything at all on his or her back. Most dumb adventurers just use it to show off hunting trophies and count how many people are taking an interest in them, but a few canny wearers have managed to generate a real following with their original ideas.",ep:0,g:174,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11472] = {n:"Twit Shield",t:82,d:"When wearing this shield, you will be visible from afar. This allows anyone to keep tabs on your exhilarating adventures and know where you are at all times, including any stops you make at Astrub Inn.",ep:0,g:91,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11473] = {n:"Witter Beanie",t:16,d:"This thing can talk... And talk... And talk... And talk! It picks up phrases it likes and repeats them to Witter Beanies in the area. At first, these hats were quite a good alternative to carrier pigeons, until they became so commonly used that the same messages started going round and round in circles, resulting in a permanent hubbub. These days they\'re also used for a parlour game called Rage K-Witter in which each participant dons a Witter Beanie and the one who can stand the noise the longest is pronounced the winner.",ep:0,g:259,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11474] = {n:"Ilyzaelle\'s Lookout Key",t:84,d:"This key lets you enter Ilyzaelle\'s Lookout. Be careful, though: it will be destroyed after use.",ep:35,g:255,l:1,wd:true,fm:false,w:1,p:1};
I[11475] = {n:"Qu\'Tan\'s Sanctuary Key",t:84,d:"This key lets you open the gate blocking the entrance to Qu\'Tan\'s Sanctuary. Be careful, though: it will be destroyed after use.",ep:35,g:256,l:1,wd:true,fm:false,w:1,p:1};
I[11476] = {n:"Polykrome Komintot Headband",t:16,d:"This familiar-looking headgear was enchanted by Hel Munster himself after a famous Astrubian fashion designer wouldn\'t stop asking him. He wanted to offer a collection that adjusted to the colours of the person wearing it. Despite its being discoloured by a top-secret process, you can still recognise the unmistakable smell of Boowolf slobber emanating from it... Yuck!",ep:34,g:260,l:1,wd:true,fm:false,w:10,ce:true,p:1};
I[11477] = {n:"Polykrome Adventurer Hat",t:16,d:"This familiar-looking headgear was enchanted by Hel Munster himself after a famous Astrubian fashion designer wouldn\'t stop asking him. He wanted to offer a collection that adjusted to the colours of the person wearing it. Despite its being discoloured by a top-secret process, you can still recognise the unmistakable smell of Boowolf slobber emanating from it... Yuck!",ep:34,g:261,l:1,wd:true,fm:false,w:10,ce:true,p:1};
