I[11525] = {n:"5-Sided Die Roll",t:24,d:"",ep:35,g:0,l:1,wd:false,fm:false,w:0,p:1};
I[11526] = {n:"Ilyzaelle\'s Mother-of-Pearl Feather",t:53,d:"This feather shines unbelievably brightly. Ilyzaelle uses it to travel quickly across the big continent. Of course, that\'s going to be complicated now.",ep:35,g:646,l:500,wd:true,fm:true,w:2,p:1};
I[11527] = {n:"Ilyzaelle\'s Hair",t:15,d:"This hair has properties that would drive any tailor mad: it is incredibly fine and very difficult to manipulate. It is, however, very silky and suppleÂ â perfect for someone like you. One thing\'s for sure: it smells nice.",ep:35,g:776,l:500,wd:true,fm:true,w:1,p:1};
I[11528] = {n:"Broken Elite Marksman Bow",t:15,d:"There isn\'t much left of this once-beautiful bow, but you can still make out a magnificent ornament on the handle. There is also the insignia of the Bonta Royal Guard deeply embedded in the wood.",ep:35,g:777,l:167,wd:true,fm:true,w:4,p:1};
I[11529] = {n:"Celestial Crackler Balancing Stone",t:51,d:"Legend says that only the most reckless can find this stone on the highest peak of the tallest mountain in Cania. Legend also says that it is waiting for a valiant knight to kiss it and turn it into a princess... Reality, alas, is often much less romantic than legends: it is much more likely to crush your hopes.",ep:35,g:466,l:178,wd:true,fm:true,w:5,p:1};
I[11530] = {n:"Temporal Spell Residue",t:12,d:"The powerful mages from the Bonta school bottle these spells so they can use them rapidly in combat. Use extreme caution when handling them or you risk creating a monumentally big rift in the fabric of space-time. In other words, exactly the opposite of what you could normally do.",ep:35,g:720,l:110,wd:true,fm:true,w:1,p:1};
I[11531] = {n:"Captain of the Avenging Order\'s Platinum Horn",t:47,d:"The Captain of the Avenging Order has spent so much time rubbing this horn that it blinds everyone around when the sun shines on it.",ep:35,g:801,l:194,wd:true,fm:true,w:1,p:1};
I[11532] = {n:"Evil Tusk",t:47,d:"This tusk perfectly embodies everything about the Esra\'Ruoy\'Dnim\'s former lieutenant: impressive, smelly, and very powerful.",ep:35,g:802,l:666,wd:true,fm:true,w:5,p:1};
I[11533] = {n:"Qu\'Tan\'s Torn Out Fingernail",t:47,d:"With pain like that, it\'s not surprising that Qu\'Tan is so grumpy. It also didn\'t help that Bworknroll told him to soak it in warm, salty water. And since water is so rare in Sidimote, he was forced to use lava instead. It\'s (almost) enough to make you feel sorry for him.",ep:35,g:803,l:666,wd:true,fm:true,w:1,p:1};
I[11534] = {n:"Demon Canine",t:47,d:"Sharpened to rival the best razor blades around, this tooth can rip the flesh off careless adventurers in less time than it takes to yell " + "\"" + "ow!" + "\"" + "",ep:35,g:805,l:167,wd:true,fm:true,w:1,p:1};
I[11535] = {n:"Smelly Demon Skin",t:59,d:"This clammy, scaly skin provides even better protection if you wear it. Once made into a piece of equipment, it can also keep females away. According to certain fans on the older side, this explains the odour requirement.",ep:35,g:630,l:172,wd:true,fm:true,w:2,p:1};
I[11536] = {n:"Cursed Chafer Bone",t:47,d:"Like his cousin, with whom he has a very cordial (in a friendly way) relationship, the Cursed Chafer has very solid bones. In all likelihood, it\'s because of a balanced diet: not too fatty, not too sugary, not too salty.",ep:35,g:806,l:135,wd:true,fm:true,w:2,p:1};
I[11537] = {n:"Demon Sorcerer Staff Piece",t:15,d:"Contrary to popular belief, the Demon Sorcerers summoned by Qu\'Tan do not use an ordinary catalyst. It is a sort of spear imbued with their master\'s black magic. Subtlety is clearly not a concern...",ep:35,g:778,l:172,wd:true,fm:true,w:2,p:1};
I[11538] = {n:"Enchanted Arrow",t:15,d:"This arrow is, by definition, special. It would be even more special if a dozen others weren\'t already sticking out of you. At least this one is in good condition.",ep:35,g:779,l:132,wd:true,fm:true,w:1,p:1};
I[11539] = {n:"Arcadia Bow",t:2,d:"This bow was made from high-quality materials. When grasped, it gives off incredible power, which can also be felt in the arrows it shoots. ",ep:35,g:69,l:195,wd:true,fm:true,w:20,an:10,tw:true,e:[7,5,2,7,50,50,false,true],c:"CS>274&CC>274",s:163,p:350};
I[11540] = {n:"Shadowy Protection Potion",t:12,d:"This potion stops you from being affected by Ilyzaelle\'s crushing power. An absolute must-have.",ep:35,g:721,l:200,wd:true,fm:false,w:1,p:1};
I[11541] = {n:"Opalescent Protection Potion",t:12,d:"This potion stops you from being affected by Qu\'Tan\'s treacherous power. An absolute must-have.",ep:35,g:722,l:200,wd:true,fm:false,w:1,p:1};
I[11542] = {n:"Ilyzawing Cape",t:17,d:"When you don these duds, you should expect a noticeable increase in ambushes and other attacks of all kinds by assailants from the Black City. Perhaps, deep down, you really do want all the extra attention.",ep:35,g:175,l:196,wd:true,fm:true,w:10,s:163,p:5800};
I[11543] = {n:"Ilyzaring",t:9,d:"This ring was touted as a unique, one-of-a-kind item that would confer you with powers coveted by dragoturkey riders dressed all in black. Scanning the crowds of adventurers in Bonta during rush hour is all it takes to reveal that this was a lie.",ep:35,g:185,l:194,wd:true,fm:true,w:10,s:163,p:3150};
I[11544] = {n:"Qu\'Tan Ring",t:9,d:"At first glance, this ring seems extremely uncomfortable to wear, even very dangerous for your tiny fingers. On second glance, your first glance was right.",ep:35,g:186,l:194,wd:true,fm:true,w:10,s:164,p:3150};
I[11545] = {n:"Feathered Belt",t:10,d:"This belt can, of course, hide your backside quite effectively. You can also wear it on your head as a jaunty cap during fancy parties.",ep:35,g:170,l:193,wd:true,fm:true,w:5,s:163,p:3150};
I[11546] = {n:"Qu\'Tamulet",t:1,d:"Set with a demon eye, this originally shaped amulet will poke you whenever you start to run. Think of it as the demon\'s revenge and a constant reminder that every action calls for a reaction.",ep:35,g:159,l:195,wd:true,fm:true,w:1,s:164,p:3150};
I[11547] = {n:"Qu\'Tanned Boots",t:11,d:"These boots smell of sulphur and cheese. In addition to giving you power, they\'ll mask your foot odour. What more could anyone want?",ep:35,g:153,l:194,wd:true,fm:true,w:10,s:164,p:3150};
I[11548] = {n:"Qu\'Tan Horned Cap",t:16,d:"Qu\'Tan is said to have used these horns to punish his subjects when they came back from hunts with empty sacks.",ep:35,g:282,l:196,wd:true,fm:true,w:5,s:164,p:3150};
I[11549] = {n:"Purse of 30,000 Kamas",t:100,d:"This purse is very heavy - it must be worth a fortune.",ep:35,g:56,l:1,wd:true,fm:true,w:10,u:true,p:0};
I[11550] = {n:"Shadowy Protection Potion",t:30,d:"This potion stops you from being affected by Ilyzaelle\'s crushing power. An absolute must-have.",ep:35,g:25,l:1,wd:true,fm:false,w:0,m:true,p:1};
I[11551] = {n:"Opalescent Protection Potion",t:30,d:"This potion stops you from being affected by Qu\'Tan\'s treacherous power. An absolute must-have.",ep:35,g:26,l:1,wd:true,fm:false,w:0,m:true,p:1};
I[11552] = {n:"Tiredness",t:30,d:"The boss\'s room is surrounded by a powerful aura that weakens you.",ep:35,g:1,l:1,wd:true,fm:false,w:0,m:true,p:1};
I[11553] = {n:"Golden Parchment",t:13,d:"(Double click to gain experience) \nWith this parchment, you gain Experience without putting yourself on the line!",ep:35,g:26,l:50,wd:true,fm:true,w:1,u:true,p:10};
I[11554] = {n:"Armoured Dragoone",t:18,d:"Inspired by the iconic Armoured Dragoturkey, this rare Armoured Dragoone specimen is also looking to reach legendary status and could even steal the show from its older sibling!",ep:35,g:63,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[11555] = {n:"Dragarmour Helmet",t:16,d:"You won\'t go unnoticed with this helmet on your head. True veterans will immediately see your worth, your unquestionable taste and the look of the famous Armoured Dragoturkey.",ep:35,g:283,l:1,wd:false,fm:false,w:20,ce:true,p:0};
I[11556] = {n:"Dragarmour Shield",t:82,d:"Forged from the same thick plating as that worn by the famous Armoured Dragoturkey, this shield will significantly slow down enemy attacks but not your fierce fervour.",ep:35,g:92,l:1,wd:false,fm:false,w:5,ce:true,p:0};
I[11557] = {n:"Dragarmour Cloak",t:17,d:"It floats on air with the same magnificence as the Armoured Dragoturkey that inspired it. The Dragarmour Cloak will make you feel like you have wings. Just remember to come back down to earth when the fight starts.",ep:35,g:176,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11558] = {n:"Armoured Dragoone Ghost",t:90,d:"This Armoured Dragoone Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:35,g:63,l:1,wd:true,fm:true,w:1,p:1};
I[11559] = {n:"Bow Kennel Certificate: Armoured Dragoone",t:77,d:"This Certificate describes the characteristics of the Armoured Dragoone that you\'ve put in the Bow Kennel.",ep:35,g:75,l:1,wd:false,fm:true,w:1,p:100};
I[11567] = {n:"Qu\'Tan Spiritual Gem",t:85,d:"This gem is awarded after a certain number of victories in duels, and it contains the soul of a monster. Keep in a cool, dry, dark place, away from strong odours. Shake well before use.",ep:35,g:2,l:1,wd:true,fm:true,w:1,u:true,p:0};
I[11568] = {n:"Ilyzaelle Spiritual Gem",t:85,d:"This gem is awarded after a certain number of victories in duels, and it contains the soul of a monster. Keep in a cool, dry, dark place, away from strong odours. Shake well before use.",ep:35,g:2,l:1,wd:true,fm:true,w:1,u:true,p:0};
I[11569] = {n:"Angel Meat",t:63,d:"A good piece of meat cut from the tenderest part of an Angel. We do not want to know what this famous part is.",ep:35,g:376,l:90,wd:false,fm:true,w:1,p:1};
I[11570] = {n:"Angel Meat**",t:63,d:"A good piece of meat cut from the tenderest part of an Angel. We do not want to know what this famous part is.",ep:35,g:376,l:90,wd:false,fm:true,w:1,p:1};
I[11571] = {n:"Preserved Angel Meat",t:64,d:"This Angel meat can now be stored for several days before being used for a dish.",ep:35,g:388,l:90,wd:false,fm:true,w:1,p:1};
I[11572] = {n:"Preserved Angel Meat**",t:64,d:"This Angel meat can now be stored for several days before being used for a dish.",ep:35,g:388,l:90,wd:false,fm:true,w:1,p:1};
I[11573] = {n:"Entrecote of Angel",t:69,d:"Angels are magical creatures with secular knowledge and the dishes prepared from their meat have kept these properties.",ep:35,g:132,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
I[11574] = {n:"Entrecote of Angel**",t:69,d:"Angels are magical creatures with secular knowledge and the dishes prepared from their meat have kept these properties.",ep:35,g:132,l:1,wd:false,fm:true,w:1,u:true,ut:true,p:1};
