I[11621] = {n:"Polykrome Scale Shield",t:82,d:"Fashioned from one of Grozilla\'s scales, this is a heavy shield of exceptional stature. Only rare and fearsome fighters may proudly wear it. What\'s more, this one is especially colourful.",ep:35,g:93,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11622] = {n:"Sauroshell Shell",t:24,d:"This shell is heavy, unwieldy, and gives off a strong stench. You clearly need to get rid of it, pronto!",ep:35,g:820,l:1,wd:false,fm:false,w:20,p:0};
I[11623] = {n:"Coloured Gift - Eachure Hat",t:89,d:"This gift includes an item of Polykrome headgear and a Mimisymbic. Be careful though, because the ink on the package can rub off... That\'ll teach you to stick your hands just about anywhere.",ep:1,g:43,l:1,wd:false,fm:true,w:10,u:true,p:1};
I[11700] = {n:"Shadowy Protection Potion",t:24,d:"This potion stops you from being affected by Ilyzaelle\'s crushing power. An absolute must-have.",ep:35,g:821,l:200,wd:true,fm:false,w:0,p:1};
I[11701] = {n:"Opalescent Protection Potion",t:24,d:"This potion stops you from being affected by Qu\'Tan\'s treacherous power. An absolute must-have.",ep:35,g:822,l:200,wd:true,fm:false,w:0,p:1};
I[11702] = {n:"Red Dragoone",t:18,d:"They say that this Dragoone got fed up with being compared to the pink buttocks of a female Bwork and wanted to set herself apart from her peers. So, she ran off to Moon Island to sunbathe in peace. Just look at her now! She\'s taken on the colour of a real flaming dragon!",ep:3,g:64,l:1,wd:true,fm:true,w:10,c:"PZ=1",p:1};
I[11703] = {n:"Ankanniversary Hat",t:16,d:"This festive hat reminds you of a very odd dream you had two years ago. See there: you do have a good memory when you put your mind to it!",ep:3,g:284,l:1,wd:true,fm:false,w:10,ce:true,p:100};
I[11704] = {n:"Red Dragoone Ghost",t:90,d:"This Red Dragoone Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:3,g:64,l:1,wd:true,fm:true,w:1,p:1};
I[11705] = {n:"Bow Kennel Certificate: Red Dragoone",t:77,d:"This Certificate describes the characteristics of the Red Dragoone that you\'ve put in the Bow Kennel.",ep:3,g:76,l:1,wd:false,fm:true,w:1,p:100};
I[11706] = {n:"Hippi-Ho for Red Dragoone",t:116,d:"With this powerful pill, you can increase the characteristics of your Red Dragoone for good. Be careful, though. Don\'t give it more than one dose or you\'ll have a dead Red Dragoone on your hands. Speaking of which, both meats are very, very tasty. It\'s best to leave it marinade for... okay, I\'ll stop talking...",ep:1,g:61,l:1,wd:true,fm:true,w:1,c:"PO=11702",u:true,p:1};
I[11707] = {n:"Coloured Gift - Musheadgear",t:89,d:"This gift includes an item of Polykrome headgear and a Mimisymbic. Be careful though, because the ink on the package can rub off... That\'ll teach you to stick your hands just about anywhere.",ep:1,g:43,l:1,wd:false,fm:true,w:10,u:true,p:1};
I[11708] = {n:"Ogrine Digger\'s Hat",t:16,d:"They make you giddy, occupying your thoughts night and day. Ogrines! Already as steadfast as the pet that can sniff them out from miles away, now you\'ll be pleased to look like one.  ",ep:0,g:288,l:1,wd:false,fm:false,w:20,ce:true,p:0};
I[11709] = {n:"Ogrine Digger\'s Cloak",t:17,d:"As transparent as your intentions (namely, to dig up all the ogrines you can!), this striking accessory will show how much you love precious ogre tears. Plus, it has little bells on it.",ep:0,g:180,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11710] = {n:"Ogrine Digger\'s Shield",t:82,d:"Although made from real ogre tears, this shield won\'t save you from one of those creatures. That said, it will protect you from their massive spittle if they sneeze.",ep:0,g:94,l:1,wd:false,fm:false,w:5,ce:true,p:0};
I[11711] = {n:"Weegle Owl",t:18,d:"A problem? A bug? A clever adventurer gave you 10% of your kamas? Don\'t panic! No need to contact Ankama Support because the adorable Weegle Owl will be there to guide you and dry your tears throughout your adventures in the World of Twelve. (Place this pet over another, already-equipped pet to change its appearance.)",ep:36,g:68,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[11712] = {n:"Pirate Tricorn",t:16,d:"No pirate has ever managed to touch this magnificent three-cornered hat during a sword fight thanks to its wearers\' agility and flexibility. If, however, it were ever to receive even the tiniest scratch (heaven forbid!), the wearer will be cursed to the end of their days and no longer worthy of wearing it.",ep:0,g:290,l:1,wd:false,fm:false,w:20,ce:true,p:0};
I[11713] = {n:"Pirate Coat",t:17,d:"This Pirate Coat, nicknamed the " + "\"" + "Thousand Battle Trophy" + "\"" + ", symbolises the astounding feat of having triumphed in at least that many sea battles. Best to think twice before attacking a pirate of such renown! Rumour has it that wearing this coat before accomplishing that feat will make you horrifically seasick... Sailors, take heed!",ep:0,g:181,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11714] = {n:"Pirate Shield",t:82,d:"Is it a shield? Or a sheath? Or both at once? This splendid and versatile Pirate Shield lets you block your opponents\' most fearsome blows and store your sharpest weapons.",ep:0,g:95,l:1,wd:false,fm:false,w:5,ce:true,p:0};
I[11715] = {n:"Flibalak",t:18,d:"This adorable creature\'s hairiness seems to hinder its vision. Beloved by buccaneers of all stripes, it views you as one of its most distinguished representatives. We did tell you it had trouble seeing. This soul eater only eats Pirates.",ep:36,g:69,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[11716] = {n:"Flibalak Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:36,g:266,l:1,wd:true,fm:true,w:1,p:10};
I[11717] = {n:"Kwismas 651 Treetop",t:16,d:"Let\'s just say that under this hat, you\'ll find anything but gifts.",ep:3,g:289,l:1,wd:true,fm:false,w:10,ce:true,p:100};
I[11718] = {n:"Weegle Owl Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:36,g:265,l:1,wd:true,fm:true,w:1,p:10};
I[11719] = {n:"Kwismas Reindeer",t:18,d:"Do you hear those jingling bells? Those crunching footsteps in the snow? It\'s Kwismas, and this pet is here to remind you of that!",ep:0,g:67,l:1,wd:true,fm:true,w:1,c:"PZ=1",p:1};
I[11720] = {n:"Kwismas Reindeer Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:0,g:264,l:1,wd:true,fm:true,w:1,p:10};
I[11721] = {n:"Bow Kennel Certificate: Weegle Owl",t:77,d:"This certificate describes the characteristics of the pet you\'ve put in the Bow Kennel.",ep:0,g:80,l:1,wd:false,fm:true,w:1,p:100};
I[11722] = {n:"Weegle Owl Ghost",t:90,d:"This Ghost hasn\'t left the living world yet. Will you find a way to resurrect it or cowardly abandon it once and for all?",ep:0,g:68,l:1,wd:true,fm:true,w:1,p:1};
I[11723] = {n:"Enhancement Potion: Weegle Owl",t:116,d:"Using this powerful potion will increase the capacity of your pet permanently. Be careful though, only one dose will work. Trying more than once will cause disappointing results.",ep:0,g:64,l:1,wd:true,fm:true,w:1,c:"PO=11711",u:true,p:10};
I[11724] = {n:"Tooschuss Flakeshield",t:82,d:"After snowploughing straight from the Icefields, this shield will show off your prowess as a novice skier from Kwismas Island.",ep:0,g:100,l:1,wd:false,fm:false,w:5,ce:true,p:0};
I[11725] = {n:"Tooschuss Ski Carrier",t:17,d:"When you wear this backpack, you aren\'t just carrying a simple backpack: you\'re carrying a simple backpack that is carrying a simple pair of skis.",ep:0,g:182,l:1,wd:false,fm:false,w:10,ce:true,p:0};
I[11726] = {n:"Tooschuss Cap",t:16,d:"" + "\"" + "Adventurer, whether you\'re in town or rushing down the slopes, your ears will never get cold with this cap." + "\"" + " Hard to believe the slogan when your ears aren\'t completely covered, but whatever... They claim it\'s true: satisfaction guaranteed or your money back!",ep:0,g:291,l:1,wd:false,fm:false,w:20,ce:true,p:0};
I[11727] = {n:"Solar Bear",t:18,d:"The Solar Bear has always been loyal to Father Kwismas, and he\'ll be loyal to you too. Thanks to its thick, downy coat, you\'ll never get cold, even on the iciest islands. Rub his belly once in a while to warm up his body. ",ep:0,g:71,l:1,wd:true,fm:true,w:1,p:1};
I[11728] = {n:"Solar Bear Hormone",t:48,d:"This dehydrated growth hormone can be used to make a powerful potion to improve a pet\'s characteristics.",ep:0,g:268,l:1,wd:true,fm:true,w:1,p:10};
