I[11747] = {n:"Brawling Headgear",t:16,d:"This headgear symbolises love. Love of war. Love of hearing your victims cry out in pain. Love of crushing those weaker than you. In short, the unconditional love that all Iops (whether by birth or conviction) have for battle with a capital " + "\"" + "B" + "\"" + " as in " + "\"" + "brawling" + "\"" + ". Romantic, isn\'t it?",ep:0,g:286,l:1,wd:false,fm:false,w:20,ce:true,p:1};
I[11748] = {n:"Bang up Cape",t:17,d:"Wearing a cape always does a bang up job of adding a classy â even heroic â touch to any look, don\'t you think? Well... except when you get your feet all tangled up in it or a gust of wind blows it over your head, that is. But, hey, fashion hurts. Make an effort!",ep:0,g:178,l:1,wd:false,fm:false,w:10,ce:true,p:1};
I[11749] = {n:"Bash up Shield",t:82,d:"Iops who know how to use their heads for than just bash ups will notice the nuances of this shield. It offers its owner protection, yes. But, thanks to its finely honed blades, it can also slice lousy pig sausage into perfect bite-sized bits. Clever...  As an added bash-up bonus, it\'ll give your enemies nasty booboos. ",ep:0,g:101,l:1,wd:false,fm:false,w:5,ce:true,p:1};

